						["IC"] = "70_inscription_deck_dominion",
						["TI"] = "[§] Bouncing Waters [§]",
						["TX"] = "Hapi is always on the move. Her tail swishes, her brow wiggles, and her lips part in a tiny-fanged smiles! Her body is totally alight with wonderful optimism, happy and willing to share it all around with everyone who speaks with her - or that she speaks to. ",
