			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Rain:512:128}\n\n\n{h2:c}{icon:pet_type_water:25}{col:5cbbff}<l The Crihmis Triplets l>{/col}{icon:pet_type_water:25}{/h2}\n\n\n{p:c}{col:5cbbff}============================================================{/col}{/p}\n\n{h3}{col:ff5850}\"Innocent are the sands...\"{/col}{/h3}\n\n{img:Interface\\ACHIEVEMENTFRAME\\UI-Achievement-Bling:128:128}\n\n{h3:r}{col:ff5850}\"... That burn our feet..\"{/col}{/h3}\n\n{p:c}{col:5cbbff}============================================================{/col}{/p}\n\n\n{h2:c}{icon:pet_type_water:25}{col:ff5850}<l The Dancing Waters l>{/col}{icon:pet_type_water:25}{/h2}\n\n{p:c}{link*https://imgur.com/a/pwg2Av9*!Hapi's Art!}{/p}\n\n{p:c}{col:5cbbff} Despite the soft childlike displays that Hapi seemed prominent to enact on a daily and nightly basis, there was much to find in the ways of attraction past the dips, curves, and tonings of her body. The beige fur, softer than the silk she buried herself in, flickering in the light to give a more highlighted display to the brilliancy of pink warbling around her irises, gentle hues of cyan blue waters playfully dancing across the glassy orbs they belonged in - a playground of infinite cosmos locked inside of almond-shaped, black lined eyes of cherubic countenance. Her lips held the same lined features, a soft and smooth snout curving in a feminine manner to the black nose that so many had been a victim of nuzzling from. Such slender and delicate features only added to just how well her large ears added, the whitish fluff that puffed out from them a direct and perfect contrast to the darker lining of her skin. And yet, should one look hard enough, the skin on her pelt was indented ever so lightly above her left eye - a scar, forever a reminder of both her abuse and her past. \n\nHapi struts the lands with a smile on her face, no matter the time of day. Her attention often varied from person to person, but the universal constant of Hapi was that she was always ready to deliver the happiest and most delicately lined smiles ever given - no matter the reason. Waters swirled around the glassy orbs, pink irises a portal into the world of the Elements that sang around her. Her hips swayed and bounced with her movements, in a constant dance to the song that the Elements blessed her with. She was content to flash a happy wink and ask whoever she was closest to to come dance with her.\n\nOften times, Hapi is seen with a guardian. Whether this be Muhri, her sister, or Oshi, her brother - or another trusted member of her caravan - Hapi was well-tended. These guardians tended to be fiercely protective of the little Vulpera, and with fine reasoning. Her innocence and cherubic countenance often times landed her in a situation befitting someone of a more skilled caliber, and Hapi herself certainly did not fit witihin that catagory. Her guardians, however, did. They keep a -very- watchful eye on her, making sure that nothing and nobody gets their hands on her. She seems to adore their presence.\n\nHigher, slim cheekbones held the peak as her smooth and slender snout met down to her well-rounded chin. Black-lined lips over her muzzle, shaped and smooth, colored and shaded to add onto the girl's sandy beige fur, these lips were simply another great addition to such a blessed face. Leading up to her well-proportioned cheeks and up, were her eyes, alive with emotion and extremely animated, Hapi’s large eyes expressed how she was feeling before words even left her lips. They bounced and pulsed with elemental energies at all times, ranging from droplets of wonderous cyan leaving her irises to a dormant shimmer and dance of water glimmering around her large orbs.\n\nHer body was in great shape. Legs finely toned with lean muscle met a slender shape, meeting up to graze up to her large, round hips. Being slender and curved more towards complimenting her rear, this was her greatest 'asset', as it were. Her hips met dipping curves on the girl's sides, leading up her body to a generously sized chest, perfectly shaped and rounded to a robust and attractive form. It seemed obvious that Hapi was the pinnacle of a genetic lottery, although her body was well-proportioned in a way as to not make it overwhelming. She held the grace and piquant of a dancer, one who spent her time freely wiggling in the hours, bringing the rains with each swing of her well-rounded hips. Her midriff was delighted and blessed with a serendipitous curvaceous renature, connecting the bubbled and sublime hips to the twin baubles hoisted upon her small frame. Despite being very short, even for a Vulpera, Hapi's body was beyond developed, honed and toned from years of her dancing and elemental craft. Her chest formed well in any of her clothing that tightly snuggled along her proportioned, light, and supple shape. Her fur was angelically soft, blessedly settling over the canvas of her pelt in wonderful tufts and holding grips. Despite her rather sinful form, Hapi is the exact opposite of what most hope for, and is a chaste pure little bean that truly only seeks love in the form of friendship.\n\nHer personality was one easily read. Open, blunt, cheerful and giggly, she's most commonly referred to as 'cute' or 'adorable' by how bouncy she was. High energy  almost all of the time, completely engulfed in the joy of simply being alive... not too good at being able to switch into an attitude of stoicism when the situation needed. {/col}{/p}\n\n\n{p:c}{col:5cbbff}============================================================{/col}{/p}\n\n\n",
