				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Fae Nightmare",
						["TX"] = "Illidari binding and an encounter with consumed anima alongside the Night Fae combine into a form reminiscent of both factions. She bears a resistance to the fel used in her homemade war paints worn regularly, devil and ram horns, a thin veneer of tawny fuzz on her ears' backs, lilac felflames filling empty eye sockets, mood dependent glitter'd and glowing freckles across her body, fae wings that tend to remain concealed within her back, long chitinous claws on hand and foot, and a long flexible tail with furred tip.\n\nAs with all Illidari, she possesses a more horrific form that maintains the same influences. Metamorphosed, she bears a fifth horn jutting from her forehead, a persistent anima glow in runes along all of her horns, fae-like antennae and ears, chitinous growths along her skin that act as armor, voided eye sockets, wings that cannot be concealed at both back and hips, fel-tinged spines along her tail, fetlocked hooves, and glowing runes of fel along various parts of her skin.",
						["IC"] = "ability_ardenweald_demonhunter",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Glitzy",
						["TX"] = "At all times she's wearing some form of glamorous accessories, usually made of either gold or platinum and bearing precious gemstones. These accessories tend to be on her tail, ankle, ram horns, and fingers.\nShe always wears a pair of engineered silver dog tags that function as both her comm radio and a two way tracking device.\nMost often she is wearing small crystals on her forehead between her brows, which serve as a foci for her use of anima.\n",
						["IC"] = "inv_ring_ardenweald_02_light",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Homemade",
						["TX"] = "All of her clothes are made by her hand, including her few leather armors. Her plate is specifically made for her by a friend to help channel anima and rift energies through it.\nHer attire is always form-fitting and flexible to accommodate her style of close-quarters melee, but is also decorative and telling of her social status.\nWhen she does not plan to be in combat, she's likely to be seen in more revealing attires that accommodate her naturally increased body heat.",
						["IC"] = "inv_chest_armor_ardenwealdcosmetic_d_01",
					},
					["5"] = {
						["IC"] = "ability_ardenweald_deathknight",
						["TI"] = "Broker Agent",
						["TX"] = "Bunny bears a sigil that represents her affiliations with both the Ba and Ta cartels, which usually hangs from her belt or neck and is easily noticeable by other agents or cartel members. Her circular sigil is made of gold dry-brushed elethium, and stamped with a jackalope's facial profile and her surname on the front side, and a waxing crescent moon on the back with a star between the points.\n\nAnother tell-tale sign of her affiliation is the ability said sigil aides in to create rifts of varying sizes with varying waypoint possibilities that bear scaling tolls taxed on her physicality.",
						["AC"] = true,
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Armed",
						["TX"] = "She is always armed, even if it doesn't appear so. Aside from her main weaponry, which varies on occasion, she always has a dagger strapped to her left thigh and a smaller knife on her right ankle.\nHer arsenal is heavily varied, though her proficiency with some weaponry is still fairly novice.\n\nStaves: Proficient in physical use and technological channeling of capabilities.\nDaggers: Proficient in close quarters.\nSwords: Proficient.\nWarglaives: Extremely proficient, favored melee and ranged weapons.\nShields: Semi-proficient dependent on shield size.\nBow & Arrow: Novice, learning.\nGun: Novice, learning.",
						["IC"] = "inv_staff_2h_ardenweald_d_02",
					},
				},
				["v"] = 36,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h3:c}Important Physical Points:{/h3}\n{p:c}{col:ffffff}‡ Two pairs of horns, one small and devilish, one ram-like that almost touches tips to her cheeks.\n‡ Six foot long tail with fleshy length and thick tuft of fur at the tip. Fully flexible.\n‡ Lilac felflame 'eyes'.\n‡ Fae wings that usually remain concealed within her back.\n‡ Long chitinous claws on fingers and toes. No shoes cover her toes unless otherwise stated.\n‡ Hair gradually changes with the seasons; always has blonde streak on left side. Has flowers / leaves / snowflakes naturally ih her hair dependent on season.{/col}\n{link*https://imgur.com/a/kFZUCgW*SFW Art References!}\n{/p}\n\n{h3:c}Important Notes:{/h3}\n{p:c}{col:ffffff}‡ Firebrand Lieutenant: Employed as the second in command of Firebrand Trust's security branch, and maintaining duties for other branches, grants her the title of 'Lieutenant' to Captain Ishbaneer Schatten.\n‡ Broker Agent: She uses some Broker technologies and has allegiances to the Ba and Ta cartels. She has been to Tazavesh under friendly conditions.\n‡ Former Noble: While still maintaining her 'Lady' title, her family's name has been wiped out and she is the only remaining member. Her noble bloodline, current occupations, and general thriftiness in most situations has granted her a substantial amount of wealth.\n‡ Technology, Not Magic: She has had no formal training in any traditional magicks, but can utilize some fel spells thanks to her Illidari training. Her ability to open rifts comes entirely from her training under the Brokers as a corporeal, mortal agent.\n‡ Illidan Loyalist: Though she believes there is no current need for Illidari due to the lack of Legion presence, she maintains loyalty to her first master and would not hesitate to rise up with him again.{/col}\n{/p}\n\n{h3:c}OoC Notes:{/h3}\n{p:c}{col:ffffff}I'm 27 years old & genderflux. I have nearing 15 years of roleplay experience. I struggle with lore constantly, but try my best to remain within its natural flexibility. No ERP outside of her relationship with her boyfriend; thirst whispers are immediately blocked. All other themes welcome, with discussion and with players over age 21. NSFW art available on request; I've removed the Rick Roll.{/col}\n{/p}\n\n{img:Interface\\Garrison\\ShadowlandsMissionLandingPageBackgroundNightFae:256:256}",
