			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1:c}{col:00caff}Who Is Rixxa?{/col}{/h1}\n\nA traveler, a caring friend, a wild card. Rixxa is all these things and more. She's always on watch for things that lurk in the shadows and go bump in the night. From the looks of her, it would appear she has seen more than she'd care to admit, but she remains steadfast.\n\n She often comes off as goofy, maybe even a little out of her mind, but those who pay close enough attention can tell that she usually has reasons for what she does.",
						["BK"] = 9,
						["IC"] = "ability_mage_massinvisibility",
					}, -- [1]
					{
						["TX"] = "{h1:c}{col:81ff9a}Her Weapons, Tools, and Skills{/col}{/h1}\n\nRixxa's skills are akin to a shaman's but her magics are less reliant on pacts with elementals. She has studied how to use the planet's leylines to produce rune based magics and elemental arts akin to a mage, though not as quite extreme in power as such.\n\nSimply because she isn't as reliant on elementals, doesn't mean she hasn't made any pacts. She calls on them to enhance her other elemental abilities, and on occasion calls for the aid of a rock elemental she dubs 'Rocky' much to it's dismay.\n\nRixxa is also a fairly accomplished alchemist and mixes up all kinds of potions and tonics that can be useful. Her own personal mixture is a drug called 'Anti-Out' which acts like a hyper adrenaline shot, increasing energy, keeping one awake and alert, and works well for hangovers as well! However, open wounds will lead to one bleeding out faster.\n\nShe is resourceful, often using the environment to her advantage and adapting life experiences into tools that can aid her, in combat or otherwise. One such 'tool' is a bag of extremely spicey, hot pepper powder, that she will use when someone needs a good roasting.\n\nAs a goblin, Rixxa has at least a decent understanding of technology, even if she doesn't tinker much herself. She has purchased a Sky Golem that she can call upon to get around, or help her mess someone up in a pinch.\n\nWhile she does use magic, Rixxa was a bruiser for the Bilgewater Cartel for time. As such, she is a well acomplished physical fighter who is not afraid to bust a few knees.",
						["BK"] = 12,
						["IC"] = "boss_odunrunes_blue",
					}, -- [2]
				},
				["BK"] = 1,
				["TE"] = 2,
				["v"] = 19,
			},
