				["PE"] = {
					["1"] = {
						["IC"] = "RACIAL_TROLL_BERSERK",
						["TI"] = "Savage",
						["TX"] = "The troll is ,while surprisingly adaptable, clearly an outsider sliding into things rather than a civilized member of the Horde. He views life with a Hunter's eye:Predator and Prey, survival, co-operation amongst a Pack, and violence against outsiders or enemies. He seems to have his impulses reined in, but they are not subdued entirely.",
