					["3"] = {
						["AC"] = true,
						["TI"] = "Cunning and Genial",
						["TX"] = "The Troll seems to have a strangely contradictary manner around others: he can be genial, polite enough (in a roughneck sort of fashion) and even charming. However he tends to also be quick to judgements and classify others by his own possibly archaic standards. He can be open minded and welcoming to members of the Horde, while still managing to hold stereotypes and chauvanistic views tempered slightly , but shamelessly kept to heart nonetheless.Tends not to respect personal space or worry about impropriety.",
