			["about"] = {
				["T1"] = {
					["TX"] = "{h2:c}Spirit of the Sirocco{/h2}\n\nClad in ornate robes of deep red, and equipped with enchanted blades, tomes and pouches of reagents, this young Goblin likely telegraphs her profession before one even bothers getting to know her. There is a certain, unmistakable quality about her, reminiscent of the dry winds and blistering heat of her home in the deserts of Tanaris, which ultimately give her away, combined with her garb and scholarly demeanor, as a mage.\n\nAnd looking closer, all of the dry heat and smoke, the blackened fingertips and singed hems of her clothing taken into account clarify her role further as that of a Pyromancer.\n\nShe was young for certain, maybe in her early twenties, with sharp red eyes, a slightly bulbous nose and full lips. Her violet hair was kept in a hastily tied ponytail, with lengths and tresses tucked behind short, pointed ears.\n\nShe carried a single edged sword at her belt, and often some sort of enchanted trinket or bauble to compliment it. She wore a satchel slung around her torso which stank of pungent herbs and odd magical reagents. Lastly, she was followed behind, by an enchanted tome, which flapped around behind her like an odd bird. The pages contained illegible, shifting words and letters, and belched smoke and sparks as it flitted about.",
