				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-paladin-cover:256:256}\n{h1:c}{col:8adeff}A Physical Description{/col}{/h1}\n{p:c}Physical Appearance:  From stalwart warrior to diminished cripple, Artomius has endured a range of physical states over the past couple of years. Now, however, the man has returned to what he once was before being held as a tortured captive. To bare his heavy plate armor and wield the weapons he was most accustomed to once more, the man has regained what muscle he had lost and is back to being rather bulky for an elf. As what might seem to be the usual for him, the paladin takes on a constantly dour expression that seemed to be always brooding over something or another. Though, a touch of softness might be found twinkling in his now glowing gold eyes. Both his hair and full beard were of a pale blonde that most may guess had been striking during his younger centuries, but the passage of time and a turmoil of events have left it lacking in luster. \n\nThe paladin sports a multitude of scars accumulated throughout his lengthy military career as well as personal endeavors. While the scars vary from the mundane nicks to wide cuts, the most prominent one would be the jagged scar running down the length of the left side of his body with the scar tissue beginning just above his left eye and ending somewhere on his left thigh. Though his body would have to be exposed to see that along with a majority of the little nicks and cuts. Besides the scars, the elf now has two new additions to his list of past injuries that have left a mark upon his form. Or rather, the lack of. The male’s right ear has been cut in half horizontally and seems to have been topped with a piece of metal to hide the skin’s potential deformity and the paladin’s left arm had been completely severed at the shoulder.{/p}\n\n{link*https://cdn.discordapp.com/attachments/655261742309441555/672815547632582670/Illustration133_2.png*Art of Art!} Art done by @rustfuse on Twitter!\n\n{p:c}Armaments of War: Given his chosen position in the frontlines of war or battle of any sort, the paladin takes to equipping himself in the heavier forms of armor, mostly of matching plate and chainmail that allow him to be protected from the larger varieties of danger. His commonly chosen set was not as regal or ornamental as many other elven warriors might choose, but it did not mean that there wasn’t some semblance of his race’s heritage amidst the design of his breastplate at least where his house’s crest of a crow was engraved. On occasion, the elf takes to adorning a light robe over his chosen regalia or simply a light kilt that billows out from his belt. In an even rarer instance, he will take to forgoing both robes and kilt, instead vouching for a heavy cloak to cover his armored frame. As for weapon of choice, the elf’s experience with war has allowed him to bring all manner of weapons to the battlefield, but he is most commonly found wielding a sword of sorts in battle.{/p}\n\n{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\n{h1:c}{col:ac5614}Common Inventory:{/col}{/h1}\n{h3}-Regalia of the Reforged\n-Blades of the Fallen House\n-Libram of the Reforged\n-A tight coin purse (Visible)\n-An odd coin (Hidden)\n-A waterskin (Visible)\n-Enchanted Flask (Partially Hidden){/h3}\n\n{h2}OOC Notes:{/h2}\n\n{h3}May know Art via:\n-Veterans of the Second or Third War.\n-Having the faint recollection of a fallen house amongst Silvermoon's nobility (Kor'serrar being the original name).\n-Knights of the Silver Hand or fellow Light wielders associated within the order. (No previous association w/ Blood Knights until the unification of the Silver Hand. After split, perhaps some then.)\n-Northrend Campaign against the Lich King via the Argent Crusade\n-Fights against the Twilight's Hammer in the Highlands\n-Being amongst the initial forces that assaulted the Broken Shore.\n-Assisting in the campaign on Argus.\n-His brief assignment as a lieutenant amongst the Horde forces in the Blood War.\n-Other Argent members who have heeded the call of duty once more.\n-Or by simply coming across the elf while traveling about inbetween any of these events. Want to set something up? Just ask! Let's work something out :D{/h3}\n\nCharacter's Date of Birth (removed from records): 5/22\n\n",
				},
