				["TE"] = 1,
				["T1"] = {
					["TX"] = "About Zarshal Blackburne: \n\nProfessions and Companions: \n\n- He mostly is an Alchemist, Sometimes he goes out of the city to either explore or to get Plants for his potion and other supplies.\n\n- Zarshal sometimes ride around with his steed Luna, Mainly for flying around places or just to wander around with her. Bingo is at his side usually around Stormwind.\n\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-HYJALPAST:256:128}\n\nBackstory of Zarshal:\n\n- Zarshal was born in Gilneas City when he was younger, But he wanted to explore the world when he gets older, See what the world has to offer for him.\n \n- For now, His parents taught him some training. Starting with Combat. Zarshal was told how to fight when he was 10 years old. Fighting against a target dummy made of wood planks, Using a wooden sword. It happened for two weeks. He has to know combat before anything. His parents then taught him survival, then after it's all done, Training taught and such. His parents decide to do fishing. Selling fish to the local travelers who visits Gilneas city and citizens of the city. He then was living out with his family for a while, For the rest of the days he has.\n\n- It was all peace and quiet until the forsaken attacked the city of Gilneas City, Which was at the age of 15. Luckily he was taught how to defend himself and his family gave him 50 gold before the attack happened, But he knew fighting forsakened would be dangerous, So he just ran out of the city, Hoping to find a better city that he calls 'home'. He traveled for a week, Staying on the road where it's more safer. As he was traveling, He was living off eating Bread and drinking water he bought from the local travelers. He then found a city with walls, Zarshal was happy to find this. A city with walls and guards patrolling around is a better place for him. He then walked inside the city. He's in a better home now. After a few years, Zarshal decided to help a few people out, See what he can do to help. He lived his life now as a wandering Alchemist now, Partly being a Scout. He knew it would come in handy in some ocassions.",
