			["about"] = {
				["T1"] = {
					["TX"] = "{h1}Currently{/h1}\nHis job a the library has now made keychains mascots of him for alll the childern he teaches to have a Kamille of their own to take home.\n\n\n\n{h1}Backstory{/h1}\nKicked out of his last caravan for being a spineless wimp, he assumed. His memories are blurred between two different caravans. He's not real fond of the idea of becoming part of one again. Upon hearing the Vulpera joined the Horde he made his way to Orgimmar. Only to end up moving to Silvermoon City after several months attracted to the amount of books there.\nHe will read just about anything. Whether or not he comprehends what he reads is in question. This love of reading has been noticed by several other Sin'dorei and was offered a job.  He accepted and now is 'The Storytime Fox' for the kids in the library. Most of the children assume that he is an enchanted animal mascot for the library.  Gotten found of butterflies.\n    \nIt was suggested that he dress better to fit in the city. Having gotten used to such robes, his people's traditional garb is strange to him. Isn't entirely sure why everyone thinks he is a priest though.\n\nExtremely naive and taking most things people say to be the total truth. He keeps a good attitude about things, when he isn't on the run from things. He finds taller races interesting, willing to risk his tail being stepped on to talk to them. When surrounded by his friends, he gets a little cocky. Often not sure what personal boundaries are with his friends. Its rare to see his cowardice among his friends. \n\nYears of undernourishment from his bad caravan life has left him on the scrawnier side. Moving to Silvermoon has given him more food access but he still hardly eats. Still preferring the fruits and bugs of his previous life to the heavier foods.  His fur is dark grey and near white of standard pattern. Most of his fur unusually plush, with his tail looking like it belongs to something of bigger proportions. Keeps most his thinner side hidden with fanciful robes topped with a matching hat. Recently has dabbled in excercise aim to stregthen up some.\n\nCurrently sleeps in a large basket a tailor shop. The owner keeps sewing new outfits for him to wear. Along with a almost never ending supply of shampoo. If he thought about it hard enough, he might realize he was being treated like a pet.\n\nHe often speaks in third person. More practice lines will usually have him speak in first. He will get your name wrong the first few times. Maybe even forever. Knows several parlor tricks that has helped him avoid being eaten while living in the desert by larger animals. His extreme flexibility is a surprise to most.\nHas taken an interest in the healing arts. Slowly being trained by the priests at Silvermoon. Though he doesnt seem able to grasp it firmly. Is more secure in non-magical methods of healing.\n\nUnsure of relationships. Having been burnt really bad in the past. This has ruined his self confidence when it comes to attracting someone. \n  \n{h2}Quirks{/h2}\nEasily gets crushes on males.\nLoves Books\nPampered\nSpeaks Thalassian ((Tongues))\nThose trained in the Light may notice butterflies sitting on his hat or ears.\n\n{h3}Etc.{/h3}\n\nNotes on his Caretaker Mooncraver:\nSindorei Tailor whose childern have all growned up. Sees Kamille as a pet and subistute child.\n\n\nCharacter Art:\n{link*https://tinyurl.com/yuta7e7c*Floating Around}\n{link*https://tinyurl.com/ycpgjgv6*Kamille's First Date}\n{link*https://tinyurl.com/y7hw5yec*Kamille's Butterfly}\n{link*https://tinyurl.com/4n6huk7h *Puppy Eyes}\n\nLooking for artwork? Commisions Open.\n{link*https://twitter.com/Hokshi_Tiger*Twiiter}\n{link*https://www.furaffinity.net/user/hokshi/*FA}\n",
				},
