				["TE"] = 1,
				["T1"] = {
					["TX"] = "\"He who says violence solves nothing never won a fight.\"\n\nWhen the caravan needs safety, it's the guardians they call upon. Aisi was raised to be one such Vulpera thanks to her feisty attitude and never one to turn down a fight when she was a kit, always trying to prove herself better than the next. As she grew older and was trained by the caravan's guardians, however, that unbridled fury was tempered and restrained, to be deployed when the safety of her family was at stake. That fury is what earned her the nickname Sandstorm, for any who got caught in the crosshairs of her ire were subsequently beaten and left to the dunes as her namesake left its own victims.\n\n(( It's a WIP so things will be added when I'm not lazy af I don't think people actually read these things anyway ))\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-89:64:64}\n",
