					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Runt",
						["TX"] = "Zerrahki is very tiny for one of her kind, both in height and weight. She still tends to stand over most of Azeroth's other races.",
						["IC"] = "inv_pet_cats_bombaycat",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Skittish",
						["TX"] = "She is very skittish and would probably even jump at the sight of her own shadow.",
						["IC"] = "ability_druid_cower",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Heterochromia",
						["TX"] = "She has Heterochromia; Her left eye is blue and her right eye is green.",
						["IC"] = "trade_archaeology_catstatueemeraldeyes",
					},
				},
				["v"] = 27,
			},
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "The first thing most people will notice is how tiny Zerrahki is. She stands far below other members of her race and she's far skinnier and more lithe than one would expect. Most of her druid forms tend to take on this same shape, leaning towards mobility more than anything else.\n\nThe other thing people tend to notice quickly are Zerrahki's eyes. Her left eye is a light, almost sky blue and her right eye is a darker green. Moving down to her left cheek is a long scar that extends down to her chin where a tuft of fur is missing.\n\nShe tends to don herself in mostly druidic garbs and always has some kind of potions on the belt around her waist, giving off the impression that she has some passing knowledge in alchemy.\n\n{link*tinyurl.com/Zerrabust*Appearance} (( Art done by the -fantastic- Ushi/Bowno! ))\n{link*tinyurl.com/zerraheadshot2*Cat Form} ((Art done by Peritha/Mamuemu!))\n{link*https://i.imgur.com/vmtd0da.jpg*Zerra & Catbuns} (( Art done by Fabcrab! ))\n{link*tinyurl.com/Bluecatslimes*Zerra & Slimecats} (( Art done by Ein! ))\n{link*https://twitter.com/Zerrahki*My twitter!}\n",
						["BK"] = 9,
					},
					["PS"] = {
						["TX"] = "- She is a very caring individual. She will do everything she can to help someone that is wounded or needs it.\n\n- She's very skittish. It doesn't take much to make her jump. Sneaking up on her will likely cause her to leap and give her laboured breaths.\n\n- Due to her caring nature, she also tends to be quite gullible. People with a silver tongue could trick her easily.\n\n- She has a bit of a stutter where she tends to repeat words multiple times, especially when she's nervous.\n\n- She's fiercely protective of the planet and will go out of her way to heal damage to it. She would never push her ideals on another, but if those ideals came under attack, it'd be one of the few times someone would see her angry.\n\n- She loves to joke around! Don't be surprised if she teases you a bit, especially when she gets close.\n\n- Flirting goes right over her head and if it doesn't, she'll likely try to shut it down or change the subject.\n\n- She is a shiny addict! Watch your pockets around this one.\n\n- She doesn't handle her booze well. It takes hardly anything to get her tipsy and it comes with some rather extreme personality changes.\n\n",
						["BK"] = 9,
					},
					["HI"] = {
						["TX"] = "Zerrahki keeps her history guarded. The easiest things to find out is that she's a druid and she's an alchemist. She might be willing to share some of her past with people she trusts.\n\n(( - Extra Notes: Zerrahki cannot speak in druidic forms, only emote. Trying to speak will cause her to lose the form.\n\nShe does prefer cat form for very casual things and loves the increased mobility.\n\nCombat isn't her thing and she'll likely try to flee if threatened with bodily harm or worse. It isn't difficult to take her down.\n\nAll of this aside, I have no problem with and welcome character conflict, even if that means injury, combat or whatever else! ))",
						["BK"] = 9,
					},
				},
