				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-BUrntEarth:700:150}\n\n{h1:c}{col:FF7F00}Appearance{/h1}{/col}\n{col:FFFFFF}Corvalos is obviously fit for battle, as any Illidari might be, boasting a mix of both strength and agility. His frame is littered with battle scars, dull cinders illuminated against his deathly pale skin, dark tattoos remaining black and dull unless in the midst of battle or when his emtions run high, when they start to burn with a fiery light. His hair is likewise pale in tone, pulled back into a fairly messy tail.\n\nHis voice is an inviting baritone, a set of prominent fangs seen between his lips whenever he spoke. He didn't seem to be the fidgety sort, standing with a still confidence that comes with an age that can easily be seen as an elf in his prime.\n\nHis attire is a mix of dull crimsons and blackened metals, appearing to be about as utilitarian as a demon hunter might get. A set of skull decorated sword hilts sit at his sides, cold and dark until drawn, when they ignite into flaming scimitar blades, a dark profanity about them.{/col}\n\n{img:Interface\\Pictures\\artifactbook-demonhunter-twinbladesofthedeceiver:512:256}\n",
