			["misc"] = {
				["PE"] = {
					["1"] = {
						["IC"] = "warrior_skullbanner",
						["TI"] = "Freelance?",
						["AC"] = true,
						["TX"] = "Save for the intrinsic affiliation with the Horde, the orc wears little to display loyalty to other factions openly. It'd be safe to assume she's for hire.\n\n\"Remaining amicable with any potential employers is profitable. Save for the person whose face you're being paid to rearrange, of course.\"\n",
					},
					["4"] = {
						["IC"] = "inv_misc_bone_skull_03",
						["TI"] = "Erratic",
						["AC"] = false,
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Excess Esurience",
						["IC"] = "inv_misc_food_legion_heartyfeast",
						["TX"] = "To put it bluntly, Rhakara is on the heavier side for an orc. An otherwise ravenous propensity for feasting has left its mark on the warrior, namely a few dozen extra pounds in her absence from the battlefield. Oh, and a few inches thicker around the middle. Those girdles aren't likely to get much looser.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Visage",
						["IC"] = "inv_helm_laughingskull_01",
						["TX"] = "When analyzing what can be seen of this orc's face, it's probably just as apt to say there's not much visible. The typical Laughing Skull facial adornment makes for an intimidating headdress as well as a solid facilitator of anonymity.\n\n\"Am I certain what animal this skull is from? No. Does that undermine its importance? Also no.\"\n",
					},
				},
				["ST"] = {
					["1"] = 0,
					["3"] = 0,
					["2"] = 0,
					["5"] = 0,
					["4"] = 0,
					["6"] = 1,
				},
				["v"] = 94,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sandstorm:512:96}\n{h3:c}{col:696969}Disdain{/h3}\n{col:696969} (n.) a feeling of contempt for someone or something regarded as unworthy or inferior; scorn.\n\n\n{h3:c}{col:9a6d55}D E S C R I P T I O N {/h3}\n{col:9a6d55}It's difficult to contest the fact that orcs are a race predominantly built for war; this one hardly seems like an exception to such a statement. Both stature and form only further prove that she's an exemplar of this adage.\n\nBroad shoulders trail down to a pair of burly arms that appear capable of moving mountains, though the rest of the orc's form suggests she doesn't do all that much moving around herself. That plated girdle remains tightly cinched against a burgeoning midriff, monolithic legs forming a solid foundation for the assailant's stance. For as irresilient as it may make her appear, the notion of conflict being something foreign to her is assuredly false.\n\nThe maw of the orc's mask similarly belied little sympathy, an adaptation of her untainted kinsmen's headdresses. What little could be seen included a toothy grin behind the fossilized incisors; a menacing pair of amber eyes made that piercing gaze known from beneath.\n\n{h3:c}{col:9a6d55}H O O K S {/h3}\n{col:9a6d55}Your character might recognize Rhakara from:\n\n—Combat on the Broken Shore.\n\n—(Most) Fourth War battles; chiefly the defense of Dazar'alor.\n\n—Enlisting her services in the past, including protection and debt collection. She's on retainer for the Steamwheedle Cartel and has posters advertising such in most of their outposts.\n\n{col:9a6d55}",
				},
				["BK"] = 3,
				["TE"] = 1,
				["v"] = 83,
			},
		},
		["0831193414FW4Bx"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Heavily Scarred",
						["TX"] = "Khan'gar bore across the entirety of his body a series of scars, most of which appeared to have been inflicted across his backside by a whip of some sort. The numbered far greater than what would be expected of an Orc as young as him.",
						["IC"] = "ability_xavius_tormentingswipe",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Warsong Orc",
						["TX"] = "Whith Khan'gar's parents having been slain in his youth, he'd been raised by a select few Warson Orcs in Duortar. It was among them he completed his trials and earned the status of \"Wolfrider\". Currently, he seeks to rejoin and honor more members of his clan and their traditions. Recently, Khan'gar completed the trials of adulthood, taming a wolf of his own.",
						["IC"] = "inv_archaeology_orcclans_warsongpike",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Thera'gor",
						["TX"] = "Slung across his back sat an ancient Orcish runeaxe that was thought to be lost in a tomb until only recently. Khan'gar takes claim to the feat of it's retrieval.  Enchanted with elemental energies that would be unstable to use for any unskilled, it likely once belonged to a powerful Shaman.",
						["IC"] = "inv_axe_102",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Cold-Weather Plate",
						["TX"] = "Khan'gar dons traditional Horde military garb, though with several appointments made for duty in extreme weather conditions. They included but were not limited to things such as insulated gloves, boots, and a thick Kodo hide hooded cloak. All throughout his armor could be seen runes he'd carved himself of various Warsong meaning.",
						["IC"] = "inv_helm_plate_raiddeathknight_p_01",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Bane of the Ogres",
						["TX"] = "After spending a considerable chunk of his life enslaved by Ogres, Khan'gar has developed a particular hatred for them. He's begun hunting them, carrying a series of Ogre horns on a small cable on his hip.",
