			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}{col:ff2b19}Early Life{/col}{/h2}{img:Interface\\Pictures\\11733_blackrock_256:256:256}\n\n   {col:ffad68}Khan'gar's parents were among relatively few Warsong clan members who actually recieved the call from then Warchief Orgrim Doomhammer, making their way through the Dark Portal. As reinforcements in the Second War, they served alongside the other Orcish forces in the Burning Steppes at the foot of Blackrock Mountain, only to be met with defeat at the hands of the Grand Alliance. His parents would carry on to Kalimdor with their surviving kin, finding work guarding make-shift ports in Tanaris, aiding convoyers and shipping routes for the Horde in the North. All was well, and not long after Khan'gar was born. \n\nAt the age of 5, Ogre aggressors stormed the port, overrunning and slaughtering all, including the boy's parents-- leaving him orphaned. A mere child, the Ogres who organized the ambush swiftly apprehended Khan'gar and several other Orc refugees, selling them then to various slave owners scattered throughout Tanaris and the surrounding regions.\n\nKhan'gar would remain a slave, working in mines until the age of 14, when a wayward Horde patrol from a Northern territory known as Durotar came upon, and liberated the enslaved Orcs from the Ogre overlords.\n\nIt wasn't long after that, once identified as belonging to the Warsong clan, Khan'gar was sent to the Valley of Trials to make a full recovery, and begin his instruction under the Elders.{/col}\n\n\n{h2:c}{col:ff1411}Training and Placement{/col}{/h2}\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-OUTLAND:256:128}\n{col:ffa36c}Khan'gar's mentors early on found the boy to be largely reclusive, unwilling to interact with others. It was several years before the shock of his enslavement had begun to dull. All the while, Khan'gar demonstrated a higher than average intelligence, and a keen instinct for combat very much befitting of his status as a Warsong Orc. He was groomed from a very early juncture with one word in mind-- \"war\".\n\nHe would spend his days under the tutelage of his masters, recieving a series of tests and challenges that most would consider especially brutal. But, so they must be for an Orc to be effective in battle. His training finally reached it's conclusion at the age of 21, whereupon Khan'gar set out to complete his trials.\n\nAmong them, his first was to collect a heavy stone and carry it upon his back to the den of his enemy-- several small bands of Demons and consipirator summoners, where he carved through them with ease. A series of slayings including ferocious beasts, monsters, et cetera followed after. Customary to the Warsongs, he then sought to break a wolf of his own. He found a large pack, and engaged in battle with it's largest member, barely surviving the ordeal. Some time later, and with considerable coaxing, the wolf came to see him as it's master.\n\nWith this, his fellow Warsong deemed him \"Wolfrider\", and the young Orc's trials would be complete.{/col}\n\n\n{h2:c}{col:ff2011}Service to the Horde, the Fourth War{/col}{/h2}{img:Interface\\ARCHEOLOGY\\ArchRare-DraenorOrc:512:256}\n\nWIP WIP WIP\n\n",
