			["time"] = 1631081559,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "I see you’re checking me out. I’m tall and built, it pays to keep in shape both on and off duty. You won’t find any scars since my use of the Light takes care of that. You’ve got to take care of yourself, you only get one body. \n\nIf you see me in a city I’ll most likely be off duty or requisitioning supplies. That’s my time and I don’t have a need to go showing off any fancy armor. If the armor's on it's for a purpose.\n\nIf you need a reference look up Chuck Connors from The Rifleman. Just having to say that makes me feel old.\n",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "A random speech given to new men under his command.\n\n“Alright! Enough with the pleasantries, you know who I am. I don’t know and I don’t give a damn what other people have told you about me. You’re going to get it straight from me, I’m a fair man. If you treat me right… I’ll treat you right. Just like you I’ll be in the thick of things and I’m going to do my best and give it my all. That’s all I expect of you. If you don’t like the way I do things then speak up. I don’t need anybody going behind my back and trying to bend me over. We’re all stuck together so we might as well get along.”\n\nOn women\n\n“I’d say every man needs a woman who can go toe-to-toe with him verbally. Let’s face it, we’re pig-headed and sometimes we need help when viewing things. Used to call my wife ‘the bride of Ragnaros’ because she could be fire incarnate when I wouldn’t listen.”\n\nOn Orcs\n\n“Strong people with a strong culture. I’d be proud to stand side by side with them in battle. Let me command an army of Orcs and I can take every city on Azeroth. Let me command one Orc and he’ll make you give me that army.”\n\nOn Tauren\n\n“I’m ashamed I made a few beef jokes back when I was young and stupid. They give the appearance of gentleness, but you see then in battle and no word can describe their ferocity. Some of the most kind and hospitable people I’ve met.”\n\nOn Forsaken\n\n“They got the raw deal. I see one and I’m reminded of what happened to my home and people. Then I have to remind myself they had no choice. Even free they’re bound by all that negative energy, it’s not like they have much of a say in how they act.”\n\nOn Trolls\n\n“Good natured, good fighters, and I’ve seen them have a good time. To be honest, the accent makes it hard for me to know what they’re saying.”\n\nOn Goblins\n\n“Yeah, I’m a bit iffy on them. They can get whatever you need, if you don’t mind the price. Just saying ‘Hello’ to one makes me wonder if I’ll walk away with any money left.”\n\n",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Got a patrol to be on so I’ll make this quick.\n\nWas born, grew up, became a guardsman of Silvermoon, then a Blood Knight.\n\nAs for me being in Kalimdor… Okay.\n\nWound up with a new recruit, some snotty, privileged, arrogant Magister’s son. Thought he was hot shit, but I tell you right here right now, he was one of the WORST I ever had to deal with. For some reason daddy gave him the idea that rules don’t apply. So after a large amount of infractions I put the brat on guard duty. Check on him… He’s not there. Eventually found the son of a three-legged kodo in an inn. He’s in there bragging to the ladies about how’s on his way to being a captain and how great a Blood Knight he is.\n\nSo I grabbed the worthless piece of trash and proceed to beat him.\n\nAfter that favors were exchanged, hands shook, and bargains struck. All this behind closed doors and I wasn’t included. It wasn’t so much what I did as it was I did it in front of a crowd. So my punishment is a loss of rank, patrolling Kalimdor, and the twerp… At least he’s not a Blood Knight.\n\nAm I happy with the situation? No. I accept it though, especially if it keeps the runt away from ever being a Blood Knight.\n\nContinue to petition for reinstatement, See all these new threats and want to join the battles, I want to serve in a better capacity.\n\nDenied.\n\nSo that’s why I’m here. If you’re ever this way again bring some of that nice baked bread from Silvermoon. I miss it. \n\n(( You made it this far? Why hello there! I can very easily sum up Morothane in two words: John Wayne. ))\n",
						["BK"] = 1,
					},
