					["TX"] = "{link*https://imgur.com/a/OiryZ7B*ART!}\n\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-94:64:64}{h2:c}{col:2aba24}Tight leathers clung to his abdominal. His tunic was skin tight, to the point his carved abdominals would easily outline through his leathers. Pumped biceps squeezed at the fabric sleeves that left little to the imagination.  Green Fel hues sprouted from his attire, from the pauldrons that held a swishing goo. To the collar that also served as a mask. Should one dare touch the glowing extensions of his person, they would be quick to find themselves scared and burned. Should the pauldrons vials break? The liquid once in contact with air emits a disgusting poison riddled gas. That also serves as the last option for retreat. Along his belt, one would notice firearms. Six, however, they are no longer the flintlocks he used in the past. Rather improved. Through chaotic design, they now mirror his very being. Extensions of the very corruption that once plighted the planet. A shot from anyone could easily scar, sever, burn, and incinerate any unlucky enough soul. Should the need arise. He also carries with him tainted sickles that will sear away flesh and steel. Due to chemical reaction anything else will combust whatever remains of his foe, to dust.{/col}{/h2}\n\n\n\n(Ask for NSFW)",
