						["IC"] = "spell_shaman_ancestralawakening",
						["TX"] = "The mysterious figure in front of you is a Sin’dorei of towering height and terrifying build upon further inspection one would help but notice, one the eye patch that covered his right hue. Then secondly how burly his figure was, wrapped and hidden away under skin-tight leather are muscles carved from stone. Which would be the simplest description of his sturdy disposition, broad shoulders, thick arms, even washboarded abdominals that appealed with a natural V shaped-body type. \n",
