						["TI"] = "IV.",
						["IC"] = "spell_fire_felflamering",
						["TX"] = "Hanging just under his collar was a necklace. Golden crust decorated it's outline, the inner circle of the gem seemed to be just as intense as a blazing Fel flame, the crystal even glowed emerald to match. On one hand is a silver-ring with an image of a one eyed grinning fox, a gem serving at it's lone working eye. On the other hand is another silver ring, however this ring has a snake coiled around the fox. However the pair don’t seem to be in conflict, rather they seem to be ready to strike whatever is front of them. In his a silver pocket watch, with the same markings of the grinning fox and the coiled snake. Clearly high craftsmanship. Those sensitive to magic could tell they were enchanted. ",
