			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Rain:700:200}\n{h1:c}{col:3B957D}Appearance{/col}{/h1}\n\nScruffy would be an apt way to describe this man. A constant stubble ornaments his statuesque jawline, his lips soft and full with subtle laugh lines that frame the corners of his mouth. His eyes are a dark teal color, dancing closely to appearing blue, showing a minimal level of fel corruption in him.\n\nHis body is toned, a lean physique chiseled from years of a healthy and challenging lifestyle. Were one to get him out of his clothing, his body held some scars from wars past: typically small cuts or arrow wounds that have left their mark, though he was no stranger to being on the receiving end of a blade. His right arm masks some of these with an elaborate tattoo of water flowing down a river, surrounded by various flowers from all around Azeroth. It covers his entire right arm and his pectoral, where a whirlpool is inked into his skin.\n\nHis voice holds a soft rumble to its tenor, his tone often hushed and husky when speaking one on one with someone. His hands often move as well, gesticulating as he speaks. He never shies away from darker or risque topics or debate, more than willing to dive headlong into deep conversation.\n\n{h3:c}Hooks{/h3}\nValadrin may have been seen in port towns or cities, particularly Booty Bay, where his permanent home is. His most frequent haunts are Silvermoon, Suramar, Uldum, Tanaris, Zuldazar, Orgrimmar, and Ratchet. He's likely garnered a reputation for being a smooth-talker, but a reliable and (mostly) legitimate business partner and information broker (aka, paid gossip) for anyone willing to do business. For business he doesn't do, he can point people in the right direction. He may also be known in some circles as a good painter and orator.\n\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:250:50}",
