		["0801010716okSww"] = {
			["character"] = {
				["CO"] = "Novice RP'er, so I apologize if I'm a little clumsy.\n23 years old and open to all themes.\nReally appreciates walk-ups\n",
				["RP"] = 1,
				["v"] = 33,
				["XP"] = 1,
				["CU"] = "\nDoing a lot of figeting with her good luck charm.\n\n\n\n",
