				["EC"] = "Orange(left) Blue(right)",
				["FN"] = "Whisper",
				["v"] = 24,
				["RS"] = 1,
				["IC"] = "inv_fox2_white",
				["PS"] = {
				},
				["RE"] = "Dandred's Fold, Hillsbrad",
				["AG"] = "28",
				["CL"] = "Bloodletter",
				["FT"] = "Freelance Assassin||Bubonic Fox||Travelling Exsaguinator",
				["HE"] = "3'4",
				["CH"] = "890500",
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "                                                 {h2}History{/h2}                                            Whisper was born and raised in the shifting sands among Vol'dun. Not much is known about her early life as at a young age, she was taken by the Sethrak for their slave markets. Under a cruel slavemaster, she endured his increasingly sadiststic tendencies for many years until one night in a frenzied rage, she carved him to pieces and fled to the wastes. Whisper would wander Vol'dun aimlessly for a time. Striking out at Sethrak hunting parties, and using the natural diseases from the land to poison their more renowned figureheads. Eventually, she would garner the attention of Vulpera requesting her assistance, as well as Zandalari exiles in need of dirty work to be done. Her work would soon begin to take her from Vol'dun and further into the outside world. To this day, Whisper continues to offer work to discreet and contained circles of unscrupulous figures across Azeroth. She has recently begun work with a number of new business partners. \n\n                                             {h2:c}Attributes{/h2} \n Whisper has always been self-trained. She has learned and adapted to killing since her slave days. She most commonly uses a pair of jagged steel knives. Designed for effectively bleeding out her foes. Whisper's most infamous staple of her work are the poisons she utilizes. Rather than typhical venoms commonly used by rogues, she instead uses deadly diseases found across Azeroth and turns them in to sickly mixtures always dressed on her knives. Her signature toxins can cause suffocation, rapid fungal infections, tetanus, irreversable paralysis, and (if you're on her bad side) a specialty concoction that boils the blood and gradually melts the body from the inside. If Whisper can inflict any death possible, she will make it painful, meticulous, and violent.  \n\n                                                 {h2}Personality{/h2}        \n  Whisper is committed to her work and does so with a sadistic aura and a oddly cheery demeanor. She will appear confident, courteous, honest to her clients and associates, and loyal to her craft. Whisper doesn't ask for a high price for her work, believing the effort is more worthwhile than the reward.  However, she is difficult to contact(excluding close associates). Whisper has a habit of taking any measure to conceal her prescence. She will always remain mobile, and will mostly avoid heavily populated areas. She is easy to approach, but is very short when it comes to speaking, or just uses facial gestures when responding. Whisper finds it difficult to remember not only most reoccuring clients, but friends and family from her past as well, questioning at times if they ever existed in the first place. \n\n                                               {h2}Appearance{/h2}     \n Whisper's outfit can be considered common among many scoundrels. Garnishing dull browns and grays, with a mask draped over her muzzle. Whisper never goes anywhere without her supplies and carries a cleverly hidden bag with her specialty toxins and an assortment of serrated knives. Around her neck is her \"Good Luck Charm\". A glowing sky-blue gem strung by a coil of rope Whisper has carried throughout her life. Whisper's fur is snow-white, lined with silver streaks. Beneath though are numerous scars invisble to the naked eye. Her most noticable ones are a serpent-shaped brand engraved upon her back, and a long cut down the left side of her muzzle. Whisper stands at a diminulative 3 feet and 4 inches and is scrawnier than most other vulpera.                                                                                           ",
				},
