				["PE"] = {
					["1"] = {
						["AC"] = true,
						["IC"] = "inv_misc_redsaberonfang",
						["TX"] = "Hanging around Drokgar's neck is a dragon's fang, carved with an intricate design and dyed black.\n\nThe necklace is obviously well taken care of, the string it hung off of being strong and the surface of the fang itself being fairly devoid of any sort of battle damage.\n",
					},
					["3"] = {
						["AC"] = true,
						["IC"] = "inv_misc_tabard_dragonmawclan",
						["TX"] = "Swirling black tattoos cover the orc's body. They cover nearly everywhere except his face and his forearms.\n\nInstead of tattoos, his forearms are decorated with a matching brand on either arm. The visage of a dragon's head is burned into his thick skin, surrounded by a spiked circle.\n",
					},
					["2"] = {
						["AC"] = true,
						["TX"] = "The orc has obviously seen much fighting in his life, covered head to toe in scarred over wounds.\n\nNone seemed to stick out much from one another, at least those that were visible outside of Drokgar's armor.\n\nThe most noticable injury is on the warrior's face. A long scar runs down his right cheek, going from his ear and all the way across his mouth to his chin. His tusk on that side is gone, broken down to the root. A silver cap protects what remains.",
						["IC"] = "ability_butcher_gushingwounds",
					},
					["5"] = {
						["AC"] = true,
						["TX"] = "Another item on his belt is what at first appears to just be a simple, yet rugged lantern. Along the large ring that the orc uses to attach the light to his belt sits something a bit more gruesome, however.\n\nAt all times, at least one stumpy, dwarven finger can be seen impaled on the large ring, dangling against the lantern as another trophy on the orc's person.\n\nAn iron key also hangs from the ring.",
						["IC"] = "inv_offhand_1h_draenorhonors2_c_02",
					},
					["4"] = {
						["AC"] = true,
						["IC"] = "inv_misc_monsterscales_20",
						["TX"] = "Contrasting the dark browns and fiery highlights of his armor, a piece of twilight dragonhide hangs from his belt, presumably as a trophy.\n\nThe hide seems to be a bit worn, with some of the scales having fallen off.\n\nWhether that was from the hide's age, or because of the brutality of its last owner's death, is uncertain.",
					},
				},
				["v"] = 49,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n{img:Interface\\PETBATTLES\\Weather-BurntEarth:512:4}\n{h1:c}{col:B25F2C}• Drokgar Wyrmbash •{/col}{/h1}\n{h3:c}{col:757575}ooo{/col}{/h3}\n{h2:c}{col:B25F2C}Appearance{/col}{/h2}\n{img:Interface\\PETBATTLES\\Weather-BurntEarth:512:4}\n\n{p:c}{col:B0B0B0}• The orc looks like your typical Dragonmaw. His skin is a light grey, the dull color broken up by the occasional tattoo, brand, or scar. His eyes glow a bright yellow, making his gaze seem harsher than it actually is at times.\n\n• Drokgar wears heavy plate for protection, the armor seeming to produce a heat and glow of its own. The steel he wears seems rather battle-worn yet still strong, destroyed and ripped apart just to be put back together again, much like the scarred orc who wears it.\n\n• At any given moment, the orc probably has at least some sort of blood splattered on him, combat being a daily thing for him. Occasionally, he'll be polite enough to at least attempt to clean it off before appearing in public.{/col}{/p}\n\n{h1:c}{link*https://imgur.com/a/HvFvKDE*Model Edit}{/h1}\n\n{h3:c}{col:757575}ooo{/col}{/h3}\n{h2:c}{col:B25F2C}Personality{/col}{/h2}\n{img:Interface\\PETBATTLES\\Weather-BurntEarth:512:4}\n\n{p:c}{col:B0B0B0}• Seeing as much battle and destruction as he has in his life, Drokgar is hardly able to be surprised or disturbed by much. He's seen his fair share of the horrors of war. \n\n• He doesn't tend to hold his words back. If he has something to say to you, he'll say it, whether he really should or not. On the rare occasion he'll keep his thoughts to himself, mainly to avoid a senseless fight.\n\n• Drokgar has tempered his bloodlust, no longer angered at the drop of a hat like he was when he was younger. He's quite patient now, for an orc at least.{/col}{/p}\n\n{img:Interface\\PVPFrame\\Icons\\prestige-icon-3-5:128:128}\n\n",
				},
				["MU"] = 441799,
				["BK"] = 3,
				["v"] = 47,
			},
		},
