					{
						["TX"] = "{h1:c}Grozna{/h1}\n{h2:c}Archmage, Enchanter, Alchemist{/h2}\n{h3:c}{/h3}\n{col:ffffff}\nBiography.\n{/col}",
						["BK"] = 1,
					}, -- [1]
					{
						["TX"] = "{h1:c}{col:FFD13A}Character Information{/col}{/h1}\n{col:ffffff}\nStraight up, what needs to be addressed immediately and first and foremost is one extremely important point; \n{p:c}{col:19ff00}IN CHARACTER{/col} does NOT equal {col:ff1d00}OUT OF CHARACTER{/col}.{/p}{col:ffffff}\n\n___ does best in slice of life, dark themes, or combat scenarios, but all RP themes are accepted and endorsed from horror to military, so long as it makes sense from a storybook perspective it's all good and especially endorsed.\n{/col}\n{h2:c}{col:FFD13A}Resources{/col}{/h2}\n{p:c}{col:ff0010}Disclaimer; Art, while SFW, can be considered NSFW in terms of size, you have been warned, if you don't like big body types then you literally arn't missing out on anything revolutionary{/col}{/p}\n\n{icon:inv_misc_notepicture1b:30} Art: {p:c}\n\n{/p}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:350:30}\n\n{icon:70_professions_scroll_01:30} Music: {p:c}\n{/p}\n",
						["BK"] = 1,
						["IC"] = "wow_token02",
					}, -- [2]
					{
						["TX"] = "{h1:c}{col:FFD13A}Player Information{/col}{/h1}\n\nHi! I'm Mary{col:585858}(#12988){/col}, this is my TRP, and TRP template! Hopefully you enjoyed reading because it took a lot of effort to make!\n\n{h2:c}{col:FFD13A}Player Specifics{/col}{/h2}\n\n• {col:ffffff}Female{/col}\n• {col:ffffff}28{/col}\n• {col:ffffff}Has a dog, if AFK, that's probably why{/col}\n• {col:ffffff}Incredibly self-doubting, it's a problem{/col}\n• {col:ffffff}Wants to RP all the time, but doesn't wanna walk up{/col}\n• {col:ffffff}Wants a Storyline and friends{/col}\n• {col:ffffff}Suffers from writers block, it's REALLY bad{/col}\n• {col:ffffff}Thinks she's nice but is probably a prude{/col}\n• {col:ffffff}\"It do be like that sometimes.\" is a motto{/col}\n• {col:ffffff}Easy going, laid back, drama-free{/col}\n• {col:ffffff}ERP is a major turn-off, just gets bored too easily{/col}\n• {col:ffffff}LGBTQ+ friendly, and all that, just don't be a cunt{/col}\n• {col:ffffff}Logs on Characters per request{/col}",
