			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-ChromieScenario-Gold:256:128}\n\n\"Yes. Yeeees~. Uma'baba can see the very moment you claim victory. Or~... Or is it the fate we all wish to avoid. Uma'baba is not sure~... It would require a few more gold. Yeees~. Just a few~. Handfuls,\" the hooded creature said, jutting out a hand to receive payment. The other hand hovers over the gentle illumination of a crystal ball, taming a vision that spells out the fate of the wary male goblin.\n\nWide-eyed, the green shorty quickly shoves both hands into each of his pants pockets respectively! The Soothsayer began to grin, tilting his head back to give a bit of revealing light to his shady hood. The sound of precious gold! That's exactly what he was after. Overexcited, the Vulpera bounced within his seat and coaxed the goblin on with the payment. Who was greeder at this point? Hard to tell considering the situation.\n\n\"Yes, yes! Ooooh-ooh~. Yes... YEEEES~! Uma'baba sees it now. Mmmn... Riches, piles of loot, oil barrels for the taking. ARMFULS OF,\" the Vulpera pauses, leaning closer to whisper the big surprise, \"Growth elixirs. No more Mr. Small Guns~. Nooo~. PAYMENT PLEASE!\" he shouts, yanking his clenched fist from the glowing ball, pointing towards the next it. \"Deposit your fees~, yes~. Place them in the urn on the way out. Not get out. OUT! NEXT!\"\n\nThe goblin nods as if pleased with his fortune, screaming in delight, \"Oh! OH Thank you! Thank you! I'm so excited! A new lease on life! Now I can afford that boat! AND MANSION! AND MY NEW RANK!\"\n\nThe Vulpera smiled and reassured the customer, \"Yes~ YES! All of it... GO. Go now... Time is money. Money~ Uma'baba needs.\" A claw pointed as the goblin took his leave, waddling out and tossing the gold within the tall brass urn toward the exit. That delightful noise! Coins falling upon coins, collecting, setting into an unseen pile of uncounted riches!\n\nA quiet maniacal chuckle came from the odd creature, slamming his fist into the table before screaming, \"NEXT! Come! The Darkmoon Faire has your fate kept inside Uma'baba's tent! Know how you succeed! Or fail~! Next into Uma'baba's tent and learn of your fate~! Come on in, before it's to late~! NO REFUNDS! Mmmn~ Uma'baba is hungry and lunch will now be accepted as payment. Heh-heh.\"\n\n\n------------------------------------------\n\n{link*https://imgur.com/JMjgxGT*Uma'baba welcomes you inside...}\n\n",
				},
