						["TX"] = "{img:Interface\\Pictures\\artifactbook-monk-cover:256:256}\n{p:c}{col:ff3038}\"It matters not how strait the gate, How charged with punishments the scroll; I am the master of my fate: I am the captain of my soul.\"{/col}{/p}\n\n{p:c}{col:ff343c}If you would like to see artwork of the character and to gauge her design and looks, click the link below.{/col}{/p}\n\n{p:c}{link*https://imgur.com/a/JHPVgYA*Captain Sera Crosswind Album}{/p}\n\n{p:c}{link*https://i.imgur.com/6txvTnF.jpg*Remy & S.Crosswind - Gifted from Remy, thank you!}{/p}\n\n{p:c}{col:f5fff9}Some artwork is serious, some is less serious. You'll be able to tell the difference. No I do not have any NSFW, if I did, you would never see it.{/col}{/p}\n",
