			["about"] = {
				["v"] = 28,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n\n{h1:c}{icon:ability_racial_preturnaturalcalm:25}{col:8cff57}  Physical Description {/col}{icon:ability_racial_preturnaturalcalm:25}{/h1}\n\n{p:c}{col:781dc6}Tallax is a Shal'dorei of average height for a female. She holds an hourglass figure but modest features. Adorning her face and body are hoops and studs piercing her flesh, the only other body mod she has are the mystical markings. Within each marking is a name of a demon, either one she has made a pact with or one she can summon. \n\nShe keeps her head shaved close and holds no other body hair aside from her brows. She holds an unconventional beauty to her, she is very rarely seen with make-up on. Her fashion is average these days as she no longer holds the wealth she once had. You can see her dressed often in robes and dresses, often sporting a skull or two, dark colors is what she favors. Purples and black mostly.{/col}{/p}\n\n{h1:c}{icon:ability_warlock_darkarts:25}{col:8cff57} Personality Traits {/col}{icon:ability_warlock_darkarts:25}{/h1}\n\n{p:c}{col:781dc6}Tallax may seem aloof, but that is mainly due to culture shock. Since her exile, she has had a hard time coping with the change of the world she is now a part of.\n\nTallax is rarely ever seen with any sort of Demon in tow. As a Demonologist, she knows it is uncouth to have one displayed. She also seems to feel shame and holds a deep-seated ire for even having the knowledge of how to summon them.\n\nGlancing at Tallax you would see she can fight, but would rather not, it is important to know that she will defend herself, and if she is outmatched she knows when to cut her losses, but she is no coward.{/col}{/p}\n\n\n{h3:c}{icon:inv_misc_book_16:25} {col:8cff57}History{/col} {icon:inv_misc_book_16:25}{/h3}\n \n{p:c}All info below is general info Tallax would share. I urge you to find out more about Tallax's history in character.{/p}\n\n{p:c}{col:781dc6}Tallax belonged to a family of Vinters in the upper class. With the return of the Legion and the Shal'dorei split. Her family wanted to retain their status and sided with the Legion in hopes that they would get favorable treatment. Forced to learn the dark arts of Demonology a pact of dark knowledge was forced on her. She was forced to help summon the minions of the Legion through the war. Her family was slaughtered and she was captured. She spent some time in a cell before she was given the option, leave and never return or rot for the rest of her days. She chose Exile.{/p}\n\n{h3:c}{icon:ability_dualwield:25}{col:ffd259}Rules of Engagement(Combat rules){/col}{icon:ability_dualwield:25}{/h3}\n{p:c}{col:ffd259}†HP: Both players got 5/5 HP\n†Combat rolls: /roll 10 is preferred, ties are rerolled, higher score deals damage.\n†Post order: Roll for Initiative, Emote, Roll, Repeated the last two steps until combat ends.\n†Pets: Pets are included in players attack but do not add damage, just flavor!\n†Rule of 3+: If you beat a roll by 3+ you deal extra damage.{/col}{/p}\n\n\n",
