		["0904002533ftRl9"] = {
			["character"] = {
				["CO"] = "",
				["RP"] = 1,
				["CU"] = "",
				["XP"] = 2,
				["v"] = 65,
			},
			["time"] = 1631000320,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{h3:c}{col:ff6f83}Once a bright shining jewel of Quel'Thalas, now a somber ember. Adopted by two loving mothers at an early age, knowing nothing of an earlier past nor family, life was good. Between the love, the care, schooling in magic and martial art, sports activities and more, living couldn't have been better. For decades happiness wasn't even a thought but a constant. Then tragedy struck the kingdom. Arthas had come with a terrible might and waged a genocide. Even those who were not soldiers stood up and fought for their lives and the lives of those they love. Not all were lucky to survive, a vast majority lay upon the ground growing cold. \n\nAs they say, in the Light you are reborn. Its just that... There are different kinds of light. A bright blue hue raised consciousness, a shriek casted out. Full of fury, sadness and pain. The beginning of a new life, a second chance. Not without it's struggles. Many days spent sitting before a mirror, staring endlessly, wrapped in thought and trying to decipher everything. A lack of emotions, the intensity of other emotions, coming to terms with what that mirror reflects, understanding the deep and dark eternal cold.\n\nThough it was soon learned it is not all bad. Acceptance the hardest part, and after, unlife becomes so much more easy to manage. Advantages over the mortal coil. The lack of need for sleep, drink, food and the extinction of fatigue and typical pain. In this state the draw to magic much stronger than before, bolstered in fortitude. This lending itself to the physical. The ability to leap great distances, scaling walls and lifting weight not able to while alive. A new degree of confidence having grown over time. A complete cycle come to end. The understanding of totality.\n\n\"Abracadaver\" is now her name. The world her playground.{/col}{/h3}\n\n{h3:c}{link*https://www.youtube.com/watch?v=98t-SaHaEj4*If it's worth dying for, will it seal the deal?}{/h3}\n",
				},
				["BK"] = 3,
				["TE"] = 1,
				["v"] = 9,
			},
			["link"] = {
				["Abracadavers-WyrmrestAccord"] = 1,
			},
