		["[MSP]Cuddlefox-WyrmrestAccord"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "i.",
						["IC"] = "inv_foxpet",
						["TX"] = "Delicate black fur touched by the Void, grey eyes peering from the cloud of shadow. Sometimes a void tentacle seems to just emerge from nothingness and writhe about excitedly. Her total lack of body heat often leads her to warm people or fires. It's fun being a voidfox.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "iii.",
						["IC"] = "inv_helm_mask_fittedalpha_b_01_nightborne_01",
						["TX"] = "Sayana seems particularly fond of silks and lace, with a fondness for dark purple. Often, she can be found dressed in fine elven regalia brimming with the arcane. At other times she may prefer dressing down.\n\nAnd while certainly not as apparent as her revealing outfit, Sayana has a rather large ring. This ring was a treasured gift from her mate.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "ii.",
						["IC"] = "archaeology_5_0_umbrellaofchiji",
						["TX"] = "Sayana has a particular fascination with umbrellas and rainfall. She seems to prefer being around sources of water, as if pacified by a sense of calm felt near them. She will often be seen carying her umbrella regardless of the weather.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "v.",
						["IC"] = "inv_staff_2h_nzothraid_d_01",
						["TX"] = "Saya carries a staff that radiates void energy, This staff has faithfully served Sayana for countless generations, a thoughtful creation that writhes and watches with a strange sort of sentience.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "iv.",
						["IC"] = "inv_inscription_80_vantusrune_nyalotha",
						["TX"] = "Whimsical and ever curious, Sayana enjoys observing the world around her. An active dreamer with a strong connection to the unseen, Sayana always seems to know more than her actions and words might reveal. How could such a disarmingly cute vulpera bond with the void so easily?",
					},
				},
			},
			["link"] = {
				["Cuddlefox-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "ability_warrior_strengthofarms",
						["BK"] = 1,
						["TX"] = "Sayana's majestic body seems to dance and shimmer beneath a veil of shadow, a flawless figure that seemed almost arteficial in its creation. Her fur is a silky, shiny grey that is incredibly soft to the touch. Her eyes are a bluish grey, glowing in even the darkest darknesses. Often obscured by an elegant Shal'dorei masque, Sayana observes the world around her with her ever vigilant gaze. \n\nSayana's clothing is made of fine materials. While not especially covering, her most beloved outfit consists of silken lingerie. A delicate lacy dark purple bralette paired with luxurious panties matched in colour complete with fine leggings that fit her delightful curves perfectly. Her formal attire is an outfit of Shal'dorei craft commissioned in Suramar. She also took this time to purchase a masque that would become one of her favourite possessions.",
					},
					["HI"] = {
						["IC"] = "inv_misc_book_12",
						["BK"] = 1,
						["TX"] = "Along the nothern coasts of Vol'dun, a strange young vulpera seemed to survive just fine on her own. She did not belong to any known caravan nor did she seem an escaped slave. She felt no danger around the sethrak, no fear of the giant beasts lurking in the sands. If anything, she seemed to find them entertaining. She was always smiling around the dangers. Few encountered Sayana and gossip about her was surprisingly rare. Her preferred company were the naga and tortollans, effortlessly communicating with both despite the ancient animosity between the two races.\n\nSayana was always an enigmatic creature of unknown origin that had no notable traces left on the world, no history or records to prove she existed at all. As a vulpera, she rarely left the coasts or deliberately sought social interaction. Her presence in Vol'dun was far more noteworthy as a sethrak. A black scaled creature with striking amber eyes, Sayana had left a far greater impact in Korthek's empire than she ever had as a vulpera. She was seen as a scholar of magic who held no fear in channeling dark magics.\n\nThough her interest in mortals had always existed, Sayana often restrained the impulse to engage them more. She found the sethrak terribly dull and the vulpera visually appealing but culturally insignificant. She held great contempt for caravan culture and the traditional ways of the scavenging desert wanderers. It was not until her chance encounter with a unique young vulpera that lived with tortollans and Zandalari exiles that she became more personally invested. The child was a rare find as she possessed neither the branding of a slave or the corrupting influences of caravans. The potential to share her beliefs and experiences with the young vulpera filled Sayana with a new sort of excitement.\n\nThe young vulpera, Kyleeh, adored Sayana and worked hard to make the ancient being proud. While Saya rejected the title of mother or any obligations of parenting, she opened the young vulpera's mind to the wonders of the world. Sayana's expectations for Kyleeh were vague at first. She taught the young vulpera magic and basic combat skills. As Kyleeh grew up, Sayana grew increasingly attached. Though the few years together were nothing compared to the untold thousands spent on Azeroth, Sayana felt those interactions were some of the most meaningful. Kyleeh and Sayana would go their separate ways during the onset of the Fourth War but Kyleeh would find her way back to Sayana after a series of personal tragedies. She would take Kyleeh to the safety and comfort of Orgrimmar.\n\nSayana had integrated within the ranks of the Horde by slipping in with the rest of the vulpera population. She was intrigued to watch how the vulpera adapted and changed with new powerful allies to offer power and opportunity to a race she derided as submissive and helpless. During this time, Sayana would find herself drawn to the beautiful white furred vixen warlock Mako Snowhide. She sought the attentions of this lovely vulpera, sharing both intimate secrets and physical intimacy with Mako. Their romance progressed from lovers to wives as they wed. Sayana felt a deep inner conflict about Mako's finite lifespan and offered to confer immortality upon her beloved wife. She patiently awaited Mako's decision...",
					},
				},
