			["character"] = {
				["CU"] = "Appears back at peak performance, Ready for a bloody brawl.",
				["CO"] = "Walkups always welcome!\n\nThe Horde needs more Violent Orcs, You don't know somebody until you're elbows deep inside their ribcage!",
				["RP"] = 1,
