			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Gondrak physically is a hulking brute of a Bleeding Hollow Orc, where his skin has paled from undeath, his lust for blood has kept him in peak fighting condition, However within his armor one will find countless stitches and wounds from battles won and lost.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Gondrak swaps between raging bloodlust and being completely docile, Swapping from enjoying his odd fixation with sugary sweets to an enraged state where he desires to turn his target into a bloodied smear of gore on the ground,\n\nAs a Bleeding Hollow Orc he takes pride in the ritualistic butchery of anything he can get his fingers on, peeling flesh away like a fruit's skin and letting blood flow freely, Though his mind has suffered damage from his turn into undeath, limiting his memory of other subjects he enjoyed prior to his 'death'.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Gondrak's youth was filled with tales and myths of the Iron Horde and their battles with the 'Alliance and Horde', Ranging from shameful and acts likely considered 'Dishonorful', and stories that any Mag'har would likely take some messure of pride in, Growing up within Tanaan as the cleansing of Demons and Fel was underway, He once had a passive outlook towards Draenei, However once Yrel and the Lightbound fanaticism took root, Only pure hatred dwelled in his heart for anything regarding the Draenei.\n\nBy the time the Mag'har had fled to Azeroth, He was of age, ready to carve his name in the tomes of History, or Die trying...He succeeded in the Latter during the Initial shattering of the Sky in Icecrown, Being felled by countless Undead in a bloodied and brutal demise. When Gondrak was risen, he still had felt the burning pulse of hatred in his body, and accepted to join the Ebon Blade with only a single condition, That being: 'To be able to stand at the front lines if the Door to Alternate Draenor ever should re-open', Until that day arrives however, He apparently continues to follow both the Mag'har and Ebon Blade with equal Undying Loyalty.\n\nNotes: \n\n'Shamans or those attuned to the Spirits of the Dead when refrencing Gondrak will likely not have him in the most 'favored' regards, as Undeath is something unheard of in Bleeding Hollow Culture, However his consistant ritual sacrifices of blood and creatures both willing and otherwise 'does' appease them, At best, Gondrak's relations with his Ancestors could be summerized best as \"Not Angry, Just Disapointed\".'\n",
						["BK"] = 1,
					},
				},
