						["TX"] = "Pretty obviously the first thing one would note about him is his size. Standing quite tall, the draenei strikes an imposing figure. A sturdy, immensely muscular body boasts raw power. Intimidating and dashing, made only more-so by the plate armor he's often seen wearing.",
