						["IC"] = "inv_orderhall_armamentpurple",
						["TX"] = "- Two-Handed Sword: A massive claymore made of dense crystal. Forged in such a way that it helps conduct the energy for any manner of artificing he might do.\n\n- Hidden Blade: In his right gauntlet, Kavo has a spring loaded blade. It is nothing special; a simple shortsword. Though it can be fired free of the holster that hides it.\n\n- Folded Shield: In his left gauntler Kavo has a shield! Managing to perfect it so that it folds away neatly. It's always but a simple switch away from protecting what he needs.\n\n- Leather Tail Pouches: From halfway down his tail, up to the base, rest at least half a dozen hefty leather pouches. All tied up and supported nicely with an extra belt along his waist. What could such wonderful, mysterious tail pouches hold?\n\n\n",
