			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "{h2:c}{/h2}{link*https://imgur.com/a/zObXlYv*Kelek's Art!}",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "1",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "\n{img:Interface\\LFGFRAME\\LFGICON-STRATHOLME:256:256}\n\n\n{h2:c}{col:c23e16}Stratholme{/col}{/h2}\n\n{h2:c}{col:ff3823}It's done! Those of you who have the will to save this land, follow me! The rest of you... get out of my sight!{/h2}{/col}\n\n{col:ff3000}Those few hastily spoken words would change a young Kelekolnir's life forever. He had seen how bad the curse was, with his own eyes; he had seen what it does to people. How could he just walk away? He couldn't...\n\nThe few soldiers Arthas could rally marched into an infected Stratholme. They were scared, ashamed and felt remorseless guilt; or at least Kelekolnir was experiencing those scarring emotions. Fighting orcs, trolls, tauren and the rest of the Horde was one thing, but this was entirely something else. To march into a city of defenseless civilians and cull them like animals? The mere thought had Kelekolnir shaking in his boots. But.. deep down, he didn't see any other way - this had to be done.\n\nThe thalassian killed many people that night--people he had come to know as his own. Their culture and lifestyle was his now. These were his people. But despite those thoughts, he decimated them out on the streets, in their own homes and even while they slept, showing no mercy or hesitation to anyone in his path of shame. The only thing he cared about was protecting Lordaeron and his family; and that thought alone would guide the elf through his dreaded duty.{/col}\n\n",
						["BK"] = 1,
					},
				},
