			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h3} Other Information {/h3}\nJust a spot for other, maybe interesting things about Seara!\n{h2:c} Art? {/h2}\n{link* https://imgur.com/a/GJW5EQB *Searastrasza's Gallery, SFW!}\nAll art that is not mine, will be credited! <3\n",
						["BK"] = 1,
						["IC"] = "spell_holy_elunesgrace",
					}, -- [1]
					{
						["TX"] = "{h1:c} Scalewarden Searastrasza  {/h1}\n{col:ff0023}\nSearastrasza, a wandering, friendly red dragoness with a sassy attitude.  She has a big heart, so don't let her looks deter you!  Generally quite upbeat, this dragon enjoys having fun and is always looking for friends to hang around with while she travels from place to place.\n\nFeel free to walk on up!\n\n(Remember, IC is NOT OOC! <3)\n{img:Interface\\QuestionFrame\\answer-zone-Cataclysm:512:256}\n\n{/col}\n{h3} Player Notes!{/h3}\n {col:ff765e}\n{icon:6bf_blackrock_nova:25} Ayo!  Not trying to godmod at all.  Seara is a dragon, yes, but she's also lost her powers since the fall of Deathwing.  Godmodding / Mary Sue-ing are NOT my intentions at all.  Just looking to have fun!\n\n\n{icon:6bf_blackrock_nova:25} You cannot make this dragon fall tail over claws for you.\n\n{icon:6bf_blackrock_nova:25} Player is approachable, as is character!  I'm kind of shy is all!\n\n{icon:6bf_blackrock_nova:25} Cross-faction RP is adored!  Searastrasza is a neutral character by default anyways!\n\n{icon:6bf_blackrock_nova:25} I'm seventeen!  I kindly ask that there be no creepiness!  I'm also ace!\n{/col}\n",
						["BK"] = 1,
						["IC"] = "ability_mount_feldrake",
					}, -- [2]
					{
						["TX"] = "{h2:c} Do You Know Searastrasza?  (Potential Hooks!)  {/h2}\n\n{col:ff4891} Survivor of the Dragonmaw {/col} - Seara is wholly terrified of the Dragonmaw clan.  This can definitely be expanded on if you ask her, but the short end of the stick about it, is that she was severely wounded and nearly killed by the clan, twice.  She is very visibly nervous around them.\n\n> Do you recognise her?  Does she recognise you?\n> Can do interactions between Dragonmaw and dragoness!  I'd just severely appreciate it if you didn't kill her immediately?  I'm genuinely curious to see where that kind of interaction could go!\n\n{col:ff5669} Island Expeditions?  {/col} - If you traveled from island to island during the Fourth War, you might've seen Seara where the Twilight and Black Flights landed.  Some of these encounters might've been her fighting them, others, peaceful negotiations.  A red the size of a grown black dragon is hard to miss!\n\n{col:ff4891} A Guardian of the Vermillion Redoubt  {/col} - Seara was once a guardian of the Redoubt's whelplands!  She might remember you if you ever came to visit during the Cataclysm, or if you're a fellow dragon!\n(She was also a *foster* broodmother to the whelps there before more attention and support came to the Redoubt.)\n\n{col:ff1244} Friendly, laid back, and just looking for some fun! {/col} - Seara is VERY chill for a dragon.  Almost alarmingly so.  Looking for a casual chat?  Have a question about history?  Just need somebody to talk to?  She's here, and happy to be of service!  (Both player and character are happy to have conversations!)\n\n{col:ff4891} Exalted with the Wyrmrest Accord {/col} - She's seen many a face wander through the temple, and remembers those that may have championed the cause.  She holds those individuals in high regards!\n\n{col:ff4891} Open Book {/col} - Searastrasza would tell you she's an open book because she must be.  There's a reason she doesn't hide herself away!\n\nMore to come, just quickly typing this up!\n",
						["BK"] = 1,
						["IC"] = "inv_helm_flowercrown_a_01_orange",
					}, -- [3]
					{
						["TX"] = "{h1} Personality  {/h1}\n{col:ff2c6d}\nSeara is a kind, sometimes overly hyper red dragon.  She does the best she can to see the absolute best in everyone, and is a patient individual.  She can seem quite antsy from time to time, but who isn't?  She has a kind face, albeit scarred from fights long past, but she often wears a smile!  She's quite brave, and is optumistic when pitted against challenges.\n\nShe can be sassy, but she means well!  (IC isn't OOC! <3)\n{/col}",
						["BK"] = 1,
						["IC"] = "inv_neck_firelands_03",
					}, -- [4]
					{
						["TX"] = "{h1:r} Physical Description {/h1}\n{col:ff3882}\nSearastrasza, or, \"Seara\", is a six foot tall Sin'dorei woman with a darker complexion.  She has bright golden-yellow eyes, and dark freckles dappled all over her face, shoulders, legs and arms.  Her face is marred by three scars over her lips.  She has two spikes on either side of her jaw poking out, and two on her chin!  They are ebony black!\nShe has vermillion red hair, and she has many horns petruding out of her face and head.  She's slender, but very well built!\n\nHer garb is not for show.  It has a purpose-- it's light, it lets her move swiftly, and change between dragon and mortal quickly, without issue.  It's mostly red, adorned with her own shedded scales!  It's breathable, not skimpy!\n{/col}\n",
