			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}\"Evil is not born, it is taught.\"{/h1}\n\n{h1:c}History{/h1}\nOnce a proud Mage, now a destructive Warlock. Once risen, Goregut was not fond of his apperance nor the fact that his arcane studies and skills failed him. When he discovered what he now was he became enraged, burning everything in his sights causing absolute chaos. Goregut grew to hate his teachings through his now new life which led him to dive into a new greater and more destrustive power, the Fel. Still enraged by what happened, Gore began to subtly change and began to alienate his allies and accepting his new demonic \"allies\" for they had the powers he seeked. When the time came, the demons tried to take Gore under their influence. Goregut was able to overcome his would-be-posessors and still manage to use his new known power, but at a price. The struggle and conflict caused his armour and his flesh to bond, mutating him into a monster. Startled by this, Gore was now willing to not only keep and use his powers, but be wary of them as well. While his now new allies respected him for resisting the demonic influence, they also feared him..for he was still and unstable threat..  .{img:Interface\\Pictures\\artifactbook-warlock-cover:256:256}\n\n{h1:c}Current Image{/h1}\nRecent events have now caused the Forsaken standing before you to look almost normal, but he still looks very odd. His apperance is very strange, for it seems his armour has still taken a toll on his skin after finally being removed. His face is almost completely gone, a few fleshy bits still remain but most of it is fleshy bone at this point. His voice is less haunting but still deep and raspy. His skin is still some shade of green, almost an acid color except for his fingers which are just bone at this point. His hair is long and white and somehow still intact.\n\n{h1:c}Currently{/h1}\nGore now roams Tiristfal Glades mostly, alone and afraid to ever show his face ever again. He tends to the Deathknell graves, even if most of the Forsaken had abandoned them. Most of his fellow friends have not seen him since he went on the quest to find his mate after she went to seek out the Old Gods. He seems a bit cuckoo but can you blame the guy? He has not seen his mate since, and has slowly grown cold and twisted.\n",
