			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Greasy, grimey, unkempt and smelling of sweat, motoroil and explosive materials, Ruby is a stunning example of your average, lower-class goblin. Perhaps most notable about her are her eyes, the pupils of which always seem to be mismatched in size giving the already crazy-looking goblin an even more unsettling, rabid look.",
						["BK"] = 1,
					},
					["PS"] = {
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "\"The mischievous Goblin Sappers are known throughout the Horde for their incredible aptitude for destruction. These diabolical Goblins are invariably armed with extremely volatile explosives; which enable them to level enemy structures and weapon emplacements. Although the Sappers are highly unpredictable and insubordinate, they have become necessary to the plans of conquest maintained by the Horde.\" - Unknown Source on the Goblin Sappers of the Second War.\n\n{icon:inv_wildfirebomb:25}\nThe daughter of one such sapper, Ruby Rumblebolt was destined for big things. Big, explosive things.\n\nHowever, for the first decade or so of her life, Ruby had never even SEEN an explosion. Her father, traumatized by his experiences in the Second War, sought to live a simple life and had cloistered the Rumblebolt family away to a remote corner of Kezan to farm sweet potatoes and raise pigs. However, due to Mister Rumblebolt's phobia of modern, combustion-based technology, it wasn't long until the industrialization of Kezan rendered the Rumblebolt farm obsolete and subject to hostile takeover.\n\nAnd boy, was it hostile.\n\nGoblin Gyrocopters armed with machine guns and explosive missiles descended from the sky strafing the pigs, bombing the fields and indiscriminately killing everything on that farm.\n\nEverything except young Ruby, who stood atop the roof and shouted: \"WHOO-HOO! HOTROD OF DA SKIES!\"\n\nObsessed with fiery, explosive death and newly orphaned, Ruby spent her adolescence savaging scrapyards, tinkering and generally slumming it. A childhood depraved of dangerous explosives gave way to an obsessive mania in the young goblinette to learn as much and experiment as much with ordinance and machinery as she could. And soon she joined the Bilgewater Military as one of many expendable Experimental Turbocopter Pilots fighting in the Fourth War.\n\nSince the war's end, and with Ruby's handlers missing in action and presumed dead, there's little stopping this hyperactive goblin from wrecking havoc upon the general populace.\n",
