			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Feng had a mixture of darkish-brown and black fur covering him...short and kept clean. A lighter shade of the brown would be seen along his chest and on his face. His hair and beard made somewhat of an outline to show where that lighter fur stopped, at least it did towards the top of his head. Two shaped patches of the darker fur surrounded both eyes, and two slashes of bare skin showed on the right eye...with the addition of his more recent injuries. \n\nRecently, Feng has shorten his hair a tad. No longer long enough to keep a ponytail, he simply had it smoothed back on the top of his head. \n\nArmor:\nThese days, Feng has found a set of armor that he's keen on keeping with him. This one was clearly more cared for than his previous set; the dents and scratches dug into his other one did not show on this one. In fact, it appeared to be almost new. Purple was the obvious theme for the set, with hints of other dull colors decorating the rest of it. A serpent was designed onto his left shoulder guard, breathing purple fumes. A more elegant-looking bow rested onto his back, though he could also be seen carrying around a polearm.\nSecond Armor:\nHis second set was far more heavier, and clearly meant for close combat. Most of the armor showed a grey-black mix of colors, with white decorating the trims and one glove. The rest of it, in the heavier parts of the armor, would be a goldish-yellow. There were a few pieces that had spikes stiking out...and they were as dangerous as they looked, enabling Feng to use them as weapons if needed. His right arm and paw was the most armored out of everything...though the gauntlet opened up towards his fingers to allow use of them more easily. To finish the look, the hunter had a cloak draped down his back...and a polearm resting against his back. He could sometimes be seen with a bow instead.\n\nHe had two scars; one noticable immediately, one hidden away.  His right leg, close to the knee, had a bald spot the size of his paw. The fur there didn't seem to be growing back. It appeared to be some kind of burning injury.\nThe second scar, or scars, would be three claw slashes across his right eye. The fur was still clearly growing back, making them easy to spot. ",
