						["IC"] = "ability_warlock_whiplash",
						["TX"] = "Faelsyn, like many other Illidari, had various demonic mutations. Horns, pronounced fangs, claws. The more uncommon trait for her, was a tail that was coiled around her waist.\n",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 3,
					["5"] = 0,
					["4"] = 3,
					["6"] = 0,
				},
				["v"] = 26,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h2:c}{col:ffc81b}Physical Appearance{/h2}\n\n{col:ffffff}Faelsyn's form was not too uncommon among the Illidari's ranks. A well toned, athletic build. Her body seeming to lack much of any unneeded fat. Chest fairly small, nearly flat as a result of such. Light patches of skin from scars, and smoldering runic tattoos, mar her tanned skin. Dark hair would roll down her shoulders, and extend to the length of her mid back, in the right lighting, one could see it was a deep red, nearly black. The demonic traits that graced her form, were no different than any other fel-altered being. A pair of horns that curled up and back over her skull. Slightly more pronounced canines, and claws seeming to have replaced both finger and toenails. The most uncommon mutation being the slender tail that wrapped itself around her waist, keeping itself away from swinging blades.\n\nThe attire that this woman wore, were often dark, form fitting leathers or more traditional red and gold Sin'dorei themed clothing. More often than not, revealing and exposing the warm runic tattoos. She didn't seem to mind what so ever of the attention it drew. Over her eyes, rested a blindfold, often a simple black and silver, or red and gold style. Resting between her pair of horns, was a ruby, enchanted with flame that caused a crown of fire to circle her head. Floating just under the horns, and above her hair. \n\nMore recently to her wardrobe, was some finely crafted jewelry. A ruby band around her left wrist, that spiraled it three times, with white crystal inlays that gave off a prismatic reflection of light. On her neck, was a choker of a purple hued metal, bound together with magic, and embedded with gems of different colors.\n\n\n {link*https://media.discordapp.net/attachments/300444197700370432/517191637252702218/demo2.jpg?width=744&height=465*Art WIP}\n\n{h2:c}{col:ffc81b}Public Knowlege{/h2}\n\n{col:ffffff}-Faelsyn was born from the union of Dalaran dwelling nobles of House Shadowfeather and Goldenmist, some time around the first war. Learned fire magic at an early age.\n\n-Left for Silvermoon to become a ranger as soon as she could, and was stationed in the Hinterlands, making a name for herself fighting against the Amani.\n\n-Rejoined with the newly renamed 'Sin'dorei' shortly after the first group left to Outland, and sought join the Illidari.\n\n-Was not among the Illidari sent to reclaim the felhammer. By the time she had arrived in Shadowmoon Valley, the temple had already fallen under siege. Not being able to join their ranks, only having desired to.\n\n-Was spotted in Shattrath among the Scryers and Sin'dorei that had joined the Horde. Later assisted the Shattered Sun at Quel'Danas\n\n-Has since then been seen at every front of the Horde.\n\n-Trained shortly among the monks of Pandaria.\n\n-Was spotted in the late Draenor campaign with demonic mutations.\n\n-Was finally able to join the Illidari on the front of the Broken Isle, and Argus as a new recruit.\n\n-Aided Highmountain Tribes, and the rebels of Suramar to reclaim their homes.\n\n-Openly distraught over the events in Darkshore, leading up to, and the burning of Teldrassil.\n\n-Was considered missing in action after the attack on Lordaeron.\n\n-Took a new surname after the rising Horde and Alliance conflicts.\n\n-Returned to the front focusing on Azshara's and N'zoth's forces.\n\n-May have been among Saurfang's Rebellion.\n\n-Has been spotted in the Shadowlands, namely assisting Ardenweald, and fallen Kaldorei. \n\n-Has voiced her desire of female tauren, and draenei quite clearly. Also has a fondness for Kaldorei and Shal'dorei females.\n\n-Known Languages: Orcish, Common, Thalassian, Demonic(Ere'dun).\n\n-Learning Languages/Little Known: Darnassian, Shalassian, Draenei, Taur-ahe, Kalimag.\n\n((A good voice reference for those that are curious. Rin Asogi (english) - Rin: Daughters of Mnemosyne.))\n((I may get around to writing a short story at a later date.)){/col}\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n{col:5b5b5b}First name basis.\n/c/ \n",
				},
