			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "Muji was born in the Valley of the Four Winds in Pandaria. She spent her adolescent years growing up on a small ranch. \nHer family was composed of farmers and brewers, working closely with their neighboring shao'din. \nThey were especially close with the Tillers and the Anglers, enabling her to grow up with capable abilities and skill in farming, fishing and agriculture. \n\nHer family mainly lived a quiet life, but had roots that spread to every coast of her land.\n A majority of her historical family were practicing monks- many of which were enslaved by the Ancient Mogu Empire. \n\nWhen the Horde and Alliance brought their war to the shores of her homeland Muji's family was struck with great pain.\n The once peaceful brewing family was especially susceptible to the negative power of the Sha. \n\nHer close relatives were all negatively impacted by the emotions the Sha caused them to discover. \nMuji herself was prone to lashing out in bouts of anger and violence. She often felt despair, doubt, hatred and fear.\n Her peaceful way of life was turned upside down, her family now hurtful and violent to eachother. \n\nShe decided to venture off into other parts of her land to train, hoping to better herself and help fight the Sha that were ruining her homeland.\n Many of the temples of Pandaria were her home as she learned from all aspects of the Celestial families.\n She found the magics of the Elves that her family once spoke of more and more tempting as the Sha corrupt her heart and mind. \n\nEventually, after spending time learning how to control the magics, she returned to her family in the Valley of the Four Winds to find them all but gone.\n Her parents were missing, assumed dead. In all her anguish, the Sha found her vulnerable and entered her mind once more. \n\nShe took refuge at Halfhill, spending her time tending to a small farm at Hillsong Ranch. \nThe local shao'din knew nothing of her inhabitance for months, until she grew more weary of her own thoughs and emotions and \nweakly collapsed at the market in her bodys  desperate attempt to seek help. The locals befriended her until she was strong \nenough to leave once more, vowing to use her knowledge in magic to help purge the lands of the Sha. She took up history in the meantime,\n learning the cause of all the events around Azeroth that ultimately lead to the pain that she now felt. She perfected her brewing, \nan old skill she learned when she was young, to pass time and make ales to ease her pain. In her attempts to brew, she found herself \nat peace with nature, learning how to collect valuable resources and tend to the earth... But the ales she brewed and farms she tended\n were only masking the effects of the Sha. \n\nShe had nightmares, and would occasionally find herself lashing out. The more she tried to control it, the less in control she felt- \nboth over her emotions and her magic. \n\nA great movement began to rid Pandaria of the Sha and the Horde leader that was using it for his own plotting.\n Muji found herself aligned with secretive factions such as the Golden Lotus and the Shado Pan. \nShe met a mysterious group of foreigners the she also rather liked. With the help of them and many more,\n Garrosh Hellscream was defeated and the power of the Sha began to lose it's grasp on the lands. \nMuji found herself relieved and at ease, but also faced new obstacles. The fight was won but there was more to be done.\nIn a moment of clarity she decided to fight for and with the Horde against any forces that were a threat on this world. \n\nDespite the time that has passed and all the challenges that she has faced, deep inside the Sha still touched Muji's heart. \nShe often found herself in the midst of chaos, something she felt at home with. \n\nMuji is honest and forgiving in nature, but her negative emotions sometimes still make her shut herself off to \naccepting wrongs and forgiving people. She is hesitant, but well-earned trust is not something she takes lightly.\n Those that have earned this trust are often easily forgiven. \n\nShe aims to help others, not wanting another soul to feel as she ever did, hoping to do everything possible \nto keep the peace in the world. She is gentile at heart but her past and her drinking habits sometimes turn \nher into a drunken mess. With the negative effects of the Sha, Muji is often very superstitious, \nand uncontrollably impulsive. You'll find her drunk and wild in social settings, or otherwise quiet and reserved.\n She can be timid, but sit down and have a drink or two with her and Muji will open up and be more welcoming. \n\nHer loyalty is only paralleled by her curiosity and desire to seek more knowledge.\n Muji hopes to  gain more comrades that she can one day accept into her own shao'din, as her own family.\n{img:Interface\\ARCHEOLOGY\\ArchRare-PandarenTortureDummy:512:256}{col:2b2b2b}{col:303030}{link*http://your.url.here*Your text here}{/col}{/col}",
				},
