		["[MSP]Elwiel-WyrmrestAccord"] = {
			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "ability_warrior_strengthofarms",
						["BK"] = 1,
						["TX"] = "A lovely elf lady, usually dressed in quality robes and always looking her best, obviously caring much for her appearance. She is thin, but has little in the way of muscle, clearly not a fighter in any way.\n\nElwiel has a rather... generous chest. It happens. She doesn't like that brought up, though.\n\nShe seems to attract trouble, and always has a story about something terrible that happened to her recently.\n\n(I prefer whispers and one-on-one scenes for RP)",
					},
					["HI"] = {
						["IC"] = "inv_misc_book_12",
						["BK"] = 1,
						["TX"] = "Elwiel came to the eastern kingdoms after being expelled from the temple of Elune, where she was one of the more prominent novice priestesses. The events which led to her getting kicked from the order are unclear.\n\nElwiel is a character I love to get in the worst messes or embarassing situations. Feel like mugging someone? Need a sacrifice for your evil rituals? Poke me and I'll gladly see about playing the victim. More harmless shenanigans are also welcome. Pranks, spying on her, tripping her up, or just walking right up and flipping her skirts and the like. I will usually find a way for things to go (hilariously) bad for her somehow. She seems to have the most terrible luck...\n\nEven if your character is not evil, Elwiel is very accident prone. It's certainly no one's fault how she tripped over you and triggered a whole chain of events that ends up with both of you tangled up together in a fishing net!\n\nI'm also always happy to set up a scenario where you could find her already in trouble. Captured by brigands, being attacked by monsters and the sort. Ask and I'll gladly come up with something!",
					},
