		["07032019110ecLk"] = {
			["character"] = {
				["CO"] = "No, I don't RP here - I keep to discord. Don wanna do the fuckin boring ol talky stuff and then spend 20 minutes doing nothing productive in this game.\nI goddanm love RPin though -- just need actual fucking PLOT AND EFFORT put in instead of, what happens here in SMC or ORg.\n\nIf you're an assassin with titles, you are clearly a shitty assassin for getting yourself KNOWN for such things.\n\nIf you go /ignoring people without even attempting to communicate, you are a laughably shitty person. There's almost no exception to that.",
				["RP"] = 1,
