				["v"] = 7,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "The Sin'dorei was a relatively nice looking one, to say the least. Her face had the typical angular features one expected, along with an aquiline-looking nose and golden eyes. A small set of scars was all that marred her decent attractiveness: one that ran along her chin and lip, and another that came across her right eye all the way to her sideburns.\nHer onyx hair was often kept cut short, not even chin-length. Not at all messy though: in fact, her hair was taken care of quite a bit!\n",
						["BK"] = 1,
						["IC"] = "ability_rogue_rollthebones05",
					}, -- [1]
					{
						["TX"] = "Her physique was notably different from other elves of her kind. Not at all like a supermodel with pointy ears, but instead a lithe, wiry figure. The barest of feminine features made it difficult without staring to see past a vague adrogyny. Her arms had adequate muscle to them and her core was certainly toned. Her legs on the other hand were far more muscled, enough to impress most. \"Runner's legs\", as they were - she wasn't someone to get exhausted after a kilometer sprint. Yet more amusingly was in how her chest or rear were practically nonexistant. The former wasn't even something that someone could consider A's - that was too large! And her rear was in the same position, only something that could be admired because of the considerable amount of muscle that was added from her thigh muscles. Either way, puberty hated her, and she hated it back.\nHer body - whenever it's seen, which is a rarity - often has scars running across it. Nicks, scrapes and cuts criss-cross themselves, enough so that she clearly has put herself into a dance with death hundreds of times, coming out with a mark for each time. Or five.\nIn particular, though, her right arm was... Missing.\n",
						["BK"] = 1,
						["IC"] = "ability_warrior_intensifyrage",
					}, -- [2]
					{
						["TX"] = "The arm itself was completely gone at the shoulder, where in its stead there was a prosthetic. The mechanics themselves were fine-tuned and to those with good eyes for mechanics, could see it was something that had a master's touch to it. Not of the Sin'dorei's own design, but she made sure to keep it well maintained nonetheless.\nThe wiring & servo's were kept functional and hidden away under the plating. Surprisingly, it worked relatively simmilar to a normal limb, were it not for the clicking and tapping from the metal brushing against itself.\n",
						["BK"] = 1,
						["IC"] = "inv_gauntlets_10",
					}, -- [3]
					{
						["TX"] = "Her armour was more of the same - custom made, and certainly of high quality. A hooded helmet kept her face protected behind a mask that kept her identity generally hidden whenever it was worn, her golden eyes glowing all the more under this helm.\n\nThe spaulders were kept relatively small but adequate enough to protect from glancing blows towards the neck or limbs: partly metal and partly hardened leather.\nHer chestpiece was far more ornate however, with a segmented breastplate that covered part of her torso, a gambeson & hardened leather protecting the rest - as well as underneath the metal.\nThe cuisses were a solid yet dark metal, attached to the leggings quite firmly. Her boots were right under those, thick and worn, sabatons & greaves making sure that her legs were just as protected.\n",
						["BK"] = 1,
						["IC"] = "inv_leather_raidroguemythic_q_01chest",
					}, -- [4]
					{
						["TX"] = "Lastly were her weapons - at least, those people know of. The first  being her gauntlet that came over her replacement arm. Not too much different from her left gauntlet, save for the thicker plating that made it a nightmare to cut into - and impossible to cut into the arm with that much plating. Thick talons were set on the end of each of her digits, the plating surrounding it covered in... Runes. Arcane runes.\nAt the very least, one could amplify its capabilities with magic of some variety, if someone were to give it so. Or, on the other hand, it could be used to defend -against- magics of some variety, if it wasn't given any to amplify itself.\n",
						["BK"] = 1,
						["IC"] = "inv_leather_raidroguemythic_q_01glove",
					}, -- [5]
					{
						["TX"] = "Then came the just as commonly used dirk that she used - a massive thing that probably fit on a troll or orc better than it did on her lithe frame. Still, it had a considerable curve towards its edge, but enough of a point that its stabbing was still a very viable capability. A handguard came over the front of the hilt, and with its size it more accurately could be seen as a shortsword or arming sword! Still: it was nonetheless remarkably light, meaning that she wasn't going to worry about hefting something that was clumsy in the hand.\n",
						["BK"] = 1,
						["IC"] = "inv_knife_1h_artifactfangs_d_04",
					}, -- [6]
					{
						["TX"] = "You want history?\nShe grew up with fuckall in the Murder Row like every stereotypical assassin/rogue or what have you that's out there, became the best there is and now loves to make a killing off her sneeki breeki skills. Fought in every single war with all the distinctions but is still somehow super secret and nobody knows anything of her.\n\nSeriously, you wanna know, ask ICly. She's an assassin or bounty hunter, though, so at least you know that if you roam in such darker circles.\n",
						["BK"] = 1,
						["IC"] = "inv_misc_enchantedscroll",
					}, -- [7]
				},
