			["about"] = {
				["v"] = 42,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "New toon! WIP! <3)\n\nAn orc with no family, no clan, no name. Born in an orcish work camp and sold to gladitorial slavers. The berserker has spent much of her life in shackles, chained behind bars, only to see the light of day when being transported or fighting in the arena. Through her years, she has had multiple masters, sold again and again, forced to fight the races of Azeroth in the pit, including kin for bloodsport. The admiring cheers of the crowd when she mutilates her opponents is the only sign of approval she knows, and the lash the only sign of failure. Over her years, she's accumulated multiple callsigns from her masters to make up for her lack of a name. 'Goremane', 'The Snarling Jackal', 'Bloodfrenzy' to name a few. Finally, after so many years of enslavement, she has broken free of her shackles, slain her most recent master, and escaped. With her newfound freedom, she wanders the world, lost and confused, but determined to find her place.\n\n{img:Interface\\LFGFRAME\\LFGICON-NAGRANDARENA:256:256}\n\nThe she-orc before you is a telltale sign of hard fought battles and harder victories. A thick mane of gore red hair dresses her scalp and frames her dark green face to the shoulders, pulled and twisted into thick braids bound by leather strips to manage. Her face is best described as 'savagely beautiful'. She possesses thin dark brows, the left halved from a blade's strike, leaving a scar that cut down across her cheek to her jawline. Beneath those brow lay her feral orange eyes, the lids lined with a thick plume of lashes. Seated in the center of her face sits her round nose, the bridge licked with scarring, the septum pierced with a bone fragment. And below her nose sits her full pouty lips, a set of tusks jutting from the corners of her mouth. Dark tattoos reminiscent to wild swipes and slashes mark her cheeks and chin. Her pointed ears are pierced with an assortment of claws and bones, with a mixture of fine gold rings, the lobes stretched with solid gold plugs.\n\nThe berserker's form has been shaped and molded by the arena, crafted to be an effective killer in the pit. She stands at solid six foot one, her womanly curves being the only trace of fat on her body. She carries her head upon a slender neck, her throat forever marked with the scarring of shackles. From her broad shoulders hangs her toned arms, the flesh tattooed with the same tiger stripe-like slashes, with a plethora of scars marring her skin, along with similar shackle-scarring on her wrists. Her palms are rough and calloused, ripped and healed over a dozen times from battling vigorously with an axe in each hand. Her back is a canyon of muscle definiton, the flesh hard like leather from the roadmap of disciplinary lashes that marr her pine green skin. Her chest carries upon it a hefty bust, and beneath lies her flat washboard abdomen, licked with close-calls scarring that cuts across her naval. Her strong, thick haunches support a taut rear, her legs trimmed from her years spent sprinting across the arena to clash with her opponents, the flesh tattooed and marked with battlescars like the rest of her form.\n\nThe She-Orc struggles with her self identity since finding her freedom. All her life, she's always been a gladiator, her name-titles constantly changing with her varying slavers. She struggles to interact with most, coming off as skittish and feral in nature towards newcomers. Simple interactions, and even the way she eats and drinks is beast-like in nature, even for an orc. The berserker doesn't share the same concept of 'honor' as her kin do, prone to sack, pillage, and steal for the sake of survival. But like any wolf, with a little time, the she-orc can prove to be a loyal companion.\n\nThe she-orc wanders the world in her gladiator attire, a collage of plates, chains, furs, pelts and silks of different racial motifs. A thick, rigid iron helm sits atop her head, flared with a feathery mohawk comprised of horse hair, dyed blood red. Along her collarbone sits a golden usekh, a decorative collar of Tol'viri craft. A thick leather tunic dresses her torso, the hide embossed with a tribal pattern along it's seams, with large tusked plated pauldrons fastened to her broad shoulders, and a simple pair of fur-lined steel cuffs shield her forearms. A thick girdle wraps around her hip, a human's skull fastened into the front as a decorative piece with dangling strips of reinforced leather covering her crotch. The girdle suspends an abundance of weathered tiger pelts and tattered Tol'viri silks around her hips that flow freely around her trouser-dressed legs, with decorative chain-link gold and even femurs jingling and clacking about. A pair of bolted fur-lined steel boots complete the berserker's set.\n\nA pair of hatchets dangle from her hips, the fighter's preferred weapons of choice. The right-handed blade, a hatchet of orcish make, chipped and jagged from it's use and sharpened a dozen times over. It's long hilt is wrapped in an abundance of thick hide strips and fixed with a spiked handguard, with a jagged blade serving as it's pommel. The blade that accompanies her left hand, a wicked hatchet of ogre origin. The curved blade shares the same battle-wear as the other with a wicked curled hook crafted on the end of the leather-wrapped neck.\n\nYou may know the gladiator if:\n\nYou've frequent arena fights: The she-orc has been in countless fights over the years during her enslavement, going by different callsigns with each new master. Perhaps you've seen her fight? Maybe you were a fan even? Or maybe she won you a hefty sum of gold from your bet?\n\nMercenary work: She's been getting by in the world by killing for coin, be it beast or man alike. Perhaps you and her shared the same bounties, or maybe you hired her?\n\nYou were, or are, a gladiator: With this she-orc being carted from one arena to the next for most her current life, there's chance you've met her. Maybe you've encountered her in one of the underbellies of the arenas gearing up for her fight. Or perhaps you've fought along side her, or even against her? It's not uncommon for team coordinators and slavemasters to pay extra to have their best gladiators spared from execution. Perhaps she almost ended you, or you her.\n\n\n\n\n\n\n\n\n\n",
				},
