						["TX"] = "Based purely on the vixen's outer appearance, she's been around an inferno more than a few times; and on a closer inspection; in one. \n\nThere are several clear indications that Ashe has had numerous third degree burns over her body, the most defining burn across her cheek and her muzzle, and a thin line circling her neck in an intricate, wovern pattern. This same pattern is burned on her arms, the back of her paws, the sides of her torser, and on each of her ankles. \n\nThis pattern is far from religious burnings, or a form of self mutilation, instead, it's clear that she was wearing metal jewelery in each of these areas when she was caught in a fire; the tissue so scarred that her fur cannot grow back. She refuses restoration magic, insisting that her burns are a part of her destiny.\n\nWhat fur does grow is soft, full with a bright, healthy sheen. It's color is a deep crimson, bleeding out into a pale, cream shade. ",
