			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-OldGodTrinket:512:256}\n\n{h2:c}{col:000000}Physical Description{/col}{/h2}\n\n{p:c}{col:cc9900}As many would describe, Cain stands at an average 6'2, such a height would not tower over anyone neither would he feel miniscule in comparison to most others. His body, well taken care of, can be described as sinewy. A lean body with a rather commendable build. His shoulders broad which would emphasize on his posture; Upright and proud. Cain portrays himself with grace, as if leaving an air of elegance in his wake. (wip){/col}{/p}\n\n\n\n{h2:c}{col:000000}Personality{/col}{/h2}\n\n{p:c}{col:cc9900}A pleasant and amiable man, sometimes slipping in a little bit of charm, never shying away from courtesy or respect, speaking to cain would allow anyone to pick up that he had been raised in a high-society household, portraying good manners and ethics in the many situations he gets himself into. Cain, one who would insist they spare their formalities towards him but he addresses everyone else with utmost respect. Speaking to Gravy as though he was the Regent Lord, a fearless huntress as though she was a shining jewel standing out at a ball. He is also a curious soul, he's always been fascinated with the way a person's mind works, it should not come as a surprise if Cain would attempt to try and understand a person on a deeper level from early interaction. He is by no means a social butterfly however, though purely by choice, he enjoys the peace and silence of being alone, but wont turn down a friendly chat. (wip){/col}{/p}\n\n\n{h2:c}{col:000000}RP Hooks{/col}{/h2}\n\n{p:c}{col:cc9900}Therapy sessions with Doctor Cain. He's had clients who merely just wanted to chat to people almost destroying his office :) go wild.  // He's known as a noble around Silvermoon. // If your character has attended a few balls and court meetings in the past, you may have seen Cain then. // Cain has a very dark side, i will not spoil this, but if you wish to know more, i will be willing to provide some information and maybe we could go of that. (Will add more as time goes) {/col}{/p}\n\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-CthunsPuzzleBox:512:256}\n\n{h2:c}{col:000000}OOC Info{/col}{/h2}\n\nFirst off, thanks for reading my profile. I have a very bad habit of writing TRP's when im absolutely smashed and/or exhausted, apologies for my scuffedness, will improve and fix as time goes.\n\nCharacter is perpetually under construction, but Cain is most definitely RP ready.\n\nPlayer is over 18 and is friendly, most forms of RP and walkups are fine with me. Yes, even that, but it would all be for Cain's personal indulgence, everything sticks with his character\n\nI believe history should be RP'd out instead of simply read from a profile. I will however, mention that **Cain has a very dark side to him**, you should write with me to find out more. :)\n\nPlayer may be slow on posts here and there, i care about the detail and the way i write, please be patient with me\n\nI am always open to writing long term and building stories, shoot me a whisper if you're interested!\n\nResonating has two different rp profiles for two different rp characters, dont be alarmed you know me on either character and see that my character's completely different\n",
				},
