				["Selowin-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "<The Argent Resurgence> is the Horde wing of the joint Argent guild <The Argent Redemption> on Alliance! Medium RP, military style, campaigns - currently tied in with the Year of the Scourge WRA Server Campaign!\n\n\nYear of the Scourge D20 Damage & Healing Roll System {link*https://docs.google.com/document/d/1gSds-GOFRdXJxsfLT2id-rwDCv99B_NE_p9odSrvEiU/edit*HERE}\n\n\nGorgeous and calm, with a soothing voice and earnest eyes.\n\n{link*https://selowyn.tumblr.com/post/179654535644/marcelafreireart-portrait-commission*ART LINK ONE}\n\n{link*https://selowyn.tumblr.com/post/183556021434/selowyn-3*ART LINK TWO}\n\n                            ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\n\n* * * An Argent Confessor, An Ardent Cleric: Sunwell Pilgrim, Aspiring to the Light * * *\n\nDrawn to the wounded, she will give of herself long past when it's prudent to do so. Making attempts at learning healthier personal boundaries in this troubled era, though she's always wistful for the past and will welcome any opporunity to trade war stories of the Northrend Campaign.\n\nAs an Argent through and through, she sas a complex relationship with the Horde and Alliance. She has worked with both over the years in varying capacities. Most of the time she has been too busy serving the Argent Dawn and then the Argent Crusade to worry overmuch about schisms and faction lines. Skews Quel'dorei (as she never supped of Kael'thas's demon crystals) but prefers the more global racial moniker of simply \"Thalassian\". She straddles the line betwixt the factions as best she can and considers herself neutral in such matters.\n\nLover of fine jewelry, the theater, the opera; and despite all the darkness and destruction she's seen; all the hurt, disillusioned, scarred people she has fought beside and helped to heal...she still believes in fairy tales, and clings to hope for an eventual Ever After.\n\n                                ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\n\nOOC: Player is 21+, on Eastern time zone. Experienced RPer. Loves walk-ups. Open for all kinds of storylines. Slice of life to campaigns. Light, dark etc. Bring it on.\n\nTumblr: selowyn.tumblr.com",
				},
