			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-shaman-cover:256:256}\n{h1:c}{col:939bff}Ten{/col}{/h1}\n{h2:c}{col:beff91}The Solitary Seer{/col}{/h2}\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-71:64:64}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n\n{h3}{col:ffba71}The vulpera you see before you has no name. Perhaps he did once, but if that is the case he certainly doesn't remember it anymore. \n\nTen is a vulpera of rather unimpressive stature. More lithe and effeminate than most males, his equally short muzzle and curved facial features look more at home on a female than a male. Although he at least has the big ears thing going for him. His body is also covered in sandy tan fur with white vulperan underbelly, accented with the typical plains markings. \n\nThose vulpera that know Ten either shared a fate similar to his own or heard it from someone who did. A fox that lifted spirits in the Fathless slave pits, Ten was always so find of his cards and his scrying. Many positive outlooks could be found in the telling of destiny, and Ten's captors did not enjoy the idea of their slaves having fun.\n\nSo they saw fit to beat it out of him. And the brutality of the Sethrak was highly imaginative. It's unknown exactly what they did to him, as he either refuses to speak or shuts down in the effort. But one thing was for sure. Killing him meant making him a martyr to the other slaves; and the idea of killing all the unpaid labor meant getting behind schedule. Or doing it yourself. And Sethrak aren't very DIY.\n\nStill, Ten did his cartomancy and his divination in secret and even took up his slave name, Number Ten, after having had his old one beaten out of him. More so, he added his own sense of purpose to it, becoming known by his nickname amongst the other slaves: The Wheel of Fortune, the tenth major arcana in his deck. Of course the Sethrak kept destroying his cards, so he had to continually make new ones.\n\nAnd then, one day, he wasn't in the camp anymore. Sethrak bodies started to pop up. And with earthen spikes nailing copies of the tenth card to their chests.\n\nEither he figured out how to do shaman things or he had help doing shaman things. No, he probably did shaman things...{/col}{/h3}\n\n{img:Interface\\QuestionFrame\\answer-ShamanRestoration:256:128}\n\n\n",
				},
