				["BK"] = 9,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-hunter-thasdorah:512:256}\n{h1:c}{col:f15c16}Lion Cub{/col}{/h1}\n{h2:c}{col:c745f9}Appearance{/col}{/h2}\n{link*https://sunwraths.tumblr.com/post/660186935121395712/rhiannon-sunwrath-the-lion-cub*her face claim}\n{col:f15c16}The woman that stands before you is of an underwhelming height, at merely 5’1, she does not seem to look like much. Everything about her seems to be small, like her scarred hands, her lightly freckled nose, and particularly her ears, which immediately give away her human heritage. Yet, a better look at the little elf tends to reveal a strength to her body which may usually be overlooked due to her size and general physical appearance. Rhiannon is a slim woman but with a toned body, with strong arms and rather broad shoulders, forged by years of marksmanship and more than a few violent brawls in random taverns at the end of the world. Her human heritage has given her icy blue eyes, round cheeks and soft facial features, which make her look quite different from full-blooded elves. Despite her hatred towards the idea, she definitely looks more adorable rather than delicate and sharp. {/col}\n\n{col:f15c16}As for clothing and style, she tends to stick to lightweight mail and leather armors, the one she currently wears is dark mail of fine Pandaren craftsmanship. She can often be seen carrying an old leather backpack and some small pouches strapped to her hip, which carry various little items that she believes to be relevant (such as medicinal herbs, coin, or something she found on the floor and decided she wanted to collect). {/col}\n\n{h2:c}{col:c745f9}Personality{/col}{/h2}\n{col:f15c16}To put it simply, Rhiannon is a young soul, seemingly unburdened, joyful and friendly. The Halfling carries herself with an unusual confidence for those of her kind. Years of odd looks, whispers, and inapproptiate questions about her blood don't seem to have taken much of a toll on her bubbly and generally nice personality. The woman has traveled around a lot with goblins and it -shows-, got their eye for business and the lack of filter. Her good qualities, however, can sometimes be eclipsed by the bad ones. Rhiannon struggles a lot to focus and is very easily distracted, tends to zone out a lot and makes lots of mistakes due to not paying attention at the proper times. Her desire to move around, explore, and do everything at once can sometimes make her seem too insensitive or a little flaky, lacking the ability to pour her time and attention into one task only. Even with these complications in mind, however, Rhin tends to have an energy that is nice to keep around if one can handle her goofiness. The woman likes to have fun and enjoy the simple things in life, like attempting to drink people under the table (and failing spectacularly at it), spending time in nature, befriending animals, and punching dragons (note: not serpents, DRAGONS!). {/col}\n\n\n{h2:c}{col:c745f9}Background{/col}{/h2}\n{col:f15c16}\nRhiannon Sunwrath came into this world as a glimmer of hope to a depleted bloodline. Teanna Sunwrath, a formerly distinguished and famous Blood Knight, saw in this child a chance to save her house from vanishing, and raised the girl with this concept always present. From the very beginning it was only the two of them against the world, living out in the Ghostlands and rarely ever meeting with other people. Rhin never questioned this life of seclusion and secrecy, as she was completely unaware that there were alternatives. Her greatest and most joyful interactions occurred whenever her cousins, the Bellators, came to visit. She didn’t get to see the four girls often, but they always treated her like she was just one more sister. \n\nGrowing up, Rhiannon was taught how to fight, forage, explore and survive, and she was a good learner, but Teanna always pushed her limits until the little girl was left tired and on the verge of tears. Teanna wanted a soldier, and a child who would continue their bloodline, but as Rhin grew up she proved to not be viable for either of those things. At some point during her teenage years, Rhin got sent to the house of one of Teanna's friends to live there for a while. She doesn't seem to remember the years or events that went down during her time there, but she believes it's merely because it was an irrelevant, dull point in her life. \n\nAfter this event, the elf allowed her child to go out and explore the world. Since money was no issue at all, Rhin got to travel pretty much wherever she wanted and was left in awe of how different the world was then she’d always thought it to be. Eventually, the girl started taking jobs as a mercenary or hunter, as she had both an affinity and talent marksmanship. During this time moving around fighting things for money, she eventually stumbled upon a group of goblins, travelers like her, and vendors of rare items. Rhin joined them as their bodyguard, and this gave her access to new resources and opportunities. Rhin's adventures travelling with the goblins were cut short a few months ago when they got lost at sea. Most succumbed to the elements and lack of resources, but Rhin and two others managed to make it.\n\nThe young woman has been stuck in a strange place for the past few months, she has been living in Pandaria recently, watching over the baby one of her cousins recently abandoned, and trying to find some new direction in life. Not too long ago, she stumbled upon the Order of the Cloud Serpent, and has been training with them ever since. Only recently she moved up from the rank of trainee to warrior, and she's excited about her new position. Other than that, she spends her days moving between Orgrimmar and Pandaria, clearly still craving some excitement and adventure. \n {/col}\n\n{h3}{col:c745f9}Additional Rhin facts:{/col}{/h3}\n{col:f15c16}- Has lacunar amnesia and ADHD, so she tends to be a little clueless about what goes on around her, as well as some events that happened during her childhood and teenage years\n- Perpetually hungry, will steal your food\n- Sometimes will also steal other things, has light fingers\n- Do not, under any circumstances, give her caffeine. \n- She’s super friendly, but if you joke about her height she’ll kick you in the knees\n- Despite the friendliness, she can also be a little shy at times. Definitely functions better if surrounded by people she knows. \n- Likes: serpents, goblin and elven women, bows, booze, head scrtitches, fantasy literature, animals\n- Dislikes: dragons, people who talk shit about her height, elves that are too “elfy”\n{/col}\n\n\nOOC notes:\n- congrats on making it all the way down here, have a cookie\n- player and character are both an ADHD disaster, be patient plz\n- my first language isn't english, please don't murder me if I make any mistakes\n- looking for long term rp with this girl\n- sale su rol en español pa los que hablen el idioma? :v \n\n",
