			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-AlliedRace-Zandalari:256:128}\n\n{p:c}A tall standing Zandalari, Valatl shows off what a true Zandalari hunter is. An athletic build that isn’t too large to slow him in his hunts or too weak to be overpowered by what he hunts. His long dark blue hair either flows freely most of the time or is sometimes seen to be tied and held in place with a golden circlet around his head. His ears and nose have no piercings, a sign of Val’s preference to remaining natural and simple while also not having the shine of gold give away his location during his hunts. Though, his large tusks which curve down and then up do sometimes have a pair of golden rings close to his jaws along them. Perhaps a little Zandalari flair for himself? And though he doesn’t choose too much jewelry he does have a small affinity for gold trimmings and accessories depending on the day or duties. Maybe it’s just a Zandalari trait. The last things to note of his visage are the bright, vibrant azure eyes he has and the small engravings carved into his tusks.{/p}\n\n{img:Interface\\Pictures\\artifactbook-hunter-cover:256:256}\n\n\n{p:c}Those strong and bright eyes gaze out with a deep calmness and wisdom within. Almost as if looking into the eyes of a resting Devilsaur lording over its hunting grounds, Val’s eyes and even form have a primal feeling about it. What gives that feeling off most would be the noteworthy scales that protrude from the Zandalari’s shoulders, wrists, and ankles. Instead of smooth plates flush to the skin, Val’s poke up and extend outward along the limbs almost like scaled hooks or barbs. This feature gives the Zandalari a more primitive and savage feeling, but, his personality is almost a polar opposite to the idea of a rampaging or violent being. Following down his arms and chest down one would spot the golden skin marking his arms around his elbows and the ornate channels over his body. Vibrant and stunning, the color seems to not be a tattoo or magic but how the troll’s skin is somehow naturally colored. Though, the golden luster shines unnaturally in darkness as well. Even those with an affinity to feel magic though cannot feel anything but faint traces of an ancient power lingering to the troll’s markings.{/p}\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-TinyDinosaurSkeleton:512:256}\n\n{p:c}Continuing down along his body, Val’s legs are quite the powerhouses. Sculpted and firm, each leg is like a bent bow-limb, able to straighten to unleash a powerful force. A lifetime of hunting and running has toned the entire lower half of Valatl and the Zandalari packs some very powerful kicks. Agile and surprisingly nimble, one would have a hard time keeping up with or holding down a troll like Valatl if he wished freedom. Even at his ankles the troll has more of those pointed scales, making even a grazing kick from the Zandalari potential scratch and rend his foe’s flesh. Despite the natural weaponry though the Zandalari only resorts to violence if needed, often times preferring to enjoy the tranquil and peaceful life of hunting and the peace between hunts.{/p}\n\n{img:Interface\\ARCHEOLOGY\\Arch-Race-ZandalariBIG:256:512}\n\n{p:c}Would you know the Zandalari? If you embarked on the countless island expeditions during the Fourth War you may have been customers to Ahtlatl Outfitting. Run by a respectful and noble artisan who was a master of his many trades, Valatl was their assistant and resource supplier/gatherer. Though it seems there has been a change of ownership and now Valatl is the Chief Outfitter. Though sometimes it seems he forgets his new title. It also makes one wonder how he acquired it and why the business has been absent for quite some time now in Dazar'alor's port.{/p}\n\n",
