		["0206113602PbPzx"] = {
			["about"] = {
				["vote"] = {
					[1515763503] = 1,
					[3280319835] = 1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-BurntEarth:512:128}\n\n{h1:c}{col:e5cc7f}Chentao Bronzefur{/col}{/h1}\n{h3:c}{col:ffffff}\"Act with the passion of fire and the resolve of steel.\"{/col}{/h3}\n\n{img:Interface\\Pictures\\artifactbook-warrior-cover:256:256}\n\n{h2:c}{col:ffffff}Appearance{/col}{/h2}{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{col:ffffff} Tall, broad, stout, imposing... these are all terms one might characterize Chentao with. His many years of training is displayed by a clearly defined muscular frame, yet through it all, he's managed to maintain a large belly and all around chubby figure that any Pandaren should be proud to have. His gait would give contrast to his rather heavy appearance by showing that he's quite light and swift on his feet; the burly fellow's got a well-balanced stride, especially for one of his size.{/col}\n\n{col:ffffff} Underneath the somewhat worn and tattered armor usually adorning him is a frame of mostly brown, coarse fur and a hide so thick that it'd do a name like 'Bronzefur' more than enough justice. His chest, neck, his feet, and the tops of his paws are some exceptions to his fur color, always having been bright white of hue. A collection of scars could be seen on most parts of his body, though they'd likely seem to be primarily concentrated at his shoulders, arms, chest, gut, and upper back.{/col}\n\n{col:ffffff} Most would meet a narrowed and seemingly studious gaze when catching the attention of Chentao. Even so squinted, one could easily remark the forest green eyes hidden below that bushy brow of his. Though most of the fur on his face is rough and bristly, it'd seem to be absent of scars and lacerations. Similar to most of his kin, he has prominent ears, chubby cheeks, a wide jawline, a thick neck, and rounded facial features. If given the honor of a smile, you'd surely notice those two sharp cuspids of his.{/col}\n\n{col:ffffff} Not one to care for a formal appearance (a commonly absent trait among his fellow Huojin), this bear sports a spiked mohawk on the top of his head and a distinctively grown beard from along his jawline. Both of his eyes are engulfed by their own sizable patch of fur and accompanied above by a dense, sharpened brow. While most of the fur on Chentao's face is vividly white of shade, his hair, beard, spots, ears, and brow all serve as notable exceptions in being composed of his distinguishing brown tint.{/col}\n\n\n\n{img:Interface\\TALENTFRAME\\bg-monk-battledancer:256:256}{h2:c}{col:ffffff}External Links{/col}{/h2}{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h3:c}{link*https://twitter.com/jikai1992*Twitter}{/h3}\n\n{h3:c}{link*https://imgur.com/a/2EcQ27O*Character Art Gallery}{/h3}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-91:64:64}",
				},
