					["1"] = {
						["AC"] = true,
						["TI"] = "The Beast of the North",
						["TX"] = "After being exiled from House Gloomdust, Andrixx set out to fight the horde of undead in Northrend, eventually earning the respect of the soliders he fought alongside. After a while, people started referring to him as \"The Beast of the North\", for his animalistic prowess in combat.",
