					["3"] = {
						["IC"] = "ability_hunter_improvedtracking",
						["TI"] = "Wherever I May Roam",
						["AC"] = true,
						["TX"] = "Andrixx does have a home, but he rarely returns there for very long. Always exploring and looking for adventure, whether on land or by sea, Andrixx has adopted the \"Wanderer\" lifestyle to sate his curiosity.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "He Would Just Sail On...",
						["TX"] = "After his time in Northrend, Andrixx grew to enjoy the sea. He liked how calm it could be, and yet how much damage it could do. This newfound love made him join a crew for an ocean voyage, until one skirmish effectively made him captain. He's been sailing with his new crew ever since, excited for the adventures that are in store for him.",
						["IC"] = "inv_garrison_cargoship",
					},
					["5"] = {
						["AC"] = true,
