			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h2:c}Appearance{/h2}\n{p:c}Donning the vestments of the Kyrian, Reality appears to be an angel of pure white. This all changes when she's angry though... \nShe carries a blade at her hip that gives off an eerie prescence. (No its not Xala'tath, name is Sehrrana, similar in origin.) {/p}\n{link*https://imgur.com/a/cd4kCLz* Reality! <3}",
						["BK"] = 1,
						["IC"] = "spell_shadow_summonvoidwalker",
					}, -- [1]
					{
						["TX"] = "{h2:c}Personality{/h2}\n{p:c}Reality is a cheerful individual, often choosing to see the best in in those around her. For \"Good people can do bad things\". As what is good in the world is subjective.{/p}\n",
						["BK"] = 1,
						["IC"] = "spell_paladin_lightofdawn",
					}, -- [2]
					{
						["TX"] = "{h2:c}History{/h2}\n{p:c}Once a Holy priest, devoted to the cause of the light she helped many peopel in any way she could. She started experimenting with the healing properties that the void had, only for her experiments to backfire, twisting her mind. She still has a glimmer of the light within her, but it is clear she needs help. She does'nt remember much of her past. Her catastrophic experiment hurting her own mind.{/p}",
						["BK"] = 1,
						["IC"] = "spell_shaman_spectraltransformation",
					}, -- [3]
					{
						["TX"] = "{h2:c}Entreprenuership{/h2}\n{p:c}A proprietor of rare and exotic goods, often trading with others entreprenuers or buying stocks within Azeroth's many companies. Even going as far as making deals with more.. shady individuals.{/p}",
						["BK"] = 1,
						["IC"] = "inv_inscription_tarot_earthquakecard",
					}, -- [4]
					{
						["TX"] = "{h2:c}OOC{/h2}\n{p:c}-Furry goes OwO?{/p}\n\n-Burger please?",
						["BK"] = 1,
						["IC"] = "ability_fixated_state_purple",
					}, -- [5]
					{
						["TX"] = "{h2:c}Tailor{/h2}\n{p:c}In her off time. Reality is a very good tailor, often creaing clothing with her skills. And other soft fuzzy things! (I make TRP items if you ask :D )){/p}",
						["BK"] = 1,
						["IC"] = "inv_tailoringdye_green",
					}, -- [6]
