				["T3"] = {
					["PH"] = {
						["TX"] = "Madeline at a glance\nA petite young woman with long, dark smooth hair, rosy pale skin, and glowing amethyst eyes stands before you. This woman stands tall with excellent posture and walks with self-assurance and confidence. When she walks by or stands next to you, you might get a whiff of mandarins, coconuts, and vanilla. She can be seen wearing a dark blue, red, and green armor set with matching green goggles and a bronze hunting rifle with green bullets. \n\nMadeline’s Armor\nMadeline’s navy blue armor set primarily consists of mail materials. Her armor covers her body, but is form fitting -- showing off the filled out, and not so filled out parts of her body. Due to having an ectomorphic body type, Madeline is naturally a petite woman. She has narrow shoulders, and boney elbows and knees. The navy blue armor is decorated with red, light taupe, and green hues to accentuate her figure. This armor set is sleek and not flashy, as she wears it to be discreet. She is always carrying one of her weapons. She has a pair of matching 12 inch survival knives strapped to her left and right outer thighs and the bronze and oakwood hunting rifle with green bullets and grey wrappings. Under her armor, Madeline wears a black scoop neck leotard with black transparent tights and a set of black hand wraps. This second layer provides extra protection from all magic and extreme weather conditions.\n\nGadgets: \nMadeline has a hunting rifle made with bronze and oak wood and green bullets. \n On the outside of both of her thighs lie navy blue survival knives sheathed by matching leather cases.\nUnderneath her chest on on her ribs (on the green part of her chestguard), she has two block glocks that are holstered up via magnetism \nOn each side of her hip (green part of her belt) lays a pair of black metal spheres. Their purpose is unclear at a glance. \nThe green eyes on her wrists glow faintly, but its purpose is also unclear at a glance\nMadeline’s green goggles are large and simplistic in appearance and their purpose is also unclear at a glance\nThe diamond studs on her upper ears are bugged with microphones and the jade spheres on her lobe serve as the control panel for the studs. \nThe circular decor on the center of her chest looks like a projector lens, but its overall purpose is unclear at a glance. \nThe buckle on her belt protrudes outward slightly. It contains a grappling hook for climbing. \nThe soles of her boots have pocket knives attached to them. When activated, the blade of the knife can be seen from the tip. \nThe sleeve of Madeline's gloves have concealed, curved blades that extend up to three feet in length. They are activated at the push of a certain button.\n\nMadeline’s Face\nMadeline has a heart shaped face that is framed by her long, thick dark hair. Her elven ears are long and thin, sporting two studs on the upper portion of each ear -- blue and black diamonds. She also sports a small, jade spherical stud on each lobe. Her eyes are amethyst and glowing, round and large in shape, surrounded by long, thick lashes. She also has subtle dark circles under her eyes, an indicator of her lack of sleep. These dark circles, regardless of sleep quality, would still be present due to genetics, but are darkened via lack of sleep. They are subtle for the most part. Her cheeks are naturally rosy from discoloration with a slight pink tint, soft, and slightly chubby, making them pinchable and squishy. Her nose is small and straight, but upturns slightly at the very tip. Her cheeks and nose are sprinkled with several dozen pale freckles, that can be seen if one were to look closely at her face. Her lips, while not big or wide, are naturally plump, soft, and a pale shade of pink. They are smooth and in the right light, they glimmer, from some sort of lip balm. Behind her soft pink lips is a set of white teeth, but they are not pearly white like other elves, this is caused by drinking coffee, smoking, and eating sweets. They are mostly straight, but not perfect. She has vampire canines at the bottom and top part of her teeth, that are notably sharp, sharp enough to make someone bleed, should she bite them hard. \n\nMadeline’s Hair\nMadeline has long, thick dark hair that reaches down to her lower back, a few inches away from her buttocks. She wears her hair down her back, and some of it also falls in front of her chest. Her hair is predominantly black, but has a plethora of lowlights, highlights, and tones in charcoal, sliver, and black. Towards her scalp, Madeline sports black and ashy grey shades but her hair tones darken to richer charcoal and midnight black tones The very ends of her hair consist primarily of black and deep ashy tones. Her hair is for the most part straight, but becomes slightly wavy in texture toward the very ends. Her hair is soft, shiny, and smooth, with hardly any tangles or frizz. \n\nMadeline’s Body\nMadeline is a lanky, petite woman. While she may be small in stature, she is no stick. She has an “hourglass-ish” figure, but does not have perfect measurements, due to genetics and an uncompromised diet of delicious and nutritious foods… and a few sweets. Her bust is approximately 34 inches, with a 30 inch band size and she sports medium sized, perky D-cup breasts, which seem larger due to her petiteness. Her 24 inch waist is notably narrow compared to her 36 inch hips. Her arms and legs are toned, her arms more so than her legs, since she appears to store a large bulk of her fat in her thighs and buttocks. Her abs are not muscular, but they are flat. Her butt, while not large in size, is round, bubbly, and perked up from consistent, vigorous physical activity. She has matte black, sharp and short almond shaped nails. Each ring finger nail has a white cartoony skull painted on it. She has a black tongue piercing, several ear piercings, and piercings that hide beneath her layers. \n\n\n",
