						["TX"] = "OOC INFO\n\nPlayer is 24\nMost themes are chill, if they're not I'll bitch and moan ofc\nIC =/= OOC\nNo cry babies or god-modders\n\nWalk ups: Yes\nLong-term RP: Yes\n\nRomance/ERP: ERP is locked with this toon until sufficient relationship points are gathered. If this seems like too much work you're probably unworthy anyway.\nRomance is also locked with this character unless the vibe is right or until sufficient relationship points are earned.\nQuality > Quantity\nDevelopment > Random Smut\n\nFights: Roll battles. Not going in circles with \"I hit u but u didnt hit me\" emotes. I will not acknowledge your attacks if they're not accompanied by rolls so if you wanna sucker punch this char or whatever please pst and we can make something fun happen.\n\nDeath: One of these days but not today. I'll let y'all know when this char is ripe for killing off\n",
