			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["vote"] = {
					[2891117809] = 1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-DraenorOrc:256:128}\n\n{p:c}{link*https://cdn.discordapp.com/attachments/662742285959823360/670461983556108298/Tarkcompletedscars.jpeg*Most Recent  Artwork 1/24/20}{/p}\n{p:c}{link*http://imgur.com/a/UsD4f*Other (slightly older) Artwork!}{/p}\n\n{h1:c}{col:ff072a}The Skullcleaver{/col}{/h1}\n\n{col:ff8300}Proud to a fault and fierce in battle, Tark’ri probably isn’t far off when one thinks of an example of an orc. She stands just a few inches shy of seven feet tall and possesses a strong, powerful build from a lifetime of hard work and combat. At the age of eighteen the Tark’ri went through the trials to become a Wolfrider. She would narrowly survive the trials but in the end the young Warsong would make her ancestors proud by claiming that coveted title. She would ride amongst her fellow raiders as an equal and share in the glories of battle. \n\nSeveral years after Tark’ri established herself within the clan a mysterious orc showed up. He had the markings of the clan but nobody had seen him before. He warned them about the imminent doom of their people and the destruction of their planet. With this knowledge the orcish people would reject Gul’dan and his demonic masters, sparing both the orcs and Draenor a fate worse than death. Soon after the clans would come together to form the Iron Horde in order to conquer a new land which the stranger, who had come to be known as Garrosh, spoke of. It took many months to build the great portal but in the end the gateway was open and the Iron Horde charged through into the new world where they would meet the forces of Azeroth head on. \n\nTark’ri was amongst the initial wave that pushed through and alongside her brothers and sisters she cut her way through the forces of Azeroth, battling new and exotic enemies. All hopes of ‘glorious conquest’ were extinguished when the portal fell dark and Tark’ri and the others found themselves trapped on the strange new world without reinforcements. Those who weren’t killed were captured with Tark’ri amongst the latter. \n\nDuring the night her small encampment was set upon by Horde forces. After nearly an hour of combat the exhausted orc found herself surrounded with none of her comrades left alive. Refusing to back down, the Warsong let out a war cry and charged forth. She managed to take down eight of the remaining Horde soldiers before collapsing from her wounds. The ‘leader’ of the Horde party, a scheming little green rat, decided to take her back to Orgrimmar as a ‘prisoner of war.’ Once back in Orgrimmar, the Goblin would sell her off under the table to an arena master looking for quality prospects. The next two years of her life would be spent in chains, fighting in various arenas across Azeroth. During this time she would receive the name ‘Skullcleaver’ as the She-Beast took the heads of each of her fallen opponents. \n\nEventually the Warsong would manage to ‘claim’ her freedom but with no home to return to and no love for the people who robbed her of her pride, Tark’ri had very little prospects. The first few months as a free orc were spent swimming in ale and lashing out at anyone who looked at her in any way she deemed ‘funny.’ She was wallowing in self pity and hating the world around her and it wouldn’t be until she received one hell of a beat down from an elder green skin for her to snap out of it. She had one skill; fighting. She could put the past behind her and join the Warmachine but the aspect of that Banshee Bitch calling the shots outright killed that thought. Instead, The Skullcleaver returned to the arena to fight and earn a living to the roar of the crowds... {/col}\n\n",
