			["about"] = {
				["T1"] = {
					["TX"] = "{h3}Physical Description{/h3}{col:688bff}\nTall and moderately muscular, Grim could be a rather imposing figure. His right eye was covered with a dark, rugged eyepatch, leaving his yellow left ever-the sentry. He always seemed to be watching, listening, waiting. His fur, a deep and dark gray mixing with black, was plush but not puffy, and covered the worgen thickly from head to toe. It kept him more than warm in cool weather, though he very much seemed to dislike the heat. Two simple braids adorned the fur where his jaw met his neck, always neatly braided and clean of any debris. \n\nThough most were generally covered with armor, his body was littered with many, many scars, the bulk of which on his torso and upper arms. His most immediately noticeable was, however, poking out vertically from his eyepatch-covered right eye. The pink scar had never healed correctly and it stood out against his dark fur. A few other noticeable scars were what appeared to be a poorly-healed but wide puncture wound just below his left shoulder, a worgen bite mark on his right, a deep cut on the underside of his left forearm, and thin pink scars wrapping all the way around both wrists.\n\nHis human form differed somewhat from the worgen though both were considerably taller than the average. His dark brown skin was similarly marred with scars and he maintained his intense and inhuman yellow gaze, fangs, and claws. Shoulder-length dreaded braids decorated his head, more often than not they were tied back neatly while he was working, which was very often.\n\nThough generally hidden beneath the armor he almost always had on, he forever wore two necklaces; one housing several silver rings far too small for his worgen fingers, and one holding onto what appeared to be a worg’s tooth made of similarly silver metals.\n\nAlthough generally slow when he walked, he moved with elegance and in smooth, directed motions. In either form, would smell faintly of pine sap, and those with acute noses would notice a faint trace of lilac. \n\nHis voice was gravelly and deep and he spoke with a sort of quiet intensity. It was rare he raised his voice.\n\nVC: Idris Elba\n\nHis animal forms are Kodiak Bear, Lion, Golden Eagle, Leopard Seal, and Percheron (Travel form).\n\nBear: 5'7\" (at the shoulder)\nCat: 4'10\" (at the shoulder)\nHorse: 6'8\" (at the withers) (20 hands)\n\n{link*https://i.imgur.com/Oh9NUBQ.jpg*Bear Form}\n{link*https://i.imgur.com/HhJOiOK.png*Cat Form}\n{link*https://imgur.com/fE34oAH*Horse Form}\n{link*https://pestiluke.tumblr.com/post/613610035888668672/an-old-piece-of-my-main-wow-oc-in-his-human-form*Human Form}\n{link*https://i.imgur.com/MQ4fGyt.png*Human Form (Formalwear/Full Body)}\n{link*https://pestiluke.tumblr.com/post/613256422549045248/finally-finished-my-reference-pic-of-worgen-form*Worgen Form}\n{/col}\n\n{h3}Personality{/h3}{col:688bff}\nTo most he is a grumpy but quiet man, and a displeased frown coats his face nearly always. Despite this, he will often unnecessarily go out of his way to help people even if he won't admit it.\n{/col}\n\n{h3}History{/h3}{col:688bff}\nLong. But, you might know him if:\n-You're Gilnean\n-You specifically lived in Duskhaven\n-You were in Darkshore during the events following the Cataclysm\n-You were in Moonglade between Mists and early Warlords\n-You were present in the fight for the Broken Shore\n-You were present in subsequent fights for the Broken Shore\n-You have fought or worked on Argus\n-You were present in the first and subsequent battles in Darkshore\n-You worked with the Cenarion Circle in Silithus during the 4th war\n-You were personally a part of the raiding party of Castle Nathria\n\nWhisper me beforehand if you'd like to have a connection through one of these, and I'll give you the information you need to know!\n{/col}\n{img:Interface\\Pictures\\artifactbook-druid-theclawsofursoc:512:256}",
