				["T1"] = {
					["TX"] = "{h2:c}{col:9ceaff}.:Wandering {col:FFEA6D}Medic:.{/h2}\n{p:c}{link*https://imgur.com/a/zf8Ihg4*Rin Zizzix}{/p}\n{img:Interface\\QuestionFrame\\answer-PriestShadow:256:128}\n\n{h3:c}{col:FFEA6D}.:A P P E A R A N C E:.{/h3}\n{p:c}{col:9ceaff}Short in stature, just a little more then most other goblin women, She's roughly 3 feet in hight. The woman has a large chest, would be a handful for most races,  though she was kept in proportion by wide hips and a large rear. Long blond hair reaching down to her rear, bangs swept to the side to frame her dream like face. Her features giving her an etherial look, somewhat out of place for a goblin woman. A lip piercing going right through her lower lip.{/p}\n\n\n{h3:c}{col:FFEA6D}.:H I S T O R Y:.{/h3}\n{p:c}{col:9ceaff}Having spent most of her childhood training as a surgeon, she had little to no friends, mostly known as a stuck up prude throughout her neighbourhood. Though she achived her dream in adult hood, becoming a highly skilled surgeon and medic, hired to work on most battlefields along side many others. Training with a few forsaken in order to fully understand stitch work. Soon her skills where recognized by the light which had blessed her with a few gifts, bestowing the power to heal apon her, which she very quickly adopted into her work.\n\nnow she studdies some of the old, physical ways to mend someone outside of surgury and healing spells.{/p}\n\n\n{h3:c}{col:FFEA6D}.:H O O K S:.{/h3}\n{col:9ceaff}\n• Most goblins would know her if they grew up middle class as her family were well off, healers that worked on any injuries caused by.. experimentation.\n\n• almost anyone who was in the military or on a battlefield would know her for her skills.\n\n• She's almost always on her own, a face that is unlike most of her kind. tends to be able to be spotted in a crowd.\n\n• Has a sloth. (Daisy) always.\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n{img:Interface\\Pictures\\artifactbook-priest-xalatath:512:256}\n\n{p:c}Player Notes {/p}\n{col:FFEA6D}\n• I am anxious, Walkup's are adored.\n• Everything IC stays IC.\n• I prefer to keep things organic, walk-ups and all that. I don't mind making plans but prefer to do that if its for cross faction.\n• I tend to be a para-player. Though shorter in cities and light roleplaying.\n• I have 10+ years of rp experience, I'm supportive and happy to help new rp'ers learn and appreciate being tought a thing or two myself.\n• I am engaged irl.\n• Non-Binery, Literally any pronouns work, though I prefer \"they/them\" Thanks!\n• Sapphic.\n",
