				["CO"] = "Player is 27 Nonbinary\nLGB(T)QIA+ Friendly, Neurodivergent, extremely shy\nSemi-Para to multi-para rp'er\nBackstory a wip after TRP wipe.\nWalk ups are okay.\n",
