			["time"] = 1631048888,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-Frostfire-Magnarok:512:256}\n\n{p:c}Lavanya was born into a family of druids of the flame, and was raised into their ways. She knows nothing of her tauren herritage or customs. Extremely brash and harsh most of her life, she was a force to be reckoned with, even by her own cult. After a time, she became more and more aware of the destruction she truly caused with her fire, and the cataclysm opened her eyes fully to the truth. She defected, much to the dismay of her parents. She fled to the safety of the horde, where she was welcomed very hesitantly at first. She quickly proved her worth by aiding in the post-cataclysm effort to restore hyjal. She never saw her parents again, presumably because they fled into hiding when the majordomo was killed.{/p}\n\n{p:c}Lav now seeks to clear her name and reclaim the name she was given as a druid of the flame; The Burnt Horn, named for her blackened horns due to the flame magic she practices. Never hostile in form, she uses flame to tell stories and cast wonder upon those who are brave enough to approach. She uses either her staff or flaming daggers to conjure up the fire the bends.{/p}\n\n{h2:c}Appearance{/h2}\n\n{p:c}Lav sports a light brown coat that was formerly pure white at birth. She dyes her coat this brown to hide the singed fur underneath. Her warpaint reflects her alleigance to the flame and the promise to never use it for destruction. Her face is lacking much of the fur she used to have, especially her nose, which lacks it completely up to the middle of her snout. Across her body is a series of burn marks and scars, but much of it is covered by her armor. The only mark that remains exposed is one across her right thigh.{/p}\n\n{p:c}{icon:ability_mount_fireravengodmount:25}She is nearly always seen with a{icon:ability_mount_fireravengodmount:25}\nbird of some sort at her side, and is usually as firey in nature as she is.{/p}",
