			["about"] = {
				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["TX"] = "The assassin was a Pandaren who proudly showed off all he had to those looking. He was decently tall, with the right amount of chub and muscle. Whatever attire he had himself in, he left room around his stomach so it could jiggle freely. The brown and white fur that showed was clearly cared for; neat, and his beard and hair trimmed. His claws were clean, sharp...ready for anything. \n\nHe carried a far more formal outfit these days. A majority of it was colored gray, there was a few parts of the clothing that were dyed a dark red. The coat itself appeared to be made leather, but the overall weight of the attire appeared to be light. Underneath however, if shown, one could see that there was padding to keep himself safe during combat. He wore no shoulder guards with it, but he had gloves to protect his paws...with openings made into the leather to let his claws out. To finish it off, Dao almost always carried a pair of rapiers with him, and a belt with throwing knives on the sides.\n\nDao had two scars, one new, one old; a long slash from the top of his right shoulder, down to the middle of his arm. The whole line had areas of missing fur that never grew back.\nThe second would be seen if his chest piece was off. A horizontal, jagged slash showing on his stomach. The fur there has not grown back, showing a bare line of scarred flesh.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Dao never hid that he was a flirt; he was friendly, he told jokes and teases to get people to blush. He could be protective and supportive in a heartbeat...but he could also be one's worse enemy. He can come off as cruel at times, though it appears he has been trying to tone it down.",
