				["TE"] = 1,
				["T1"] = {
					["TX"] = "Asmodae Blackshade was a Sin'dorei mage during the scourge assault of Silvermoon City. Once the city fell, the aftermath left most of the survivors without the power of the Sunwell to sustain them. In this desperate time Asmodae turned to the Fel, submersing himself in it's addicting power. This gave him an insatiable appetite for even more power. A goal he found possible with a group known as the Illidari: those that follow Illidan. He trained, killed and did other unspeakable acts all in the name of the Illidari and gaining more power. With the fall of the Black Temple, Asmodae saw it as a lost cause and retreated to the Netherstorm. For the next few years he lost touch with reality and started to become more demon than elf. Eventually he would be found by the Shattered Sun Offensive and would nearly lose his life. They thought him a beast to be put down, his saving grace was that they noted he attacked only demons. They used him for a while clearing out demons that remained in the outlands and sheltered him bringing him back from the brink, having him relearn what he had lost. With the return of the Illidari during the Azeroth Legion invasion the Shattered Sun introduced him back to his homeland so that he may defend it. Even now he still struggles with even casual social engagements, and with no war currently, this is one of the more difficult periods of his life",
