			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}{col:6e2328}Kor'Kron Dossier{/col}{/h2}{h1:c}{col:ae693e}Agent File:26017-7{/col}{/h1} {h2:c}{/h2}{img:Interface\\Pictures\\artifactbook-hunter-cover:256:256}\n\n{h1}Name: {col:000000}[REDACTED]{/col} Skogar\nCodename: {col:ff001a} Zaisko{/col}{/h1}{h1}Designation:{col:abd373} Ranger {/col}{/h1}\n\n{col:653218}Agent skill list: Shows exceptional skill in Tracking, Sabotage and Target Elimination. \nOther noteworthy skills include, \n-Knowledge of Kal'dorei culture and military tactics \n-Proficient in the art of camouflage\n-Weapon Proficiencies: Axes, Spears, Bow (Agent refuses to use firearms), Swords,{/col} {col:363636}Staves{/col}, {col:1e1e1e}Daggers{/col}, {col:0b0b0b}Glaives{/col},{col:585858} Maces{/col} {col:653218}_____ (List extended multiple times over the weathered Dossier's lifetime.){/col}\n\n{col:ffffff}Agency Acquisition:{/col}{col:2f2f2f}Agent first considered for Kor'kron initiation program following return from Hyjal during the Third Invasion, Refer to{/col} Report form: LH-356 \n\n{h3}LH-356 : Squadron:Snowsong{/h3} {col:653218}Incident Report: Following the Battle of Hyjal, 36 out of the 38 members of Snowsong Squad were confirmed KIA following a Legion ambush. Snowsong had been ordered to reinforce a narrow pass with a small platoon of Kal'dorei sentinals. Upon further investigation of the skirmish, Signs point to sentinals abandoning the pass prior to enemy engagement. Reinforcements arrived to the pass to find the two survivors, Skogar, and {/col}{col:000000}[REDACTED]{/col}. {col:653218}Both were taken to the nearest outpost for medical care before being transported back to Orgimmar for recovery. {/col} {col:000000}[REDACTED]{/col} {col:653218}succumbed to injuries, leaving Skogar the last remaining survivor of Snowsong.{/col}\n\n{col:482c17}Shifting through the Dossier one can see page after page of Reprimand reports. One would catch your eye. {/col} \n\n{h2}Reprimand Form Z-163{/h2}{col:653218}{/col} \n{col:653218}Following the loss of the Barrens trade routes, Warchief Hellscream ordered every Kor'kron back to Orgimmar to hold back these traitor's little rebellion. Message through usual channels to Agent has been met with silence, When wyvern was dispatched for immediate extraction back to orgimmar, severed wyvern head found impaled on rear Orgimmar gates with an arrow was found two days later, Agent's standard issued medallion hanging from it. Medallion has been placed within dossier.\n\nAgent Zaisko has been designated for KoS if encountered, Proceed with{/col}{/col} {col:ff0f0f}extreme caution. {/col}\n\n{col:880808}Blood stains the bottom of the Reprimand Form, A crude spot remains unstained in the shape of a insignia.{/col}\n\n{h3}{col:f024ff}Hooks{/col}{/h3}\n\n{col:000000}Things that you'd likely know Zaisko from\n-If you are an Ex-Korkron/Currently Kor'kron (Yep. Lore wise they are indeed still around...just alot less racist)\n-Was stationed in Ashenvale\n-Participated in the Battle of Hyjal (Vaguely would know){/col}\n\n{link*https://imgur.com/gallery/ZCNB4EE*New Art 5/12/21!!!!}\n{link*https://imgur.com/gallery/54nvF0L*Art!!!!}\n{link*https://i.imgur.com/kzekxk4.png*Zaisko and Chompy}\n{link*https://imgur.com/a/F9AaDxc*Screenshot Story submission}\n\n",
				},
