				["TE"] = 1,
				["T1"] = {
					["TX"] = "Jandyssa Starweaver grew up in Silvermoon City with her parents, Thalon and Ellyn, and her older sister Serrana. Her parents were skilled astromancers who could divine the future from the movements of the stars. She was never as gifted in divination as her sister, but she did show skill in nethermancy. Jandyssa is the sole surviving member of her immediate family following the fall of Quel'Thalas to the Scourge.\n\nJandyssa later joined with Kael'thas's Sunfury forces in Outland, lending her skill as a summoner. She helped defend the mana forges in Netherstorm untli the Prince's defeat at Tempest Keep, at which point Jandyssa returned to Quel'Thalas with other defectors.",
