			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-warboard-mop-JadeForest:256:128}\n\n{h2:c}{col:fff946}\"If one spends their life constantly looking behind them out of fear there will be a dagger, they will not notice the wall they are about to walk into.\"{/col}{/h2}\n\n{h1:c}{icon:ability_monk_jadeserpentbreath:25}{col:3b24ba}Background{/col}{icon:ability_monk_jadeserpentbreath:25}{/h1}\n\n{h3}Born {col:2c9f6d}Artam-Yu Ironkeg{/col}, to the fishermen couple of {col:dac341}Teiwa{/col} and {col:2a8fae}Kuo-xi{/col} Ironkeg, Artam had spent her youth in the jungles and coasts of Krasarang, strengthening not only her muscles, but also her wits to help her father fish.  {/h3}\n\n{img:Interface\\Pictures\\artifactbook-monk-cover:256:256}\n\n{h3}Having started her teachings from the Celestials by heeding the teachings of Niuzao, through her first of many masters, Master Xiu. A wandering monk of the Black Ox who had came to Artam's fishing village in search of ingredients for a new brew. While there, Artam as a young girl sat in fascination before the monk, listening to his tales beside the fire. From that very moment, Artam knew it was the Four Wind's will for her to become a monk... Little did the young pandaren know what fate would befall her and her master.  {/h3} \n\n{img:Interface\\QuestionFrame\\answer-warboard-mop-DreadWastes:350:175}\n\n{h1:c}{icon:achievement_raid_mantidraid06:35} {col:930006}The Mantid{/col}{icon:achievement_raid_mantidraid03:35}{/h1}\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-8:64:64}\n\n{h1:c}{col:f2ff00}~WORK IN PROGRESS~{/col}{/h1}\n\n\n\n\n{link*https://imgur.com/a/rAmxTFg*Artam NSFW}",
