			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Kazrath  Is a large orc,  His lighter green skin was different than his fellow kin, he hailed from  a mountain tribe near winter spring.    At a glance he was quite the large orc, built exclusivley to fight. His Tribe prided themselves upon their warriors. \n\nWhen looking at Kazrath one would notice his pointed red mohawk, it was messy yet able to be played with into the positoin that Kaz liked.  As you continued on his face was void of scars, yet, if one would look at his canines they would see that he had them specifically carved into. The carvings were  that  of a Wargs head with axes behind it. ( Sorry for the hard core lore people I'm  making one up on the spot!)  Along his forearms Kazrath has  mostly tribal tattoos that wind themselves mostly along the forearm and bicep. The red coloring standing out along his lighter green skin. \n\nMoving lower and if one were able to see his chest, There were scars upon his back either a bear, or wars, one would have to ask them if they saw it.   Most of his scars are covered and one wouldn't see him as he is almost always seen with his armor on.   \n\nKazrath honored the battle field and carried a few trinkets from here and there with those whom he had battled. A few skulls that he kept as a trophy signifying the hunt but also his respect for them.  Even with that Kazrath would talk about the respect he had for his enemies. He believed that a true warrior should respect those whom he faces. \n\nRecently Kazrath had gone back to his winter home and had decided to tattoo himself. The tattoos ran along his entire body, the swirling tribalistic tattoos ran up along his face as well. Giving Kazrath a more fearsome appearance \n\nKazrath also is straight. \n\n( still working on a few more ideas at the moment)",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Kazrath like most Orcs finds honor to be very important. With this in mind, Kazrath is highly opposed of harming innocents for the cause of furthering war, or ones own agenda. If that turned out to be the case, you could bet Kazrath would oppose it. With that Kazrath values loyalty as well, If Kazrath deems you a friend, then you have a orc in your corner for life. \n\nKazrath may seem a bit gruff at first, but he is pretty easy to approach for anyone interested in talking with him. \n",
