						["TX"] = "Leigh Ravenwind comes from a well to do noble family from Silvermoon City. While they may not be the most recognized or well known, they do their duty with honor and pride. Well, all except for Leigh. This spoiled daddy's girl has little ambition or long term goal in mind. Instead spending her time drinking, partying and doing any form of narcotic that is placed before her. Unafraid to be cut off from her families wealth, this Sin'dorei spends the majority of her day sunbathing on private beaches or at Gallywix's pleasure palace. While her night usually consists of attending any party she learns about or batting her lashes at any man who seems likely to buy her a drink. .   \n\n***             ~~~ How would you know of Leigh? ~~~              ***\n\n\n**  She is the daughter of Lieutenant General Than'thelon Ravenwind, who took the Ravenwind House from a minor political relevance to an up and coming rise to glory through leading a field army of Spellbreakers and Magisters to victory over the Amani in countless wars.\n\n** The House Ravenwind name is becoming more and more common in discussions all over Silvermoon.\n\n** The House has many trade dealings with Bilgewater Harbour and various other Goblin Cartels.\n\n** The House is currently sending out political hints and feelers that they are up for discussing an arranged marriage with Leigh. They are seeking to use her hand in marriage to further their political rise in the Silvermoon courts.\n\n** You went to the University of Dalaran in recent years.  Leigh attended the University out of loyalty to her House, they told her she was going to enroll and so she did. But once there she had no interest in becoming a mage. Being the social diva that she is, she became the life of every party that was thrown by the student body of U.o.D.  ",
