			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:f30016}Sidaelea Everlight{/col}{/h1}\n{h2:c}{col:ffd100}Blood Knight of Quel'thalas{/col}{/h2}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n{h3:c}Former Crusader{/h3}\n\n{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}\n{h2}Early Life{/h2}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n{col:ffd100}Sidaelea was born in northern Lordaeron in 168 BDP, or Year 424 by the King's Calendar. Her first century was simple - help her mother and father tend to their ranch in between her studies, and whenever possible, spend time with the soldiers from Lordaeron and Quel'thalas if she could sneak away. For most of these hundred years, her intention was simply to take up the sword for her country, or if that didn't work, to take up a spade and hoe instead. She was a carefree, tomboyish child, and any thoughts of war were distant fantasies like storybook heroes. There were occasional scraps with the Amani trolls, certainly, and even the adventurous Witherbark hunting beyond their ken, but the thought that Sid Everlight may one day be a soldier never really crossed her mind.{/col}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-88:64:64}\n\n{col:ffd100}Sid first saw war of any kind around 75 BDP when the fledgling human kingdom of Stormwind went to war with the unified gnoll packs of Elwynn Forest, Westfall, Brightwood, and Redridge. Though it was a purely human conflict unaided by the seven kingdoms, an overly enthusiastic and idealistic young Sidaelea heard of this conflict and traveled for months to the south to lend her blade. Ultimately, she was only involved to a very minor extent, helping small human towns battle off Packlord Garfang's pack. Within a year, she was recalled to Quel'thalas and berated for involving herself needlessly in another nation's affairs.{/col}\n\n{h2:r}Entering the Priesthood{/h2}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n{col:ffd100}Following the Gnoll War, Sidaelea returned briefly to her parents' ranch before entering into the service of the priesthood in Silvermoon City to learn proper discipline. She had always heard of the Holy Light growing up, and like all of her kind, revered the Sunwell as the source of their magic, life, and culture, but she didn't fully understand the depths of the Quel'dorei's religious beliefs. This would change drastically in the years to come, as she spent much of the coming decades amidst the clergy. For nearly a century, she existed solely where the Light and the Quel'dorei needed her - which for the most part meant the Isle of Quel'danas, tending to the Sunwell, or in Silvermoon proper as an aid to the people.{/col}\n{img:Interface\\Pictures\\artifactbook-priest-cover:256:256}\n\n{col:ffd100}During this tenure with the priesthood, Sidaelea maintained her skill with the blade through late-night practice sessions beyond her own walls. Many among the priesthood were known to be skilled in such a way, and often armed themselves as needed to defend Quel'thalas just as the Farstriders and city guards. Still, their primary function was prayer and relief - at least until the Third War, when Prince Arthas Menethil laid siege to Quel'thalas in 20 ADP and resurrected the necromancer Kel'thuzad as a lich using the waters of the Sunwell. During the invasion, Sidaelea and a select few other survivors on the Isle of Quel'Danas holed up in the hills beyond the Plateau, fighting off whatever undead came their way. After this incident, the faith of so many was shaken, Sidaelea's included. The Sin'dorei were born, named to honor the blood of the fallen.{/col}\n\n{h2:c}Becoming a Paladin{/h2}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n{col:ffd100}Fifteen years prior to the fall of Quel'thalas, Sidaelea heard of the formation of the Order of the Silver Hand and the training of the first paladins. At the time, she thought nothing of it - but after losing almost 90% of the Quel'dorei, her people were attracted to the idea of holy warriors capable of fighting back against the undead Scourge. In those five years after Prince Arthas' attack, Sid donned her armor once more to aid the newborn Sin'dorei in reclaiming Quel'thalas. The progress, however, was excruciatingly slow, and with little to no direction, an extremely frustrated Sid followed Prince Kael'thas to Lordaeron.{/col}\n{img:Interface\\ARCHEOLOGY\\ArchRare-Demons:512:256}\nSidaelea was there for the betrayal of Grand Marshal Garithos, just as she was there for Sunstrider's pact with Lady Vashj of the naga. She escaped the dungeons of Dalaran alongside so many others, and from there, crossed through the Dark Portal to the extradimensional wastes of Outland. Shortly thereafter, once Illidan had trained the Sin'dorei to extract magic from alternative sources, Sid followed Kael'thas to Northrend and aided in their fight, though her role was minor and never on the front lines. Still, this experience would sow the seeds of doubt that the Prince was capable of leading their people effectively while vengeance ruled his heart.\n{img:Interface\\ARCHEOLOGY\\ArchRare-KaldoreiWindChimes:512:256}\nStill, when the Magisters proposed they create the Blood Knights using the sapped strength of the captive N'aaru M'uru, Sidaelea was there to take the oath. Now fueled by Illidan's teachings, a mana-addicted husk of her former devout self, she lusted for greater power. Anything, anything that would provide her some mode of destructive potential against the undead or any others who would oppose the Sin'dorei was well worth claiming - and it was with this mindset that she began to make a servant of the Light she once served herself.\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-BonesOfTransformation:512:256}\nIn those days and months that followed, Sidaelea did not return to Outland and was left unaware of their Prince's betrayal. She carried out the vengeance of the Sin'dorei in Quel'thalas once more, now armed with the broken Holy Light and the tutelage of their Matriarch, Liadrin. The Blood Knights carved a swath through the undead and eventually turned their sights upon the rest of the world's paladins, eventually burning down Alonsus Chapel to establish their own dominion over the Light. It was not until Kael'thas stole M'uru from the Blood Knight Headquarters in Silvermoon that their Order's eyes were opened, and behind Liadrin, Sid marched to Shattrath City in Outland to submit to the N'aaru A'dal.\n\n{h2}The Shattered Sun{/h2}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\nFollowing Kael'thas' betrayal, Sid followed the Blood Knights and A'dal in service of the Shattered Sun Offensive. For the better part of a year, she assisted in dismantling the traitor prince's operations in Netherstorm, and following his defeat in Tempest Keep, traveled to participate in the offensive on the Isle of Quel'Danas. Though she was not present for the actual battles with the fel-tainted Kael'thas or Kil'Jaeden, Sid participated in the siege of both to a minor extent. Her greatest involvement in the siege, however, was in the battle to retake Sun's Reach Harbor. It was here that she saw most active combat against the demons, and ultimately where she decided that she would always serve whatever unified fighting force stood against a larger threat.\n{img:Interface\\Pictures\\artifactbook-demonhunter-cover:256:256}\nSidaelea remained on the Isle of Quel'Danas for several months after it was reclaimed, aiding in the Shattered Sun's relief efforts there to rebuild and restore the resting place of the Sunwell. Despite that recent promise to herself, she was grateful for the opportunity to trade out her blade for a hammer and nails for a change. Of course, in what felt like no time at all, she came to regret those thoughts; an old enemy returned, and Sid rushed off to the north.\n\n{h2:r}The Argent Crusade{/h2}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}",
				},
