			["about"] = {
				["BK"] = 19,
				["T3"] = {
					["PH"] = {
						["TX"] = "Taller than most goblins. 4'11\" Lean muscled from years of labor and bruiser work, hair  usually long and tied back, noticable hair on chest and arms, No visible tattoos, and piercings only a girlfriend can confirm.",
