						["TX"] = "Honest, blunt, Flirtatious, Protective of who he deems trustworthy. Backs friends.",
						["BK"] = 10,
					},
					["HI"] = {
						["TX"] = "                    Birth and Youth\nBorn a year before te First invasion of Azeroth, in the desert of Tanaris, his parents worked and \"slaved\" for the Steamwheedle Cartel. Father was killed in a dispute over a water claim in te mountains north west of the city of Gadgerzan, His mother became a concubine for one of the underbosses who oversaw the cities water company. \n\nBy his late teens, having worked as a laborer for the same boss that routinely made use of his mother, he was taken in by the Steamwheelde as a goon.  He began to make his way though the ranks slowly, but in part it was a dual edge sword that guided him as one  he was allowed in cus of his mothers involvement be due to that also, he was used to keep his mother compliant to the boss's wishes and desires.\n\nYoung Adult and the Steamwheedle.\nHaving spent a several years being a Bruiser for the cartel, He finally learned fully how his mother was being treated. Now unable to touch the underboss who was abusing her (And serveral other women) he was how ever able to get into the Cartel via his size that impressed a made man in the group to bring him on as muscle. That is when friction began when his mothers \"boss\" learned he had joined another  mans crew. Meaning he was semi protected from being used against his mother.  After a few more years learning the trade, and serving as a Bruiser for both the cartel and city as a whole his size and skill increased more and more.  During the anniversary of Gadgetzan celebration, his mother watched as her boss, in a drunken rant. began to slap around his \"Ungrateful slut\" and degrading her and her son who, with his own boss and crew near by, Heard this and before anyone could stop him, he defended his mother, by killing her attacker.  Once the uproar was brought into control, He and is mother were hauled in, One crew screaming for his death, his own defending him citing the behavior of the murdered boss as proof the actions were due to Family loyalty.  Surprisingly, the new made boss of that crew defended him also, (particially cus he wanted the promotion and couldnt figure how to do it).  Boss Noggenfogger ruled on it citing the uncooth behavior of one o his underbosses was not tolorated and he granted favor to Karrik and let him stay within the organization.\n\nMother and Unmade.\nHaving narrowly escaped being put down for his defense of his mother, Karrik continued his work with his crew, working in Shimmering flats as laborer and guard. His mother had moved north to the port town of Rachet to start over, more so to avoid any other trouble for her son.  Now rumors began to surface from his crew that he was to be kept as a muscle goon.  No chance to move higher within the cartel, all fingers pointed to his killing of his mothers former master.  He, on his part was not to phased.  His enjoyment of being a goon and having some freedom from the rules that governed the cartel, his attitude toward not being able to become part of the cartel proper was mellow.  He did his job and enjoye perks of it. Be them parties, more coin, and the ladies. Ladies by far he came to know working in the desert city and its out laying business'. Enjoying a life of travel and other based delights town to town, it was in Ratchet that he witness the passing of the Horde, having just arrived and aided the Tauren tribes of the barrens he had heard of them being aided by goblins in their war against the Kolkar Centaur. \n\nComing of the Horde\nA year after the Orcs and their allies traveled north into Ashenvale, rumors came south out of the red hills (Now Durotar) of the quillboar tribes being routed out and driven into the southern barrens. Fighting said tribes from attempting to invade Ratchet he was there when the Horde came to aide them.  Intruged by these orcs and Trolls and Tauren, the goblins of ratchet immediately spoke of their city far to the south and setting up trade rights and business contacts. Karrik was one of the first to volunteer to travel to the new city of Ogrimmar to guard the trade envoys in this new  settlement.\n(More to come)",
