					["HI"] = {
						["TX"] = "Faenerel Autumnsky had aspirations of joining the ranks of magus in Silvermoon. Moving from the forests into their grand city left much awe and wonder to the elf in her younger years. Unfortunately for her, her ineptitude reared its ugly head. Her fellow students often gossiped behind her back and even her master was known to snide about his useless pupil. \n\nOften left to her own, her master soon becoming neglegent of his troublesome student, the aspiring magus transfixed herself within the libraries stocked within Silvermoon, oft finding herself helping students find requested tomes. One such search made her first discovery of the Fel. Untold, forbidden, terrible, powerful magics lay within, obviously the workings of what -not- to do least paying the ultimate price.\n\nAfter the destruction of Silvermoon beneath the Scourge's heel, Rel found herself as part of a caravan that soon stumbled upon the Sun King's burdened son. Pledging loyalty to him and saving their people, Rel operatedly loosely as a scout until they were all imprisoned by the Grand Marshall. Their subsequent escape into Outland left the elf questioning her usefulness and place within her people's shattered society. Then came an offer she could hardly refuse...",
