		["03311054424ryPv"] = {
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1:c}Appearance{/h1}\n\nChòu is a pandaren man of average height and above average weight (Even for pandaren!), he is an older man in his sixties, with light grey fur and a slightly hunched posture. The first thing you'll likely notice about him is his usual attire: The old cook is almost always wearing his favourite white apron atop his green flannel shirt. He sometimes even brings out the chef hat! Especially when he cooks in front of people.  \n\nUpon further examination, you'll find that Chòu's fur clearly has a fluffy appearance. Thanks to his renewed interest in personal hygiene, Chòu now has well-kept, soft fur as well as a pleasant woodsy scent. He may be missing a couple teeth from his earlier years but they are now kept nice and shiny. The old bear is proud of his sweet smile!",
						["BK"] = 1,
						["IC"] = "achievement_cooking_pandarianmasterchef",
					}, -- [1]
					{
						["TX"] = "{h1:c}Personality{/h1}\n\nChòu is an eccentric man who takes great pride in his unusual cooking practices. He waddles around with a gruff, haughty demeanor, with his voice being loud and confident. The old cook can be quite sweet however, he enjoys mentoring others and acting as an uncle figure to everyone he comes across, always insisting others call him \"Uncle\".",
						["BK"] = 1,
						["IC"] = "achievement_profession_chefhat",
					}, -- [2]
					{
						["TX"] = "{h2:c}Uncle Chòu's: Mulgore - Menu{/h2}\n\n{h1:c}Noodles{/h1}\n{p:c}Vegetable Medley Ramen{/p}\n{p:c}Lotus Root and Spicy Kodo Ramen{/p}\n{p:c}Uncle's Flaming Hot Mushan Ramen{/p}\n{p:c}Plainstrider Soba with Mulgore Spices {/p}\n\n{h1:c}Rice{/h1}\n{p:c}Egg Fried Rice{/p}\n{p:c}Seafood Fried Rice{/p}\n{p:c}Uncle's Bento - Bento box containing white rice, a green salad, five fruit dumplings, and your choice of tempura shrimp or squid karaage {/p}\n\n{h3:c}Big Breakfasts (Served all Day!){/h3}\n{p:c}Bacon and Scrambled Eggs{/p}\n{p:c}Chocolate Chip Pancakes and Maple Syrup{/p}\n{p:c}Mixed Berry Pancakes and Maple Syrup{/p}\n{p:c}Pan-Fried Kodo Steak and Hashbrowns {/p}\n{p:c}Uncle Chòu's Hungry Tauren Special{/col} - Five kodo sausages cooked in bacon grease served with baked beans, mushrooms, and fried eggs. Served with a side of country gravy.{/p}\n\n{h3:c}Sushi{/h3}\n{p:c}Spicy Crab Roll (x6){/p}\n{p:c}Tuna Roll (x6){/p}\n{p:c}Smoked Salmon Roll (x6){/p}\n{p:c}Tempura Yam Roll (x6){/p}\n{p:c}Sweet Potato Roll (x6){/p}\n{p:c}Anago (Salt water eel) Roll (x6){/p}\n\n{h3:c}Delicious Desserts{/h3}\n{p:c} Glazed or Sugar Donuts (Half dozen or full dozen){/p}\n{p:c} Pound Cake (Comes in lemon, double chocolate, strawberry, and cinnamon raisin{/p}\n{p:c}Ice Cream Flavour of the Day{/p}\n{p:c}Squdge (Squid and chocolate fudge){/p}\n\n{h3:c}To Drink{/h3}\n{p:c}Kafa{/p}\n{p:c}Hot Chocolate{/p}\n{p:c}Tea - Green, Oolong, Pumpkin Spice, Chamomile, Chocolate and Mint Chocolate{/p}\n{p:c}Coffee{/p}\n{p:c}Chocolate Milk{/p}\n{p:c}*NEW* Milkshakes - Vanilla, Chocolate or Strawberry {/p}\n",
						["BK"] = 1,
