				["v"] = 80,
				["CO"] = "Hi!\nAmateur roleplayer here. GW2 roleplayer as well! Character exists as a Flame Legion Charr Renegade.\nVoice claim: E.T.C. - Heroes of the Storm.\nLG[B]T+ Friendly!\nWalkups welcome!\nLet's do high M+ keystones. c:",
