			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1:c}{col:9d200e}The mightiest moose bull! He swings that hammer, smelt those iron, forge those beautiful weapons...{/col}{/h1}\n\n{img:Interface\\LFGFRAME\\LFGIcon-NeltharionsLair:256:256}\n\n{p:c}{col:9d200e}The large moose bull stands before you. His looks is unkempt, especially his mane. In a rare occassion he is seen groomed well with a flamboyant mohawk. His face looks stern, but is actually sweet and rambunctious in heart. He has a nosering, and two more gold earrings on his left ear. He could make up a smug if you try to get his attention, and if he likes you. His body is sturdy, balanced and muscular with a bellygut. He has piercing on his chest nipples as well as some scars on his torso from accidental forgework. One could feel his firmness and the warmth if you try to feel his body. He loves eating and drinking, working out and also hammering his weapons by the anvil of his forge, and he's not afraid to show you how strong and attractive he is with that male body of his. Beneath his body lies a crushing thighs between his legs, and a nice pair of hooves to stomp around with. He makes sure he doesn't skip leg days. Sometimes.\n\nRoarmulus lives by his family name of Flintstone. His herritage branches onwards, and up to him that the blacksmith work has been going for years and on. It is easy to remember how he forged the weapons for all tribes of Highmountain. During the Burning Legion Invasion, the requisition of his wares surged in priority for the battle against them, and he tries to keep in pace to get everyone armed against his people's enemies. It was a rough time during then, and now his work subsides, but peace came short when the Horde reaches out for the Highmountain. He is packed on his work, and it is difficult for him to ship his wares over to Orgrimmar, so he had no choice but to move there, despite the political business he's facing. He did what he could for the war, and when it came to an end, he relaxed for a little in the town, and sets his next move to venture across the world of Azeroth.\n\nRowdy moose bull he is, he can be very boisterous and loud, and could drink like a bottomless drunkard on the taverns. He usually is a chaotic type that can cause any trouble when he overdrank. Outside of it, he can be nice if you get onto his good side. At home, he has two poultries pets he lives with and feeds them whenever he's around. Thankfully, his tribefolk are very nice and takes care of them.\n\nThe heart of the forge lives with him, so long as he walks, it burns bright.{/col}{/p}\n\n{p:c}{link*https://imgur.com/a/DkoQ60s*Flint portrait, rough sketch @ me}{/p}",
