			["about"] = {
				["v"] = 29,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "                          ~~~~ Childhood into Adulthood~~~~~\n\nOnly a year or two old when the Legion Corrupted the Orcish horde of Draenor, his parents members of the Whiteclaw Clan, were amonst the few who did not partake  of the tainted blood of Mannaroth NOR was he taken by the warlocks and aged drastically to make warriors for the Horde.. He remained within Draenor until the year Ner'zul thought to reopen the portal to other realms (circa Though the Dark Portal) joining his father in the small incursions with the Warsong into Azeroth, when the alliance counter attacked he was taken hostage  and held, as an oddity as he was NOT green as many other orcs. After the defeat of second invasion and destruction of Draenor into  Outlands, he was taken and thrown into one of the many Intermentcamps the humans made to hold those orcs they captured.\n\nSeeing this youth had energy and  spirit the humans of his camp soon used him as physical labor.  As he grew a day came he was sent to the forge to work the bellows. There his body took on its muscled girth common to orcs, the forge production doubled with his help.  Soon the forge master gave the youth a chance at the anvil.  First it was merely ingots and horse shoes and nails the youth pounded out.  Then the forge master took kindly to the orc and began showing him how to forge Armor only. Soon the Orc was skilled at ring mail then soon forging breastplates.  The Forge master kept him to armor only as it was frowned on to teach the ENEMY how to forge weapons. As the youth grew he snuck about watching training, and guards of the camp engaging in practice, he attempted to practice his own skill at arms. Jokingly some guards found this out and decided to use him as a test dummy for younger troops to deal with the Larger Orc, preparing fpr dealing with a Orc clan uprising in the Altrec mountains.  \n\n                ~~~~~~~Coming of Thrall And the New Horde~~~~~~\n\nOne day the youth met a green skin orc hear his age, a recent captured orc who began speaking to the orcs of the camp. Listening to this empassioned Orc and seeing his skill of the  element.  Opening the forge to this orc and those who roused to the call to escape he joined Thrall and orcs of the camp to break out and flee into the mountains to join with the Warsong and Frostwolf clans. Joining this new horde he was trained as much as he could be but soon his skill as a smith were seen and he did what he could to aid the horde, even going so far as repairing Thralls armor at times.  Soon the Horde made its exodus to Kalimdor, following Thrall and Grom Hellscream.  Fighting with his people though the Barrens and Ashenvale and surviving the battle of My Hyjal.  As the dust settled from the Third war, the Youth looked out on a new land and new life.\n\n         ~~~~~~~~~~The Establishing of Durotar and Kalimdor~~~~~~~~~\n\nIn the aftermath of the War with the scourge and legion, surviving his wounds, the Young warrior traveled with the Horde to establish the city of Orgrimmar, as the city was established, he traveled with Orcs into the barrens to help establish and maintain a trade route between Orgrimmar and new Tauren settlement of Thunder Bluff in Mulgore.  During this he aided those who wished to settle in the new town of the cross roadsbuild their homes.  This lead to the first and not the last time battles with both Quilboars, who were driven out of Durotar, and the Kolkar tribes, who were still out for blood when the horde first came though the barrens and aided the Tauren.  The first battle of such culminated in a joint attack by both Quilboars and Kolkar  on the new town of Crossroads, here the Young warrior aided and for a time took charge of the defense of the town.  With the arrival of troops from Orgrimmar to break the attack Cross roads was saved from sacking.  Seen by those as a warrior worth his skill, he was given rank with the Horde's military soon he was seen in many a place though out Kalimdor. Witnessed the establishment of ThunderBluff, Orgrimmar and Taujaro, Stood with the ranks that battled and repeled the invasion of Admiral Proudmoore's fleet of Durotar. It was during this that he caught the eye of commander Keithoo, a subcommander of the Kor Kron Elite, the recently established Guard of The Warchief.\n\n                 ~~~~~~~~~~Rising though the ranks~~~~~~~~~~\n(Time begins at time of Vanilla drop)\n\nOver the brif years following the Proudmoore invasion attempt, he served in Orgrimmar and surrounding settlements routinely. Aiding in defending Horde lands from the ever present Kolkar and Quilboar raiders.  With the joining of the Forsaken to the ranks of the Horde, he was hesitant to travel back to the eastern kingdoms, as much for lack of trust in the Scourge rejects, as for tangling with Alliance forces.  With the arising of the Dragonkin Onyxia and Nefarian in their attempts against both Horde and Alliance, he adventured though the lands doing what he could to aide his allies.  Just as these settled and a small peace would be seen, word came that the Blood Elves of Silvermoon had not only been granted addition to the horde but also though the actions of Kael'thas, opened the portal and such brought rumor of surviving lands of the once mighty world of Draenor.\n\nWith this news, the Warrior joined, with partial invitation from Thrall himself, who recalled the brown orc from the camps, the force sent though the portal to investigate the going ons of both the alliance and the Blood Elves.  Rejoicing in seeing the lands of his birth still thrived he eagerly took part in many of the Hordes actions within Outlands. It was during this that the warrior was given honor. The warrior was amongst the first to reach Nagrand and discover the Mag'Har village of Garadar and the presence of both the Great mother Geyah and Garrosh Hellscream.  At once he raced back to the portal and back to Orgrimmar, and brought forth by Commander Keithoo. He reported his findings to Thrall.  With all this Warrior had done since the camps and praised by many of the Grunts and commanders in the field, Thrall honored the Warrior with the chance to join the Kor Krom Elite.  Donning the Black and Gold, he returned to Outland as part of Thrall's guard as he went to visit The great mother and son of his closest friend.  With the defeat of Illidan and Kil Jaden in outland, the Horde returned to Azeroth. As things settled rumors came, via Jaina Proudmore and other contacts in Eastern Kingdoms, that a disturbance had begun in the far north.... \n\n~~~~~~~~~~~~~~~~~~~The Lich King to present time~~~~~~~~~~~~~~~~~~~\n\nThe Invasion of the scourge back into the lands of the Horde and Allaince took many by surprise at the suddeness along with the precision strikes at most of the capitol cities in an attempt to slay the current rulers.  The warrior rose quick with the rest of the KKE and defended Orgrimmar and the Warchief from the undead invasions.  With the knowledge that the Lich King was one again arisen and planned to again take the world by storm, The warrior was given command of a small troop and dispatched with the larger force under comand of both Garrosh and Saurfang to counter the Scourge in Northrend.  Arriving in Northrend, the War against the Lich King began.\n                            \nServing within this elite corps, he took to the fields of Northrend,  Fighting though Northrend as sub commander to the newly promoted, Warlord Kiethoo (PC), he fought though most of Northrend securing foot holds for the invasion of Ice Crown, he nearly died when he and his team were caught in the attack on Wrathgate. Watched in horror as the forsaken betrayed the Horde and Alliance with their massive attempt to use poison and blight to kill all in sundry.\n\n  Surviving the Betrayal at the Wrathgate and the final assaults on Icecrown, he returned to Kalimdor and for a time took leave of the Elite and traveled the land as more of a mercenary. With the advent of the Cataclsym, and Deathwinds return, he once more took up the Black and Gold to aide in rebuilding and containing the heighten threats between Horde and Alliance.  At first delighted with the appointment of Garrosh to Warchief, he soon saw this was a change, as the Kor Kron of old was sent on increasingly dangerous missions and a new corps of Kor Kron was being raised with each death of Original KKE.  After the defeat of Deathwing, came the discovery of Pandaria, here the tensions Grew between those of KKE as Chuk, and others, noticed and even endured the  outright hostilities between the Old and New guard. Though out this he still served the Warchief hoping it was merely misunderstanding..  Then came the cull.  \n\nThe Cull (RP events in Orgrimmar undertaken by Orcs RPing as Kor Kron)\n\nGarrosh's plans and ideas became zealotous with his followers, and New Kor Kron and the old Elite began clashing in the streets of Orgrimmar.  Those left of the Old Guard, attempted to dethrone Garrosh after his plans in Pandaria became known and with his many deeds to divide the Horde races.  This Failed.  Many old Kor Kron Elite were slain out right and chased and fought though the city.  Several of the Black and Gold's were captured, Chuk himself but due to a lack wit of a warrior guarding him, escaped and succeeded in rescuing several Black/golds before they were taken south and exicuted.  The next few months, leading up to the Siege of Orgrimmar, the surviving Black/golds lead small missions though out Kalimdor showing that not all Kor Kron were now murderers and wholely devoted to Garrosh.   Participating in the Siege, Chuk'Atrok was not amongst the lead elements to defeat Garrosh, he had continued with the fighting in the City proper.\n\nReturning Home.....Sort of?\n\nSince the end of the Siege, he has taken to a mercenaries life again, unable to wear his Black and Gold, even in memory of what was, would lead to him being attacked.  Still serving the Horde he learned of a new threat beginning, the portal had opened again and this time, militarized Orcs, Brown of skin had invaded though the portal.  Not knowing first hand of what happened after the fall of Garrosh, he was surprised to learn this invasion was from.....Draenor?\n\nHurriedly he joined the Horde in its counterattack and beheld the Land of his birth As they were before the legion, though these lands were also changed as these orcs were mobilized in a new Horde but one lead by orcs not the Legion.  Seized by both joy, curiousity and abject lust to see his homeland as it had been, he took to the campaign against the Iron Horde. At first he was hesitant in his actions, but soon though the ordeal things came to light to show the under side of the story and again the Legion at work. Renewed effort to aide both Horde and Frostwolf clan to stop the  Ironhorde, and make them see the threat of Gul'Dan (Again) he aided in the downfall of Gul'dans plans.  Sadly a choice was made as he had strong ties to the Draenor that was and this altered Draenor that could be.  He chose to leave and return to Azeroth.  These events led into the resurgance of the Legion In Azeroth... the cycle continued....\n\n\n\n\n\n",
