						["TX"] = "---------------------------------------------\nStaple Pieces:\n\n- Truesilver necklace with an oval turquoise pendant. Details in About.\n\n- Bracelet-watch on her left wrist. Details in About.\n\n- A simple anklet made of peridot gems spaced evenly on a plain gold chain. A little lotus design sits in the center of the chain.\n\n---------------------------------------------\nTransient Pieces:\n\n- Outfit-matching earrings and necklaces will be worn. Just look at character model!\n\n- Jeweled hair accessories, such as gem-encrusted barrettes and headbands, are also common.",
