			["about"] = {
				["T1"] = {
					["TX"] = " {h2}Physical Description{/h2}\nElinore is a young woman of average height and looks to be in her early twenties. Typical of most women, her nose is slender and jawline is soft, tapering downwards to a delicate chin. The corners of her lips are a little upturned, making it seem like she's always smiling faintly. She has large round eyes in a light turqoise hue and they're framed by long, curled lashes and slightly arched brows. Ellie is not one for heavy make-up, other than on rare, special occasions. She's usually found fresh-faced, only opting for brown mascara to define her lashes and some tinted gloss for her lips, with colors ranging from warm pinks to soft corals. Her hair color is a rich honey-blonde, with strawbery blonde undertones and highlights mixed in. It hangs mid-way down her back where the bottom half is naturally a bit wavy. As for her build, she looks fit and slim, but not overly thin.\n\nHer features are quite expressive, therefore it's rather easy to tell her mood. However, with effort, she is capable of concealing her feelings and conjuring up a neutral visage.\n\nHer attire is indicative of a fortunate upbringing, but her gait and posture, while graceful, lack the rigidity of noble birth. She appears to be someone who's quite relaxed and easy-going. Hints of an extremely slight Gilnean accent surface at odd times when she speaks, and this heritage is also glimpsed in her features.\n\n({link*https://imgur.com/a/k3LeyTo*This} is what Elinore looks like!)\n\n\n{h2}Other Details{/h2}\n{icon:inv_trinket_80_kultiras02b:25} Bracelet-Watch\nIt's mostly a bracelet with a small, delicate clock face in the center. If you pay close attention, you'll notice she has many of these, all done in different metals, with the bezel of the clock face done in different gemstones (specifically the 12 birthstones). They almost always match whatever outfit she wears. \n\n{icon:inv_jewelry_necklace_64:25} Oval Turquoise Necklace\nA naturally shaped oval turquoise pendant dangles from a delicate truesilver chain. The semi-precious stone is framed with a thin, but elegant silver bezel. The gem itself is a vibrant hue with thin gold veins running through it, and it matches the color of her eyes nicely. This piece is not used to match outfits, and is usually tucked underneath collars. It is also sometimes layered with other pieces. {link*https://imgur.com/a/mXY3nRa*Picture of the Gem!}\n\n{icon:ability_ghoulfrenzy:25} Faint Scar\nIf she's wearing short-sleeves and you have a good eye, you can see on the inside of her left forearm are two very thin and faint parallel scars, about 3 inches long. They're barely noticeable at a glance, but are visible upon close inspection.\n\n\n{h2}OOC Information{/h2}\nPersonality traits and other details have been left out of this profile on purpose. Please come roleplay to find out more! =)\n\nI use the Musician addon and its Piano plugin for Einore's piano playing. If you'd like to hear the music, you will need the addon and the plugin.\n\nDisclaimer: All credit for the songs Elinore plays in-character goes to their original composers, as well as the musicians who arranged the scores.",
