			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-embercourt-security-maldraxxusarmy:256:128}{icon:spell_necro_deathall:25}\n\n\nAfter being fed up one day in Orgrimmar, he decided to leave the city for a nice long quiet walk. Making his way into Azshara to the coastline for some salty ocean air he noticed up the beach a campsite. Giving in to his terrible habits he ran up to the camp to rummage whatever goodies he could find.\n  \n Out of the ocean came a naga witch grabbing him by the throat with her magic. \"ssso you come to take my trinketssss have you\" she cackled. He grabbed at the arcane tendrils wrapping around his throat but his paws passed through them. The seawitch cackled slamming him to the ground. \"I think I know a proper punissshment for you\" as she enveloped him in a green toxic mist. He felt faint never experiencing this type of magic before. He collapsed to the ground choking.\n       \nPickles woke up hours later looking around, the tide moved in and the seawitch and her camp were gone. He stood up confused looking down at himself... or herself? \"what did she do to me?\" Pickles yammered. Walking over to the water he looked down at his reflection, or.... her reflection. \"I.... i'm changed?\" she stared confused and angry. \"That cursed sea witch changed me into a vixen!\" She took a few moments to stare out at the ocean eager to catch the seawitch, but all she heard was her cackling off in the distance.\n\nShe made her way back to Orgrimmar, unsure of what others would think of the change. She didn't overly mind it though as she kept looking at her reflection. \"looks good honestly.\" she sighed, \"gonna be a shame to have to go back\"\n                                      {icon:spell_misc_zandalari_council_soulswap:25}",
				},
