					["TX"] = "{img:Interface\\QuestionFrame\\answer-warboard-wod-FrostfireRidge:512:256}\n\nHonor, Ferocity, and Discipline...these are the traits of a Frostwolf Warrior. Vrothenar carries these ideals with him in as much as he is able...though there was one time in his life where his Feral nature got the better of him. \n\nEarly life was as any other Frostwolf...hunt, eat, sleep, repeat. Mother and father were proud members of the clan...strong and generous. It had been only years after his birth hat this orc was killing game that even more elder hunters would hesitate to pursue. \n\nTragedy would strike without mercy as the boy witnessed his father and mother beaten to death by ogres his mother having almost been raped if it were not for the actions of his father. When their broken bodies laid before him, he remembered precious little of what transpired. All Vroth knew is that when he finally came to he stood in the center of a massacre...the small raid of Ogres having been slain by ferocious methods...throats torn out by his teeth which then dripped blood and soured his tongue with the filthy life essence of those who stole his life from him. \n\nAfter being found by a regularly visiting family, Vrothenar was taken to a nearby village where he was then adopted by the Elder. Over the years he would learn more of what it meant to be Frostwolf and the ideals passed along from one generation to the next...the responsibilities and the undaunted vigilance of protecting family and clan. \n\nHe grew and his skill followed in tandem in fact as he managed to grasp at the attention of one of the Warsong...a commander who held close ties to a few Frostwolf homes including the elder that took him in. Seeing that he honestly had taught the man everything he could...the Elder granted a blessing to Vrothenar to train under the Warsong...to expand upon the ferocity that slain the ogres so long ago.\n\nDays turned to months turned to years all within the span of what seemed like minutes to the Frostwolf. Trained to wield an ax with the strength that resembled Chieftains of old. When properly trained to the standards of the Warsong, the Frostwolf warrior would join them on raids against the ogres as well as rushed defenses of villages and through this the orc gained trust which was rewarded with an ax of the Warsong which screamed as most of their weaponry did when swung. \n\nAfter this the Frostwolf would find himself confronted with a living member of what he thought to be a dead lineage. His uncle...a powerful shaman with abilities gained from a lifetime of dedication to the elements would confront him and through him was given yet another gift. His ax which was masterfully crafted was then imbued with the power of Spirit. A fifth element that grants him the strength to hew through even the toughest of armors with a seemingly minuscule amount of effort. \n\ntbc\n\n\n",
				},
