				["v"] = 15,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h3:c}{icon:achievement_character_bloodelf_male:25}{col:c65d39} Physical Description {/col}{icon:inv_summondemonictyrant:25}{/h3}\n\n{p:c}{col:c1a635}Malanguine is built to be sturdy. He is average height and weight for a muscular built Sin'dorei. Unlike most of his Illidari kin, Mal does not sport any of the usual signs of demonic corruption aside from his eyes, which overflow with Fel energy. His chest is adorned with vibrant red tattoos that were placed during his binding ritual. Upon close examination, the tattoos appear to be a flowing river of energy.\n\n{link*https://imgur.com/a/wqbwARd*Art}\n{col:ababab}{/col}\n\nBound to Malanguine is a Doomguard by the name of Vo'zurth. As a result of this binding, Mal is granted immense physical strength and an otherwordly tolerance for pain. When transformed, his skin becomes covered in rigid scales and two pointed horns sprout from his head. \n\n{link*https://i.pinimg.com/originals/aa/20/1e/aa201eeeb9616f1255432fde17ca6527.jpg*Demon Form Reference Art}\n{col:ababab}(Not my art, if you know the artist, let me know so I can credit){/col}\n{/col}{/p}\n\n{h3:c}{icon:ability_demonhunter_eyebeam:25}{col:c65d39} Personality {/col}{icon:spell_shadow_demonform:25}{/h3}\n\n{p:c}{col:c1a635}Malanguine is a friendly individual, though sometimes that manifests itself in the form of sarcasm. While not the smartest person around, there is very little that Mal wouldn't do to help a friend. Always the first to leap in to the fray and the last to leave it, Mal is never one to shy away from conflict. That being said, he will actively try to keep his friends and allies out of harms reach if he can help it. Every hit he takes is one his allies dont have to.{/p}\n\n{h3:c}{icon:inv_misc_tournaments_symbol_bloodelf:25}{col:c65d39} History {/col}{icon:crest_demonhunter:25}{/h3}\n\n{p:c}{col:c1a635}Malanguine spent a large portion of his life as a farmer. There was nothing extraordinary about his life, as he minded his business and rarely partook in gossip. It took a Legion raiding party destroying everything to shake things up. The raid was led by Vo'zurth, who took great pleasure in murdering Malanguine's wife in front of him, then leaving the broken man to pick up the pieces. Equipping himself with what he could and rallying other farmers who had been ravaged, he led a mob to strike back at those who took everything from him. He personally sought out the doomguard and fought him, giving every ounce of energy he had to strike down the beast. Making sure not to finish him off, he dragged the bound demon across the land until he had found a group of Illidari. Marching in to their camp and demanding to join their ranks. His only condition was he wanted to be bound to Vo'zurth or die trying.\n\nThe process was far from easy. It took three full days for Mal to completely dominate the demon and bind him, however through pure strength of will, he managed to do it with minimal corruption. Following through on his oath to the Illidari, Mal followed them in to the fight, often making his way to the front lines and clashing face to face with the Burning Legion. He fought with reckless abandon, volunteering for missions most deemed suicide. He spent much of his time during the war working with a squad developed purely to hold the line while others retreated.\n\nAfter dealing with a harrowing experience in the Shadowlands, Mal is left trying to make sense of his life. Many of the truths he had taken for granted have been exposed as lies and coming to terms with that is no easy feat. The best he can do is take it one day at a time and choose who he trusts with great care.\n{/p}",
