			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\n\n{p:c}{col:ffa156}Fairwind is a woman forged in the very ideal of her faith. Righteous and just, this devout follower of the Light encompasses the very core of what it means to be a protector. To give without a thought, she shines with a reserved benevolence. To face her in battle, she is a composed structure of war, bent on defeating those whose cause is truly lost. No truth may hide from the divine matriarch, for she sees all with the Light as her guide. \n\nCoalesced light creates a dense nimbus around the woman's head, highlighting her features and making her presence immediately known. The light bathes her face in heavenly rays, revealing sacredly scarred tissue of a woman built from a lifetime of war. Citrine locks pool against pauldroned shoulders. Delicate ringlets curl around a mature visage, framing her marred cheeks and occasionally falling into her line of sight. Diverse shades of silver course throughout the gemstone thicket, catching the light every now and again. The petals of her pallid lips curl into a weary smile; rarely ever enough to show her teeth. Jadefire light illuminates the pointed features of her face, originating from her eyes. Beneath them, the lilac crescents of isomnia accentuate the tender flesh. The tell signs of age wear at the woman; warranting her natural beauty unworthy. \n\nShe is a woman of boisterous curves and bountiful musculature. A pristine set of plate armor adorns her brutish figure. Rarely ever is she seen out of warmetal.  A pair of hardened gloves conceal her calloused and scarred palms. Her muscular thighs are contained by seemingly indestructable legguards. Bulky clompers snake up her wiry calves, and hitch up to her knees; a vague incline is present in her soles. An austere hammer or shield and sword are often casually slung against her back. \n\nHycindel's voice is a sultry, Thalassian  croon. The raucous melody of her voice carries a refined arrogance. Her accent, though slight, is a plague upon her rich vocabulary, rendering her unable to pronounce complex syllables.{/col}\n{/p}\n",
