			["character"] = {
				["CU"] = "Wondering where the hell is his wife is at?!\nWater Totem HP: 3/3",
				["CO"] = "Lore Abiding\nRarely IC in cities\nTargeting you = Reading your TRP most likely",
				["RP"] = 1,
				["LC"] = "enUS",
