				["v"] = 64,
			},
			["time"] = 1631149288,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Moonlight:512:128}\n\n{img:Interface\\PVPFrame\\Icons\\prestige-icon-3-3:128:128}\n\n\n{icon:inv_jewelry_frostwolftrinket_01:25}{col:1455ff}Kar'kash Shadowhowl or \"Kark\" as he prefer to be called by his friends is an acomplished shaman from the Frostwolf clan, born and raised within the Alterac Mountains. When he came of age, Kark was put under the tutelage of a Farseer named Krel'noz who became the boy's guardian after the tragic death of his mother and older brother. Together the two shamans fought tusk and nail in the battles for Alterac Valley. Over the time fighting agaisnt the Stormpike Dwarves, and the Alliance, Kark has grew a deep and passionate hatred for the Dwarves and the Humans for the deaths of his mother and the gruesome torture they inflicted onto his older brother who he found the broken corpse with his fingernails torn off and a letter stabbed through the skull with the name of the Dwarf who executed him.{/col}\n\n{img:Interface\\QuestionFrame\\answer-warboard-bc-Nagrand:512:256}\n{h1:c}{col:5e821a}The Winds of the Ancestors{/col}{/h1}\n{col:5e821a}In the coming years, Kark and his mentor Krel'noz traveled through the Dark Portal once word pass that adventurers reestablish contact with the Mag'har who found refuge in Nagrand. Together they journeyed to Garadar where Krel'noz met his long lost wife and granddaughter and Kark met his ailing grandfather who revealed to him his Shadowmoon heritage and the history of their bloodline. As well passing down {col:2c03ae}The Shadow Wolf Cowl{/col} {col:5e821a}onto Kark before his passing during that same evening. In the following days, Kark, learned more of his people's history and their past connection to the elements of Draenor. He gradually grew to feel a stronger familiar connection to the shattered remains of Draenor than he had for Azeroth. Although he secretly long to stay in Outland he knew that it was a dying world and together, him, Krel'noz and his granddaughter returned to Azeroth.{/col}\n\n{h1:c}{col:2c03ae}The Shadow Wolf Cowl\n“Under the shadow of the moon, the black wolf howls.”{/col}{/h1}\n{img:Interface\\LFGFRAME\\LFGIcon-Draenor:256:256}\n{p:c}{icon:achievement_boss_korkrondarkshaman:25}{col:2c03ae}The Shadow Wolf Cowl is a ancient shamanistic artifact made from one of the first few Shadowmoon shamans, Gar'gram Shadowhowl. Legend says that Gar'gram infused the cowl with the primal elemental energies of Draenor and empowers its wearer with a boost of its power as well strengthens their connection to the elements. However such claims can be nothing more but myths and legends.  Over the following generations, the Shadow Wolf has been passed down father to son after their passage into adulthood and complete their shamanistic training. For over a thousand generations, the Shadow Wolf has been used as a tool of balance and knowledge, as well a means of power. However Dar'kash, Son of Karn'kosh Shadowhowl, was given the cowl by his father and used his power to enslave the elements of Draenor for his own means. Dar'kash was eventually hunted down and nearly killed by his own clansmen and left behind the cowl. Karn'kosh would then hide away the cowl as he believes it has become a symbol of disgrace to his family's long and noble legacy, until word has passed of the bastard son of Drak'kash, a young Orc shaman who lives within the Frostwolf clan. When Kark ventured out to Outland with his mentor, the young shaman finally met his long lost grandfather. Once there, Karn'kosh retrieved Shadow Wolf from its container and handed it over to Kar'kash stating that he has redeemed their family's name by killing the one who spat on it, but it is up to Kar'kash and his legacy to restore the cowl's honor from all of the crimes it was forced to commit when it was worn by the Dark Shaman.  \n{/col}{/p}\n\n{h1:c}{col:860900}Bludgeon: The Dwarf Scalper{/col}{/h1}\n\n{p:c}{icon:inv_axe_1h_warfrontshorde_c_01:25}{col:860900}Forged from the minerals found in the Alterac Mountains, Bludgeon is a one of a kind weapon design to be as light as possible but sharp enough to slice through rock with ease. This weapon was used by a Frostwolf scout named Gra'tor who used it to slice off the heads of many Dwarves and clashed blades with many weapons of Alliance soldiers. The weapon gradually gained popularity by the Frostwolves who battled the stormpike dwarves that was given its own title; “The Dwarf Scalper”. While the weapon is taken care of well with the day to day sharpening and cleaning, there is a fine red line that is purposely left stain with the blood of its fallen enemies as a subtle but foreboding warning to never challenge its wielder in a combat to the death.{/p}{/col}\n\n{img:Interface\\QuestionFrame\\answer-warfronts-horde-CallOfTheStorm:256:128}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n{h1:c}{link*https://tinyurl.com/Kark-KollugArt*Artwork:Brotherhood}\n\n{link*http://fav.me/ddjmhth*Artwork:The Shadow Wolf}\n\n{link*http://tiny.cc/Themesong*Theme Song}\n\n{link*https://youtu.be/kwfuKv_C-is*Voice claim-Steve Blume}{/h1}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n-I take my RP fairly serious in public and in cities (Although I might goof around in public OOC from time to time) and if I am being trolled by someone who's fooling around too much I will ignore them. I'm also very lore abiding but I am willing to RP with anyone as long as I am free to ignore obvious lore breaking things about their character. So that's why you'll most likely won't ever find me in character in Silvermoon. hah! \n\n-I am open to RP with just about anyone but I prefer RP'ing with other orcs, Taurens, Trolls and Goblins. But that doesn't apply just for them exclusively. \n\n-IC does not equal to OOC. Ever. If I ever do something that offends you IC or OOC feel free to whisper me about it.\n\n-I've been RP'ing since around 2014-2015 and I've regularly kept myself up to date in the lore for the most part. If you have any questions about the lore or what kind of character you want to role play as, I'm more than happy to help as best as I can. Just don't ask me for gameplay advice. I'm actually below average in the game. Hah!\n",
				},
