						["VA"] = "I have found my panda.",
					}, -- [2]
				},
				["FN"] = "James",
				["FT"] = "Rakish Rogue & Devilish Dog || Connoisseur of the Concealed || Purveyor of Purloined Property || Panda Wrangler",
				["CL"] = "Rogue",
				["WE"] = "Fit",
			},
			["about"] = {
				["v"] = 57,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Moonlight:512:128}\n\n\n{h3:c}{col:828282}\"Darkness surrounds us. The moon is beckoning.\"{/col}{/h3}\n{h3:c}{col:828282}\"Do you hide? Or do you shine?\"{/col}{/h3}\n\n\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-47:64:64}\n{h3:c}The Man:{/col}{/h3}{col:ffffff}\n\n\nBrazen, brash, and with a touch of bravado, these were all words perfectly applied to the subject of our focus . Be it through a silver tongue or a razor sharp wit, every situation could be controlled if approached correctly. All one needed was the right attitude and a penchant for using the assets one was given. While standing at a modest 6'1\" James would appear in every way the sly roguish gentleman. Keeping  himself well groomed at all times, that long black hair and matching beard were kept in nothing less than tip top shape. The same of course could always be said for any chosen attire. Be it a long colorful coat or those simple day to day threads, he would dress to impress. Or perhaps at the very least, dress to deceive. For it one wished to win their desires, one must at least know how to play the game.\n\n\n\n\n{h3:c}{col:828282}\"Do you fear? Or do you embrace?\"{/col}{/h3}\n\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-89:64:64}\n{h3:c}The Beast:{/col}{/h3}{col:ffffff}\n\nAh yes, the counterpart to all things. The ying to the yang as one might say. While perhaps not as controlled and cialculating as his counterpart, there was something to be said for sheer animal instinct. While of course that sharp mind remained intact within this secondary form, something much more primal lurked within. The man of modest height now consumed, replaced at it were with a beast standing now a full 8'5\". That dark midnight hair converted into a full coat of rich dark fur. The ebon layer covering the mighty monster from that massive head down to those imposing paws. Seemingly with claws and fangs sharpened and at the ready, the most clever of plans were simply no longer needed. It was enough to relyon sheer brute force, and be gone with that sharp tongue in favor of a more direct and passionate approach. A methodical and calculating gaze now akin to something a bit more predatory.\n \n\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-42:64:64}\n\n\n{h3:c}{col:828282}\"Do you feel free? Or do you feel trapped?\"{/col}{/h3}\n{h3:c}{col:828282}\"Either way, there is no going back.\"{/col}{/h3}\n\n",
				},
			},
