					["TX"] = "Physically built like a muscle-corded fireplug, Morrgar is a thug. A very good, very stealthy thug. He typically works for the highest bidder, usually wealthy folks that aren't interested in being identified when dirty work gets done. These benefactors supply him with the money and equipment necessary to accomplish said dirty work.\n\nHe can be smooth and persuasive, or abrasive and downright bullying. He's easy enough to approach and knows how to chill and have fun, and doesn't make it obvious that he's a complete and total jerk...Though his menacing appearance might make it hard to tell the difference either way.\n\nHe is not a good orc and has little use for concepts such as honor and justice. He's able to easily put on a hypothetical mask in public so that he doesn't get chased out of town with fire and pitchforks.. Otherwise, he's trying to steal, rob, assassinate and fuck, among other unsavory hobbies and pastimes.\n\n\nDarker/mature themes definitely preferred. Feel free to send me a /tell if you'd like to interact!",
