						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Grom'loktar was once a viscous warrior of the warsong clan. When Ner'zhul called on the orcs to attack the draenei, he gladly accepted. He cut his way through countless innocents, drank the demon's blood and went through the dark portal. Throughout the first and second war he was an unstoppable whirlwind of death cleaving through anyway that would get in the way, until he was captured and like many orcs placed in an internment camp. His onslaught could not be tamed though as he eventually broke free from the camp. When Thrall made the call to go west, he followed. After a few stops,the orcs as we all know arrived in Kalimdor. He followed with Grommash as they were both Warsong. He along with Grommash attacked the human base against thrall's orders. He followed Grommash to Ashenvale. He battled against the night elves with fury and once more drank the demon's blood along with Grommash and the rest. He and Grommash were eventually stopped, but his rage persisted. He continued with his relentless onslaught whether it was in outland slaughtering demons, in northrend cleaving through scourge, or more alliance. He was glad to see Hellscream become warchief and loyally served him throughout the battles against the alliance. He eventually with many other orcs arrived in Pandaria. One time, he got into a battle with some alliance soldiers. It was a difficult battle, and he had to use all the fury within him to slay the opposing warriors. After the battle was done, he was in such a state of rage and bloodlust, that he started just swinging randomly in the air trying to hit rage induced hallucinations. No matter how much he swung he could not hit them as they were not real. His anger consumed him and the sha took hold of him. His fellow soldiers tried to calm him down, but he just cut through them all. Eventually a pandaren monk came along and was to stop him. The monk said that he had let his anger consume him and that he must stop before his anger consumes the land. The orc did not budge though saying he had no care for the pandaren's land. To that the pandaren pointed to the corpses of his fellow soldiers and asked him if he at least had some care for his fellow soldiers. The orc kneeled to the ground and weeped. In that moment he realized that his rage and hatred was not justified. He begged the pandaren monk to train him to contain his rage and the pandaren accepted. Over time Grom'loktar stopped being such a warmongering and psychotic orc and instead became a calm and caring one. He realized that Garrosh was leading the horde down a path of bloodlust and blind rage, so he quit the army and returned home. He later participated in the siege of Orgrimmar. He helped fight the legion on the broken shore. After Vol'jin died and Sylvanas became the new warchief, he was not happy. Her warlike attitudes and blatant disregard for honor being the main two reasons. He did not participate in the fourth war, as he had realized how pointless the alliance vs horde war was. He was eager to overthrow and he arrived at Orgrimmar along with Varok Saurfang and the others. He witnessed the duel, and was saddened by Saurfang's death. Though he was somewhat happy that Sylvanas would no longer be warchief. \n",
