						["TX"] = "A towering, bean-pole of a Troll, he carries himself with a goofy and almost alooft smile. His actions are slow and relaxed, taking his time to respond and react, working more on \"Island time\" more than anything else. Despite being so easy-going, he does seem to bring his puffed chest into the conversation first, being extremely proud of himself. Maybe too much so.\n\nHis dark lilac skin is obviously sun-worn, and freckles poke through from beneath thinning spots of war-paint. His tusks are shined to an immaculate degree, branded with intricate styalized carvings of Bwomsamdi, his tribes stories, silver jewelery and insets, and decorative markings. His silvered hair towers above him in a well kept crest. His left eye is clouded over, a faint and jagged line of scar drawn through it.",
