					},
					["3"] = {
						["IC"] = "inv_misc_food_167_sugarcane",
						["TI"] = "Master of the Overdraw and Short Arrow",
						["TX"] = "Along with his quiver of mismatched arrows, Kai carries around a reed shaft cut long ways that helps him draw broken arrows to full power. (This is not unlike the Korean style tong-ah and pyeonjeon arrows.)",
						["AC"] = true,
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "A Reminder of Home",
						["TX"] = "Kai is almost never seen without his constellation amulet around his neck - the stars reminescent of the Draenor skies.",
						["IC"] = "icon_7fx_nightborn_astromancer_blue",
					},
				},
				["v"] = 26,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h3}Appearance{/h3}\n\n•Perhaps most noticeable about this orc is their short stature, standing about a head shorter than most orc males. Kai can be a tad self conscious about their short stature.\n\n•Despite their young age, Kai’s hair is silver, which has grown to the middle of their back. Rather than groom it too much, they bind it in a loose braid that they leave hanging either to the side or pushes it over their shoulder.\n\n•Because of the above, it is comically easy to confuse Kai for a she-orc.\n\n•Like many Frostwolves, Kai’s eyes are clear blue. They tend to rebuke the claim that it is symbolic of a greater destiny, preferring not to think of themself as anything more than an archer and caretaker to their pack.\n\n•Also white as snow is the war paint they wear on their face, namely the camouflage-like streaks against their mag’har brown skin. They also seem to have the snarling wolf head emblem of the Frostwolves tattooed on their right pec and a white hand tattooed on the outside of their left arm. As of late, they sport a searing brand on the lower part of their stomach; which they aren’t shy to show off, sporting a mail-midriff.\n\n•Kai’s ears are gauged with inch wide iron plugs and their septum bears an iron loop. Although not a cosmetic choice, Kai seems to be missing half their right tusk.\n\n•Kai is bonded to an impressive number of wolves and is almost never found without one nearby.",
						["BK"] = 1,
						["IC"] = "ability_racial_sympatheticvigor",
					}, -- [1]
					{
						["TX"] = "{h3}Personality{/h3}\n\n•Honorable and loyal to the Horde\n•Although shy, they are friendly\n•Resourceful but impulsive\n•Anxious in crowds\n•Self-deprecating\n•Unapologetic bibliophile",
						["BK"] = 1,
						["IC"] = "ability_racial_pureblood",
					}, -- [2]
					{
						["IC"] = "ability_racial_ancestralcall",
						["BK"] = 1,
						["TX"] = "{h3}Background{/h3}\n\nUruk-Kai Wolfbrother was still-born to Draeg and Uruka the White of the Frostwolf Clan; but they were saved after they were dunked into a nearby frozen stream, eliciting a cry from the newborn. They were so small and considered weak growing up, spending much of their youth struggling behind their peers  and even their baby sister, Rulkah. When they came of age to undergo their om'riggor, Uruk-Kai exiled themself to the harsh wilderness of Frostfire Ridge to spare their family the pain of having to exile them themselves when they failed to pass. \n\nDuring their exile, Uruk-Kai honed their skills as a hunter and survivalist, and began to grow a considerable pack of wolves under their care. Eventually, Kai ventured from their snowy home when he met their lifemate, a Shattered Hand orc and fellow runt named Gret’ka Ripjaw. Together, the pair helped one another not only survive? But, also overcome any hardship that overtook Draenor and survive the tyrannus advent of Exarch Yrel and the Lightbound, escaping to Azeroth. \n\nOnce in Orgrimmar, Kai pledged themself as a tracker and was grouped up with a team of equally hopeful initiates into the Horde’s ranks. The group quickly impressed their superiors with their skills and they were almost immediately dispatched to Darkshore. While there, they showed unwavering loyalty to the Warchief, even after she burned the World Tree and incited disharmony amongst the ranks of the Horde itself. However, the war dragged on and the battlefront claimed many of Uruk-Kai’s new friends until only they remained. \n\nEver since they were recalled from Darkshore, Uruk-Kai has returned to Orgrimmar and has offered up their services as a tracker and hunter.",
					}, -- [3]
				},
