			["about"] = {
				["v"] = 20,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:7f5993}\"Purity is a construct made to shame you. You need not be clean to be good. And damn that hands that tried to dirty you.\"{/col}{/h1}\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-73:64:64}\n{p:c}{link*https://imgur.com/a/o1n9Cwc*Art Gallery}{/p}\n{p:c}{link*https://www.youtube.com/watch?v=kRBi4ElF4p4*Theme Song}{/p}\n{p:c}{link*https://www.youtube.com/watch?v=27Weg8uX-MU&t=37s*Voice Claim}{/p}\n{h1:c}{col:7f5993}A Vixen, A Vessel{/col}{/h1}\n\n{p:c}{col:599c54}Tall and slender, the elfin woman holds minimum curves to her form; more sylphic. Muscle forms beneath her ivory flesh, giving her a toned appearance. Her skin has become a canvas of ink and scars. First, there is the pair of claw marks upon her thighs, raking down to her knees. Then, raven ink, black as night etched into her back; a sigil of sorts. A magical ring. It's purpose is unknown, but each line o fit oozes with something unholy.\n\nTriviana's face is slender, her features well defined as expected of the Thalassian people. Her lips are pillowy, painted a glossy black. A pair of overgrown fangs press into the flesh and are often shown when she smirks. Large doll-like orbs hold a deep violet hue, gently glowing with a veridian mist. Wrapped by spidery lashes and deep eyeshadow, this makes her eyes look ablaze at times. Striking, even.\n\nCurtains of straight silvery locks fall down to her lower back, lingering with the scent of her many incesnses. Matching feathery brows are duel-pierced, the black metal threatening to only draw more colour out of her face and pallid tresses.{/col}{/p}\n\n{h1:c}{col:7f5993}Of Fallen Faith{/col}{/h1}\n\n{p:c}{col:599c54}Triviana's is a dance of Fel and Shadow; the occult magics often helping her rip out the mournful spirits from the earth - those who do not wish to pass. However, her useage has begun to stain her form; her nails have grown black andclaw-like, while her fangs grow to unnatural lengths. The most telling is here eyes, however - as is with all elves. \n\nAlas, her devotion to the craft does not seem to waver, as she purges the world of the wandering dead and dubious demons. She does, however, make sure to keep her magics typically underwrap. Only spectral sight or the well-trained can feel her corruption oozing from her.\n\nHer occupation is quite literally worn upon her sleeve. Her form is littered with all of the tools one would expect of a witch hunter or exorcist. Charms, dark symbols, vials of holy water, and books containing questionable rituals all find a home upon The Faith Fallen.{/col}{/p}\n\n{h1:c}{col:7f5993}\"If only we have some truth to believe in.\"{/col}{/h1}\n\n{h1:c}{col:7f5993}To Know The Fallen:{/col}{/h1}\n\n{h3}{col:599c54}† Are or were a member of The Church of The Light †{/col}{/h3}\n{col:599c54}Once a woman of the cloth, Triviana was adopted by the church, having lost her family at a young age. Raised in the temples, she was a respectable nun, despite never being able to use the Light.\nIn her late teen years, however, something caused her to abandon the church, going her own way.\nIt is unknown why she left, but the church grieved for their fallen sister.{/col}\n\n{h3:r}{col:599c54}† Live(d) in Quel'Thalas, Duskwood, or Lordaeron †{/col}{/h3}\n{p:r}{col:599c54}The dead have risen in these once vibrant homes, causing chaos for all who are caught in their path.\nTriviana is well known in these areas for helping qwell these threats - for a price, of course. Perhaps, you caught a glimpse of her in town?{/col}{/p}\n\n{h3}{col:599c54}† Are a member of The Uncrowned †{/col}{/h3}\n{col:599c54}Triviana first carved her place in the order during the Outland campaign, feeding The Uncrowned information about the Sin'dorei and their growing pressence in the Horde. \n\nHowever, her true mark was made during the Legion Invasion, supplying them with knowledge on the occult and what the demons brought with them. All the while, she aided in assassinations against said demonic foes, as well as retrieving some of their forbidden knowledge.\n\nOpinions are mixed about Triviana, but one thing is for certain - she does her job well.{/col}\n\n{h3:r}{col:599c54}† Are An Occultist †{/col}{/h3}\n{p:r}{col:599c54}In the past few decades, Triviana has begun to dabble in the very dark arts she combats. Stealing crumbs of knowledge, butchering covens, nothing seems to stop her from this thirst she has grown. Not much dust has been kicked up from this publically, but it is known among those with less than holy magics that she has begun dancing a path filled with shadow and demons.{/col}{/p}\n\n{h1:c}{col:7f5993}\"I will regard their cries as braying steeds, waiting to be whipped, broken, and bridled.\"{/col}{/h1}\n{h1:c}{col:599c54}†{/col}{/h1}\n",
