			["about"] = {
				["T1"] = {
					["TX"] = "{h2:c}RP Hooks{/h2}\n\nIf your character was politically aware and active as Quel Thalas was fighting the scourge, the name Kaveaa Dawnwalker may be a familiar one. A rising star then, you could swear she was pretty and competent once, now she is just pretty incompetent. \n\n{col:7f00ff}Night Life!{/col} A partygoer for the longest time, if your character got involved in debaucherous parties they may know Kaveaa. She is the type of woman to dance on tables and scream in joy during the best of times, and most certainly responsible for many young Syn'dorei's first times. \n\n{col:e00000}Bloodthistle{/col} - At one point a former dealer, even! Kaveaa has had prominent activity buying, selling, and using bloodthistle.\n\n{col:3ec6ea}Mage!{/col} (Technically) - Be it studying before the scourge or reaping the benefit of her title, Kaveaa is still associated with the Kirin Tor as a low-ranking mage. Her skills have deteriorated in the past decade but she \nfinally seems to be on the upswing. \n\n\n\n\n\n\n\n{h2:c}OOC Stuff{/h2}\nHello and {col:4d0c07}||welcome to my TED talk||{/col} thanks for reading my profile, whomever you are. You might judge me to not be good at the little, special details and you'd be right. It's something I still have trouble with 5 years into this hobby. I am by no means a WoW veteran but I try to research things when they're relevant, I'm not the type to read the wiki for hours, I don't find that enjoyable. \nI try to match styles with other people. Para/Multi-Para people imtimidate me, though, as I said before I have trouble with details. Verbosity is a skill I must chip away at.\nFinally, I would like to say that most things are fine with me. Seriously. We're all adults here (at least we BETTER be) and we can handle mature stuff. I'm not going to make fun of you for using trigger warnings because other people might prefer them, but if I have a problem I will speak up for myself.",
