				["T1"] = {
					["TX"] = "Jade prides herself on her gorgeous appearance, spending seemingly excessive amounts of time grooming, primping her hair and body to look its absolute best for beauty's sake. Her age barely shows in any manner.\n\nAll that work shows, as does much of her skin on most occasions. She's proud of her work and takes joy in flaunting such.\n\nShe nearly always has some form of make-up on, though most of it tends to reside solely upon her perfectly plump lips. Such always seems to glisten the deepest and most passionate shade of blood red.\n\nShe is deeply enjoys wearing rather short heels and tighter dresses and robes. leaving little of her form to the imagination.\n\nShe rocks a slender, smooth form packed into her dresses and robes. She nearly always has her flowing crimson locks down and done is a majestic manner to run down her shoulders. Despite her lack of visible muscle tone, she carries a significant weight on her chest. Her bosom is sized on the near comically high end, at times putting audible strain on her robes. Though she carries her heavy chest with pride. They bounce slightly with each step, and below her plush mountains a near perfectly flat stomach and her long beautiful legs.\n\nWith the weight of her chest taking much of the spotlight, those that walk behind her are in for a life changing show as well—swaying those thick hips with each step, the curve of her rear is rivaled by few...\n\n\n(Body ref avalable at request! 18+ ))\n",
