					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Windy:512:128}\n{h1:c}{col:e57e0f}Keilnisho, The Nomad Soul{/col}{/h1}\n\n\n{img:Interface\\Pictures\\artifactbook-hunter-titanstrike:512:256}\n{col:863032}Race: {/col}{col:ffffff}Vulpera{/col}\n\n{col:863032}Born:{/col} {col:ffffff}23rd April L.C., Vol'dun\n\n{col:863032}Moniker:{/col}  {col:ffffff}The Nomad Soul{/col}\n\n\n{icon:inv_archaeology_80_witch_book:25}History{icon:inv_archaeology_80_witch_book:25}\n\n{col:ffc079}Keilnisho was born in Vol'dun in a poor traveling family consisting of two parents and a sister. He spent all of his life wandering the dunes with them, until an opportunity in recent times came about, which granted him the option to travel to Kalimdor. He left his family behind to pursue the experience of discovery in this new land, and does what he can within reason to make a decent living. The lifestyle of a nomad followed him, and he wanders the lands of Azeroth alone with no clear goal in mind.{/col}",
