				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Moonlight:512:128}\n{h1:c}Appearance{/h1}\n\nElynna (El-lean-uh), or Elly, is a young elf of approximately 25 with a youthful, radiant, and typically aloof expression, seldom welcoming and friendly. Bright green eyes had a warm glow that would be calming to those who did exchange glances, as well as supple lips, a button nose, and sunkissed cheeks. Almond shaped eyes had natural full lashes all complimented by dark layers of black eyeliner. Based on mood, she may seem bright and exuberant, welcoming, and energetic. Depending on the current outfit, a canvas of artwork would be visible, contrasting against the tanned skin. Long perky ears had small, black gauge hoops that just filled out her earlobe without causing any real stretch.\n\nWhat she lacks in size, she makes up for in attitude. At about 5'3\" and 120 lb, she is on the punier end of elves, but there was a certain confidence and grace that made her seem over 6 foot. Her frame was thin and lean, built for fast and silent movements but was just muscular enough to take a few shots. Curves were set in all the right places accentuating the beauty bestowed by her people. It appeared to be kept up with hinting at considerable effort directed towards diet and exercise.\n\nSoft, wavy brown hair fell to the middle of her back in thick, tamed locks. It would usually be tied in a loose crown braid or waterfall braids to keep her hair out of her face with bangs that framed her flawless cheeks. Frequently, the rest of the mass would be tied in a pony tail or collected into a large, messy bun. Tangled into that forest, an enchanted rose would be woven into a braid behind a long ear. In all, she was truly beautiful with a captivating, heart skipping gaze and smile if one were ever fortunate to meet it.\n\n{link*https://tinyurl.com/EllyRighthand*Right hand}: An intricate poison vial with a skull and crossbones on the glass. Stoppered by a cork plug.\n\n{link*https://tinyurl.com/EllyRforearm*Right sleeve}: A girl standing on a short dock overlooking a lake on a detailed colorful starry night sky.\n\n{link*https://tinyurl.com/EllyLeftHand*Left hand and half sleeve}: A single intricately shaded black rose with thorns that intertwined to her wrist and into a series of more black roses with thorns as a half sleeve.\n\n{link*https://tinyurl.com/EllyrightRibs*Right ribs}: A Highmountain inspired dream catcher with feathers and beads taking up a fair portion of her right rib cage. Shades of purples, blues, and pinks in a type of galactic hue.\n\n{link*https://tinyurl.com/w3wapgf8*Back}: A large set of elegant feathered angel wings sprouting from her spine, expanding nearly the entire back with the ends disappearing below her waist.\n\n{link*https://tinyurl.com/EllyLeftLeg*Left leg}: A face beneath the waves and a ship sailing just above it, crashing over a crest. The sun was beginning to cast a bright light through dark clouds.\n\n{link*https://tinyurl.com/EllyRLeg*Right leg}: A fairly detailed map of Azeroth with latitude and longitude lines as well as nautical equipment. A very close look would reveal a few places with dots here and there\n\n{link*tinyurl.com/4dog6ehl*Face claim! (Just the very first picture of course)}\n{link*tinyurl.com/Ellyfaceclaim3*Another face claim}\n{link*tinyurl.com/1pchmblk*Yes, a claim to Selena Gomez, don't judge me}\n{link*tinyurl.com/Ellyscrownbraid*Hair references}\n\n\n{h1:c}Personality{/h1}\n\nWithin this bright mind rests locked away a sinister past that developed her into somebody manipulative and hostile, usually merciless at the best of times. A recipe for disaster spelt out with shark like aggresion: cold, tactile, facetious, and snark with emotionless brutality and disregard for the well being of most everyone except the ones who can crack through a near impenetrable shell. Her past is something she would rarely discuss, but she's a product of her environment as she had to take or fight for the simplest of necessities. Being such an isolated person, her tone of voice is very matter of fact or sarcastic. Antagonistic yet unnervingly calm under most circumstance, it would seem pressure was nearly weightless on her shoulders.\n\nShe is the embodiment of Jekyll and Hyde as her mood can fluctuate, sometimes within moments. Some have described her as a split person with bipolar tendencies ranging from mania to depression. Kindness comes during euphoric highs or the desire to acquire in conniving nature. This woman even gets a kick at times to puppet with emotions and she's damn good at playing the game by luring in the weak minded with charm and flirtation only to take advantage of misplaced trust. If she is after monetary gain and false friendliness doesn't work, she may not be above violence without remorse. Though pitiful in size, underestimating her could be a lethal mistake considering she may be quicker to pull a trigger or plunge a knife than consider the consequence. Lifelong struggles calloused her to affection and care, leading to a lone wolf complex that naturally tends to push people away, though she can act as a team member usually for nothing more than her best interest.\n\nCunning, logical, and realistic. She tends to think before she talks and attempts to plan ahead, though she does have impulsivity that leads to action prior to thought. For specific jobs, she plans from A through Z ready to react to any situation, but for daily interactions, she may be abrupt, unpredictable, and reactive. Tread carefully.\n\n\n{h1:c}Skills{/h1}\n\nA life on the streets has developed comfort picking locks and pockets alike, breaking into homes or into inns for a free place to sleep. Her feet move without any sounds, falling in a single file line to create a hypnotic sway of her hips.\n\nShe is adept at hand to hand combat, with or without weapons. Agile as they come, but able to fight with much larger and stronger opponents through leverage. There isn't much weight or significant power to throw around so the smaller elf has learned how to manipulate others movements against themselves. Because of this, her body moves with a flowing grace.\n\nIntrusive and rather friendly at the right time, she is well practiced at breaking down walls and leading people into false security due to a pretty face, silver tongue, soft voice, and traiterous smile.\n\nThrough her family name, she was naturally gifted with rogueish shadow magic. Her father, Aelinor Shadowmist, a terrible pirate who utilized the shadows, monopolized the talent in his own gain by raising the girl to be proficient in stealth and manipulating said dark magic. Her mother was a natural healer of the light, well talented, though the light never came to Elly. Instead, she learned to heal physically rather than magically from a surgeon aboard a ship. She uses herbs for poisons and potions alike as well as procedures and even shadow magic to a lesser proficiency for fixing wounds.\n\n\n{h1:c}History{/h1}\n\nAfter her broken family was mysteriously murdered at their home in Eversong Woods, she fled to the city. The girl was an outcast in Silvermoon as a child for her family name, thievery, robberies, and even an accused double homocide of a nobleman and Blood Knight. After that accusation, she became notoriously wanted and disappeared from the city to board a vessel. In this vessel, she was taught and honed her skills while working with all walks of life from both Alliance and Horde. She saw and participated in war, visualizing death in a very intimate fashion. Seeing a human who was able to heal without magic, she collected his knowledge for her own personal gain in case she were injured. When this vessel, The Daggermouth, was at last sunk, she was taken aboard a new ship that was not as welcoming to her presence. She was a forced medic given her acquired talents and of course lusty sailors persued her without success. Elly was trained well and able to defend herself, so she was sold for profit as an arena slave where she would fight for her life for entertainment. It was predictable. Wake up and fight. So she performed well for a warm bed and decent meal, not mention the reward of seeing the morning sun. There eventually came the time where she was prepared to leave, so after contemplation, she picked the lock to her cage and left the arena in a pool of the blood of her captors before escaping. A new life was eventually started with someone she grew to love and trust. A life no different than what she lived. Violence and self-gain. Eventually, a botched robbery of a supply vessel heading to The Broken Isles led to her capture and forced participation in the war against the Legion. At first, she was only a slave worker, but proved herself capable during an attack on the camp. She was promoted with the promise of release at the conclusion of the war, assuming she had survived. Giving her all, she made it through with her life only to return to a changed partner who eventually fled without warning, leaving Elly betrayed and alone. From then on, she lived for herself only getting by without much incentive or advantages to thrive. When the war between the Horde and Alliance resumed, she was forced to join the attack on Teldrassil, then to defend The Undercity. With her participation, she was granted full pardon and is considered a free person, though she is still not accustomed to such a life and as such constantly glances over her shoulder.\n\n{h2:c}Hooks{/h2}\n\n. Her family name is one that is despised among many and feared by the vulnerable. There were accusations of assaults, drug dealings, psychosis, dark magic use, piracy, extortion, torture, murder and likely anything in the name of self gain and preservation. Her family was found murdered in their home in the Ghostlands.\n \n. Troubled youth in Silvermoon. Frequently stole from vendors, pickpocketed and robbed civilians. Pretty well known to authority figures or city officials as an elusive nuisance. Allegedly, her crimes became more violent until she was charged with two murders in a robbery gone bad. A city guard and a civilian were stabbed multiple times and their possessions stolen. There is no proof on who did it, but suspiciously she seemed to have disappeared from town some time after it happened. Even currently, older and experienced figures of authority may be able to recognize her as the trouble maker (act out how you please, I don't mind confrontation!)\n\n. She spent much of her teenage years sailing the seas where her delinquent acts continued. Quite a few of these included seducing drunken sailors around town and robbing them after she lures them to privacy. She has gotten violent and hurt people if she doesn't get her way. \n\n. Elly was even sold to fight in the arena after being kidnapped and held hostage by some people. She was a strong fighter, so they decided to make profits. Brutality was further normalized as she was rewarded for her particularly gruesome kills. Eventually, she escaped leaving multiple people dead in her path.\n\n. For a while, she lived in Pandaria and Booty Bay. Very frequently, she visited Jade Forest and Halfhill Market.\n\n. She fought against the Legion throughout the Broken Isles. She served primarily as a combat medic in field, a scout, and a surgeon on bases. Notably, the elf healed without magic so some were not as receptive to her methods, seeing them as less efficient. There was also a number of accusations that she was a pirate who tried stealing supplies and she was sentenced to serve in the war. Thusly, she was not well trusted, being considered a traitor.\n\n. She was also in Darkshore and Undercity for boths attacks, not by choice. She served as a combat medic again, healing the wounded.\n\n. It is possible she may have provided first aid on your character for some situation, or will provide it if needed, though she makes no outward attempt to display her medical knowledge, save for the medical journal she carried on her all the time. \n\n. She sells potions and herbs! Things that affect the health in manners like modern day medicine. Some increase or decrease blood pressure, prevent seizures, restore vitamins and electrolytes, thin the blood, diuretics and more. Of course, not all herbs are good for health and she will low key sell poisons to those who inquire.  \n\nThese are just a few places to recognize her from, but she has lived several different aliases and has the habit of suddenly disappearing. Depending on what point in the timeline we are talking about, she could have been a totally different person. And depending which person she claimed to be would depend on her traits. It gets pretty complex so please pst me to clarify or if you want a hook specific for your character!\n\n{h2:c}Aliases{/h2}\n\nAngel - An alter ego of a priestess, dressed in holy looking robes of whites, golds and black. She assumed this ego shortly after meeting her ex-wife. Her brother-in-law developed an obsession with Elly and started a manhunt for her. He was of high authority and standing within Silvermoon City and put her back on high demand. For this reason, she became Angel to hide and walk freely as a healer. She claimed to be a priest, but obviously was not due to her lack of holy magic and heavy shadow aura.\n\nFeyli Featherbreeze - A name she assumed when dressed in her leathers. This was so that any crimes she committed would not be linked to her true personality. Feyli wields dual rapiers, red, black, and silver leathers, a whole plethora of other weapons, and poisons. Feyli is also a mercenary name who has been known to accept shady jobs for generous compensation.\n\n{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n\n{h2:c}OOC!{/h2}\nIf you read all this, thank you! I know it was a lot, but I tried to tone down the length of her original TRP (which wiped a long time ago). It's still a WIP and I will probably make changes to reflect her current mentality which has changed somewhat since she is now considered free. Elly has lived a variety of lives under several aliases and as such, not everything is easily pinpointed exactly to her, but rather those alter egos she lived under. There are a number of hooks to walk up and plenty of backstories to be written, so if you're interested, message me and we can work out the finer details since the history section is a very brief synapse to give you an idea of who she is and what she's about.It also looks like most of the tattoo links don't go exactly where I want them to, so I'll fix it eventually>.<",
				},
