				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h3:c}{col:83ff3e}Appearance{/col}{/h3}\nNovai is a largely unimposing mass of fluff and steel, standing at just barely over three feet tall. The dry heat of the desert she once considered her home apparently kept her from rotting in death, as the sheer fluffiness of her faded grey and white fur has not diminished in the slightest, puffing out at the edges of her armor. Her ears stand tall and alert above a pair of glowing blue eyes giving off the telltale blue mist, a sign of her undeath.\n\nHer armor, though variable, typically bears a green color, either dark or light depending on variables known to no one, potentially not even her. The actual style of the armor is much more standard for a Death Knight, with sharp edges and skulls and a generally menacing vibe that would probably be intimidating if she wasn't a small fox person. Or perhaps, in spite of it?\n\nAt her back rests a sword, massive for a Vulpera, longer than she is tall. It is a fairly standard Ebon Blade greatsword, glowing with unholy power that resonates well with her own powers. Its size and weight does not appear to be any hinderance to Novai, either at rest or when wielded.\n\n{h3:c}{col:83ff3e}Personality{/col}{/h3}\nNovai is a very literal person, often taking figures of speech and slang at face value, and being very direct in her interactions with others. It's not uncommon for her to respond to questions with a flat yes or no, and her explanations and stories are similarly simplistic.\n\nThis is not to say, however, that she is entirely devoid of emotion. Though she may not be able to outwardly express herself very well, she is still capable of reacting just the same as any living mortal.",
