				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n{h1:c}History{/h1}\n\nShe was born and raised in Quel'thalas and given the name Rune, which she was told means Secret in Thalassian. When the Scourge invaded, she fought to defend her lands, she was just a humble priestess, so she wasn't able to do much. When Quel'thalas fell to the Scourge she joined up with the expedition along with their prince to find a cure and fight back the Scourge with the remnants of the Alliance of Lordaeron. This didn't last for long once the Grand Marshal had sentenced the expedition to death for consorting with Naga, she never made it to the portal when the escape to Outland began, instead she fled back to Quel'thalas. \n\nShe was almost killed by the Scourge, as well as the pursuing forces of the Alliance hunting her down, but she was saved by a group of mercenaries they easily dispatched both the undead and the Grand Marshal's forces. She repaid them by joining their warband, and abandoned her notions of the light and started training with a blade in the shadows, which she turned out to be pretty good at.\n\nShe eventually longed to return to her homeland and bid the mercenaries her farewell. She'll still do mercenary work as she's gained the taste of gold and always wants more now, doing nearly anything for gold or items of value.\n\nWhen the Scourge began their resurgence she fought to defend Quel'thalas once again and continues to do so, frequenting the city if she isn't being paid to go elsewhere and deal with specific targets across Azeroth.\n\n\n{h1:c}Personality{/h1}\n\nThe only things she seems to like are her own people and gold, she's very quiet, a habit she's had when stalking prey for hours.\n\n{h1:c}Equipment and Appearance{/h1}\n\nShe wears mercenary armor, finely crafted leather with bandages wrapped around her arms and legs. It has several pouches, knives and other vairous tools an assassin would use. She's nice on the eyes, as most of her kind are, her silver hair shines with the moon, her hair also covers her blind eye. She also wears a mask to conceal her lower face.\n\nShe wields spectral daggers that seemingly pass through armor and only make contact with flesh, they shine a red sinister glow and are surprisingly cold to the touch.\n",
