			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "{h2:c}{icon:crest_deathknight:25}{col:004b6d}Levias Gravebriar{/col}{icon:crest_deathknight:25}{/h2}\n{col:00829e}Before you stands the self proclaimed Frost Prince of the Frozen Wastes. He stands a stoic and dour figure, with broad shoulders and narrow hips. His lichfire eyes peer without mercy nor care, from under well groomed and systled hair of regal appeal. His body is clad in armor suited for someone who claims the mantle that he does. Mail and plate, forged in the cold halls of Acherus, with visages of skulls and other grim things. Strapped to his belt are the blades Talah and Falor, elven swords cursed and wrought with runes of ruin. Their luster is a dark with an eerie allure that seems to beckon those to accept their curse. \n{h3}{col:dbfff9}{/col}:Voice:{/h3}\n{col:00829e}Brooding and soft bass in sound, Levias voice holds a cold, unmerciful tang of disdain. It is almost a whisper that seems to echo, though when rised it matches the fright of the howling winds of Northrend itself.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "{h2:c}{icon:spell_deathknight_frostpresence:25}{col:00829e}Somber{icon:spell_deathknight_frostpresence:25}{/h2}\n{col:00829e}Levias Gravebriar is a somber man, conflicted and sorrowful, but too he is a man of bitterness and spite. His soul was shattered like many others slain and raised by the Scourge. He is haunted by the memories of what once was, yet must face that those days are forever out of his reach. A sickness has taken him, one of which he longs to hear the voice of the Frozen Throne, yet desires to keep his free will. Levias stands on the edge of oblivian, daring to stray just a little.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "{h3:c}{col:008290}I died... in his arms.{/h3}",
						["BK"] = 1,
