				["Naylatari-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["v"] = 53,
				["BK"] = 12,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n{h1:c}Appearance:{/h1}\nNay stands a little taller than most of her fellow elven women, but looks about average due to the way she stands to the side or sometimes slouching.\n\nShe has reddish-grey hair that looks like it belongs on a forsaken more than an elven woman.  She doesn't do much in the way of care for her hair style, keeping it short for mainly practical reasons and its easy to rush into battle with, as it doesn't delay her actions.\n\nNay's face has a slight heart shape to it, denoting a former beauty that is now replaced with scars where the transofmation to a Demon Hunter had her rip her eyes out with blades.  \nTypical to other Illidari, her eyesockets are covered by a plain red cloth that only shows the glowing of her fel flame eye sockets.\nJust above her forhead, the Illidari woman bears the visible markings of her trade in the form of two recurved horns that are deep red-brown and give a familiar look to those of a shivara.\nWhen following the scars along the eyesockets down her cheeks, the ugly rips end abruptly at her thin, yet deep cimson lips.\n\nThe rest of her body reflects parts of her former life as a warrior in service to the crown.  Her shape is typical for a muscular elven woman, with her thighs and biceps showing more bulk than other parts of her body. \nGlancing at her upper body, the two most noticable part of her body are her breasts, and her biceps.  Her upper arms have an almost prefect round hump from formerly heaving a huge double bladed axe, and now because of twin demonic-flamed enhanced warglaives. \n\nNayla is currently seen wearing a set of armor reflecting the heritage of her Sin'dorei blood and the people of Silvermoon itself, since the fall of the Burning Legion.  She carries a set of warglaives that are made of magical fire to enhance the appearance.\n\n\n{h1:c}Personality:{/h1}\nNayla has basically evolved her personality from that of an absolute demon killer, to one of a softer and more inqusititve tone.\nShe is somewhat socially inept. Things that people take for granted, she can have problems catching the meaning.\nHer biggest answer to most situations is simply, \"I haven't given much thought to it.\"\nWhen asked what she does like, she will answer with mostly two things.  The color red and the physical look of Orcs.\nPersonal questions she will answer fair and polite, unless it is about the demon she consumed.  \nOverall, the elven woman is friendly, or trying to be.\n\n{h1:c}Background:{/h1}\nBorn as Naylaneth she was the first of the Jaydenthorn girls, raised mostly in the city of Andorhal.  She spent most of her young life following in her fathers footsteps with the love of fishing and the water.  She worked on the many boats he did and traveled, learning the beauty of the world around her. \nNay was often tasked with lifting and carrying the heaviest of loads for the dock workers, because of her natural size.\nHer father noticed that as time went on, her real talent was in the ability to swing a shield and sword.  He worked it out with the guard so she could squire with them and gain the ability to become a warrior and protect those around her.\nAll was fine until the scourge attacked.\nNay lost everything in her life in those moments.  Her mother and father killed in the initial wave, her sister missing in the Ghostlands.\nLost and without a cause, the young warrior stepped out into the now darkened world, and killed anything that moved or caused threat to people around her.  She was reckless, not caring if she lived or died.  \nCrossing over the Dark Portal, she fought her way to Shadowmoon Valley, and ultimately to Black Temple itself.\nShe sought out the others on the temple walls, and pledged herself to the Master.. Illidan.\nThat day, Naylaneth the warriror died, and was replaced with Naylatari, Demon Hunter.\n\n\n\n\n\n\n\n",
				},
