			["about"] = {
				["v"] = 34,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:f30cff}Appearance{/col}{/h1}\n\n{p:c}{col:e365ff}This little elf hardly seems to pose a threat to anyone. In fact, at her height, she barely reaches a normal elven woman's shoulder. Her skin overall is pale, as though she's never seen the light of day, even when standing in it. Light blue eyes have bags and dark circles around them. No more enchantment to make them appear green! Despite the tired appearance, if she ends up looking into someone's eyes, she's still got the youthful, \"stare right through the soul\" gaze a woman half her age would have. \n\nPouty lips are often stained with a ruby pigment, usually quirked at the corners with a smirk, be it from mirth or something more sinister. Through her lower lip on the right side are four tiny truesilver loops that hug the plump, crimson flesh, and two truesilver tongue rings accented with azerothian diamonds can often be seen glinting between her lips. The tongue rings are set one behind the other.\n\nTwo truesilver hoops pierce the top of her left ear, while one decorates the upper right, all three loops small enough not to snag, given the fragility of those long elven ears. Three titansteel bars decorate the thicker, starting point of each brow, curved and thin with small dreadstone balls on either end. A tiny silver stud decorates the left nostril of a tiny, slightly upturned nose, along with an itty bitty dark iron rose. \n\nRed locks have been hacked away by a dull blade and finished by an unsteady hand, creating a shaggy, unkempt look. It seems she doesn't mind this however, as she rarely does more than scratch at her head, the only 'decoration' found here being the one thing no modern day rogue dares advertise, especially on their person. \n\nThe name \"Sujikai\" has been tattooed in elegant, black script across the back of her neck. Can't get more identifying than that.  A silver chain hangs around that neck; from it dangles an obsidium ring with an obsidian 'jewel' that glows a dim blue shade at all times. This rests against her breastbone at the top of her cleavage, usually visible.\n\nPetite shoulders are half the width of most full grown elven women's, collarbone the perfect example of fragility, though it's hidden beneath a fine layer of fat.  An average torso possesses sides that slope inward gently from beneath the ribs to flare again at broad hips. Her bosom appears plump and well rounded, though the flesh sags when left alone, her choice in tight leather tops and harnesses keeps this area -looking- perky at a glance.\n\nThe woman's midsection is muscular, but plagued by a layer of squishy fat left over from several pregnancies. If one happens to see her stomach exposed, the glinting of a diamond becomes obvious in the dip of her navel, a truesilver hoop pierced through the flesh above with a small chain of the same material allowing it to dangle down. \n\nLong, toned arms appear to be those of a climber, complete with delicate though strong fingers. Her nails are always clipped short, squared off, and painted with a brilliant crimson polish, while her palms and the pads of her fingers lack any sort of callousing. \n\nA bit further down, well padded hips become the focus point, about the same width as her shoulders, a bubbled, plump behind completing this package. Legs that make up for the most of her scant height begin with thick thighs that look untoned, though there is indeed muscle beneath the pudgy exterior. The surprisingly well sculpted calves of a runner lead into sturdy ankles and small feet, usually hidden in boots.\n\nOn the back of her left shoulder, the insignia of the horde has been tattoo'd into pale skin, another found along the curve of her left hip, black ink reading \"Victory or Death\" in Orcish text. Starting just beneath her shoulders and working down, forest green ivy vines have been inked into pale flesh, several intricate treasure chest locks and keys strategically placed about in the mess. Those locks and keys are inked in bronze just like the one described below, glinting in the light like real metal when she moves. \n\nMoving further down her back, just above her rump, in fact, one would find an intricate treasure chest lock inked in bronze, shaded in to look precisely like the real thing. If exposed, each of her wrists and ankles have been tattoo'd with chains that possess the same intricate treasure-chest lock as the ones on her back, in a smaller scale, both the chains and the locks in these places done in bronze ink, the locks set on the fronts of each.\n\nThe middle finger of her right hand sports a pure elementium band, flawless, indestructible, and usually heading the blows when her fist meets flesh. The same finger on her left hand sports an identicle band, along with a dark iron one set with tiny heart shaped inferno rubies. Her right ring finger sports a flawless elementium band decorated with tiny heart shaped dreadstones. {/col}{/p}\n\n{h1:c}{col:ffa2f9}Fragrance{/col}{/h1}\n{p:c}{col:e170ff}The scent usually lingering on her form is that of various herbs, coconut rum, and vanilla. If for some reason, however, one is excessively close to her; the scent of cloves drowns out anything else. Especially when it comes to her breath.{/col}{/p}\n\n",
				},
			},
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Small:",
						["TX"] = "4'8\" isn't very big!\n\nYes, she's an adult.",
						["IC"] = "INV_Pet_Mouse",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Belt:",
						["TX"] = "Bulging pouches and several knives line her belt. \n\nWithin the pouches one can find anything from jerky to ink pigments; poison vials to dice and coin.\n\nThe knives are assorted; some obviously intended to cut plants, others for skinning. Many for throwing.\n\nA single knife is sheathed against the small of her back, resting flush against the belt. At a glance, it simply looks like a roll of fabric.",
						["IC"] = "INV_Belt_Cloth_RaidMage_Q_01",
					},
					["2"] = {
						["IC"] = "INV_Misc_Gem_Diamond_01",
						["TI"] = "Jewelry and tattoos:",
						["TX"] = "Four truegold hoops piercing the right of her lower lip. Two diamond tongue rings. Three titansteel banana bars on each brow.\n\nA silver chain hangs around that neck; from it dangles an obsidium ring with an obsidian 'jewel' that glows a dim blue at all times.\n\nA golden band littered with glowing, crimson runes adorns the ring finger of her left hand. In front of it sits a second, pure gold band; definitely a wedding set.\n\nTattoos:\n\nHer own name on the nape of her neck in black. Horde insignia on the back of her left shoulder. \"Victory or Death\" in Orcish following the curve of her left hip.\n",
						["AC"] = true,
					},
					["5"] = {
						["IC"] = "INV_Azerite empowered state",
						["TI"] = "Azerite blades:",
						["TX"] = "The blades of her swords seem to be comprised of...Azerite? That can't be right! \n\nBut ah, it is. The highly volatile substance has been forged into a pair of lethal weapons.\n\nIf one looks closely, they can see the subtle, slow ebb and flow of Azeroth's lifeblood in the blades.\n\nHow -does- she keep from blowing off an arm, volatile as that substance is known to be?! Enchantments to protect the wielder, probably. It helps to have a Master Smith for a husband.",
						["AC"] = false,
					},
					["4"] = {
						["IC"] = "Ability_Rogue_GrapplingHook",
						["TI"] = "Grappling hooks:",
						["TX"] = "A set of simplistic grappling hook launchers can be found strapped to either side of her belt.\n\nThe attached chains coiled upon themselves at her hips and their hooks appear at a glance to be simple truesteel; but upon closer inspection glimmer with an enchantment. Likely to prevent their breakage.\n\nThe woman seems extraordinarily fond of using the things.  ",
						["AC"] = true,
					},
