				["T1"] = {
					["TX"] = "{h2:c}Appearance{/h2}\n\nClad in a dark hooded robe, face hidden by a mask at all times.  The figure looks as if they must've been of considerable stature before withering in undeath, now it's like they're nothing but bones.\n\n{h2:c}History{/h2}\n\nFormerly working for the Royal Apothecary Society as an officer before resigning, now employed by the Darkrunner Blades. Someone who has encountered either of these groups since the Cataclysm may have met or heard of Shadow. Sometimes known to offer freelance work as a chemist, arcanist or demonologist, most history is unknown to the public beyond that.\n\n{h2:c}Languages{/h2}\n\nCommon\nThalassian\nOrcish\nDemonic/Eredun\nForsaken/Gutterspeak\n",
