			["about"] = {
				["v"] = 25,
				["BK"] = 7,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-warboard-classic-NorthernBarrens:512:256}\n{h1:c}“The prairie skies can always make you see more than what you believe.” {/h1}\n\n\n\n\n\n\n\n\n{h1:c}Physical Appearance{col:c0a72e}{/col}{/h1}\n     Standing slightly above average height for a Vulpera, and with a somewhat stocky build, Corin tends to not stand out in a crowd, preferring to blend into the background. His fur is a dirty tan, with some mottled black spots, particularly on the tips of his ears and on his tail. His fur has a bit of a scraggly appearance, it's almost as if he cuts it with his knife, becaus he does. His usual clothing of choice is his leather plains garb, strewn together from various animal skins, including crocolisks, kodo and raptors. Corin carries several weapons on him, consisting of a large bowie knife he keeps sheathed on the side of his boot, a trio of small throwing daggers hanging from his shoulder, and his six round revolver holstered on his hip. Because of his time spent in areas such as the barrens and Vol'dun, he is usually covered in a light layer of dust and sand, and he carries the scent of the wilderness behind him.\n\n\n\n\n\n\n\n\n\n{h1:c}Personality{col:c0a72e}{/col}{/h1}\n     Having been brought up in a simple but hard life, Corin has devealoped into quite the blunt Vulpera, never afraid to tell someone what's on his mind, or suggest his \"to the point\" solutions to many of his problems. He is not well versed in the \"higher\" forms of art or culture, such as magic or reading, preferring to surround himself in and embrace what he's good at. He generally prefers to be by himself most times, and as such will usually not surround himself with several people, and his circle of those he calls friends may be small. When it comes to his work, he is persistent to the point of being stubborn, and will do everything he can to ensure the job is done and done well, no matter how rough he may have to be to get it done. Because of these traits, he may come off as rough around the edges around new faces, although he will warm up eventually.",
				},
