					["TX"] = "Comes with art! https://sta.sh/21i23hocfmr1?edit=1 (done by myself)\n\nChacter is a work in progress i will type up a huge and proper thing later! But here's a few things to know\n\nRivetea was practically born on a pirate ship and raised by pirates that are no longer around and disbanded a few years ago, She got her scar on her eye from being dragged under that ship by something she doesn't recall all she can remember is stabbing it in its eye and swimming for her life back to the surface to be rescued by her crewmates\n\nAs a retired pirate she still took an intrest in rare and exotic beast taming/collecting when she ran into her first ever beast she tamed Torraske the Eternal. Found out she had a real knack for it, forming deep and personal connections with the ones she tamed and it seemed to fill a hole that had been left after her entire crew disbanded. Now she travels the world looking for more exotic beasts to add to her collection and befriend.\n\nShe's a very mischievous Vulpera that doesn't understand 'treat others the way you want to be treated' and doesn't get friendship really due to days of sailing at sea with a crew that only knew how to mess with each other so she has a tendency of lying to mess with people and doesn't feel bad/gulity about it until someone calls her out or by some miricale realizes she did something wrong. She sucks at apologizing too.\n\nShe is so smelly and can be super selfish!\n\nWill edit and add more later!",
