			["zone"] = "Orgrimmar",
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Eyepatch",
						["TX"] = "Lannivath wears an eyepatch over his right eye. Four claw marks can be seen slashed vertically over his right eye, up to his cheek. He can actually see fine without the eyepatch, but is quite adamant about keeping it on, at least when he is around new people. What is he hiding?",
						["IC"] = "inv_leather_demonhunter_blindfold_01",
					},
					["3"] = {
						["IC"] = "inv_misc_monsterfang_02",
						["TI"] = "Attuned with Wolves",
						["AC"] = true,
						["TX"] = "Lannivath is rather accustomed to wolves out of all animals, so much so.. that he seems to sport wolf-like features, such as long canines and claw-like nails. Whether wild or tame, wolves seem to instantly grow quite calm, comfortable, and even act affectionate around him. At times, he can be seen talking to the wolves and actually responding to them, as if he can understand them.\n\nUpon the left side of his pectoral, there is even a tattoo of a paw print surrounded by a sort of circular, celtic spike symbol. A further representation of his love for wolves. (Reference in about.)",
					},
					["2"] = {
						["IC"] = "inv_bone_skull_04",
						["TI"] = "Skull",
						["TX"] = "Upon his left shoulder, Lannivath wears a skull that belonged to a large wolf. He seems to treasure the skull out of respect and memeory to the wolf, rather than wear it as a trophy. It appears to emmit a strange, shimmering golden glow.",
						["AC"] = true,
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Gift of the Wild",
						["TX"] = "Lannivath has the ability to mend the injured with a special type of magic. A soft, golden glow emits from his hands, summoning ribbons of light that swirl around the wound, before giving off a shimmery vapor that falls onto the wound, healing it completely. \n\nOther than healing, he uses his magic for fun. He likes to use the stripes of light to create things in the air for his or for other peoples entertainment.",
						["IC"] = "ability_druid_naturalperfection",
					},
					["4"] = {
						["IC"] = "inv_archaeology_80_witch_etcheddrustbone",
						["TI"] = "Whistle",
						["TX"] = "Lannivath keeps a small bone whistle wrapped in twine around his neck. Though it looks quite ordinary, it actually has a very special use, one that is saved for emergencies.",
						["AC"] = true,
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 3,
					["5"] = 0,
					["4"] = 3,
					["6"] = 0,
				},
				["v"] = 93,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-hunter-cover:256:256}\n\n{link*https://cdn.discordapp.com/attachments/797688217318195230/803125009354194954/R7373d61e51f30f8a75a85bc345ae7041.png*Lannivath's tattoo reference}\n\n{h1:c}{col:ae7641}Appearance{/h1}{/col}\n\n{p:c}{col:412c18}Lannivath is quite the youthful and handsome looking man of tall stature, lightly tanned skin, a lean and athletic-looking build, and has long, unkempt, dark brown hair, reaching down near his lower back,with a tad of facial hair around his chin. He prefers to tie his hair back with a long and strong-looking vine into a long and wild looking ponytail, leaving his bangs to frame around the left and right side of his face nicely. It is clear he is Quel'dorei, hence the blue colored eye on the left side of his face. Adorned around his waist is a sort of kilt made of different furs from Lannivath's hunts, perfectly stitched together, with the thinner and lighter-colored furs wrapped around the top, accompanied by white-furred trim, and the longer and darker-colored fur trailing from the center to bottom. The kilt is held together by a large and rounded belt, with a symbol at the center that appears Nordic in nature. On closer inspection, three bones can be seen decorated around the bottom of the darker fur, from smallest to largest. They appear to be made from the ribs of smaller and bigger animals. On his right eye, however, he wears an eyepatch. Four large and rather prominent claw marks can be seen vertically slashed over his right eye, all the way up to part of his cheek. On his right forearm, light brown bandages cane be seen wwrapped around it, hiding old and nasty looking scars of teeth markings that had torn through flesh, not exactly healing properly. It's no wonder he keeps it wrapped up then! If one were to look close enough, his eye behind his eyepatch seems to sometimes emit a faint, golden glow based on his emotions, whether he is happy or upset. It's clear that something is up, though if one were to ask, Lannivath would simply disregard the subject, as he is quite adamant about keeping his eyepatch. If one were to earn his trust, then perhaps he would be more willing to talk about it.\n\nAs a Quel'dorei, one would think that Lannivath would take better care in his appearance, but honestly, he couldn't care less. While most would prefer the fancy and luxurious lifestyle of the city, Lannivath would prefer spending his time within the great outdoors, especially within the company of animals. More specifically, wolves. Interesting enough, wolves seem to take a strong liking to Lannivath the most, whether they are tame or feral. Perhaps it has something to do with the fact that Lannivath appears and smells... more wolf than humanoid, as he sports a distinct wolf scent, long canines, and claw-like nails, and abnormal body heat. His agility, strength, and reflexes appear to be a lot more advanced than most too, in regards to a wolf. Upon the left side of his pectoral, a tattoo of a wolf paw surrounded by a sort of celtic spike symbol can be seen, while around the right side of his ear, two adolescent-looking wolf teeth can be seen through the inside of his right ear, around the top, a further implication that Lannivath is quite accustomed to wolves. \n\nWhat seems to stand out the most from his appearance would be the large looking skull from a great timber wolf perched upon his left shoulder. It seems to emit a strange, shimmery, golden glow from around it, as if it was almost... still alive. Lannivath wears this skull out of great respect towards the wolf, rather than wear it as a trophy. He is hardly ever seen without it, not only because he sees it as a sort of companion and guide of sorts, but also serves as an example of his past, to remind him of a promise he intends to keep.{/p}{/col}\n\n{h1:c}{col:ae7641}Personality{/h1}{/col}\n\n{p:c}{col:412c18}To most that first interact with him, Lannivath is quite the friendly, caring, playful and easygoing individual. Unless you give him a reason not to, he happens to love meeting new people. Interesting, considering he has spent most of his young life in the wilderness with his wolves as company; though it doesn't mean he has ever been robbed of human companionship. He is actually quite happy with either. While having lived in the wild, among wolves and other animals, he happens to also have a sort of shameless streak in his personality. It's one of the things he happens to be so easygoing and playful about; playing little pranks or teasing others to get a smile, a laugh, or even a small blush out of them. He is quite energetic and loves to have fun with people, especially if it comes to a bit of friendly competiton. Not just that, but he can also sometimes do or say things that wouldn't exactly be classified as \"dignified\" or \"normal\", coming from a Quel'dorei especially. One example of this is that he seems to hold conversations with wolves, or any wolf, really. Hah! As if they could ever respond to him, right?\n\nEven with his playful and easygoing attitude, he is not without his serious and more noble qualities either. To those he trusts and loves dearly, he is very protective of and would give his life for in order to keep them safe. Family and friends are very precious to him, as he considers those part of \"his pack\". As such, he refuses to turn a blind eye to those in need or leave any of his \"pack members\" behind when they're in trouble.. The same goes for animals too. He hates seeing animals in fear or in any pain and will do his absolute best to help take care of them, as a promise he made years ago to his mentor.{/p}{/col}\n\n",
				},
