			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Moonlight:512:128}\n\n\n           {col:ffffff}Bhrute Duskfang watches the world around him from beneath half-lowered eyelids, those golden orbs gazing out into the shadowed streets. His lips twist upward into a smug grin. His horns rise high, yellowed with age, sharpened with conflict, chipped with war.{/col}\n\n           {col:ffffff}The locks of his hair are a mane, rich and thick, woven and braided with dwarven knuckle-bones and the tusks of Dwarves as trophies. There is no mistaking the brutality of the Tauren's history - fresh scars lacing old ones, visible on his bared arms and chest.. slabs of flesh on a dense core, ruining the thick fur of the warrior. Brands of loyalty and oaths of pain marr that fur, symbols of honorifics and unit affiliations carved into his flesh beneath, yet the Horde's mark is largest of all. Bones and fangs and tusks are mounted on his armour, skulls resting against the gnarled leather, dragon-gut wrapped tight around empty sockets, binding the boney, sightless gazes of countless trophies to his gear. From a banner pole affixed at his back, cloth and cured flesh stir in the breeze - stained blue with dye and red with blood, the insiginia of the Horde stitched there matching the brand mark that ruins the fur of the great Bull's shoulder.{/col}\n\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-55:64:64}\n{h1:c}His War-Kit{/h1}\n\n    {col:ffffff} The massive sword of dark steel lies lashed to the back of the Warrior, the blade angled in its primitive sheath so that the jagged edge rests to the side of the great riding beast's hips. The Tauren's preference for efficiency over design stands obvious - blades rest in sheaths about his thick frame, axes and crude cutting weapons strapped to his belt, his boots. The wicked, uneven edges of the blades fray their crude leather sheaths. The massive two handed weapon at his back is adorned with a skull of a great beast, it's great horn cracked in twain.{/col}\n\n    {col:ffffff} His weapons, much like his armor, is jagged and without elegance. Much like Bhrute himself.{/col}\n\n\n{img:Interface\\QuestionFrame\\answer-AlliedRace-Highmountain:256:128}\n{h1:c}His Wyrd{/h1}\n\n    {col:ffffff}All those who carried his family's name are dead, and he alone remains. He is the last son of the last son, a line of long-dead tribe, some honoured, others cursed, all proud and spitting their defiance at their last. He has fought under many flags, on many battlefields. He has spilled his enemies’ blood on the crust of many strange lands, and he has trod his heavy iron-shod feet into the halls of ally and bane, god and demon, dragon and man alike. {/col}\n\n     {col:ffffff}None have been his doom.{/col}\n\n     {col:ffffff}The blessings and curses of his life are obvious, for the hulking Tauren's step is haunted by shades. Whispers abound amongst the Horde warrior's desperate quarries that shadowy whispers from his ancestors guide him to a death full of glory and honour, luring the Bull to his prey with an unnatural accuracy and swiftness.. Many of the rank-and-file in the military regard him with both relief and fear - that he is present does as much to calm the unit he's assigned to as it does to unnerve them, for Bhrute's search for glory is well known. It would not take a shamn to see the scores of spirits clinging to his bloodied, scarred hands, desperate to lead the massive brute towards a worthy death shrouded in glory.{/col}\n\n",
				},
