			},
			["about"] = {
				["v"] = 80,
				["BK"] = 4,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\LFGICON-ZULFARAK:256:256}\n\n{h3:c}{col:ffc232}{icon:ability_druid_healinginstincts:20}{icon:spell_monk_envelopingmist:25}Personality{icon:spell_monk_envelopingmist:25}{icon:ability_druid_healinginstincts:20}{/h3}\n{col:67d57f}This sand troll displays a wide variety of emotions, but many of them are subtle and kept toned down when in public. Like the animal she is naturally drawn to, she portrays many features of a feline- aloof, wary, and hard to trust. When around others that has earned her favor, affection and tenderness may slip in with the rest of her demeanor. The kicker to Vor’biba is her tendency to switch on the dime, either to suit the situation or suit her personal desires. Artificially, many see her as timid, a suck-up, or too cocky for her own good. To pin down what she is truly like would require time and understanding, and she will sometimes do her best to remain vague to keep her distance. \n{img:Interface\\PETBATTLES\\Weather-Sandstorm:512:3}\n\n{h3:c}{col:ffc232}{icon:crest_monk:20}{icon:ability_racial_embraceoftheloa_kimibul:25}Physical Description{icon:ability_racial_embraceoftheloa_kimibul:25}{icon:crest_monk:20}{/h3}\n{col:67d57f}This troll hails from the harsh dunes of Tanaris, seen by the light, dry skin from the very first impression. Her head is full of a vibrant red mane, streaks of blue sneaking their way throughout. She holds it up in a golden band, various locks braided. If one was to get closer to the troll, they would see her dazzling blue eyes, the pupils looking narrow like that of a cat. She has stiff ears, still capable of twitching and angling slightly to listen in to all the sounds around her. On her light skin are brilliant red stripes, a sign of her worship to Kimbul. They travel down her arms, decorate her face, and even hug along her ribs. When going down to her hands, the nails are darker and sharp, kept pointed like claws. Physically she is in top shape, holding a curvy figure to fill out her usual choice of wear.\n\n{col:67d57f}She currently has a heavy wooden staff that she has strapped securely upon her back, which has a leather bag tied to it, along with a heavy keg storing her supply of water. Surprisingly very few tattoos or piercings mark this sand troll, her body kept altered only to the likeness of her Loa.\n{img:Interface\\PETBATTLES\\Weather-Sandstorm:512:3}\n\n{h3:c}{col:ffc232}{icon:misc_legionfall_monk:20}{icon:ability_monk_touchofkarma:25}Current Interests{icon:ability_monk_touchofkarma:25}{icon:misc_legionfall_monk:20}{/h3}\n{col:67d57f}{icon:ability_monk_serenity:25}Now that she has joined the Horde, this sand troll is looking for opportunities of any type. Connections, jobs, and above all, a teacher to better help her understand what it takes to become a monk. \n\n{col:67d57f}{icon:ability_monk_serenity:25}If she is going to learn the culture of the Pandaren with the path she took, then it is only fair to understand their deities in better detail. What does each Celestial do? What are they capable of? She wants to know all of this, and is looking for anyone who might be able to give her the knowledge she desires. \n\n{col:67d57f}{icon:ability_monk_serenity:25}She's perfect for finding on the road, just about anywhere. There is always a destination, but what it is and where she goes is decided on a mere whim. Who knows what sort of adventure may lie in wait with this sand troll?\n\n{col:67d57f}{icon:ability_monk_serenity:25}This may come as a surprise, but this sand troll has a personal interest in learning about the other races that reside on Azeroth. Of course, she still holds onto a bitterness for how the Horde and Alliance played their part in attacking the Farraki. Even then, she's willing to give them the benefit of the doubt. The only race she still cares nothing for, of course, are the goblins. \n\n\n",
				},
