						["TX"] = "The sand troll in her times of travel has learned simple Common, a decent amount of Orcish, and is still very much fluent in Zandali. For this reason, she tends to have a heavy accent when speaking out of her native language. When speaking, she will also commonly growl, snarl, hiss and purr, usually interlaced in with her words.",
