						["TI"] = "Flowers! ",
						["TX"] = "This troll -loves- flowers. Despite living in Tanaris for most of her life, she found that forested areas are by far the best. She will always try to wear a flower tucked in her hair if possible. Because of this, she took on a floral scent.",
