					["1"] = {
						["AC"] = true,
						["TI"] = "- Armor -",
						["TX"] = "The woman's armor primarily consisted of leather-bound chainmail and halfplate. Providing ample protection from physical blows, particularly slashing strikes. It was light enough to keep her swift on her feet, but durable enough to take a blow should she fail to evade. Her armor was red, black, and gray for the most part, with some off-golden trim in certain places. She sported a long crimson cloak that stretched down to her sabatons.\n\nHer usual headgear was a set of spectables, engineered by none other than Arin herself of course. Other than the ability to improve her combat perception to some degree and the style that comes with their wearing, the spectacles perform adequately to protect her eyes, be it from a strike or some scoundrel wielding pocket sand as a weapon. \n\n...However, as of late she has taken a liking to wearing a scalemail coif, it's inside stitched with fur, it makes her look far more covert!\n\n",
						["IC"] = "inv_misc_wartornscrap_chain",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "- Perceptive -",
						["TX"] = "It's not uncommon to feel as if one's being watched when in the company of Arin, and that's because she is most likely watching! Ever vigilant on her surroundings, it's not uncommon to see the elf inspecting strangers at a bar, or watching passerby. Her reasoning is her own, but her awareness has saved her from trouble many times.\n\nIf someone was percieved as a combatant, Arin's gaze may grow predatory, as if sizing them up, measuring them, analyzing their obvious strengths and trying to point out any weaknesses, despite being ever impassive.\n",
						["IC"] = "sha_ability_rogue_bloodyeye_nightmare",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "- Arms -",
						["TX"] = "Arin's weapon of choice was a beautifully crafted longsword, often seen resting in it's elk-hide scabbard slung across her back. The weapon featured a decorative crossguard with a simple pommel and a blade elongated slightly past standard for it's type. Despite this oddity, the weapon is well balanced and fits in Arin's grip like a long, sharp arm. It was durable and medium-weighted, heavy enough to put some stopping power behind her strikes, but not so much as to weight down her swift, agile maneuvering.\n\nPartial to guns of course, Arin has a holster strapped to the chainmail protecting her hip. Within the holster was a high-caliber hammer-operated pistol, much like a revolver. It carried five rounds of ammunition before needing a reload. Unlike her sword, it's design was minimalist and straight to the point - hardly a concern to anyone caught on it's business end.\n\n",
