		["0825170338RKdUV"] = {
			["link"] = {
				["Jazpark-WyrmrestAccord"] = 1,
			},
			["character"] = {
				["CU"] = "In a good mood.",
				["CO"] = "\nIC anywhere, world RP let's go!\n\nWhen will /who return from the war...\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
				["RP"] = 1,
				["LC"] = "itIT",
				["XP"] = 3,
				["v"] = 95,
			},
			["time"] = 1631157284,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T2"] = {
					{
						["TX"] = "Black hair and violet eyes; pretty unremarkable for a goblin, right? Jazpark banks on being unremarkable. His ability to blend in and his lanky, agile frame help him get into where he needs to be and, more importantly, get out. He'll talk to anyone about anything and enjoy it.\n\nBut that's when he's working...\n\n\nWhile he calls himself a politician, his fingers are callused, but it's not the battle-worn wear common to so many; it's concentrated on the fingertips.  Maybe that violin case really contains a violin and not a tommy gun. Doesn't really explain the pocket full of piano wire, though.\n\nJazpark stands taller than average on the goblin height scale His black hair is often wild when it's not long enough to tie back. \n\nHis frame is wiry but fit; a bit far on the too-skinny side lately, really, as his work demands a knack for getting into places by any means, a fast running speed, and even faster reflexes.\n\nIt seems this rogue is more than just a highwayman, but it doesn't mean he's not a damn good one.\n(Jaz is IC Ravenholdt with a stint in SI:7 and now Uncrowned. If your toon is and you'd like to know him, feel free! Just let me know first!) \n{link*TinyURL.com/Jazpark-Art*Imgur Album}\n\n",
						["BK"] = 1,
						["IC"] = "Spell_Shadow_NetherCloak",
					}, -- [1]
					{
						["TX"] = "Jazpark grew up on Kezan; the son of prominent musician and club owner, middle brother of four others and a mum who raised the lot of them: the old man included. \n\nWhen he wasn't learning the tricks of the trade from the old man down at The Loose Fuse down by Kajaro Field, he was at home with his siblings. Pretty standard stuff for a goblin preteen.\n\nSomething changed, pushing him to the career path he's on now. Quiet and more reserved than he was in his youth, he's certainly not the carefree musician he was. But he's guarded about his past. \n\n...What rogue wouldn't be?\n",
						["BK"] = 1,
						["IC"] = "inv_misc_book_09",
					}, -- [2]
					{
						["TX"] = "Tattoos:\nSheet music  across the left side of his ribcage.\n\nSeven bridge pins in a circle over his heart, each with a letter; M, K, J, I, L, D, and E.\n\nItems of note:\nA gilded flask with \"Red and Gold\" etched on one side and \"A Family Bold\" etched on the other. He is never without it.\n\nA Ravenholdt signet ring on his right pinky.\n\nA gold and silver band with Thalassian engraved on it around his left middle finger.\n\nAn intricate truesilver and moonstone ring expertly crafted into the shape of an orchid. Seems to radiate magic gently.\n\nA silver and gold pocket watch with the initials J.B. engraved on it.\n\nA money clip with the initials J.B. inlaid in red gems on one side.\n\nA leather bracelet around his right wrist: dark leather with strands of red and purple, a band of metal with daggers etched along woven in.\n\n\nScars:\nWhen any part of his arms are visible, there are  long, precise scars down each from the top of the shoulder to the top of each wrist. Every three inches or so, a scar loops around the circumference from bicep to wrist.\n\nSmall, thin scar on the right side of his abdomen.\n\nThin scar on the left side of his abdomen.\n\nJagged scar from the top left hip, ending under his right side shoulder.\n\nTwo inch scar over his heart.\n\nLeft ear has a faint scar along the lobe to mid-shell.\n\n\n",
						["BK"] = 1,
						["IC"] = "inv_60pvp_ring3a",
					}, -- [3]
				},
				["BK"] = 1,
				["TE"] = 2,
				["v"] = 56,
			},
			["misc"] = {
				["ST"] = {
