				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\n{h3:c}{col:FFDE60}— R H A K A R A —  {/h3}\n\n{col:fff7ae}It's difficult to contest the fact that orcs are a race predominantly built for war; this one hardly seems like an exception to such a statement. Both stature and form only further prove that she's an exemplar of this adage.\n\nBroad shoulders trail down to a pair of burly arms that appear capable of moving mountains, though the rest of the orc's form suggests she doesn't do all that much moving around herself. That plated girdle remains tightly cinched against a burgeoning midriff, monolithic legs forming a solid foundation for the assailant's stance. For as irresilient as it may make her appear, the notion of conflict being something foreign to her is assuredly false.\n\nThe maw of the orc's mask similarly belied little sympathy, an adaptation of her kinsmen's headdresses. What little could be seen included a toothy grin behind the fossilized incisors; a menacing pair of amber eyes made that piercing gaze known from beneath.\n",
				},
			},
