					["1"] = {
						["IC"] = "inv_legion_faction_kirintor",
						["TI"] = "Not well liked in Dalaran.",
						["AC"] = true,
						["TX"] = "The details are murky, but what is certain is that Millastra suffers a less than ideal reputation with the mages of the Kirin Tor.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Rendered strange.",
						["IC"] = "spell_arcane_blink",
						["TX"] = "She saw something, or sensed something. Felt something or had been made prey of something beyond ken. Either way, when she delved into deep conversation, she tended to discuss outright odd metaphysical theory.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Underworld connections.",
						["IC"] = "ability_rogue_disguise",
						["TX"] = "She was known in certain circles, after she left Dalaran. And in those rare moments where she came up for air, she generated something of a name for herself among criminal circles as a sorceress, apothecary and discreet surgeon for hire.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Generally pleasant.",
						["IC"] = "achievement_halloween_smiley_01",
						["TX"] = "Everyone has bad days, but when and if she does, she weathers them well. She's almost always at least polite, unless others decide that they aren't first.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Temporal distortions?",
						["IC"] = "spell_holy_borrowedtime",
						["TX"] = "Sometimes things got weird in her immediate vicinity. Objects nearby would age and deage, always returning to their initial states, however when she left. It didn't seem to do anything to other people.",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 3,
					["5"] = 0,
					["4"] = 0,
					["6"] = 0,
				},
				["v"] = 21,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n\nMages often made it tricky to nail down their precise ages. Millastra was no exception in this. Her skin was taut, and her complexion clear. She had pretty features with observant, smiling purple eyes, a slightly bulbous nose, and full lips, often playing home to a mischevious little grin. She adorned herself with hoops of silver and studs of amethyst in her ears and nostrils and kept her platinum hair in a loose, lazy ponytail. She rounded out the look with just enough blush and eyeliner of kohl.\n\nShe was thin, as mages tended to be, though not sickly by any means, with a petite feminine frame, dressed often in modest, but finely made purple robes. Slung about her torso was a satchel of black leather which hung at her side. The strap had loops stitched in, where she stored a staff of silver and amethyst across her back. And those colors seemed to repeat as a theme over and over. Purple, silver and black. Her fingers all hosted rings of silver, set with opals, amethysts, jet and obsidian.\n\nHer mannerisms however, did not match her looks or dress. Where at a glance, once might expect a demure, refined little Goblin, she was somehow still rougher around the edges. Perhaps it was a consequence of whatever fueled her ability, or the rumored neccessity of palling around with the underworld for the years she was missing, but something about her was just... Odd. Something aside from the near insane ramblings, anyway.\n\n\n{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n\n\"No, it ain't as controversial as some of the things I could get up to, but there's a reason a lotta mages stick to fire an' ice. An' the way I went about it? let's say the Kirin Tor don't count me as a friend, an' leave it there.\"\n\nWhat cost, power? Millastra, in her time with the Kirin Tor would first have been called a student of great promise, later a troublemaker lacking focus, and later still, persona non grata. The reasons for this are kept quiet but... People talk.\n\nIt was said that first, the outspoken young Goblin began questioning the value of her course work, the wisdom of her superiors, and the strict control the Kirin Tor exercised over its members. From there, she began rallying against those senior casters, accusing them of hoarding knowledge, and limiting the more junior members in what they could learn or do. The last straw was said to have been a late night raid she alone executed, making off from the floating city with a litany of scrolls and tomes. If that last bit were true, it was odd that she wasn't hunted by the Kirin Tor. Again, people talk... But not always truthfully.\n\nWhatever the truth, and despite her departure Millastra, who seemed to be a falling star in her exile from Dalaran, came out the other side somehow... Smarter than she ought to be. Having left only a few years into her training, she was considered a novice at best when she disappeared. When she turned back up in Orgrimmar some three years on however, she spoke of odd realities and limitless potentials, and more importantly, had somehow come into a great deal of arcane power; casting offensive spells of raw arcane energy and expressing easy mastery over conjuration and portal magic.\n\nThe why and how of this sudden gift was unclear. She seemed to be protected from most forms of scrying, and while she carried a clearly arcane aura, nothing about it would hint at anything more devious than countless years of study. Countless years she somehow crammed into three all the same. She and a select few likely knew the truth of it all, the secret source of her power, or the trick she was pulling, whichever it happened to be; but she wasn't talking, and the Kirin Tor remained ever abrupt about the topic.\n",
				},
				["BK"] = 1,
				["TE"] = 1,
				["v"] = 7,
			},
		},
