				["PE"] = {
					["1"] = {
						["IC"] = "inv_misc_herb_zoanthid",
						["TI"] = "\"Sugar, spice, everything nice!\"",
						["TX"] = "The aroma of naturally sweet flora lingers about the gentle giant. The flowers that bloom across his armor prove to be the source. It's almost intoxicating...",
						["AC"] = true,
					},
					["3"] = {
						["IC"] = "ability_rogue_disguise",
						["TI"] = "Shy Guy",
						["TX"] = "Big in stature, small on words. He choose to keep his eyes low and speaks only when necessary. Compassion is normally the only means he comes out of his shell. That, or selling his honey.",
						["AC"] = true,
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Plant Garb",
						["TX"] = "The mixture of formal leathers and attire was entangled with vines and lengths of flowering branches that offered little protection. Though, it did make for a fine lure for honeybees!",
						["IC"] = "inv_helm_flowercrown_a_01_blue",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "\"BEES!\"",
						["TX"] = "Relax, relax! The bees aren't aggressive. In fact, they don't even pay much mind to people. The pollen upon the giant's armor was what they were after. Honey was to be made after all!",
						["IC"] = "spell_nature_insect_swarm2",
					},
					["4"] = {
						["IC"] = "spell_nature_strength",
						["TI"] = "Wasted Potential",
						["TX"] = "Under the leather and plant fibre reveals a body finely sculpted to be battle-ready and then some. A lineage of warriors ends here as this one prefers to walk the path of nature than violence.",
