			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-druid-cover:256:256}\n\n\n\n{link*https://imgur.com/kvrqYHN*Sweet Nectar & Big Double}\n\n\n\"Y-your name translates to - I'm sorry can you run that by me one more time?\" an orc recruiter stammers, clearly in a bit of disbelief.\n\nThe youthful tauren blinks as if not understanding the issue. A quick pat to the center of his formal chestpiece attempts to clear up any phlegm and further confusion. The tauren then announces, \"My name is Sweet Nectar, botanist, agriculturist and apiculturist.\"\n\nThe orc recruiter tilts his head with a furrowed brow, \"A what?! Cultist?! No, no, we can't have that within city limits. I'm afraid we can't... oh, you mean beekeeper. That's fine. Completely different. We are in need of those keen in agriculture. Perfect. I assume you are wise with plants, farming, things of that nature. Or, nature in general.\"\n\nWith that, the somewhat eager bull nods, \"Yes. I know much of how to grow flora. Although, I am not sure if Durotar has the right conditions for farming. Well, perhaps some foods will grow here. With a lot of care, and time.\"\n\n\"That is why we need people such as yourself! But, do you have any other skills? Something outside the realm of farming. We have plenty of farmers, but need others willing to march to the front lines. You have the body for an axe if you ask me!\"\n\nThe tauren made a face, scrunching his nose and casting his eyes away from the recruiter. \"No. No weapons training here. Just farming... Uhh, maybe I know a thing or two about mending wounds.\"\n\n\"Medic! Got'cha! Aw! Wow, I'm gonna make a big bonus off of you, kid. Heh heh. Well, I guess that's it. Not like you'd get rejected or anything but here ya go! Here's your insignia, your barracks bunker number and axe! Complimentary to new recruits. Makes you feel like a real grunt, huh?!\" the recruiter said, trying to motivate the rather unenthusiastic greenhorn.\n\nThe youthful bull didn't speak right away. He'd shrug his shoulders and grumbles, \"Yeah, a real grunt. Can you put me somewhere at the back of the battle? I'm really not a fan of... war.\"\n\nThe orc bursts into laughter, \"Then why did you join up, kid?! We're knee deep in conflict at all times. What, like we'd have you in the fields with a hoe?! BAH-HAH! Oh, no. We're gonna work you good on the battlefield, son! Now, get that flower out of your head and march down to the Hall of Legends, we're not done with your registration.\"\n\nSighing, the bull nods and shovels off to follow the recruiter. From the awkward lack of space within the office to the open roads of Ogrimmar, the bull peers out towards the many faces and various walks of life. The slight melancholy upon his face melts away, happy to be surrounded by so much life, so many cultures.\n\nThis is what he joined for; To assist those around him no matter their creed or means of honor. To him, life was precious no matter where it may come from. It was beyond the service of a banner, or faction. It was a calling to protect all that walk upon the Earth Mother, a duty he'd claim until his death.\n\n--------------\n\n{link*/c/sweetnectar*/c/}\n\n\n",
