						["TX"] = "{h1}{col:F97D5B}. : • ˚ † M{/col}{col:F98863}a{/col}{col:F9936B}d{/col}{col:F99E74}e{/col} {col:F9A378}mist{/col}{col:F9A87B}akes{/col} {col:F9A378}when{/col} {col:F99E74}we{/col} {col:F9936B}were{/col} {col:F98863}young. †{/col}{/h1}\n{p}{img:Interface\\PETBATTLES\\Weather-sunlight:500:3}{img:Interface\\PETBATTLES\\Weather-sunlight:200:3}{/p}\n{p:r}{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-Skyreach:300:170}{/p}\n{h1:r}{col:F97D5B}† C{/col}{col:F98863}a{/col}{col:F9936B}n{/col}{col:F99E74}'t{/col} {col:F9A378}s{/col}{col:F9A87B}a{/col}{col:F9A378}y{/col} {col:F99E74}that we{/col} {col:F9936B}never had{/col} {col:F98863}fun.{/col} {col:F97D5B}† ˚ • : .{/col}{/h1}\n{p:r}{img:Interface\\PETBATTLES\\Weather-sunlight:200:3}{img:Interface\\PETBATTLES\\Weather-sunlight:500:3}{/p}",
						["BK"] = 1,
