					}, -- [1]
					{
						["TX"] = "{p}{col:F97D5B}† \"And{/col} {col:F98863}I{/col} {col:F9936B}know{/col} {col:F99E74}you'll{/col} {col:F9A378}never{/col} {col:F9A87B}understand,{/col}{/p}\n{p:c}{col:F9A378}no, no one{/col} {col:F99E74}understands,{/col}{/p}\n{p:r}{col:F9936B}all I wanted{/col} {col:F98863}was to be{/col} {col:F97D5B}free...\" †{/col}{/p}\n{p}{img:Interface\\PETBATTLES\\Weather-sunlight:500:3}{img:Interface\\PETBATTLES\\Weather-sunlight:200:3}{/p}\n{p:c}{col:F97D5B}It's no use,{/col} {col:F98863}you've definitely seen{/col} {col:F9936B}this Vulpera before, no matter how much you rather not remember.{/col} {col:F99E74}Either you've seen him yelling in Orgrimmar about witches{/col} {col:F9A378}or getting into trouble in Silvermoon,{/col} {col:F9A87B}the point is this loud mouth Vulpera{/col} {col:F99E74}unintentionally makes his presence forcefully known,{/col} {col:F9936B}his stupid face is constantly grinning with pride as if he's proud of his mess. Minus his obviously annoying persona, Tenko is kind, and likes to aid those for whatever matter is the issue, even for those he's not sure of,{/col} {col:F98863}or has taken a disliking to. He comes off forceful, and a little extreme, but he means well,{/col} {col:F97D5B}he just doesn't have a inside voice, nor is he familiar with how things go around for others unlike himself.{/col}{/p}\n{p:r}{img:Interface\\PETBATTLES\\Weather-sunlight:200:3}{img:Interface\\PETBATTLES\\Weather-sunlight:500:3}{/p}",
						["BK"] = 1,
						["IC"] = "inv_shield_69",
					}, -- [2]
					{
						["TX"] = "{h1:c}{col:F97D5B}. : • ˚ † A{/col}{col:F98863}p{/col}{col:F9936B}p{/col}{col:F99E74}e{/col}{col:F9A378}a{/col}{col:F9A87B}r{/col}{col:F9A378}a{/col}{col:F99E74}n{/col}{col:F9936B}c{/col}{col:F98863}e † ˚ • : .{/col}{/h1}\n{p}{img:Interface\\PETBATTLES\\Weather-sunlight:500:3}{img:Interface\\PETBATTLES\\Weather-sunlight:200:3}{/p}\n{p:c}{col:F97D5B}Tenko is brightly apple red color with dirty white,{/col} {col:F98863}his fur scratched with tiger-like markings on his tail and ears of the darker red, arms?{/col} {col:F9936B}Maybe those too. His face is spotted about with lightler red dots, resembling freckles in a way. His ear tips are dyed with a low plum purple color,{/col} {col:F99E74}it's not his natural color to have purple ears, but the reason as to why he dyed them is a mystery.{/col} {col:F9A378}His fur always looks shiny, but because of the sweat and greasy-look from{/col} {col:F9A87B}fighting and working out in the heat, and has some dried patches that look like blood,{/col} {col:F9A378}overall, Tenko can look like a mess without a care in the world.{/col} {col:F99E74}His eyes are the shade of strawberry pink. When Tenko's mouth is viewable,{/col} {col:F9936B}his tongue has vertical tongue piercings,{/col} {col:F98863}'snake eyes' on them in silver, and his one and a half inched fangs have crack marks on them,{/col} {col:F97D5B}they're not broken, or cracked, but they came close before.{/p}\n{p:c}{col:F97D5B}Tenko's body is covered in small scars,{/col} {col:F98863}most are hidden away from fur coverage and gear, although there's visible scarring on his right{/col} {col:F9936B}arm and up where the fur does not cover nor grow back,{/col} {col:F99E74}they appear to be large and sloppy, they don't go further than his elbows.{/col} {col:F9A378}Under the fur there's scarring around Tenkos neck, much similar to those one would call rope scarring,{/col} {col:F9A87B}and just below the base of Tenkos left ear rests a curved horizontal line under the base,{/col} {col:F9A378}it looks like it was an attempt to cut his ear off, and failed and left behind the scar, and while barely visible,{/col} {col:F99E74}there's a slight scaring on the back of Tenko's head. His chest is covered in claw-like scars, much similar to those of Vulpera claws, and battle scars made from sharp weapons, his wrists are scarred with shackle marks as well.{/col} {col:F9936B}If able, one could spot a slave brand tattoo on the back of his left shoulder blade.{/col} {col:F98863}As of lately, both Tenko's arms have sorror blue colored tattoo marks from the elbow and up, to his shoulders,{/col} {col:F97D5B}they match the design of how plant roots would look, or wooden binds. They don't seem to bother him, but they give off a faint glow whenever he uses his magic, however he never notices this...{/p}\n{p:c}{col:F97D5B}Tenkos tail is decorated is many charms and beads, mostly of red and gold that shine in the sunlight,{/col} {col:F98863}when he runs or wags his tail, the charms click and jingle, it sort of looks heavy,{/col} {col:F9936B}but it barely bothers him. His fingers and wrists are also jewelry'd, his fingers are covered in many different types{/col} {col:F99E74}of rings he's collected over the past year or two, while his wrists are decorated with {col:F9A378}friendship bracelets and charms,{/col} {col:F9A87B}even his right ankle has a velvet colored bracelet on it,{/col} {col:F9A378}both of his ears have gold colored earrings that also{/col} {col:F99E74}shine in the light, needless to say,{/col} {col:F9936B}Tenko loves jewelry, the shinier the better,{/col} {col:F98863}while he not necessarily greedy for them,{/col} {col:F97D5B}he just likes it when they flash and sparkle, a sign that he takes care of his stuff.{/p}\n{p:r}{img:Interface\\PETBATTLES\\Weather-sunlight:200:3}{img:Interface\\PETBATTLES\\Weather-sunlight:500:3}{/p}\n{p}{col:F97D5B}† \"All bow{/col} {col:F98863}your heads{/col} {col:F9936B}to the one true{/col} {col:F99E74}King{/col}{/p}\n{p:c}{col:F9A378}Who created us{/col} {col:F9A87B}just to leave us to bleed. {col:F9A378}But aren't{/col} {col:F99E74}you angry?{/col}{/col}{/p}\n{p:r}{col:F9936B}Won't you take this opportunity?{/col} {col:F98863}Look to me and{/col} {col:F97D5B}you'll be set free.\" †{/p}{/col}",
