					{
						["TX"] = "{h1}{col:F97D5B}. : • ˚ † \"S{/col}{col:F98863}o{/col} {col:F9936B}I{/col} {col:F99E74}p{/col}{col:F9A378}u{/col}{col:F9A87B}t{/col} {col:F9A378}m{/col}{col:F99E74}y{/col} {col:F9936B}middle finger{/col} {col:F98863}up,\n{/h1}\n{h1:r}{col:F98863}I'm done being{/col} {col:F97D5B}your slave.\" † ˚ • : .{/col}{/h1}",
						["BK"] = 1,
						["IC"] = "inv_misc_herb_tigerlily",
					}, -- [4]
					{
						["TX"] = "{h1:c}{col:F97D5B}. : • ˚ † P{/col}{col:F98863}e{/col}{col:F9936B}r{/col}{col:F99E74}s{/col}{col:F9A378}o{/col}{col:F9A87B}n{/col}{col:F9A378}a{/col}{col:F99E74}l{/col}{col:F9936B}i{/col}{col:F98863}t{/col}{col:F97D5B}y † ˚ • : .{/col}{/h1}\n{p}{img:Interface\\PETBATTLES\\Weather-sunlight:500:3}{img:Interface\\PETBATTLES\\Weather-sunlight:200:3}{/p}\n{p:c}{col:F97D5B}Tenko definitely acts like a child, he's known to overreact when stressed and doesn't know when to shut up when speaking with someone about whatever.{/col} {col:F98863}He's not smart either, he always messes something up or gets something wrong, and won't even notice unless it's pointed out.{/col} {col:F9936B}Tenko is the party starter, the wild little brother type, he loves to make things more fun and enjoyable for not only himself but for those who seem down or serious.{/col} {col:F99E74}Tenko can become very sassy and stubborn at times, and uses this to spite those around him he's having a quarrel with, but is in fact not a asshole,{/col} {col:F9A378}and apologizes when he knows he needs to. Tenko tends to let his emotions take control of himself,{/col} {col:F9A378}it's not uncommon to see Tenko sulking or shittalking to himself occasionally,{/col} {col:F9A87B}especially if alone.Tenko is very open minded, he's sociable, fun-loving and genuine,{/col} {col:F9A378}he unfortunately sugar coats things and tells white lies{/col} {col:F99E74}to avoid hurting someones feelings, strangers and his friends alike.{/col} {col:F9936B}He's very observative with others emotions, and can tell{/col} {col:F98863}when ones feeling off or not like themselves,{/col} {col:F97D5B}like how a companion normally would for their loved ones. {/p}\n{p:c}{col:F97D5B}Tenko before he came to Orgrimmar was quiet and stoic, he almost felt and seemed like he lacked emotion.{/col} {col:F98863}Fixing and growing himself in Orgrimmar had changed him for the better, and although he knows hes not everyones favorite character to have around,{/col} {col:F9936B}he's happy with himself, and that's what matters to him the most.{/col} {col:F99E74}Tenko is incredibly slow and dense, and has trouble{/col} {col:F9A378}understanding even the most simple of things, and is extremely emotionally closed in.{/col} {col:F9A87B}Tenko wasn't allowed to show emotions as a slave,{/col} {col:F9A378}so getting him to look anything other than okay is diffcult in fear of past abusive reactions returning to him,{/col} {col:F99E74}expressing visible emotion acts such as crying or growling/snarling{/col} {col:F9936B}is the hardest for Tenko to show,{/col} {col:F98863}although he's getting better{/col} {col:F97D5B}at trusting others around him.{/p}{/col}\n{p:c}{col:F97D5B}It's no secret Tenko is known to not only being very sweet and charming,{/col} {col:F98863}but also arrogant and very angry, too. Because of his past of being a Sethrak slave,{/col} {col:F9936B}he's grown quite the uncontrollable anger, and tends to not listen to reason{/col} {col:F99E74}when deep in his own emotions, because of this Tenko is very sensitive, and often times lets his emotions take control when he feels he cannot do so on his own,{/col} {col:F9A378}this may or may not cause problems for those around him and himself.{/col} {col:F9A87B}He's extreme, silly and caring, but in large groups or events,{/col} {col:F9A378}he becomes shy and timid, and quiet, being quiet is a good thing when it comes to him, right?{/col} {col:F99E74}Tenko is very loving, and can be clingy and annoying, and can be very loud with his voice{/col} {col:F9936B}and even being a guard, Tenko has a damaged heart{/col} {col:F98863}that is still used to love and protect those around him, no past trauma or grudges will keep him from{/col}{col:F97D5B} giving those who he cares about and consider family his unconditional love.{/p}{/col}\n{p:r}{img:Interface\\PETBATTLES\\Weather-sunlight:200:3}{img:Interface\\PETBATTLES\\Weather-sunlight:500:3}{/p}\n{p}{col:F97D5B}† \"...Still{/col} {col:F98863}you{/col} {col:F9936B}try{/col} {col:F99E74}to{/col} {col:F9A378}burn{/col} {col:F9A87B}me{/col}{/p}\n{p:c}{col:F9A378}to the{/col} {col:F99E74}ground with the ones who kept us bound,{/col}{/p}\n{p:r}{col:F9936B}you'll pay for this treachery.\" †{/col}{/p}",
