					{
						["TX"] = "{h1:c}{col:F97D5B}. : • ˚ † R{/col}{col:F98863}o{/col}{col:F9936B}l{/col}{col:F99E74}e{/col}{col:F9A378}p{/col}{col:F9A87B}l{/col}{col:F9A378}a{/col}{col:F99E74}y ho{/col}{col:F9936B}o{/col}{col:F98863}ks † ˚ • : .{/col}{/h1}\n{p}{img:Interface\\PETBATTLES\\Weather-sunlight:500:3}{img:Interface\\PETBATTLES\\Weather-sunlight:200:3}{/p}\n{col:F97D5B}• Your character{/col} {col:F98863}was a Horde Guard{/col} {col:F9936B}along side him,{/col} {col:F9A378}and or have{/col} {col:F9A87B}seen him patrolling around{/col} {col:F9A378}captial cities such{/col} {col:F99E74}as Silvermoon City,{/col} {col:F9936B}Thunder Bluff{/col} {col:F98863}or Orgrimmar!{/col}\n\n{col:F97D5B}• You were there{/col} {col:F98863}during the Scourge{/col} {col:F9936B}Invasion event,{/col} {col:F99E74}and have{/col} {col:F9A378}participated{/col} {col:F9A87B}during it{/col} {col:F9A378}as one{/col} {col:F99E74}of the{/col} {col:F9936B}citizens he and{/col} {col:F98863}other guards had saved!{/col}\n\n{col:F97D5B}• You're friends{/col} {col:F98863}with a Paladin{/col} {col:F9936B}Sin'dorei{/col} {col:F99E74}named{/col} {col:9BF275}Jovirin,{/col} {col:F9A378}and indirectly{/col} {col:F9A87B}know him{/col} {col:F9A378}from her{/col} {col:F99E74}or have heard of him{/col} {col:F9936B}from her, or have seen{/col} {col:F98863}them together which is extremely common!{/col}\n\n{col:F97D5B}• You heard{/col} {col:F98863}him screaming{/col} {col:F9936B}about witches{/col} {col:F9A378}[or screaming in general]{/col} {col:F9A87B}somewhere in a{/col} {col:F9A378}captial city,{/col} {col:F9A87B}and were extremely annoyed,{/col} {col:F99E74}[which in{/col} {col:F9936B}this case is very reasonable]{/col} {col:F98863}or amused.{/col}\n\n{col:F97D5B}• Your Vulpera{/col} {col:F98863}was also{/col} {col:F9936B}a slave{/col} {col:F99E74}to the Sethraks{/col} {col:F9A378}during the 4th war{/col} {col:F9A87B}and managed to escape.{/col} {col:F9A378}While Tenko might{/col} {col:F99E74}not like his own kin, seeing other{/col} {col:F9936B}Vulpera he may have met back as a slave wandering{/col} {col:F98863}Orgrimmar would make him happy.{/col}\n\n{col:F97D5B}• You know of Tenkos{/col} {col:F9936B}brawlers activity{/col} {col:F98863}and have either{/col} {col:F9936B}watched him fight{/col} {col:F99E74}or fought him yourself.{/col} {col:F9A378}Either it be{/col} {col:F9A87B}inside the Brawlers{/col} {col:F9A378}guild,{/col}{col:F99E74} inside of Orgrimmar or{/col} {col:F9936B}outside of Silvermoon City.{/col} {col:F98863}[Feel free to approach Tenko for Duels / Spars!]{/col}\n\n{p:r}{img:Interface\\PETBATTLES\\Weather-sunlight:200:3}{img:Interface\\PETBATTLES\\Weather-sunlight:500:3}{/p}",
