					{
						["TX"] = "{h1}{col:F97D5B}. : • ˚ † \"M{/col}{col:F98863}y{/col} {col:F9936B}g{/col}{col:F99E74}e{/col}{col:F9A378}n{/col}{col:F9A87B}e{/col}{col:F9A378}r{/col}{col:F99E74}ation's{/col} {col:F9936B}had enough,{/col}{/h1}\n{h1:r}{col:F98863}and you should be{/col} {col:F97D5B}afraid.\" † ˚ • : .{/col}{/h1}",
						["BK"] = 1,
						["IC"] = "inv_misc_herb_tigerlily",
					}, -- [7]
					{
						["TX"] = "{h1:c}{col:F97D5B}. : • ˚ † L{/col}{col:F98863}i{/col}{col:F9936B}n{/col}{col:F99E74}k{/col}{col:F9A378}s{/col}{col:F9A87B} & {/col}{col:F9A378}O{/col}{col:F99E74}O{/col}{col:F9936B}C{/col} {col:F98863}Notes † ˚ • : .{col:F97D5B}{/col}{/h1}\n{p}{img:Interface\\PETBATTLES\\Weather-sunlight:500:3}{img:Interface\\PETBATTLES\\Weather-sunlight:200:3}{/p}\n{p:r}{link*https://imgur.com/a/Gif21rf*Character art with his friend! Made by Jovirin @ WrA!}{/p}\n{p:r}{link*https://www.youtube.com/watch?v=k2z34nkfA9Q*Theme song / Voice Claim}{/p}\n\n{p:c}{col:F97D5B}• Player is a Twenty-One years old Non-Binary who goes by He/They/She! They suffer from{/col} {col:F98863}Type one diabetes, depression and anxiety, so they will often times AFK randomly or take a little bit to reply / respond to things!{/col} {col:F9936B}I am A-OKAY with IC relationships, however OOC I am not seeking any kind of relationship other than friendships or RP partners because I'm already in a relationship! Please understand that I myself am awkward with romance, so a lot of my toons will be too!{/col} {col:F99E74}A lot of my toons are also what people would call 'clueless' and 'dumb', this is because the player is also a little empty in the head. x vx{/col} {col:F9A378}Player is incredibly friendly but also sensitive!{/col} {col:F9A87B}Some of my characters however may not be friendly and or sensitive! If I were to RP{/col} {col:F9A378}with any of my toons with other people aside from trusted friends. PLEASE know I socially awkward and suffer from a illness{/col} {col:F99E74}that makes it hard for me to wrap my head around some of the simpliest of things! I tend to get confused and anxious{/col} {col:F9936B}with certain things and will likely need a little help or patience from you!{/col} {col:F98863}I might even ask a few questions for reassurence or confirmation!{/col} {col:F97D5B}Player is A-Okay with -all- races, and is okay with small lore-bending as long as it doesn't cause too much issues. ;; v;{/p}{/col}\n{p:c}{col:F97D5B}• Tenko is a Dark-gorey/Drama/Comedy/Wholesome character,{/col} {col:F98863}and in this I prefer those types of RP themes!{/col} {col:F9936B}He -may- be used for mature, depending on the situation! Ten attempts [and often fails]{/col} {col:F99E74}to make people laugh, he likes to break fourth walls and likes to make people question his sanity,{/col} {col:F9A378}he might make some uncomfortable on accident, so feel free to let Tenko know!{/col} {col:F9A87B}Tenko has a dark past and often times without him knowing, it shows,{/col} {col:F9A378}unintentionally making things dark when he doesn't mean to do!{/col} {col:F99E74}I am MORE than happy to walk up first if you PM me!{/col} {col:F9936B}I'm oocly just as shy as you, but Tenko isn't necessarily{/col} {col:F98863}shy when it comes to walking up to a single individual or two!{/col} {col:F97D5B}Just know he can be a tad bit awkward!{/p}{/col}\n{p:c}{col:F97D5B}• I use PvP as my Battle resolution, however I am more than happy to do emote battles or roll battles!{/col} {col:F98863}I am also open to unwarned attacks or sudden attacks against Tenko,{/col} {col:F9936B}I am a fair battler and as a matter of fact, I enjoy when my toons get beat up, I will purposely let Tenko get beaten down to the pulp if allowed too,{/col} {col:F99E74}although I do not want Tenko killed, so emote battles unforunately will not just be Tenko being beaten up if the results could lead to death!{/col} {col:F9A378}I am ALL about unfair fights against Tenko, or near death encounters, and more [and worse!],{/col} {col:F9A87B}just know Tenko will survive all of them simply because I'm not actively out to kill him off yet!{/col} {col:F9A378}By all means, if you see his health meter under 10/10, attack him!{/col} {col:F99E74}If he's gearless or distracted, go ahead and stab or blast him! Go for it, I encourage it!{/col} {col:F9936B}By all means, go ahead and scar him, lose an eye? Lose his other hand? Missing pieces of tail or ears?{/col} {col:F98863}I am ALL about it! [Although do let me know ahead of time for those{/col} {col:F97D5B}but 9/10 of the time I am A-Okay with this!] All attacks are ATTEMPTS, no god-modding here.{/p}{/col}\n{p:r}{img:Interface\\PETBATTLES\\Weather-sunlight:200:3}{img:Interface\\PETBATTLES\\Weather-sunlight:500:3}{/p}",
