					["1"] = {
						["AC"] = true,
						["TI"] = "I. Awkward Occultism.",
						["TX"] = "† —» •••••••••\n\nAs of lately, it's no secret Tenko has been practicing on and off on weird magic, maybe sorcerers could tell what it is? It looks like Shadow, but hinted with green, not necessarily fel, more haunted looking, similar to that of Heartsbane magic? Whatever it is, Ten's aura exposes extreme energy of it, those sensitive to magic might be able to notice this from a decent distance, or those who practice magic could also sense it off of him.\n\nOccasional bursts of magic can be seen popping off of him, he doesn't seem to be worried about it, so should others?\n\n                                       ••••••••• « — †",
						["IC"] = "ability_deathknight_desolation",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "III. Suspicious bag.",
						["IC"] = "inv_misc_bag_26_spellfire",
						["TX"] = "† — » ••••••••• \n\nAround Tenkos shoulder and left hanging behind him is a rather large satchel, it appears to be extremely silky and soft looking, it's color matches that of dark velvet, both of Tenko's favorite things, silk, and the color red. It makes jingling noises and clanking noises whenever he walks and runs. For some reason, this bag can hold just about anything Tenko puts into it. There's a few flowers attached to the chains of his bags, given to him by someone. A Snow Lily, Tiger Lily, and a Golden Lotus/\n\nHis bag isn't really suspicious, he just makes it out to be that way... Right?\n\n                                        ••••••••• « — †",
					},
					["2"] = {
						["IC"] = "inv_sword_2h_pvpdraenors1_d_01",
						["TI"] = "II. Hand-on-Hand.",
						["TX"] = "† —» •••••••••\n\nTenko carries around drustvar-crafted weapons, either it be axes, hatches or a scythe, they're all decorated with heartsbane charms and trinkets, and gives off an uneasy magic source, but he's not worried, so you shouldn't be either, right? They're all rough, and far from perfect condition, they've obviously been used, and are stained rather aggressively in crimson red, his scythe seems to be his favorite, the deer skull attached to his scythe is decorated with black feathers and... fur?\n\nAll known of these, they're not his, they were stolen, but from who?\n\n                                        ••••••••• « — †",
						["AC"] = true,
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "V. Destiny Bond.",
						["IC"] = "sha_spell_warlock_demonsoul_nightmare",
						["TX"] = "† —» ••••••••• \n\n\"I will be the last you see; it's irony\nI'll be the one to take all your glory\nYou wrote the end to your own life story\n\nMake a move on me\nI'll be your last memory\nTake me down\nThe tricks on you because you're coming with me...\n                  ...Destiny bond\"\n\n-----------------------------------------------------\n                Using his curse to his advantage.\n-----------------------------------------------------\n\nTenko had used his curse to inflict a spell onto himself, his death results in his attackers death as well, Tenko is originally aiming for his curser, however if someone else were to lay the final blow, they'll be taken down with him instead. With the spell active, a faint blue aura surrounds Tenko, can be seen when close to him or starts to be clearly seen when approaching him.\n\n                                        ••••••••• « — †\n",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "IV. Mechanical Palms.",
						["IC"] = "inv_hand_1h_pvpdraenors2_d_01",
						["TX"] = "† —» ••••••••• \n\nTenko has a mechanical right hand, and it's impossible to tell it's fake, due to a recent (and painful) trip to a Draenor Engineer, his right hand is mechanical and indestructible. The vixen pelt is crafted and designed to match Tenkos fur, what may give it away is the faint machine sounds it'll make up close or Tenko tells you it's fake, it's able to grip onto two-handers with ease, the hand is incredibly heavy and can lock onto it's target easily. Either it would be.... weapons, or someone. If grabbed, the palm of his new hand is rather... sliced, or open.\n\nWhatever is causing the palm of his hand to feel incomplete is a mystery, the hand is very much done and working, however something is inside the hand, and needs an opening, best not to find out what the thing possibly is, could likely be deadly, or even fatal. Avoiding grabbing his wrists and yanking, you'll likely give yourself a cut. Don't let him grab you, either.\n-----------------------------------------------------\n[If you have TRP extended, you can view this in his Inventory!]\n\n                                        ••••••••• « — †",
