				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\LFGIcon-BlackrockFoundryForge:150:150}\n\nRend is either a very bad orc or a very good one. It depends on who you ask – and there's no middle ground at all. He doesn't care much for the Elements. He swears like a sailor. He likes to drink, fight, and fuck. He hates philosophy, religion, or indeed any question of any depth at all. Even for a warrior, he's aggressive and loud, a black sheep amongst his people.\n\nPhysically, Rendrok is a brutish figure, so much so that there's doubtlessly some ogre blood in his lineage. He's a wall of muscle and armor, the black hue of his skin mingling with the reds and pewters of his plate until he seems nothing so much as a rusty golem. Of course, the Blackrock is very much alive. He shows it by his booming laugh, his fast grin, and his insatiable appetites. \n\nHis face is broad, with a jaw that could cut through rock, square and prominent. It's often covered by dark stubble, Rend taking only the most intermittent care to shave himself. He sports intense, burning eyes and a nose that has been raked by a claw at some point in the past, leaving behind a pair of scars across the bridge. \n\n{link*tinyurl.com/RendrokDoodle*Sketch done by Ireigh because she's awesome.}",
