			},
			["about"] = {
				["T1"] = {
					["TX"] = "Sarthariel or \"Sari\" for short, isn't the everday doom and gloom dark broody demon hunter, and is in fact quite the opposite. Sari is a whimsical spirit, she enjoys her wine just as much as the next elf and is either busy with paperwork, chatting, doing stupid things, or of course internally arguing with her demon Kha'Reis, AKA Karen. Despite Sari's positive demeanor she is a force to be reckoned with on the battlefield, while seeming innocent and sweet, she takes great pleasure in tearing her enemies, namely demons, limb from limb in a sadistic fashion. Her usual occupation as most Demon Hunters is with the Illidari, she typically patrols the Broken isles and other once demon infested areas as a guardian to stem any rising threats of demonkind that may surface.\n\nSari doesn't know much about her past, most of her long term memory was lost during the pairing ritual between her and her demon. The faces of her parents or any other family she may have had are lost to her, she recalls her family name, and has small blurs of what once was her life before becoming a demon huntress. The one thing that sticks with her from her past life, is her unbridled hate for demon kind, though she is unsure of its origin. \n\nSome demon hunters grow scales and hardened skin, others get acid blood, Sari was graced with keeping her normal looks,gained  horns, wings, and of course her ethereal sight, hers however, is more of a far sightedness. She is unable to see close up things very well, images return to her in a fuzzy fashion, however, she can \"see\" and feel things coming from very far away. \n\nThe ritual Sari went under was a special case, her demon was a powerful hybrid of sayaad and annihilan (pit lord), many students were lost in attempts to subdue the demon that inhabits Sari. What made Sari compatible with Kha' Reis was her personality and hatred for demonkind. Where Kha Reis wishes for the destruction and doom of all things, Sari counteracts those traits with her positive demeanor and attitude towards demonkind. \n\nSicne the fall of the legion Sari has allied her interests primarily with that of the horde, while not on mission she spends most of her time fighting off the forces of N'Zoth, battling the alliance where it is appropriate, rescuing cats from trees with her amazing climbing abilities, teaching children how to draw simple shapes and of course, leisurely drinking and getting into whimsical nonsensical trouble somewhere somehow.",
				},
				["BK"] = 1,
				["TE"] = 1,
				["v"] = 10,
			},
