			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-BurntEarth:512:100}\n\n{h1:c}{col:ffd959}Art comming soon!{/col}{/h1}\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-DraenorOrc:512:150}\n\n\n\n{h1:c}{col:ffd959}{icon:ability_mount_whitedirewolf:25} Wolfrider Morok Irontusk {icon:spell_warrior_sharpenblade:25}{/col}{/h1}\n\n{img:Interface\\PETBATTLES\\Weather-BurntEarth:512:15}\n\n\n\n{h1:c}{col:ffd959}History of Morok{/col}{/h1}\n\n{img:Interface\\QuestionFrame\\answer-warboard-bc-HellfirePeninsula:412:156}\n\n{h1:c}{col:ffd959}Prior to the Dark portals opening:{/col}{/h1}\n\n\n\n{p:c}{col:ffd959}Morok Irontusk was born in Nagrand, Draenor (Outlands now).  Born in the Warsong Clan, he was raised by the other warrior at a young age. Morok didn't have much of a childhood because many things were changing around him. At the age of Seventeen, Morok was on his way to becoming a Wolfrider. A very challenging thing to do because of the various steps it took to become one. He joined the legendary Grommash Hellscream on many raids of ogre villages and he enjoyed it with every ounce of him. This all continued until Gul'dan came to them all. Many of the Warsong orcs were the first to drink the demon blood, Morok did so proudly. This lead up to the Dark Portal.\n\n{/col}{/p}\n",
