		["0630185740gtLB9"] = {
			["about"] = {
				["v"] = 12,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-shaman-cover:256:256}\n\nMutorm Stormhand was born in the old Draenor. Born in the reaches of Frostfire Ridge, his parents were slain in combat. Raised among the other orphans he grew to commune with the spirits. Speaking to his parents, and ancestors. The Shaman took him in, and he began to naturally progress. \n\nEarning the name Stormhand for his use of lightning, and the power he displayed with it. He began his long journey within the rising Horde. Joining in hopes to save his world, and taking the Fel. His power grew, his body grew. He loved the feeling, but it came at a terrible price. \n\nHis conquering days are behind him. No longer locking those in chains, or enslaving them to his will. He teaches and guides now, though he still feels the pull to his previous life.  \n\n\n{h2:c}Draenor{/h2}\n\nBefore his coming to Azeroth, Mutorm was of Draenor, the blood of the Ancestors pulsed through him. Then came the war against the Draenei. His axes slick with their blood, the cries they made when he cut them down. He wouldn't hesitate to say at the time he enjoyed it. Casting bolts, crushing them under rocks, he used the Elements to fight them, and before long he had nothing left to fight. The Horde moved on, and he with them as the Dark Portal opened and he flooded into Azeroth with his kin.\n\n{h2:c}First War{/h2}\n\nComing out in the Black Morass, Mutorm was one of the first to meet these new people. Strange, smaller things that were pink and weak. His axes cleaved through them with ease. The Fel magic flowing through him made him feel strong, like ten warriors instead of just one. He burned Westfall, dragging those that were weak, and killing all those who rose arms to defend themselves. The hit and run tactics of Warchief Blackhand were strong, but soon enough the Humans struck back. Strangely none of the other kingdoms helped, Mutorm would think it would make sense for them to band together in defense of their home. \n\nIn the end he cared little, and decided these weak things were nothing better than practice. Though the humans managed to defeat the Horde three years later, at the first Siege of Stormwind. He thought that Blackhand was losing his touch after his brush with death, and killing the two Warlocks was senseless. \n\nAfterwards it feel to Doomhammer, one that Mutorm respected greatly, to build a barracks and strategic outpost of Kyross. They crushed any that stood before them and they were sent word to go fetch the Warchief's daughter. Mutorm was left at the barracks, and before long were under attack. After the reenforcements appeared the raiders were swiftly crushed. \n\nAfter the Horde mastered the new Magic of the humans, they marched up towards Stormwind once more. \n\n\n\n(MASSIVE WIP) \n",
				},
			},
