			["about"] = {
				["v"] = 11,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-ToxicFumes:512:128}\n{img:Interface\\PVPFrame\\Icons\\prestige-icon-3-2:128:128}\n\n{link*https://imgur.com/a/jOMQBoI*Tiresian by Norivander}\n\nCold, clean, and clinical, Tiresian Ashreaver’s likeliness bears all of the warmth of a polished sheet of stainless steel, elegance and business caught in quid pro quo. Passed down by a lineage proud of its bearings and refined by years of athleticism and martial charge, his features are noticeably sharp. Sitting atop a lantern-jaw and a neck corded by muscle, his face is well-balanced and equally whetted. High cheekbones rise up and protrude out of the sides of his face, framing his Aquiline nose. Though rarely seen, two fel-fire 'eyes' sit deep in each socket beneath a thick brow ridge, that overlaid by two often-trimmed and exceedingly strong black eyebrows. \n\nTwo basalt-colored horns act as the centerpiece for his fel-wracked frame. Protruding out of his head and bending back into a high arc against it, each horn has been pared by years of engagement. They sit eternally perched on his head, wrapped at their base by roots tethered to tendrils of inky black hair whose depth is softened by gentle waves throughout.\n\nHis frame is padded by lean muscle cast in scaled, armor-like skin, giving him a distinctly reptilian appearance. Huge blocks of inked skin are collaged together across his body and are segregated only by thin, wispy negative spaces which flare with fel energy when it is expended in a quantity large enough to be tangible to others in some way. The patterns range from geometric to chopped shades of black and grey.\n\nLong strands of inky black hair branch down over his scalp into soft, tendril-like curls that curtain his shoulders. His gaze is striking when unveiled: the fel-fire which has taken the place of his eyes, the sockets emptied aside from it, flares with the intensity of a chaos bolt beset by gasoline when he fixes onto something or someone. Like many of his kin, he is proud to a point of being haughty, resilient to the point of being relentless, and steely to the point of being cruel. A true Sin'dorei if there ever was one. \n\n{img:Interface\\PETBATTLES\\Weather-ToxicFumes:512:128}",
