					},
					["HI"] = {
						["TX"] = "Bel'dare was born in Quel'thalas along with her sister who was called Sin’salama. Their parents were both skilled mages. She was taught much about the arcane, but her studies were cut short, when her parents both died while fighting off the scourge. Bel'dare was just a child and so was Sin’salama at the time of Arthas' invasion and so she just used some magic to help her and her sister stay invisible long enough to stay hidden for the scourge to pass through their house. They were obviously saddened by the death of their parents, but they were nowhere near powerful enough to take on the scourge to get vengeance. They knew they had to get out of Quel'thalas, so she just went south. The young elves did not know where she was going, but they were certainly going. They encountered much scourge along the way and had to either fight them off or run away from them. They saw no living beings for years until she met a strange dwarf paladin called Dagagada. Bel'dare demanded the dwarf explain what had just happened. Dagagada explained that Arthas was originally a \"decent lad\" who he even fought alongside, but that he changed when they arrived in Stratholme. He explained how the grain there was infected with the plague of undeath and how Arthas wanted to destroy the whole town. He and many other people refused to do so, and for that they were all relieved of their positions by Arthas. He then said that he went to northrend for a bit, came back and then went full evil. The young elves thanked the paladin and asked that he train them, so justice could be served to the scourge. The dwarf accepted and taught them how to fight along with the ways of the light. They then departed from the dwarf and went to slay more undead to the south. They eventually arrived in Khaz Modan, unfortunately the blood elves  had just recently become part of the horde and she was attacked. While Bel’dare managed to avoid the dwarven bullets, her sister was not so lucky. They went back to Lordaeron with Sin’salama somewhat injured, they were fortunate enough to come across a forsaken camp. The forsaken immediately went about healing Sin’salama, they both became very afraid as they thought they were scourge who were going to kill and reanimate her. They were both restrained and healed. Bel'dare asked them who they were and they explained how they broke free from the lich king's will and taken over Lordaeron. They also spoke of how the now blood elves had joined the Horde. While Sin’salama went off to join the horde, Bel’dare just waited many days for many days confused on what to do as she could not try to rejoin the Alliance, nor did she want to join the horde.Eventually, when it was revealed that Arthas had awoken, she decided to swallow her pride and she joined the Horde offensive in Northrend. After slaying much scourge in the Borean Tundra, she made her way to Icecrown and joined the Argent Crusade. After Arthas eventually fell, she pondered what to do, as she was not interested in waging war against the alliance. She wanted to join the Blood Knights, but then she learned about how they had once enslaved a being of pure light (M'uru that is) to get their powers. Then strangely enough, she met her undead sister who went to join the horde all those years ago. She explained how she became a blood knight while she was with the horde, but fell in battle against the scourge when sweeping through Lordaeron. She explained how she was raised by Arthas and committed horrible crimes while under his grip. She described her change of heart at light’s hope and begged Bel’dare for forgiveness. Bel’dare replied that while she did forgive her for crimes while still bound to Arthas, she did not forgive her for stealing power from the enslaved nauru Mu’ru as she was not mind controlled at the time. This response made Sin’salama confused, as her crimes while a blood knight paled in comparison to her crimes as death knight. She apologized for stealing power from Mu’ru, but Bel’dare was not having it. The two cut all ties for a while.Now out of threats to deal with Bel’dare waited until Garrosh came along, of course Garrosh went on his war campaign in Pandaria and continued to alienate most members of the horde, including Bel'dare, however she was not very interested in that drama. She did however, join the siege of Orgrimmar. When the legion came once again to Azeroth. She had learned that they were the ones responsible for creating the lich king and the scourge and she was eager for vengeance against them. She also participated in the third battle of Light’s Hope where the Ebon Blade tried to raise Tirion, during the battle she saw her sister with the ebon blade. She was about to charge at her, but then she saw, she was not actually on the ebon blade’s side. Sin’salama was actually attacking the ebon knights. After the battle was over, Bel’dare realized that by doing this, Sin’salama had essentially kicked herself from the ebon blade and made herself a target. Thankful for this sacrifice, she finally forgave her sister for her crimes as a blood knight.When the legion were pushed back she somewhat withdrew from adventuring. She later learned of the crimes Sylvanas had committed, so she joined the horde rebellion against her, but the siege was not so much a siege as she thought it would be. She does not do too much adventuring anymore.\n",
