			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1:c}Appearance/Personality{/h1}\n\nWhen you first lay eyes on Jung-Hee, you'll find that he is of slightly above-average pandaren height, standing at around 7'7. You will also notice however, that he is heavier than most male pandaren. His big belly is round like a ball of dough, soft like one too. Despite this appearance, there is a sturdy look to it, as if there is indeed a good amount of strength hidden under all that soft fur. Jung goes around shirtless most of the time, proudly displaying his bare belly for all to see.\n\nExcept for his brown and white fur, Jung has no hair on his head or face. Many compare him to an over-sized cub, which some would describe as fitting for his personality. His attire generally consists of shorts, sandals, and a rope belt of some sort. His dark blue eyes typically have a warm and friendly look. \n\nJung is normally an easy-going, somewhat bubbly pandaren. He always tries to be polite, but when he gets agitated he tends to act rather bratty . He is also a frequent crier, whether it be due to fear, sadness, or even happiness Jung cannot help but wear his emotions on his bare belly. Jung has a slight stutter, he will usually stutter a word or two in a sentence. \n",
						["BK"] = 5,
						["IC"] = "achievement_worldevent_brewmaster",
					}, -- [1]
					{
						["TX"] = "{h1:c}Description{/h1}\n\nJung is a young monk in training. He is training his body to act as a shield to protect those he cares about. Using his massive belly and rump as his weapons, Jung-Hee travels the world trying to improve his strength as well as sampling whatever delicacies he comes across. \n\nJung's short-sighted childish behavior has often gotten him into trouble. Hoping that he can change, his parents finally kicked him out of their home, forcing the young pandaren to make a life for himself outside the valley.\n\nNow all Jung wants to do is train to act as a protector to others. When it comes to practicing as a monk he uses a style that combines elements of the tiger and ox styles. Jung hopes to eventually continue on his family's sauce-making business, before that however he must prove to his parents that he can change his ways.",
						["BK"] = 5,
						["IC"] = "pandarenracial_epicurean",
					}, -- [2]
					{
						["TX"] = "{h2:c}Home Life{/h2}\n\nJung hails from the Valley of the Four Winds, born and raised in the town of Halfhill. Growing up, Jung lived a life of comfort. There was always plenty of food and friends available, and as an only child Jung was often spoiled by his parents.\n\n\"Gravybelly Flavors\" Is the family business of the Gravybellies.  It is a sauce-making business, offering a variety of condiments ranging from spicy to sweet. Jung would sometimes run the stand set up in the food market, there he enjoyed meeting many different people especially travellers from across the land. ",
						["BK"] = 5,
						["IC"] = "inv_misc_food_cooked_greatpabanquet_general",
