				["T1"] = {
					["TX"] = "{h1:c}{col:00ad4d}Alchemical {col:764cad}Afflictions{/h1}\n\n{img:Interface\\Pictures\\artifactbook-warlock-cover:256:256}\n{icon:inv_alchemy_70_potion2:42}{icon:inv_alchemy_70_potion2_nightborne:47}{icon:inv_alchemy_70_potion2:42}{icon:inv_alchemy_70_potion2_nightborne:47}{icon:inv_alchemy_70_potion2:42}{icon:inv_alchemy_70_potion2_nightborne:47}{icon:inv_alchemy_70_potion2:42}{icon:inv_alchemy_70_potion2_nightborne:47}{icon:inv_alchemy_70_potion2:42}{icon:inv_alchemy_70_potion2_nightborne:47}{icon:inv_alchemy_70_potion2:42}\n\n\n\n{p:c}{col:764cad}The sound of bubbling concoctions materialize through the darkness. The smell of sulfur makes it's way into the man's nose, causing him to grunt as he begins to regain consciousness. His eyelids crack open, blinking a few times to wash the blurred vision into clarity.\n\n{col:00ad4d}\"Oh good, you've awakened.\" Rakkdos spoke as he tightened the restraints holding his hostage. The man's eyes shot open, darting to the darkly dressed elf. Fear flooded the man as he questioned.. \"This isn't a dream?\" Rakkdos retorted. \"Not in the slightest.. But thanks to my Dreamshade tonic, we have learned so much from your euphoria!\"\n\n{col:764cad}The man howled in pain as his restraints were clasped tighter. \"Please.. no more!\" The man cried out. \"I've told you all I know!\" Rakkdos let out a sinister chuckle, clamping a hand around the man's face. \"Oh my friend.. Not everything. But we will get there very very soon.\" Rakkdos squeezed the man's cheeks, forcing his mouth open before pouring another elixir down his throat.\nRakkdos released his victims face and stepped back, allowing a few moments for the elixir to take effect.\n\n{col:00ad4d}The warlock would grin devilishly, admiring the fruits of his work. His prisoner's body lay stiff across the table, but his eyes dart around the room in a panic. Rakkdos tipped his tophat down before he spoke. \"A potion of petrification. It paralyzes the body, but leaves all other functions untouched. That means.. you won't be able to move.. but you'll feel everything. Let us continue.\" Rakkdos let out a deep and low laugh as he raised a hand to his prey. A swirl of shadow and fel penetrate the man's chest, siphoning his essence while all he can do is release a hollow scream.{/p}\n\n\n\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-ShadowmoonBurialGrounds:384:256}\n \n\n\n\n\n\n\n\n\n\n\n\n \n\n\n\n\n",
