				["T1"] = {
					["TX"] = "{col:a30a00}{h2}Fate? Please, I write my own luck..{/h2}{/col}\n\n{col:ffffff}The handle to the door opened easily, still those green fingers would wrap around the wood of the door to not let it swing open with a loud squeak. Instead, he pushed his lean body against the door and the opening he created and squeezed on by. Closing it behind him, eyes would look about the large bedroom chamber. He had to pinpoint where that safe might b-- and those eyes landed on a large painting of the human male. \"..Bingo..\"\n\nHis steps were silent, calculated, and quick. It was almost like a dance for him, making his way to the painting. Quietly he lifted it from the hook it was standing on, and lowering to the side softly and gently. A chair was placed infront of the safe, so he can leap up to it, and place his ear to the safe door. Moving his hand on the dail, he started to turn it very slowly to the left...Click! Then to the right...Click! Then to the left once more...Click! handle to the safe would slowly lower and the door would open up! \"To easy..\"\n\nThe item inside was taken and placed inside of his vest pocket. It was then he turned his head to hear the steps and sounds outside. His hand quickly went down to his waistline to recover his pistol, as the shadows seem to meld around his form, slinking him into the ground slowly. \"Good thing a bullet sounds the same in every lanuage..\"\n\n\n{h2}Info and Stuff!{/h2}\n\n{col:ffffff}So, you wanna know about me eh? Well, take a seat. Like most goblins, I took this world by the balls, and never let go. Ya see everybody has a story, mine? I'll give ya hint. Involves being trained by elfs on both side of the faction. Im a gob of many talents. Sometimes you can see me fightin' for gold, or sometimes you can see me on a magazine cover thanks to a friend.  \n\nOh you want more? Sorry pal, gunna cost ya{/col}\n\n(Currently protected against : Voodoo (Necklace/charm. Protection wards him for a week. Rolling out of 20, a 17 or higher is needed to effect Jex.) )\n\n{col:a30a00}Friend once told me. Jex is a mix of John Wick, Lupin the III, and James Bond\n-- Former Bloodsail \n-- Works for..a certain group under the Goods store in Dalaran.\n-- Is known for finding things. Espcially in the higher Sin'Dorei circles. Nobles not wanting normies to know what happens behind closed doors yanno?\n-- Currently been seen working VERY close with the Brokers of the Night Market.\n-- As many people have witnessed, Jexdel is a seasoned fighter. Approach with caution if you want to scrap\n-- Proud owner of many pets (Two Raptors, A Frost Wolf, A Direhorn, Blue Dragonkin, and a Lyrion Cub)\n-- Also a proud owner of a Portable Pocket Dimension thanks to Cartel Xy{/col}\n\n{link*https://tinyurl.com/JexArt*Some visuals of your fav Gobbo}",
