			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Inspiration: Thrall is my inspiration of creating Magilokk. He is pretty much his idol and Magilokk strives to be just like the Thrall of old.\n\nName Pronounced: MAH-Gih-Lock\n\nBackstory: \n\nAfter the Second War, Magilokk was born into the Frostwolf Village. A fateful day would one day come during his adolescence when Thrall would come to the village for the first time. He would leave and return to the village, telling stories of his conquests on freeing the Orcish slaves. Even bringing back some great heroes who were held in captivity, like Varok Saurfang, Grommash Hellscream, and Eitrigg. \n\nOne unfortunate day, news would reach the village that Warchief Orgrim Doomhammer had been slain on the field of battle. Thrall was named Warchief of the New Horde. Magilokk was eager to follow him into battle to exact vengeance upon the Alliance. Thrall then kindly lectured him about the dangers of having a vengeful heart, and that until he learned what it meant to truly be an Orc, he was not ready to join the Horde.\n\nAt first Magilokk was disheartened, but some time after, he put Thrall's words to heart and became inspired to learn the ways of the elements. And so, he requested training under the village's Farseer, Drek'thar. \n\nYears of training would pass by until Magilokk was finally wise and strong enough to join the Horde. With excitement and pride, Magilokk serves the mighty faction, with Thrall as his role model. Do not fight for vengeance or with hatred. Fight for home, and family. This is what it truly means to be an Orc.\n\nPersonality:\n\nMagilokk believes that the nonviolent way of solving an issue is the best way. He would show kindness to everyone he meets, including his enemies. However, he is fierce and deadly on the battlefield, and strikes down his enemies without mercy. He believes strongly in defending the lands of his people, the Horde. Any who dare threaten it, he would become their bane.\n\nMagilokk isn't very receptive to those who act a fool near him, and tends to be grumpy towards people like that. He is a peaceful Orc, but he loves battle just like any other Orc, and will eagerly fight in the front lines to protect his people. He takes pride in being a fighter in the Horde, and will always stay true to Thrall's Horde.\n\nThose who threaten the values that he lives by, beware. Magilokk is coming for you.\n\nAttracted to: Orcs/Maghar, Trolls/Zandalari, Goblins\n\nSocial Media: \n\n@zzapee on Twitter/Instagram\n@MexPotaChips on Facebook",
				},
