			["about"] = {
				["v"] = 29,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n{h1:c}{icon:inv_belt_cloth_warfrontsforsaken_d_01:25}  {col:c5a953}Voskus Shadowstalker{/col}   {icon:inv_belt_cloth_warfrontsforsaken_d_01:25}{/h1}\n\n\n{col:c5a953}Lichfire yellow hues it was the first trait that many observed when they encountered the undead, either in cities or out in the world itself. As many forsaken are reborn into their unlife , Voskus was no more different than his fellow brothers and sisters , falling and then being risen into service of the lich king. Only to then regain his free will at the time the bulk of the forsaken people came to be. {/col}\n\n{col:c5a953} Born in life as Voskus Emsworth , he held a home in what is now the western plaguelands in the small town of Darrowshire , there he lived with his wife Adreanna and their young son Jovan , when the plagued grain spread across the kingdom of Lordearon , he and his family were not spared their dark fate. Thus he fell , however as he was risen he had killed his wife and son as a mindless undead only later realizing what had transpired after regaining his free will.{/col}\n\n\n\n{h1:c}{icon:inv_glaive_1h_warfrontsforsaken_d_01:25}{col:c5a953} Physical Traits{/col}{icon:inv_glaive_1h_warfrontsforsaken_d_01:25}{/h1}\n\n\n{col:c5a953} He stood as many as his brethren did , at an average human height , his head had been shaved clean except for a long thick pony tail of dead grey hair bound with leather at the base. His lichfire yellow eyes pierced whomever he looked upon , watching and observing those he spoke to , tracked , or even glanced casually towards. More dead skin was centered around his mouth region. His frame was toned and somewhat lean , as were the characteristics of forsaken body structure , bone being exposed at his elbows and knee's and claw like digits and toes as well.{/col}\n\n{h1:c}{icon:ability_hunter_beastwithin:25}{col:c5a953}  Personality  {/col}{icon:ability_hunter_beastwithin:25}{/h1}\n\n\n{col:c5a953} He was a rather gruff and hard headed undead , never shy about putting one in their place if they so deserved it. Serious to a fault and driven he was an individual that reveled in getting whatever task needed completed done. However there were moments where the undead was humerous and even in his own slightly darker manner joyful. A student of observation he seemed to never tire of studying idividuals and ther mannerisims. He could indeed be gentle when he so wished .. however that was only in specific situations and even then he was particular about it.{/col}\n",
				},
			},
