				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}{col:ff1200}Descripto of Toris{/col}{/h2}\n\n\n{h1}{col:ff0800}Tratoris Palar was a man of his word, a classic Paladin of the holy light who strives to help those who cannot help themselves. He stood proudly with a gaze that would make even the strongest of warriors’ waver with caution. He walked with an exuberant amount of confidence and pride almost tripping over the edge of cocky to some. Heavy plate armor made his presence known to those within hearing distance for he was not a being who hid himself away from questioning onlookers, he knew his worth and was unashamed in showing it.{/col}{/h1}\n\n\n{h2:c}{col:ff0c00}Features of Toris{/col}{/h2}\n\n\n{h1}{col:00ecff}His features looked that of most of his Sin'doreri brethren; muscular with a dash of grace. His eyes on the other hand was what set him apart from most; they were Blue with an Orangen hue iris and pupil with a faint luminescent glow to those intense orbs. Only those close to him know the reasoning behind this oddity. His hair was dark and long, having only a partial bulk of his hair crudely tied into a tail with a simple leather band. Like most of his kind his body was decorated with enchanted golden tattoos to represent his belief and values, while also blessing him with the extra strength needed to smite down his foes, the golden ink traveled along his chest and abdomen.{/col}{/h1}\n\n\n{h1}{col:00f3ff}His tone was pleasant and friendly, but on a dime could turn into that of a commanding sort if warranted. He didn’t carry the classic accent of the Sin'dorei, it was more… Proper, closely related to that of a Human, or a Dwarven man. Another strange trait that only those close to him would understand why that was.{/h1}\n\n{link*https://cdn.discordapp.com/attachments/826505489914265666/857733705644376074/NIorONcpL_b3kJXGETVobcRckj9P3Suz_D-xC-0pqnc.jpg*Toris in his Glory.} (Reference)\n{link*https://cdn.discordapp.com/attachments/826505489914265666/857733718470950942/DMq3ihDXkAAtmhC.jpg*Toris looking over his Victory.} (Reference)\n\n",
