					["PH"] = {
						["TX"] = "Upon looking at her face, a pair of thick, pinkish-red lips stand out in a smirk. Framed by shoulder-length platinum blonde hair that appears to be shaved on one side, it is a stark contrast to her sun-kissed skin. A rather curvaceous and voluptuous woman, the elf has plenty of meat all over her body though none of it seems to hide the musculature that seemed ever prominent. Squared features give her a more masculine look, yet it's clear in her voice and temperament that it could not be further from the truth. Bright blue eyes peer outward, shining and shimmering with a twinkle of mischief. Though more often than not she hides behind a suit of armor, making getting a good look at the woman much harder than it should.\n\n{link*https://imgur.com/a/2Cydh0T*One of the many art commissions of Idrissae... Note, semi-NSFW}\n\n[ OOC NOTE: This /c/haracter DOES possess more art than the above! PM for details. ]",
						["BK"] = 1,
