						["TX"] = "Despite her appearance and occupation, Idrissae is a soft-spoken and gentle individual. Despite this, her deeper yet smooth and calm voice tends to make her appear much older than she truly is. Usually keeping to herself when in larger groups, she speaks up when she feels the need to say something or when approached. In smaller situations or private however, the elf seems to come out of her shell more easily. In these cases, the seemingly meek and quiet woman comes to life. Smiling more and becoming more talkative. It is also in these circumstances that she can often find herself flustered. Whether that is from going on long tangents about things she likes to even the smallest and silliest of things spoken, her sun-kissed cheeks quickly find themselves red and rosy.\n",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "A veteran blood knight, Idrissae has always been a shining beacon. Trained and skilled like many others of her calling, the elf continues her mission through adventuring. Throughout her many years of life, she has slowly grown jaded with the world. Even recently, she has begun to question her faith and has slowly started to disassociate herself with others who bear a similar title. Nonetheless, her skills remain unwavering and despite this, she continues to strive in her ultimate mission: to give aid to the poor, defend the weak, and bring hope to the hopeless.\n",
