				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Revisions Underway - Updates pending.{/h1}\n\n{h1}Siaru (18+){/h1}\nIt was discovered Siaru had a high affinity for magic during one of the trials issued by the sethrak slavers. She later attended KirinTor academy not long after escaping Vol'dun to hone her magical abilities, eventually joining the Horde to help their plight as much as she could.\n\n{h2}Magic Training{/h2}\nVulpera were never allowed to pursue much in the way of education under the rule of the Sethrak. She jumped at the oppurtunity to attend the KirinTor mage academy when the chance presented itself.\n\n{h2}Likes{/h2}\nShe absolutely loves being pet. Quickest way to get on her goodside!\n\n{h2}Past{/h2}\nIn the days of Vol'dun, Siaru never had much in the way of freedom. She was captured by Sethrak Slavers and eventually sold to a family as a house servant. The Mistress of the family treated Siaru well, teaching her the basics of reading, writing and enough magic to aid in her duties. Siaru was eventually freed from her servitude when the family fell on hard times after the fall of the Sethrak Empire. She would eventually be bought and taken in by her current owner.\n\n{h2}Contractually Enslaved{/h2}\nSiaru was rescued from Vol'dun by her current owner. Despite her best friend Rikara begging, he would not buy her freedom from the sethrak slavers if she had not agreed to sign a contract of ownership to him.\n\n",
