				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-shaman-cover:256:256}\n\n{h1:c}The Howling {col:3254bc}Storm{/col}{/h1}\n\n{h3:c}{col:3086e6}Tall and powerfully built as many of his kin were, he carried himself with an aura of icy calm confidence that quickly set him apart from his wilder brethren. His better than average looks were marred by several scars and scratches that adorned his forehead and cheeks, and served to give him a battle worn appearance. He cut a leaner less bulky shape than his peers as would befit someone who spent their life in a most inhospitable environment. Sharp intense eyes, the color of rich amber stared out from under the shadow of thick eyebrows, but the spark of intelligence that shone through those eyes clearly marked him as a breed apart  \n\nRoughly crafted, reinforced and utilitarian scale armor hung from broad shoulders and their singed and mended parts bore silent testament to the rough profession their owner undertook. Numerous pouches, trinkets and blades adorned the broad belt that hung from his waist and quickly identified him as a both a War Shaman and a Mystic. Nicks and scorch marks mar the old rough iron shield and axe he carried and it was clear they were as much for utility as they were for intimidating his enemies...as Absolutely nothing about his appearance or aura suggested a timid Orc.\n\nThe calm veneer of practicality that comes from long years living on the cold unforgiving landscape of his home glossed over the amusingly foul mouthed core of an Orc whose tie to the elements seemed to directly affect his personality in times of stress or excitement. That is not to say that he wasn't polite and amicable in most situations it was just plainly obvious he belonged on the battlefield where he was free to wreak havoc on the enemies of his people.{/col}{/h3}\n\n{h1:c}{link*https://tinyurl.com/vorsfw*SFW Artwork of Vorzok}{/h1}\n\n\n\n{h3:c}{link*https://youtu.be/cHyDOvjJYBY*Vorzok's Theme Song.}{/h3}\n{h3:c}(Hear it when he walks..and you got it right.){/h3}\n\n{h3:c}Your character may know or have heard of Vorzok if they have seen the Tattoo work he's done on multiple people. He specializes in intricate Runic and Tribal inkwork.{/h3}\n\n{h3:c}Your character may know or have heard of Vorzok if your character has fought in the jungle campaign in Nazmir, The Defense of Zuldazar or the Nazjatar Campaign.{/h3}\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n{h3:c}{col:ff162f} /c/ {/col}{/h3}\n\n\n{h3:c}{col:ff162f} If you wish to see *ALL* *nudge nudge wink wink* artwork of this character, just ask. Adults Only. {/col}{/h3}\n",
