				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Personailty{/h1}\nWhile being a warlock who are know for their lust for power...Sohee is not that. She is a very shy and kind warlock but can joke and even be a lil bit sassy with people she loves to be around. While always smiling, the second someone says anything nice to her the warlock will blush HARD and will turn a bright pink. People tend to find this cute. Mainly her love.\n\n\n\n{h1:c}Looks{/h1}\nThe warlock has red hair with many dark flowers in it and purple eyes that will have a tint of green in it when in combat. Under her left eye, Sohee has a lil beauty mark, same with the side on her nose. Sohee is about 5’10 in height. Her long ears are heavily pierced. On her left she has a total of nine and on the right eight. While not seen due to her armor, The warlock has many tattoos. 11 in total. She is a very curvy elf and that is how she got the name ‘peaches’. At one point her hair was very long but now she has cut it short.\n\n{h1:c}Tattoos{/h1}\nRight wrist: Light blue claw marks\nRight thigh to hip.: Fel flames\nLeft thigh: A few stars\nFinger: Arrow\nLeft hip: A lil harp\nLeft arm: Crescent runetic moon\nSternum: Moonwheel with petals\nStomach: Pisces constellation to cover scars\nRight ankle: Lilly flowers\nLeft ankle: Elemental rune \n\n\n{h1:c}Demons{/h1}\nImp: Belpad. Sassy, talks shit. May or may not have a drinking problem\nVoidwalker: Graz’thyk. Doesnt speak. Low key hates being here\nSuccubus: Villissa.  Flirty. Loves to read. Will throw hands\nFelhound: Rhuunum. Loves to bork. Is a good boi\nFelguard: Veezekeel. Is a dick.\n\n{h1:c}Family{/h1}\nParents\nBellasong Frostblade: Mother\nUnknown father\n\nSiblings\nSen’rel: Twin brother\n\nOther family members\nNorasong: Aunt\nGainsong: Cousin\nSora: Cousin\nMelodi: Cousin\nLeo: Cousin.\n\n{h1:c}Art!{/h1}\n{link*https://imgur.com/a/sziZAZi*Sohee by Bean!}\n{link*https://imgur.com/a/8ug0XyE*nsfw}\n{link*https://imgur.com/a/eXlDOA0*Artbreeder}\n{link*https://www.pinterest.ca/seirendarkelf/sohee/*Moodboard}\n\n{link*https://img1.daumcdn.net/thumb/R720x0.q80/?scode=mtistory2&fname=http%3A%2F%2Fcfile22.uf.tistory.com%2Fimage%2F993418415EF50D9A0E5E00*Face claim}\n\n\n\n{h1:c}Theme songs!{/h1}\n\n{link*https://www.youtube.com/watch?v=51FsFpZvbcI*Afterschool-Dressing room}\n{link*https://www.youtube.com/watch?v=Oe-xOCE-MCY*Gemie-Ashes return}\n\n\n\n",
