			["about"] = {
				["v"] = 15,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-HighmountainTauren:512:256}\n\n{h2:c}{col:5dffa0}\"A second chance is not made to be wasted.\"{/col}{/h2}\n\n{col:5dffa0}\"I could tell you everything about my life.  But I won't.  So there.\"\n\nSekeatsa is a rather unique Pandaren among others.  The young looking grey Pandaren is in her prime.  Dressed not in her peoples style of garb but in clothing aligning more with the Tauren and the Horde..  Thigh guards and shin guards with leather buckle.  A scant padded vest adorned with black eagles feathers and bone ribbing upon the sides to protect the ribs.  Each piece of padded armor armor was somewhat decorative in the effigy you would expect to adorn a Tauren's armor..If they were a Pandaren. Her waist was wrapped in a thick belt with a leaf and rope drapes.\n\nHardly typical for a Pandaren.  But she seemed to have an appreciation for aspects of the culture of the clothes she wore.  Despite being obviously martially trained by the Pandaren in their arts.  A very curious combination for one of her kind.  However it seems in direct contrast to the attitude she carries which is a vibrant lust for life that edges onto the hedonistic and violently aggressive.  Fighting, drinking, engaging in every act she can partake in that satisfies her desire to feel alive.\n\nThe astute of the mind can probably see that this kind of behavior ties into something in her past that she experienced, however what that is remains yet to be discovered. She also seems to fight and act beyond her years.\n\n(It's a work in progress and I need to continue working on it.  I'll keep adding through RP probably!)\n\nMaximum Sass Theme: {link*https://www.youtube.com/watch?v=wBQwU2qGFJ0*She's worth it.}\n",
				},
