						["IC"] = "inv_archaeology_70_tauren_drum",
						["TX"] = "Saketsa's armor bares a slight tauren theme that shows if one looks.  Sigil carved ankle boots, bone and horde carved gauntlets..  Her belt is more Pandaren however.  They're made to be more flexible than Tauren reinforced wood.  It seems to be hide and cloth with thin padding marked in sigil.\n\n(No mog like this exists so I did my best :( )",
