		["0716191452Nazba"] = {
			["about"] = {
				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["BK"] = 1,
					},
					["PS"] = {
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Krelemar was born into a lowborn family within Silvermoon City. His younger days were filled with hard labor trying to put food on the table for his family. As a child he would work along side his father moving trade goods in The Bazaar, while his mother was a tailorer creating the clothing and robes of the common people within the city. At an early age he realized the social dynamics of Silvermoon City and began to desire to better his standing within his homeland.\n\nWhen Krelemar was of age, he joined the Silvermoon Guard. He noticed that those within the military castes were treated far better than those of the civilians. While he enjoyed the benefits of serving under the guard, his desire for more grew as time went on. Krelemar would continue to train and hone his martial skills while still performing his duties as one of the guards protecting the city and keeping order.\n\nWhen the shattering of the Sunwell happened, Krelemar was one of the lucky few to survive the whole ordeal. Unfortunateley, his parents were not so lucky and fell during the chaos. He was able to eke out a living continuing his service but wanted to train even harder and gain more power and standing within Blood-Elven society.\n\nWhen M'uru was captured and contained within the Sunwell he heard about the Order of Blood-Knights that were a new military faction being created. Day and night, Krelemar would train his fighting skills until he was one of the notable ones that were suggested to go through the trials of becoming a Blood-Knight. He knew about the stigmatism and the negative views of the Blood-Knight Order and how they were forcefully taking the powers of the Light, but paid them no mind as they were seen as an elite fighting force that demanded respect and honor. Krelemar accepted the initiation without hesitance knowing that his struggles were just about to begin.\n\nHe was fortunate enough to have a Blood-Knight mentor that saw potential in him and inducted him as a Knight-Squire. For several years he trained mentally and physically to weild the powers of the Light, but with some repercussions that would inevitably follow him to this day. Krelemar would suffer from headaches occasionally due to the unethical methods of how he obtained his usage of the light. While others succumbed into madness in the process, he channeled that struggle through his newly obtained mental fortitude with an iron resolution. He liked the strict codes and discipline that was being molded into him which defined the other Knight-squires like him. The madness still resides in him because of the apprehensive way he obtained his magical skills, but it manifested as a personality trait in which he is undeniably contempt of others. He tries to keep the insanity in check, but one can easily hear in his voice the strain he has holding back from being aggressive or outright lunatic.\n\nThe years of trials felt like an eternity to him but he was able to succeed and became a full fledged Blood-Knight. After reaching this milestone he thought his inner desire for power would be satiated but it has only morphed into something else. He holds the strict codes and tenants of the Order in high value and seeks to further their renown through his own deeds. When told he would need to travel the world to lend his skills in places that direly needs them, he did so almost eagerly. Looking to make a name for himself and for the Blood-Knights, he now seeks battles to prove why him and his Order should be feared by those who would be unlucky to have his sword aimed at them.",
						["BK"] = 1,
					},
				},
