					["3"] = {
						["AC"] = true,
						["TI"] = "Friend of Animals",
						["IC"] = "ability_hunter_mendpet",
						["TX"] = "Rael is always surrounded by beasts and critters alike. He can bee seen feeding strays and wild animals when he has the time and snacks to do so. Don't you dare abuse an animal around him.",
					},
					["1"] = {
						["AC"] = true,
						["TI"] = "Heirloom Bow",
						["IC"] = "inv_bow_1h_draenorcrafted_d_01_a_alliance",
						["TX"] = "Rael carries the bow his father carried, it has been passed down for genereations. Ask him about it.",
					},
