				["v"] = 16,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Mud:512:128}\n\n{h1:c}{col:378e2e}{icon:ivn_chest_armor_zandalaritroll_d_01:25} Physical Description{/col} {icon:ivn_chest_armor_zandalaritroll_d_01:25}{/col}{/h1}\n\n{h1:c}{link*https://www.e-lewd.com/wp-content/uploads/2020/10/comm1-1.jpg*Rael - Art by E-LEWD}{/h1}\n\n{p:c}{col:457d38}Rael is an exceptionally tall Zandalari Troll with a slate grey complextion that is free of blemishes. He keeps his head shaved at all times and holds no facial hair, his face is adorned with gold accessories. Hoops in his upper ears and clay plugs in his lobes, a single hoop in his nose shines in gold as well. Two large tusks protrude from each side of his mouth and they too ar adorned in gold, when he speaks the fact that his tongue is forked and eat half is pierced can be seen, though this does not impead his speech.\n\nRael's physique is kept in pique conditions, he trains regularly, and often with his hunting companions. The muscles on his body are lean and well built, honed to be the perfect hunter. \n\nFashion is not one of Rael's priorities, he dresses in tactical garb, Mail and leathers to protect him on the hunt.{/col}{/p}\n\n\n{h1:c}{col:378e2e}{icon:inv__faction_zandalariempire:25} Personality {icon:inv__faction_zandalariempire:25}{/col}{/h1}\n{p:c}{col:457d38}Rael is a very kind soul who will give you his last coin if you needed it, but at the same time he is a fierce hunter, and can sometimes be very aggressive. The latter being if someone threatens any of his animal companions, or those he has grown loyal to. On the other hand he is always striving to push people to be their best! He will offer encouraging words and if he see someone struggling he will reach down and pick them up, running with them to the finishline if he has to. You alaways got a friend as long as Rael is around.{/col}{/p}\n\n{h1:c}{col:378e2e}{icon:achievement_alliedrace_zandalaritroll:25} History {icon:achievement_alliedrace_zandalaritroll:25}{/col}{/h1}\n\n{p:c}{col:457d38}Rael grow up in Dazar'alor, he was a big city boy. And like his father before him he dedicated himself to Gonk the Loa od the Hunt. He was gifted with a Dire horn as his first hunting companion, and raised him, hand reared him and perfected his husbandry to provide for his partner. As he grew he learned all the ins and outs of being a beast handler, he was sent to Warbeast Krall to continue his persuit of becoming a Predator, an expert hunter. During his time there a speaker of the Horde came to Zandalar, and following them was war. Being a capable warrior he was chosen by the newly named Queen to go to Orgimmar and represent his people.{/col}{/p}\n\n\n{h3:c}{icon:ability_dualwield:25}{col:ffd259}Rules of Engagement(Combat rules){/col}{icon:ability_dualwield:25}{/h3}\n{p:c}{col:ffd259}†HP: Both players got 5/5 HP\n†Combat rolls: /roll 10 is preferred, ties are rerolled, higher score deals damage.\n†Post order: Roll for Initiative, Emote, Roll, Repeated the last two steps until combat ends.\n†Pets: Pets are included in players attack but do not add damage, just flavor!\n†Rule of 3+: If you beat a roll by 3+ you deal extra damage.{/col}{/p}\n\n{img:Interface\\ARCHEOLOGY\\Arch-Race-ZandalariBIG:256:512}\n\n",
				},
