			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\nfor people who like to know what i dis-like let me tell you.. TARGETING!!!!! i have Continuously with out stop keep telling people just because i am targeting you IT DOES >>>>NOT<<<< MEAN I AM LOOKING, STARING or any other term you want to use... that is why in profiles people have \"Targeting= looking at\" because shocking enough guess what... YOU NEED TO TARGET SOME ONE TO LOOK AT THERE PROFILE.... or TO LOOK AT THERE ARMOR.... so i do not mind the attempts to want to roleplay with me... but please please please please please PLEASE!!!!!!... respected this... don't tell what my character is looking at.... don't tell me i am staring at you..... i will emote if i am i am VERY capable of doing that... thank you and enjoy the rest of my profile.\n\n======Body Referance=====\n{link*https://tinyurl.com/tpzbayg*curvy body example Art done by makkochi in DA}\n+\n{link*https://tinyurl.com/u4u9cm3*Muscler body Example Art done by Trollfeetwalker in DA}\n======Extra details======\n{link*https://tinyurl.com/wqhbnje*Draenei Tail example Art done by RatsuTerra48 in DA}\n\nAshlin Frostfang was Born in Frostfire Ridge with her father, mother, half mother and half sister for most of her life by her father's wishes she hidden her fact of being a half breed but her father was an orc shaman and her mother was a draenei Vindicator. After Ashlin was born her father agreed to keep her and take care of her but her father could not stop thinking about how she would be treated by other orc's if they found out her being a half breed, even her half mother and half sister so she hidden her daughter away until she was older told her mate and daughter a lie so they would hate him and never want anything to do with him then raised Ashlin alone. When Ashlin was about teenager she never followed the path of the warrior or the path of the shaman she followed her own path using a dagger and blades of different kinds she even started creating her own weapons to use around other people who threaten her but thats is when a dark figure moved in to greet Ashlin and gave her a new path a path of power and and magic Ashlin never really liked Magic but she did want to be stronger like her father. Ashlin was about to take the invite the dark figure was going to offer her until her father grabbed her and pulled her away scolding her and giving her a long serous talk before bedtime for her, later that night Ashlin sneaked off to head to where the dark figure said to go and thats when she found out it was a Sub branch from \"the shadow council\" before she could get out they grabbed her and chanted some kind of dark magic inside her soul but before they could finish a blast of flames burst out from where she walked in it was her father and two allies one was her mother and the third was some Orc warrior. They rushed in and attacked the members of the cult slaying them left and right as her father pulls Ashlin out and rushed out back home where she was talked to harshly by both her mother and father as they was not happy with her, by this day she still carries her half breed apperance but instead of hidding it she embraces it but in honor of her father and mother she does not let anyone give her shit about it or defind who she is by what she carries in blood.\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n{img:Interface\\TALENTFRAME\\bg-rogue-subtlety:512:512}\nBy when she is an adult she has taken the role of an Assassin with \"special\" abilitys with in the shadows she has used her skills and the gear she has created into helping her with her jobs and work Assignments she is very creative and talented for an assassin she has attempted to rejoin her half sister and half mother in telling them what happend to her father but she never really got the chance to do to. She keeps her self busy with work, assassin targets, war assignments and taking care of her twin daughters.\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n----Gear Status / list----\n1: Armor\n-Basic leather padding mix with Metal Spikes, Matel sheet plating, Cast Frame and mail underneath.\n-Custom mask with built in breather for gas resistance.\n-custom belt gloves with hidden dagger under the wrist for fast kills and an injecter on the other for posion injecting.\n-plated metal boots for heavy hard kicks.\n- Armor tail attachment allowing to apply different weapons to her tail such as Wrecking ball, Spike mac and Blade hook.\n2: Weapons\n-Long Bow used for stealth kills and taking out mid to long targets.\n-Cannon rifle sued as a heavy weapon to blow down doors and knock out if not kill humaniod targets.\n-Custom long rang bolt rifle created to take elemental shots such as Explosive, Acid, Frost and Electric\n-Custom dual Hand cannons built as a single shot cannon long reload but light for a small hand cannon.  \n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n3: Swords\n-Light's Bane, Glory of Redemption: a sword of holy light and unforgiving power of honor and Glory no undead can touch this blade or suffer its burning light.\n\n-Desolation, Vengeance of Hate: this sword is enchanted by blood magic allowing each cut to not only draw blood out of the host for as long as its close to the wound but to keep the blood dripping and coated on the blade it self.\n\n4: Large daggers\n-Endbringer ,Dark Blades of Nightmares: these dual Blades are large daggers entranced with shadow magic one Slace even a small cut brings forth your deepest darkest fears to life.\n\n5: Hidden daggers\n-Shadowfall, Dark Blade of Shadow: a special blade that is coated in a posion that slowly works its way around your body cutting away the magic abilitys of a spell caster  for each cut it makes allowing the posion to seep in.\n\n-Blacktalon, Bayonet of Traitors: a straight blade slightly wider then a normal Bayonet carries a flame around the blade it self making it burn anyone who the blade touches.\n{img:Interface\\Pictures\\artifactbook-rogue-cover:256:256}\nAshlin also is an Export posion crafter making all kinds of different Posions to effect in different ways then any normal posion could this makes it very easy to allow her to screw with people in many ways the known posions she has created are.\n\n-Black blood of undying: Knockout posion after one injection knocks the target out cold.\n-Venom of the Wyrmling: Blocks the mana pool of a caster making it impossible to cast spells for a time limit.\n-Netherspawm toxins: Paralyzing the target making them unable to move there body (if used right) for a time limit.\n-Felburn bloodline: Gives the target a painful feeling of being burned inside out creating a large amount of pain.\n============================================\n{img:Interface\\BlackMarket\\BlackMarketSign:256:128}\nAshlin holds different Bountys with different people if you know these people or the group they are in ICly then you can roleplay knowing her Bounty as the following\n\nAlliance Military Bounty: over 900,000 gold for dead or Alive\nNeed Proof if killed\nStatus: Active\n\nIrontide Raiders Bounty: 500,000 gold for Dead\nNeed the Head as proof\nStatus: Active\n\nKul Tiran Military Bounty: 650,000 gold for dead or more then 800,000 gold for Alive\nNeed Proof if killed\nStatus: Active\n\nKaldorei Night Warrior's Bounty: over 950,000 gold for Alive only\nSaid to be taken to them Alive to be dealt with\nStatus: Active\n\nNightborne Bounty: 650,000 gold for Alive\nSaid to be taken to the nearest demon for reward\nStatus: Cleared (sense the Rise of a new leader of the nightborne)\n\nIron Horde Bounty: 650,000 gold if captured alive or 250,000 gold if brought in dead\nNeed Proof if killed for extra reward of new job and a promotion of rank\nStatus: Cleared (sense the Iron Horde broke off there attack)\n\nMogu Empire Bounty: 250,000 gold and the Gift of power if brought in dead or alive\nNeed Proof if killed\nStatus: Cleared (sense the Empire fell apart)\n\nTwi'light's Hammer clan Bounty: 500,000 gold brought alive or dead\nNeed Proof if killed if brough alive a promote in rank will be given\nStatus: Active\n",
