						["IC"] = "ability_warrior_strengthofarms",
						["BK"] = 1,
						["TX"] = "Jazmeina stands around the average height of most Blood Elves, with long blonde hair, a fair, youthful complexion and pale white skin. A few faded scars dot her often exposed body, with a pair of scars criss-crossing over her right cheek on her face.\n\nPhysically speaking, she's built with a pleasant combination of muscle and fat; with her limbs being well muscled and strong, and a noticeable gut which she doesn't seem to mind at all! Round and probably a bit squishy, though not without muscles beneath the surface. She probably loves her food and alcohol. Her chest and backside are a little big but, not by much.\n\nA few more scars of note, one that looks like a stab wound right beneath her diaphragm, a deep pink scar tracing across her left hip, and a scar going diagonally right down her back. They seem almost deliberately maintained...\n\nHer eyes are, as with many Sin'dorei these days, showing signs of the gradual change sweeping the people as the Holy Light infused Sunwell continues to make it's healing known. Golden and radiant, they glow like beacons and despite her pale complexion, she seems quite healthy! To say nothing of the fact that she obviously eats well...",
