			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h2:c}A Beautiful Game{/h2}\n\n{p:c}For generations the Teatummy family was known for their wood carving business. They would craft ornate tables, chairs, even boats! However, they were also known for their traditional game. One that has been passed down through the generations, standing through times good and bad, and filling nights with laughter...Dices and Dumplings{/p}\n\n{p:c}Those times have passed however, and Gei Teatummy now finds himself the sole remaining member of his family. The aging pandaren now seeks to pass down his family's traditional game to others in hopes of keeping the game alive for many more generations.{/p}\n\n",
						["BK"] = 5,
						["IC"] = "achievement_zone_jadeforest",
					}, -- [1]
					{
						["TX"] = "{h2:c}How to Play Dices and Dumplings{/h2}\n\n(Dices and Dumplings is a simple roll-based game that involves dices and dumplings as the name implies.)\n\n- Two players sit on the floor or ground, seated across from each other\n- Between the players a circle of five (5) plates of jiaozi dumplings is placed. The dumplings are filled with cabbage and mushrooms and there are ten (10) of them on each plate. \n- A teacup containing one six-sided dice is to be used\n- The goal of the game is to eat three plates of dumplings (A best of five)\n\n{h3:c}How a Game Works{/h3}\n\n- After the plates are set up, the players first determine who rolls first. This is done by...Rolling. However they will only be rolling one of the dice for this round. Gei will typically let his opponent roll first. Players will use /roll 1-6 in this case. The higher number gets to go first. If both players roll the same number, they must both roll again.\n\n- The player who got the higher roll now gets to actually roll and the game starts. Now the real game begins! The player who rolled the highest number now does /roll 6 again, followed by the opponent. The player who got the higher roll now gets to eat a plate of dumplings from the circle. They must eat all ten dumplings.\n\n- The players then roll again in the same fashion, the goal being of course to eat at least three plates of dumplings. The first player to eat three plates wins the game. Players will keep playing until one of them eats three plates.\n\n- In the event that both players roll the same number, a belching contest must be held. Each player will drink a small bottle of plum juice, after which they will see who can do the biggest belch. This is done simply by /roll. The higher number results in the winner being able to eat the plate of dumplings.\n\n",
						["BK"] = 2,
						["IC"] = "inv_cooking_90_meatyappledumplings",
					}, -- [2]
