						["AC"] = true,
						["TI"] = "Scars",
						["TX"] = "- He has a long scar on his lips, starting below his left nostril and running diagonally down to the right side of his chin.\n- A horizontal scar running under his left eye,\n- A deep \"T\" shaped scar on his right cheek.\n- One on his chest, running from his left shoulder diagonally down across his chest and coming to a stop near the right side of his naval. (Can't see unless shirtless)\n- On his back, running from the right shoulder, down his back, and jutting over to the left, resting right above his left hip. (Can't see unless shirtless)\n- Impalement scars covering his chest, back, and sides. (Can't see unless shirtless)",
						["IC"] = "Ability_Rogue_BloodyEye",
