					["3"] = {
						["AC"] = true,
						["TI"] = "Steadfast",
						["TX"] = "Ani is upright and erect in his movements. Hardly at a slouch or a lean, he stands head up high and usually rests \"at ease\".\n\nA pair of dog tags can be heard jingling from his chest as he walks, clanking against a gold wedding band.",
