						["TX"] = "When Anivastin is nearby, it is possible to catch a feeling of Light and warmth radiating from his being.",
						["IC"] = "Ability_Paladin_BeaconofLight",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Worn down",
						["TX"] = "Anivastin is beyond exhausted. Constant fighting and constant battles have drained his energy. He's still more than a capable fighter, but the stress is beginning to really take it's toll on the paladin.",
						["IC"] = "spell_nature_sleep",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Shy and socially awkward",
						["TX"] = "Ani usually doesn't speak much. He'll enter a conversation if need be, but outside of that, he's not much of a talker.",
						["IC"] = "SPELL_HOLY_SILENCE",
