			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Ani is covered in scars. Here's a list:\n\n- One on his chest, running from his left shoulder diagonally down across his chest and coming to a stop near the right side of his naval.\n- On his back, running from the right shoulder, down his back, and jutting over to the left, resting right above his left hip.\n-Random impalement scars covering his chest, back, and sides\n- He has a long scar on his lips, starting below his left nostril and running diagonally down to the right side of his chin.\n- A horizontal scar running under his left eye,\n- A deep \"T\" shaped scar on his right cheek. \n\n\nHis years serving in the militia have made him strong and muscular, and his posture prompt and poised. The only real unkempt thing about him was his flaming red hair. Although it was not disheveled or messy, it was cut at different lengths from combat.\n\nEven though a lot of his strength comes from wearing and wielding heavy weapons and plate mail armor, Ani is also very toned and strong from his time working with metals and forging them into useful objects. Can't be a good paladin if you can't repair your own armor.\n\n*Voice Claim*\nPeter Stormare",
						["BK"] = 2,
						["IC"] = "Spell_Nature_Strength",
					},
					["PS"] = {
						["TX"] = "Anivastin is modest, somewhat shy, and withheld. However, he is always open to a good story.\n\nHe does not believe in drinking alcohol, but instead finds solace in a good tea.\n\nHe is mostly in control of his emotions due to his years in service and from training, Although, when harassed or berated, his anger does slip from him and get the better of him from time to time.\n\n\nDespite being hardened from fighting on the battlefield and duties of keeping his city safe, he is more than \"somewhat\" of a bumbling idiot when it comes to women. Completely naive and utterly clueless in their presence, its not difficult to make him blush and stumble over his own tongue.\n\n\nIn his off time, this Blood Elf enjoys relaxing by means of reading and drinking tea. In the events he is able to leave the front lines, Anivastin can be found on the banks of Booty Bay in Southern Stranglethorn Vale or touring around the lands of Pandaria for a place to sink a line. He is a gifted angler and enjoys nothing more than throwing out a line and catching fish.\n\n\nHis time in the service, being a fierce combatant on the battlefield, has left it's mark on this Sin'dorei. In the name of The Light, Anivastin has slain many. Serving in the armies between Lordaeron and The Horde for greater good and persuit of justice, Anivastin is afflicted from Post-Traumatic Stress Disorder. (P.T.S.D.) There is nothing else that can shake him to the core like recanting his tales of Northrend and the frozen Hell he lived while stationed there. With battles always on the horizon, it's hard for him to not relive the nightmares of fighting time and time again.\n\n*Theme*\nJorge Quintero - \"300 Violin Orchestra\"",
						["BK"] = 4,
					},
					["HI"] = {
						["TX"] = "\"One final heartbreak; blinding lights will guide my way. Free me my blind state; they will call me by my name - Undying.\"\n\n“Suffer no more, and trust in thy salvation…”\n\n\"And an awesome wailing was heard throughout the Heavens! And the terrible hand of The Light struck upon this earth! And as an almighty God created you, now He calleth you home!\"\n\nA well educated and battle-seasoned paladin, Anivastin is a hero of The Light. Trained and diciplined in various art forms, he seeks to bring The Light to where darkness resides.\n\nAnivastin's origins are unknown. It is believed he might have been born in Quel'Thalas, what is now \"The Ghostlands\", although no birth record of him exists. He was simply dropped off in the streets of Silvermoon one night many, many years ago. He spent a large majority of his life growing up in the orphanage in Silvermoon City.\n\nGrowing up, he was constantly bruted and bullied by the other High Elves for not being as strong as them, often being the subject of cruel torment by the other children, One year, everything in Anivastin's world changed when a Paladin by the name of Balthaneus Godspire took him out for Children's Week. At the end of the week, Anivastin was adopted into his care.\n\nFor years following, Anivastin trained under Godspire in the ways of The Light, Taking campaigns serving Lordaeron made him battle hardened and formidable. After the destruction of The Sunwell, Anivastin was among the second to be knighted as a Blood Knight, staying behind to help with the reconstruction of Silvermoon instead of following Kael'Thas through the Dark Portal into Outlands. Godspire and Anivastin, instead, roamed the lands looking for new sources of energy to qualm their people's thirst for magic.\n\nAnivastin was in the city of Silvermoon the day that Kael'Thalas laid seige to it in order to retake the Naaru, M'uru. Anivastin defiantly stood his ground in combat with The Legion. During combat, however, his armor was shattered and his torso was sliced open, leaving him gravely wounded. He stumbled to the Shephard's Gate and collapsed. Godspire, who was returning from Dalaran, rushed into the pillaged city and found Anivastin. He saved his life a second time, pulling him to safety and healing his wounds.\n\nGodspire and Anivastin laid low for the time being, waiting for Anivastin's wounds to heal and waiting on new orders from Lady Liadrin. When the Northrend campaign broke out, Balthaneus Godspire was hand-picked to fight the Lich in the Northern territory. Anivastin begged to leave with and fight alongside his master, but was declined. Godspire told Anivastin it was too dangerous. He has almost lost him once, he did not want to lose him again. Balthaneus was struck down in combat and raised into a Lich three months later.\n\nUpon recieving the news about his teacher, Anivastin took off to Northrend to confront King Arthas. While he never made it to the storming of Icecrown Citadel, he did, however, slay many of the Lich King's army, taking comfort in putting the bodies of the fallen in their final resting place. During a routine patrol in Zul'Drak, however, he did find the reanimated body of Godspire. A great fight broke out between student and teacher. The battle not only scarred Anivastin physically, but mentally as well after having to lay the broken corpse of his best friend to rest. He takes up the name \"Godspire\", in memory of the man and the legacy that spared him.\n\nWith no real family and his mentor and companion gone, Anivastin roams the world in persuit of becoming a better paladin. To him, the only real thing he can believe in is The Light, and there is nothing, object or person wise, he holds closer than his teachings... and drive to eradicate evil from the world.",
						["BK"] = 4,
						["IC"] = "INV_Relics_LibramofHope",
					},
				},
