					{
						["TX"] = "{h1:c}{col:FFD13A}Character Information{/col}{/h1}\n{col:ffffff}\nStraight up, what needs to be addressed immediately and first and foremost is one extremely important point; \n{p:c}{col:19ff00}IN CHARACTER{/col} does NOT equal {col:ff1d00}OUT OF CHARACTER{/col}.{/p}{col:ffffff}\n\nKuva does best in slice of life, dark themes, or combat scenarios, but all RP themes are accepted and endorsed from horror to military, so long as it makes sense from a storybook perspective it's all good and especially endorsed.\n{/col}\n{h2:c}{col:FFD13A}Resources{/col}{/h2}\n{p:c}{col:ff0010}Disclaimer; Art, while SFW, can be considered NSFW in terms of size, you have been warned, if you don't like big body types then you literally arn't missing out on anything revolutionary{/col}{/p}\n\n{icon:inv_misc_notepicture1b:30} Art: {p:c}\nNone, yet...\n{/p}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:350:30}\n\n{icon:70_professions_scroll_01:30} Music: {p:c}\n{link*https://www.youtube.com/watch?v=2V-u-vUUo9k*Moulder}\n{link*https://soundcloud.com/leotzal/fleetwire-cerebral-cobweb-alt-ver*Cerebral Cobweb}\n{link*https://www.youtube.com/watch?v=raItvlLX4Dc*Thorns}\n{link*https://soundcloud.com/oofkey/friday-night-funkin-tricky-mod-madness-coverremix*Madness}\n{link*https://soundcloud.com/oofkey/friday-night-funkin-tricky-mod-expurgation-coverremix*Expurgation}\n{/p}\n",
