		["0529233638bXiCJ"] = {
			["character"] = {
				["v"] = 85,
				["CO"] = "Walk-ups welcomed!\nPerpetually under construction.\nExtremely unfriendly towards Sylvanas Loyalists.\nI follow the lore as closely as possible. If you'd like help with the lore, I'm more than happy to help!\n\nAlso looking for long term RP/Storylines\nNot into the whole furry thing.  I chose a Tauren because I think Minotaurs are badass, not because I think animal people are attractive.  You do you, though.",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "10/10 HP\n\nIdly puffing away at a hookah.\n\n((Art in About!))",
			},
			["time"] = 1630911114,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1:c}===Physical Description==={/h1}\n\n{link*https://i.imgur.com/HcpyNiT.jpg*New Art!}\n{link*https://www.artstation.com/thyslendy*Art By Thy Huynh}\n\nStanding at 9'7\", Skuhl in an imposing figure.  His form has been hardened and toned from decades of battle, with many scars from more of the same.\n\nHis armor is typically very basic, yet strong, containing no moving parts and nothing terribly flashy.  He finds chest armor to be..  difficult to get in and out of, and shoulderguards to be cumbersome, so he usually foregoes them entirely, opting instead to use the relative freedome without them to avoid taking direct blows entirely.  Too much armor can make one overly reliant on it, after all.  He is but a simple warrior, relying only on his strength, skill, and agility in battle.",
						["BK"] = 9,
						["IC"] = "Ability_Warrior_IntensifyRage",
					}, -- [1]
					{
						["TX"] = "{h1:c}===Personality==={/h1}\n\nSkuhl is very well spoken and doesn't usually take himself too seriously.  He has a suprisingly sharp wit for a warrior and is usually quick with a joke.  While off of the battlefield, he is usually fairly laid back, often found relaxing, smoking hookah, and enjoying his favorite beer.  However, he takes his duties as a soldier very seriously, and is extremely no-nonsense when it comes to his duties as both a warrior and a leader.  Having spent most of his life as a nomad, wandering Azeroth, he can be extremely shy and sometimes awkward around people, even those he's closest to.  He can be somewhat standoffish and rarely approaches others unless he has business with them, but is more than happy to engage new people and is generally very polite and friendly.\n\nThough he tries to maintain this calm and mellow persona, sometimes his temper can give way to a rage.  He has a strong affinity for all non-aggressive animals and will go out of his way to see that they are not harmed.  The needless slaughter of these beasts is a sure fire way to get on his bad side.  It is also this love for animals that has earned him a trusted place amongst many beasts on Azeroth, many of which are often found at his side as companions or mounts.\n\n{link*https://www.youtube.com/watch?v=HmcAUWT8AHM*Theme: Grandson - Bury Me Face Down}",
						["BK"] = 5,
						["IC"] = "Spell_Arcane_MindMastery",
					}, -- [2]
					{
						["TX"] = "{h1:c}===RolePlay Hooks==={/h1}\n\nYou may recognize Skuhl if:\n-You served the Argent Dawn or Argent Crusade\n-You fought against the Legion during the most recent invasion\n-You helped to liberate Suramar\n-You do not agree with Sylvanas' Actions as Warchief and were aligned with Suarfang.\n-You like to drink.  A lot.  Skuhl can often be found at bars or taverns.\n-You're a fan or participant of the Brawl'gar Arena.  Skuhl has repeatedly held the highest rank of each season, among many others, proving himself to be a formidable combatant and champion.",
