			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "(( this sucks, I need to rewrite it ))\n\n{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n{col:ffffff}\n\nA diminutive mage. Lots of blue. \n\nTheir attire suggests a powerful mage, their face doesn't. Young and androgynous, they wouldn't be out of place among first years in an arcane academy. Despite this, they carry themselves like an accomplished arcanist on account of how they are one. They wear long, flowing robes that hide their form.\n\nThey're very soft spoken, like they've spent a lifetime in libraries. \n\n\n {/col}\n\n{img:Interface\\Pictures\\artifactbook-mage-cover:256:256}\n\n\n{h2:c}OOC Notes{/h2}\n\nOld character being reused for a new character. If you actually remember 2014 Vel, it's a different person.\n\nCan bake cupcakes. Can make cupcakes appear out of thin air. Both are abnormally good cupcakes.\n\nFlunked out of a baking apprenticeship.\n\nSocially incompetent, typically avoids eye contact.\n\nNot actually a blue dragon, but people thinking they are is very funny. So feel free to comment on that.\n\n{h2:c}RP Hooks:{/h2}\n\nWas posted to a Manaforge while a member of the Sunfury, defected after Kael'thas' defeat at Tempest Keep.\n\nFormer Sunreaver, left shortly after the Isle of Thunder.\n\nSpent time in Warsong Hold and Dragonblight during the Northrend campaign.\n\nTaught apprentice mages in Silvermoon and Orgrimmar. Typically taught apprentice mages before they chose a discipline, so even other mage specs could have been taught by them or be known to them.\n\nHas written several books commonly used as study material for Sin'dorei and Horde mages.\n\n\n",
