			["link"] = {
				["Thlissara-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}{link*https://www.artstation.com/artwork/nYG65K*A portrait of Thlissara}\n{link*https://www.artstation.com/myanyan*Here's my portfolio!}{/h2}\n\n{h3:c}Thlissara doesn't take her time to polish any armor, in fact it looks very old and worn and makes her look like everything but a paladin.{/h3}\n\n{h2:c}{icon:ability_creature_cursed_01:25}Alignment:{/h2}\n{h3:c}She developed kind of a dark personality although not evil.\nShe believes to be a Neutral good person, or at least that's what she tries. An oath to order, the guilty must be punished. They must face fire of hell or die by her holy sword.\nShe likes to help others, but doesn't mean she will help everyone.{/h3}\n\n{h2:c}{icon:spell_holy_crusaderstrike:25}Personality:{/h2}\n\n{h3:c}\"If the light doesn't give us its favor, I'll take it anyway\"{/h3}\n\n{h3}Thlissara is normally a chill elf, might worry about the injured and the weak, that could be physically or emotionally.{/h3}\n\n{h3}The Fire purifies and penance is a mean of redemption. Thlissara might deny her aid if the person in need has caused unjustified pain to others.{/h3}\n\n{h2:c}{icon:ability_butcher_exsanguination:25}Flaws:{/h2}\n{h3}Mana addiction. - Thlissara is very sensitive and can detect mana when it's in short range. Downside though is she will attempt to absorb it, often without asking.\nIf she runs out of mana or can't find more she's gonna lose her cool.\n\nFamily and nobility - She hates talking about it, will do if she's comfortable though.\n\nGuilt and Penance - She will face the consequences of her actions. Which is a good thing but also a flaw.{/h3}\n\n{h2:c}{icon:ability_revendreth_deathknight:25}For Blood/Death Knights:\nAre you a blood or a death knight?{/h2}\n{h3}Feel free to recognize Thlissara as one of your members and judge by your character's morals:{/h3}\n{h3:c}1.As someone who deserted due to her morals during Teldrassil/Undercity and kept her honor.\n2.As a traitor who ignored direct orders of the Warchief.\n\n3.Death knights: You might know her as a sadistic one who kept 'healing' undeads for the sake of watching them suffer.{/h3}\n\n{h3:c}Inventory: she got a strange scroll{/h3}",
				},
