		["0321041003pWoIM"] = {
			["character"] = {
				["v"] = 70,
				["CO"] = "Extremely character based. Interactions with her will be remembered and will develop her character. \n\n< Baroness by title only, born a commoner > < Disliked by other nobles > < Will do most things for the right price > < Chaotic neutral /neutral evil >\n\n(( 18+, walk ups are okay, ERP okay, char is WIP)) \n\nPersonality: Noblewoman persona: Proper, polished, a fine lady of the court. \n\nActual persona: She can be rather crass, snarky, sassy. She comes off as rude and vulgur, but she is really sweet when you get to know her. ",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "Tired after a long day of poach- She means hunting. \n\n\n\n\n\n\n\n \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
