			["time"] = 1630890938,
			["link"] = {
				["Neoxbow-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "                                                   Appearence\nUpon seeing her, you can't help but notice her beautiful, yet piercing brown eyes. Upon being hit by sunlight, they appear like swirls of dark amber. She has an olive complexation but used to be more fair in her younger years. Her face is angled, yet with hints of softness. Despite her years in the military, her face remains unscarred, or perhaps it could be her amazing make up skills? Her black hair is thick and wavey, differing from her shorter straight hair she had several years ago. She is of average height for a human woman. She has a slim figure with an average bust and hips. Upon closer inspection, her body is riddled with scars from her years in Pandaria. \n\n                                                      History\n\nAfter a long and successful career in the military, Ella Finch was rewarded with the title of \"baroness\" and a parcel of land in Redridge Mountains. While court politics differ from the military politics she was used to dealing with, she is slowly getting used to her new life. \n\nElla was orphaned a young child during the first war.  She was eventually picked up by a young couple living in Redridge and she lived with them for many years. She learned tailoring from her adopted mother and hunting from her adopted father. It was humble living with little luxuries but she was happy. A raid by the horde killed her newfound family when she was only 16. Angered, she vowed revenge against the Horde and joined the military. She eventually climbed up the ranks as a skillful assassin and eventually became a lieutenant commander. She lead many sucessful battles against the Horde and quickly became a favorite among most people of Redridge. Her careful planning and charm earned her the favor of a highlord but the top brass' jealously. She eventually messed up on a mission, causing the deaths of hundreds of alliance soldiers including most of her friends. This resulted in top alliance military officers to call for her termination; some even called for her execution over her poor judgement. \n\nShe managed to pull her connections with the highlord to retire (step down) from service in exchange for nobility and a small parcel of land. This ensured her protection from the military's wrath. While she enjoys the lavish parties (the food in particular), her crass behavior and low born stature has gained the disrepect of many nobles. Some nobles even resort to blackmailing her in order to humilate her by doing servant work. Besides a few acres of land, she didn't really get much and is relatively poor despite her title. She has resorted to doing some sketchy jobs including poaching and prostitution. This caused her to rethink her decision of becoming a noble. However if she leaves the life of nobility, that might put her at risk of immediate execution by the Stormwind military. She misses aspects of her old life and she constantly sneaks away from the castle to do mercenary work. She doesn't want to give both lives up and currently seeks a balance between the two. She wants to remain a noble, but she will do things her own way. \n",
				},
