				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n{p:r}Imperially framed, borne from a life of rigorous practicality and an austere outset—this here is a Knight, readily seen from the crest displayed high on his torso.\n\nThe man's face is carved out of a bitter, winterly touch. Despite his apparent venerable age, the Blood Knight's long hair is not merely white but ashen, the test of time not without its pricy admission: a full beard tracing his jawline is overdue for a preening, though some is gathered in a crop at the peak of his chin; a latticework of serrated nicks and winnowingly cuts give character to his silvered complexion; paltry in itself, perhaps, when noting the most jagged and prominent scar marring the periphery of his gaunt cheek, perpendicular to his left ear.\n\nHis gait and posture treads a stray line between two warring realms: shifting from pensive and alert, prone to a menacing stride, to unaffected and calm—all at the stroke of his patriarchal, lordly whim.  \n\nThough he is taciturn in speech, he offsets his cumbersome appearance by a viperous demeanour—gruffly mannered, almost surly, but relentlessly poised and articulated.{/p}",
