			["about"] = {
				["v"] = 12,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n{h1:c}{col:ffffff}Avialasti Darkspine{/col}{/h1}\n\n{h2:c}{col:ffffff}Aspiring Apprentice; Student of the Dark Arts{/col}{/h2}\n\n{h3}{col:ff7ff6}\nAvialasti, Avia for short if you will, was built like your typical Sin'dorei woman. Though she was rather on the short side of her people it did not quench the fire that burned within. Hair crimson red and kept cut small never reaching down to her shoulders. Lips painted in darker rouge to decorate the expression they displayed so frequently. A touch of charcoal eyeshadow to help make those glowing corrupted eyes pop.\n\nHer body though short was no less seductive and alluring than the remainder of her kin. For one wanting measurements they would find them to be 40B - 20W - 35H. Each step taken caused her chest to bounce just enough if she so demanded it. If given the chance to see her from behind anyone would see Avia was not lacking in that department. A good amount of plush causing any impact to make her jiggle like jello.\n\n\nAs for her personality? One should really find out themselves!\n\nRP Hooks/Ideas:\nFeel free to know her if you're a sin'dorei.\nShe's an apprentice seeking a teacher! Looking for Necromancy, Rituals, Chaos..anything for a Warlock really.\n{/col}{/h3}",
