		["0524221112ELzFb"] = {
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1:c}Lady Ariandrys Vaudrin{/h1}\n{h2:c}Public Image and Rumors{/h2}\n\nLady Vaudrin was originally born a bastard child to house Dawnreaver. Daughter of a servant mother who died in childbirth, Ari grew up raised harshly by the rest of her family. Her identity was swept under the rug for some time, until her father pushed to legitimize her under the Dawnreaver name when she was fourteen years old.\n\nNow a noble like her brothers and sisters, Ari was however faced with the difficult reality that the public knew of her original status as a bastard child, and therefore she would be most likely frowned upon by the vast public scene of Silvermoon's nobility. This did not, however, change the fact that the girl had determination.\n\nNot so long ago, Ariandrys was settled by her family in a marriage arrangement with a noble house of Suramar, wedded with their youngest son named Arleaux. Neither of them had any say in the matter, and it is most likely that they do not know each other very well.\n\nThe two were soon handed a small trading company to be the head of, of which most of the credit is handed to Arleaux. Ari has been seen as a trophy wife eversince the wedding, and her public status has not changed since then.\n\nOutside of official business, Ari is seen as a friend of the people of all classes, spending time out in the open world to meet new people and make new friendships. She always makes sure to help those in need, and seems to go out of her way to do just that.\n\nSome whispers in the wind may speak of Ariandrys treading through the slums of many large cities, speaking with less than respectable, or simply suspicious individuals. However, no proof of it being really her has been delivered to the public, and these rumors have had a tendency to die out, being brushed away as simple gossip and made up scandals to bring ill views on the Vaudrin name.\n",
