			["misc"] = {
				["PE"] = {
					["1"] = {
						["IC"] = "achievement_character_bloodelf_female",
						["TI"] = "Appearance",
						["AC"] = true,
						["TX"] = "Short and generally unassuming, Ariandrys does wear the traits of a typical Sin'dorei. Greenish teal eyes, a thick head of ginger hair and features as sharp as a blade.\n\nShe will always make an effort to look proper, as she is often called to do business with some. However, it does not take away the fact that most her free time is spent with people outside of her prestigious social circle, and she will therefore present herself accordingly.\n\nNevertheless, Ari chooses to always stand her ground and keep a straight and distinguished posture.",
					},
					["3"] = {
						["IC"] = "inv_inscription_runescrolloffortitude_yellow",
						["TI"] = "Business Affiliations",
						["AC"] = true,
						["TX"] = "This Sin'dorei is quite invested in a trading company by the name of Crossroads Trading. The group is relatively fresh, having named Ari as co-proprietor only recently, though most the credit for running the company has been given to her husband.\n\nShe will often be seen trying to make new contacts and scout out opportunities in the name of business.\n\nNow a part of House Vaudrin, she is quite often seen mingling with Silvermoon and Suramar nobility, having established many friendly relationships and a rather impressive web of contacts.",
					},
					["2"] = {
						["IC"] = "inv_trinket_revendrethraid_02_red",
						["TI"] = "Equipment",
						["AC"] = true,
						["TX"] = "It is not uncommon to see Ariandrys roaming around garbed in somewhat protective, though mostly practical gear.\n\nDue to her status, she takes great care of keeping herself safe, and will likely be carrying some form of subtle weaponry, oftentimes knives and small daggers.\n\nShe always seems to have various vials on her person, though no one has confirmed what their exact use is.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "A Woman of Reputation",
						["IC"] = "ability_monk_jasmineforcetea",
						["TX"] = "Ariandrys has earned a name in less than respectable social circles that her family would most likely be incredibly disappointed in.\n\nShe has become good friends with many people of the lower class, particularly around brawling arenas, questionable taverns and such circles.\n\nHowever, there is no proof Ari is involved in illegal dealings, and her renown for being generous and friendly to all is what people tend to stick on.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Scent & Jewelry",
						["IC"] = "inv_trinket_maldraxxus_02_red",
						["TX"] = "Force of habit, Ariandrys will typically be wearing subtle hints of perfume, though nothing extravagant. A typical smell of roses hovers around the woman, only perceptible through proximity.\n\nIt is rare that Ari will be sighted wearing jewelry outside of her business dealings and official events, but two pieces always remain.\n\nA subtle silver chain around her neck from which hangs a small vial filled with a wine coloured liquid, and her wedding ring, worn on her left finger. It is of Shal'dorei make, using a polished silver for the band, mounted by a finely cut ruby.",
