			["about"] = {
				["v"] = 2,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Ashinel was a beguiling woman, possessing a tall willowy figure and deceivingly delicate features. Bright silvery-white hair was commonly found in exquisitely brushed wavy bangs that framed the sides of a healthy-pale face. The rest of the rich mane flowed down to her shoulders, before ending between her shoulder blades. Her pale features were a sculpted blend of delicate and sharp, with high smooth cheekbones which sloped down into soft slender cheeks. The angle of her jaw possesses the same blending of features. Lips were on the slender side, with only enough fullness to be womanly, with a delicate hawkish nose above it. Dark green eyes were softly angled and expressive with a Fel Green glow around the edges.\n\nStanding around six-feet, when not considering her customary heeled boots, Ashinel’s physique of the blending of willowy, with a predatory sleekness, but still soft at the edges. Long lissome arms and legs were proportional with a willowy torso and slender hips. \n\nHer attire had a few customary belongings that tended to make up her attire. The first was a pair of high-heeled leather boots, which went up to her knees. The dark red leather was uncharacteristically smooth and had a sheen to them in the right light. Matching the boots, she wore long delicate leather gloves that ended right below the elbows of the same unusual leather. Bound around her willowy hips was a finely wrought chainmail belt, hanging from it were various sealed vials and a set of magical silver handcuffs, but the outstanding item on the belt was a locked leather grimoire, which was bound in the same leather as her gloves and boots.\n\n",
