			["about"] = {
				["v"] = 24,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "New toon! WIP!\n\n{img:Interface\\QuestionFrame\\answer-warboard-cata-Uldum:512:256}\n\nAt first glance, the woman looked closer to a human than an elf. Were it not for those honeyed eyes and short pointed ears, the guards of Horde cities would be quick to take her to the chopping block. Instead, her half-blood seems to earn her glares of disapproval, especially amongst her pure-blooded Sin'dorei kin.\n\nWhat she lacked in the standards of elven beauty, she made up for with her human traits. Born of a wastewander mother and living her life amongst a wandering caravan of merchants in Uldum, her smooth, flawless skin has adapted to the harsh desert sun, taking on a soft light brown complexion. Atop her head sits a thick mane of silky black hair that falls to her shoulders, framing her angular face. Below her long, thin brows lay her soft golden hues, her lids always painted smokey black, and lined with a thick plume of lashes. The half-elf possesses a pronounced nose, the right nostril pierced with a single golden stud. Below her nose lies her full, pouty lips. Though they are hardly ever pouting, rather upturned into a charming little smile. Her ears are mostly hidden beneath the curtain of thick hair on her head, the points just barely peeking through, the lobes pierced with large gold hoops.\n\nThe half-elf's form is slender, but by no means to the degree of her elven sisters. From her small shoulders hangs her gently toned arms, her tanned flesh tattooed from shoulder to hand with a mix of arcane runes and Tol'viri heiroglyphs, all of which glow a vibrant mana blue. Shey-Ra possesses a shapely hourglass form, adorning a generous bust upon her chest, with a flat toned abdomen just below. Her haunches support a supple backside, her legs trimmed with a fair bit of muscle definition from her time sprinting through the various traps that riddle the various ruins she finds herself in.\n\nShey-Ra is a friendly, curious soul by nature, greeting all with a warm smile and a bow of her head. Since leaving the sands of Uldum behind, she has been eager to meet the various races of Azeroth and learn of their culture. She is a merchant by trade, and will always be looking for something to sell or barter. Though do not let her friendly smile and sultry speech fool you. It's best to recount your coin after speaking with her.\n\nShey-Ra's attire is best suited for the harsh deserts of Kalimdor. Layers of cloths and Tol'viri silks are draped and tied around her form, the fabrics tattered and frayed from the sandstorms they've indured. An embossed leather tunic dresses her torso, being the only 'real' source of protection on the spell-thief's form, leaving her incredibly light on her feet. Her belt holds an abundance of leather bags, scrolls, and corked vials seated upon it, along with a drab brown tapestry around her hips that spans down her backside to her ankles. A baggy pair of trousers dress her legs, stitched over a dozen times to patch holes in the fabric. Her calves are kept wrapped with thick bandages, her feet dressed with simple cloth sandals. Despite her dull, sandy attire, the spell-thief adorns some luxurious items. A golden usekh dresses her small shoulders, resting across her bust. The collar is engraved with distinct Tol'viri heiroglyphs and patterns. Her tattooed biceps are wrapped with matching cuffs, fashioned in the likeness of vipers curling around her arms. Jingling gold chains dangle from bracers around her wrists, linking to bands that dress her middle fingers.\n\nThe swords upon her hips are Tol'viri by craft, khopeshes; swords that served more like hatchets than a traditional sword. The blades themselves looked as if they were carved from a rich sky blue topaz, the flats glimmering like the stars in the night sky. The blades are crafted from a rare metal, appropriately named 'star metal', from a comet that crashed into the sands many years ago. The Tol'viri thought this a gift from the Titans, and forged various rare, luxurious jewels for the king and his mates, as well as weapons for his finest generals using the precious star metal. Such weapons, including a twin pair of khopeshes gifted to General Zahim. When he died, he was buried with the blades in his tomb, long forgotten in the sands, until a certain sticky-fingered half-elf krept her way through the tomb and plucked them from the general's decrepit hands. \n\n\n                          {icon:inv_tailoring_uncommoncloth:25}The Tapestry {icon:inv_tailoring_uncommoncloth:25} A beautiful handwoven tapestry depicting imagery of Uldum lies at the woman's feet, lined with a variety of wares that range across Azeroth.\n\n-Numerous spices, coffee grinds, and pipe tobacco flavors.\n-A cluster of potions ranging in colors and sizes.\n- Various silks and cloths of racial make. \n-Enchanted whetstones.\n-Several alchemical herbs and fungi.\n-Varying bottles of cologne, musks, and perfumes.\n-Rings, necklaces, anklets, bracelets, and collars of varying racial motifs. \n-A large macaw in a cage.\n-One use offensive and defensive scrolls.\n-Stacks of elven literature.\n-Dream catchers.\n\n\n\n\n\n",
				},
			},
