				["T3"] = {
					["PH"] = {
						["TX"] = "Mao has a semi-muscular build with a slight belly to him. His fur is black and white, like an ordinary panda's. He does however keep his shirt off as he has nothing really to hide.",
						["BK"] = 4,
					},
					["PS"] = {
						["TX"] = "Mao is an adventurous panda with dreams to see the world and travel. He tries to be overly kind to those he meets and shows trust. Mao loves to help others whenever needed. However at times he may seem absent minded, lost in thought.",
						["BK"] = 5,
					},
					["HI"] = {
						["TX"] = "{WIP, not my best}\nA bartender's son isn't the best place to start, but it worked out for Mao in the long run.\n\nBorn on the Wandering Isle, Mao Ju Caskchuckle was made to be his father's assistant, handing out drinks and cleaning up messes. But even then Mao had never backed down.\n\nMao was later trained in the ways of a monk, specificly through the Ox training. Mao was quite tenacious and throughout the years learned to ignore pain within his own body.\n\nMao soon then learned how to create ales and brews from his father, carrying his knowledge and working hard at the Barking Turnip.\n\nHowever, once the alliance ship landed on the Isle, the oppertunity was set in place. Mao could leave the Isle, and explore the world outside.\n\nHe happily took the chance and for 2 years he wandered, trying to find new ways to make brew.\n\nCurrent events:\n\nMao has been given a lavender stone by his former lover, carrying with him the last of his lover's magic wards.\n\nMao now has a brewery! Located in Thunder Bluff, Elder's rise. Named the Chuckled Cask.",
