		["0530180440MG7ej"] = {
			["character"] = {
				["CU"] = "One fo de moneh, two fo de show..de world be ending so here we go!",
				["CO"] = "**Art In about**\nMature, Paragraph, Adaptable.\nWalkup & Whisper Friendly\nI often AFK, so whisper if I missed your emote.",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["v"] = 50,
			},
			["time"] = 1631142884,
			["link"] = {
				["Khahazan-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-HeroicScenario:256:128}\n{h1:c}Dance de Spiraling {col:ed1314}Flame{/col}{/h1}\n{/col}\n\n{h3:c}{col:ddb82a}Tall and powerfully built as many of his Zandalari brethren, he shares their height and strength but the sharp wild intense eyes, the color of molten iron staring out from under the shadow of furrowed eyebrows mark him as a class apart. Handsome in a savage way his tattooed face seems locked in a perpetual pendulum between grimace and amused smile as if the world he sees around him confuses, disgusts and amuses him in equal parts. Possessed of a twisted and cruel wit, his sense of humor seems to flow from the dark places of his past. Charming in the way a serpent is, his manners and decorum seem to come and go as the mood strikes him or as need dictates. A coarse guttural voice seemed to hiss out from between razor sharp teeth and rune inscribed tusks, speaking with a bewildering confidence that betrayed the whirling vortex of barely contained mania beneath. A slow and confident..yet syncopated gait seems to allude to this as well, as he exudes the aura of a Troll who has seen and done unspeakable things for his people and has come out the better for it...or at least as he sees it.\n\nDressed in frayed robes of black silks, with gold and red accents hung with trinkets..long sleeves and high shoulders are the order of the day, as they primarily conceal the lines of ritual brands and burn scars that cover his coal black skin. A crudely made spell blade and macabre fetish fashioned from a mummified hand hang from a waist that was wrapped in tarnished golden hooked chains intertwined with vials and little carved fetishes. A billowing cloak of silk and chained together sections of..what appears to be stretched..leather..hangs from his broad shoulders, the grizzly clinking drape offering a muted glimpse into the mind of a madman whose chaotic aura seemed to drift from him like a smoking brazier with every step.\n\nAs a recent transplant into the ranks of the Horde, he seems to have adapted fairly well, with only a few..minor..incidents. A person would be hard pressed to guess what exactly motivates the wayward Zandalari to do what he does, but one quickly realizes that when dealing with him,  good, evil and even normality are relative terms.{/col}{/h3}\n\n\n\n\n{h1:c}{link*https://tinyurl.com/khahazansfw*SFW art of Kha'hazan}{/col}{/h1}\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n{h1:c} {col:ed1314}/c/{/col}{/h1}\n{/col}\n\n\n\n{h3:c}{col:ff162f} If you wish to see *ALL* *nudge nudge wink wink* artwork of this character, just ask. Adults Only. {/col}{/h3}",
				},
