			["about"] = {
				["T2"] = {
					{
						["TX"] = " {h1}Appearance{/h1}\n\n{col:82FE9B}Aleklah has a very motherly figure, with full hips and a bit of a belly. She is soft, and elegant despite her short stature. On her shoulders she has crescent moon tattoos similar to the druidic kaldorei{/col}\n\n {col:82FE9B}Her horns are opulent, large and strong, with multiple chitinous plates that sweep back behind her ears and curl back forward slightly at the ends. They are a dark, slate-grey color, much in contrast to her pale blue skin. Her hair is icy white and fluffy, drifting past her shoulders in uneven tufts. It parts in the center just above her crest and sweeps around her face.{/col}\n\n{col:82fe9b}Reference Artwork:\nLinks are in the process of a rework!{/col}",
						["BK"] = 9,
						["IC"] = "inv_misc_druidstone04",
					}, -- [1]
					{
						["TX"] = "{h1}Artwork{/h1}\n{col:82FE9B}\nPlease note that I am currently reworking artwork links! Everything will be up soon!\n\n{link*https://cdn.discordapp.com/attachments/832426405336711233/866894892546654208/Aleklah_Reference_Page_Underwear.png*Aleklah Reference Pages} NEW!\n{link*http://your.url.here*Inventory Reference} COMING SOON\n{link*https://imgur.com/a/gndS8Fd*Art Gallery} RECENT & FAVORITE PIECES\n\n{/col}",
						["BK"] = 6,
						["IC"] = "inv_legion_faction_dreamweavers",
					}, -- [2]
					{
						["TX"] = "{h1}History{/h1}{col:82fe9b}\nAleklah has spent her time since arriving on Azeroth living in various places around northern Kalimdor, and after the Fourth War and the Burning of Teldrassil, has since moved to Val'sharah to pursue her druid studies and raise her family.\n\n(Haha my TRP wiped and I don't have this easily ready to post back so RP to learn more!)\n{/col}",
						["BK"] = 9,
						["IC"] = "achievement_zone_newshadowmoonvalley",
					}, -- [3]
					{
						["TX"] = "{h1}Roleplay Hooks{/h1}{col:82fe9b}\n- If you were a Vindicator or Anchorite in Karabor or Shattrath.\n- Have lived in Darnassus following the Arrival of the Exodar.\n- Are a poor Druid in Moonglade and have had to try and teach this stubborn little goat.\n{/col}",
