			["about"] = {
				["T1"] = {
					["TX"] = "{h1}Aikaria (18+){/h1}\nAikaria is a mage who is an arsonist at heart. She later attended KirinTor academy not long after escaping Vol'dun to hone her magical abilities, eventually joining the Horde to help their plight as much as she could.\n\n{h2}Magic Training{/h2}\nVulpera were never allowed to pursue much in the way of education under the rule of the Sethrak. She jumped at the oppurtunity to attend the KirinTor mage academy when the chance presented itself.\n\n{h2}Likes{/h2}\nShe absolutely loves being pet. Quickest way to get on her goodside!\n\n{h2}Rules of the Alpha{/h2}\nFollows the Rules of the Alpha Vulpera.\n\n{h2}Past{/h2}\nIn the days of Vol'dun, Aikaria never had much in the way of freedom. She was captured by Sethrak Slavers and eventually sold to a family as a house servant. The Mistress of the family treated Aikaria well, teaching her the basics of reading, writing and enough magic to aid in her duties. Aikaria was eventually freed from her servitude when the family fell on hard times after the fall of the Sethrak Empire. She would eventually be bought and taken in by her current owner.\n\n{h2}Contractually Enslaved{/h2}\nBecause ownerships did not transfer from Vol'dun to Orgrimmar, her current owner swayed her into signing a contract to strengthen his control and hold over her.\n\n",
