			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n{img:Interface\\QuestionFrame\\answer-ChromieScenario-Chromie-Small:256:128} {h3:c}Let's Take A Look Into The Past...{/h3}\n\nRakonna had a harsh beggining to life. In Frosfire, Dreanor, her mother was a nomad of sorts-a female orc of the Frostwolf Clan who chose adventure in a young life.\nRakonna's mother was...taken advantage of by other traveling Orc's. She was kept as a slave until she was with child. With Rakonna.\n\nWhen the male orc's found out, they sold her off to Ogre's and she was put to work till the day she gave birth to Rakonna... She only had a few moments with her new born child before the Ogre's snatched her away and raised her in a dark cell.\n\nShe was never given a name, not yet...\n\nFor the first 7 years of her life, Rakonna was 'taught' how to speak by one Ogre, in order to understand commands by her new masters. She spoke in a broken language, she poke like an Ogre. And for the next 2 years she worked in the slag mines, surrounded by fire and hot coal and the cries of other slaves. She understood this was not how someone was supposed to be treated...But she never spoke against it in fear of beatings.\n\nShe always wore a chain collar around her neck because the first time she learned she was a slave, and there was a world outside, she tried to run. She was only 9 so she was caught easily by an Ogre Mage. And ever since she was put on a leash like a dog. The iron collar wore down the skin on her neck so it made for bad scarring from below her chin down to her collar bone.\n\nRakonna loathed being a slave, she cried almost every night when she was allowed what little sleep she had. She was just a child, small and defenseless. Barely spoke a word because she didn't know them or was too afraid.\n\n\nOne night, on a terribly cold winter eve, Rakonna was suddenly woken up from her sleep as she heard screaming and shouting. Ogre's shouting.\nIt was the Frostwolf clan! They joined forces with the Horde and were raiding the mines, smashing cell doors open and freeing slaves. Dreanei and Orc's alike!\n\nOnce her cell was opened, Rakonna made a run for it, not caring who was shouting at her from behind. She was too scared to stop and look.\n\nShe ran outside. For the first time in her entire life, she felt a breeze...Cold, fresh....Welcoming. It felt like...Home. She stood still for a long moment, letting her bare feet sink into the snow like one would do in warm, soft sand. \nTears fell down her cheeks and she let out a howl, tossing her head back. Her heart was racing in her chest with excitment and joy, falling onto her back on the soft snow... It felt so much better than the small cot made of hay she had in her now former cell.\n\nRakonna closed her eyes and listened to the wind. Her peaceful moment was interrupted by heavy footsteps in the snow, a low voice rumbling. \"What are you doing, little one?\" It was a tall, heavily muscular male Orc with dark skin and a few tattoos on his arms.\nRakonna shot up to her feet and backed away in fear, glaring at him and growling. \"No friend!\" She snapped at him. She was declaring the male orc was an enemy, one like the Ogre's who enslaved her.\nThe male orc simply smiled and sat down in front of her. \"Perhaps not. But I can be.\" He held out his hand, in it were food rations. Bread and meat. \"Eat, little one. You look starved.\"\nRakonna inched forward, growling at the man still as she quickly snatched the food and ate it all in about 10 seconds. She liked the taste of fresh meat and non-molded bread. She let out a huff of ecitement and began grabbing his pockets, looking for more. This earned a laugh from the orc as he took the chance to pick her up, \"I see you liked that!\" Rakonna just let out another huff. \"Hungry. Give.\" This earned another laugh from the orc as he kept a supportive grip on her, holding her like a baby cradled in his arms. \"I know somewhere you can eat a lot more.\"\nRakonna tilted her head, understanding some of his words. \"Nom nom, where?\"\nThe male orc smiled as he walked off with her. \"Home.\"\n\nFor years to come after that night, she was given the name Rakonna. She and her wolf G'anar and Solvera hunted for the clan, and she loved it. Running free in the wilds as she pleased. She wished she could have known her mother... But she knows she is honoring her by living on, to be the best she can be!\n\n{h3:c}And Now Back To The Present!{/h3}\n{img:Interface\\QuestionFrame\\answer-ChromieScenario-Chromie-Small:256:128}\n",
				},
