			["about"] = {
				["T1"] = {
					["TX"] = "{col:e0e0e0}Sso, you want to know my sssstory? Letss sssee....{/col}\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Sunlight:700:120}\n{col:fbffae}The day shines bright in a small Shu'halo village tucked away in the Stonetalon Mountains. It shines even brighter for a particular young couple as they gaze down lovingly at their brand new baby girl, their little ray of sunshine, almost literally with her golden fur and straw-blond mane, grinning from ear to ear at her parents.\n\nTo say she was a happy calf would have been an understatement, and the young pair had to always be on their toes, the little rascal constantly getting herself into trouble. As energetic as they come, she ran everywhere she went, bounced when standing in place, and laughed at everything she saw. She was an absolute joy, if her mother and father were to be asked.\n\nSadly it was not to last. In one fateful night, less than a week before her coming-of-age ceremony, everything changed....{/col}\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Darkness:700:128}\n{col:ae8fd1}A concerned mother's voice...\n\n\"Art'eruk, have you seen M'lai? It's getting dark and I'm getting worried, she's usually home by now...\"\n\n\"Sorry T'uleila, I'm afraid I have not. Have you checked by the Strand? I noticed she's been heading that way more and more lately.\"\n\n\"Not yet, I'll get K'inyar and have a look now. Thank you.\"\n\nWithin a few minutes, the couple were on their way to find their daughter. Zoram Strand... It wasn't that far from the village, but you had to negotiate cliffs to get to it, and many of those outcroppings were loose...\n\nThe adults of the village usually didn't have much trouble scaling those cliffs, but almost none of them would attempt it in the dark. They had to hurry, or they would be forced to camp on the Strand, and the normally calm waves that lapped at the shorline became rather intense in the light of Mu'sha.\n\nIt took them longer than they liked in the fading light, but eventually they made it to the last precipice and were able to gaze down tot he sand below and see their beloved daughter laying in the sand, her head as well as an arm at angles they should never be able to go...\n\nT'uleila bursts into tears as K'inyar just stares in shock. Finally he becomes able to tear his eyes away, and notices the creature slowly making its way toward their daughter's body, unable to make out exactly what it was in the failing light. In fear of having to watch his pride and joy devoured by some beast right before his eyes, he leaps from the precipice, his climbing hook held to strike the beast when he landed. He landed just barely too late, the beast's head snapping forward and sinking its teeth into her right shoulder.{/col}\n\n{col:e0e0e0}M'lai raises a hand to feel the two bumps of scar tissue just above her right collar bone, her eyes clouded in memory...\n\n\"Ah, ssssorry, got a bit losst. Let me continue...\"{/col}\n\n{col:ae8fd1}The creature's head remained attached to the young Shu'halo as its body dropped, lifeless as K'inyar's hook ripped through the flesh of its neck, accompanied by the sound of his left leg snapping as he landed. He grabbed its head, throwing it into the sea before the adrenaline wore off and the pain in his leg hit him, dropping him with a gasp, the agony causing him to miss the last tendrils of shadow creeping into the bite.\n\n\"K'inyar! Are you alright?\" the concern in her voice clear.\n\n\"I broke my leg, but the creature is dead.\" As is the pain in his.\n\n\"Hold on, I'm on my way down!\"\n\nEven with her eyes blurred by the tears still flowing from them, she manages to find and grab the rope dangling from the last point they tied it off from. A few moments and she was to the sand, and by her mate's side.\n\n\"Let me have a look... Well, it's definitely broken. We'll have to stay here for the night and hope the waves don't reacah us.\"\n\nThe sea was unnaturally calm that night, and as two pairs of eyes closed in sleep, a younger pair opened...{/col}\n\n{col:e0e0e0}She took a moment to clear her throat, \"I think that isss enough for now, I need a drink...\"{/col}\n\nI -think- it's pretty much done, the rest of the story to be told in actual RP. Some stuff may be changed slightly. Perfection is a journey, not a destination.\n\nSide note: If you're going to stand around chatting OoC, the polite thing to do is move away from the people trying to RP.",
				},
