			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://imgur.com/a/M1rKmm0*Tycho Art Gallery!}\n\n{h3:c}______________________________________{/h3}\n{h3:c}{col:ff493b}Total Murders:{/col}{/h3}\n{p:c}{col:ff0600}29{/col}{/p}\n{h3:c}______________________________________{/h3}\n{h1:c}{col:ff4e4c}Tycho Short Stories{/col}{/h1}\n{p:c}(And Tycho Related Short Stories){/p}\n{h3:c}______________________________________{/h3}\n{h3:c}{link*https://docs.google.com/document/d/1TTpQPTG8jwXgPU0jbGWGQnXkr9LlRiVeia2k9ZMaEN0/edit*Nineteen}{/h3}{h3:c}{link*https://docs.google.com/document/d/1YKizt-UcDKACAmoUYPsHZGDwpdBYoybF-9l7twwDncE/edit?usp=sharing*Boat}\n{link*https://docs.google.com/document/d/1OZF-ydksuMhBGJS_MxkNlvlfHUGxdL3aQQqzef_wud0/edit*Her Loyal Companion}\n{link*https://docs.google.com/document/d/1h2h2Cp64vcVy6AsgyQizIjJxiyCIKka9DPAE0jrxMZU/edit*A Little Off Schedule}\n{link*https://docs.google.com/document/d/1WDISX5vSX40zhfh0nBaqiWnts3Fuj_NlGCgBihPMxH0/edit*Bladeworth}\n{link*https://docs.google.com/document/d/1c7PnCHKp-6aEKebt8ejgV7QVEGFeutAEtQunvp4edsk/edit?ouid=113247444903974330108&usp=docs_home&ths=true*She'd Beg to Differ}\n{/h3}\n{h3:c}______________________________________{/h3}\n\n{h1:c}{col:caf5ff}Tycho's Poetry{/col}{/h1}\n\n{h3:c}______________________________________{/h3}\n\n{h3:c}Umbrella{/h3}\n{p:c}A shield from the rain?\nTo break these chains..\nSimulated stimulation..\nTrue exhileration?\nGenuine admiration?\nUnusual sensation.\nA shield from the pain?\nBurst the water main.\nLevel the dam.\nSlaughter the sham.\nIf you can.{/p}\n\n{h3:c}______________________________________{/h3}\n\n{h3:c}Umbrella - Revised{/h3}\n{p:c}A shield from the rain,\nwho eases my pain.\nSimulated stimulation,\nnow true exhileration,\ngenuine admiration,\nthe greatest sensation.\nVulnerability and compassion.\nStrength, and real passion.\nYou'll always be my hero,\nEven if you smell a little like a Gyro,\nAnd even if, too, sometimes, you smell like a pack of cigarillos,\nI'll always love you, Danru, even if you Still have a stupid Nelma body pillow.{/p}\n\n{h3:c}______________________________________{/h3}\n\n{h3:c}Untitled{/h3}\n{p:c}Sitting alone in my tent.\nI would like to vent.\nI am so pent-up inside.\n\nThinking by myself.\nMaybe it would be easy.\nEasier than this.\n\nTo pack up and go.\nBack to the dunes, which I hate.\nShip me in a crate.\n\nA short trip, I'm sure.\nThis is naught but my demur.\nDemur, manifest.\n\nEach and every day-\nAgonizing tests.\nYes, I am a mess.\n\nStanding on the edge.\nPonder jumping in my head.\nWould that be better?\n\nNEVERNEVERNEVERNEVERNEVER{/p}\n{h3:c}______________________________________{/h3}\n\n{h3:c}Days and Nights{/h3}\n{p:c}My head hurts tonight.\nThis much is normal.\nI awake in the dirt.\nIn naught but my shirt-\nThe middle of the night.\nSo, this is my fight.\nI try with all my might.\nTo ignore these headaches which alter my sight.\nNay, I cannot-\nIt is bright.\nI shield my eyes from the light.\nIs it morning already?\nNay, I am not ready!\nGo away, little sun.\nI am BETTER than EVERYONE!\n\n\n\nMy head hurts tonight.{/p}\n\n{h3:c}______________________________________{/h3}\n\n{h3:c}A Choice{/h3}\n{p:c}A dilemma, practically an extrema.\nA choice, both painfully obvious and shamefully onerous.\nThe easy route, or the hard? As it stands, I'm but a shard.\nLong and windy, or short and timely?\nAxe-murderers are wack.\nTime to hit the sack.\n\n\nOkay, it wasn't actually that hard of a choice, come to think of it.\nSO WHAT?\nAnyway, I did a survey and these were the results:\n\n1. HORRIFIC Surgery: 8\n2. SLOW Healing: 23\n3. UNDECIDED: 3\n{/p}\n\n{h3:c}______________________________________{/h3}\n\n{h3:c}The Parents{/h3}\n{p:c}Along the streets of Boralus, there stood a man with a mallet.\nA carpenter, seeking to improve his life. To provide for his wife.\nOnly no matter how he tried, the well of work had long dried.\nFor his reputation was marred.\nNay, -scarred- by -her-.\nSure, it -was- her. Fur of orange. Spots of brown.\nBut his daughter was a plague on this town.\nThe girl had been long like this.\nSomething quite amiss.\nShe lacked something crucial, which had once been quite fruitful.\nAn accident? Foul play? It didn't matter, for on that fateful day..\nThe girl was never the same.\nHateful, and without remorse. And everyone knew the source.\nOnly nothing could be done.\nAnd before long, the day had come.\nThe girl would be sent away.\nHer feelings manifest, it was surely a test:\nTo see her aboard, their muscles were surely made sore.\nShe screamed and she fought, but the bindings were taught.\nThe girl did not want to leave.\nThis was her home, even though she cracked her dome.\nShe acted a cur.\nAnd they just could not stand her.\nThe girl cried and she swore and she cursed and she mourned.\nFor her family to which she'd been born? No.\nFor her friends which she'd surely worn? No.\nFor who she'd hurt, so mercilessly torn? No.\nThe girl's tears were for none but herself.\nAnd with the setting of the sun, the deed had been done.\nHer fate had been sealed, it was a done deal.\nA weight lifted, and another in its place.\nThe girl was never seen again.\nAnd that was simply the case.{/p}\n\n{h3:c}______________________________________{/h3}\n\n\n{h3:c}It Doesn't Get Better{/h3}\n{p:c}It doesn't get better. I'm gonna choke.\nFloat like a feather, then fail to cope.\nI write word after word in these notes, but it's like I never got off the boat.\nI'm afloat in an endless, stirring sea of pride and shame.\nI sway among the waves.\nAlong my peaks and my valleys.\nAnd it all started in a simple alley.\nAll my progress, forever waylaid by my mind's ties.\nThey were right to throw me away, despite my cries.\nI can't even keep a hyena alive.\nFloat like a feather, fail to cope.\nI write word after word, but I never got off the boat.{/p}\n\n{h3:c}______________________________________{/h3}\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n{col:ff001b}New!{/col} (<-- ignore that, it's just so i dont gotta redo it again later)\n\n{link*https://t.co/fipgOVXQyY?amp=1*Vulpera No-Touching Pamphlet}",
