						["TX"] = "{p:c}Although a chosen Pupil of Yu'lon, she is still a product of her own environment, she still slightly struggles to be humble when it comes to \"lesser fortunate\" denizens of Orgrimar and Azeroth alike. In any case, Minty is a cunning conversationalist and eager to learn about everything and anyone. She is almost always keen for a bit of danger and sensation...\n\n(outside of combat)Playful at times, giggly/cheeky, talkitive and curious..sometimes shy\n(inside of combat)Tactical, silent, vigiliant and unwavering...sometimes unsettlingly eager for a fight\n\nFavorites: Candied Nightwell Nuggies and Arcwine shots, loves a good drink (its 5pm somewhere, right?)\n\nDislikes:--Yet to be discovered, you will find her very movable on alot of subjects. \n{/p}",
