						["TX"] = "{h3}Physical Description{/h3}\nThis stout dwarf standing at 4\"4' has short, ruffled black hair and a beard that is equally ruffled and is average length. He's most comfortable in his heavy plate armor, and tends to wear it all the time.\n",
