					}, -- [1]
					{
						["TX"] = "{h3}Personality{/h3}\nKhazgrim puts on an air of cheerfulness and tries to brighten the days of people around him, but those perceptive enough can sense the deep underlying sadness that lies within each chuckle. While it can be tough, Khazgrim has managed to overcome the depression that comes with death and redirected it towards pressing forward and helping those in need.",
						["BK"] = 1,
						["IC"] = "spell_frost_wisp",
					}, -- [2]
					{
						["TX"] = "{h3}History{/h3}\nKhazgrim was killed and raised by the Scourge after sacrificing himself to allow his family to retreat from a skirmish. After regaining free will, he went back to his family, who reaccepted him without hesitation, and attempted to live a semi-normal life once again, but the pull of the Ebon Blade was too difficult to avoid, as well as the \"eternal hunger\" that all Death Knights endure. He realized he had to embrace his new life, and fought for Azeroth with his fellow death knights.\n\nAfter the Deathlord assaulted the Sanctum of Light to attempt to raise Tirion, Khazgrim couldn't pretend to be satisfied with the way they led any more. He left active duty and focused on fighting the Legion with the Alliance.\n\nOnce the Legion was defeated, Khazgrim officially left* the Ebon Blade to join Magni Bronzebeard's cause, seeking out ways to heal Azeroth, including gathering Azerite. Denouncing the Fourth War as a waste of time, he argued and fought to divert Azerite away from weaponry back towards where it belonged.\n\nHowever, when Sylvanas attacked and burned down Teldrassil, Khazgrim realized that she was as much of a risk to Azeroth as she was to the Alliance, and thus joined the War of the Thorns to drive the Forsaken out of Darkshore. \n\nOnce Sylvanas denounced the Horde and disappeared, he refocused his efforts back towards Azeroth- just in time for N'Zoth to unleash his visions upon the world. The struggle against N'Zoth's forces was a brutal one, but through the efforts of the champions of the world, Azeroth prevailed. \n\nWhen the fighting came to a conclusion, and a shaky peace treaty was put in place, Khazgrim was left in a predicament. The \"Eternal Hunger\" he feels does not stop for peace. The best he could do was help quell small pockets of fighting and continue to assist Magni.\n\nAnd then the sky tore open. With the pull of the Helm of Domination gone, and Bolvar now fully in control of the Ebon Blade (and no Ner'zhul!) Khazgrim re-entered active Ebon Blade duty to delve into the Shadowlands to fight against Sylvanas... and then disappeared after the initial conflict.\n\nPresumed dead, the Ebon Blade included him in their memorials for the fallen- but no evidence of a body was ever found, only his runeaxe, leading some to believe he's still alive, somewhere.\n\n\nFamily:\nMogruff Frostbeard- Brother\nBrythlin Frostbeard- Sister\nKjeldruf Silverskimmer- Cousin\n\n*The idea that Death Knights can leave the Ebon Blade is somewhat disputed. If you are one who believes they cannot, then Khazgrim just left active duty to help Magni, still chained to the Ebon Blade.",
