					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Mud:512:128}\n=====Fayla Stoneshield History=====\nFayla is a member of the Stoneshield tribe, one of the few tribes of the most large Tauren's of both male and female in Azeroth. The stoneshield tribe is an earth type group of people built by mostly shaman's, they are known to be in Thunder bluff but some have been known to take differnt paths such as warrior, paladin, and even druid but they are always in tuned of the earth as any of the tribe members.\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-DraenorOrc:512:256}\nbeing part of the Horde for the longest time she and her tribe has always been part of the bigger idea as long as there was honor, respect and most of all self control meaning no needless blood shead of the name of greater power being the Chieftain of her Tribe she does the most work with in the Horde even though she does not like this war that has be happening.\n\n{img:Interface\\ARCHEOLOGY\\Arch-TempRareSketch:512:256}\nFayla uses three weapons and a shield crafted personally by her self with her blacksmith skills\n\n-Hardened Earthed Axes-\nfayla can summon two earth like axes to fight with from the ground at will these axes are hardened stone stronger then basic metal even able to with stand the most powerful of matels for a limited of time at lest.\n\n-Custom Totem Mace-\nusing her blacksmithing she has Crafted a metal based totem weapon that is pure Demonsteel inside the core of the totem with a cast molded around the steel thats made of Balanced Trillium that is about five inches thick casting\n\n-Stoneshield custom made family Heirloom-\nPersonal crafted Heavy Shield large enough to cover most of fayla's body crafted in the highest grade wood with a reinforcement behind the shield frame made of Obsidium and Titanium fused together with a metal outer base frame that is also made of Elementium and Titansteel with a spikes on the front made of True iron and Blackrock welded on with Elemental Flux making this shield heavy to carry by anyone but those who does not work on strength training extremely alot sense even holding the sheild up would be a work out for even the strongest group of people for the shield weight is about half the weight of an average size Kodo.\n=============================================\nBody Example Art\n-----------------------\n{link*https://tinyurl.com/y38krad7*Art done and Owned by atryl from DA}\nkeep in mind her Size... she is a Female Tuaren thats 12-13 ft tall which is way bigger then the average male Tuaren so if you look at this Art and say \"oh this is just some lewd crap\" she is a big ass Tuaren.. of course other parts of her body will be big too to match her overall Size so stop thinking that you perv's\n=============================================",
