					["1"] = {
						["AC"] = true,
						["TI"] = "Welcoming Demeanor",
						["IC"] = "achievement_worldevent_brewmaster",
						["TX"] = "To all but the most outwardly malevolent sorts, Kai would exhibit a warm and tranquil manner. Those that meet his calm gaze can often expect a genial smile and a formal greeting.",
					},
					["3"] = {
						["IC"] = "inv_helm_mail_pvpshaman_e_01",
						["TI"] = "Shamanistic Garb",
						["AC"] = true,
						["TX"] = "This young bear often wears simple, uninhibiting attire, though with the weathered distinctions of a practicing shaman. Elemental runes or other such blessings may also be noted.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Frostbound Weaponry",
						["IC"] = "inv_mace_1h_artifactazshara_d_05",
						["TX"] = "A set of frozen armaments, seemingly crafted from the depths themselves, can often be seen on this pandaren's person, both embedded with an elemental core and imbued spiritual enchantments.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Adherent of Balance",
						["IC"] = "ability_shaman_ascendance",
						["TX"] = "Having long sought the favor of the spirits, those capable of sensing such cosmic forces may find a considerable degree of both ancestral and elemental influence in Kai's ambience.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Humble Accessories",
						["IC"] = "inv_misc_bag_09_black",
						["TX"] = "Little else could typically be seen on Kai's person. Most times, he'll carry with him a modest coinpurse, some traditional Pandaren-styled totems, Tortollan scrolls, and perhaps a bijou or two.",
					},
				},
				["v"] = 52,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Rain:512:128}\n\n{h1:c}{col:007ba7}Wavespeaker Kai Jiang{/col}{/h1}\n{h3:c}{col:ffffff}\"A mastered perspective knows only fortune.\"{/col}{/h3}\n\n{img:Interface\\Pictures\\artifactbook-shaman-cover:256:256}\n\n{h2:c}Appearance{/h2}{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{col:ffffff} Whether it's the broad physique, the fine coat of soft fur, or the overall ursine appearance, there's little chance of mistaking Kai of anything but your typical, hefty Pandaren... in terms of build anyway. Near or far, one might sense this young fellow to bear a rounded and modestly strong frame as well, but he's no exception of his kind when it comes to having a vast, plump belly. His stout biceps and leg muscles should speak of a worldly and self-sufficient man, and though he does appear to have respectably broad shoulders and a somewhat wider neck, the notable lack of scarring and other such bodily damage could allude that he doesn't make a living of combat.{/col}\n\n{col:ffffff} Being a rather welcoming and optimistic sort of bear, he'd assuredly greet all but the most palpably bitter sorts with a fond smile. His visage exhibits a harmless, gentle, and contemplative demeanor with his cerulean eyes--each engulfed with their own vertical black stripe--ordinarily tapered in a cool and studious manner. Should neither headdress nor straw hat veil his head, a bed of spiky back-brushed hair would be noticed, as well as a thick, bristly brow and a lengthy, tidily trimmed beard along his jawline. His silken hide is almost entirely dark black in hue, the exceptions being the bright white fur upon his feet, paws, chest, face, and underbelly.{/col}\n\n{img:Interface\\QuestionFrame\\answer-VindicaarCrystal-LightforgedWarframe:256:128}\n\n{h2:c}Hooks{/h2}{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h3}One may recognize Kai if...{/h3}\n\n{col:ffffff}• They are from Shen-zin Su, particularly the Dai-Lo Farmstead and the Singing Pools.\n\n• They frequently visited Mandori and the Temple of Five Dawns during his training.\n\n• They were among the first to depart from the Wandering Isle to set foot on Pandaria just after its rediscovery.\n\n• They work with or are affiliated with the Earthen Ring, the Champions of Azeroth, and/or the Kui Zhang Society.\n\n• They are a fellow student of the elements and history of Pandaria.\n\n• They are/were a student of the Krasari wavespeaker hermit, Master Jang Yeong-jin.\n\n• They are currently receiving training with one of the Celestial temples, particularly at the Jade Temple.{/col}\n\n\n\n{img:Interface\\TALENTFRAME\\bg-monk-mistweaver:256:256}{h2:c}{col:ffffff}External Links{/col}{/h2}{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h3:c}{link*https://twitter.com/jikai1992*Twitter}{/h3}\n\n{h3:c}{link*https://imgur.com/a/2EcQ27O*Character Art Gallery}{/h3}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-91:64:64}",
				},
