			["about"] = {
				["v"] = 7,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h3:c}Appearance{/h3}\n{p:c}{col:1bffdd}\n    Standing at an even 6 foot, Exsuai is firmly on the taller side of average for her elven kin. She has a well developed build, with a strong core and fair tone to her whole body. Yet, she maintains that key elven lankiness, which almost seems at odds with her abilities. \n\n    As with many, Exsuai’s skin has been changed to a stained blue color, and her hair has become an equally deep blue. Apart from those changes however, she lacks any notable void taint. \n\n    In terms of appearance, Exsuai is fairly typical for an elf. Pointy nose, pointy jaw, high cheekbones, thin lips and bright eyes. There isn’t much about her face that really stands out. Her age is impossible to tell, due to the lack of fine lines. \n\n    Exsuai’s hair is relatively long, but also well kept. Her hair reaches to the middle of her back, where it’s bound into a loose braid. The braid is always kept behind her back, in order to make sure it’s out of the way. Her hair was once black, but is now a deep blue. \n\n    While somewhat uncharacteristic of a fighter, Exsuai has a rather soft and quiet voice, with some hoarse undertones. Her voice does not seem to carry the strange echo/flange of many void elves, but that doesn’t mean it’s absent.\n {/p}\n\n{h3:c}Skills and armor{/h3}\n{p:c}{col:97dcff}\nExsuai has a rather unusual set of armor, designed to protect virtually everything. Her torso is guarded by a full breastplate with placakart. The armor has a raised collar to guard her neck and deflect strikes away. Pauldrons to protect her sides and upper arms. Full plated gauntlets to guard her hands. \n\nFull leg plates which cover every part of her legs, save for the joints, and full sabatons for her feet. Faulds guard the sides of her thighs and around the hip joints.\n\nThe armor doesn’t appear to have any notable seams to the plating. Parts like the breastplate and arm guards seem to be fully formed over her, with no apparent way of removal. There is likely some magic in play.\n{col:a1d5cc}\n\n\n {/p}\n\n{h3:c}Quick bits{/h3}\nUses magic to boost her strength and reflexes for short periods. Doesn't do it too much to avoid heavy strain.\n\nThe name Exsuai originates from a slured out Exile ",
