		["0811225043UGeZY"] = {
			["character"] = {
				["v"] = 33,
				["CO"] = "I'm easy going and friendly, don't shy away!\n\nBrushing the dust off this character after over a year of hiatus. Bear with me as I figure out what she's like again!",
				["RP"] = 2,
				["LC"] = "enUS",
