			["time"] = 1631081305,
			["link"] = {
				["Ophirael-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Windy:512:128}\n{p:c}{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-4:64:64}{/p}\n{h1:c}{col:ff4400}Description{/col}{/h1}\nFear has dominated this elf's life and her appearance shows it. Combs and scissors could injure her while grooming, so her hair is long and unkempt. Make-up can be toxic, so she leaves her face untouched by it. Jewelry can scratch and choke, meaning she has none.\n\nShe is constantly jittery and even the slightest unexpected noise can startle her. Her eyes rarely meet others' and she often pulls her clothing around her in a defensive way. What may have been an ethereal Sin'dorei with slender poise and elegance has been buried beneath layers of fear and anxiety.\n\n{p:c}{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-14:64:64}{/p}\n{h1:c}{col:c300ff}History{/col}{/h1}\n{p:c}You may know Ophirael if...{/p}\n...you are a mage or otherwise active in the academics of magic. At one point she was a well known author of books on telemancy. These days it's hard to see the resemblence to what was a witty and intelligent writer. She is a shadow of her former self.\n\n...you practice dark magic. While she seems to have little desire in delving into the arts herself, many of her family members have been accused of studying necromancy and are well connected to the underworld revolving around black magic.\n\n...you run any business involving security. She is a nervous wreck who spends way more money than she should on defending her home. She's just never been the same since the Scourge invasion.\n\n{p:c}{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-47:64:64}{/p}\n{h1:c}Out of Character Notes{/h1}\nHello! Thank you very much for reading through this. I'm just going to leave a few key points here about my preferences and style. That way all of us can get the most fun out of our RP.\n\nFirst, I'm a really chill person. My RP is flexible and can accomodate just about any theme. Don't worry about mistakes, we all make them. That said, if said themes end up leaning towards the adult variety, you have to be over eighteen. Not really something I do a lot, though, so feel free to interact however you like.",
