			["about"] = {
				["T1"] = {
					["TX"] = "{link*https://d.furaffinity.net/art/brownhair798/1619213078/1619213078.brownhair798_tybig.jpg*Art by Brownhair798!}\n {link*https://cdn.discordapp.com/attachments/364454133450932244/808501983887228978/20210208_194643.png*Art by Jazziks!}\n\n(( Super NSFW extremely big parts art twitter on request. ))\n\n\"Sorry toots, can't go any lower. I got mouths to feed too, y'know.\"\n\nHe was a handsome looking goblin. Y'know, one could swear they've seen his face on an advertisement before... Or a magazine? Something or other - Point is, he's had to have had some influence in the past. He was haggling with a customer - Or rather, denying said customer a chance to haggle.\n\nIt'd be hard to argue with him. He had such a confident personality - Such a strong face, chisled features. But of course, it'd probably be even harder to follow up on any sort of argument with him as well. Though he wasnt nessecarily intimidating, on the contrary, quite approachable - but he was LARGE.\n\nTaller than most goblins by a full head, and with a musculature that screamed 'Tiny orc' more than anything else. His limbs were titanically muscular, thick and coiled, rippling with strength. His chest, barely covered by a fashionable mini-vest wit ha few dozen silver strips hanging off the front, hung loosely over a powerful set of pectorals and rock hard abdominals.\n\nA thick set of haunches lead down to powerful calves, barely contained by the tall boots he wore.\n\n\n--------\n\n{h2:c}Recent History{/h2}\n\nFalling in love with one Brynzi Trix has not been an easy path for Tywrecks. From every side, new threats seem to emerge with the intent of dragging down their romance - From self-absorbed rat paladins to legalese spewing cartel leaders - But all it has served to do is drive Tywrecks to the absolute breaking point.\n\nAt some point in the recent days - He has snapped. He has become unhinged - And very dangerous.\n\n\n\n\nHas lately taken up the title of Siegecrafter as he works towards making new machines for his new guild, Rutius Luna.\n\n\n\nMany months of his life memory were erased when a malignant, anima-infused parasite was eradicated from his body.\n\n--------\n\n{h2:r}The Wrecks Entertainography{/h2}\n\n\n{h3}Films{/h3}\n- Rockin Seas;\nA teen drama about an underappreciated musical genius and his heartfelt journey to win a battle of the bands-style competition on a cruise junker, by employing classic goblin ingenuity and a mind controlling musical note. Tywrecks played the tough and nasty bully Biff Tuffscrew, at the age of 17.\n\n- Brake The Law: Origins;\nIn this prequel to the Brake The Law series of 'law' thrillers, Brake Punchlots, Lieutenant of the Undermine Law Enforcement Squad, gets his first ever assignment; RESCUE THE TRADE PRINCE'S PET BOAR. Tywrecks was given the lead roll of a young Brake Punchlots, age 20.\n\n- Shredd;\nA political commentary film criticizing the pro-environment fuel-alternative movement that was growing in goblin society until Gallywix made the statement that there's no money in it, 'So cut dat out.' The film was lazily produced, excessively on the nose, but is seen by some critics as an 'artsy' reel. Tywrecks played a variety of characters that would appear, drop a line of wisdom, and then dissapear in a burst of flames.\n\n\n{h3:r}Advertising{/h3}\n\n- The 'face' of Old Stank spiced body powder, known for staring directly at the target audience and speaking about the product in a fairly provocative and inspiring way.\n-  Poster Model for Scourban Authentic Moth-Chewed Jeans and accessories. \n\n\n{h3}Modeling{/h3}\n\n- Runway Model for Scourban Authentic Moth-Chewed Jeans and accessories.\n- Calendar model for Flickwidth Calendars, (Firegob Edition, Adventurers Edition, and Stay-at-home reasonably-successful Dad edition)\n- Cover model for gaUB~ fashion magazine, as one of the seven xtra-thick and muscular male models they hired for each issue.\n\n{h3:r}Music{/h3}\n\n- Brieft stint as the lead singer of TriBard, was removed after four months due to legal issues and repeated brawls with booking agents.\n\n{h3}Mature Dealings{/h3}\n\n-Several low production values films alongside Tiffaline Twirlytails, a very 'Overenhanced' goblin actress.\n-Several rumors persist that Tywrecks participated in the trials of experimental enhancement procedures...",
				},
