					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\n{h1:c}{col:80FF8E}Korleeza{/col}{/h1}\n\n\n{h2}Appearance.{/h2}\n\nKorleeza's fur is a soft snowy white, her eyes a bright magenta. Her snout is short and stout, akin to her ears. \n\nShe's a little below average height for a vulpera, her body a tad chubby due to her magical prowess not requiring her to get a real workout. Her chest size is rather large, around Double-D's in human cup size.\n\n{h2}Personality.{/h2}\n\nKorleeza is a very sweet and caring vulpera, often going out of her way to talk to or show affection to her fellow race. Expect a touchy, huggy girl if you're a vulpera.\n\n\n{h2}Background.{/h2}",
