					["1"] = {
						["AC"] = true,
						["TI"] = "Honorable Tribute",
						["IC"] = "inv_misc_bonenecklace",
						["TX"] = "The teeth of dragons, fashioned into a necklace, hang around the neck of Kadugg. These are dyed black. A proud insignia!",
					},
					["3"] = {
						["IC"] = "INV_OrderHall_ArmamentUnopened",
						["TI"] = "Weathered Armaments",
						["TX"] = "This Orc is clad in well-used gear. His armor, and weapons, having seen more than a few battles. This does not mean he hasn't looked after them however. Lacking polish and shine there are no faults to be found. \n\nThe same can arguably be said for what few tabards Kadugg may don. As weathered as his armor but mended with stitchwork. From Clan Tabard to that of what those who fought under Hellscream during the civil war wore. \n\n• To note, his armor has been enchanted to better serve him in battle. A common theme with warriors. Perhaps one will notice this and inquire.",
						["AC"] = true,
					},
					["2"] = {
						["IC"] = "INV_misc_wailingbone",
						["TI"] = "Pierced & Mended Tusks",
						["TX"] = "Kadugg's right tusk is adorned with a iron clasp. Symbolic in efforts of mending, or saving, that tusk from breaking off. The other is pierced with a simple hoop near the sharp tip, it too, iron.",
