			},
			["about"] = {
				["vote"] = {
					[2545613221] = 1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-58:64:64}\n\n{h2:c}{col:a60d13}{icon:PVPCurrency-Honor-Horde:25}Kadugg the Red{icon:PVPCurrency-Honor-Horde:25}{/col}{/h2}\n\n\n{col:8d8d8d}From ancient Draenor to modern Azeroth, this Orc has carved his way through many battles, fought in several wars and skirmishes and still thirsts for more. First one to stand, weapon in hand, never hesitant to say he will fight. He has seen the rise and fall of many a Warchief, the complete sundering of lands and countless lives lost. Having stood axe to axe with the toughest, bravest and best men and women of his time, he knows what it means to be a conqueror. Never has he been shy from the hellish gore of warfare, the splintering of wood, shattering of steel, the rivers of blood combined with all of the fire, oil, smoke, screams and more. Such is the reason Kadugg the Red upholds fierce patriotism and traditional values of his kin. Some may see him as overzealous while others raise their axes in howling cheer. Whatever the case may be, he has not, and will not, abandon the ways of his ancestors.\n\nIn current time his appearance can only be called handsome by not of traditional orcish society but true warrior culture. A burly frame marred by extensive scarring, tattooing, piercings and a couple of burns. His face flat, skull broad, nose up-pushed and smushed. A tusk clasped by iron to save, a ring hanging from the septum, ears lined with hoops.  There are at least eight braids of hair, each denoting a feat of strength likely in times of great peril during wartime merriment. The elder smells of a smokehouse and a cologne of slight spice. Like thunder within a chasm, the earth trembles with the old soldier's howl that strikes terrible fear into the hearts and minds of his enemies. As is the same with others of like proclivities when shoulder to shoulder of the mighty Warsong. Though conversationally it is much more tame. \n\nCalled 'Red' or 'the Red', this title issued to Kadugg simply by way of his die-hard loyalism to the Horde and the amount of blood from various species he'd be covered in when battles were done and over.\n\nBlood and Honor, for the Horde!{/col}\n{link*https://www.youtube.com/watch?v=zAhlAy7wl-o*Lok'tar Ogar!}\n\n{img:Interface\\LFGFRAME\\LFGICON-BLACKROCKSPIRE:256:256}\n\n{link*https://www.youtube.com/watch?v=0oEwU3F62no*Adding Heads to the Pile}\n{link*https://abandoforcs.bandcamp.com/album/march-of-the-gore-stained-axe-tribe*March of the Gore-Stained Axe Tribe}\n\n\n\n{col:ff000a}Rumors, Miscellaneous and History:\n\nA guerilla warfare specialist, taught by the Kaldorei over many skirmishes simply by observing. Yet a wolf rider, raider, front line berserker leading charges or flanking the enemy.\n\nAlways holding a respect for his enemy.\n\nOnce killed ten humans in Hillsbrad with his bare hands before savagely beating another five to death with just one of the men's arms.\n\nTurned the tables on a Sayaad and was the one to seduce her.\n\nLet forth a mighty roar that brought about the unconditional surrender of a would be Alliance attack in Pandaria.\n\nDuring intense engagements with Alliance forces in the barren desert, three orcs were carried upon gramp's back to safety. Only one of the wounded survived.\n\nSaid to not have a strict orientation, to quote: \"I am too old to care.\"\nThose with more than one set of genitalia are assumed to be cursed, avoided and shunned. \n\nHas yet to show any grey in his hair despite being an elder warrior.\n\nOpenly uncaring of his dislike and contempt of the youth.. Bold in his stating of position of opinions. The current Horde climate being too soft, too inclusive, too tolerant. Believing many a proud orc are rolling in their graves in angry embarrassment due how the Horde and it's peoples have become.\n\nPrefering logic, reason, honor and tradition over superstition, insanity and stupidity.\n\nFather to many a bastard son and daughter.\n\nAdamant in the belief that all should pull their weight within the Horde. Without purpose, without benefit, there is no place for one within it.\n\nNever struck an enemy in the back. Never struck down an unarmed combatant.\n\nSaid to be impossible to intimidate and die, having fell in glorious combat and awoke in a pile of bodies on the death wagon. Saying that the spirits of his ancestors did not want him just yet.\n\nThat one perpetually grumpy old timer that continues to outlive everybody, carting his giant steel balls around in a wheelbarrow like the equivalent of a fuckin' WWII veteran who stormed Omaha Beach. Having in fact done very similar during many a campaign, including coming through that infamous portal within The Black Morass.\n\nThe most bad ass orc you've never heard of or just a common traditionalist warrior of old. One thing is fact: Kadugg exudes BDE - Big Dad Energy. Still within his prime and not showing a sign of slowing down any time soon.{/col}\n\n",
				},
				["BK"] = 13,
				["v"] = 50,
			},
