			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}{col:7b0fae}Makulah - The Lost Star{/col}{/h1}\n\n{h1:c}{icon:artifactability_balancedruid_moonandstars:25}{/h1}\n\n{h3:c}{col:ffffff}Makulah was raised by her father while her mother was exhiled for holding true to the clan's old ways. As Makulah grew, her father and the Shadowmoon clan taught her how to harness dark power for the Void. She would learn to wield the power to inflict terror and pain against the Draenei.\n\nOver her young adult life on Draenor, she witness the horrors or war as she relunctantly waged her effort in the conflict against the Lightbound. Her innocense dwindled as blood was spilt continuously around her. \n\nWhen Makulah arrived on Azeroth, it took great effort and time to wash away the marks of war left on her. Having adjusted overtime, she began to pull away from the ways she was raised. Makulah now longs for and searches for tales and directions of what the Shadowmoon clan orginally stood for. Following the stars, she hopes to find solace with herself.{/col}{/h3}\n{img:Interface\\QuestionFrame\\answer-SpiresofArakk-ShadowmoonCliffs:512:256}",
