		["0720110200Qu0YM"] = {
			["character"] = {
				["CO"] = "Player is 22.\nPlayer is nice sometimes, character can be an ass!\nWalk ups are loved\nDark RP Enthusiast\n",
				["RP"] = 1,
				["v"] = 22,
				["XP"] = 2,
				["CU"] = "You kinda smell.. like a baka..",
			},
			["time"] = 1630884408,
			["link"] = {
				["Fizzyfire-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}Fizzy Embertwist{/h1}\n\n{img:Interface\\Pictures\\artifactbook-warlock-scepterofsargeras:512:256}\n\n{p:c}The sinister essence of chaotic energy wafts around those brave enough to stick around close quarters with Fizzy Embertwist. A gnome born and raised in Dun Morogh to loving parents who did their best make her upbringing a pleasant one. Unsurprisingly, her life would be anything but. \n\nWhen Fizzy was an infant, she had often become fixated with flames, matches, campfires and any other sort of open flame. One night, in her family home in the dead of winter, she had been put to bed and woken up to a grumbling noise erupting from the fireplace. She had gotten out of bed to slowly creep into the sitting room, fearful of the hazy purple glow emitting in the darkness. And when her head peeked around the corner she was blown back by an aggressive force of energy. She cowered in fear, trembling on the floor until a strange cold presence made itself known to the child. A voidcaller, a creature glowing with a purple hue had stretched it's tendril like hand out to the gnome and hissed at her as if it were trying to speak. This was the first of many rendezvous' the child would have with demons. The voidcaller would be the child's imaginary friend for years to come, until Fizzy was much older. At sixteen years old, Fizzy had become so infatuated with the power the demon imbued, she decided that she needed to satisfy the craving for such dark powers..\n\nToday Fizzy Embertwist studies dark magic with a powerful organization stationed in an unknown location within Northrend. She was picked up as a recruit in Stormwind and began working as an apprentice for a highly knowledgable and yet completely obnoxious warlock, a snobby man who thinks too highly of himself. Fizzy often works alone these days and is currently in the works of being transfered to a new study to complete her orders for clients.\n{/p}\n\n\n{h1:c}Things You Should Read{/h1}\n\n\n{p:c}Fizzy stands at roughly 2'11'' and weighs about as much as a medium sized pet dog. But one shouldn't underestimate her size. She's a fire cracker with a bite much worse than her bark. A spark of wicked and chaotic energy pumping constantly through her veins. She's a trickster who enjoys teasing and bullying the taller folks, and uses her bold and yet mysteriously beautiful looks to lure in potential clients and companions.  She's a friendly spirit though, when she's decided upon being friendly that is. If you're on her good side you are likely an ally, a strong business partner, or maybe a love interest. Though the latter is rare. Who would love a psycho like her? Only the brave. And unluckily, the world is anything but brave. Her eyes and hair are stained with a very unnatural vibrant purple wash. To no fault of her own, she stands out due to this phenomenon, but you shouldn't ask her about it, or do.. It's your funeral after all.\n{/p}",
				},
