					["3"] = {
						["AC"] = true,
						["TI"] = "Monk",
						["TX"] = "Kylaria is trained to fight either with light armor or no armor at all; she is just as deadly nude as she is in armor.\n\nShe does not wear gloves or pauldrons, carries a staff, and like other vulpera she lacks footware.",
						["IC"] = "ability_monk_dpsstance",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Well-Groomed",
						["TX"] = "Kylaria's coat of fur is bright and healthy. Her claws are trimmed short, her teeth are brushed, and her ears are always cleaned.\n\nShe takes proper care of herself, and if touched her fur is silky soft to the touch.",
						["IC"] = "inv_misc_comb_02",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "OOC Information",
						["TX"] = "I am fine with ERP roleplays as long as there's some kind of RP lead-up to it. And only with other vulpera--I do not engage in such with any other race, it doesn't matter how much you ask.\n\nThere is only a certain amount of custom lore that I will accept; saying you are related to a lore character (distant or not) is tolerable by me depending on how you do it, however saying you're from an entirely different kingdom, land or continent not present on Azeroth will likely cause my character to regard you as crazy and not take you seriously as I do not accept such lore.\n\nThis character does not enter the Shadowlands and is not a Maw-Walker and she will never enter the afterlife regions--even through the Death Knight portal in the city.\n\nI prefer dice battles in RP fights unless I trust or know the other person very well.\n\nI am accepting of all genders/races within the WoW lore, though bare in mind there are no androids or cyborg races in the lore. Robots in WoW tend to be fully mechanical as there has been no reference to androids in the lore anywhere (you are free to disprove them to me with evidence!)\n\nIf I don't like how you regard lore then I simply won't interact with you, but I won't try to educate you on why your character is stupid like elitists would.\n\nLack of proper spelling/punctuation can cause me to lose interest in RPing with you. Dyslexia is fine, just let me know beforehand you are dyslexic somehow!\n\nI am overall friendly with other players and I'm willing to help with advice on pretty much anything. If you need help? Ask!",
						["IC"] = "inv_misc_questionmark",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Horde-Aligned",
						["TX"] = "Kylaria is a member of the Horde.\n\nShe carries a Horde symbol badge on her belt on the side.",
						["IC"] = "inv_cape_battlepvps1_d_01_horde",
					},
				},
				["v"] = 18,
			},
			["link"] = {
				["Kylaria-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "inv_herbalism_70_foxflower",
						["BK"] = 7,
						["TX"] = "A female vulpera whom is youthful in appearance.\n\nShe is covered in chestnut brown fur with yellow-white underbelly colorings as well as dark brown stripes overtop her coat; her coat of fur glistens in the light, showing it is healthy and cleaned.\n\nShe has black pads on her palms and undersides of her pawed feet, trimmed black claws on her fingertips and toetips, and her tail is fluffy. If touched her coat is extremely soft.\n\nShe is adorned in loose-fitting leather armor which is a combination of both casual clothing and armor. She wears a rope belt with a pawprint on it. Her only 'weapon' is that of a staff with a pandaren gourd hanging from one end. She does not wear gloves, pauldrons or has a shirt on underneath her chest armor. She prefers to keep her cleavage exposed.\n\nHer eyes are bright green in hue. Her voice is soft and pleasant to the ears, though a bit higher pitched than a typical female vulpera. She has a horde symbol badge attached to the side of her rope belt.",
					},
					["PS"] = {
						["IC"] = "ability_racial_nosefortrouble",
						["BK"] = 7,
						["TX"] = "Even amongst the vulpera of Vol'dun she was known for having a bit of a hyperactive state for more sexual encounters with other vulpera.\n\nAn overly friendly Vulpera whom is quite polite and proper with other folks; she does not like to barge in on others' conversations and will generally wait until being included by others or when approached as she rarely approaches others first.\n\nShe is both honest and blunt to others and herself; dressing how she likes and speaking her mind on anything being talked about. She rather enjoys getting into relationships with other vulpera (usually males) and will often stick to the one until it either blossoms or collapses, though at present she has no ongoing relationships. She is only attracted to other vulpera and not to any other race!\n\nShe enjoys the company of tauren, orcs, some elves, and pandaren over others. She does not like humans or anyone from the Alliance or 7th Legion.",
					},
					["HI"] = {
						["IC"] = "inv_inscription_80_contract_vulpera",
						["BK"] = 7,
						["TX"] = "Once a member of Zana's Caravan; Kylaria was one of those whom would aid in digging the dunes for water to help refill their stores between trips across the deserts of Vol'dun, along with several others. Though Zana's Caravan were not very well known, they were a caravan that often traveled between the Terrace of the Devoted and the Exile Camps trading fresh water for food or protection or favors.\n\nZana's Caravan was one of those targeted by the 7th Legion during the Fourth Great War, though the Caravan Guards managed to kill or drive off the 7th Legionnaires before any lasting damage could be done; the attack did, however, impart into Kylaria an extreme hatred for the Alliance and the 7th Legion in particular despite their caravan never working with the Horde.\n\nThis action pushed Zana into bringing her caravan to Orgrimmar alongside Kiro as they joined the Horde at the same time as the others had. She was never a combatant and so she ventured to Pandaria through Orgrimmar's portals as she made her way to Kun-Lai Summit where she sought a trainer in the TEmple of the White Tiger.. as she sought to be trained in the arts of the monk.\n\nNow with the Fourth War over, Sylvannas' betrayal evident, and now with the Champions elsewhere; Kylaria spends her time idling around in Orgrimmar when not out and about fighting enemies of the Horde or training with her instructors at the Temple of the White Tiger.\n\nShe is actively on the look-out for a male vulpera to raise a family with, though she has yet to find any worth her time.",
					},
				},
