					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Rain:512:128}\n{link*https://cdn.discordapp.com/attachments/810017671734099988/810017731432153168/514303_6a.png*Lexx}\n{p:c}{col:7cd3d8}Physical Description\n\n{icon:ability_deathknight_remorselesswinters2:25}\n\nLexx’s wave of violet  locks trail down the small of her back.\n\nEyes almond in shape, the blue of her kind though she swears they are teal.\n\nShe wears an exagerated cat eye liner with blue and black smokey eye.\n\nLips stained with literal blood.....always set in a sly smile.\n\nWhen talking you may catch a flash of her red heart shaped tongue ring.\n\nDue to years of maintaining her training her body is slender yet toned.\n\nHer hips are home to two folded fighting fans when unfurled hidden blades\nprotrude out. A chain hangs on the hilt of the fan with an ornate charm on the end. \nThese can be fastned to her wrist to prevent them from being knocked out of her hand.\n\nHidden under her handwraps is a barbed Kunai attached to a chain on her wrist.\n{/p}\n\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-UmbrellaofChiJi:512:256}\n\n{p:c}{col:7cd3d8}Personality\n{icon:inv_inscription_tarot_tsunamicard:25} No Filter, Says whatever she wants.\n{icon:spell_misc_emotionhappy:25} Jokester, Why so serious?\n{icon:spell_holy_silence:25} Foul Mouthed, Maker of Insults\n{icon:spell_shadow_soothingkiss:25} Sassmaster\n\n{/p}\n\n{icon:inv_misc_matchbook:25} *History is to be rped out. I don't believe in putting it in a profile often times people read it and somehow dere character \"randomly\" brings something up in it.*\n\n\n\n",
				},
