					["1"] = {
						["IC"] = "achievements_zone_highmountain",
						["TI"] = "Built for the Mountains",
						["TX"] = "Konado is, rather obviously, a Highmountain-born Tauren. His fur is thick, warm, and more than a little shaggy, though perfecty well kept (Save being more than a little unruly).\n\nSomewhat atypical for his kin, though, his form is a little more on the slender side. Though he's tall, his muscles don't quite bulge like some of his kind. Rather, he seems built for speed, insofar as a Tauren can be, and though lean his musclature clearly shows efficent power.",
						["AC"] = true,
					},
					["3"] = {
						["IC"] = "inv_armor_tauren_d_01shoulder",
						["TI"] = "The Eagle and the Rider",
						["TX"] = "Though easily mistaken for just a simple warrior, upon closer inspection one begins to notice hints at this Tauren's more druidic leanings. A braid in his hair ends in a little carved eagle totem, and several other charms and feathers decorate his armor and shaggy fur. If one has a sense for these things, they can feel a noticable pull of natural magic.\n\nThis becomes very obvious when he's in his preferred shapeshift form - a large, equally decorated eagle.",
						["AC"] = true,
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Brave",
						["TX"] = "This Tauren is, or at least was once, a Brave - a warrior of his tribe. His armor is simple and well-worn, protecting little and weighing even less. Made of hardened leathers and hides, it seems more intended to protect his forearms and legs, leaving his whole upper body free and unimpeded for ease of movement.\n\nAs such, the tauren is also not without his fair share of scars, though his shaggy fur does well to hide most of them. Here and there, though, his fur parts and reveals knotted and healed scar tissue, trophies of battles past.",
						["IC"] = "inv_archaeology_70_tauren_drum",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "birb",
						["TX"] = "birb",
						["IC"] = "ability_garrison_orangebird",
					},
					["4"] = {
						["IC"] = "inv_archaeology_70_tauren_stonewoodbow",
						["TI"] = "Bow and Spear",
						["TX"] = "Despite his Druidic hints, Konado seems to prefer less natural weapons. Two, in fact, hang across his back most of the time. The first is an old but well-cared for spear, typical of the Eagle Riders of the Skyhorn tribe. Decorated lovingly in feathers and trophies, the blade appears quite well honed despite seeing it's share of battles.\n\nAlso slung over his other shoulder is a hunting bow, along with a quiver of arrows at his hip. Not quite as decorated, the bow seems less a weapon of war and more the kind to bring down large game. Though, made by a Tauren, even a 'light' hunting bow poses a signifigant threat in a pinch.",
