		["0306233340ajM3x"] = {
			["character"] = {
				["CU"] = "Extremely confused and irritated.\n\n[Glowy jewelry is not IC]\n[Man this profile needs to be updated.]\n",
				["CO"] = "Walk-ups loved.\nIC =/= OOC.\nLGBTQ+ Friendly!\n\n\n\nI can sometimes misinterpret things. I might need clarification at times.\n",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 1,
				["v"] = 94,
			},
			["time"] = 1631093550,
			["zone"] = "Orgrimmar",
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1:c}Things!{/h1}\n\n{link*https://cdn.discordapp.com/attachments/830692239445327872/832987127318446110/VinderiFinNOBG.png*Gifted art by Nigel.}",
						["BK"] = 2,
					}, -- [1]
					{
						["TX"] = "{h1:c}{col:79ffa1}History{/col}{/h1}\n{p:c}As with most Vulpera, Vinderi spent the majority of his early life travelling the vast dunes of Vol'dun with his caravan. Vinderi's caravan were a fortunate lot, being able to consistently avoid the Faithless among other threats due to their sporadic travel routes.\n\nThis luck wouldn't last forever though, on one evening, several Faithless Sethrak caught the caravan off-guard. Panicking, Vinderi loosed one of the alpaca and fled into the desert. Vinderi couldn't navigate the dunes on his own however, quickly succumbing to dehydration and passed out after three days of aimless wandering. Fortunately, he was soon discovered by a small group of Devoted Sethrak who took him to the Sanctuary of the Devoted and aided his recovery.\n\nIt was there that Vinderi learned of the Vulpera allying themselves with the Horde. Seeing it as a chance to make something of himself, he promptly made the journey to Orgrimmar once he had recovered.\n{/p}",
						["BK"] = 4,
						["IC"] = "inv_scroll_16",
					}, -- [2]
					{
						["TX"] = "{h1:c}{col:79ffa1}Personality{/col}{/h1}\n{p:c}Brief interactions with Vinderi might lead most people to believe he is simply a moronic, but kind hearted individual, often lending his aid to anyone who asks.{/p}\n\n{p:c}Once Vinderi has gotten to know someone, he will often consider them a genuine friend and will go out of his way to help them to the best of his ability. Most would also find that Vinderi is trusting to an absurd degree, often placing his full trust in those who might not deserve it. {/p}",
						["BK"] = 4,
						["IC"] = "ability_racial_nosefortrouble",
					}, -- [3]
					{
						["TX"] = "{h1:c}{col:79ffa1}OOC{/col}{/h1}\n{p:c}\n{col:00ff32}- Player is fairly new to RP and the game, started playing at the start of Shadowlands and started RPing in early March. So be aware I might make some mistakes in regards to lore and such.\n\n- I really enjoy walk-ups, go for it!\n\n- My grammar isn't the best. Sorry.\n\n- IC does not equal OOC. \n\n- No ERP.\n\n- Pls do not try and romance the coward fox.\n {/col}{/p}\n\n",
						["BK"] = 4,
						["IC"] = "tracking_warboard",
					}, -- [4]
				},
				["BK"] = 7,
				["TE"] = 2,
				["v"] = 12,
