			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Her hair appears to be purposefully kept short, often nicked at odd angles. A small flower is often seen there, if she's able to find one fresh in bloom.\n\nHer body stays the rotund pandaren physic that they are proud of. Black and white fur kept perfectly in line in their natural paterns save for below her eye, a scar barely hidden by newly grown fur etched down well past her neck and beneath her clothing.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Overall jovial, patient monk. She is quick to allow people to join her in drink and sharing stories, but rarely prompts so for herself.\n\nIs afflicted with the so-called 'wanderlust' pandaren from the homeland describe for their adventurous kindred.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Born and raised on the fabled Wandering Isle, Sei spent her youth attending Shang Xi's Academy. Alongside with her sister, she studied and learned the martial teachings passed down from generation to generation. Life would have been simple if the Horde and Alliance did not crash land.\n\nForced to make a choice, Sei could only follow along her sister who joined the Horde. Escorted 'tenderly' into the 'welcoming' arms of Warchief Hellscream, she is soon whisked to different parts of Kalimdor, participating in proving her people's strength to their newfound allies. \n\nWhispers of a land shrouded in mists soon reached her ears, and surely it could only have been tales of her ancestral homeland. Chartering a course alongside the soonest expedition to this newfound landmass, the monk was quick to go AWOL and explore in fervant wonder.",
						["BK"] = 1,
					},
