						["IC"] = "inv_mace_1h_artifactdoomhammer_d_02",
						["TX"] = "He will be seen with either have  a hammer and axe, or hammer and shield. The runes on his hammer read \"Thunderfrost\", all his weapons spark with lightenting.",
