					["5"] = {
						["AC"] = true,
						["TI"] = "Scarification Runes",
						["IC"] = "trade_archaeology_silverdagger",
						["TX"] = "Both forearms have scarification runes. On his right a jagged rune for \"Sacrifice\" ornates the flesh. On the left the runes \"Wolf\" and \"Love\" are more streamlined but less complex. All the runes are highlighted white with white tattoo around the scarred runes.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "War Totems",
						["IC"] = "misc_drogbartotem01",
						["TX"] = "He wears a totem war harness on his back. Both are carved with Orcish runes and elemental runes. On the top of both are carved wolf heads.",
					},
