				["v"] = 35,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\Arch-TempRareSketch:512:256}\n{p:c}Dralgur was born in Wor'gol Frostridge in the Frostwolves Clan (AU Dreanor). His parents Drekitesh and Gaz'kase Grimfang were both warriors for the clan. They instilled honor and strong ties with other clan members. His father pushed for his training to be a warrior at a young age. When he is not playing with the other childern, was training with his father.{/p}\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-DraenorOrc:512:256}\n\n{p:c}Dralgur is a full grown Mag'har orc. Standing a few inches taller then the standrd orc. He has tattoos adoring his scared skin, on both his outer biceps is the Frostwolf Clan insignia. Due to the heavy training that his parents put him though, he his fairly strong. At most time, if he is a group he would listen and watch everyone. Thats is his way of trying to know who you are, if you speak to him he will talk to you. {/p}\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-AncientShamanHeaddress:512:256}\n\n{p:c}During the last few days on Draenor will on patrol for any Lighbound. He came across a elemental that called for his aid. He helped free the elemental and was gifted some of its powers. Unknowing how how to weild such power, the elemental told him to seek out a certain Farseer. After going through the portal at Beastwatch. Dralgur went to seek out this Farseer along with his best friend.\n\nHaving found a place a he could call home and the Farseer he was told to seek out. He begain his path to Shamanism, training each day to prgress his body and mind. He would try to commune with the elements as well and strenghen his connection to them. He forms strong ties with those that he connects with and fiercely loyal to them, while also being very protective of them as well for the Elements. For most time he was favored duel one handed axes, but later favored a hammer and shield or hammer and axe. When on patrol you will always see him scanning the horizon for any threats, he would also stay in the back of the pack. Watching everyone in front of him, when in battle he would pay close attention to his battle mates. He would be often seen running toward to aid one and blocking blows not for him. After he would tend to everyone that was injuried even before himself. If he is order to do something from his upper command he will follow it as long as it is good intentions or goes along with what he follows. When he is in relaxed state you can always find him working on a new carving or totem. He is always willing to lend a ear to either to talk or if you have a problem. He often somtimes speaks words of wisdom when someone is need of it, and encourge them to be better then what they are. He would also go out of his and help anyone that is need.{/p}\n\nOCC\n{link*https://imgur.com/gallery/cN6iVuf*Art of Dralgur}",
