						["TX"] = "{link*https://imgur.com/a/kKeNbF8*SFW Art}\n\nJust because Incubi and Succubi tend to naturally look great doesn't mean that Cain neglects to put in the work to go the extra mile! He tries his best to take care of himself and the effort really shows!\n\nHis short, brown hair was usually bedraggled but still remained in an 'organized mess' atop his head between his horns. His handsome features were typically pulled into a wicked grin with his fel emerald eyes alight with playful intent at those around him.\n\nHe loved doing the work of a bodybuilder and it showed! Just about every muscle on his body seemed to be as thick as a tree trunk! Those chorded muscles had what seemed like every single vein popping from his tan flesh to be on display for the world to see. He put a lot of work in honing his musculature and he'd be damned if he was gonna hide it from the world!\n\nThe same went for his legs if not doubly so! Cain loved leg day more then anything so it was pretty clear that he had a pair of thighs that could squish a watermelon! Oddly enough, despite being an Incubus he had no hooves! Actually, he didn't have a tail or wings either, ain't that just a hoot?\n\n",
