				["T2"] = {
					{
						["TX"] = "{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-BlackrockFoundry:256:128}\n{h1:c}{col:ff2008}Appearance{/col}{/h1}\n{p:c}Ria is an orc of below average height (if you want to call them that), and a bit above average weight. They have the appearance of your average blackrock orc, however they always seem to be disheveled and have bags under their eyes. They keep their messy hair held back in a ponytail.\n\n\nRia is often seen wearing black safety glasses... They claim it's for incase something bad goes wrong when doing repairs or making bombs, but in reality, it's just to help hide their tiredness. When not working at the Darkmoon Faire or doing repairs, they dress more casually. They usually wear armor or clothes that are easy to move around in... or armor that's comfortable enough for them to fall asleep in, since they do that... a lot.\n\n\nThey have a feminine frame.{/p}\n{h2:c}History{/h2}\nRia was born to Grek'nag and Droka Bloodburner, an infamous couple of orcs known for their interest in siege engines and bomb making. They were taught their craft by their parents, and fellow clan members... which is also how they got their name, Dreamburner-- It was meant to make fun of their habit of sleeping on the job all the time.\n\nThey don't particularly share any information about themself beyond that, though maybe you could pry it out of them with a few drinks if you managed to befriend them...\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-BlackrockFoundryAssembly:256:128}\n{h2:c}{col:ff8e3c}You may know them if...{/col}{/h2}\n{p:c}- You frequent the darkmoon faire often\n- You assisted in Draenor.\n\nFeel free to recognize them without my permission. {/p}",
