					["TX"] = "Classic dyed hair, depressed G-girl.\n\nHair done up in a bun, well groomed, dyed grey. Finely trimmed and shaped eyebrows with a natural brown color. Make-up from eye-liner, eye-shadow, contor, painted stars on the right cheek, all the way to a bland lipstick. She's vanity at it's height. \n\nTorso fit and thick from pecks to abs, small c-cup breasts all packed into some hard leather armor or a loose shirt. Corroded metal arms and legs with plenty of fine care put into cleaning some areas from general maintenance. \n\nA minimalist design to her limbs, favoring a lighter build, clamps for grabbers.\n\n\nA citizen of Gadgetzan for most of her life, followed by mechanization, finishing with monk teachings. She devotes her life to a peaceful and neutral lifestyle. \n\nShe's a Tiger Style Windwalker Monk with an intimidating style of putting her limbs in harm's way. She's been known to tear off a broken limb to use as a weapon in dire combat.",
