						["IC"] = "Achievement_Faction_Elders",
						["TX"] = "Whether it's the graying fur or the feathered brow, one might first regard this pandaren to be a rather aged fellow. Despite it, he's maintained a robust, rounded figure and an imposingly sturdy frame. No sagginess or slouching here!",
