						["TI"] = "Ancestral Charm",
						["AC"] = true,
						["TX"] = "A weathered, silken ribbon of a bright red hue could often be seen around his neck which bears a numismatic coin. Enveloping its center are four inscriptions: The emperor's bell, a burning flame, a paw print, and the Pandaren symbol for the family name 'Zhu'.",
