			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Windy:512:128}\n\n{h1:c}{col:e5cc7f}Master Fist{/col}{/h1}\n{h3:c}{col:ffffff}\"Strong mind, strong body.\"{/col}{/h3}\n\n{img:Interface\\Pictures\\artifactbook-monk-cover:256:256}\n\n{h2:c}Appearance{/h2}{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{col:ffffff} Hearty and solid, robust and muscular, Master Fist seeks to stand a testament to the ideal Pandaren monk's physique no matter how many seasons are under his belt. Embodying all the stout qualities typical of a male of his kin, this elder Pandaren should appear to be just as formidable in taking down even the greatest foes as he is in taking down a feast! However, the signs of aging have become considerably more noticeable throughout the years; where once his leathery hide was coated in silky black fur, it now adorns a silvery and snowy white hue.{/col}\n\n{col:ffffff} Nevertheless, the old bear would appear not to have slowed down in his age! Whether it's the neck, biceps, legs, or any other muscle, plenty of well-toned brawn should be evident in even a cursory inspection. And judging by the scars mottling his burly frame (particularly so at the knuckles), he's no stranger to utilizing his daunting physique. An apparent lack of distiguishing marks, lacerations, or other such bodily damages may tell that he generally makes it out of the fray fairly unscathed, much to the dismay of his countless opponents throughout the years.{/col}\n\n{img:Interface\\QuestionFrame\\answer-zone-MistsofPandaria:256:128}\n\n{h2:c}{col:ffffff}External Links{/col}{/h2}{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h3:c}{link*https://twitter.com/jikai1992*Twitter}{/h3}\n\n{h3:c}{link*https://imgur.com/a/2EcQ27O*Character Art Gallery}{/h3}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-91:64:64}",
