					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Sentinel Rank & Pendant",
						["IC"] = "inv_feather_13",
						["TX"] = "Her feathers noting her as that of Huntress rank hang from the thin leather choker around her neck. They sit alongside a crescent moon pendant encasing a moonstone.",
					},
				},
				["ST"] = {
					["1"] = 0,
					["3"] = 0,
					["2"] = 0,
					["5"] = 0,
					["4"] = 0,
					["6"] = 0,
				},
				["v"] = 12,
			},
			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "inv_misc_tournaments_tabard_nightelf",
						["BK"] = 1,
						["TX"] = "{col:6151FF}She has an unusually pale complexion that starkly contrasts her waist-length dusky blue hair; which, when not tied up in a helm, flows freely down her back. Although she is of average height, she is often considered a small figure for her race due to being skinner and slighter of build.\n\nShe bears the “Serpent” facial tattoos; a single line curving down across each of her eyes and cheeks. They signify her path as a huntress: stalking and striking her prey swiftly, silently and with lethal precision. \n\nThe only visible scars she has to speak of are three long, jagged claw marks running from her right shoulder to the center of her back; though they are typically hidden by her armor.\n\nHaving a proficiency in leatherworking, she is generally wearing leather armor reinforced with sections of mail armor and dyed in dark greys and blacks so as to better blend in with the shadows. She is quite skilled with a bow, and as such, is rarely seen without one; although she does keep a small dagger strapped to her belt for skinning animal hides and emergency defense situations.\n\nThe only non-combat adornments she wears are several small silver rings pierced through her ear lobes and the tips of her ears; as well as a thin leather choker around her neck. It has a small metal pendant shaped like a feathery wing hanging from a chain interwoven through it.\n\nThe talon of her former hippogryph, Sagewing, hangs from her belt. Her current one, Windsong, can often be seen following her around.{/col}\n",
					},
					["PS"] = {
						["IC"] = "ability_stealth",
						["BK"] = 1,
						["TX"] = "{col:6151FF}Alesterra is an extremely quiet individual to those that don't know her. Having been alone most of her life, she is accustomed to solitude, prefers to keep to herself and becomes rather anxious around larger groups of people.\n\nShe is usually found off on the edge of or some distance away from the group; preferring to observe and listen and rarely speaking without first being addressed.\n\nThose that do know her often comment on her snarky, sarcastic and sometimes teasing behavior.\n\nThough most of her skills are self-taught through determination and countless hours of practice, she is constantly striving to better her talents, especially in the case of her combat skills. She keeps her expectations of herself at high levels akin to perfection, and, as a result, can be easily frustrated when faced with even the slightest of failures.\n\nAlthough not one to give up quickly, she has a tendency to dwell on her failures and will even down-play her successes.\n\nAs her mate would describe her: \"Smart, but impulsive, which sometimes leads to shitty decisions or choice of words despite knowing better. Hard working when she wants to be, and more often is, but at times hard to motivate if the topic or task doesn't interest her. Headstrong, confident, will hold her ground when faced with adversity and usually knows what she wants; although these things can backfire due to having a bit of a short temper, moreso if she's passionate about it. Most of all, she's creative and likes to do things in a different manner than most would think to do.\"{/col}\n",
					},
					["HI"] = {
						["IC"] = "inv_archaeology_80_witch_book",
						["BK"] = 1,
						["TX"] = "{col:6151FF}Hailing from the snowy, mountainous region of Winterspring, Alesterra Duskrunner is no stranger to harsh conditions. Born in Starfall Village to the northwest of the primary trade town, Everlook, she spent much of her childhood learning how to be self-sufficient in order to survive in the unforgiving territory plagued by a nearly perpetual winter. Although she at first considered becoming a priestess of Elune, she quickly revealed a particular knack for abilities such as tracking, hunting and setting traps. Eventually, she even started to show an aptitude for working with and taming animals, which she often used to her advantage during hunts and skirmishes with hostile creatures.\n\nHer mother abandoned her when she was hardly more than a toddler and she, in turn, barely remembers her. Her father, Elrandir, raised her alone, with some occasional support from the other residents of the village. As an expert craftsman in a couple different trades, he trained Alesterra primarily in the art of leatherworking, which she took to rather swiftly.\n\nWhen she was barely more than a century old, one of the local hunters returned to the village with grave news for her. Her father, having departed several days before on his yearly trip to Everlook, had been forced to detour through the wilderness due to especially nasty weather. The severe winds eventually forced him to take shelter in a cave where he was ambushed by a rogue yeti and mauled to death.\n\nHaving been rather close to her father, the news devastated Alesterra to the point that she immediately set off to exact revenge. The spent over a week tracking the yeti until she finally found it a few miles from Everlook. In a blind rage, she attacked the creature head on. She managed to defeat it, but it was a victory that nearly cost her her life. During the battle, the yeti had left deep gouges in her back that would have caused her to bleed to death. However, due to a sheer stroke of luck, a Priestess of Elune found her and brought her to her camp, where she cleaned her wounds and cared for her for a couple of days. Although grateful for the priestess’s help, she was so consumed by her grief that she barely acknowledged her presence most of the time.\n\nWhen she was finally well enough to journey on her own again, she thanked her and quickly set off without another word. Instead of returning to her village, however, she became a wanderer for a short while. She quickly established a circuit running all around northern Kalimdor as a leatherworking trader: one of the many things her father had taught her. Though she desired the path of the priestess like the one that had saved her, she instead settled for this simple traveling lifestyle for a few centuries.\n\nBut eventually, she ran into a cadre of Sentinels and was immediately impressed by them. Seeing a bigger, better purpose, she joined their ranks and from then on  vowed to do whatever was necessary to protect and help others in any way she could, even if only to try to shield them from feeling the type of loss and despair that always lingers within her.{/col}\n",
					},
				},
