			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Annaliese in a glance is no more interesting than any other human. She stands at 5'6\" tall and is rather muscular. Often wearing full sets of plate in the field and lighter sets within the city. \n\nPale skin is always a bit red in the cheeks, with her red curly hair held back in a ponytail or bun depending on the day, loose pieces framing her face neatly. Her skin is covered in freckles-especially across her cheeks and nose. But her eyes would be her most striking feature.\n\nHer eyes are two different colours-not immediately noticeable if one isn't looking at her at a close distance. Her right is a light greyish sky blue and the left is a jade green, sometimes hidden slightly behind thin framed glasses used for reading. \n\nNear the right side of her forehead, hidden by the strands of her hair is an old scar from a severe head injury. \n",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Annaliese tends to be rather quiet and stern. Her expression shifts are subtle despite the consatnt flush to her cheeks. She rarely seems embarassed or flustered or bothered much by anything at all.\n\nSome would often consider her rather standoffish, perhaps a touch cold. In reality, she is merely a very pragmatic and level headed individual. A dry sense of humour laces her words though sometimes goes unnoticed by others.\n\nAnna is a very kind hearted individual, hardened perhaps by things she's seen. But not completely closed off. Merely aware of patterns and behaviours. ",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "(rp for the whole story)\n\nRp hooks:\n\nAnna runs a small pop up clinic within Stormwind for anyone seeking medical treatment.\n\nAnna did train briefly as a paladin/Priest however she didn't devote herself to either order completely, instead learning how to heal using the light and then expanding her knowledge of healing into other schools as well. She is a known part time field medic for the alliance Navy. \n\nIf you lived near Stratholme in your younger years, you may have enountered her, however briefly. \n\n",
