						["TX"] = "Those familiar with chi energy should be able to sense there's plenty of that within his being.",
						["AC"] = true,
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Dog Tags",
						["TX"] = "Around his neck on a thinly long chain are two small iron tags for identification purposes tucked underneath whatever he is wearing. Whether Cauric had these made, or they were given to him is something he doesn't disclose even when asked. If one were able to snatch them to read, they'd see the following engraved text:\n-\nCauric\nSilvermoon City\nQuel'Thalas",
