					["5"] = {
						["AC"] = true,
						["TI"] = "Scent",
						["TX"] = "Once close enough to have his personal space invaded, he possesses a scent that can only be described as freshly cut pine - with the likely source coming from the specific aroma of cleaning soap he chooses to wash with.",
						["IC"] = "Achievement_Zone_Silverpine_01",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Hand Wraps",
						["TX"] = "One can see when Cauric's plate-armored gloves are removed that there is hand wrappings around his fists. Said wrappings aren't very remarkable on their own. Being a dull color and little else other than extra protection.",
						["IC"] = "INV_Hand_1H_PanStart_A_01",
