				["v"] = 80,
			},
			["about"] = {
				["vote"] = {
					[2690122329] = 1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Appearance:\nCauric is a man of rugged appearance, reflecting his brash personality and career choice as a professional soldier. He sports an extremely muscular build when out of his armor, a tanned complexion, and is of above average height for a blood elven male. His short hair is considerably blond, whilst seemingly prone to naturally spike upwards on it's own. His actual eyes are hidden behind a glowing haze akin to any other Thalassian elf from Quel'Thalas, masking what color his pupils might be otherwise.\n\nFeatures portray him as someone who's been through much in his life, leaving his face hardened as a result. On first glance his firm lips are usually tilted downwards in a slight frown, both brows are oft narrowed near permanently and an alert gaze glares about in constant suspicion driven by his past experiences. This facial presentation is what others could easily deem as a blatant scowl in simpler terms. Though quite a few whom choose to interact with the warrior could possibly judge this display as forthcoming enough to approach.\n\nWithout his plate armor, the blood elven fighter has an incredibly refined physique that's entirely due to his innate fitness mixed alongside lifestyle choices such as strict dieting and his decision to spend several hours training on a daily basis. Said training regiment is what gave his muscles their noticeably tempered appearance, the sin'dorei appearing akin to a statue carved from stone with the simplest of motions regularly causing involuntary flexing.\n\nUnfortunately, there's visible scars that mark his flesh. Dagger given blemishes dot his arms and shoulders in a sadistic pattern from what is most certainly the assumed conjecture of him being put through an unwanted torture session for an indeterminable amount of time. Without a shirt on, there is also three prominent scars in the shape of a large animal's claw across his chest and another set down his back. When questioned about this - Cauric will claim he received it from slaying a ferocious bear without weapons and armor.\n\nPersonality: \nThis particular elven man comes across as clumsily heroic and very protective of those he cares about. Even so, he is actually not very bright (but has on a rare occassion shown some cunning and strategy when a situation deems it necessary). He ostensibly fancies himself as an intelligent man, despite his personality traits implying that he overestimates his actual prowess in comprehension. Much, entirely too much, to his own chagrin.\n\nIndeed Cauric truly has a wild, rowdy personality and is always on the lookout for a good fight in contrast to his claims about committing 'Justice's Will'. Still in spite of this reckless nature, the sin'dorei harbors a sense of loyalty to those close to him and acknowledges the value of friendship if asked. Regretfully, only a rare few can see past his rough exterior and somehow manage to fully befriend or earn his respect. With this comes his strong dislike at the idea of being used by someone else, or worse, becoming the victim of betrayl. When this situation happens, he immediately focuses on blatant attempts to get even with those who he considers as having double-crossed him.\n\nWith all the above personality traits in consideration; 'The Pillar of Justice' is normally impulsive, needlessly hostile, immensely loud and swift to leap into action without contemplating any possible risks. As a consequence he frequently comes across as brash, judgemental and exceedingly prideful to everyone else around his person. Furthermore, these same character traits has landed him in lots of trouble far too many times to be counted. However, he is truly dedicated to doing good at his core while oftentimes proving to be a steadfast ally who's willing to help out when called upon.\n\nHis methods, attitude and general demeanor isn't any where close to socially normal in terms of sin'dorei society as a result. Cauric struggles to understand simple social concepts, and can be quite slow at picking up things that'd be obvious to a majority. It doesn't exactly help this elf seems to have a decidedly defined term of 'JUSTICE' he genuinely follows to an obsessive degree. Using this appointed set of beliefs to sometimes attempt forcing his opinionated sense of decency on various Horde members. Of course with the predictable results that this distinctive mannerism is generally not appreciated at all - especially when their business is interrupted by his apparent nosiness and paranoia.\n\nOne of his most defining traits is a stubborn desire to never surrender on these 'righteous' ideals. Outright refusing to back down from any mental, emotional, social or physical challenge on these views when provoked. Depending on the current situation; it is Cauric upsetting any opposing viewpoints that makes daring attempts to point out flaws in his mindset with markedly shallow insults. This response, naturally, has nearly ended his life many times since he rather foolishly engages in such activities around remorseless criminals dwelling with Murder Row. Regardless, it has yet to completely dampen his spirit.",
				},
