					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\n{h3}{col:5047c0}To get here took its time\nI forgot to make a life\nBetween the scripted ones I knew--{/col}{/h3}\n\n{h3:r}{col:794cff}When admiration grew\n I was only loved by few\nMy true love and passion, nobody knew.{/col}{/h3}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-93:64:64}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n{h2:c}You may know Narcoss if...{/h2}\n\n{col:93a6ff}- You're part of the Hearthstone scene.\n\n- You're affiliated with the deeper parts of SI:7.\n\n- You're actively affiliated with the Forsaken.{/col}\n\n{h3:c} {link*https://imgur.com/a/uAwIjBv*Art Album}- {link*https://imgur.com/a/B962HlO*True Identity (Spoiler)} - {link*https://www.youtube.com/watch?v=Rzt0MfhFyrw*Voice Claim Video} {/h3}\n\n{h2:c}The Stranger's Poisons:{/h2}\n\nThe Stranger may have one poison applied to him at a time.\n\n{icon:ability_rogue_deviouspoisons:25} {col:2adc26}[Rigor Mortis]{/col}\n\nA potent poison that gradually courses through the veins at each movement. The site where the poison was applied will slowly paralyze until entering a rigid state.\n\n{icon:spell_nature_slowpoison:25}{col:8c8c8c}[The Experience]{/col}\n\nA custom poison. Crafted for use against Light wielders, it courses an unholy venom through the veins. Light users afflicted with the poison will be filled with a crippling pain when casting, the Light reacting to the blood as it would a creature of undeath.\n\n{icon:inv_potiond_6:25}{col:91f9ff}[Oil of Sharpening]{/col} x2\n\nA clear, gelatinous oil that sparkles with tiny ultrathin silver shards. One vial can coat one slashing or piercing weapon. For 1 hour the weapon becomes magical and deals additional damage as if it were a serrated edge. More bleeding can be expected.\n\nCourtesy of Black Beak Magic Shop,",
