				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Moonlight:700:128}\n{col:ffb6e3}Midnight black covers her from head to hoof in a short coat of soft fur. Large, black horns sweep back from her skull. Broad shoulders and back. Abnormally large bust that seems always in danger of falling out of whatever top she wears. Wide hips leading to thick, strong legs. Firm backside that jiggles as she walks.{/col}\n\n(Always WiP)\n\n\nOoC Notes/Rants:\n\nAll these people with \"LGBTOMGWTFBBQ+ friendly\", how about just don't be an asshole? I don't care what you are, I care that you can write coherently.\n\nI tend to prefer being a little more on the realistic side. She may be short for a Tauren, but a 180lb elf is likely not \"lifting her easily\".\n\n\nSome extra details below.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n18+ please.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nJust a little bit further.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nHi! So obviously, I'm ok with writing smut, as long as it makes sense. I don't do it to get off, I just really enjoy it, been a fan/writer of erotica for 16+ years. That said, Palumei is still a -real- character, she is not purely made for smut and \"normal\" RP is a big yes please. She has a personality, she can get pissed off, and if you approach her in the wrong way she will absolutely tell you to fekk off. Anywho here are some \"intimate\" details that may come up:\n\nPiercings: She has a silver ring in each nipple, with a small full moon charm hanging from each one. Her clitoral hood has a stud in it, with a cresent moon charm.\n\nMini-skirt: While it -is- extremely short, it does still hide everything while standing up, unless your character is very short... It also has a flap of cloth in the front and back hidden on the inside that covers her when she's sitting or bending over.",
