			["about"] = {
				["v"] = 11,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Resina is a bitter and jaded Vulpera who feigns politeness in order to keep the few companions she can find. Currently working as a mercenary healer, she can be easily persuaded for the right price, just don't expect her to be out on the front lines.\n\n{h1:c}Background{/h1}\nSent out at a young age by an uncaring and forgotten family, she was forced into a secular caravan alone to channel the power of the Light. Unmotivated and having no real idea why she was there, Resina struggled to make any connections with the other students and masters. As she grew, her knowledge of the Light did as well, albeit at a much slower pace than her peers. Just before becoming an adult, she decided her lessons done, long having seen the Light as just another source of power rather than anything truly divine. Shortly afterward she ventured out once for the first time of her own will, to the last place she remembered before being sent to the cleric caravan. She didn't know what she was going to do or even say, but she was sure they would get a piece of her mind. \n\nWhat she found was barren sands and dunes, all along the way. Once she had finally reached the last place she could recall, there was nothing for her. Initially distraught, any feelings she had towards them quickly faded to nothing. And so she went off again, having no direction and little world view of anything outside the desert.\n \nAfter a long struggle through the dunes, she finally found a glimmer of hope: a roaming band of mercenaries going about their business and covered in old wounds. Soon enough, a mutual need was satisfied. The mercenaries needed someone to keep them alive, and Resina needed something to do with her life, a true purpose. That and the funds to live properly on her own, which she was provided in troves. It all fell apart just weeks later when the group was reduced to blood in the sand and swords in the ground. Fleeing, she learned a valuable lesson: nothing good ever lasts.\n\nThis lifestyle continued for quite a while, banding with groups of fighters to keep them safe for extravagant fees while putting on a smile and conveniently leaving out what happened to the last ones. She always resented how cute and bubbly the cleric girls acted when she was little, but learned that it was good for business, so it would have to do. She's not all that good at it anyway, but it never hurts to try.\n\n\n\n\n\n{col:ffffff}The part in the additional information was originally a joke, but you can decide to take it as canon or not. She won't bring it up either way.{/col}",
