				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Who Needs the Wyvern's Tail?",
						["TX"] = "\"Given the way you look at me, I'd say you don't need a Love Potion.\"\n\nFlasks and vials of all shapes and sizes line every inch of this vulpera's leather belt. Rarely are they all filled to the brim, but none look older than a few days.\n\nAs for their contents? Neither color nor texture are consistent from one to the next. Each is unique, and dangerously unlabeled.",
						["IC"] = "inv_potion_111",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Bearer of Gifts So Shiny",
						["TX"] = "\"If it is good enough to take your eyes off me, why not drop some coin and take it home with you?\"\n\nA heavy pack is slung over this vulpera's shoulder almost at all times, overflowing with an assortment of relics and gems from across Azeroth and worlds beyond.\n\nWhether you seek to buy, sell, or trade, you are almost guaranteed a transaction with this sly fellow.\n\n...Although you may come to your senses a few hours later and wonder how you were swindled so easily.",
						["IC"] = "inv_misc_gem_x4_uncommon_perfectcut_purple",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Right to Bear Arms",
						["TX"] = "\"Weapons? Please; nobody would dare attack this pretty face.\"\n\nKeen and wandering eyes may notice a questionable lack of equipment. Neither girded by thick plate nor wielding dangerous weapons, this scoundrel seems ill prepared to handle the dangers of the Drag's alleyways, let alone a trade route.\n\nHe must have a number of tricks up his sleeve. Which would be impressive, given that he does not have sleeves.",
						["IC"] = "ability_warrior_disarm",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Hand in Your Pocket",
						["IC"] = "ability_paladin_handoflight",
						["TX"] = "\"I'm after the jewels, not the gold.\"\n\nIncredibly distracted or otherwise daydreaming folk that happen to catch this sly fox's interest are likely to be snapped back to their senses with a foreign hand rummaging through their pockets.\n\nBut don't worry, even if he isn't caught red-pawed, not a single coin will be unaccounted for.",
					},
					["4"] = {
						["IC"] = "spell_brokenheart",
						["TI"] = "CHA Stands for Charm",
						["AC"] = true,
						["TX"] = "\"My eyes are up here, but you can keep yours there.\"\n\nAlthough he is often softspoken when not the center of attention, a smooth voice bordering on a surprising baritone deliver his words with elegance and charm.\n\nMeanwhile, sharp facial features and lean musculature offer his body some definition underneath the natural blanketing of soft fur. \n\nAnd curious sniffers are sure to be exposed to a blend of his natural masculinity blended expertly with a favored cologne, probably of his own make.",
					},
