			["about"] = {
				["T2"] = {
					{
						["TX"] = "{col:83ffaf}Claims:\n\nAny artwork or voice references I recieve will be linked here! Credit will ALWAYS be given to artists!\n\nTRP credit: Worthlesskid-WyrmrestAccord\n{/col}",
						["BK"] = 1,
						["IC"] = "ability_bossfelmagnaron_waveempowered",
					}, -- [1]
					{
						["TX"] = "{col:8056b3}Physical Description:\n\nHyl'ia Dawnwisp was - despite her mannerisms - a gentle featured woman. A soft frown rested upon her pale lips, and her bone white hair stretched down halfway across her back. Her eyes had a light blue glow to them, reminiscent of a moonpool. Breaking her near perfect skin, however, were harsh scars and occasional healing injuries, deep and violent in nature.\n\nApparel:\n\nHer clothing was an assortment of tanned leathers and light mail, though sometimes when she is within the city, she can be spotted wearing more casual clothing made up of inexpensive threads. She typically carried a knife in her boot, a quiver and a bow upon her back.{/col}",
						["BK"] = 1,
						["IC"] = "achievement_character_nightelf_female",
					}, -- [2]
					{
						["TX"] = "{col:9763d8} Worgen Form:\n\nThe afflicted Kaldorei's form had an aggressive lavender gaze that would fixate and narrow upon all whom pass her by. Her fur was a deep soot color, some light grey segments sprinked like ash along her pelt. Hyl'ia's ears sprung much thinner and longer out of her head than that of an average Worgen, and her stature was a bit more narrow, suggesting her to not be a typical Gilnean Worgen like most. Her claws were thin and long, yet surprisingly well cared for.\n\nApparel:\n\nHer outfit seemed to be made from enchanted chains, cloth and skins that would readjust according to her form. While it made any patterns upon her armor slightly strange looking, at the least she wasn't tearing out of her clothing every time she shifted.{/col}",
						["BK"] = 1,
						["IC"] = "ability_shaman_freedomwolf",
					}, -- [3]
					{
						["TX"] = "{col:ff001f}OOC Info:\n\nHello all! As you may know, I am a minor, so please -DO NOT- whisper me for ERP. Yes, I have to unfortunately clarify.\n\nI am comfortable with most topics besides sexual ones, please keep excessively dirty remarks to yourself! I would appreciate it!\n\nNot new to RP, but still fairly new to WoW RP!\n\nI am aware that Hyl'ia is considered VERY young for a night elf, but she is still an adult regardless.\n\nI am tentative about roleplaying with members of Dead Sun Harbor due to multiple bad experiences with them. I will not outright ignore you, but I may disengage to prevent OOC discomfort.{/col}",
						["BK"] = 1,
						["IC"] = "inv_babyfox_purple",
					}, -- [4]
