				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}\n\nHe is of average height, a lean and leather clad build. His demeanor is pleasant, if not stoic. Friendly, yet approachable. A good, understanding friend to have. A good, understanding enemy to have!\n\nAgent by trade, Engineering as a hobby. He does not quite hold his looks to particularly high standards. A bristly, unkempt face and the occasional work tarnish!\n\n\n\n{img:Interface\\Pictures\\artifactbook-rogue-cover:256:256}\n{h2:c}RP Hooks!{/h2}\n{h3:c}Currently works or has worked for the Regency. Not a lot of information is known about him, though one could know -of- him.\n\nCurrently works or has worked with the Sunreavers. Like above, there is minimal information known about him. Of him, perhaps, and to a greater degree than those that worked for the City.\n\nAs above, if one is in possession of an Uncrowned Insignia, they may know even more about the red headed rogue. He is a more lawful sort, acting only as his morals allow him. Some rogues do not trust him, most are wary, few he deems friends.\n\n(( Friendly player. Feel free to talk to me about the things mentioned above or any branched ideas that you may have. Open and welcoming for plots, friend-ly or foe-ly. In the box, out of the box. )) {/h3}",
