			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Foxy Lady",
						["TX"] = "Kyleeh is a pretty vulpera with uniquely golden eyes. Considerably taller than most vulpera, Kyleeh has a slender and appealingly athletic build. She's generally not wearing much and her body is always visible. Often bold and outspoken, Kyleeh is prone to saying things without considering them first. She might seem rude and abrasive but beneath it is a sensitive vixen who feels every emotion strongly.",
						["IC"] = "inv_fox2_white",
