					["4"] = {
						["AC"] = true,
						["TI"] = "The Crybaby",
						["TX"] = "Kyleeh is often prone to emotional outbursts and crying. She feels every emotion strongly and is a passionate vulpera who endures her troubles to the best of her ability. She often stays up in the late hours of the night contemplating her life.",
						["IC"] = "ability_druid_eclipse",
