					["3"] = {
						["AC"] = true,
						["TI"] = "A Walking Disaster",
						["TX"] = "Kyleeh has coarse wiry fur and generally seems to have a bruise here and a scratch there. She's often unstable and unpredictable, a wild mix of the best and the worst of her personality mixed into a storm of impulsivity. Kyleeh's hygiene has improved considerably since her days in Vol'dun but she still envies that plush soft fur of some vulpera.",
