			},
			["msp"] = true,
			["character"] = {
				["RP"] = 2,
				["CO"] = "If you're reading this message you're doing great and I support you <3\n\nAlways up for a guild signature. Just ask :)",
				["XP"] = 2,
				["CU"] = "Not good",
			},
			["time"] = 1630901415,
			["zone"] = "Orgrimmar",
			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "ability_warrior_strengthofarms",
						["BK"] = 1,
						["TX"] = "Kyleeh has light grey fur and striking gold eyes. Her fur is often glossy and shiny but can feel slightly coarser than one might expect. Her body is slender with a vaguely athletic build, though she has an adequate bust and generous rear. Her tail is bushy and fluffy. Kyleeh's claws can leave a scratch or two but clearly she's not much of a fighter. And while not immediately apparent to most races, Kyleeh is considerably taller than the average vulpera, just don't call her dire. She's around the average height of female dark iron dwarves, if a bit smaller.\n\nKyleeh generally doesn't wear much beyond her underwear. But during times when it's more appropriate or her self esteem falls too far, she will put on a dress of some sort. She likes to have earrings and a necklace but often misplaces her jewellery. She seems especially fond of her seashell jewellery and has actively taken care to not lose it for any reason. More recently, she has also acquired a beautiful necklace of immaculate craftsmanship from the mysterious chatelaine Emira.\n\nKyleeh has developed a fondness for cosmetics, particularly fond of purples and blacks. Her dark violet lipstick pairs well with her black eyeliner and sparkly purple eyeshadow. Her nails are painted a dark purple as well, matching the colour of her favourite bra.\n\nKyleeh's staff is of naga origin, as are the bracers she wears at almost all times. She seems quite familiar with the culture of the strange serpentine elves.\n\n\nKyleeh has art now!!!!\n[Taanai and Kyleeh by Jam, the Vulpera Loa <3]( https://64.media.tumblr.com/f9f165bffd2fb5b945531f89f390dee9/1c5e1f0f62cf6013-eb/s2048x3072/fc278c9e0bb98baf3f23debe071f2b76dcc55ced.png )",
					},
					["HI"] = {
						["IC"] = "inv_misc_book_12",
						["BK"] = 1,
						["TX"] = "Shy, somewhat of a scaredy-fox, lacking self esteeem, cute, these are the words that perfectly encapsulate who Kyleeh is as a shaman and as a vulpera. She is a rain shaman who onced used healing waters to mend wounds and bring life to the empty desert. Her capacity for empathy and emotional sensitivity make her susceptible to great pain, but also the capacity for great love as well.\n\nKyleeh enjoys teasing and telling jokes. She feels a sense of belonging when her desire for attention leads to increasingly outlandish behaviour. She can't handle her alcohol, often resulting in embarrassment. As something of a hopeless romantic, Kyleeh endlessly fixated on her ideal romance. Her greatest desire in life is to find her soul mate and experience true love and happiness. These obsessive and clingy tendencies have resulted in a series of failed relationships that had serious and long lasting effects on Kyleeh's life.\n\nBut for Kyleeh, it was not the end. She would not give up. Too many new friends cared about her and she wasn't simply going to fade away forever. Though her future is still uncertain and troubled, Kyleeh still believed. For the first time in a very long time, Kyleeh had the chance to simply live in the moment. With a sense of routine and a loving environment to relax and enjoy life, Kyleeh assumed her troubles would simply go away. Her problems were not solved so easily. Resentment built up, gradually destroying her confidence and leaving her full of guilt over events that had never actually happened. Her relationships crumbled quickly as most were built on a foundation of haste and fear. She even, in her desperation, married someone she lusted for but never truly loved. This marriage ended in the death of her wife, an event that seemed to almost leave no impact on Kyleeh.\n\nKyleeh left Pandaria feeling oddly certain and calm about her future. Kyleeh returned to Orgrimmar calmer and more clear headed than she had been since she became a shaman in Vol'dun. She would stay with her dear friend Borrev for a time, relying on his charity and kindness. She was crying most every night and struggling to just get through the day sometimes. The defeated vulpera wasted away in Orgrimmar, no longer believing love could find her. She embraced her depression as absolute truth and hoped death would claim her soon. But this failure, as with her previous ones, faded with encouragement and kindness. Kyleeh relied on her friends and perservered. And her patience and mental strength were rewarded richly with good friendship and great experiences. Kyleeh began to learn sign language to speak to her deaf friend Uhka.\n\nKyleeh found herself in a series of memorable and passionate encounters with the mysterious vixen Emira, though she had stronger feelings for her close friend Taanai. Kyleeh would attempt to romance Emira knowing Taanai was already in a relationship, but between her conflicted feelings and awed admiration for Emira's elegance she found herself unable to continue further with Emira. Instead, Kyleeh decided to finally voice her feelings for Taanai. The path to love was difficult but Kyleeh and Taanai felt the same and made difficult choices in order to make their relationship work. Despite a rough start, Kyleeh and Taanai's relationship quickly became a strong bond. Taanai's patient attentions and constant encouragement to stay involved socially with their friends ensured Kyleeh never truly felt alone.",
