			["character"] = {
				["CU"] = "The Elements are singing!\n He is once more transfigured.\nHair's growing back, finally.",
				["CO"] = "Whisper/Walkups loved\nPlayer is 21+ Adult /Mature Themes\nAlways looking for new RP friends/partners\nLF Cross Faction RP",
