			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "You can see Bekrash in all his glory. He's massive, even for an orc! Large streaks of bodypaint cover his rippling muscles. The paint is made of a mixture of ash, clay, oil, and water. His skin is smooth, hairless, shiny and healthy looking. Seems like he bathes frequently. It's dark reddish brown, the color of fired clay. Warm looking. His fire red hair is long, and arranged into a thick mane consisting of a great multitude of braids.\n\nHe has the broad features of an orc. His hairline is set high on his round forehead, with eyebrows that seem to be permanently bunched and arched as though upset by something. His eyes are bright and clear, with a pale yellow iris. They flash with a peculiar, bright red light when he feels strong emotions.\n\nA prominent nasolabial fold marks the area between his cheeks and mouth. His nose is squat, seeming slightly flattened. His upper lip is very thin, while large, sharp tusks protrude from his lower jaw, which is covered by a thickened lower lip. His tusks are black colored now, with a peculiar looking texture. They have a faintly purple colored sheen, when the light catches them.\n\nHe has huge, broad shoulders, and large pectorals that he pops whenever he wants to show off. A large, diagonal scar runs across his chest, starting above and past his right nipple, and slashes downward, extending beneath and past his left nipple. His arms are thick all around, heavy with muscle, but he's surprisingly agile with them. Large veins bulge from his huge biceps, which are decorated with tattoos. His hands are very large, with more prominent veining. His fingers are thick like a sausage. He looks like he could easily crush a mans skull just by closing a hand around it, or punch through solid stone.\n\nBeneath his wide chest, he has a huge fuck-off six pack that blends into a pillar like waist.  Shredded serratus muscles bulge from his ribs and large obliques push through his skin on either side of his stomach.\n\nHis hips are narrow, and his muscles form prominent diagonal lines at either side of  his groin. Veins can be seen faintly bulging through the skin, at the very lowest part of his flat, rock hard stomach.\n\nBekrash's backside is firm, and well rounded. It flexes with each step. His thighs are massive, and together with his rock hard calves he looks like he could choke a horse.\n\nA complex network of dark tattoos can be seen branching and wrapping around his hips and buttocks, reaching up to his lower back, and extend down to his thighs and calves.\n\nIt is always too hot for Bekrash. He used to run around naked all the time, but when he came to Orgrimmar, the grunts told him he couldn't enter unless he covered himself up. He wears the bare minimum required to enter the city. Bekrash is almost entirely naked but for the loincloth that barely preserves his modesty. He still undresses if he's traveling outside of a city. Sometimes, he'll encounter people on the road, and they get upset with him, or ask him why he's undressed, out of concern or curiousity.  His answer is always the same, \"The elements protect me, I will not reject their gift.\"\n\n* * * Whisper me to view the NSFW section, 18+ only * * *",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = " Bekrash loves to cook! His favorite food is something he calls \"meatbread\". It's just a small, hollowed out bun stuffed with spiced meat and cheese. He eats them by the platefull.\n\nBekrash has a big heart and loves pretty much everyone. He's kind of rough looking in the face, but he's nice to people unless they give him a reason to not be.\n\nHe likes all the races of the Horde, but all Forsaken, Deathknights, some Demon Hunters, and Shadow Priests make him uncomfortable, Still, he tries not to be rude to them. About the only kinds of people he doesn't care for are Warlocks. Demons are dangerous and the people that mix with them are stupid or crazy. Or both.\n\nHis connection to the elements has rendered him something of a hedonist. He knows he shouldn't overdo things, but somtimes he'll indulge a bit too much. When he first came to Azeroth, he heard an elven bard sing about \"Wine, women, and song\". Well, that about sums it up, doesn't it? Life for mortals is full of struggle and pain. Bekrash believes that the highest good therefore, is to live a life that avoids inflicting suffering others, and to do whatever can bring the greatest pleasure.\n\nBekrash can enoy almost anything, whether it is cooking, eating, drinking, singing, arguing, fighting, loving, or partying. The elements have shown him that life is beautiful and he has a seemingly unending joy for life.\n\nHe uses magic, but in the strictest sense, he does not cast spells in the way a mage does. He directs elemental spirits, and these spirits produce tangible effects in the world such as projecting a fireball or making food appear out of thin air. He has a number of 'utility' spells, simple acts of magic that have practical uses like cleaning things or creating water. He uses when he cooks. He also uses these sorts of utility spells to store and retrieve personal items that he does not appear to be carrying.\n\nBekrash's speech is peppered with idioscyncratic references to what he calls the \"Song of the Elements.\", a sort of non-corporeal \"music\" that he claims to hear.\n\nHe can on occasion be seen unfurling a large scroll and writing in it.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Bekrash was born with the gift of magic, but as a child it seemed locked up inside him somehow. He is a member of the Bleeding Hollow clan of Orcs and spent his earliest years living with his family in Tanaan Jungle. As a boy, his Chieftain told him he would not die on Draenor, and that his destiny would lead him to foreign stars. Shortly after that, Bekrash ran away, and wandered for many years. Sometimes he'd get into trouble, but he always found a way out. He ended up in Nagrand. In his years of wandering, he heard stories about the Elemental Plateau. They intrigued him. Something pulled him there.\n\nAs he neared the Plateau, he began to hear the voices of the elements on the wind. The very ground itself seemed rise up and meet his feet and pull on him. It was telling him where to step, how fast to move. The wind pushed him on.\n\nHe made it to the Throne of the Elements during a tremendous thunderstorm, and the air buzzed with energy. Bekrash's heart was pounding in his ears, his breath came in furious, ragged gasps, all his muscles were tensed tighter than a saberon crouched for a kill. He heard a name on the wind, spoken by a voice louder, clearer than all the others. Something swelled in Bekrash's chest, and his voice exploded out of his throat. With a terrific flash of lightning and a great crash of thunder, Bekrash screamed the name \"INCINERATUS!\"\n\n In an instant, all fell silent, the earth opened up, and in a great gout of flame, something emerged. It was gigantic, and great waves of heat radiated from it. Bekrash was pushed to the ground from the violent, hot winds that blew all around him now. The thing before him was a Fury of Draenor, a powerful elemental spirit. Something like a head rested atop its great body, and turned its gaze downward to Bekrash. It made a noise, but it wasn't speech, it was, all at once, the explosion of an eruption, the chaos of a firestorm, and the gentle crackle of a campfire. It was Bekrash's anger, rage, fear, hate, but also love, passion, pride, and ambition. It spoke, and Bekrash understood. In his heart, Bekrash felt the magic inside him come loose. Spirits were with him on Draenor, and he would find more in the land of his destiny, a place under foreign stars. The Fury directed him back to the land of his birth, the sweltering jungles of Tanaan.\n\nOn his journey home, Bekrash realized something in him had changed. He felt hot all the time, but wasn't sweating. He ripped his clothes off and abandoned them. He was not ashamed of his nakedness. It was... freeing, to wander the wilds of Draenor in this manner. It made him feel more connected to the elements. He could feel the wind dancing across his skin, and the sun shone on his face, arms, back and chest.\n\nBekrash's encounter with the Fury on the Throne of Elements had left him with a powerful feeling. Something flowed through him, and it made him feel... Not stronger, but safer.\n\nHis first act of magic was in Talador. He encountered a Lightbound Draenei, who was upset by Bekrash's nudity. The Lightbound tried proselytizing to Bekrash, and Bekrash tried telling the Draenei that he only needed the power of the Elements. Bekrash turned away from the Draenei, and the Draenei followed. The Draenei grew annoyed, and grabbed Bekrash's shoulder, to turn him around. Bekrash spun around, and moved to punch the Draenei. Instead, a flash of fire shot out of his hand, and seared the Draenei's eyes shut. The Draenei screamed and writhed on the ground. Bekrash had never hurt a person before. He'd killed animals, for food, and he'd killed goren, which weren't really \"people\" people. He even killed a botani once, and that was a plant.\n\nThe flesh on the Draenei's face had melted over his eyes. What he had done frightened Bekrash. His breath caught in his throat. There were other Draenei in Talador. Should he find help? Would they help? Would they be angry? They would be angry. Orcs and Draenei kept getting into conflicts. This wasn't good. Bekrash weakly said \"Someone will find you\" and fled. He became angry with himself. How did he do that? Where had the fire come from? He was aware he was still a child.\n\nHe returned to his people in Tanaan, and his reception was... less than welcoming, initially. When he approached the spiny pallisades of his village, the guards thought he was mad. Demonic influences still worked in the dark places of Draenor after the fall of the Iron Horde, and Bekrash's people thought he might have had his mind addled by a demon. It had been many years since he had been to the village of his birth, and the people did not initially recognize him. The village shaman met Bekrash outside, and Bekrash told him about his years of wandering. About his encounter on the Throne of the Elements. He showed the shaman how he could make fire come out of his hands. He told him about the perpetual feeling of heat in his body.\n\nAs near the shaman could tell, Bekrash was born with a connection to the elemental plane of fire, and the encounter on the Elemental Plateau with the Flame Fury had opened something inside Bekrash so that he could now channel the power of the Furies from the plane of fire. The perpetual feeling of warmth he had was just a side effect. Bekrash was allowed back into the village. It's not like anybody had never seen a naked orc in a place as hot and humid as Tanaan. The Bleeding Hollow recognized Bekrash as a man now, and a full member of the clan.\n\n A few years later, the entire Bleeding Hollow clan  left Tanaan Jungle for the safety of Hellsreach Citadel, in Gorgrond. Encounters with the Lightbound had grown far more violent. The Orcish clans of Draenor new they needed to band together.\n\nThe clans of Draenor unified because the Lightbound were now forcibly converting Orcs and even some Ogres, and killing anyone that refused to turn over to the Light. One day, the entire Lightbound army marched on Hellsreach Citadel, and offered a final ultimatum to the Mag'har. Give themselves to the Light, or die. Chaos ensued. Death surrounded Bekrash. The cultural differences between the Draenei and Orcs sometimes resulted in friction, but after the fall of the Iron Horde, both peoples seemed closer. They had found common ground in fighting an enemy that threatened both races. Something changed afterwards. The Light came to the Draenei, and had bound itself to them. The Light brought with it suffering and death.\n\nEmissaries of the Horde of Azeroth appeared, and offered assistance to the Mag'har. They wanted to bring the Mag'har to Azeroth. A small group of warriors stayed behind to fight the Lightbound. The emissaries from Azeroth worked strange magic, and light filled Bekrash's eyes. He could feel his connection to Draenor's Furies become tenuous, fading...\n\nThe sounds of fighting and death faded and was overcome with something like thunder. A sudden, violent jolt shook Bekrash, and he opened his eyes. He didn't recognize where he was. The land was hot, dry, and dusty. He was surrounded by other Mag'har, but his parents were nowhere to be seen. The massive spiked walls of a great city lay before him. He was in Durotar, in front of the great gates of Orgrimmar. That night, as he wandered the streets, dressed only in a loincloth, he looked upwards to a sky filled with nebulae and constellations. He looked and understood. He had fulfilled his destiny. He was in the land under foreign stars.\n\nBekrash took time adjusting to life in Orgrimmar. He was upset that his parents were left behind on Draenor. He took some small comfort in the fact that they most likely died in battle fighting the Lightbound. He couldn't conceive of them worshipping anything like the Light when it had brought pain to so many. He found more comfort in the bottom of a mug of ale and the arms of the many exotic women of the Horde. To them, he was exotic, something new, this painted orc in a loincloth.\n\nIn Azeroth, Bekrash could no longer feel the comfort of Draenor's Furies, though the heat was still in him. His experience had left him weakened. He could only make a small, weak fireball. Whatever effect his encounter on the Throne of the Elements had, it seemed that it was permanent, regardless of distances of time and space.\n\nBekrash sought out a shaman, for counsel. It was not difficult locating one, many of the races that made up the Horde had strong shamanic traditions. What was difficult was finding a shaman knowledgable in both the Azerothian Elements and Draenic Furies. Bekrash found him, an old, blind Troll so thoroughly riddled with arthritis he could barely move. He was something called a witchdoctor. Coming to Azeroth so suddenly had thrown Bekrash's \"mojo\" out of balance. Bekrash's connection to the Furies of Draenor was strained, like injuring a muscle unaccustomed to work. Bekrash needed medicine. The old blind doctor mixed odd ingredients into a cauldron of fuming liquid. The ingredients were odd things with intangible qualities. An old leather belt, said to be the bonds of family. Bekrash lost his family on Draenor and would need to find his own place on Azeroth. The second ingredient was the scream of a gryphon. The elements of Azeroth could not hear Bekrash yet, and needed something to carry it on the wind. The third ingredient was something the witchdoctor called \"Latent Heat\". It was a thick, gummy light blue liquid in a bottle. The witchdoctor had to cut it with scissors as he poured it into the cauldron. The cauldron bubbled and fumed furiously. The witchdoctor bid Bekrash come near, and breath deeply.\n\nThe effect was immediate. The room spun about Bekrash, and the witchdoctor laughed as he fixed his milky eyes on the orc. Heat welled up inside Bekrash. He was falling. He was falling into infinity. Winds carried him through the clouds. A cloud shaped like a man held him in its massive hand and wrapped him in its fingers. Bekrash fell, through sea and sky and fire, deep into the heart of the earth. He was in a desert. He could feel power underneath him. Some vibrated beneath his feet. Every grain of sand felt like it was alive. The queen of the earth bored through his skull with amethyst eyes. He felt very small. Bekrash tumbled into the abyss, and was swallowed by a whale. Water flowed over him, under him, and through him. Bekrash was in the ocean and knew he carried the ocean inside him.\n\nThere was fire in the sky. Stars fell. Moons exploded. The universe was aflame with life. It burned in Bekrash's soul. With far, distant eyes, Bekrash could see Draenor. The Lightbound. His parents. The Furies of Draenor looked at him. They stood alongside the Elements of Azeroth. He saw the space between infinities. Order and Chaos. He saw and understood. The universe whirled around him. Solar fire and terrestrial flame licked his skin. Every nerve was stimulated. Pleasure and pain blinded him. The fabric of existence was climaxing. He felt himself resting on a mat.\n\nBekrash turned his head, listlessly. He stared dumbly. His lungs felt like they had been burned. He smelled something warm... It was food. The witchdoctor was using magic to cook food. It smelled like home. Bekrash new anywhere on Azeroth could be Home. He had breakfast with the Troll, and thanked him. The Troll was appreciative, but said thanks was unecessary. Bekrash left. He ripped off his loincloth and ran through the wilds of Azeroth. All around him he felt the elements. He could hear them. They were singing. The magic in him was free again. He was home.",
