			["about"] = {
				["v"] = 52,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}{col:ff000c}APPEARANCE{/col}{/h2}\nA warrior through and through. Falanthos carries himself with pride, dignity, and perhaps more than enough resoluteness. Standing at a height most impressive for his kind, it comes as no surprise that Falanthos quite literally looks down upon others of his race. As if his towering height wasn't enough, Falanthos also carries around quite a bit of bulk. Broad shoulders, tree trunk arms, a torso which seemed to be sculpted from stone, and powerful legs to keep him supported. His skin had darkened somewhat over his life, though he was still a few shades away from a sun-kissed look. His flesh, while not particularly soft thanks to his way of life, was warm to the touch, with several old scars of varying sizes dotting his body. \n\nHis hair, the color of ink, was usually left to its own devices. Most often the knight allowed it to grow out so that the back of his neck was hidden behind his locks, while a few lucky strands laid out down his chest. When the length becomes a hassle, Falanthos keeps it all tied into a tail, looking quite wild. The ladies like it, so he manages.\n\nAs an elf of the highest birthing, Falanthos possesses the traits born to all children of the high home. Long and thin brows, pointed ears, and the characteristic glowing eyes. His shine a golden hue, thanks to the blessing of The Sunwell, and his own mastery of holy magics. Most notable about his eyes, or rather his left eye was the scar that ruined the perfect symmetry that was his face. Starting a few centimeters above his brow, the scar seemed to have been made by a blade, given how straight the line is. It trails all the way down his face, stopping a few inches before reaching his jaw. A pointed nose rests above his lips, usually found in soft scowl or a neutral poker face. A sharp jaw rounds his face together, and as of late, he's allowed his facial hair to grow out some, it helps him appear more mature he thinks.\n\nWhile the knight hasn't decided yet whether or not to get a tattoo, the option is still there. The only piece of jewelry on his person happens to be a locket in the shape of a star. Inside is a picture of an elven woman, most likely someone special to him. \n\n{h2:c}{col:ff8500}EQUIPMENT{/col}{/h2}\n\nAs a blood knight, Falanthos has specialized in fighting in close quarters with heavy armor and a variety of weapons. Plate armor consists of most of his attire when out in the public eye, and always accompanies him when on a campaign. While he can choose from any number of weapons to take the the field of battle, his most common choice is a light-blessed steel greatsword gifted to him by the Order of Blood Knights. This blade means a great deal to the elf, as it was this weapon of mass destruction that laid waste to thousands of blood-thirsty demons, nightmare spawn, undead monstrosities, and more than a few Alliance warriors looking for vengeance for the fallen king Varian.\n\nA list of less heroic but still equally important equipment includes:\n\nA short blade, mainly used for parrying or in circumstances where a greatsword isn't ideal.\n\nA set of goblin goggles, used primarily for scouting long distances or seeing in the dark.\n\nAn ornate dagger used in rare occurrences, or to surprise the enemy.\n\nAs for armor, Falanthos has a bit of a bad habit of being unable to decide which to use. A wide range of different sets of armor with different themes and styles are his greatest collection. Some draw inspiration from orcish heavy plate, others are issued to him by his order, and others are some he simply had commissioned for the pure aesthetic.\n\n{h2:c}{col:5b5b5b}ABILITIES{/col}{/h2}\n\n\nFalanthos far outclasses the common soldier in a number of ways, ranging from fighting techniques, mastery of certain weapons, an assortment of versatile spells and a deep understanding of magic. \n\nAs a veteran of several campaigns across Azeroth and taking part in numerous battles, Falanthos has sharpened his skills as a warrior, as well as picking up on some of the lessons taught by the indigenous peoples of some of the lands he's been to.  \n\nFirst and foremost, Falanthos is most effective going toe-to-toe with his enemies, most often with a two-handed weapon in his hands. While swords are prefered, axes, maces, polearms, staves and other large weapons are all just as deadly in his hands. Finding a shield on the elf would be a rarity, though when the fight calls for a more defensive approach he does not shy away. Falanthos also can find success while wielding two one-handed weapons, or with blade in one hand and magic in the other. Firearms and other ranged weaponry are almost never witnessed, though in the knight's hands, he can still do his job. The only weapons out of his arsenal are fist weapons. They are useless.\n\nHeavy armor protects him from certain attacks, if not completely negating the damage from a poor strike or a weak swing. In addition, the rare metal known as Lumenstone plays quite a roll, as traces of the stuff can be found imbued into his armor. This, while not wholly protecting him from magic, does allow him to not be totally helpless when against spell-casters. Mobility-wise, the elf isn't well off enough to be a major danger to enemies at a distance, even with the natural agility his kind is commonly known for. \n\nThe Light may be the knight's most powerful weapon, however. The ability to both mend his own wounds and that of his allies while also dealing righteous destruction upon his enemies should not be underestimated. Those who call him 'friend' can rely on an assortment of healing spells. Cuts, broken bones, burns, poisons, and certain illnesses are nothing the knight cannot handle. More grievous wounds may take longer to heal, but are still doable. Life-threatening wounds or severe neglect are perhaps the only thing Falanthos cannot mend. \n\nOn the opposite side of the battlefield, the knight is truly a force to be reckoned with. A bold fighter, he cares little for wounds he may sustain while in the thick of a fight, allowing him to fight with a more aggressive style. Of course. The Light can also be used to reduce most of his foes to ash. His specific choice of harnessing the Light's Wrath involves channeling the power into a form of fire. Just as lethal as natural fire, this form is most effective when used against demons, undead or evil beings in general.\n\nDuring his time in The Broken Isles, Falanthos trained with the Valarjar Vrykul. One ability the knight picked up on was runic magic. His most prefered spell is on which increases his strength to rival that of an ogre for a short time. This runic spell requires a great amount of stamina to preform, and is used only in dire circumstances.\n\n{h2:c}{col:ffea00}HISTORY{/col}{/h2}\n\n Born into a middle class family, Falanthos was the youngest of three children, coming after his brother Saris, with both brothers coming after their sister, Beledra. His father, Anastarin worked as a construction worker, while his mother Velsia worked as a priestess. Growing up as the youngest of the three, Falanthos was forced to endure an endless barrage of sibling-bullying, especially from his brother. This in turn sparked a sibling rivalry which lasted all the way well into adulthood. Upon reaching a mature age, Falanthos stuck around with his family, mainly finding work with his father's employers. The young blood elf behaved in a typical fashion for one of his age and standing. He worked hard, and played harder. In keeping up with tradition, Falanthos and his brother often competed over a number of trivial things, such as displays of strength, drinking contests, and perhaps the most competitive-- women. This was the only life Falanthos knew for quite some time. Of course, the possibility of a run in with an Amani was always there, but most occurrences ended without incident. This life was about to change though with the onset of The Second War.\n\nThe fall of Stormwind weighed very little on Falanthos' mind at the time, though his concern grew as the armies of The Horde drew closer and closer to Quel'Thalas. When the Amani threw there lot in with the orcs, Falanthos knew just how foolish he was to ignore the rising threat of the crazed orc hordes. Their advance was made all the more daunting with the arrival of enslaved red dragons. As such, Falanthos only got to experience a handful of skirmishes with the orcs and trolls before the threat of winged beasts pushed he and his allies behind the walls of Silvermoon. It was here that the boy began to change into the man. Fortunately for the high elves,\n\nAfter The Second War, Falanthos remained in Quel'Thalas, having little desire to travel so far away from home for the sake of bloodshed. Life changed for him and his family, especially the relationship with his brother once the fighting had stopped. Saris believed it was necessary to cross The Dark Portal and take the fight to the orc's homeland, while Falanthos thought it would merely be a waste of men and women. Shaken by the things the both of them had seen, the had a bit of a falling out. Playful rivalries slowly evolved into open arguments, with the brother's eventually coming to blows over almost everything. The one thing the pair agreed upon was the Amani issue, with both of them doing all they could to protect their home. \n\nWhen the plague of undeath sprouted up within Lordaeron's borders, Falanthos prayed for them, but knew there was little he could do. After hearing of Arthas' purge of Stratholme however, the elf worried deeply for the stability of his human neighbors. This concern was made into a full blown crisis after the death of the human king, and Arthas' fall into madness. With the shadow of death creeping closer and closer to the borders of Quel'Thalas, Falanthos prepared for the worst. What came was more terrible and harrowing than anything he could have imagined.\n\nAgainst this new enemy, Falanthos and his people stood little chance at victory. With their army shattered and chaos seeding into the land, he and his family had no other choice but to flee their home. It would be the last time he would call Suncrown Village home ever again. Witnessing the slaughter of his friends and destruction of his home was one thing, but the corruption of The Sunwell was another thing entirely. He and all other high elves felt the ramifications of this loss almost immediately. Their sacred fount of holy and arcane energy had become corrupted. The High Elves, and eventually all of Quel'Thalas would fall victim unless something was done. Unfortunately, the only option that would cease the flow of corruption was the destruction of the very thing which gave the High Elves life. Under the leadership of prince Kael'thas, the survivors renamed themselves the Blood Elves in honor of those who fell.\n\nOnce the main undead army marched back south, the rebuilding began. The first trial was overcoming the reality of the numbers of those who had fallen. The vast majority of Falanthos extended family had perished, and most of his friends fell in battle or lost themselves to their own sorrow. His immediate family was spared, though they would not remain intact for long. Beledra left Quel'Thalas at the earliest convenience to find her own path, while Saris followed Kael'thas to the orcish homeworld, now known as Outland. With both siblings gone and his family losing everything, the situation seemed hopeless. The cravings for magic was soon to follow, bringing a whole list of other problems for the Sin'dorei to endure. Madness and crippling weakness took hold of those who couldn't survive, while the loss of power in general pushed the elves into an even more vulnerable position.\n\nExistence was a struggle for the few that remained, and even with most of the undead leaving their lands, they were still a dire threat. With their armies shattered, it fell to the few soldiers remaining to defend the land still left untainted by Arthas' march. In addition, the amani reignited hostilities once the blood elves were left exposed. There simply wasn't enough manpower to stop the incursions. Then, Falanthos' salvation came in the form of a deity of light. Kael'thas, the last prince of the blood elves managed to transport the creature known as M'uru to Silvermoon, in hopes that his people may harness the near-boundless power within the holy being. Falanthos and his people were skeptical at first, seeing as how the light did little to aid them in their plight against the undead. Many didn't see the point, that was until the creation of the first Blood Knight.\n\nLady Liadrin showed that even if The Light had abandoned them, they could still harness its power. While Falanthos never personally felt connected to The Light, the ability to call upon it was a momentous boon to their current situation. The Light was especially effective against the undead that remained in Quel'Thalas, as well possessing ways to combat a range of other foes. He joined the newly created order of Blood Knights at his earliest convenience. His life changed forever once he was invited into the fold, his acceptance made a rather clear choice thanks to his physical prowess and dedication to seeing the undead destroyed. Accepting the power stolen from M'uru was a euphoric and terrifyingly awe-inspiring experience. Power unlike anything Falanthos had held before was now at the tip of his fingers. It would take time for him to harness this newfound strength, but he knew once he mastered it, none would threaten the high home again and survive.\n\nWith the addition of the Blood Knights on the battlefield, the situation within Quel'thalas began to stabilize. Much of Eversong was recovered, but across the Elrendar river was another story. The 'Ghostlands' were still crawling with undead and amani trolls, with nearly all of the settlements brought to ruin. The task of reclaiming the land was daunting, with many seeing it as near impossible. That was before the blood elves received a helping hand in a most unlikely ally. The Forsaken claimed to be free from the Lich King's will, and seeked the bring the blood elves into the fold of The Horde. The idea seemed preposterous at first, until The Forsaken revealed they were led by Sylvanas Windrunner. \n\n\nIn the following weeks, more and more territory fell back into the hands of the blood elves, though the corruption from Arthas' assault made the land relatively useless. Still, Quel'thalas would not abide scourge minions within her borders. After many trials, the combined forces of the Blood Elves and Forsaken were prepared to launch an assault on the Scourge base in Quel'thalas, Deatholme. The traitor Dar'Khan Drathir, who was largely at fault for allowing Arthas entry into Quel'thalas met his end, with his head removed from his rotting corpse for all children of Quel'thalas to see. With their homeland secured and Dar'Khan brought to justice, the blood elves were welcomed into the ranks of The Horde, a decision many still see as controversial.Many would rather see Quel'thalas thrive on their own, while others saw the benefit of a new alliance, seeing as how the humans were no longer an option. All that remained now was to find their wayward prince, Kael'thas. Which meant their next destination was the shattered homeworld of the orcs. Outland.\n\nThe rest will have to be discovered through IC interaction.\n\n{h2:c}{col:0eff00}PERSONALITY{/col}{/h2}\nA lone wolf to the core, Falanthos has valued his solitude for as long as he can remember, opening himself to only a select few lucky individuals who are blessed enough to be within his good graces. That being said, the knight has a very short temper and is prone to violence, a disability clinging to his psyche ever since he stole M'uru's power. This in turn, makes it hard to make friends. Go figure.\n\nOff-duty, the elf tends to keep to himself, often found against a wall or some solid object. A keen eye keeps track of those around him, sizing up his fellow horde brothers and sisters. Rarely does the knight approach for conversation, though he does not shy away should he be dragged into one. Not afraid to speak his mind, Falanthos is rather blunt, as well as mixing in a healthy bit of sarcasm when the situation calls for it.\n\nHis relationship with The Light is strong, granted his path in life. Since the Sunwell's rebirth, it's become more intimate. Contrary to what most shadow-loving cretins might say, Falanthos does not have a blind faith in The Light. He follows his own creed and trusts his own judgement when faced with a dilemma. He is his own man, and does not need a divine force to live his life; he holds The Light in high regard. It does not control him.\n\nWhen slighted, Falanthos does not back away from challenge. Those who dare dishonor him or those he cares for are on his shit-list for all time. He never forgives, and he never forgets. \n\n{h2:c}{col:ffffff}POLITICAL AFFILIATION{/col}{/h2}\nPerhaps a surprise to no one, Falanthos holds his homeland and people above all others. While loyal to The Horde and all its tenets, this particular Sin'dorei will always act on behalf of Quel'thalas first before anything else.\n\nPrideful, but not pompous.\n\n{h2:c}{col:ff00fa}OTHER SHIT{/col}{/h2}\nRP guilds are cool.\nAll themes accepted, save for ERP. Sexual tension and themes are still fine.\nWhisper if you'd like me involved in your stories. \nIf you RP a loud and annoying mentally stunted waste of skin, I'm probably going to ignore you. If you RP anything outlandish or clearly breaking the canon, I'm probably going to ignore you.\nALL MEN ARE KINGS.\nIf you are RPing a female character, do NOT talk to me if you do not have 20 points in lustful. (joke)\nIf your rogue/thief/shadow assassin character has ever 'faded into the shadows' I want nothing to do with you.\n\n\"Blood Knight bad!\"-- NPC #132\n\nWhisper me for anything else you'd like to know :^)\n",
