				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-CathedralOfEternalNight:456:4}\n{h1:r}{col:670040}\"Life is just{/col} {col:b0ff00}so much better{/col} {col:670040}when people{/col} {col:6fff00}like you{/col}{col:670040}.\"{/col}{/h1}\n{p:c}{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-CathedralOfEternalNight:456:4}{/p}\n\n{h2:c}{icon:spell_warlock_demonbolt:25} {col:ff2889}D{/col}{col:ff4cc6}es{/col}{col:ff76de}cr{/col}{col:ffa1c2}i{/col}{col:FF76DE}pt{/col}{col:ff4cc6}io{/col}{col:ff2889}n{/col} {icon:spell_warlock_demonbolt:25}{/h2}\n{p:c}{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-CathedralOfEternalNight:256:3}{/p}\n{h2}{col:9a003b}Altielle Darkwish...{/col}{/h2}\n{col:741990}The one. The only. She's a vain thing who places great emphasis on her appearance. Casual clothes are a concept all but foreign to her. If she's going out of the house, she's going out in -style-. That means pointless spikes, a few hundred visages of skills, and a twisted scythe in her hands. She's a wicked warlock, after all. She might as well sell it.\n\nAnd sell it she does. Her sharp face often contains a clever smirk, as if she knows something you don't. And for this girl who thinks the world revolves around her, she probably assumes she does. Her smokey eyes sparkle with a haughtiness that dares anyone to challenge that assumption. Anyone who does, well, why don't you role play to find out?{/col}\n\n{p:c}{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-CathedralOfEternalNight:456:4}{/p}\n\n{h2:c}{icon:inv_artifact_dimensionalrift:25} {col:1c7f00}H{/col}{col:71ff27}i{/col}{col:a5ff61}st{/col}{col:d3ff91}or{/col}{col:f8ffa9}y {/col}{col:d3ff91}Ho{/col}{col:a5ff61}o{/col}{col:71ff27}k{/col}{col:1c7f00}s{/col} {icon:inv_artifact_dimensionalrift:25}{/h2}\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-CathedralOfEternalNight:256:3}\n{col:BBFF00}If you served in the Fourth War you may know her. She was active in Darkshore for the most part, though she's made occasional trips to Kul Tiras and fought in Nazjatar. She was known to struggle with following orders.\n\nYou might know her if you were an Elisande loyalist. She fought on the wrong side at the Nighthold and her past has a tendency to haunt her wherever she goes. For those who are familiar with the felborne, she backed out just before becoming one.\n\nYou may also know her if you were a Dusk Lily rebel for a similar reason. Her time serving with Elisande and Gul'dan was a tumultuous one, and her past is certainly what one might consider \"checkered\".\n\nIn addition, she's a warlock, so anyone involved in shady magical business may well be acquainted with her. She does put in an effort to hide her darker lifestyles in public, however.\n{/col}\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-CathedralOfEternalNight:456:4}\n{h1}{col:670040}\"Is a life with no ambition or future even a life at all? I was{/col} {col:00ff64}trapped{/col}{col:670040}...{/col} {col:13ff00}choking{/col}{col:670040}... {/col}{col:afff00}alone{/col}{col:670040}... had to get out.\"{/col}{/h1}\n{p:c}{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-CathedralOfEternalNight:456:4}{/p}\n\n{h2:r}{col:ffa1c2}A {/col}{col:FF76DE}Fe{/col}{col:ff4cc6}w N{/col}{col:ff2889}otes{/col} {icon:ability_warlock_mortalcoil:15}{/h2}\n{col:741990}I'm pretty laid back, friends. We all make mistakes from time to time, be it lore or typos. I'm understanding when it comes to that. This is just role play, after all!\n\nI'm over 18. I do not do exclusively 18+ stuff, though, so don't shy away! Howver, if it does happen, you HAVE to be over 18.\n\nI'm addicted to ellipses and /smirking. Send help.\n\nAnd /nodding. I have a problem.\n\nSometimes I can get overwhelmed in groups. I often struggle when more than one character tries to address her about different things. So sometimes I go quiet or miss posts. I swear it's not that I'm ignoring you! I've even recently installed Listener to help me out but I'm still learning how it works.\n{/col}\n\n{h2}{col:ff2889}A{/col}{col:ff4cc6}r{/col}{col:ff76de}t!{/col}{/h2}\n{link*https://cdn.discordapp.com/attachments/632675903704662016/753383143440121916/Altiface.jpg*Face art by meeeeee!}\n{link*https://cdn.discordapp.com/attachments/632675903704662016/716789507021864990/Rude_Awakening.jpg*A rude awakening}\n{link*https://i.imgur.com/EXoeFMa.jpg?1*An Older Piece. I've really gotten better, huh?}",
