					["TX"] = "{p:c}((I'm not one for writing backstories in my TRP, so heres some extra info)){/p}\n\n{h3:c}ART AT BOTTOM!{/h3}\n\n{p:c}{img:Interface\\QuestionFrame\\answer-warboard-classic-Gilneas:512:256}\n{/p}\n{h3:c}Do you know me?{/h3}\n\n{p:c}Gilneans would possibly recognise Victor from early life, or when he was in the Gilneas Brigade. Undead can potentially remember seeing him, but chances of this are slim to none if you're hostile. Lordaeronian humans who were around before Terenas's fall might find him familiar.. wonder why.\n\nNowadays, he resides in the Old Town District of Stormwind, and has joined the third platoon of The Seventy Third.{/p}\n\n\n\n{h3:c}Eye ability{/h3}\n\n\n{p:c}Bacara has a special ability that is focused around the eyes. To put it short, Telepathy, Telekenesis, Detect Magic, and enhanced field of view are the general powers it gives, but he has to focus on a target or in general to use them.\n\nTelepathy can be done without direct eye contact for a single-way sentence, but two-way communication requires eye contact.{/p}\n\n\n{p:c}{link*https://i.gyazo.com/4f9c7f43e79898bbd2a75cd618dfee47.jpg*Bacara w/ cloak in HDR Shaders}{/p}\n{p:c}{link*https://i.gyazo.com/3e169f54ec9a4ba1e72a4af6791efb32.jpg*Another Angle}{/p}\n{p:c}{link*https://cdn.discordapp.com/attachments/680262327018455083/846032419563241512/bacara.png*Shirtless STV BB art (SFW)}{/p}\n{p:c}{link*https://i.gyazo.com/629bd1ebccad882a45044e5af24c113d.jpg*Alternate Outfit (Coat from FFXIV)}{/p}\n",
