		["0215100558LHADY"] = {
			["character"] = {
				["v"] = 33,
				["CO"] = "Currently redoing the TRP, I just got ART!\nPlayer is 18+ all themes welcome\nWalk ups welcome",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "Currently on extend leave, in a breif brake in his travles\n\nDressed fancy yet, lacking the armor for now.\n\nSeems content with life",
			},
			["time"] = 1631044121,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{link*https://tinyurl.com/x4wm8ku9*I got face art thanks to an awasome friend!}\n\n\n\n\n{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}\n\n\n{h1:c}Honor, Valor, Allegiance, Excellence.\nFrom Azeroth, For Azeroth.\nToday. Tomorrow. Forever.\nTogether We Rise. Together We Prevail.\nForward Unto Dawn{/h1}\n\n\n\n\n\n\n\n\n\n\n\n\n{h1:c}Physical Description \n{/h1}\n{p:c}Helfar was quite the physical specimen thanks to rigorous training dedication and especially disiplin. To start, his torso was well built, His shoulders are broad with a well defined pair of pecks further down. Below those he would have a well defined abdomen, Helfar sported an 8 pack,though none of this would usually be seen due to his armor. However if he was wearing a shirt his muscles would be seen through it easily. As for his legs he kept them well trained as well, having good quads and hamstrings and calves, his rear was also fairly toned. In addition, Helfar’s face was chiseled, with golden eyes that glowed with the light. Atop his head his hair is blonde and cut short. Though he had been known to allow it to grow out at times, it all depends on what he feels like at the time. As for what helfaar would typically wear, he usually would be in his plate armor, more specifically his blood knight armor, colored in reds, blacks and silvers. One could sense it was enchanted and blessed by the light if they were sensitive to such things. As for weapons, Helfar was most proficient with greatswords, short swords, shields and polearms. Through that does not mean he can’t use other weapons to varying degrees of skill. Host often however Helfar carried a greatsword of Ravendreathen make, or a sword and shield of rather intricate design. The greatsword, glowed with light and some Vynthir magic, the blade is strong enough to stand up to blades several times its size and width and is nearly indestructible. And finally, around his neck usually hidden beneath his armor, he would wear a silver necklace, on this necklace there would be 4 military dog tags and a blue crystal of sorts. On each of the tags there would be some wording. One would read “Helfar Fardawn #0258,” the second would read “Honor in service” the third tag would read “Ma’krish #0259” and the forth would simply read “In memoriam”. Helfar would wear this necklace even when without his armor more often than not, it holds great importance to him.\n{/p}\n\n\n{h1:c}Personality\n{/h1}\n\n{p:c}Helfar is a largely pleasant man,he was raised well by his parents and is usually pretty polite, respecting most that he speaks to unless wronged by them, even then he is not against forgiving people and when he can he throws a bit of wit and humor into conversation, he usually has nothing against a good joke. However Helfar is a devoted light worshiper, he believes that the light should be used to help people, heal those in need and dispense justice against evil. Often does he humbly ask for the light's grace and protection he has worshiped since he was a child and carries great respect for those who respect the light and the balance between light and void. \n{/p}\n\n\n{h1:c}History TLDR/How you might know him\n{/h1}\n{p:c}Helfar’s first campaign took place in Outland. He fought in Zangarmarsh, Netherstorm Shadowmoon then was later recalled to aid the shattered sun on Quel’danas.\n\nHe fought in Dragonblight and Icecrown during the Northrend campaign Loseing a close friend in the process. He went into retirement after the conflict was over and stayed that way until the Pandaria campaign.\n\n\nReturned to service during the Pandaria campaign, at first fighting in the dread wastes and later joining the frey in the isle of thunder. Here he gained the rank of knight master and the title “The bloodedge.” He renounced the title by the campaigns end.\n\nDuring the siege of Orgrimmar he was severely wounded by an orc blademaster and was subsequently dragged back to the healers by Nadra who was watching over him at the time.\n\nDuring the Draenor campaign he fought in talador against the shadow council and Iron horde respectively. He later went on to fight the Fel horde in Tanaan jungle. \n\nWhen the legion conflict begain Helfar’s ship crashed in Azuna and he wandered wilderness alone for a month until reconnecting with horde forces in Suramar. He assisted in the liberation and later offensive on the broken shore. He also was pleased to be working with the silver hand again.\n\nUpon the beginning of the 4th war he was stationed in the Arathi highlands. For his skill in defensive warfare he was promoted to Knight lord. He went on to fight in Nazjatar and later against the black empire in Pandaria and Uldum.\n\n\nSomeone may know helfar form any of these campaigns, from being a blood knight, from his time as a priest or him possibly enhancing something for you.\n\n\n\n{/p}\n\n\n{img:Interface\\QuestionFrame\\answer-warboard-classic-EversongWoods:512:256}\n\n{h2:c}History - early life\n{/h2}\n\n{p:c}Helfar was born 132 years ago to a noble mother and father, his father was a high ranking mage and his mother a priest. For the first 5 years of his life his family lived in Quel’thlas before deciding to move to human lands in the southern eastern kingdoms. Their reason for this was that his mother and father were both enchanters, and such skills were very profitable and in demand in the human kingdoms. Thus they ventured south and helfar along with his two sisters were raised in human territory. Those lands were not entirely devoid of other high elves through and helfar befriended what of his kin he could along with some humans. As he grew up he was taught the ways of the light and enchanting by his parents, helfar took to the light quickly by the time he was 18 he was almost prepared to become a full priest. However, helfar had always leaned primarily holy magic and little void. In the final years of his training he looked over many tomes on the subject and practiced what he could, for a time all was well until he reached beyond his bounds. One day Helfar wished to attempt a powerful void spell, apparently it would create a torrent of void energy at a point of the wielder's choosing. This was out of his league, and when he attempted it the void exploded as he channeled it knocking him several feet away and leaving a void rift open where he once stood. The rift consumed life killing the grass and sucking in other various objects as the rift became larger. Helfar thought that would be his end, until an instructor sensed what was happening and sealed the rift, but at a price. It left one of the man’s arms withered and useless, from that day on Helfar swore off void magic. He would never use it again, but from that day whenever he encountered that darkness it would always whisper the words. “DOST THOU DESIRE THE POWER'' even though he never did.\n\n{/p}\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-GenBeauregardsLastStand:512:256}\n\n\n\n\n{h1:c}History-the beginning\n{/h1}\n\n{p:c}Helfar went on to specialize in holy magic after that day, he was forgiven by the priest that saved his life. But for a time the guilt of the event did remain with helfar. So in action he strived to make up for it. As a priest he helped those in need however he could. He healed the sick, gave advice to those that needed it, delivered sermons at times and even vanquished some restless spirits on a few occasions. His life continued peacefully like this for decades, along with his work as a priest he worked in an enchanting business with his family. They had become quite wealthy by this pont life was good, until the first war. At the time of the fall of stormwind during the first war, Helfar along with his immediate family lived there, as such they were forced to evacuate boarding ships to Lordaeron. When his family was settled in and a discussion was had, Helfar's parents decided that they would go out and fight in the 2nd war. Helfar, not being the type for battle at the time, remained in Lordaeron for the duration of the 2nd war healing the wounded while his parents fought far from him. Years later,by the wars end his parents did return as veterans of the 2nd life eventually, went back to normal things for the Fardawns were peaceful. They returned to stormwind eventually, evading the devastation of the third war when it came, though word of it had not escaped them and it weighed heavy on their hearts for years. In all this time however, something with helfar’s father had...changed. The man was going mad, sometimes ranting and raving about nonsensical things, developing a at times rather angry personality and refused to speak to other non elves for long periods. His father’s health weighed heavily on Helfar’s mind time and time again he was berated by his father due to the madness, and the thought of his homeland often made him wish to do something. He had all of this power in the light, he always had he needed to do something. This all came to a head one day when helfar decided to train as a paladin, as such he joined the silver hand for a time after a couple years of training he left. Not long after did he inform his mother that he would journey to Quel'thalas he wanted to help the Sin’dorei after what had befallen them. Helfar asked his mother to journey with him but she declined; she wished to stay and care for his father. Somewhat saddened by this Helfar said his goodbyes to his mother  and promised they would meet again. Unbeknownst to Helfar however, his mother was not going to leave him alone, she sent a Quel’dorei battlemage by the name of Nadra Doria after Helfar to keep an eye on him and protect him over the years. Nadra remained ever vigilant, sometimes even taking on illusions or disguises to talk to Helfar while he was none the wiser. \n\n{/p}\n\n{img:Interface\\QuestionFrame\\answer-warboard-bc-HellfirePeninsula:512:256}\n\n{h1:c}The Burning Crusade\n{/h1}\n\n{p:c}After a month and a half of traveling Helfar had finally reached the gates to Quel'thalas. There he found guards two stationed which upon seeing him demanded him to halt and explain the reason for his coming, they had seen the blue in his eyes clear as day. Helfar then said to them “Long have I been separated from my homeland, I have come to rejoin my people.” The guards were intrigued one produced a Fel crystal from his robes and told Helfar to drain the crystal dry. Somewhat hesitant he did, his body felt like it was burning as he absorbed the corruptive magic but he endured, his eyes now tainted green. After that he was let through and made his way to the hall of blood, quickly enlisting a Blood knight. There he met someone he did not expect to find a priestess he had known in the past by the name of “Ma’krish” she had enlisted as well. The two caught up over time and became friends, helfar however excelled at his blood knight training alright being trained by the Silver Hand some time prior. Ma’krish on the other hand was midway through her training and the two became full knights at around the same time and were assigned to the same division, not long after they were sent to netherstorm to battle against the forces of Kael'thas and after that to shadowmoon valley. Battle took adjusting to for helfar, but he took to it all the same,he found no pleasure in killing especially if it was any of his even brethren he had to say. But things like demons he took no issue with, he had always seen them as foul and unholy,worthy of only being sent back to the nether. Helfar and Ma’’krish fought together every step of the way, becoming the best of friends. He couldn't ask for a better companion but one final obstacle remained, the sunwell. By the conflicts end the sunwell was restored and Helfar eventually bathed in its light as most blood knights do. He could have given up his faith that day but he did not, the Light was always a part of him and so was believing in it. \n\n{/p}\n{h1:c}The Northrend campaign \n{/h1}\n \n{img:Interface\\Credits\\CreditsScreenKeyArt2WotLK:512:256}\n\n\n\n\n{p:c}Helfar eventually returned home to Quel’thlas to rest after his time in Outland was done. But this was not to last. The lich king awakened from his sumber on the frozen throne and threatened azeroth once more, as such the horde and helfar with it journeyed to Northrend to combat the scourge. Most of his time in the Northrend was spent in dragonblight and Icecrown, as always he fought with his good friend Ma’krish. The two had grown quite close at this point, Helfar though he never stated it had begun to have feelings for her but duty came before such a thing. He hoped to make his feeling clear to her when the conflict ended, little did he know she had the same idea, but this was never to be. The contingent of knights Helfar and Ma’krish were assigned to marched from Agmar’s hammer to the horde stronghold at the wrathgate.They were to be reinforcements for the struggling horde forces but they came into contact with a medium sized scourge force and a skirmish erupted. The battle lasted about an hour before it concluded. The blood knights were victorious, Helfar even killed his first Death knight. A feat he was proud of but it was short lived, during the skirmish Ma’kish had been slain. Her blood seemingly entirely drained and her corpse withered. Helfar was nothing short of devastated once her death sank in. He was given her dog tags to remember her by but for the remainder of the conflict there was an air of sorrow about him. He had to press on, he knew that is what she’d want and he went on to survive the remainder of the war in icecrown. By the end Helfar had had enough, he decided to retire and take up enchanting for a living. Throughout the cataclysm he maintained this profession, living quietly and contemplating his past. \n\n\n{/p}\n{h1:c}Pandaria\n\n{/h1}\n\n{img:Interface\\LFGFRAME\\LFGIcon-Pandaria:256:256}\n\n\n\n\n\n{p:c}Years later the conflict in Pandaria had begun Helfar, still being a civilian at this point felt somewhat torn about the conflict. At first it just seemed as though it was another war for territory, but as news continued to flow in as the days went on Helfar learned that there was a supposed “Darkness” in pandaria. This eventually prompted him to rejoin the Blood knights, they were happy to take him back as an old veteran. A day after rejoining he was sent with a new unit to the dread wastes. There he battled the mantid and quickly did he discover that they were under a sort of void influence known as “The sha” \n{/p}\n\n{h1:c}Bloodedge\n{/h1}\n\n\n{img:Interface\\LFGFRAME\\LFGIcon-ThunderForgotten:256:256}\n\n{p:c}Helfar performed exceptionally in his return to service. He fought with renewed strength and determination, but something happened to change Helfar in the midst of his service. One day, Helfar was taking leave and on his way home when he came upon seral portals with other Sin’dorei rushing out of them. Quickly he looked the scene over and spoke to a nearby guard who explained to him the slaughter in Dalaran. At first he was shocked, but this feeling was soon replaced with anger and a desire for vengeance. To himself he said “I will deal out justice for this atrocity and by the light it will be so!” Helfar immediately forgot his desire to take leave and went to volunteer to venture to the isle of thunder. There he became known for his ruthlessness and his tendency not to take pensioners be it Alliance, Zandalari or Mogu. For this ruthlessness he was promoted to the rank of Knight master and was granted the title “The Bloodedge.” Due to this Helfar was well known at the time, but after the brief truce when the gates of the thunder kings palace were opened he began to question if he should be acting this way. By the end of the campaign on the isle he decided to renounce the title his reason was cited to be”I do not wish to be known for blind zealotry and slaughter” \n{/p}\n",
