					["HI"] = {
						["TX"] = "Born on the western edge of Vol'dun, Konrow lost his mother before he began making memories. His father in his grief moved them to the Terrace of the Devoted, the sethrak that lived there took in the lost displaced pair sheltering them. As a child konrow would constantly worry his elders, he would dissapear off adventuring the surrounding areas sometimes for days. As he got older he got more ambisious eventually discovering the outskirts of Nazmir, over taken with curiousity he ventured in becoming lost for weeks. Eventually stumbiling though the swampy land he ended up in the middle of a conflict between the Zandalari and Blood trolls, attempting to hide from the savage fight he discovered his ability to meld in with the shadows themselves. In the wastes of the conflict Konrow approached the fallen trolls, his childish curiosity commanding him to learn as much as he could. Seeing the cruelty displayed by both sides he began realising that fighting face to face was a pointless waste of time and effort. Scrambling around aimlessly for the next few days he eventually found Vol'dun, he wandered along familiar routes to his home.\nYears later he would return to Nazmir, determined to overcome the road block which had denied him the him from exploring to his hearts content\n\nWhen the champions of the Horde arrived at the Terrace of the Devoted Konrow became amazed at the freedom they had, he followed their journey watching and learning that despite them still fighting in a bloody manner, they fought with purpose. Following them on their quests he soon picked up the orcish language. Later in one of his hidden expiditions through Dazar'alor he learn of vast lands far away from Zandalar, with his curiosity overtaking him he hurried back to his home to prepare for a long journey.\n\nThis is how he believed he spent his life...\n",
