				["PE"] = {
					["1"] = {
						["IC"] = "achievement_character_human_female",
						["TI"] = "Look Another E-Oh!",
						["AC"] = true,
						["TX"] = "At a distance and at first glance, Cerisa can and is often mistaken for a full blooded elf! She does, after all, take more after her mother who was Quel'dorei. She had gorgeous elven curves, beautiful slender elven ears and a cute lil' elven button nose. However, the human side came in with her average looking peachy complexion, her gentle emerald eyes and..oh goodness above she had freckles -and- dimples. Her earlobes were more rounded than an elf's as well and she carried herself with more of a natural human manner than the natural grace most elves shared. However, her elven side kicked back in with the fact her magical aura and aptitude was quite, quite strong and visible. Is she offended when mistaken for a full blooded elf? Nope, she's used to it and she's ok with it!",
					},
					["3"] = {
						["IC"] = "ability_mage_invisibility",
						["TI"] = "\"What was that noise??\"",
						["AC"] = true,
						["TX"] = "She didn't mean to be a snoop all the time, really! She's just..well..she's a very curious girl despite her timidity and shyness to new people. She did try her damndest to be sneaky about it at least to both protect herself and to not be a bother but, well, she wasn't quite -good- at stealth. When she hid in bushes, she often got too comfy or never realized her toes would poke out from bushes, sometimes both. She often did go invisible but her footfalls would give her away, especially in a panicked state if she was in such, and give away her direction. She really, really never had malicious intent behind her poor attempts to sneakily listen in, though! Curiosity just grips her often and she likes to listen!",
					},
					["2"] = {
						["IC"] = "inv_drink_02",
						["TI"] = "Juice Goblet!",
						["AC"] = true,
						["TX"] = "If she's not holding it in her hands, it's floating beside. The Goblet was a gorgeously created, handmade goblet that blended the cultures of Darkshire and Quel'thalas. It was made by her parents together as a permanent gift to Cerisa for when they were gone as a reminder of her heritage and a symbol of her parents always being with her. The Goblet was always only ever filled with her favorite childhood drink; Moonberry Juice! She loved Moonberry Juice to death because of the memories it has for her and the taste it brings to her lips. She keeps the Goblet close to her at all times and it is indeed attuned to her, meaning it will be yanked through the warpways of the leylines back to her if it is moved too far from her. She loves it to death and is very reluctant to have it be the focus of attention unless she was amongst trusted individuals.",
					},
					["5"] = {
						["IC"] = "petbattle_health",
						["TI"] = "Heart of Gold",
						["AC"] = true,
						["TX"] = "Despite everything she's been through and the jittery nerves the half elven girl has, she was at her core a very, very sweet and loving soul. She loved to help, she loved to laugh and she hated seeing others in rough spots. She'd always be one of the first to offer help in any way she can, albeit probably quietly or from talking into her goblet, but still! She had a heart of gold underneath the magic and the mana-reaping scythe and the skittishness she bore with her. She was a lover and friend first, a fighter second and she wasn't ashamed of it.",
					},
					["4"] = {
						["IC"] = "spell_misc_emotionsad",
						["TI"] = "Nerves and Jitters",
						["AC"] = true,
						["TX"] = "For as sweet as the girl was, the poor mageling was so timid and shy! She barely ever approached others and usually in group conversations she'd have to be roped into and back into conversations for her to keep participating, otherwise she'd pull into her own little world again and just listen in. She tried her hardest to let others know it wasn't because she didn't like anybody, she's just grown up sheltered and usualy being super super studious with her nose in a book studying magic and other avenues of life instead of social aptitude. She was a shy bean but there was a sweetie underneath the stutters and skittishness! One just had to push past that and they'd find quite the gal underneath. However, being the center of attention in any kind of setting did genuinely terrifying the girl unless there were ways to distract her and she could easily crack under pressure if the fact she had all eyes on her was made known to her. She wasn't as jittery now that her classes are passed, BUT it still comes out sometimes!",
					},
				},
				["v"] = 24,
			},
