			["about"] = {
				["v"] = 3,
				["BK"] = 9,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n{col:bbbbbb}\"Mad world beats,\noutside our heart.\nTimes of need,\nWe are apart.{/col}\n\n{p:c}{col:bbbbbb}————————{/col}{/p}\n\n{p:r}{col:bbbbbb}Under stars,\nwe are alone.\nGive yourself to harmony,\nunderneath the stars.\"{/col}{/p}\n\n\n\n{h2:c}{icon:spell_priest_divinestar_shadow:25}{col:bbbbbb}• • • • • {/col}{icon:spell_priest_divinestar_holy:25}{/h2}\n\n{h3:c}{col:bbbbbb}Ceracus Dearing{/col}{/h3}\n{img:Interface\\QuestionFrame\\answer-ArtifactTEMP:256:128}\n\n{col:bbbbbb}Exploits of endurance and enigma carry around the elf's travels from decades past to rural areas of modern moors. Ceracus \"Cera\" Dearing upholds every ounce of the tenets befitting knights down to its most common principles; though, not without scrutiny. Considered an outcast amongst his kin and their connections, the knight walked with a bitter determination and commodity of conscience. Values and morality never the same thing; at least, to him.\n\nA stature of height isn't the only thing to command respect, but the posture in which it's fostered, and Cera marries bulk and brawn with the statuesque demeanour to keep it carved in marble. Taught in yesteryear to tame the natural inhibitions to scale back, a dog-eared determination refuses to rouse any laxness upon his pale person, and maintains that mantra despite how stern, cold, and unfathomable the aura he exudes. Exhales that seek exodus concentrate through pursed tiers, eyes train with a cautionary circumspect, and a right-hand claims its crown upon his beloved sword's pommel. Every digit upon the left-hand, apart from the index and thumb, remains cleaved to the knuckle in a harsh reminder of a rigorous past; because of such, his expert swordsmanship hails solely from his right-hand. Confidence without arrogance, and arrogance without its consequences. \n\nA broad face, chiseled in bulk, remains scarless except for a tiny scar just under his left-eye, some small swipe of a dirk. A thick brush of prickly hair, oft kempt, trims without tear to his jut of jaw, high cheekbones, and marries at the hidden cleft of clutched chin. The severe ridge of his browbeaten narrow forbodes fiery thought, a volcanic heat with a molten portcullis that refuses to show its flame. The neutral lines to venerable features come across as unsettling for their fortitude that lacks change; as if truly sculpted. {/col}\n \n{img:Interface\\QuestionFrame\\answer-ArtifactTEMP:256:128}\n\n{h2:c}{icon:spell_priest_divinestar_shadow:25}{col:bbbbbb}• • • • • {/col}{icon:spell_priest_divinestar_holy:25}{/h2}\n\n{h3:c}{col:bbbbbb}Hooks, hubris, and general information!{/col}{/h3}\n\n{col:bbbbbb}• Many Sin'dorei and Quel'dorei would know of Cera's exploits, both good and bad but always grand in scale; a leader in the efforts to eradicate the remaining Scourge from the shattered Quel'Danas.\n\n• An expert swordsman; a mix of brutality and sly agility cultivated his renowned antics and loyalties. Teaches and tames those unskilled.\n\n• Known to be a widower in his homelands to a fallen husband, then a fallen wife; any children, if alive, remain unknown to general record.{/col}\n\n",
				},
