					["TX"] = "{h1:c}Description!{/h1}\nBefore you, standing tall and proud is Aji’rena. You may or may not be fucked but whatever fate has befallen you, here she is. She is like many other from the Jungle when it comes to her height, and a lifetime of war thanks to the violent climate that is her home has honed her body into a weapon, she proudly displays this toned muscle and her thighs can and will crush the life out of you should be fortunate enough to be between them. \n\nHer skin is a luscious shade of blue, she uses only the finest and natural Gurubashi methods to keep it this way and it is complemented with white bone tattoos. Her face is tattooed with a white skull, her eyes are blue and piercing, she is judging you. The right side of her face is cleanly shaven, her hair is a silky white like the clouds and fashioned into a braid. Decorating her the braid is a net of bones.\n\nPierced in her ears are ivory and bone, piercings are also slightly on her chest, hidden by a dark basilisk hide bra, she is a D cup if you are curious and brave enough to stare. Around her neck are obsidian and bone necklaces. Her attire beyond the bra, is a chainmail kilt and rather ornate. Bone is used for fashion over top of the chainmail underneath, each bone link and ivory tusk that hang from it is carved in depictions and prayers of her Loa.\n\n{h1:c}MISC INFO!{/h1}\nShe has a themesong!\n{link*https://youtu.be/7BE3J2nQ3Wg*https://youtu.be/7BE3J2nQ3Wg}\nHere is a list of other jams I use to vibe into Aji!\n{link*https://youtu.be/M22rNPh6bHo*https://youtu.be/M22rNPh6bHo}\n{link*https://youtu.be/Y2e47wBWTV8*https://youtu.be/Y2e47wBWTV8}\n{link*https://youtu.be/0VD7i2xUH5c*https://youtu.be/0VD7i2xUH5c}\n{link*https://youtu.be/vflRxjjMftY*https://youtu.be/vflRxjjMftY}\n\n{h3}Inspirations!{/h3}\nBEHOLD THE MIGHT OF SHANGO!\n{link*https://youtu.be/nBYZpsbu9ds*https://youtu.be/nBYZpsbu9ds}\nHE WILL SMITE!\n{link*https://youtu.be/tq1mxZZIuIY*https://youtu.be/tq1mxZZIuIY}\nHE IS POWER!\