				["TE"] = 1,
				["T1"] = {
					["TX"] = "(Mandatory UNDER CONSTRUCTION sign.)\n\n{col:e5feff}{h1:c}In various places, wanted posters could be seen. Though citing crimes from various factions.{/h1}{/col}\n\n{col:dd0005}Steemwheedle Cartel: WANTED FOR THEFT OF HIGHLY VALUABLE PRODUCTS.\nVenture Co: WANTED FOR MURDER OF SITE FOREMAN.\nSilvermoon: WANTED FOR ALLEGED ABDUCTION OF NOBILITY.\nKingdom of Stormwind: WANTED FOR MURDER, ABDUCTION, VARIOUS COUNTS OF THEFT, AND HORDE AFFILIATION.\nDarnassus: ARSON.{/col}\n\n{col:e5feff}{h1:c}Each poster gives a general description of the culprit. {/h1}{/col}\n{col:dd0005}Race: Orc\nHeight: Six feet\nBody build: Muscular\nSkin color: Green\nEyes: Blue\nHair color: Red\nAge: Aproximately early to mid 30s\nWeight: Aporiximately 190-230 pounds{/col}\n\n{col:e5feff}{h1:c}A number of posters seem to have some graffiti on them, likely from people who's seen or met her. A few of the gems are as follows.{/h1}{/col}\n{col:5cff26}\"Rude bitch.\"\n\"She stole my drink.\"\n\"Orc has a big ass.\"\n\"Nope.\"\n\"For a good time find <random name>.\"\n\"Do people even read these?\"\n\"NO DON'T PICK ME U-\" And there is a line just going up.\n\"COME SEE THE BILEWATER CARTEL. IF WE DON'T GOT IT, THEN WE'LL SELL YOU SOMETHING ELSE!!! Insurance not guarenteed.\"\nThe word \"MOCKERY\" is written in big letters.\nAmong others.{/col}\n\n{col:9bb1ff}One of her exes may be selling more personal information about her.(Whisp for link if its something your character would buy. 18+ only.){/col}\n\n{col:6fff1b}Other character info:\n\nSiblings! Mo'karie has 3 siblings. One of them happens to be her twin.\nHer father is still alive. Likely retired.\nYou would know her or recognize her insignia if you are Uncrowned.\nMo'karie has a pet hawk that she has a mental link to.\nShe has a fascination with alchemy.\nShe does not have any tattoos or piercings.\nHer satchel is enchanted to hold much more than it looks like it can. By thinking of the item, it raises upwards into Mo'karie's hand. Who knows what she will pull out?{/col}\n",
