		["1026153431cOhdM"] = {
			["character"] = {
				["CU"] = "Chillin.\n",
				["CO"] = "Player is 21M. Straight Friendly.\nCross Faction RP is DOPE!\nTRP WIP\nWalkups/Whispers welcome.\n\n",
				["RP"] = 2,
				["LC"] = "enUS",
				["XP"] = 1,
				["v"] = 88,
			},
			["time"] = 1631042713,
			["link"] = {
				["Eskender-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Standing at 6'8, Eskender is your orc with large and strong muscles throughout his body.\n- His hair is tied into a topknot.\n-Two scars bare above his right lip region.\nTo show his heritage pride, he is sometimes seen with blue warpaint on, to symbolize the Frostwolf clan.\n",
						["BK"] = 9,
					},
					["PS"] = {
						["TX"] = "He has a calm nature to him, often times thinking before acting on a matter. He often tends to be quiet around others, although he greatly enjoys good company.\n-He strongly believes in forgiveness and second chances, and does not hold anything against anyone. \n-His time in serving the Horde has done great for his battle skills. At times, he can be seen with his mighty axe strapped to his back.\n",
						["BK"] = 9,
					},
					["HI"] = {
						["TX"] = "  Eskender was born as the second and last child of Hirom and Ruuta, and younger brother of Okoth in the Alterac Valley after the Frostwolf Clan had been exiled by Gul'dan once they had crossed the Dark Portal into Azeroth. During his youth, he was very close with his father, whom was a wise and noble shaman. Hirom had begun to help train the ways of shamanism to his eldest son, Okoth and had been guiding him. Eskender tends to carry much of his fathers wisdom and strength with him to this day to honor his memory. His mother, Ruuta looked after the two brothers and loved and cared for them greatly. She too saw great promise in Okoth and supported him as well with his elemental powers and spiritual connection.\n\n* During the conflict between the Frostwolves and the Stormpikes, Eskender's father was slain by Okoth, who had deserted his shamanistic ways and became a warlock prior to the incident. Eskender grieved and sought out vengence, but he remembered the lessons his father taught him and chose to let it all go and move on. Soon after, his mother fell in a deep state of sorrow and never moved past the lost of her mate. Eskender did everything in his power to help her move past their loss but unfortunately, she passed on over to her ancestors. Eskender made an oath to himself that he would never seek to punish his brother for his treacherous actions that broke his family apart. Since then, the elders of his clan had taken good care of him and were proud when he had came of age.  \n\n* He soon joined his chieftain, Warchief Thrall to free his imprisoned orcish brethren in the internment camps. He also journeyed across the sea to Kalimdor where he fought beside his chieftain and brethren in search of a new land for their people, though his heart will always remain in the Alterac Mountains. He eventually enlisted in the newly formed Horde and fought in the Third War against the Burning Legion. He was present at the Battle for Mount Hyjal and fought alongside the Humans and Night Elves, an event that has stayed with him to this very day. \n\n* Over the many years, Eskender took part in many of Azeroths historical conflicts, he lended his aid to the Argent Crusade against the Lich King, chose to rebel against his former Warchief, Garrosh Hellscream, and ventured to an alternate version of his homeworld, Draenor. Numerous times his brother would threaten him for not joining him in his demonic ways, and each time, Eskender would boldly refuse. Over the years, Eskender would witness and often times even participate in some of the Hordes atrocities throughout Azeroth. He would even begin to question his own loyalty to the Horde. He despised the way that the Horde had started to become and even had thoughts about abandoning it entirely. \n\n* Eskender was also present at the Burning of Teldrassil. He truly believed that he had lost his honor for participating in the burning and slaughter of a people he had called an ally long ago. He would even despise himself for that very reason. During the Fourth War, Eskender had come across a noble human paladin while out scouting in Nazmir. The two soldiers immediately clashed, but showed great honor and respect towards each other as enemies. Their battle caught the attention of a few blood trolls and were both ambushed by them. The paladin was knocked unconscious and fell in a marshy river. Eskender fought off the attackers and was even wounded in the process. Once the ambushers had been dispatched, he chose not to finish the human off, but instead showed compassion when he rescued him from the water. \n\n* During a battle, Eskender was captured and taken to Stormwind for interrogation where he was beaten and tortured by the guards everyday. One of the two guards had recognized Eskender from the War of Thorns and had taken personal vengence of tormenting him the worst. The other guard had extreme hatred in his heart and would rather see Eskender dead then and there but still enjoyed witnessing his torture. They had contacted his brother, where it was revealed that they too, delved with demonic magic and had informed him of his little brothers location and predicament. \n\nSeeing his chance, Okoth met the three of them on the outskirts of Stormwind and gave Eskender a choice, \"Submit to him or Die.\" Eskender believed that he could save his brother from his demonic ways by reminding him of his old shamanistic life. The trio laughed at him and decided that he was as good as dead. They planned to behead him but decided to torment him some more before they could. Eskender was mere inches away from losing his life until a blast of holy light errupted near them and had saved him. It was the paladin that he had encountered back in Nazmir. He had promised Eskender that he would help him regain his honor in return for sparing his life during their fight.The human secretly looked after him while he was in captivity and even pleaded for him to be released, but none would listen. \n\nWhen the paladin arrived, he was shocked and angered by the amount of treachery that he was witnessing. He immediately battled the two guards and did his best to protect Eskender from them. The paladin had even managed to blind one of them before they could both escape. Okoth had stabbed Eskender directly in his heart making sure that he wouldn't leave there alive. The human attempted to end Okoth but was stopped by Eskender who insisted for him to be spared. The human used his powers to heal away the wounds throughout his companions body and was greatly relieved to see Eskender back on his feet.\n\n* After that, the two were both present at the Mok'gora between High Overlord Saurfang and Warchief Sylvannas. They eventually became good friends and even consider  each other as family despite their obvious differences. Eskender answered the call to battle once more when the sky shattered. He has been helping out in any way that he can with the conflict and hopes for a greater future for Azeroth.\n\n",
						["BK"] = 9,
					},
