			["about"] = {
				["T1"] = {
					["TX"] = "{h3:c}{col:5ecbff}Bastioux Silverfume{/col}{/h3}\n{col:76ffee}---------------------{col:a5ffea}----{col:cffff9}{col:f2fff9}-----------{/col}------{/col}----------------------{/col}--------------------------------{/col}\n{col:9cd2ff}Easy on the eyes is something that you’d agree with the first moment you see Bastioux. With her accentuated curves and well rounded assets. Red hair cut up in the pixie style, keeping it out of her eyes and swept back behind her ears. Two emerald earrings accentuated her lobes, decorating them royally Beautiful golden eyes light up the room when she steps in, piercing through souls and clothing alike. Plush lips that curl in to smiles guaranteed to draw your attention with every flirtatious glance she could give you.{/col}\n \n \n{p:c}{icon:petbattle_health:14}{icon:petbattle_health:14}{icon:petbattle_health:14}{/p}\n\n{col:ff5583}Any info can be learned through RP. Some general information though:\n\n-Informally trained as a pyromancer\n-Does both mercenary and artisan work\n-Enjoys smoking her peace pipe and is a free spirit\n-Typically friendly towards new people\n-Too often gets herself into trouble\n\n\nOOC\n\n-Player enjoys and is open to most rp\n-EST. I'm tabbed often\n-Whisper if you're interested in setting up a scene or rp!{/col}\n\n          {col:646464}    /c/bastioux{/col}",
