				["Kïri-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["v"] = 65,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:00b08d}Kiri Hellblaze{/col}{/h1}\n{h3:c}{col:ff0051}Crane Style Master{icon:monk_stance_redcrane:25}\nShrouded Serpent Blademaster {icon:inv_jewelcrafting_azureserpent:25}\nKin of the Pandaren {icon:achievement_character_pandaren_female:25}\n{/col}{/h3}\n\n\n{h2:c}{col:ff0051}Appearance{/col}{/h2}\n\nKiri sported a thin and flexible body with pale skin. Her soft shoulders lead to her developed breast. A slim waist leading into very wide hips and a thick bubbly rear. Overall she sported a balance of tone and fat which lead to her attractive, thin and powerful form.\n\nHer Attire often resembled where she trained, either wearing kimono's, Ghi's, simple tunics or more advanced garb fit for a pandaren war dancer, or often a mixture. It was clear she took a lot from the land she trained in, coming off more Pandaren then Elf.\n\n{h2:c}{col:00b08d}{icon:inv_snake_blue:25}Blademastery, The Shrouded Serpent{icon:inv_jewelcrafting_azureserpent:25}{/col}{/h2}\nThe Shrouded Serpent is an unorthodox Form of Blademastery incorporating the strong powers of Water, refining the normally beneficial element of healing into a deadly one. It was honed and created by Kengar the Sage, Champion Blademaster of the Burning Blade Clan.\n\nDesigned to be a flexible style able to adapt to anything, Mimicking the flow of water, and movements of Serpent's. Employing Razor Sharp Currents of water, Mighty tides, and disorientating mist as well as spiritual or chi magic, incorporating the normally beneficial element of water into nearly every technique with mist often cloaking or disorientating the abilities and attacks the Blademaster would perform. Making it both hard to predict and often well suited to stealth oriented fighting making this style of combat well versed in all manners of combat from the battlefield, to behind enemy lines.\n\n{h3:c}{col:00b08d}First Form: Decisive Current {icon:ability_mage_waterjet:25}\nSecond Form: Crescent Razor Mist {icon:ability_skyreach_wind_wall:25}\nThird Form: Crushing Depth's{icon:shaman_pvp_ripplingwaters:25}\nFourth Form: Whirlpool {icon:ability_monk_cranekick:25}\nFifth Form: Low Fog {icon:spell_monk_envelopingmist:25}\nSixth Form: Tidal Wave {icon:spell_frost_summonwaterelemental:25}\nSeventh Form: Crescent Moon Storm {icon:artifactability_balancedruid_halfmoon:25}\nEighth Form: Slumbering Fog {icon:spell_holiday_tow_spicecloud:25}\nNinth Form: Advancing Serpent {icon:trade_archaeology_whitehydrafigurine:25}\nTenth Form: Final Eclipse {icon:artifactability_balancedruid_newmoon:25}\n{/col}{/h3}\n\n{h2:c}{col:ff0051}{icon:inv_misc_book_07:25}Hooks and History{icon:inv_inscription_80_warscroll_battleshout:25}{/col}{/h2}\n\n{h3:c}{icon:inv_pet_cranegod:25} Master Crane Monk{/h3}\nKiri is a Master of the Crane Style, a flexible martial art that specializs in chi magic, healing and fending off multiple foes. Taken to the Crane Temple by a wandering Pandaren at a young age she would train here up till the Invasion of Pandaria.\n\n{h3:c}{icon:spell_monk_mistweaver_spec:25} Traveling Healer{/h3}\nAfter finishing her training, Kiri traveled the lands and came to Orgrimmar where some of her first true experiances with the Horde began. She'd often offer her healing aid free of Charge so that should could learn more about the Horde and after some time. Eventually joining up with a local Horde Clan, The Scar Blade of Alterac.\n\n{h3:c}{icon:inv_pet_tigergodcub:25} Temple of the White Tiger{/h3}\nAfter enduring the majority of the 4th War, and being a Prisoner of War for the Dwarves and putting up with their abuses. Kiri would return to Pandaria to continue her advanced training, venturing to the White Tigers Temple to refine her combat style and even begin learning advanced techniques with Blades and other weapons. She spent much time here training endlessly and even helping the locals with Bandits and other problems.\n\n{h3:c}{icon:pandarenracial_innerpeace:25} A New Mentor, Blademaster Kengar The Sage{/h3}\nEventually Kiri would find herself under Master Kengar, an Orc of the Burning Blade famous for both his training of entire generations of warriors and authoring of lewd books. Kengar was a Master Monk, Blademaster, and member of the Shado-Pan. \n\nKengar would teach Kiri the art of Deception, Infiltration and Assasination, and begin her training to become a Blademaster with hopes of her joining the Shado-Pan one day. Together during these tiems Kiri would infilrate a local brothel disguising herself as a working girl. While blending in, she'd gather much information.. and later with the aid of Kengar, and with some training to become more intune with the Spirit of Water they'd dismantle the drug running gang known as the \"Red Lotus\". Kiri would then further her training in the arts of Stealth.. and of mastering the Blade.\n\n{h3:c}{icon:achievement_nazmir_boss_mythraxtheunraveler:25} Black Empire Invasion{/h3}\nLater Kiri had returned to the Crane Temple now a Senior Master Monk, during this time Pandaria and more specifically the Vale had been invaded by the Black Empire. She was one of many who rose to defend the sacred capital of Pandaria. Though became one of many more victims to the Dark Empire's forces. Captured, she fell to numerous horrors that tested  and even broke her santiy as well as body being ravenously defiled.\n\nThis Defeat broke her mentally, spiritually, and physically. Leaving her a nearly crazed hermit wandering the lands like an aimeless vagabond. Barely a remnant of her former self present. She'd be like this for some time before eventually being nursed into recovery.. Where she made a quick return to training and strenghtening herself and re-establishing herself as a Master Monk.\n\n{h3:c}{icon:achievement_battleground_templeofkotmogu:25} Sun Spring Onsen & Meadery{/h3}\nAs time relaxed, somewhat. Kiri founded a Onsen nestled in the Valley of Four Winds, built around a singular spring which offered co-ed bathing along side a meadery, selling a wide variety of meads alongsides other services. The Honey for the mead sourced from her own Bee farm.\n\n{h2:c}{col:ff0051}OOC{/col}{/h2}\n\n21+ All Themes Accepted including Dark and Adult/NSFW\n\n{link*https://twitter.com/KHellblaze*Twitter of Kiri} \n\n{link*https://imgur.com/a/fpGJs7o*Kiri's Art NSFW}\n",
				},
