			["about"] = {
				["T2"] = {
					{
						["TX"] = "Skalzz stood average for a goblin, having average body build.  Though with some fat to him, though, nothing outstanding to call him obese.  The man’s most outstanding features were of his face.\n\nThe Goblin’s face was showing his age.  This was from the creases he had and small sweeps of grey that littered near the roots of his black hair.  The depression marks on his face, wrinkles some would call them, others would call them scars.  It was hard to say given they looked aged.  The man’s eyes though lacked the crowsfeet that was common of someone his age, though Skalzz had some laugh lines, especially when smiling.  Another quality of him was his ears, making him considerably taller to most standards.  Curved slightly at the top and would bob while he walked due to their size.  It was large ears or his piercing eyes.  That were red, quite the deep red as if the dying embers of a fire.  Though one thing one could not forget was his nose.  Carrot shaped.  He would commonly rub it or something to hide it, perhaps due to some hate for the whole thing.\n\nHis garb would carry around some rather astute pieces to perhaps show his nature as a businessman. Though the outfit was worn with pride, most likely due to his longevity as most goblins do not live too long, mostly due to ‘Accidents’ of one account or another, usually involving an explosion or a knife.  What was almost always on him were three things; A quill.  An ink well.  A notepad of some sort.  No matter what he wore these were things he always kept near him, most likely due to the avarice nature it would feed into what was most goblins.",
