			},
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-AlliedRace-Highmountain:256:128}\n{h1:c}{col:FF1D00}Solruhk Surgestomp{/col}{/h1}\n{h2:c}{col:FF1D00}• Highmountain Mechanist •{/col}{/h2}\n{h2:c}{col:9C6144}o o o{/col}{/h2}\n{h2:c}{col:FF1D00}Appearance{/col}{/h2}\n{img:Interface\\PETBATTLES\\Weather-BurntEarth:512:5}\n\n{p:c}{col:ffffff}• Solruhk's Bloodtotem heritage is immediately clear upon seeing him; the bull stands at an intimidating height, having more than enough muscle and bulk to back it all up. \n\n• The next most obvious thing about the tauren is his limbs. Both of his forearms and lower legs have been replaced with robotic prosthetics. Even his hooves are now hefty blocks of bronze-plated solid steel.\n\n• Those who are familiar with the different schools of engineering on Azeroth would recognize his mechanical limbs to be, strangely enough, Mechagonian in design. They are expertly crafted, and are near constantly thrumming with energy.\n\n• Said energy seems to be sourced from the almost fluorescent red markings on his body; the barely noticeable glow coming from beneath his skin growing brighter, then darker in time with the lights on his prosthetics.\n\n• The last bit of visible robotics on Solrukh is his right eye, the orb and socket replaced entirely with metal and a glowing crimson piece of optic tech. Surprisingly, it doesn't do anything fancy besides enabling him to still be able to see from the right side. At least, as far as he knows.\n\n• The reason behind all the mechanical bits on the tauren becomes clear when one looks where machine and flesh meet; the tissue there is heavily scarred, remnants of burns and other nasty looking wounds remaining still on Solrukh's thick hide. Whatever catastrophe happened to him, must have been enough to take his extremeties along with it.{/col}{/p}\n\n{h2:c}{link*https://www.heroforge.com/load_config%3D22050163/*Rough Visual Reference}{/h2}\n\n{h2:c}{col:FF1D00}Personality{/col}{/h2}\n{img:Interface\\PETBATTLES\\Weather-BurntEarth:512:5}\n\n{p:c}{col:ffffff}• Solruhk is certainly the loner type. Happy to take part in as little conversation as possible, he tries his best to keep to himself. However, he does like eavesdropping on others, hence why he even bothers to appear in populated places.\n\n• If one does manage to get him talking, they'd find that Solruhk is a pretty stereotypical Bloodtotem, personality-wise. He finds it hard to trust others, particularly non-tauren, and his violent nature often extends to his words.\n\n• Despite his anti-social nature, Solruhk is capable of caring for others. Those that have managed to befriend the Bloodtotem are few and far between, but those small few have earned themselves a stalwart companion.{/col}{/p}\n\n{img:Interface\\PVPFrame\\Icons\\prestige-icon-6-4:128:128}\n\n",
				},
