			["character"] = {
				["v"] = 19,
				["CO"] = "- Friendly to all. Tends to alttab a lot. Is 21+.\n- ART in about!\n- Walk-ups adored.\n- VC: Lothric/Gwyndolin (Dark Souls series)\n\n\nI'm a EU intruder!\n",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "Feeling content and being himself in all ways possible.\n\n(might be tabbed)",
			},
			["about"] = {
				["v"] = 16,
				["BK"] = 5,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link* https://imgur.com/a/1GDqbrp*Garn's 3D gallery. I add new renders every now and then depending on how lazy I feel...}\n\n{link* https://twitter.com/HowliteArt/status/1424719314318512133/photo/1*Garn with his worgen friend; by Howlite on Twitter.}\n\n{link* https://twitter.com/DuskDog/status/1425924249139679234/photo/1*In his fancy outfit; Drawn by my BF!.}\n\n\n{h1:c}Crucial OOC Info First{/h1}\n{p:c}Hi! So basically, this player is still rather inexperienced in WoW RP, most other experience being from very casual RP be it in a game or anywhere else. He is also NOT a native english speaker, thus sometimes a slow reader and typer but hopefully not too slow, and his vocabulary might not be always rich. Sometimes I literally have a translator open to fully comprehend what's being said, woops....{/p}\n\n{h1:c}Story{/h1}\n{p:c}Like most death knights, Garnacuga doesn‘t remember anything from his life before his ressurection. All he remembers is waking up in the middle of the night into fear, anxiety, confusion and choking while feeling a strange frosty aura radiating around his body. He felt very cold, stiff and was tearing up. He didn't remember who or where he was and what happened. Before him stood a wolf-like humanoid figure with blue light illuminating from her eyes. It appeared to be the death knight who brought him back. She sighed and didn't look happy. She figured the ressurection was a rare case and the vulpera retained all his emotions and was then too confused and vulnerable to wield the powers of a death knight responsibly. Without a word she knocked him out and locked him up in a hideout where this newly raised vulpera death knight spent an unknown time learning about his new powers and what it meant for him now that he became a death knight himself. The next thing he remembers is waking up, again, in the middle of the night in Vol'dun near the caravan hideaway. As he opened his eyes he saw the frightened faces of his vulpera friends who seemed like they are not sure whether to be happy their friend is back or to weep because of what has become of him..\n{/p}\n{p:c}His people were rather cautious around him and did not seem to trust him much anymore. That's why he decided to leave his home to serve the horde and make his people proud by his deeds. Despite serving the Ebon Blade and the Horde, his people are still the most important to him and tries to show he is still one of them. Or maybe it is just that he tries to convince himself he is.{/p}\n{p:c}Garnacuga’s past has many unknowns. Since the day he was risen, he has found out some things with the help of others, yet there are still many that he wishes to figure out.{/p}\n\n\n{h1:c}Physical Info{/h1}\n{p:c}Physically, Garnacuga had to be a very well-built Vulpera in life. His body is quite muscular and athletic, even in his current condition, making him stronger than the majority of living vulperans. His body is very durable and sturdy to the elements and physical attacks, which might be partially both a perk of being a Death Knight and a remnant of his training before his death.\n{/p}\n{p:c}He has a white and dark grey fur. His fur is quite messy and wild yet it shows some signs of attempts of proper grooming. Due to not wearing much armor, his whole body is covered in many battle scars of different sizes. His grin reveals that he's missing a few fangs. He has no signs of decay, apart from losing some fur recently.{/p}\n\n\n{h1:c}Personality{/h1}\n{p:c}Garnacuga's mental side is a complicated one. On one hand, he can get super cocky about his physical traits and is convinced he is very attractive even for being basically dead. He never hesitates to show off his muscles and scars, which are exposed most of the time.{/p}\n{p:c}Otherwise, he is a wreck. Insecure about his death knight powers and convinced everyone he would meet would initially hate him for what he is. Unlike most of his comrades, he hasn't lost emotions and can feel anything, positive or negative, just like a living individual.{/p}\n{p:c}Most significantly, this makes him suffer when he kills or makes someone else suffer, sooner or later feeling remorse and having to hide these feelings as it would render him weak and useless. Every kill sates his neverending death knightish hunger but depending on who or what he kills, it hurts him on the inside too.{/p}\n{p:c}In combat, he is ruthless and has little care for what could happen to him, taking great risks while attacking furiously and moving swiftly thanks to the lack of armor, which labeled him as a berserker.{/p}\n{p:c}Off-duty he tries to be as normal as possible, trying to fit in with the living, though he might often appear as a shy lone fox. He likes to make meaningful relationships and always makes sure his friends know they have his support and protection.{/p}\n\n\n{h1:c}Weaponry{/h1}\n{p:c}Garnacuga is barely ever seen with any other weapon than his two one-handed blades. Seemingly, he has always been specialized in dual-wielding and feels vulnerable whenever he doesn’t have a weapon in each hand. His blades are tied to his bracers with chains to make sure he never loses them during a battle.{/p}\n\n\n\n\n",
				},
