						["TX"] = " Ataya and Motami were two trolls who found themselves cut off from their tribe, the Darkspear due to the fighting. They traveled day and night to find a new home and came across the Moonglade where they settled down as teachers and guardians. This is also where Toki would be born.\n\n    Toki grew up around other Moonglade Trolls, Night Elves and Tauren. He loved the peaceful life and used his powers to heal and restore. He couldn't change forms and shift as easy as other druids in training and didn't really mind fighting since it really wasn't his thing anyway.\n\n One day his his father Motami decided he would begin a life of sage and grew into a large tree..... yes a tree. He felt Toki had a calling to be more than just a healer so he became a tree to pull all the nature around him until Toki became nineteen where he took one of his branches and crafted it into a staff that Toki would set out with to start his own training in Sagehood, to be a healer of the world.\n\n ",
