				["TE"] = 1,
				["T1"] = {
					["TX"] = "Whatever savage beauty this Troll may have once posessed has been tainted by an obvious past association with the forces of the Scourge, and more specifically, the small legion of Ebon Knights Arthas raised in his failed attempt on Fordring's life at Light's Hope Chapel.\n\nWhere once she may have been lively and vibrant, what remains is a creature of obvious undeath; her skin darkened and mottled under a thin layer of fine, dark fur, and dry, neglected dark hair, fading to grey, has been pulled back in a loose, messy collection of braids and tails. \n\nAcross her face, and on her often bared torso and arms, she wears white paint in the design of segments of bone, and while her physique and features, sallow in undeath though they are, hint at youth, a fixed scowl and world weary countenance mark her as one who, through circumstance, has lived more than her years on Azeroth would indicate.\n\nAnymore she typically stays dressed down, wearing her old Ebon Order sarong, and simple bandages to bind her chest. Beyond this, she carries a matched pair of runed broadswords and little else on her person besides.",
