			["about"] = {
				["T1"] = {
					["TX"] = "Absolutely monstrous, gruff, albeit good-natured,, semi-retired warbeast from Highmountain that spends most of his days slinking about Orgrimmar, drinking, meeting folks and generally having a good time.\n\nHe often lingers in his animal forms more often than not, finding them to be more comfortable in many situations. As a result his mannerisms have the propensity to be a bit wild, so to speak. He tries to keep them in check as best he can.\n\nAll types of rp accepted, walk-ups/whispers welcome.",
