		["1127165156l3ZsP"] = {
			["character"] = {
				["v"] = 32,
				["CO"] = "~<Voidstar Syndicate> is recruiting. Heavy RP, Casual raid guild. All dark and devious welcome. Pst for more info.\n~25+ (player is female and over 30)\n~Walk up/Whisper friendly\n~Mirror/Para\n~Character has 10+ years rp history\n~I'm not interested in your bullshit drama\n",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "Eyes cast down in a small black book, sipping on a glass of something that has an alluring and intoxicating smell. (Afk rq, pst)\n\nCurrent Theme/Mood: Devil's Night - Johnny Hollow\n\n\n((Working on TRP, since the damn thing wiped))",
			},
			["time"] = 1631081969,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-BlackRookHold:256:128}\n\n{h1:c}Unwilling Transaction{/h1}\n\n\nScreams bounced off the walls of the dark and twisted halls of the old mansion. The location was never revealed to anyone outside of Morrigan’s personal circle of trusted allies. There was a massive library and a fully stocked laboratory that were both used frequently. Today’s venture though, was something on a more personal note.\n\nMore screams sounded, echoing from the room at the end of the hallway, which led to the laboratory. \n\n“Did I not warn you? I’m fairly certain I made it very clear that if I were to catch you harassing my dear friends again, we were going to have words.” Morrigan’s voice in another setting may have come off as darkly alluring, but to the male Sin’dorei tied to the table, it was anything but. It was a siren’s song, and he knew it.\n\n“This is far more than just words!” He said, exasperated and trying with the last bit of his energy to pull free of his restraints. He was sitting in a large chair made of obsidian, magical shackles bound to his wrists, ankles, and neck. Every time he made to struggle, he collapsed back into the seat, panting. The warlock never once touched him. Not yet. She simply stood in front of him, her hands folded in front of her as her half smirk grew. \n“What’s wrong? The struggling not helping?” She cooed in a grotesquely sweet tone. He responded only with a glare, which only enticed a soft giggle from her lips.\n\nMorrigan moved closer to him, her hips swaying hypnotically as she approached, her hair brushing just past her shoulders, just barely kissing to top of her chest.\n\n“You see… lovely,” she began, pausing in front of him to look over her prey. “These chains are not just bound to your flesh alone, no no…” She giggled, walking over, and running her index finger gently over his arm and up to his shoulder as she passed. “Those are bound to your soul. Every time you struggle, you’re only pulling at your own soul.”\n\n“Bitch!” He snapped his head to the side, trying to keep her in his vision, but she had slipped into the shadows. \n\n“Oh, baby doll, I’ve been called far worse than that,” she let her melodic giggle fill the room again, now coming back into view, but something was clutched in her fingertips. He could not quite make out what it was since he was too focused on the devious grin on her face.\n\n“It’s rare if I don’t allow someone to correct their mistakes. I gave you a chance to not come after one of my people again and you ignored my warning. See, when that happens, then we have a problem.” Her grin faded into a stone-cold expression as her purple hues locked with the male’s fel green gaze. “You became a problem.” \nBefore he could retort, his mouth beginning to open, Morrigan’s hand shot forth, her fingers gripping a purple shard, pointed at him. Instead of words, his face contorted to a ghostly length as he wailed in agony. Wisps of his soul seeped out of his pores as if an ethereal sweat were being pulled from them. The ghostly wisps became caught in the purple swirling vortex that was the attraction of the shard. \n\nHer lips moved as she softly chanted an incantation, her free hand helping gently guide the male’s soul into the shard. \n\n“You spent so much time fighting yourself, you weakened your own soul for me,” she stated as the last of the Sin’dorei’s essence was absorbed into the crystal. It pulsed, a now silent protest from the broken man. \n\nMorrigan’s full dark purple lips returned to a predatory smile as she looked down at the shard in her hand. “Thank you,” she said, sliding the shard onto her necklace with the others.\n\n\n\n\n\n\n\n",
				},
