			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\n\nFrom where does the Light come? Well, for the Vulpera, the sun has always been the skyborn provider ruling the dunes above and beyond any mortal. Simultaneously gentle and unapologetically brutal in its unbiased judgement, many fox people of Vol'dun saw it as something worthy of their reverence. Their prayers for its protection and, occasionally, strength in the destruction of their enemies, even to shine its light on riches meant to satisfy good fortune. Not so much a diety in theological terms, it nevertheless held a power over the sands beyond the Vulpera's simplistic comprehension. Thus was it a guardian spirit in some ways.\n\nSome Vulpera took to these beliefs and faith far more aptly than others, and it was these who the Light blessed. Naturally the Vulpera knew nothing of the Light, and therefore was it translated as the sun's blessing; paragons upon which the Sun bestowed its powers. Priests and Priestesses of the Sun, such as Sueko, eventually became increasingly commonplace before the destruction of the 4th War.\n\nHer time outside Vol'dun has awakened her to the realization that hers are not the only people who revere the Sun! Often does she hear of the Sunwalkers and Seers of the Tauren, or the priests and paladins of the elves, and that curious head of hers strives to learn more about these beliefs that seem to run parallel with her own!\n\n(( It's all headcanon. No supported Lore, obviously, since Vulpera don't HAVE ANY ))",
