					}, -- [2]
					{
						["TX"] = "\n{img:Interface\\PETBATTLES\\Weather-Blizzard:312:2}{img:Interface\\PETBATTLES\\Weather-Blizzard:412:2}\n{p:c}{col:8e92a0}«∙ We plot in the shadows, hang out in the gallows. ∙»{/col} {/p}\n{img:Interface\\PETBATTLES\\Weather-Blizzard:412:2}{img:Interface\\PETBATTLES\\Weather-Blizzard:312:2}",
						["BK"] = 1,
						["IC"] = "inv_tailoring_modifiedcraftingreagent_white",
					}, -- [3]
					{
						["TX"] = "\n{h2:c}{col:909090}—∙∙ O O C ∙∙—{/col}{/h2}\n{img:Interface\\PETBATTLES\\Weather-Blizzard:412:2}{img:Interface\\PETBATTLES\\Weather-Blizzard:312:2}\n\n{icon:ui_rankedpvp_02_small:25}{col:888888} Player is over the age of 18 and expects those who engage as well be. I play mature themes and would prefer a mature audience. {/col}\n{icon:ui_rankedpvp_02_small:25}{col:888888}  Not a fan of any sort of drama. Keep that kind of stuff out my plate, please.{/col}\n{icon:ui_rankedpvp_02_small:25}{col:888888}  Rather choosy on letting people exchange discords with me, especially with bnets. I've developed major trust issues and need to know I can trust you before engaging further. {/col}\n{icon:ui_rankedpvp_02_small:25}{col:888888}  Player is queer and doesn't tolerate homophohic/transphobic mfs. You don't like that then go the other way. {/col}\n{icon:ui_rankedpvp_02_small:25}{col:888888}  Player is rather cordial, but evenly shy and wary of people. Pardon if I come off aloof. {/col}\n{icon:ui_rankedpvp_02_small:25}{col:888888}  Heavily prefers world RP over city RP anyday. Feel free to hit me up. {/col}\n{icon:ui_rankedpvp_02_small:25}{col:888888}  I look to stray from ERP as much as possible unless the story calls for it, sorry. {/col}\n{icon:ui_rankedpvp_02_small:25}{col:888888}  Know the lines between IC and OOC before interacting, it's annoying when people muddle the two. My characters' actions -never- reflect my own.{/col}\n{icon:ui_rankedpvp_02_small:25}{col:888888} Player has social anxiety and can have moments where they struggle to walkup or sound interested in conversation. I apologize in advance if I come off standoffish, I just often get nervous.  {/col}\n\n",
						["BK"] = 1,
						["IC"] = "inv_misc_gem_diamond_03",
