			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:700:128}\n\n{col:76aed3}Indiscretion...{/col}\n\n{col:afff85}That was how my father described the cause of my birth, moments before he drove his axe into her neck in a rage. Over the years others have thought maybe it was just curiosity... Who knows. She was killed the night I was born, my father executed for the murder shortly after.\n\nAs for myself? I cannot say I do not care, whether one had known them or not, there is still always that tug of the heart for those who brought you into this world. A strange, hateful, at times wonderful world.\n\nI do wish I had the chance to know my mother. Maybe even ask her myself why she spent time with a large, angry cat. And of course there will likely always be this little glimmer of a hope of one day finding my father. But for now, I am simply trying to find my place in a world I am only half-native to.{/col}\n\nWiP",
