		["0527151116ex4mm"] = {
			["about"] = {
				["v"] = 55,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}{icon:inv_misc_firedancer_01:25}Physical attributes:{/h2}\n\n{p:c}{col:ffad69} The halfling's facial features lack the sharp angles they should possess, cheeks high and rounded, nose somewhat blunt and smooshed in appearance courtesy of wide flaring nostrils. A square jaw ever set in a manner that seems to convey irritation and a likewise chunky, somewhat blocky chin complete the package. A small mouth sports thick lips that are curled into a perpetual sneer thanks to a set of Orcish tusks that protrude from within the confines of her mouth. \n\nDark flesh spans the woman's form from ear tips to toes, an olive undertone giving her a slightly off-color complexion when placed next to some of her Elven kin. Brown-red hair looks to have been hacked away by an unsteady hand, cropped short and  generally unkempt. Those messy locks usually smell of a curious blend of herbs that one might have trouble sorting out.\n\nShort but pointy ears have been pierced numerous times from the cartilage down to the lobes, everything from simple dark iron hoops and tragus piercings to industrial bars composed of the same material. \n\nHer left eye is amber, sporting a dull glow that varies wildly from one month to the next. The right is milky, devoid of the Elven glow, and likewise turned in toward her nose, should one study her long enough to notice! That lone good eye is often narrowed with scorn, as if she views those around her as more of a nuisance than anything.\n\nA sturdy neck slightly larger than her handspan across leads down into a thick collarbone and broad shoulders. Her torso is longer than is considered acceptable, where most elves boast long legs, this section makes up the most of her height. Larger than average ribs support an ample, high-set bosom. While her stomach should be flat, a layer of muscle beneath the dark, olive hued flesh causes it to bulge outward slightly. Washboard abs, tilt included! Her sides curve inward subtly beneath the ribs and flare again at a set of broad hips. \n\nA plethora of scars can be found all along her torso, ranging from the claws and fangs of animals to the projectiles and blades favored by humanoid foes. This woman has clearly not lead an easy, quiet life...and she wouldn't have it any other way!\n\nLengthy arms that are thick with muscle and overyling fat boast a myriad of scars: Determining where one long-healed wound begins and the next ends could easily be turned into an obscene party game of sorts. Her hands are thicker than those of most Elves, long dexterous fingers covered in callouses while her palms remain somewhat smooth. Any familiar with the wear and tear caused by a  bow could easily guess that such is her weapon of choice. Nails meanwhile are kept filed down to a simple squared shape, left unpainted.\n\nLong legs begin with thick, well toned thighs which lead into calves of the same type, the lower half of a long distance runner and climber. The woman's rump is well rounded and quite firm, as it's mostly muscle. While her feet are usually hidden, they possess the same heavy callousing as her hands. Her toes sport squared nail tips as well, though likewise with the above, they remain unpainted. \n\nA series of commingling Orcish and Troll tribal tattoos stretch along the flesh of her back, twining serpents and scorpids laced with phrases in Orcish text: \"Death before dishonor\" can be seen clearly between her shoulders, while \"Live for Glory, Strength, and Fury\" can be found woven through the backs of serpents along her spine from mid-back down. \n\n{/col}{/p}\n\n{h2:c}{icon:inv_inscriptionlanathelquill:25}OOC Notes:{/h2}\n\n{p:c}{col:7D7D7D}Sen is half Laughing Skull Orc, being the spawn of a Main Universe Skull, she is not the wannabe stand-up comedian type. \n\nShe's not -that- kind of crazy, though she is a stark reminder of precisely why the MU Skulls were distrusted: The woman is cruel, violent, sneaky, treacherous, and not above thievery and dispatching her foes in less than honorable ways. \n\nThe Elf-Orc is capable of kindness, but generally only when it serves her.\n\nWhy yes, I'm using growth pots. They put Sen at roughly the same height as female Orcs, where she ought to be! \n\nPlayer is chronically ill and takes long breaks from RP. Almost always still happy to chat or help with content, but the creative bug takes a dive when feeling under the weather. <3\n{/col}{/p}\n\n\n",
				},
