			["about"] = {
				["T1"] = {
					["TX"] = "Alayxis Rimehearth is a paradox of a creature, twisting between two extremes of heat or chill in any moment. She shifts between being an extreme socialite in the presence of her twin, Kalistra, or when she can manage the energy to be social. At other times she has a chilling and aloof glare, observing the area around her with steepled fingers and shadowy schemes in her misanthropic mind. When seen in person with her twin, she is most definitely the relaxed 'blue' to her twin's spastic 'red.' \n\nShe is often seen sitting idle, inspecting one of the cards or runes that float about her in nonsensical, lazy circles. She bares the blank stare and eerie presence of one who has looked far too long through the veils of time and space, lost in temporal points and continuums.\n\nProne to fits of mania and bouts of distraction after long periods of sulking, she can come off as highly abrasive to most others. Some consider this her form of affection, others her lacking in social finesse to form meaningful relationships with anyone but her twin. Often her motives for doing self-destructive actions seem to elude her own logic, reasoning, or desire to evaluate her own psyche.\n\nSomething of an addict in her own way, and most visibly when not in the presence of what she considers her disturbed older twin she scours and devours all sources across of Azeroth and beyond for new and exciting magic and knowledge. Divination seems to be for her beyond a mere obsession and drive, but a literal addiction to collect and study until the font of arcane and illusive knowledge of the past, present and future is completely dried from experience.\n\nDespite her childish demeanour, obsession with fashion and the political powers in Silvermoon City, socialite gawking and general lack of boundaries towards other sentient beings, an off-handed remark or two denoted the hidden depths of a calculated, masked intellect within the depths of her eyes - if one was keen enough to catch it.\n\n((Still a giant work in progress.))",
				},
