						["TI"] = "Attire.",
						["IC"] = "INV_Misc_Bandage_Netherweave",
						["TX"] = "She dons a black and gold, leather teddy bodysuit, that hugs her form perfectly. Golden silks drape elegantly over her bare shoulders, with a matching sarong tied around her small waist. Knee-high, black leather, boots cover her feet, with tough garters connecting it to the the rest of the attire. The garments leave little to the imagination, allowing her to easily show off the tattoos on her shoulders, arms, and thighs. A light, partially invisible, prismatic barrier floats effortlessly over her skin.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Magic Tattoos",
						["IC"] = "70_inscription_vantus_rune_suramar",
						["TX"] = "Pulsing with arcane energy. Eunaya's tattoo's cover most of her body in shifting arcane runes, and floral designs. Although symmetrical, they shift and move about her skin, independent from each other, seemingly with a mind of their own. The only tattoo not glowing with magic appears to be a small circle with three daggers on the nape of her neck.",
