						["IC"] = "ability_warlock_whiplash",
						["TX"] = "A black leather whip, with gold inlays, hangs from the sarong tied around her waist. The whip's lash seems to shine. A small glint of silvery steel can be found with teeth-like formations along it's length. Stilettos may be hidden, in various places. A rifle usualy rests on her back when out venturing. ",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Guardian Wasp.",
						["IC"] = "INV_GiantWasp_Orange",
						["TX"] = "A large, feline-sized wasp rests at all times on her shoulder. It's antenna twitch and wiggle as it scans the room for threats. Normally a gift from her faith, the wasp is now infused with magics, allowing Eunaya to see through the wasp's own senses. It's stinger drips with poison, and has a knack to sting in sensitive places...",
					},
