						["TI"] = "Perfume.",
						["IC"] = "inv_potion_140",
						["TX"] = "An almost overwhelming scent of honeysuckle and lavender wafts from her. Although strong, it never feels overpowering in her prescience, always gentle and delicate to the nose.",
