			["about"] = {
				["T2"] = {
					{
						["TX"] = "This is gonna be a WIP until I am satisfied. I appreciate your understanding! :D\n\nP.S. All the RP gold you give me goes to me buying spells and junk lol",
						["BK"] = 1,
						["IC"] = "achievement_quests_completed_daily_08",
					}, -- [1]
					{
						["TX"] = "{h1:c}Appearance{/h1}\nEunaya stands at a little under five feet tall. Her form is lean and thin, comparative to other elves of her kind. Skin, pale as snow, with a slight hue of a warm pink. Covered here and there, her pronounced freckles pop up in dense patches all along her body.\n\nIn long, smooth, strands of crimson, her hair reaches to the lower of her back, densely decorated with jeweled bands, and magically preserved flowers. Normally she wares her hair in elaborate designs that look like it took hours to prepare, but on days where she adventures, it is usually kept straight and flat. The features of her face are soft. Like most elves, her nose, and chin are angled and straight but still match the softness of her composure. Her lips, small, but covered in a wine red lipstick. From her nose, hangs a elaborate silver nose-chain. The chain travels from her left nostril and runs all the way to her left ear. On her right ear where several rings, all of gold and silver. The left ear however, sat only two rings, most likely due to the scar that takes up most of the ear.\n\nHer shoulders where, slender, and usually perched atop one them was her wasp familiar. On each shoulder where two runic tattoos that seem to hum and glow with arcane life. The tattoos continued all the way down her arms. Changing in pattern from arcane runes, to floral patterns and designs, they ended at coils that wrapped around her fingers. Matching her frame, her chest was tight, although smaller than most other elves, she uses her clothing to accentuate her subtle curves. Her legs, usually exposed, are much the same as her arms, tattoos that travel from her heart-shaped rear all the way down to her toes.",
						["BK"] = 11,
						["IC"] = "achievement_character_bloodelf_female",
					}, -- [2]
					{
						["TX"] = "{h1:c}Clothing{/h1}\nTo call what Eunaya wears to be clothing would be generous. Most would consider the match of a black and gold leather teddy and matching stockings with garters to be intimate wear. The teddy was tight and form fitting, leaving little to the imagination. Though mostly a deep black, the gold that was interwoven between it appeared to have embroidery of wasps and vines. Knee-high boots protected her feet, they too looking to be made of the same dark, decorative leather as the teddy. A gold silk sarong is tied around her waist, adorned with various trinkets and charms. Unless adventuring, she also wears a silk sash along her shoulders, draping and wrapping it along her arms.",
						["BK"] = 11,
						["IC"] = "inv_tailoring_70_silkweave",
					}, -- [3]
					{
						["TX"] = "{h1:c}Weapons{/h1}\nThough not appearing to be heavily armed, she Eunaya does carry a leather whip on her right hip.  If out adventuring, she carries a rifle that appears to be too large for her small size, stored on her back.",
						["BK"] = 11,
						["IC"] = "ability_warlock_whiplash",
					}, -- [4]
					{
						["TX"] = "{h1:c}Equipment{/h1}\nTied to her sarong and closer to her whip is a single, red, coin-purse. It appears to hum with an unknown energy. On her left hip, tied with a much more impressive leather cord, is a large tome, bound in red leather. It appears to be nearly five inches thick, with red pages.\n\n+ A vial of Golden Liquid\n",
						["BK"] = 11,
						["IC"] = "inv_misc_book_16",
					}, -- [5]
					{
						["TX"] = "{h1:c}Prepared Spells{/h1}\n\n{icon:spell_arcane_arcane04:25} Cantrips:\nArcane Mark, Jolt, Message, Read Magic;\n\n{icon:70_inscription_deck_dominion:25}1st:\nBungle (x2), Burning Disarm (x2), Charm Person, Magic Missile (x2), Vanish;\n\n{icon:70_inscription_deck_dominion_2:25}2nd:\nHideous Laughter (x4), Invisibility, Seducer's Eyes, Unnatrual Lust (x2);\n\n{icon:70_inscription_deck_dominion_3:25}3rd:\nDeep Slumber, Hold Person (x4), Lightining Bolt (x3);\n\n{icon:70_inscription_deck_dominion_4:25}4th:\nCharm Monster (x2), Complex Hallucination, Confusion (x2), Invisiblity Greater, Create Acid Pit (x2);\n\n{icon:70_inscription_deck_dominion_5:25}5th;\nHold Monster (x4), Persistant Image, Teleport (x2);\n\n{icon:70_inscription_deck_dominion_6:25}6th;\nChain Lightining (x4), Cloak of Dreams, Mage's Defending Sword, Permenant Image;\n\n{icon:70_inscription_deck_dominion_7:25}7th:\nHold Person (Mass) (x2), Mage's Magnificent Mansion, Power Word Blind, Teleport Greater, Waves of Ecstasy;\n\n{icon:70_inscription_deck_dominion_8:25}8th:\nCharm Monster Mass, Irresistible Dance (x2), Maze, Power Word Stune (x2);\n\n{icon:70_inscription_deck_dominion_a:25}9th:\nDominate Monster (x2), Hold Monster Mass, Interplanetary Teleport, Overwhelming Presence,  Time Stop;",
