ips - \nResistance, Acid Splash, Drench, Detect Magic, Read Magic, Daze, Breeze, Dancing Lights, Flare, Light, Penumbra, Ray of Frost, Scoop, Spark, Ghost Sound, Haunted Fey Aspect, Jolt, Mage Hand, Message, Open/Close, Root, Scrivener's Chant, Arcane Mark, Prestidigitation",
