						["TX"] = "{h1}GEAR{/h1}\n\nWonderous Item (Tattoo): Headband of Mental Superiority +6, Wonderous Item (Tattoo): Belt of Physical Might +6, Wonderous Item: Ring of Protection +5, Wonderous Item: Cloak of Resistance +5 (Tattoo), Wonderous Item: Amulet of Natural Armor +5, Wonderous Item: Needles of Fleshgraving, Wonderous Item: Tattoo of Weapon Guidance (Firearms) (Tattoo), Ranged Weapon: +5 Rifle, Wonderous Item: Sleeves of Many Garments (Tattoo), Ring: Ring of Freedom of Movement, Stave: Staff of Enchantment, Wonderous Item: Scintillating Garment, Wonderous Item: Bandolier, Beneficial;",
