					}, -- [16]
					{
						["TX"] = "{h1:c}Disclaimer! Again!{/h1}\nThe stats section are just something I did because I was bored. I play Pathfinder and GM it. So, I figured, since I saw everyone with random stats and no one could come up with a unified idea for them, I would just use a d20 system!\n\nI do not intend on everyone to go off of them, and that's fine. Again this was mostly for boredom.\n\nWhat I did:\nSoooooooooo I took the max level of WoW (120) and the max level for Pathfinder (20) and divided that to see what I would get. Pretty much turns out every 6 levels for wow is 1 in Pathfinder (Rounding down of course!). Soooooooo at 120, I be 20!",
