				["T1"] = {
					["TX"] = "{h1:c}Ash{/h1}\n{h2:c}A burning coal and a tender flame{/h2}\n{img:Interface\\BlackMarket\\BlackMarketSign:256:128}\n\n{h3:c}The Vulpera's fur--soft and silky--comes in varying shades of dark greys and darker blacks, like swirls of coal and ash. The dark colors make the bright flame of his eyes all the more stark in contrast. His eyes, orange and bright and flickering like a living flame, hold wisdom beyond his years. His smirk, and the flash of the sharp fangs beneath, indicate that despite this wisdom, he has a streak of mischief in his blood. {/h3}\n\n{h3:c}He carries himself proudly, despite his stature. His frame is strongly build, thick with muscle and fat and strength. Stocky, sturdy, and with his own aura of confidence. {/h3}",
