						["TX"] = ">Saronite plate intermixed with reinforced leather.\n>Thick, leathery cloak/hood\n>Deathweave Satchels along her belt: Bandages, Gravedust, various vials of unknown substances, sewing needles and string.\n>Wields a saronite runic greatsword which stood nearly as long as she did. Anyone sensitive to magic could feel the weapon itself gnashing out in an autonomous effort to consume life around it. Those without sensitivity could still experience a ‘sixth sense’ wariness and visibly see sinister, blue tinted energies oozing from its blade.\n",
