			["character"] = {
				["CU"] = "",
				["CO"] = "I'm always looking for more undead themed rp.\nPst if I miss a post.\nLooking for guild.\ntinyurl.com/SabbyGroove\nhttps://tinyurl.com/ZombStomp\n",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["v"] = 11,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-TyrandesFavoriteDoll:512:256}\n{h1:c}Lady Sabilla Hex{/h1}\n{h3:c}\"We must put the past behind us, despite its hauntings.\"{/h3}\n{h3:c}{link*http://tinyurl.com/SabbyBody*TL;DR Full Body Ref (Semi nsfw)}{/h3}\nThe art is not mine. All credit goes to Rob Sacchetto\n{link*http://zombieportraits.com/author/rob-sacchetto/*Artist Website}\n{link*https://www.patreon.com/user?u=3082337*Patreon}\n\nA phantom, a specter roaming the world as a shade of a person who exists in those that loved her to be little more than a tragic and remorseful memory. Bitterly roaming the land as a damned soul, a marauder of death, detached from the natural order that governs life. Searching for a place in this new, unforgiving life, she wanders from place to place in what appears to be a vain, fleeting hope. Accumulating power, making acquaintances, and running from the ghost of her past; Lady Hex finds herself in what can only be described as a bleak, endless wasteland masquerading as a vibrant, song filled forest.\n\nWith mummified flesh of a pale white color whose icy touch sent shivers through the spine, there is no mistaking what she is: Dead. A life long lost. With an echoing voice and hateful teal eyes the nature of Sabilla is revealed to be that of a Death Knight. oozing a horrifically foul unholy aura to match the putrid stench of rot violating the air around her person, this forlorn specter's mere presence is an appalling onslaught on one's senses. With sharp features making up her face the high cheek bones are not complemented by the sunken cheeks possessed by this elf, pulling and hugging the bones of her face. What had been lush lips now dried and cracked, uncared for by this banshee, much as the silver white locks of hair drained of color sat withered and coarse.\n\nBelow her ghoulish facial traits lay a cadaver still cold as the powers forcing it to move. Sabilla may have been a looker in life, but death does take its toll, even on an elf. Still, though, the death knight remained fit with clear signs of lean muscle on her body should she even bother to find anything other than her armor. That plated saronite, a quarter the weight of steel and impossibly durable, served her well and kept this woman alive. Preferring attire complimenting a curvaceous frame, she is as agile as strong. Along with an ease in killing her prey, she is still the killing machine the Scourge created her to be. Fortunately for us all, the instinct to slaughter on sight is not quite as profound as she was during the days of being a blight on the Plaguelands, instead favoring the company of mortals and finding herself quite the social creature despite the pains.\n\n{h2:c}OOC Details:{/h2}\n>Sabilla is not anti-social or moody! If you want to walk up, she's very open to it. If you want -her- to walk up, just let me know and she will!\n>This character is neutral in terms of faction. So Alliance characters are welcome to interact with her. Also Exotics are -adored-, so don't worry.\n>\"Realism\" is not a big priority for myself. I'd rather you express your creativity in ways you want. Be it story, aesthetics, or otherwise. Just have fun.\n>Non-canon rp's are fine! Personal plotlines are lovely. Short term and long term rp's are accepted.\n>No preference on post size. If you're more comfortable with one lining, go for it! Want to post big? Go nuts! I'm not a mirror poster, I'll post what I feel comfortable posting regardless of post size. Usually this will be 2-5 WoW paragraphs in most scenes. This can go upwards to 20+ paragraphs or as little as 1 line depending on the rp.\n>I like newbie rpers as much as I like veteran rpers.\n>Level is not something I'm concerned about in rp.\n>Dark or \"Mature\" elements can be involved in rp. Macabre, death, cannibalism, rotting corpses, torture, necromancy, other taboo subjects are likely to be involved in rp. (Also, yes, that kind of rp too.) Let me know what you're comfortable with and what you're not.\n>Willing to rp in Party Chat, Whispers, and do world rp.\n>Whisper me any questions! I'm fairly open minded.\n\n{img:Interface\\QuestionFrame\\answer-warboard-classic-Ghostlands:512:256}\n",
				},
