			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "inv_axe_1h_draenorcrafted_d_02_a_horde",
						["BK"] = 3,
						["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-AncientShamanHeaddress:512:256}{col:ff4849}The first thing majorly noticeable about this handsome chappy was his azure eyes. They were bright blue, just like the ocean, and gazed around with a rather calculative stare. He was often well chiselled and most definitely spent a large portion of his time either training or being out in the wild. A dragonslayer like himself would be naturally fit and muscular, but this Orc was a straight bulwark. He was way over six foot tall, with a fierce mohawk and a mangled body, scars on almost every part noticeable. He was a rather handsome fellow, despite his scars and incosistencies, and it was clear that he didn't care for the scars and cuts he had all over his body. He came to grips with his lifestyle and was more than happy to continue doing it every single day, despite what it does to his body.\n\nHis hair was Platinum in color, and he had an ungroomed ruggedly beard upon his chin, proving he was a little over thirty just by the bags under his eyes and the mature tone of voice of which he spoke. \n\n\nOne words that people used most to describe this beast of an Orc was 'tank'. He was tall, muscular, ravishing and deadly. He would never let one of his enemies survive a fight, and this included humans, Dwarves, Night elves and more specifically 'dragons'. This Orc hated dragons with a passion, it was a pet peeve, a hatred. He slayed dragons with one eye, for it was only his left blue eye that was visible. The curse that Fel gifted this Orc with came with a gently glowing eye, and with it, a deep scar. His right eye was always closed, or when it was open it was just an empty socket, so he opted to eitehr wear an eyepatch from time to time, or just keep his eyes closed so he could fixiate the focus onto his working eye.\n\nThis Orc walked around with two huge axes that rested on his back by a tight leather strap. They were dripping, oozing with the blood of his enemies almost all the time, and was made of some of the strongest steel ever to exist on Azeroth. He carried them with ease, and used them to harm and slay any dragon that came in his way. His armour was dark in color, burned from tip to toe from all the time he spent hunting whelplings in the Burning Steppes. It was scarred from place to place, dented all over and even had holes in it in some areas. It appeared this man simply just did not care.{/col}",
					},
					["PS"] = {
						["IC"] = "inv_axe_1h_artifactmagnar_d_03",
						["BK"] = 3,
						["TX"] = "{img:Interface\\ARCHEOLOGY\\Arch-Race-MantidBIG:256:512}{col:408228}There really wasn't much to say about this Orc fellow. He was quite brutal in all honesty, and didn't have many cares for anything other than bloodshed in this world. His gaze often flowed around the people around him with only negative intent, and he was merciless in the way that he travelled aorund the city. He was never displaying any sort of welcoming demeanour, and it was clear from first glance that he was not a Orc that wanted to be stopped and talked to within the streets.\n\nDespite his merciless and brutal attitude, he wasn't the type of Orc to straight up beat anybody that approached him, especially if they were women. A well gifted Orc like Vansing  was sure to be a good magnet for beautiful women that wanted a good time, however he never cared for it. He was just a weoful individual with nothing but his next mission on his mind. He cared only for making money, killing dragons, mortals  and breathing. Anything else just went straight over his head, as if it never existed.\n{/col}",
					},
					["HI"] = {
						["IC"] = "inv_axe_1h_draenorcrafted_d_01_b_horde",
						["BK"] = 3,
						["TX"] = "{img:Interface\\DRESSUPFRAME\\DressUpBackground-Vulpera1:256:256}{col:ff8847}Vansing lived most of his youth around his clan until he left, venturing through the northern lands of the Eastern Kingdoms with no mission in mind. He was a handsome young chap with nothing on his mind, however this was soon to be changed. He used to venture through Hillsbrad, down to the Wetlands, through Dun Morogh and into the Burning Steppes. His end goal was to reach Stranglethorn Vale and explore lands unknown, however his venture were cut short when he bumped into a merry band of killers at the northern path of the Burning Steppes. These travellers were on a desperate mission to hunt down and kill a black dragon that had rumoured to be in the south of the Burning Steppes, and Vansing desperately needed money, so the desperacies collided and he joined the adventurers.\n\nHe went with them to the South of the Burning Steppes and had nothing but an axe and a rifle to accompany him, however it seems that this was all he really needed. When the group got to the south of the steppes, it appeared there was a very dark cave, beaten into the side of a mountain. It required some climbing to get to, however the bunch eventually arrived. From inside there was nothing but the sound of heavy breathing and groaning from the rumoured dragon within, and this stirred the men to turn away. They had finally arrived face to face with a sleeping black dragon and now they realised the risk it came with. Did they really want to die, eaten by a dragon for the sake of wealth?\n\nEach and every traveller turned around to walk away, except for Vansing. He walked into the cave with a lit torch, made of a magma block attached to a steel rod. He woke the dragon with a loud scream and then pointed the rifle point black towards it's skull. With the pull of a trigger, a bullet flew through the dragon's head and damaged it's scales, and Vansing rushed forward with an unsheathed axe, ramming his axe down into the Dragons' neck. The now wounded dragon ensured the other travellers were confident enough to return and help Vansing, and that is exactly what they did.\n\nThey all stormed back in, one by one. Thaniel a High Elf mage casted a crippiling frost spells into the Dragon's legs. Din'jo a Troll berserker swiped his poleram into the Black Dragon's arm, chopping one of them clean off after striking a weak spot multiple times. Finx an Undead rogue tossed a whole cannister of poison into the Dragon's eyes and blinded it, causing the dragon to wail out in pain. With one final blow, Vansing raised his axe, now stood atop the dragon, and brung it down onto an unarmoured part of the dragons' skull, causing it's brain to get lodged with the blade. The dragon slowly wailed and fell to death. Each of the ''brave'' men took a tooth from the dragon as a souvenier, but Vansing took nothing. He found a passion in the acts he just committed, so he needn't take a souvenier when he knew for sure he'd be back to kill another when the time came.\n{img:Interface\\ARCHEOLOGY\\Arch-Race-VrykulBIG:256:512}\nDue to the pleasure he received from killing this dragon, and after killing so many more throughout the next few years, Vansing actually formed a band of travellers that were primarily focused on hunting down and killing dragons, and that is what they did for five years to come. He recruited about twenty four people, excluding himself, and over the five years they travelled all over the world to hunt down these dragons that they killed. Some of them were child dragons, some baby dragons, some adult dragons. They were all dangerous and they were all out to kill these adventurers, however only fifteen succeeded. Over the five years, nine men and women were lost due to the dragons and their might, and each of them were laid to rest shortly after.\n\nThese men and women had morals, and they weren't completely harmless. Whenever a dragon was killed, and a comrade was lost, they would carry them back to their homeland  and bury him properly, with a dragon tooth of the slain dragon rested upon their chest on a necklace. Vansing approved of all of his companions that fought below him, and so he paid them well for every single dragon that was killed. This charade continued for five straight years, and a total of four bronze dragons, eighteen black dragons and three blue dragons were killed. Each had a souvenier taken for Vansing's display in his bedroom, and it currently consisted of eighty nine dragon teeth and forty scales. He was a mighty Orc  and had a lot of achievements to show just how fierce he truly was.\n\nAfter his guild disbanded, Vansing returned to Orgrimmar to be with his clan, helping them with all of the wealth that he had earned with his dragon hunting career. After a year  he returned to his craft of Dragonslaying, now buffed with his superior might and vetaren experience, aiding him in solo-killing any dragon that he gazed upon.By the time he reached forty five years of age, he'd killed over twenty dragons with the help of his  prime might, with just his twin axes sunk into their neck. His armor was tempered with dragon blood and he wore it proudly no one had the death wish to cross this man. Time has passed and the day came where all black dragons were presumably gone extinct.Vansing retired since all other flights became neutral and hunting them would get him into trouble, so he retired from Dragonslaying and became a mercenary instead. To this day, all this Orc does is roam Orgrimmar with a bewitched stare rested on every man that gazed at him. Offering his work to anybody that pays the best. He was a killer, a fighter, and never failed a mission, so he offered his mercenary skills to whomever desired it.\n\n\n{/col}",
