			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}Ri'kavek{/h1}\n\n\n{h2}Appearance{/h2}\n{link*https://imgur.com/a/UtNYCNZ*SFW Album}\n{link*https://imgur.com/a/X1ZA45G*NSFW but non-pornographic pin-up}\n{link*https://imgur.com/a/qCD9QTw*Humerus arts by Nina!}\n{col:83c8da}With a rather average looking height and build, R'ikavek isn't the type to really stand out among the crowd. With square features, large bold nose, broad chin, small eyes. It might even stand out as handsome if it weren't for the glaring reddish scar on the right side of his face. An old burn wound that one might see if he ever took the mask off. His silver hair is often decorated, but let down. Occasionally pulled back into a lazy ponytail. \n\nHe doesn't boast the impressive musculature of the majority of his people. More lean, functional over form. Although his armor can change from time to time, he doesn't go without the strange orcish skull mask. Not out of a reluctance to hide his face, even if he doesn't wear it the mask hangs on his belt. Refusing to be without it.\n\nYet another of the sea of Zandalari whom made their way to the Horde, RI'kavek keeps his things modest. The armor he does keep is mended, repaired, and his weapons amaturely maintained. He isn't destitute, but he's not guady either.{/col}\n\n{h2}Personality{/h2}\n{col:83c8da}Quiet and stoic, he is never the life of the party but he does enjoy being included. Even if it's to listen to the others or feel like he's part of the crowd. Ri'kavek seems slow on the uptake for humor and jokes and unusually serious. Not that he hates them, but they tend to fly over his head.\n\nGetting along better with animals than other humanoids, Rika rarely goes anywhere without some companion of his. But his most stalwart is his old friend Zul'thun. One of the hatchlings he has had since his time working at the Warbeast Kraal. And he is more quick to trust those his friends take to, as well as those who keep beasts with them. His pet parrot, Humerus however is quick to add a bit of flavor and add his words to the conversation.\n\nWith his previous military service in the Fourth War, Rika boasts a discipline that he struggles to break. When it comes to talking about himself, he becomes rather tight lipped but with just a bit of goading he'll relent. But far too nervous to offer up any information willingly.{/col}\n\n{h2}History/RP Hooks{/h2}\n\n{col:83c8da}Born to the Warrior Caste with a Dinomancer mother and a Rastari Father, Ri'kavek lived a pretty ordinary life for the most part. Though as soon as his body was strong enough is body was trained to also enter tha warrior caste. But the quiet son was studious and sensitive enough to the loa his parents had the greatest aspirations he could become a priest. Yet despite their hopes Ri'ka wished to follow his mother's path to become a Dinomancer. Having always had an affinity for them over people.\n\nDespite his talents though, Ri'kavek was slow to complete his training when he had been kept home for a year having been said he was sick. After his recovery he had grown even more quiet and passive. But since he always did his job to the letter and didn't cause any problems. The animals also loved him.\n\nSeveral years later, Ri'kas had been convicted of second degree murder of his Father he had been granted a mercy from the sands in exchange for leaving for the Horde lands. Ri'kavek accept his sentence without much fuss and put his lot in with the Horde military joining the offense in the remainder of the Fourth War. Meeting his closest friend and rival; Irok Steellung. Though the two started at odds with the other and had a rivalry which pushed the other to improve to new heights. The two of them baffled by the others culture had made them clash but eventually came to an understanding.\n\nThe Laughing Skull fell in the war against N'zoth and Ri'kavek honored his friend and Rival in the Laughing Skull way. And adopting his beloved pet Humerus. Once the war had been brought to it's conclusion, Ri'kavek resigned and took up busywork where he could get it.\n\n{link*https://docs.google.com/document/d/1ekLpaZQLKfvuriwuy4QRIh7Md13-tckH3K9He1QntTs/edit?usp=sharing*In-depth backstory for those who like more!}\n\n\n{col:83c8da}You might recognize Ri'kavek if:\n*They have spent a number of time in the Warbeast Kraal before the 4th war\n*A fellow Zandalari may have heard of his sentence\n*Served in the Horde Military during the 4th war and against the Armies of N'Zoth{/col}\n\n{h2}OOC{/h2}\n{col:ffffff}Welcome to set up scenes, especially in the outside world! However, not looking for random erp.\n\nCharacter IS an exile, Zandalari are welcome to recognize and even treat him negatively for it. IC =/= OOC!\n\nDual Toon character. Usually stick to the hunter, but will occasionally see me on my druid. Dinomancers can turn into dinosaurs, but player personally thinks the beast taming part of them is more iconic/interesting.\n\nFind it weird that it needs to be clarified but player/character are LGBT friendly.{/col}\n\n{link*https://twitter.com/Uni_Fools*Twitter Link}",
