			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "  The tale of Gullandron begins sometime ago. Before the third war. Son of the noble Duskrunners; a family of night guardsmen since the Sin'dorei set foot in Eversong. As a young boy he was often cheerful, and intuitive, respectful and always did as he was told. at the age of 13 he was enlisted in the silvermoon training academy and by age 17 a Lieutenant of the Guard. He served alongside his father, Captain Thallandron Duskrunner; leading those nearly centuries older than himself. It wasnt long after that he met someone he truly related to and cared for, Syllira Silvermight.\n\n  On his first mission out of Quel'thalas he was set to escort a trade caravan to Stratholme. The caravan was ambushed by orc outriders. Though the young Lieutenants men were skilled, they were vastly outnumbered. They took defensive stance around the caravan but, were instantly surrounded.\nSuddenly, a barrage of meticulously placed arrows flew out of the trees. In moments the war party was slain. Out of the darkness a voice spoke, \"Be mindful of your wits Duskrunner, dawn approaches.\". 3 hooded figures proceeded out of the woods a pulled down their hoods. \"Ranger General Windrunner\", Gullandron said unsurprised. \"You would have been dead if not for Syllira's tracking.\". Looking over to the left of Sylvannas, he saw a young elf, with fair skin and Silver hair and glowing blue eyes. He had heard of the Silvermight family, only that they are of the few remaining High Elf Lineage from Kalimdor that retains nobility above others. \n\"Well, you have my gratitude ranger.\", Gullandron admitted. Syllira looked at the young Soldier and winked with a playful grin. \"Proceed with your mission, Lieutenant. Syllira, you will continue the trip to Stratholme with the caravan.\",Sylvannas ordered.\n\nOver the years, their paths countlessly crossed, and every time Gullandron saw the Ranger, she'd give hime that same look that she gave to him when she first met. Their chemistry grew and eventually they got married and had a child by the name of Vessana Duskrunner. \n\nGullandrons father was slain shortly after the birth of his daughter and was replaced by his son as Captain of the Guard. Though he mourned his fathers death, he felt blessed at the life he had found. Though rumors of an evil stirred South. Then Arthas...\n\nThe day the Scourge marched on Quel'thalas is a mournful memory for him. As Captain of the Guard he was incharge of bolstering most seige points. Though an excellent tactitian, he was not prepared for what happened next. \n\nGullandron wiped sweat from his face and placed his helm back on his head.\"Bolster the left gate, Sun Phalanx, I need Ballistas stationed on every tower to the east!\", Sin'dorei ran with purpose, quickly carrying out his orders. Suddenly a shadow fell over the city. The march outside the city walls rattled and echoed through  the walls of Silvermoon.. He knew, he felt, but did not want to believe what was about to come. The breach was imminent.\nThen screams of terror spread throughout the city. They had passed through, Civilians ran out of the saftey of their homes as chaos grew. He grabbed his elite and ran to the Inner city. An overhelming spawn had made its way in, Captain Gullandron intiated the Charge. Before the clash, a volley of arrows tore down the running horde. He looked up in the sky intently. Syllira leading a party of Rangers mounted on Dragon Hawks flew past. \"Go!! Get to General Windrunner!!\" she yelled. She looked down at her husband, \" It's Arthas, hes trying to take the Sunwell. You have to get to Vessana! Go!\" \n\n  Vessana had been taken to the Ranger Retreat, North-East of the City. He made sure the line of defense was reformed, then left his Senior Seargant in Charge. He quickly advanced to the nearest sewer entrance and Escaped to the front of the gates. He thought his eyes betrayed him as he looked to the West and saw the biggest force he had ever seen. He stood in shock for a moment and then ran towards the Retreat. He reached the Ranger haven by nightfall, but upon arrival there was no one to be found. He entered and began to investigate. Then he heard running behind him, he quickly turned around prepared to fight, but it wasnt fast enough. Arms embrased Gullandron, it was Syllira. \"Gullandron...\" she muttered, \"Sylvanas is dead.\".  He looked into her blue eyes with sadness, \" ..and the Sunwell?\", he asked. Syllira shook her head. They both looked at the abandoned Safe Haven and wondered what couldhave happened, where did they go? They began to look for clues, in hope that their daughter was still alive.\nGullandron then heard a sound come from up stairs, he bolted! When he reached the top of the stairs he heard a really sharp sound, in unison with a sharp prick in his neck. He began to feel sick and fade, his sight was going. He fell and hit the ground.  \n\n\n        \n\n",
				},
