						["TX"] = "{h2:c}Physical Appearance{/h2}\nShe has strands of beautiful lovely hair that feel of the lovely silk, put up into a bun and long dangling hair and the dark hue that it stands on the brim of being charcoal with the soft glow when she grows far more excited . Well defined cheeks that complimented her face too much. Grand naive eyes that would keep staring for days on end. Those curious glowing eyes that can never let out, or give in always has the upper hand. Thin, yet strong! Arms built like a kodo, but the equivalent lankiness of the hawkstrider. Her legs wll carved and shaped to the liking. Her brows are lovely and trimmed , the markings on her face being prominent and shines upon the sun. The hips of hers are sculpted to perfection. The lips of hers stained the dark tint of this maroon, plump and alluring. Although, one thing seems to stand out far more than most features was a grand slash on her back from a previous incident. The chest of hers being perky and delightfully complemented by her armor. Her glutes beyond fair. Ears stretching grand and long with piercings lining her ears, her complexion of a dark purple color. Such a sweetheart, isn’t she?\n",
