					["3"] = {
						["AC"] = true,
						["TI"] = "Silver Lining!",
						["TX"] = "She promises a big silver following on her ears and jaw, she loves the decorations so much! They dangle from her like ornaments on a christmas tree, dare to say does she shine brighter than the pesky little decor that only comes once a year? The silver contrasting from the dark berry skin of hers. The jewelry makes her look even sharper than she is supposed to even be! She is delightfully kind, she has to appear sharp to make others fear her much more.\n",
