					["5"] = 4,
					["4"] = 0,
					["6"] = 1,
				},
				["v"] = 42,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "\n{img:Interface\\QuestionFrame\\answer-VindicaarCrystal-ShroudofArcaneEchoes:256:128}\n\n\n{p:c}{link*https://tinyurl.com/NattzArtAlbum*Art!}{/p}\n{p:c}(Anything not credited is my work.){/p}\n{p:c}{link*https://imgur.com/a/rMav0Q1*Commission Sheet}{/p}\n{p:c}(Commissions Closed){/p}\n\n{h3:c}The typical snark and sass anyone would expect from a goblin can be noted from Natalie, though a sincere nature lingers beneath it all. Always best to hide a cowardly nature with kindness and a lotta words.\n\nAs of late she has set aside her cheap parlor tricks to actually start learning a bit of magic. Though even with that bit of flash and arcane at her hands, she still tends to keep from a crowd and remain under the radar as best she can. No sense drawing attention to a sub-par mage. \n\nMost days she is likely to be spotted wearing some odd assortment of hats and found loitering in bars and odd spots around the city- though usually keeping to herself. More often than not she is reading a variety of books- if one glances they’re mainly cheap romance novels.{/h3}\n\n{p:c}Items of Note:\nA golden bracelet on her left wrist with bright blue gems.\nIntricate golden necklace with an emerald pendant.\nA bright golden ring on her left hand, the intricate details leading to a rose in the center.\nSatchel or backpack at all times.\nJournal on her hip.\nAlligator tooth necklace on her belt.\nHalf of a spyglass on her belt, 'Nattz' in gold etched into it.\nWeapons vary.{/p}\n\n\n{p:c}(Any open world RP is welcome if ya spot me! Zandalar or otherwise! If ya want me to find a reason to approach, I can. Mirror-rper.){/p}\n\n\n\n\n{p:c}{link*https://twitter.com/LeighHayleigh*Art Twitter}{/p}\n\n\n\n\n{img:Interface\\QuestionFrame\\answer-MageArcane:256:128}\n",
				},
