						["BK"] = 2,
						["TX"] = "{p:c}Bell sports a long swooping braid that nearly matches the length of her body. Her face is pleasant and bright, despite her many trials and tribulations. Some scars can be seen on her exposed skin here and there, but not many, and not too deep. \n\nHer build is average, a bit lean and clearly built for running and scaling trees. Her armor can typically be seen as a reflection of herself - careless, wild, and scrappy.{/p}",
