					["PS"] = {
						["IC"] = "talentspec_druid_balance",
						["BK"] = 2,
						["TX"] = "+Compassionate\n+Loyal\n+Creative\n+Clever\n\n-Brash\n-Impulsive\n-Unmotivated\n-Opinionated\n-A little selfish",
					},
					["HI"] = {
						["IC"] = "inv_staff_2h_warfrontsnightelf_d_01",
						["BK"] = 2,
						["TX"] = "{p:c}Belaurosa's history is hardly a secret, something she'll share with anyone if given the chance. She was abandoned at birth and placed upon the steps of a remote temple of Elune deep within Feralas for reasons no one is really aware of. There the priestesses raised her in the image of their order, though she proved to be a bit rambunctious and hard to control. Eventually, as a young Kaldorei, and after running away from the only home she ever knew far too many times, Belaurosa set off on her own to find her own path, and has been journeying across the all of Azeroth ever since. \n\nShe spent the first few centuries of her life getting to know the all of Kalimdor, meeting people - and foes - all across the continent. Now, after the many wars that have brought the Alliance together, Belaurosa finds herself in the company of humans, dwarves, gnomes, and all manner of strange and interesting folk. Every adventure seems to bring on new horizons, an ever expanding realm of possibilities at her feet.{/p} \n\nOOC notes:\n\n- Though a monk, Bela took up the discipline far before ever journying to Pandaria. Her style and their style aren't quite the same, though she did learn a thing or two from the pandaren that have proven very useful!\n- pretty much always ooc if dressed in full tier or in elaborate monk transmogs dgsdg\n- corruption is obviously ooc\n",
