			["about"] = {
				["v"] = 68,
				["BK"] = 2,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Rain:512:128}\n\n{h1:c}{col:ff70f9}~Kasumi Ito~{/col}{/h1}\n\n\n{img:Interface\\Pictures\\artifactbook-shaman-cover:256:256}\n\n\n{h1:c}{col:ff70f9}~Appearance~{/col}{/h1}\n{col:9bcdff}Kasumi, standing at just 5’ 3” has jet black hair done up in ponytails in the back. Her skin is as pale as the moon, free from blemishes or scars. The female has very pretty and delicate features for someone who is in combat often. Her nose and mouth are a little small while her eyes are the average for Sin'dorei elf but radiate a soft blue-green mist color. \n{/col} \n\n{col:9bcdff}Kasumi, unlike most elves who are born with long skin ears, was born with a pair of black and white fox ears along with a twenty-five-inch fox tail. Her ears and tail have full movement, Kasumi's ears bending down when sad and erecting tall when happy or curious. Kasumi's tail motion is similar to her ears in the way you can see her emotions. The fluffy extrusion wagging when happy or hanging limp when sad. The tail is white from the base until about five inches from the tip where the fur changes to black while her ears are white from the base but change to a deep black at the top. Inside there is a patch of fluffy white fur as well.\n{/col}\n\n    {h1:c}{col:ff70f9}~Body~{/col}{/h1}\n{col:9bcdff}Kasumi's body is surprisingly slim for someone who spends her day's healing, her feminine features unique. Her hips were slightly below average while her butt is in a small round shape. Her breasts are a 29 B cup with a round shape. Her whole body like her face is a pale color and free of any blemishes or scars. On her back a few small tattoos could be seen in a misty color, the shapes being small inch long fox paw tracks trailing from her lower back to her right shoulder. \n\n\n{h1:c}{col:ff70f9}~Art~{/col}{/h1}\n \n\n{h1:c}{link*https://imgur.com/a/WIpsk4c*Kassy's Art}{/h1}\n",
				},
			},
