						["TX"] = "\n• Height: \nHe once stood at a proud and average height of six feet and three inches in his past life. Being bound to a demon so massive mutated his height slightly, altering it by an additional two feet and one inch, so that he now stands at eight foot four.\n\n• Horns:\nThe horns that dramatically jut out from his skull resemble that of a specific demon, wide set and sharply bent inward. However to those who aren't familiar with demonology they will just appear like any other Illidari's horns.\n\n•Fangs: \nHis once normal teeth are now all rather sharp, even those notable elven canines are much more prominent.\n\n• Claws: \nLike most hunters he has sharp claws, four centimetres in length, in place of his nails.\n\n•Wings:\nWhen Zadak does use his wings, they are more bat-like in appearance. \n----------------------------------------------\n\n Doomguard Immunities:\n• Magic: Nearly immune. (Lore abiding)\n• Fire: Immune.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Expression:",
						["TX"] = "\nMore often than not he is seen frowning or with a resting bitch face. Despite this fact he is capable of a smile, like anyone else, you just have to work for it.",
						["IC"] = "spell_misc_emotionangry",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Collar & Blindfold:",
						["TX"] = "\nYour eyes do not decieve you! This hulking beast is equipped with a thick black and gold metal collar. There appears to be an intact, horizontal, D-ring at it's front and a broken chain that only extends five inches down. \n\nLike every other Illidari out there this man sees things through spectral sight at all times. This allows him to see the colors of magic and their auras, as well as through objects.\n",
						["IC"] = "inv_7_0raid_necklace_04d",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Unique Clairvoyance & Aggressive Quirks:",
						["TX"] = "\nBeing bound to a Doomguard grants this hunter a few extra heightened senses and abilities. While his ability to sense magic is present, he tends to excel in sensing Blood Magic and Sacrificial Practices, his brute strength is only matched by another bound to a Doomguard. \n\nAlong with what was previously mentioned the man before you also tends to be compelled to dominate a situation, or person, at a near constant...or he simply acts aggressive at random. He isn't immune to having a secret side to him however.",
						["IC"] = "warlock_sacrificial_pact",
					},
				},
				["v"] = 30,
			},
