				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-BurntEarth:512:128}\n{h1:c}JETAI{/h1}\n{col:BC3B2B}          --This wiley looking vulpera might greet you with a devilish, fangy grin and a flick of a blade-shaped ear before he's gone in a crimson flash and a whirl of shadows.{/col}\n\n     {col:ff673f}     --Aside from his vibrant red fur and the peculiar, darker crimson 'tiger-stripe' pattern running through it, Jetai is generally unremarkable for a Vulpera. He is of average height though seems quite fit and lean.  His eartips end in a dusky brown/black and the fur of his chest, belly, feet and paws are dipped in dirty ivory white. {/col}\n\n            {col:e0ceaf} -- A pair of lethal looking, curved daggers, effectively sabres in his paws, always sit on his belt, scabards fastened to his legs with straps.  They appear ready to be drawn in a flash and draw them he can with unsettling precision.  His dark, leather armor is finely crafted, made to perfectly balance speed and protection while allowing him a degree of stealth despite that striking, red coat.  The asute observer would notice a hidden throwing blade tucked here and there, you'd guess there are more of those better hidden on his person. Cargo pockets on his legs and a small, securely closed satchel may hide other dangerous odds and ends.{/col}\n\n          {col:ff673f}  --Those long, blade-shaped ears keep a constant vigil of actions around him aided by venom-green eyes and a black, vulpine nose that tests the air frequently. He quite often seemed on alert, as if out of habit. When he moves he's quick and light-footed, that bushy red tail the last thing many catch glimpse of as he dashes off, leaving purses lighter or veins opened.{/col}\n\n        {col:BC3B2B} -- His paws are a bit stained, like that of a goblin who spends all day in a sooty machine-shop.  The cream colored fur on his footpaws is dusty from endless travel suggesting the nomadic life common amongst his kind.  Though he has no distinct odor about him, aside from the faint smoke of a campfire with the metallic tinge of the forge, he could benefit from a good bath and brushing.   {/col}\n{img:Interface\\Pictures\\artifactbook-demonhunter-twinbladesofthedeceiver:512:256}\n\nWIP\n\nOOC STUFF \n\n-Shadow-users or those acute to such things might sense a dark presence grafted to Jetai.  Feel free to sense this and react if you like.  \n\n-World RP loved\n-Walkups loved\n-Jetai is a sarcastic jerk, the player is nice though, I promise. :) \n-21+\n-All RP OK, we're adults here. :p \n-Walkup!  Do eet!",
