			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "pandarenracial_innerpeace",
						["BK"] = 1,
						["TX"] = "(Sorry if there's not much! Kinda lost train of thought in the making but hope it'll do)\n(18+ / Mature Profile)\n\n\n\n\n------------------------------------------------------------\nCurrently:\n\nWandering around Orgrimmar, looking over all the passing faces and sometimes gazing off at nothing as he gets lost in thought.\n\n------------------------------------------------------------\n\n\nHere stood your run of the mill pandaren. He carried himself steadily in his simple and form fitting attire that hugged up against his rounded body which.. seemed a bit chubbier than the usual. His features were soft and partially hardy, a sign of a long journey but a bright spirit lingering in his teal colored eyes as they seemed to gaze off to the next horizon awaiting him.\n\nDespite his figure, it was clear he had some muscle in that chubby body of his, being rather shown off whenever he flexed or curled his arm to take another drink. His dark fur often shined in the sunlight as a token to how well he kept it groomed and cleaned. A few scars adorned his face and body, though most were hidden beneath the clothes and he didn't care to show them off all the time.\n\nLiao's legs were just as thick and strong as his arms, if not more so from all the weight he swings around. The plump thighs were accented by his pants and the rathy coushioned rump he had sometimes jiggled if he was being particularly bouncy in his step. Not that he minded, the man was just having his fun and being goofy if he ever did that.",
					},
