					["HI"] = {
						["IC"] = "inv_misc_book_11",
						["BK"] = 1,
						["TX"] = "(Not much here for now! Sorta just making up as I go and think about things.)\n\nRP Hooks: You might know Liao Feng (or of him)\n\nIf you've bought one of his brews or meals.\nIf you come from Pandaria as he travelled around a lot.\nIf you've been to Halfhill you might have seen him or his family.\nPerhaps you stumbled upon the bear visiting one of the major cities (both Alliance and Horde)\n\n(Or)\nYou just might see a friendly face sitting in Orgrimmar chatting strangers and offering drinks and food.\n\n",
					},
				},
