			["about"] = {
				["v"] = 11,
				["BK"] = 6,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\Arch-Race-PandarenBIG:256:512}\nVira Frozenheart\n A former enforcer of the Shado-pan, Now one of the fellow Death Knights of the Ebon Blade. Vira helped the Shado-pan, along with other heros to bring down the Thunder King. She left the shado-pan shortly after the fall of the Thunder King to follow those who call themselfs \"The Horde.\"\n\nVira lent her strength to the Horde during the Legion invasion, Although she does not remember most of conflict that occured during that time.\n\nWhen war broke out again between Alliance and The Horde, Vira yet again added her strength to the war effort! she found herself in constant battles in Kul-Tiras, Zandalar and the Eastern Kingdom. Eventually being slained from one of her allies that have seemed to have gone mad.\n\nAn unknown member from the Ebon Blade had spotted her as she was struck down, and decided to bring her to the ebon blade to be brought back as a death knight. This mysterious Death Knight saw her as huge asset in future conflicts, The leader of the Ebon Blade, Morgraine, also saw the possible potential.\n\n\n\n{img:Interface\\Pictures\\artifactbook-deathknight-bladesofthefallenprince:512:256}\n\nWhen she was brought back from death, she began to train herself inside the Ebon Hold, regaining her strength, learning her new powers and how to control them. After a few months, and after swearing her loyalty to the Ebon Blade, She returned back to the horde, just to see the corruption from N'zoth becoming more of an influence. Eventually the corruption, along with N'zoth was eliminated by a band of brave heros from both of the alliance and the horde. Perhaps peace at last?\n\n\n{img:Interface\\Garrison\\ShadowlandsMissionLandingPageBackgroundNecrolord:256:256}\n\nAs the former and current leaders were abducted to Shadowlands, Vira found herself yet again, jumping into the fray, into the realms of the dead, to aid in the return of those who were taken, to bring order to the realms of the dead. She ended up joining a covenant of Necrolords, who were sworn to the defence of the shadowlands, from any and all threats. During this time, although there may be a peace between horde and alliance, there is still skirmishes that break out, War never chanegs...Neither does the battles that are to come.\n{img:Interface\\Calendar\\Holidays\\Calendar_HordeWarCampaign:128:128}\nVira Frozenheart, Former Enforcer of The Shado-pan, Now Death Knight of the Ebon Blade. Forever a soldier in The Hordes War Machine. Lok'tar Ogar!\n",
				},
