						["TX"] = "Personality\n\nSkjoldur is can be a touch hesitant to most people he meets, though a member of the Horde since the end of the war against the Lich King, he is still used to dealing with racism and xenophobia. He is very quick to show off his tattoos if doubted and only shows his scars if he feels his honor has been tarnished. Though once known he is a very loyal and absolute individual, he speaks his mind and has no issue telling others how he feels about them or his actions. His friends are often quick to apologize for him in polite company, the Vrykul truly does not understand that he can come off as insulting. There is only action to him and he very much lives in the moment and rarely plans for the future, often lending him into awkward and sometimes dangeorus situations. Skjoldur is a loyalist at heart and it is incredibly rare for him to invoke violence or aggression onto other members of the horde. Though this can often be a surprise to some who believe Skjoldur to be nothing more than a simple minded brute.\n\nClothing\n\nIf seen out in the world Skjoldur is often wearing a full Vrykul battle warriors set with an oversized and very worn out Horde tabard, perhaps kept red from redying or from all the blood that the warrior has shed for his nation. He was known as The Flag in the Horde military and would often be seen with a large banner strapped to a pole attached to the back of his body. But when seen off the battlefield in the cities or abouts the outskirts of Thunderbluff where he often travels, he would be seen very differently. His large plate armor given up for a light linen tunic. The often hunched warrior instead stands proud with his back straight and head raised to the sky, often still choosing to wear a red tunic or leather jacket in the colder seasons. But often still wearing simple loose linen pants, but what is absent in every case other than war is that the Vrykul is always shoeless. The large oafs huge and fairly hairy feet are given free reign to the world and are often gawked at, though Skjoldur is convinced this is actually a compliment and will very often wink, happily and contently attempting to \"Show off\" His feet to any would be onlookers",
