			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-mage-cover:256:256}\n{h1:c}{col:ffa700}Chronomancer Marah{/col}{/h1}\n{h2:c}{col:ff00e3}The Fluffy Tailed Time Mage{/col}{/h2}\n\n{h3:c}{col:ff00e3}Related Stories{/col}{/h3}\n{p:c}{link*http://tinyurl.com/TheDawnlight*The Dawnlight Caravan History}{/p}\n\n{h3:c}{col:ffa700}The Beginning{/col}{/h3}\n{p:c}{col:ff00e3}Born with a gift like few had ever seen, Marah had from birth had a connection to a certain magic many of her kin never did have. Her caravan known as the Silvertail Caravan had many teachers who were capable of teaching various different types of magical practices.\n\nShe was very quick to pick up on almost all of them, each magical practice however was something she never quite managed to master as her abilities were far outside those taught by the elders of the Silvertail Caravan.\n\nHer magic caused ripples around her as she tried various different teachings and eventually it became clear she was capable of using Time Magic, something the caravan was not equipped to teach so she found herself leaving the caravan after many years to find a teacher.{/col}{/p}\n\n{h3:c}{col:ffa700}After the Fall of The Dawnlight{/col}{/h3}\n{p:c}{col:ff00e3}Marah found herself at a loss, unable to figure out where she wanted to go in life but she knew she had to keep going. Her ideals were still in tact even though her heart was broken, reluctantly she continued on.\n\nReaching Dazar'alor, she ended up making friends with the Zandalari due to her natural ability to speak Zandali because of where she grew up. The more friends she made the more her name started being talked about amongst their people, to which lead to a keen interest in what type of magic she wielded.\n\nOver time the word spread and eventually while she had come to call Dazar'alor home, A member of the Bronze Dragon Flight approached her. Wishing to ensure she was properly trained to handle the type of magic she wielded for without proper training time magic could wreak devastation.\n\nAt first her magic was dangerous, having various different ripples occur with each of her teachings and even at one point causing a distortion around her. Over time she was brought to the Caverns of Time to continue her training in a safe environment with masters capable of instructing her better.{/col}{/p}\n\n\n{h3:c}{col:ffa700}A True Prodigy{/col}{/h3}\n{p:c}{col:ff00e3}The more she learned from the masters in the Caverns of Time, the more they saw greatness in her. Along with her ideals and her caring nature, Marah would bring about a legacy for her two Caravan's that would stand the test of time.\n\nWhile she would face trials and tribulations along the way, the masters entrusted to her the knowledge they did while also instructing her to never stray from her ideals no matter how difficult at times it maybe.\n\nOne of the major requirements for her however was to unlearn any prior teachings and devote herself to the teachings of the Bronze Dragon Flight, something of which she struggled with for some time.\n\nTaught the nature of Time Magic, Marah's abilities went increasingly far but with every teaching she learned her magic was not damaging. Something that went right along with her core morals, this became her staple from then on.{/col}{/p}\n\n{h3:c}{col:ffa700}--------------------------------------------------------------------{/col}{/h3}\n\n{h1:c}{col:ffa700}OOC Notes!{/col}{/h1}\n\n{p:c}{col:ff00e3}I am well aware of the nature of Time Magic and others desires to not interact with characters like this but I request you give it a go! \n\nI actively avoided writing anything revolving around personality or appearance, it's relativity will never remain constant.\n\nOOC communcation for me key and the effort put into Marah is something I take great pride in.\n\nWhile I love goofing around OOCly, I also try to be respectful of other RPers. That being said! If you want respect then you must earn it, treat me disrespectfully and you will find your actions being mirrored.\n\nTwo last notes: I am a paragraph RPer, so I respond slow and thoughtful. But! I also absolutely do not engage with individuals who will try to stomp on RP ICly with OOC motives.{/col}{/p}",
