			["character"] = {
				["CO"] = "∞¤« IC does not equal OOC  »¤∞\n∞¤« Player is 21+ »¤∞\n∞¤« Most forms of RP ok! »¤∞\n∞¤« Walkups welcome (I'm shy) »¤∞\n",
				["RP"] = 1,
				["v"] = 57,
				["XP"] = 2,
				["CU"] = "Regarding her surroundings with disdain and boredom.\n",
			},
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n{h1:c}{col:3e67ff}∞¤«Lady Sieria Frostbrook»¤∞{/col}{/h1}\n{p:c}{col:a961ff}«Appearance»{/col}{/p}\n{col:3e67ff}Pale as snow, Sieria is average height and slender. Her pale blonde hair almost always sits high upon her head in a bun, with a few tendrils carefully lain about her face. If she is relaxing in the city you may find her with her hair down. Her face is angelic, a smattering of freckles sits under large cyan pools, leading to a small nose with full lips. Si is immaculately groomed, never appearing in public as anything less than perfect. She is typically seen wearing shades of blue or purple, and only wears the finest of threads. A lapis pendant rests at the base of her neck, and often a dark blue tiara rests upon her head, both gifts from her doting father. Occasionally she can be seen with glasses when she is studying.     {/col}\n\n{p:c}{icon:spell_fire_bluefire:25}{/p}\n\n{p:c}{col:a961ff}«History»{/col}{/p}\n{col:3e67ff}The only child to Inethlin Frostbrook, a very wealthy Magister, Sieria's childhood was truly a privileged one, although often lonely. Her mother died when she was a young elf, leaving Si to be raised mostly by her father. A spitting image of her mother, her father absolutely adored her, spoiling her with lavish gifts and praise. \n\n\nYou might know Sieria if:\nYou're nobility, you likely know her father and remember her mother if you are old enough. She will be much less cold and formal towards you if you mention knowing her mother.\nHer father has hired many bodyguards throughout her life, you could have formerly been one.\nJust whisper me if you want to set something up :) \n\n\n{/col}\n",
