				["Darget-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:r}{col:ffc300}D a r g e t  ·  T E L ' A T H A I N{/col}{/h2}\n{img:Interface\\PETBATTLES\\Weather-Sunlight:512:10}\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-MAGISTERSTERRACE:256:128}\n{h3:c}{link*https://imgur.com/a/FbewXjm*Character Art Album}{/h3}\n{p:c}{link*http://darget.tumblr.com*Darget's Tumblr}{/p}\n{img:Interface\\PETBATTLES\\Weather-Sunlight:512:10}\n\n{h2:c}{col:ffc300}· A P P E A R A N C E ·{/col}{/h2}\n{col:ffed9e}Masculine and strong, Darget stands at a height above average, with broad shoulders and a waist that is just a little too narrow for his otherwise muscular frame.  His overall physique gives the impression of a soldier who has seen his share of the front lines of war.\n\nEven bronze skin contrasts with his fair coloured hair; light ash blond and a bit unruly, it's often properly styled and coiffed away from his face. A few silver strands are blended in with the platinum locks, hinting at both age and a weathered life.  His transitioning green-gold eyes seem guarded and cold, giving very little insight as to how he may be feeling, or what he may be thinking. A strong, square jawline, straight nose, and high cheekbones lend to his unyielding appearance. \n\nWhether he's dressed in armour or clad in embroidered cloths and leathers, his attire is adjusted or tailored to fit his form.  No matter what he’s wearing, a gold ring always adorns his left hand.\n\nHis long stride and squared shoulders fit the apparent soldier-theme of this man, carrying himself with the usual airs of arrogance that might be expected of a Blood Knight.  His expression is generally neutral, his mannerisms almost suggesting that there are a few core emotions missing from his make-up.{/col}\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Sunlight:512:10}\n\n{h2:c}{col:ffc300}· G E N E R A L · I N F O R M A T I O N ·{/col}{/h2}\n{col:ffed9e}·Someone with the ability to catch glimpses into the souls of others might notice that {col:ffc300}half of his appears to be missing...{/col}\n\n·If anyone knows {col:ffc300}Dravenn Tel'athain{/col}, the resemblance between the two is striking.\n\n\n\n{p:c}{col:ffc300}Familiarity may be assumed if your character:{/col}{/p}\n\n{col:ffed9e}·Has current ties to the {col:ffc300}Blood Knights{/col} or old ties to the {col:ffc300}Silvermoon City Guard{/col}.\n\n·Has served in the military, specifically in Northrend, Outland, the Isle of Quel'Danas, or during the Third and Fourth Wars.\n\n·Attends weekly services at the church of the Light.\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Sunlight:512:10}\n\n{h2:c}{col:ffc300}· N O T E S ·{/h2}\n{col:ffed9e}The 'Lieutenant Commander' title was a field commission given to him through his unit of command in Northrend, which he has been allowed to keep upon returning.  In the Blood Knight Order itself, his actual rank is that of 'Champion'.\n\n{col:ffc300}Referring to him by either of these titles is acceptable!{/col}\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Sunlight:512:10}\n\n\n\n{img:Interface\\Pictures\\artifactbook-paladin-truthguard:512:256}\n\n\n",
