				["T3"] = {
					["PH"] = {
						["TX"] = "Taoshai used to be a fit and young fighter, eager to bounce about this way and that at high speeds. With age comes stillness and as her fur grows greyer, her body gets a bit wider with each passing year. She tries her best to keep up with her daily exercises, but gravity feels like a force she can't beat. A heavy set chest rests under her tied up leather armor, a gift from her wonderful years as a mother. A pair of wide hips and a plush stomach to complete the rest of her matronly body shape. But her arms and legs keep the powerful muscles of her youth, she's no easy target in a fight. Under her wide hat she has a full head of hair she keeps tied up, no hair color besides her natural unlike other pandaren women. Though her face shows her age, it's a kind and understanding face that rarely frowns in anger or rage.\n\nThough she can defend herself with her well trained hands, she carries a weighted staff with her. Useful for helping to walk if she's feeling winded, or beating the wind out of someone.",
