						["BK"] = 1,
						["TX"] = "In her youth Taoshai was once known as the Scourged Fist. She was a trouble maker from Kun Lai, too close to Townlong to ever be safe. With the destruction of her village at a young age, she ended up stealing and beating up grummels to try and survive. This didn't go unnoticed by a local monk, who put an end to her crimes and inner rage. Unknowingly planting the seeds for their budding relationship. The young man, Shao, brought her back to his monestary and gave her purpose.\n\nThe rest is history. A happy marriage between two, children growing up and leaving on their own in the world. The passing of one you love. Now Taoshai seeks a bit more excitement in her life and leaves her old home behind to start in a new one. Though Orgrimmar is hot, it's people are strong and hearty.",
					},
				},
