		["0103192751xyQC8"] = {
			["character"] = {
				["v"] = 84,
				["CO"] = "<Blackguard Regiment> is a newly formed guild that aims to fill the niche of a militaristic Illidari/dark art society in the belf roleplaying scene. Now accepting new soldiers (demon hunters, warlocks, spriests, DKs, rogues, and more!) PM for more info!\n\nI have the best rp partner, <3 Tir.\nArt in profile\nWalk-up friendly. 21+ ",
