			["about"] = {
				["v"] = 51,
				["BK"] = 9,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n\n\n{h1:c}{col:c60887}∙•°{icon:pet_type_magical:25}Solstice Ashreaver{icon:pet_type_magical:25}°•∙{/col}{/h1}\n\n{icon:ability_warlock_everlastingaffliction:25}{link*https://imgur.com/a/f18Vqbz*Art of Solstice}{icon:ability_warlock_everlastingaffliction:25}\n\n{col:ae93ff}There is a certain devil-may-care aspect to this elven woman, with an everpresent grin primed by caustic humor. It is an expression devoid of true mirth, and for the keen eye it’s shown to be nothing more than a masquerade for the honed awareness that only prolonged time spent in the rigors of war can produce. Though she might move with the comfortable poise of an individual content at rest, there is always an innate sense of tension about her; a glowing ember but a breath away from exploding into inferno.\n\nSolstice’s form is willowy and narrow boned; brute strength is obviously not hers to weild. Instead she possesses the limber sleekness of an acrobat, the modest curves that she does have carefully enhanced by the fit of her clothing or a tightly laced corset. Tall and long-legged, she can easily look most male Sin’dorei in the eye with little problem, a feat made all the more easy by her penchant for stiletto heels. Her ivory complexion borders on the pallid, bereft of color in a way that is often seen in the mortally ill or those touched by some insidious magic. It is easy to discern a case of the latter, as her eyes are shrouded beneath raving emerald fire in the obvious tell of heavy fel corruption. \n\nSculpted, high cheekbones cut an aristocratic elegance to her features, their prominence softened by a dainty nose and delicately tapered chin. A kiss of artfully applied cosmetics play up the stark contrast of her burning gaze and porcelain skin in smoldering kohl, her lips adorned in similar dramatic fashion with crimson or plum. Jet colored curls fall just beneath her shoulder blades when left unbound, though her preference is to keep them tamed into an elaborate bun with jeweled pins. \n\nCombat has not left her unscathed, and if visible her back is twisted in a horrific web of burn scars. From the base of her spine to the nape of her neck and onto her shoulders the skin is warped and disfigured, the product of some gruesome injury long mended but irreversible in its evidence.{/col}\n\n\n{img:Interface\\Pictures\\artifactbook-warlock-skullofthemanari:512:256}\n\n{h2:c}{col:f9adff}Public Knowledge/Possible RP Hooks:{/col}{/h2}\n{icon:inv_icon_wing01e:25}{col:c60887}Bastard daughter of Lord Vaedoran Cindersoul, the late Marquis of the southern Eversong (now a plagued ruin) and his then mistress, the famed courtesan Bellia Coldrune. The origins of her birth are both a sore subject and a matter of pride, the mingled shame of being illegitimate constantly warring against the satisfaction of clawing to where she has risen today despite it.{/col}\n\n{icon:ability_bossmagistrix_timewarp1:25}{col:ae93ff}Formerly of the Sunfury elite, Solstice served as part of the force stationed within Tempest Keep during the years of the Sin’dorei exodus to the Outlands. After sustaining grave injuries and enduring capture following the siege of the Keep and Prince Kael’Thas’ death she was placed on trial alongside the other Sunfury survivors. The magistrix managed to obtain a pardon with assistance from her father, a respected Blood Knight, but her life came at a cost. For the years to come she was sent to the forefront of any military campaigns the Horde took part in, thrown into the worst conditions and deadliest battlefields each engagement had to offer. This has had an impact on both her skill and her temperament, leaving her notoriously short fused among her peers and vicious in battle against her enemies.{/col}\n\n{icon:inv_misc_gem_amethyst_01:25}{col:f9adff}Solstice has fuck you money and is utterly unapologetic about it. Following the death of her father during the years of the Pandaria campaign she was left his entire estate, a shocking inheritance for a bastard daughter but the only logical choice for her father who had lost both of his legitimately born heirs during the Scourge invasion. Instead of retiring to a life of luxury or delving into the more traditional outlets of angst, Solstice decided to channel her daddy issues into further increasing her wealth. She sold off her father’s lands and estates, liquidating all of the assets and then reinvesting them into promising opportunities. A gamble that paid off surprisingly well, and as she showed more and more acuity for venture capitalism she earned a reputation for being just as ruthless when it came to business as warfare. More than one noble family has had their fortunes scattered by her hands, and carefully keeping the bulk of her assets in neutral territories and banks ensures that retaliation has yet to scathe her.{/col}\n\n\n",
				},
			},
