						["TI"] = "Killer Queen",
						["TX"] = "Solstice’s own personal fragrance crafted to her specifications, the complex spiced gourmand perfume has top notes of black pepper, heart notes of rose and dark tea, and base notes of buttered rum and bittersweet chocolate. ",
						["AC"] = true,
