					["3"] = {
						["IC"] = "ability_warlock_ancientgrimoire",
						["TI"] = "Dark Necessities",
						["TX"] = "It’s not hard to guess what Solstice’s chosen branch of magical specialty is; the fel aura that cloaks her is tangible and nearly defiant. Unapologetic for her craft, she has a long military record of service as proof that fighting fire with equally fel tainted fire is still a perfectly viable option.\n",
