						["TX"] = "It’s no secret that Solstice loves luxury, from fine silks and furs to exquisite jewels and lavish gowns no expense is spared when it comes to her wardrobe or comfort. Despite this she keeps her displays of wealth from straying too far towards the vulgar, preferring simplistic and elegant pieces of the finest quality. \n\n“That’s not silver, dear. It’s platinum.” \n\n",
