			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "A life of growing up on an island as a Tribal has given Rokeel a toned body. Rokeel is strong but clearly not much for weapons, preferring to fling Lava or Lightning. There is a consistent \"campfire\" scent around him.  ",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Rokeel is open minded and loves to talk with others, exchanging stories or otherwise. Though he is terrible at reaching out to others himself, if one can see him than one can talk to him. \n\nThe open mindedness works in all ways. He won't be rude unless someone is being rude to him consistantly. \n\nMay be a bit of an alcoholic, and gets a little...overly cuddly when he gets drunk...\n\nHas embraced quite a lot of the Venthyr way, and will often attempt to relieve the sins of others around him without permission. (Casting Chain Harvest) Scold him lightly; he does it out of care for your soul.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Rokeel is a tribal Vulpera, his shamanistic clan hails from an uncharted island close to Pandaria. \n\nWhen the Horde and Alliance started their island expeditions for Azerite, Rokeel's tribe was found first by the Alliance, and they fought the invaders off their island. However when the Horde arrived, other Vulpera came with them, and through the help of their own translating for them, have learned of their other peoples current allegiences to the Horde. \n\nRokeel decided to go with the Horde visitors because his more adventourous tendencies didn't fit well with the elders of his clan. As adventurous as he is however, he is a learned student of shamanism. With his wild streak, his natural ability to use the elements as weapons had gained him quite a good standing. He's been using his power to fight for the Horde, but has also been learning the art of healing as well. \n\nThe Tribal does not speak Orcish well, so he is often speaking in a different language then most understand, but other Vulpera are able to understand it just fine. Thanks to the spell of one of his companions, he is able to understand what is being told to him by others in Orcish, but he is unable to speak it well himself yet.  \n\nRokeel has learned that the interests of his people are far different than what he is used to from his tribe, yet he enjoys those same interests. He's also enjoyed learning about the other races of the world and getting to learn from the shamen who have even higher understanding of the elements than his elders did. \n\nCurrently, Rokeel works with a group of other Vulpera to go to dangerous places and fight for the Shadowlands. He has learned how to speak more fluent Orcish since then, but may sometimes still revert to Vulperan when upset or excited.",
