			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}<Chän, Attorney at Law>{/h1}\n{h2:c}Other Titles{/h2}\n{h3}* <The Virile Chän>\n* <Chän, the Virile Progenitor of the Vulpera>\n* <The Illustrious Prince Chän>\n* <Chän, the Prince of the Voldunai>\n* <Genghis Chän>\n* <Chän, the Alpha of Alphas>\n* <Chän, Keeper of the Red Rocket>{/h3}\n\n{h3}The egregious, litigious, ambitious, lustful, and irresistibly deviant Chän!{/h3}\n\n{h2:c}Businesses and Organizations To Date{/h2}\n* Managing Partner of <The Law Office of Chän, Esq.>\n* Managing Partner of <Chän Insurance Brokerage>\n* Managing Director of <The Bank of Chän>\n* Managing Director of the <Vulpera Trust>\n* Managing Director of <Chän Investing>\n* Head Hierophant of <The Cult of the Red Rocket>\n* CEO of <Chän's Mail Milk>\n\n{h2:c}Rumored Connections{/h2}\nIt has been rumored that Chän is connected with some \"Less-than-savoury\" organizations; however, these allegations are, as of yet, unproven.\n\n{h2:c}Flavourful Quotes{/h2}\n* \"You can rest assured that our prices are ridiculous.\"\n* \"My clients are always innocent.\"\n* \"Bad things seem to happen to people who don't buy my insurance.\"\n* \"At <The Bank of Chän>, we offer loans you'll regret for the rest of your life.\"\n* \"<Chän Investing> surely isn't most definitely not a Ponzi Scheme.\"\n* \"<Chän's Mail Milk> - it's not what you think!\"\n* \"<Chän's Mail Milk> - may contain traces of nuts!\"\n* \"<Chän's Mail Milk> - so delicious, it's addictive!\"\n* \"Praise the Red Rocket, praise The Virile Chän!\"\n* \"I always win.\"\n\n{h2:c}Character{/h2}\nChän has two seemingly contradictory sides to his character: on the one hand, he is a pleasant, sophisticated socialite; on the other, he is an egregious, lustful rapscallion.  To truly understand Chän as an individual, however, you have to grasp these two seemingly contradictory sides to his character.  He is not one or the other.  He is not one and then the other.  He is both.  Typically, one side of his character is more prominent than the other, depending on the circumstances, but it should always be remembered that, behind all the sophistication and refinement, behind his carefully polished professional exterior, Chän is, and always, will be a fiery, passionate soul who wholeheartedly embraces his “Animal nature.”  He is not ashamed of his lustfulness and eroticism.\n\n{h3:c}Chän, the Sophisticated Socialite{/h3}\nMost of the time, Chän goes about as a sophisticated socialite; \"Chän the Lawyer\", \"Chän the Professional\", \"Chän the Well-to-do\" - he is typically well-dressed, carefully groomed, reasonably well-mannered, and strives to make an overall good impression on those around him - not least of all when they could be potential clients, or a female requiring a more delicate and romantic seduction.  The said, his erotic playfulness often bleeds through in the form of innuendo and suggestion.\n\n{h3:c}Chän, the Lustful Rapscallion{/h3}\n\n{h3:c}<The Virile Chän>{/h3}\nChän’s virility (hence, “Virile Chän”) fuels a fairly prominent dominant streak in his personality – and it is this dominant streak in his personality that has ushered him into the status of an Alpha Fox.  He has a commanding presence, boundless confidence, unwavering self-esteem, an intoxicating “Joie de vivre”, an attractive magnetic personality, a smoldering gaze, an electrifying touch, and absolutely no shame.  He is animated by a wild, indomitable, and fiery passion.  He knows how to put that “Fire” into his gaze, into his touch, and into his words.  He knows how to get what he wants – and he’s not afraid to do so.  As an Alpha Fox, Chän feels that it is both his right and duty to procreate at an alarming rate.  He considers that all of the females as far as his eyes can see are, at least potentially, “His” and should naturally be willing partners.  Of course, they may or may not agree with this sentiment – especially if they are not a Vulpera, and do not recognize the status of an Alpha Fox.\n\n{h3:c}<The Illustrious Prince Chän>{/h3}\nOne of Chän’s newest claims is that he is, in fact, a Prince.  Whether or not this is actually true doesn’t seem to make a difference to him – he still expects to be treated like the royalty he claims to be.\n\n{h3:c}<The Cult of the Red Rocket>{/h3}\n???\n\n{h2:c}Criminal History{/h2}\nChän's criminal history is surprisingly spotless - it's almost as if he paid somebody off to make this criminal history disappear.\n\n{h2:c}PAID ADVERTISEMENT{/h2}\nDid somebody piss in your cornflakes this morning?  If so, then call on <The Law Office of Chän, Esq.> and sue somebody today!\n\n\"By the time I'm done with your case, I'll own somebody!\" (Chän, Esq.).\n\n{h2:c}PAID ADVERTISEMENT{/h2}\nAre you too lazy to walk over to the local vendors to buy milk?  Would you rather it just show up in your mailbox?  Well then, you're in luck!  <Chän's Mail Milk> is here for you!\n\n1. Send Chän a letter indictating how many glasses of his milk you'd like\n2. Send 5g/glass of milk indicated\n3. Wait...\n4. Enjoy!\n\n*May contain traces of nuts\n\n\"<Chän's Mail Milk> - it's not what you think!\" (Chän, CEO).\n\n{h2:c}Services{/h2}\nLegal consultation and representation (including, but not limited to: permits, licenses, and other misc. contracts), insurance packages - personal or business, and bank loans.  Specializing in marriage licenses, pre-nups, divorce proceedings, satisfying your disappointed wife, etc.; Chän is your one-stop-shop for all of your marital legal needs!  Interested?\n\n{h3:c}NEW!{/h3}\nChän is now offering more services than ever before!  You can now pursue investing services (both short-term [i.e.: gambling] and long-term [i.e.: schemes])!\n\n*No guarantee of returns on investment; invest at your own risk!\n\n{h2:c}Closing Statements{/h2}\nSome people swear by Chän's services; some suspect that he's little more than a smoothing-talking con-artist; others suspect that he's running a full-blown criminal enterprise, and that his businesses are nothing but fronts for illegal activities - however, none of those allegations have stuck.  \n\nChän’s eyes sparkle with a lascivious fire as he grins.  “Like it or not, I’m here to plant my flag and conquer new territory.  Remember this: I always win.”",
