				["T1"] = {
					["TX"] = "{link*https://imgur.com/a/ogUOyfw*Tilont!}\n\n{h1:c}Physical Description{/h1}\nTilont would be what one would call a nondescript Nightborne in terms of height, hair color and build. He usually wears rather intricate silvered leather armor. The typical faintly glowing tattoos that cover his body end just over his eyes and wind their way down around his arms, chest, waist and legs. He tends to wear his longer hair loose.\n\n{h1:c}History{/h1}\nTilont was born to a rather well-off family in Suramar and for millenia he enjoyed the good life. When the Legion arrived that suddenly changed. His house was divded, his parents siding with Elisande but Tilont, who up to that point had been a bit of layabout suddenly realized that it could no longer go on. His disagreement with his parents over the Legion lead to them eventually throwing him out of the house and sending assassin's to try and have him killed to cover up the dissent for fear of their own lives and the house. Tilont managed to flee them with some help and eventually escaped the city. For months he was Nightfallen on his own, scraping by and subject to the withdrawals all Nightfallen faced. Eventually though he made contact with the rebellion and began to get the help he needed. He began to train in infiltration work and by the end of the war in Suramar, he was well developed into his role as an operator.\n\nWith the Nightborne joining the Horde he found his skills still in high demand and put them to work with zeal for his new people. Tilont often spends time in the field, he has perfected his Darnassian and often spends time in the Alliance cities masquerading as a Night Elf with the help of a little magic. He also infiltrated the Loyalist camp and fed information to Thalryssa and the other members of the resistance during the 2nd Horde Civil War. He also served in the Uldum campaign against N'zoth, taking out high ranking members of the Old God's forces.\n\n{h1:c}Current Events{/h1}\nWith the war for Azeroth's future moving into the Shadowlands, Tilont now finds himself working for forces that no one truly understands yet, himself included. And yet also finds himself inexplicably drawn to the Kyrian by their sense of duty and loyalty to their cause. What the Kyrian lack in spycraft, he has made up for, serving them both against the Forsworn and the forces of the Maw.\n",
