			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-ToxicFumes:512:128}\n{h1:c}{col:2c8f69}† It's Where my Demon Hides †{/col}{/h1}\n\n{p:c}{col:00db06}{link*https://f2.toyhou.se/file/f2-toyhou-se/images/39475366_ZvVep0RHLQ5uhSG.png*Typical Outfit}\n{link*https://f2.toyhou.se/file/f2-toyhou-se/images/39475048_cVMf0YcuI8fYQem.png*Headshot}{/col}{/p}\n\n{p:c}{col:00db06}A Standard life inside Murder Row, has turned into a Life bound to a Demon and living half his life within the outer world of 'Outlands'. Calling the Black Temple home was a stretch, but it was exactly that. Home. \n\nKyraath was a thief in life, who only sought to turn his life around by joining the Horde through the Dark Portal. He didn't realise his 'life' would end there as well. \n\nNot dead, but nearly there, he was dragged into the Black Temple and was given a choice to serve or die. It's clear which he chose with the very fact that he stands here today. Tail swinging behind him, and heavy hooves carrying him.\n\nAlways a Wip{/col}{/p}\n{img:Interface\\Pictures\\artifactbook-demonhunter-twinbladesofthedeceiver:512:256}",
