		["0807113501AELEt"] = {
			["character"] = {
				["CO"] = "RPers you have my <3!\n\nMy Tarot readings are lenghty (I'm a chatterbox), so bear with me!\n\nwhitewindcompany.proboards.com\n\nTheme: Aerith's Theme (FFXII)",
				["RP"] = 1,
				["CU"] = "Finishing off some dinner while watching the sunset to unwind after work!\n\nLooks exhausted, but super happy!",
				["XP"] = 2,
				["v"] = 24,
			},
			["time"] = 1630888989,
			["link"] = {
				["Natashae-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Moonlight:512:128}\n\n\n\n\n{h1:c}{col:a134ff}Happiness can be found in the darkest of places, if only one remembers to turn on the light.{col:a134ff}{/col}{/h1}\n\n\n\n\n{h2:c}{col:a134ff}Physical Appearance{/col}{/h2}\n\n{col:d7d6ff}Natasha Ebonlocke stands at five feet and five inches, her posture that of a young woman taking in the world around her with wide eyes and a wider smile. She has long, pitch black hair (from which her family's surname stems), exceptionally pale, fair, clear skin, deep purple eyes, full red lips, a small cherry nose, and round cheeks that flush red at the slightest embarrassment. Her sparkling white teeth shine brilliantly when she smiles a smile that lights up any room she’s in. Not exactly an athlete, she has a particularly soft figure, curvy and plump in a couple areas, with a soft, squishy, but still more or less flat abdomen that creases deeply across the middle once when she sits. Wide hips and 38DD breasts protrude from over and under a somewhat slimmer waistline.\n\nA vain young woman, her girly-girl nature is featured prominently in the way her long, luxurious ebony hair shimmers in any light, and her nails are often painted black or deep purple. A charcoal eye shadow, however, is her only nod toward makeup. She generally prefers dresses to pants and shirts, and is rarely ever seen wearing anything else. She prefers black and purple in her garb, though she will, on occasion, wear something a bit lighter.\n\nAmong her other girlish tendencies are several additional adornments. She has a simple choker necklace about her pale neck, from which a purple crystal hangs. A hoop adorns her left brow and the left side of her nose. She wears a ring on her right hand that bears a large black gem which glows faintly in the darkness, casting a dim, soft, dark purple glow on the immediate couple of feet around it. Under specific situations, this ring will glow far more brilliantly. In her pocket is a pocket watch with Kaldorei designs on it. She checks this often when she knows she is due somewhere soon. Two charm bracelets adorn her left wrist. One is leather, with Kaldorei runes for \"Clothing\" and \"Home\" on them. The other is a truesilver bracelet with a rectangular charm hanging from it. A closer look is needed to see the inscription on back and engraved picture on front. The same goes for the inscription on a dark hairpin with butterflies bedecked in amethysts, a pin she particularly seems to treasure.{/col}\n\n{link*https://i.imgur.com/v9uY3YU.png*CHARACTER ART! Natasha Ebonlocke, reading Tarot cards at her booth overlooking the Stormwind Harbor.  By the incredibly talented Lady Kat!}\n\n{link*https://cdn.discordapp.com/attachments/816295160395857953/827128925494050846/Natbeach2.png*Kinda sorta slightly somewhat but not really depends on who you're talking to could be seen by some as possibly potentially being slightly NSFW art of Nat in a bikini at the beach! As before, art by the incredibly talented Lady Kat!}\n\n{h2:c}{col:a134ff}Activities{/col}{/h2}\n\n{col:d7d6ff}When spotted doing a Tarot reading, she withdraws a small cherrywood card case from a black leather pack with a spider web embroidered upon it in silver thread. The cherrywood case has an underlying hint of purple due to the wood used. She also positions a dreamy-looking pale sapphire-colored spread-cloth with swirling, shiny pearl thread patterns embroidered in. The spread-cloth is positioned to point a corner at either participant, giving it a diamond-shape. She places a deck of cards upon this cloth that have black backs with intricate dark purple designs.\n\nWhen dicing, like with her favorite game, Deathrolls, she uses a set of pitch-black dice with large, thick, dark purple numbers engraved into them. These dice are cast with a clatter and a giggle from her small, dainty hands.\n\nWhen walking, she seems awkward, and yet, she unintentionally has an alluring slow wiggle of the hips and a slow, constant roll of her heavy bosom. When running (which she rarely does), she appears a total spaz, as though she has two left feet, her curves jigging in an embarrassing and unflattering manner. Just watch for a moment, and you'll see her fall down on her face with a squeak and a blush. When riding, she rides sidesaddle, be it ground or air. This seems to be far more of a natural and smooth form of travel for her than walking, and especially running.{/col}\n\n{h2:c}{col:a134ff}Other Senses{/col}{/h2}\n\n{col:d7d6ff}Her scent is generally a mix of lavender and goldthorn. Occasional additional scents might include the faintest hint of woodsmoke, a hot, delicious meal she made, a somewhat less faint hint of Dwarven mead, or the natural, woodsy, earthy smell of Duskwood.\n\nWhen she speaks, her voice is a bell-like tinkle of a young, girlish alto, one that often giggles or stammers depending upon who is talking to her and what is being said. Her voice is a happy sound, one that brings to the subconscious mind a feeling of peace and calm and unending youthful joy.\n\nIf touched, one would feel either her silky, clean, luxurious ebon locks, or else feel silky smooth, perfectly moisturized skin. Most of her features would feel soft and a little squishy to the touch. If clothing is touched, any number of a wide variety of materials might be felt, depending on her dress or outfit of the day.{/col}\n\n{h2:c}{col:a134ff}Approaching Nat{/col}{/h2}\n\n{col:d7d6ff}Approaching her can generate any number of results – the gleeful, giggling greeting and possibly a hug for good friends, a fearful shrinking away and a stammering voice if the approaching individual seems frightening, or a stammering, shy, nervous demeanor if the individual walking up is a completely new stranger (though, if they’re friendly, she’ll warm up to them soon enough!).\n\nIn essence, Natasha Ebonlocke appears, upon first inspection, one who clearly enjoys a happy, cushy life. She’s girly, slightly vain, happy, and giggly. She’s a young woman who will befriend anyone, and doesn’t appear to have a mean bone in her body. Approach her if you like – you may just make a loyal, devoted friend for life!{/col}\n\n{h2:c}{col:a134ff}RP Hooks{/col}{/h2}\n\n{col:d7d6ff}You may know Natasha if:\n\n ~ you frequent Stormwind City, and have seen her wandering about, hanging out with groups of people various sizes, sitting at a table with them with a stein of mead in front of her, talking or eating or playing Deathrolls with them.\n\n ~ you did business with Blackflag Imports in some capacity before the company closed.\n\n ~ you have heard of her Tarot readings from someone.\n\n ~ you frequent Darkshire or Duskwood, where you see her in her quieter setting, where she works hard in the Town Hall, where she visits the tavern to see a few friends there, and where she lives in the house on the edge of town that's closest to Karazhan.\n\n ~ you frequent Ironforge, where she semifrequently visits pubs there with friends.\n\n ~ if you think... she looks like... someone... but no, that woman on the Broken Isles, or the Shadowlands, was surrounded by hordes of demonic mininons, and she had a far more confident and determined look on her face than this timid little young woman does... and yet... {/col}\n\n\n\n{img:Interface\\QuestionFrame\\answer-warboard-classic-Duskwood:512:256}\n",
				},
