			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Vazsarra has a slight, lithe build, and stands tall at just over 6'3\". She has high, defined cheekbones and a sharp nose, which gives her an imperious, if not slightly severe, look. Her natural features are emphasized further by the dark makeup she wears.\n\nHer wavy, unnaturally-colored hair is cropped short, only just reaching the nape of her neck. Under close inspection, one can see her hair has a slight iridescent sheen to it. The left side of her head has her hair trimmed close to her scalp, with a decorative braid partitioning it.\n\nVazsarra's wardrobe is almost entirely comprised of dark articles of clothing. Ranging from fine leathers to luxury fabrics, everything she wears is skillfully made, giving her an air of distinction.\n\nThe most distinctive part of her equipment is the peculiar stone-bladed dagger she carries on her hip. In its inert state it appears to be a curved dagger decorated with a purple gem in the hilt and with a blade comprised of dark stone, though no one could say what kind of stone it is. In its wakened state the stone blade seems to fracture before opening up, revealing pulsing purple energy within, and an alien pupil comes to the surface of the gem on the hilt, peering around searchingly.",
