			["about"] = {
				["v"] = 88,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:00ff00}Appearence{/col}\n{col:ffffff}Before you stands a rather large Tauren with mottled black and white fur. He stands at twelve feet tall and is rather muscular, even for a druid. Despite his rather large and intimidating frame he rarely shows a face of intimidation and his eyes always seem rather calm, laid back and even friendly when you start to speak with him. You will be hard pressed to find him in public without his self made totem that he holds dear and shows designs about his family. In addition to that he is found in traditional Tauren garb including his headdress and either a kilt or a loincloth. He also has tradtional druidic markings on his chest and face. He usually lets his mane grow out a bit and has a triple braid under his chin as well as feathers on either side of his head. He wears a totem necklace given to him by his mother when he was young and holds it dear to him. He also wears a flower in his hair. If you see him without his headdress you will see a headband with a gemstone, made for him by his father.{/col}\n\n{col:ffffff}RP hooks:\nKoth grew up in Bloodhoof Village, feel free to know him from there in the past\nHe trained under Archdruid Runetotem\nHelped out during the Legion invasion and during the Fourth War\nUsed to be seen around Orgrimmar a lot\nStill seen around Thunder Bluff every so often\nOn occasion going back to continue his training to learn more healing to this day\n{/col}\n\n\nMore to come in the future\n\n{col:ff0000}-OOC stuff and info-{/col}\n{col:ffffff}Themes I am most interested in: Long term, story driven, slice of life, romantic. Others can come but ideas need to be given to me at times.\nWant long term? Then you better exchange Btag/Discord info. Absolutely required.\nAlso be 18+, toon and player for long term\nCross faction is an option as well potentially.\nKoth can show interest in anyone but Undead and Goblins. He does have his preferences, though.\nInterested? Shoot me a whisper and lets talk a bit. \nIf you're easily bored or bad at communicating you need not apply, I am sick of having to confront people about what should just be outright said\nWhisper friendly and extremely approachable, ooc and icly, always glad to set things up for RP or answer any questions\nI can do para but I typically avoid it in the VoH out of respect for others. I myself am not picky about post length and am not bothered by typos, it's not like I don't do them myself.\nNo combat RP, please.\nTaking initiative and being confident gets you places.\nRP is a two way street, don't ghost me and let me know what I'm doing wrong if I do something you don't like it. I can be adaptable if you tell me what to do. Don't expect me to read your mind, nobody can do that as much as some of you desperately want it. Learn some communication skills ffs. \nMature themes are story driven only\nLet's get out of the city to RP, Orgrimmar RP is boring \nNo, I do not use growth pots and never will despite Koth being twelve feet tall.\nIf it matters that much I am male IRL\nF-List avalible on request for those who are 18+ and interested in long term\nPolitics in TRP will be ignored promptly{/col}\n\n\n",
				},
