						["IC"] = "inv_pet_pandarenelemental_earth",
						["BK"] = 1,
						["TX"] = "{col:6174ff}Yu is fun loving, friendly and bubbly. She is fairly naive but far from shy.  This Pandaren is eager to learn and puts herself out there to make connections and friends.  She is very loyal and loving towards those she cares about.{/col}",
					},
					["HI"] = {
						["IC"] = "inv_pet_pandarenelemental_fire",
						["BK"] = 1,
						["TX"] = "{col:5e6fff}Yu is from a small island in a village called Wu-Song.  Life there was pretty simple, pretty small. That was until one day the Hordes airship crashed nearby. Word of the outsiders spread and little Yu snuck out to see.  Like a kid falling inlove with a comic book hero Yu became obsessed with the Horde.  She idolized them, their strength, their might. She vowed that someday she would escape from her island, family, village and set out to find and join the Horde. Which she has done now being new to the ranks.  She is set now for missions and adventure for the glory of the Horde and her new life!{/col}",
