		["09071419141bIsF"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Wrathguard: Kaz-Amal",
						["TX"] = "Always at Nothogg's side, even if hidden in shadows or behind a portal, is his husband and partner in all things: Kaz-Amal. The Wrathguard does not usually present himself in Orgrimmar out of respect to social customs, but behind closed doors will typically be physically present with his spouse.\n\nDemon Hunters, Warlocks, and other magic-sensitives can detect Kaz-Amal, and he makes no attempt to hide himself from such vision or senses.",
