			},
			["character"] = {
				["CO"] = "TRP Wipe",
				["RP"] = 1,
				["CU"] = "",
				["XP"] = 2,
				["v"] = 11,
			},
			["time"] = 1631154957,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["BK"] = 11,
				["T3"] = {
					["PH"] = {
						["IC"] = "ability_warlock_demonicpower",
						["BK"] = 3,
						["TX"] = "[Character Art]\n\n{link*https://cdn.discordapp.com/attachments/611681269537046536/793583808943357962/-w9LZlJH.png*Nothogg bust by @Treatscraft on Twitter}\n\n<><><><Text Description><><><>\n\nNothogg Blightscar is, at first glance, exactly what you'd expect from a Warlock. He's incredibly massive and clearly bulked up thanks to heavy fel use. His skin is a deep, rich, green and is barren of any scarring save for a thin scar running between his pectorals. His body is abnormally muscular even by warlock standards as his pecs have with unnatural might, and his biceps swell out with thick veins pumping demonically empowered blood through them\n\nDespite being a warlock, Nothogg looks more than capable of hoisting up two fully armored Orc men and tossing them a good distance. His body is, appropriately, tattooed quite heavily in demonic runes and curving lines. Most noticeable is a crest of the Black Harvest on his left shoulder. Nothogg has little shame about his physique and will even flex his hulking muscles to show off his body for others, men in particular.\n\nNothogg's face is more or less what you would expect from a hulked out Warlock. Strong jawed and hypermasculine in the extreme. Nothogg has a long beard of deep purple hair combined with a sharply spiked mohawk of violet. The sides of the mohawk are braided, but the rest is left to fall behind him in a legitimately impressive mane of purple hair that reaches to his knees.\n\nNothogg's eyes are a vivid purple that match his hair perfectly, though his fel tainting has left his eyes sclera as black as his pupils, while his violet irises gleam brightly. This gives his eyes a distinct and spooky look to them that's made more emphatic by the short onyx horns rising from his forehead. Nothogg keeps them neatly polished and often adorned with rings or caps of silver to look more appealing. Sprouting from Nothogg's back are a pair of demonic wings large enough and strong enough to allow for flight. Nothogg typically keeps them hidden to avoid frightening townsfolk and to make wearing clothes easier on him.\n\nNothogg's style of dress is, while obviously a warlock, not very \"edgy\" to put it bluntly. He tends to dress casually in clothes you would expect most orcish civilians and spell casters of the Shadowmoon clan to wear. Often these clothes are adorned with accessories and such that will easily identify him as a warlock to those in need of his services without coming across as excessively diabolical or frightening to normal people. As a shadowmoon his clothes favor purples, whites, blues, greys, and browns. All of which serve to provide him a more modest and approachable appearance despite his profession. Likewise his clothing is loose fit to give Nothogg a degree of flexibility and motion to accommodate his bulk more easily and show off his physique to others.",
					},
					["PS"] = {
						["IC"] = "inv_summondemonictyrant",
						["BK"] = 3,
						["TX"] = "As a warlock and member of The Black Harvest, Nothogg is predictably quite abrasive and disrespectful to most people. In particular he has a strong contempt for authority figures and leadership and will not hesitate to ignore or refuse the commands of anyone who tries to boss him around. The only people Nothogg unconditionally respects is his husband and The Black Harvest council leadership, and the second one is on a situational basis.\n\nAs a scholar and researcher for The Black Harvest, Nothogg is capable of being far more eloquent than you would expect such a brash and foul mouthed man, and often shows a more tender side around novice magic users. His efforts at teaching often contain a less hostile and more jovial form of harshness or abrasion paired with a clear enjoyment of seeing others learn to wield the forces of sorcery.\n\nIn many ways Nothogg can seem like a backwards warlock. He's more often modest and down to earth where others are cackling and maniacal. His treatment of fel is likewise the same respectful and mathematical approach used by mages to the arcane forces. His more analytical approach shows through actions over words how the forces of fel are just as much a natural force and a tool that can be invaluable when handled with the respect and caution warranted by it.\n\nWith other warlocks, mages, or studious types Nothogg's abrasion softens into something far more earnest and passionate. His interests are not restricted to hellfire and demonology, magical study of any kinds perk his interest. When he gets engaged and rambling on a particular topic, you can see his eyes light up all too much like a young and excitable orc boy half his age.",
					},
