				["T3"] = {
					["PH"] = {
						["TX"] = "{col:6049ff}Indy is tall, even for a Kaldorei. She walks like someone who is either drunk, or not used to being on two legs. (Hint: It's both.) She is always smiling, which frequently shows off her sharp canines.\n\nAlso notable is the fact that her left eye is a brilliant gold, like many druids', but her right is paler and still has a fleck or two of silver. This is much more noticeable when she is a giant bird... which is most of the time.\n\n{link*https://indraste-darktalon.tumblr.com/post/660193529000329216/art-of-the-absolutely-incredible-indraste-i-was*Find art here!} ((Link goes to her tumblr))\n{/col}",
						["BK"] = 1,
						["IC"] = "ability_ambush",
					},
					["PS"] = {
						["TX"] = "{col:6049ff}Indy is a healer with a quick temper who is not afraid to hit the source of her frustrations with a stick. Or her fists. Despite this, she is generally merry, fun-loving, and a bit mischevious. She likes to keep things light. \n\nHer biggest flaw is a tendency toward cowardice: she's still getting used to the concept of her own mortality. For close friends, she will go down swinging alongside them, but she's far more cautious about aiding strangers.\n\nIf you'd like a musical exploration of her current mental state, {link*https://youtu.be/r-zPvsT4zB0*parade with me}. ((Link is to a lyric video.))",
						["BK"] = 1,
						["IC"] = "inv_staff_2h_ardenweald_d_02",
					},
					["HI"] = {
						["TX"] = "{col:6049ff}Indy has only become a full druid relatively recently, and has spent most of her time in Outland working with the Cenarion Expedition to heal the damage done by the Burning Crusade. Coming back to Azeroth has left her a bit shell-shocked. Do not expect her to know what has happened in the past decade and change...",
