				["RE"] = "The Wilds",
				["IC"] = "inv_misc_trinket6oih_wolf1",
				["EH"] = "ff9707",
				["HE"] = "3'6\"",
				["WE"] = "Fit n' Fuzzy",
			},
			["about"] = {
				["v"] = 36,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n{h1:c}AKODA{/h1}\n{h3:c}The Wilder{/h3}\n\n\n{col:95b69c}--Here is a savage, quiet and lonesome vulpera wearing travelworn, sunfaded gear.   It appears to have been stiched and restiched, patched and repatched over it's long use. His arms and dusty footpaws are wrapped in tan cloth for support during lengthy travel.  His bow gives him away as an archer and the large wolf he typically travels with indicates an affinity towards beasts. He very much has the appearance of a fox who spends most his time in the wilds. {/col}\n\n{col:5c9875}--Upon his head he is never without his  cloth and leather mask.   Only his striking amber eyes peering out at the world in cautious appraisal.  Braids of coarse fur adorn the mask and provide warmth and camoflage which seems to be his armor's primary purpose. It's practical but not very fashionable. His only piece of decoration appears to be a wolf-head amulet made of silver with pale blue gems for eyes that hangs on a sturdy chain around his neck. {/col}\n\n{col:248c5b}--On his back is a simple travlelers pack stuffed with odds and ends to aid in survival along with bundled pelts to be traded in towns and cities he reluctantly vists. This could very well be all the posessions he has.  A quiver of arrows, a short bow (a longbow in the paws of a Vulpera) and a walking stick/glaive serve as his weapons. The rest he gathers and hunts.{/col}\n\n{col:007348}--Almost always at his side or lurking nearby is a large, healthy and dangerous looking wolf of one variety or another.Each are distinct in personality and behavior but more often than not he travels with a large, healthy wolfess named River who is fiercely defensive of her hunter. River protects. {/col}\n\n\n\nWIP Ty for reading.  ",
				},
