						["IC"] = "inv_elemental_primal_life",
						["TX"] = "Nela's affinity for Life reflects in her person. She is incredibly fertile beyond any norm. She is usually pregnant, either with her own or as a surrogate.\nNela is a tridelphyte, meaning she has three wombs.\n\nCurrently: \n1) Late Third term of pregnancy. \nTummy is very round and is swelling super huge more and more! She is HUGE! Carrying twins. Large Twins.\n\n2) 2nd womb impregnated. In mid-first term.\n",
