					["3"] = {
						["IC"] = "inv_staff_50",
						["TI"] = "Staff of Power",
						["TX"] = "Nela carries with her an ornate and powerful wooden staff. It is crafted with wood from Nordrassil before the Third War occoured. Given it's origin, the staff allows Nela to channel nature energy at an to a very high degree.",
						["AC"] = true,
					},
					["2"] = {
						["IC"] = "ability_hunter_onewithnature",
						["TI"] = "Attuned to Life",
						["AC"] = true,
						["TX"] = "Nelaleria has a deep connection with the natural world of plants and animals and can sense their needs. She has a keen affinity to fertility in fauna & flora, and can help barren ground grow and dead seeds be renewed. \n\nShe can sense decay or dead organs inside an other. She can help pinpoint gangreen and other ailments in a living creature.\n\nMay also sense living creatures nearby to her or from behind a wall.\n\nRepulsed by Fel and undeath. (DK's, DH's, Warlocks, etc. Nothing personal just repulsed by the energy)",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Supply Pouch",
						["IC"] = "inv_misc_bag_herbpouch",
						["TX"] = "Nela has a pouch on her side carrying many teas, herbs, potions and snacks. She may offer you something if you are feelnig ill, in pain, or low energy.\n\nNela also creates novelty items for her special stash. The effects of these potions can wildly vary",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Look at that Wagon!",
						["IC"] = "inv_misc_throwingball_01",
						["TX"] = "Behind Nela sticks out a big ol' caboose! It's very difficult not to notice her full plump rump. You could set jars with the shelf it gives!",
					},
