				["v"] = 16,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-warboard-classic-Feralas:512:256}\n\n{h2}Appearance{/h2}\n{col:4cff4f}The woman before you appears youthful, full of energy, vibrant and glowing. She is infact ancient but you couldn't tell by looking at her. Her skin is a healthy colorful pink, her hair a rich plant-like green, and her eyes twinkle like little white stars. The visage she bears is one of welcoming and comfort, showing the gentle soul which lies within.\n\nThe lovely fresh fragrance of flowers emits off her person, at times she is literally covered in them. Her energy is raditant and brings out the natural beauty of the world around her.\n\nShe stands tall and proud with good posture. Nicely toned muscles line her body, showing off all the walking she does. A shapely backside which fills out her pants very well, so much that it could be a shelf. Wide hips are a prominent feature of the elf, no doubt perfect for the many occasions of childbearing she does.  Add in a hefty full bust sitting atop of her curvy torso and there she is!\n\n{h3:c}{link*https://imgur.com/602rOx1* Nela Art}{/h3}\n{h3:c}{link*https://i.imgur.com/U65FgNf.jpg*Nela Art 2 Newest}{/h3}\n{h3:c}{link*https://i.imgur.com/p5u8M0E.jpg*Nela Art! NSFW! Use Discretion.}{/h3}\n{h2}Personality Traits{/h2}\n{col:4cff4f}Nelaleria is a very kind and compassionate person. She treasures life and nature and always considers how her actions affect the world around her. A very conserving person, she never takes too much and prefers to ensure a balance between consumption and regrowth of nature. She is an advocate for non-violence and will do all she can to avoid unecassary pain and death.\n\nAs part of her compassion and reverence for life, she pays extra care to the most innocent of living things. She does care about adult people yes, but intensely cares for children with higher precedence. Along with her care of young children she also highly cares for animals, particularly small animals.\n\nWhen it comes to romantic things, Nela is very open to partners of all sorts. She divorces sexual encounters with emotional love commitment which makes her one to sleep with whomever she finds attractive. Her relationship preference would be for another female, but is attracted to males and females physcially alike.\n\nOne thing she has been known for is her often sage-like advice. She takes pleasure in being able to help others with guidance and is like a spiritual mother to others, along with being a physcial mother to many. {/col}\n\n{h2}Background{/h2}\n{col:4cff4f}Nelaleria hails from Feralas, almost all the way back to the Kaldorei empire days but no record of her birth is around today to be sure. At an early age she had an affinity for nature and a bond with animals which led her into the path of druidry.\n\nFor millennia she has been a roamer, always traveling the lands to help wherever she can and also just to take in the beauty of the natural world. Rarely has she settled down, and even when she does it's never too long before she took herself back on the unbeaten path.\n\nNela has had her fair share of adventures but it would be best to get to know her to hear of them. {/col}\n\n{h2}Other{/h2}\n{col:4cff4f}Nela has a very abnormal feature about her, she has three wombs which are each functional. It means she can have three seperate pregnancies going on at the same time.\nShe often is pregnant thrice at the same time, usually being a surrogate mother for others as well as endangered animals, yes I said animals.\n\nShe has a very high number of biological offspring due to the unfettered love-making she does and her incredibly high fertility rate. If you wish to have a toon be one of her grown-up children, I am very open to that and it could be some good RP.\n\nAm I werid? A little bit. Super nice though! Always looking for new friends to enjoy RP with.  \n\n{h3:c}{link*https://youtu.be/Gr5KdeKS7wc*Theme Music}{/h3}\n{/col}\n\n{h3}All things said, I do not seek out ERP. Romantic RP is fine with me and intimate RP can be part of it, but I do not soley look for ERP or ERP relationships, I need real story RP first!{/h3}\n\n",
				},
