			["about"] = {
				["v"] = 21,
				["BK"] = 2,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Born into captivity, Ambius was separated from his family very young. The Sethrac sorcerer Harthiss bought him out of recognition for his intellect, and used him as a lab gopher for the most part...but Ambius watched everything his master did very carefully, secretly read every tome he could get ahold of, and soaked it all in.\n\nThe time came when he and Harthiss were visiting a Faithless trading camp to acquire supplies...a day on which it so happened several Horde adventurers tore through the area like an unstoppable tempest. When his master was slain, Ambius took his spell-book and coin purse, and fled with the other freed slaves for the Vulperan Hideaway.\n\nHe has since used the gold that was in the purse to pay for introductory lessons in magecraft, and now explores the worlds to acquire equipment, knowledge...and of course, more gold. Further, he found and joined a large Vulperan armada for mutual benefit, and serves as a researcher for their 'Keepers'.\n\nHis weapon was a gift from his primary teacher in Dalaran. It is a physical replica of the famed blade 'Felo'melorn', and has a name of its own; Felo'ligas...meaning. 'Flame Binder'. It has a few unique abilities that aid Ambius in keeping his magic under control.\n\nAmbius now carries a \"last resort\" artifact in a hinged box of pure truesilver. If the box is opened, everything and anyone within twenty feet containing mana and magical energy of the arcane or fel varieties will be nearly instantly drained of those resources. Either leaving that area, speaking the proper command word, or re-sealing the artifact in the box will allow a regeneration of energy at a rate of ten percent per minute. Magic cast into that area will also be absorbed by the artifact.\n",
