			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Faux Stability",
						["IC"] = "ability_deathknight_asphixiate",
						["TX"] = "The little elf, once touched by the whispers of the void... was now plauged by whispers of her own mind. Anxiety, shame, guilt... anger... each time they were triggered the elf was over-run with racing, chaotic thoughts. \nThis made her quite impulsive, and at times agressive. The little elf acted far more often on these impulses than she denied them.\n\nJealousy, selfishness, greed... the little elf was wrought by the touch of envy and all that came with it. She feared her place in the world, to once more lose everything. There were no more chances for her...\n\nYet she acted on impulse, she picked fights and acted like the spoilt selfish brat she could be.\n\nShe would get her way if she could, no matter who she had to go through to get it.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Mother Nature",
						["IC"] = "inv_misc_herb_twilightjasmine",
						["TX"] = "The little elf had a knack for all things flora and fauna. \n\nAnimals flocked to her, and came to her aid far more than she would have liked. They saw her as something to defend, to protect... and the fiesty little elf wanted nothing to do with it. She commanded nature as much as it sought to command her.\n\nShe was fond of plant life as well, much more so for what it could do for her... and she spent a great deal of her life learning about the different herbs and plants of her world. \n\nThis affinity for all things living is shared by most of her kin, for reasons they themselves dont seem to know.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Pride",
						["IC"] = "ability_priest_shadowyapparition",
						["TX"] = "The little elf was proud. She thought herself worthy of everything she wanted, and she could come off as a bit... concieted. Aithne wanted so many things, and no matter how long it took her---She would get it.\n\nThe girl was proud like a cat, tail in the air... happy to do her own thing however she pleased.\n\nShe wishes for her company to compliment her, not with words but by bringing out the best in her. Whatever those qualities may be.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Skinchanger",
						["IC"] = "ability_creature_disease_05",
						["TX"] = "Aithne can take on the body of her companions. \n\nWhile she takes their body she can control every aspect of what she does so long as her body remains safe. Her mind melds with those she uses this ability on, and only the weak minded are suceptible... unless you are of a more bestial mind. \n\nHer preference though will forever be her guardian, Conri. \n\nCurrently she's only able to do this in her sleep, and she's rather paranoid over it. It's new, and something that concerns her beyond everything else.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Faux Sobriety",
						["IC"] = "ability_demonhunter_vengefulretreat2",
						["TX"] = "She tried so hard to resist the temptation laid out before her... and she was quite capable of withstanding it... until the chaos of her mind became too much!\n\nBut, she was only about to have a drink or two... she knew her limits, she had to. \n\nShe wouldnt let the throws of addiction draw her back in... or at least the addictions of simple intoixicant. Once an addict, always an addict after all... some people just trade one thing for another.",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 3,
					["5"] = 1,
					["4"] = 3,
					["6"] = 1,
				},
				["v"] = 41,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{p:c}{col:00756b}\n\nThe Quel'dorei's look was youthful, but her pale blue hues were the eyes of an old woman. The look of chaos swirling in and out, mirroring the chaos in her mind. \n\nStanding 5 ft tall the little elf was just a little bit too skinny, her dark skin was just a little bit washed out... but her color was starting to come back. Though the world had tried to defeat her by the looks of her... she had fought, and brought herself back to life. Her appearance was starting to reflect that as the days passed by. \n\nHer long hair was well kept, most of the time, and quite often worn in a braid. When she is not paying attention, or distracted by something she couldnt keep the resting bitch face look from creeping in. It was something she was actively working on, trying so hard to let her face show her emotions. As of late she wore the devious of smirks, as if she were up to something.\n\nHer demeanor seemed chaotic, even if she was sitting still she -had- to be doing something with her hands or run her mouth, rambling on and on about something that had little to do with anything. Anxiety was a curse, not that she didn't talk a lot to begin with. \n\nAithne was a hedonist, she enjoyed all the pleasures of life... from something as simple as smoking a joint in a quiet place, or giving in to those more carnal desires. All she wanted was to silence the never-ending ramble of her inner monologue left behind from the remnants of her past corruption.\n\nSo easily swayed by something that sparked the flames of excitement and pleasure, it didn't seem to matter what it was. She was an addict, plain and simple... and hated herself so much more for it.\n\nThe anxious voice inside her mind was constant, tormenting her every waking moment... lying to her, sparking the flames of her anxiety. \nConsciously she knew that not -everyone- was out to get her... but when the whispers broke out of their cage sometimes their lies were just too much. Aithne's sanity was hanging by the thinnest of threads, she could go two ways... full-blown insanity, or she could start to heal and learn to control herself. She was desperately trying for the latter. And very much succeeding.\n\nAithne is far more likely to start a fight than mind her own business, and her volatile ways brought her further chaos in its wake. \n\nFighting was something so much more than a way to express her anger. Sparring will always be where she feels she can best express herself, and like a favourite sport she was always happy to fight. Whether it's for fun, or in anger. She felt alive.\n\nShe enjoys others, and sometimes forms attachments to people she barely knows, just because they interest her and gave her the time of day. No matter how anxious others made her she was desperate to find and make new friends. She lets her energy level and mouth get the better of her, and has been known to talk a mile a minute about absolutely nothing if given the chance.\n\nNot your every day find||||\n\nDetermined, loyal to a fault, and fierce... Aithne is pure of heart and very street smart, though she has her moments of showing off her book smarts. She had been well educated, even if she had chosen a life without the use of books, and without the use of the education her family had forced upon her. \n\nThough she enjoys reading and learning she prefers to do it at her own pace, on her own time. she is a very capable learner and has taught herself most everything she knows in life and continues to use... the exception being the years of book-learning in her youth.\n\nLoyalties, Family ties||||\n\nHer only true connections currently are that of her older sisters, and her faithful companion Conri.\n\nThough she was technically the owner of Conri, the wolf took great pride in her job of protecting Aithne. Often times ignoring direct orders to protect her. Even when not by the Quel'dorei's side, the wolf was like a shadow.. prowling nearby, ready to come to Aithne's aid.\n\n~~~\n\nOOC Bits||||\n\nThis character is cross faction, you would not know just by looking at her. You would possibly know if your character is ALSO crossfaction and frequents Orgrimmar/Stormwind.\n\nAsk about art!\n\nI'm not that great at walking up, so if you see something then say hello. I'll appreciate you forever!\n\nAithne will give anyone the time of day, just say hello. \n21 + Only\nWalks up appreciated and loved, although I might not always respond so send a whisper if you dont get a response. I dont bite, promise.\n\n~~~\n\nHooks for those who want them||||\n\n- Has spent a great deal of time in the fighting pits, though her skin seems flawless. She's always up for a spar, and a chance to add to her winning streak.\n\n- Has been seen wandering Zandalar and each of the 3 zones for a few years longer than most Horde. She would have stood out enough to be noticed, ask her about it if your character noticed her!\n\n- Those of a more primal/animalistic nature will recognize a presence about her and her wolf, the presence much stronger when they are together but noticeable when they are apart. Comment on it!{/col}{/p}\n\n\n",
				},
				["BK"] = 1,
				["TE"] = 1,
				["v"] = 54,
			},
		},
