						["IC"] = "inv_hammer_2h_horde_a_01_hd",
						["TX"] = "\nResting on her back or over her shoulder, Omko carries with her a (frankly) absurdly sized hammer. Almost as tall as she is, and maybe even as heavy.\n\nShe seems to have markedly little trouble carrying it around though, and it's anyone's guess how she swings it the way she does. \n\n",
