					["3"] = {
						["AC"] = true,
						["TI"] = "Forged",
						["IC"] = "ability_foundryraid_heatregulators",
						["TX"] = " \nOmko is a big lady. She's not that much taller than the typical woman of her heritage, but she is fairly thick of muscle, and thicker of fur. \n\nMost things about her are a bit bigger than average. Her chest is heavy, her hips are.. significant, and she walks with a relaxed gait.\n\n",
					},
					["2"] = {
						["IC"] = "spell_druid_bristlingfur",
						["TI"] = "Maulings",
						["TX"] = "\nOmko, from head to hoof, is a creature who is no stranger to violence. From the drogbar to the demons to her own people, she has lived a life rife with conflict.\n\nTo that end, while she certainly looks and sounds like the friendliest peach around, that hammer probably isn't for show. \n\n",
						["AC"] = true,
					},
					["5"] = {
						["IC"] = "spell_druid_sunfall",
						["TI"] = "Sunfire Anvil",
						["TX"] = "\nOmko's abilities are a bit perplexing to some. While she identifies herself as a druid, she appears incapable of shapeshifting, has very little in the natural gift of healing, and doesn't care much for plants.\n\nWhat she is good at, however, is absolutely clobbering the everliving crap out of things with her astral-imbued hammer. \n\nShe has a soft spot for animals.\n\nBirds, specifically.\n\n",
						["AC"] = true,
					},
					["4"] = {
						["IC"] = "ability_druid_dash_orange",
						["TI"] = "One-Woman-Battering-Ram",
						["AC"] = true,
						["TX"] = "\nThe first thing that comes with being so dense is momentum. This is something Omko has in spades.\n\nIn combat she is a sight to behold, charging and swinging her hammer with the might of someone twice her size. She's very proud of this, and her boisterous attitude in combat is a testament to her confidence. \n\n",
					},
