					["1"] = {
						["IC"] = "ability_racial_preturnaturalcalm",
						["TI"] = "Appearance: Fit and Void",
						["AC"] = true,
						["TX"] = "Tiny fists of fury! Avannaril is a measily 5'4\", quite the short stature for her people! Years of practicing a strenuous, physical regiment has rendered her body toned. Her body had a distinctly effiminate sillohuette, thanks to her elven blood. However, her muscles had shallowed her curves, particularly around her abdonment and waist. By volume, her arms and legs were closer to that of a human woman, rather than the stickly elves, but once more, lean. Her chest was modest at best. All-in-all, by high elven standards, she'd be considered a bit on the mannish side. \n\nHer face wasn't exceptionally pretty, broader features stretching its slender frame, and her hair was kept tame by a simply ponytail. A few strands of the deep, royal violet fall onto her face on a regular basis.",
					},
					["3"] = {
						["IC"] = "spell_priest_voidtendrils",
						["TI"] = "Glowing Tentacle",
						["AC"] = true,
						["TX"] = "I've seen enough Ren'tai to know where this is going...\n\nShe does have a tentacle growing out of the back of her head.  Electric blue energy pulses from tip to base, while the entire thing slowly glows with a soft white light.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Sha Tattoos on Left Side",
						["IC"] = "ability_monk_zenmeditation",
						["TX"] = "From her ankle to her wrist, her left side is covered in a dark, navy tattoo. It depicts the sha in traditional Pandaren style, each connected to the next and wound around a Pandaren character. The characters occasionally pulse with a soft, white light. Those around anger, hatred, and violence are particularly faded.\n\nFor those that speak Pandaren, the following characters are matched with each Sha:\nAnger - Passion\nHatred - Vengence\nViolence - Protection\nFear - Survival*\nDespair - Endurance*\nDoubt - Confidence\nPride - Acceptance\n\n*This tattoo does not glow.  If your character has spectral sight, or has accepted the Gift of N'zoth.  Let me know!",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "RP Hook: Gift of N'Zoth",
						["IC"] = "inv_eyeofnzothpet",
						["TX"] = "She's a servent of the Void.  None too insane, just a little sassy about everything.\n\nDuring the war against N'zoth, she stood alongside the Old God's minions.  This means, she was a traitor to the Alliance and exile to the Horde, as well as generally disliked in most places, save Goblin towns. \n\nFeel free to let your character know that!  \n\nShe has since defected from N'zoth, and, while regarded warily, is no longer treated with open hostilities from the Alliancs.\n\nIf your character is alligned with the Void, then they can also know the gist of Avannaril's recent history: served the Void, the N'zoth specifically, then defected from N'zoth, but still serves the greater Void.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Anti-Magic Shackle",
						["TX"] = "An iron shackle binds her right wrist.  Sigils etched into the dark metal prevent her from casting spells. These are commonly given to convicts to limit their abilities while on parole.\n\n((It's very similar to an ankle-tracker.))",
