					},
					["PS"] = {
						["TX"] = "Quite. Stoic. Slightly below average intellegences. Warm hearted. Loves using Brute force to get the job done. ",
						["BK"] = 18,
					},
					["HI"] = {
						["TX"] = "Born not knowing how brought her into this world, she learned to take care of herself as best as she could with her eldery gaurdain. \n\nTime was cruel to the young Shu'halo as her guardain fell ill, she panicked and tried to to out to the lands of Mulgore to find herbs to mend her dying elder. When she returm, disaster revealed its sisnter head. \n\nA lone Grimtotems entered Ûshan residences, looking and killed the one person she knew and loved. She fought back with the first thing she could her hands on. She fought and sustained great injuries but she refused to yield.\n\nThen it seems a An'she blessing came bore her as a band of Sunwalkes saved her from death. \n\n\nShe awoken with scares of both loss and blood. But she swore that no one will never have to feel the injustice she had felt that day. She learn the and became a Sunwalker. Upon yearning her title she was blessed with An'shes might, burning injustice and giving warmth to the needed. ",
