			["character"] = {
				["v"] = 51,
				["CO"] = "Will most likely respond to RP!\nMay not initiate....kinda shy\nFeel free to whisper\nWalk ups welcome!\nPlayer is 21+\n",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 1,
				["CU"] = "-Doing what I can to make Azeroth a better place\n",
			},
			["time"] = 1631151802,
			["link"] = {
				["Fistofmoo-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "                              {link*https://www.youtube.com/watch?v=qdjF-KapU9Q*Words Drowned By Fireworks}\n\n{link*https://www.youtube.com/watch?v=v_hWbLaufGM*The Man They Called Cayde (Orbit Verrsion)}\n\nFist grew up as a common Tauren with no real calling for the world of adventure. During the Burning Crusade, he traveled to Outland but was more helping with provisional restocking than fighting.\n\nWhen the scourge rose, and the Lich King awoken, he used his compassion to assist those who lost their homes and loved ones. He traveled between the three horde capitals of Thunder Bluff, Orgrimmar, and Undercity giving aid and comfort to his fellow citizens. Uplifting their spirits with words of encouragement and giving what coin he could to help those that survived undeath, survive. \n\nWhen Deathwing came and tore the world asunder he still chose to heal, instead of take action. Not knowing what route to take in combat. The factions were at war again, and the world was changed forever when Deathwing came up from Deepholm. \n\nAfter the Destroyer was defeated, Fist was in Orgrimmar when a new faction joined the horde under neutrality. Ji Firepaw had a faction of Panderan with him and brought with him the teachings of the Monk. The way they used their bodies as a weapon instantly drew Fist to hear more. As a tauren, his large frame would make it a challenge but after standing on the sidelines for so long he knew it was time to take a stand and step on to the battlefield. But he would not ever be the aggressor. \n\nAfter the disposition of Garrosh, and the campaign on Draenor it almost seemed like peace would finally come to Azeroth. One threat comes after the other tho, and before long another group of visitors would come to Orgrimmar. Warchief Vol'jin welcomed these \"Demon Hunters\" and they spoke of another Burning Legion Invasion. It was only a matter of time before they would attempt to destroy our home again.\n\nWhen the call came out for volunteers to head to this island known as the \"Broken Shore\" to confront them at the Tomb of Sargeras, Fist signed up without hesitation. Protecting his home by extension was protecting those that lived there. All those who went to the shore know how that turned off. The loss of Vol'jin, and the passing of mantle to a new warchief - Sylvannas Windrunner. \n\nBy the time Fist came home from Argus, Fist was tired. The amount of fighting that had gone on from an endless army was extensive. But they had emerged victorious. It also showed him that the Horde and Alliance can throw aside their faction loyalties and unite under the banner of Azeroth to protect their home world.\n\nWhen Sylvannas decided to attack Teldrassil it made Fist question the Horde. Why should so many innocents die? It was an unprovoked attack. There was no reason for it. He questioned the motives of his Warchief. Where was she leading the Horde? They just got done fighting together, and now they are fighting each other. She brought both factions to the another war. So much death and loss on each side.\n\nWhen the veil was ripped open, her plan still didn't make sense to Fist. But he knew that she was acting on her own goals, not the great good of the Horde or Azeroth. Now that Fist has crossed over the Veil, he will still do what he can to protect those that he can and make sure that all those are treated fairly in his compay. He has never had a home to settle down in, so his travels will take him across the Shadowlands and make to Azeorth in time.",
