						["IC"] = "achievement_character_draenei_female",
						["TX"] = "Jelvii's pale white skin is so bright that it seems to glow in dimly lit places. An advantageous trait for someone who enjoys showing her majestic figure at all times.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Crystal Power",
						["IC"] = "inv_staff_2h_jcprofession_c_01",
						["TX"] = "Jelvii carries a staff purchased for her in Kul Tiras. She adores the beautiful gems and elegant design. While not a fighter, Jelvii will use the staff to defend herself in an emergency.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Bejeweled Masterpiece",
						["IC"] = "inv_jewelcrafting_mithrilfiligree",
						["TX"] = "Jelvii's body is covered in ornaments and jewellery. From beautiful rings to an ornate necklace to the filigree along her tail, Jelvii has been outfitted by master jewelcrafters to look her absolute best.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Chains of Silver",
						["IC"] = "spell_warlock_demonicservitude",
						["TX"] = "Beneath the elegant jewellery and revealing wardrobe, Jelvii seems to have a collar and wrist braces dipped in silver. In passing, these accessories do not stand out among the other pieces in Jelvii's collection but they were specially designed to attach to chains.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Softly, Sweetly",
						["IC"] = "inv_valentineperfumebottle",
						["TX"] = "A passion for perfume ensures Jelvii always smells delightfully fragrant. Her tastes vary from floral and fruity scents to more exotic aromas. Jelvii's love of expensive luxuries leads to the purchase of only the finest fragrances.",
					},
