			["link"] = {
				["Jelvii-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["read"] = true,
				["BK"] = 5,
				["TE"] = 3,
				["T3"] = {
					["PH"] = {
						["IC"] = "ability_warrior_strengthofarms",
						["BK"] = 1,
						["TX"] = "Jelvii's alabaster white skin is said to be softer than the finest velvets. Her slender figure seems to perfectly curve to support her grandly sized chest and generous rear. Her legs are long and shapely, delicate limbs for a graceful draenei. \n\nJelvii's pristine face is gentle and often smiling. She wears a great deal of verdantly coloured makeup. Her deep mossy lipstick and emerald eyeshadow accent the natural beauty of a draenei maiden.\n\nA wardrobe consisting of revealing outfits and finely tailored undergarments reveal much of Jelvii's beautiful skin. Sheer stockings rise all the way to her thighs and her wide sensual hips are barely contained by her silken panties. A bra fits comfortably around her chest, designed more for fashion than support. Often, Jelvii will wear fine dresses over this. These dresses are often worn for some semblance of modesty in appropriate times. Otherwise, she seems perfectly content to simply allow her skin to breathe.\n\nJelvii's body is adorned with all manner of well crafted jewellery and accessories. An exquisite ornamental filigree rests on her long shapely tail, encrusted with a polished amethyst.\n\nAmong the adornments are a set of wrist chains and a metal collar, both crafted with silver and designed to appear beautiful despite their purpose. Jelvii does not seem unhappy in this condition.",
					},
					["HI"] = {
						["IC"] = "inv_misc_book_12",
						["BK"] = 1,
						["TX"] = "Jelvii is a beautiful draenei that enjoys a life of luxury and pleasure. She indulges in the finer things in life and enjoys being cared for by others. She is shameless about her enjoyment in her hobbies and pursuits. Due to her expensive tastes, Jelvii is dependent on others to maintain her lifestyle. Affluent and wealthy friends enabled her in Stormwind as she became increasingly incapable of taking care of herself. Any skills learned through hardship on Draenor were long forgotten. Outland was as distant a memory as her days as a young initiate in the priesthood. Though she has received formal training as a priestess of the Light, Jelvii denies any such power. She dislikes being recognised as one and will often speak negatively of her abilities and that part of her life.\n\nThe Fourth War and the loss of Teldrassil brought many hardships to the citizens of the Alliance. Jelvii saw many of her friends join the fight against the Horde. As a mere civilian, she simply remained in the safe protected walls of Stormwind hoping for life to go back to normal. Instead, she received letters from the front lines, news of death and tragedy, and worst of all found herself in a series of abusive relationships. Jelvii's expressive emotional personality and delicate constitution made her easy to use and abuse. And time after time, she found herself the subject of heartbreak.\n\nGrief was one emotion that proved far beyond the pleasure seeking ways that carried Jelvii from one day to the next. She couldn't run forever from relationships that ended poorly or from the reality that goodbye really meant goodbye. She had spent her nights partying with her best friends only to never see them again after they set sail for Kul Tiras. Daydreaming of her past relationships and the unhealthy idealisation that prevented her from seeing she was never truly loved. With every new understanding of how empty her life was, Jelvii began to sink further and further into a sense of defeat.\n\nNow, Jelvii finds herself wasting away in the streets of Stormwind no different from the displaced Darnassian refugees. With a dwindling supply of gold and an even shorter list of friends to pay for her most basic essentials, Jelvii wonders if she had survived the horrors of Outland simply to die starving in a city of wealth and opportunity. An ironic fate, she thought, but not one she wished to endure. The fear of death was now her motivation to simply try and improve her life, though she feared even more the notion that she knew nothing of the realities of caring for herself.",
					},
				},
