			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1:c}Appearance{/h1}\nAinkai stands about 3’4” with soft orange fur covering his body with a few white spots. His face gives off a warm smile with his greyish blue eyes. His ears are somewhat small and end in black and often flicker to faint sounds. He takes great time and effort to keep his fur looking fluffy and soft.\n\nHe’s often seen with a rylak skull on his head, a rather sturdy chest piece, and wearing light pants to restrain as little movement as possible.\n",
						["BK"] = 1,
						["IC"] = "inv_bone_skull_04",
					}, -- [1]
					{
						["TX"] = "{h1:c}Personality{/h1}\nAinkai is carefree and laidback to a fault, having a hard taking anything seriously. Stranger or friend, he'll welcome them with a smile.",
						["BK"] = 1,
						["IC"] = "inv_alchemist_81_spiritedalchemiststone",
					}, -- [2]
					{
						["TX"] = "{h1:c}History{/h1}\n Ainkai can’t seem to remember most of his past. From his childhood to his early adulthood seems to be a mystery to him. The moment he awoke from a coma, he was met with a troll priest of Akunda who saved him and has been tending to him from a peril he does not even remember. After recovering from his wounds and thanking the troll, he set out to a land he only vaguely remembers. A new beginning unburden by the past.\n",
						["BK"] = 1,
						["IC"] = "inv_inscription_80_contract_vulpera",
					}, -- [3]
					{
						["TX"] = "{h1:c}Hobbies{/h1}\n\nHunting: Enjoys hunting beasts for their bones. The bigger and deadlier they are, the more Ainkai will enjoy the hunt.\n\nMaking art with bones: In his free time after a long day hunting, Ainkai enjoys decorating skulls and bones with a variety of things. Making from simple decorative house pieces to armor decorations to sell or give to friends.\n\nCollecting skulls: He has a rather large collection of both normal and heavily decorated skulls. Most are personally collected by him.\n\nDrinking: Just likes to drink till he pass out...Not much to it. Better with friends.\n",
						["BK"] = 1,
						["IC"] = "inv_misc_1h_orcclansblacksmithhammer_a_02",
					}, -- [4]
				},
				["BK"] = 3,
				["TE"] = 2,
				["v"] = 21,
			},
