					}, -- [3]
					{
						["TX"] = "{h3}{col:ff9900}Reputation, Relations, and Roles{/col}{/h3}\nWIP.\n\nAman Gigifuse's Reputation:\n• WIP.\n\nAman Gigifuse's Relations:\n• WIP.\n\nAman Gigifuse's Roles:\n• WIP.\n",
						["BK"] = 1,
