					{
						["TX"] = "{h3}{col:ff9900}Gameplay Choices{/col}{/h3}\n• WIP.",
						["BK"] = 1,
						["IC"] = "ability_rogue_grapplinghook",
					}, -- [5]
					{
						["TX"] = "{h3}{col:ff9900}RP Hooks{/col}{/h3}\nYour character may know Aman if:\n\n• WIP.\n",
						["BK"] = 1,
						["IC"] = "sha_ability_rogue_bloodyeye_nightmare",
					}, -- [6]
					{
						["TX"] = "{h3}{col:ff9900}Out of Character{/col}{/h3}\n• Hi there! I go by Edi (Pronounced like the name Eddi/Eddy) and I'm the player behind Aman's character. I'm over 21 years of age and I'm willing to interact with anyone over 18.\n \n• Both Aman and I are LGBTQIA+ (Both Aman and I are trans and bisexual) and I both go by he/him pronouns.\n• I'm open to almost all RP themes excluding ERP.\n\n• Always remember that IC does NOT equal OOC. \n\n• Additionally, due to my social anxiety, I rarely walk up first, sorry! Walk ups are greatly appreciated because of this.\n\n• If I'm marked as IC, I'm IC! This includes cities and the world, the only exceptions are dungeons and raids. I absolutely adore world RP so feel free to stop me while I'm questing or doing dailies! \n\n• On top of adoring world RP, I also live for cross faction interactions! Aman is neutral in terms of his attitude towards the Alliance, so feel free to walk up!\n\n• While I have over a decade of RP experience, I'm fairly new to WoW and its lore (I only started playing when BfA was released), so patience is appreciated! Feel free to correct me (nicely) if I say something that is not supported by lore. \n\n• Please note that the I'm autistic and a relatively slow typer (especially for longer replies), so patience is very much appreciated when it comes to responces! \n\n• That being said, I ever miss a responce, please don't be afraid to whisper me and let me know!\n\n• Thanks so much for reading this all, have a fantastic rest of your day or night!",
