				["PE"] = {
					["1"] = {
						["IC"] = "spell_shadow_soothingkiss",
						["TI"] = "Woo",
						["AC"] = true,
						["TX"] = "Vlahos enjoys meeting new people, but mostly so he can win them over and extract valuable information from them. He thinks he's pretty charming.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Time is Money",
						["IC"] = "ability_racial_timeismoney",
						["TX"] = "Vlahos is always looking for a way to bolster the Novikov Family Business. And if that means stepping into the shadows, well, so be it.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Casual Attire",
						["IC"] = "inv_shirt_black_01",
						["TX"] = "Vlahos is actually a merchant rather than a champion to a cause. He tends to wear casual clothing: simple leather tunic, riding pants, and a utility belt.",
					},
					["5"] = {
						["IC"] = "ui_venthyranimaboss_heartsword",
						["TI"] = "Chaser of Beauty & Danger",
						["TX"] = "Vlahos can't help but be allured by everything and everyone beautiful and dangerous. ",
						["AC"] = true,
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Observant",
						["TX"] = "He's always listening in on conversations, or keeping an eye on the more interesting people in the city. Do you have something valuable? Vlahos wants to know about it.",
						["IC"] = "sha_ability_rogue_bloodyeye_nightmare",
					},
				},
				["v"] = 34,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{col:ff2014}{h1:c}Vlahos Novikov{/h1}{/col}\n{h2:c}Youngest Son of the Novikov Family Business{/h2}\n{img:Interface\\Pictures\\artifactbook-hunter-cover:256:256}{h3:c}Grave Robber. Black Market Smuggler. Chaser of beauty and danger. Terrible cook.{/h3}\n\nYou probably have, of course, heard of the Novikov family if you spend a frequent amount of time in Dalran. When the family name is mentioned, it's always spoken about in hushed tones -- as if speaking it will manifest some sort of terrible fate upon the one who dares to say the name aloud. \n\nOn the surface, the Novikovs are a family of merchants who have a knack for savvy and entrepreneurial business dealings. Their ware of choice is, of course, smuggled artifacts intended for the Black Market. This is no secret. In fact, the Black Market in Dalaran is frequented by buyers almost as often as any other auction house in a major city. The huge economic boost and revenue makes the Kirin Tor turn a blind eye, and so business in the Underbelly continues on each day as normal. \n\nBut the politics of shady business dealings, especially among a family of rogues such as the Novikovs, isn't always pleasant. Many other smugglers aim for the same attention and preference that Madam Goya gives to the Novikovs.\n\nTry as their enemies may, nothing will stop the Novikov Family from keeping complete control over their trade empire. Nothing.\n\n{h3:c}Character Information{/h3} \n{h3}Black Market Smuggler{/h3}Vlahos thinks he's quite alluring due to his ability to charm his buyers into whatever business deal benefits him the most at the time. As a rogue, he's also skilled at getting out of precarious situations if the business deal goes south. He actually prefers not to get involved in combat or fighting, thinking that there isn't a conflict in the entire world that couldn't be solved with the right business deal, but he has no qualms about taking a life if the situation requires it.\n\n{h3}Internal Conflict {/h3}As Vlahos has gotten older, he has begun to wonder if the live of smuggling stolen artifacts, while glamorous and thrilling, is what he's meant to do in life. He sees the heroes and champions coming in and out of the city, heading off to fight their noble battles to save the world time and time again, and feels discontent growing inside his heart. This internal conflict only grows stronger with every new hero that he meets in the world...\n\n{h3}Chaser of Beauty and Power{/h3} Vlahos is attracted to everything that is beautiful and dangerous. Perhaps you'll catch his eye.\n\n\n{h3:c}OCC Information{/h3}\nPlayer is a 29 year old queer woman. I'm extremely new to RP and to WRA, but happy to be here! I enjoy creative writing, and I'm using RP to help with inspiration and to practice my creativity. \n\nLooking for more lighthearted, adventurous RP with smuggler/trade/Indiana Jones-esque plotlines. Not really looking for ~romantic~ plots at this time, unless they happen naturally as the story unfolds.\n\n{h3} Current  Relationships:{/h3}\nAlyosha Novikov - Older Brother\nArtem - Adventuring Companion\n\n\n",
				},
