		["03041649087U7Zc"] = {
			["character"] = {
				["v"] = 25,
				["CO"] = "• Mature + Dark RP. 21+ Adults Only.\n• I prefer novella style RP.\n• Whisper me if I miss a post.\n• Despite my character's name, I'm a friendly dude.\n",
				["RP"] = 2,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "• Brimming with newfound power.\n• (( The quality of RP that WrA-Horde has to offer has really gone down hill. ))",
			},
			["time"] = 1631052299,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}{col:7f5530}• Ω •{/col}{col:95ff2c} The Carcinogen{/col}{col:7f5530} • Ω •{/col}{/h1}\n{h3:c}{col:95ff2c}\"a substance capable of causing cancer in living tissue.\"{/col}{/h3}\n\n{img:Interface\\Pictures\\artifactbook-demonhunter-cover:256:256}\n\n{h1:c}{col:7f5530}• Ω •{/col}{/h1}\n\n{col:7f5530} Ω{/col}{col:95ff2c} Horns. They're typically the first thing noticed about a demon hunter. In Karcinogen's case, that's no different. They are immensely large and curve upwards gradually. The entire length though, have ridges and are as black as obsidian. Kept long and tied up in a traditional manner is the male's hair, raven hued and swept back for convience for the most part. Along the male's jaw is facial hair, which is just along his jawline but kept neat. Evenly trimmed, and maintained daily. Karcinogen's face is that of a normal Sin'dorei's, apart from the blindfold with the typical fel-green glow that most Illidari don. He's even managed to keep his face free of any scars.{col:7f5530} Ω{/col}\n\n{col:7f5530} Ω{/col} The famous tattoos can be found sprawling across his chest and back. These typically glow the same fel-green as his eyes, only pulsing with energy when in combat. Beneath the tattoos lie corded muscle from daily training and going on hunts often. Not only the muscles hide beneath the tattoos, but countless scars of many past battles and fights. As of recently, the Illidari's skin tone has darkened and taken on a bit of a scaly look. There's also the growth of talons of where he once had finger and toe-nails.{col:7f5530} Ω{/col}\n\n{col:7f5530} Ω{/col} It appears that Karcinogen has finally made an upgrade to his armor; after literally being forced to. That old armor just wouldn't stay on anymore. While still light and allows mobility, he's made quite a few improvements to the physical defense a suit of armor should provide. Fel magic and enchantments can be felt from a good distance away; while the armor still has a lot of gaps, the magic would likely make up for them. Oh, and the skull's blade on his belt? Sharp and lethal, without any doubt.{col:7f5530} Ω{/col}\n\n{h1:c}{icon:achievement_boss_argus_varimathras:25}{/h1}\n\n{h1:c}{col:7f5530}• Ω •{/col} {col:95ff2c}OOC Section{/col}{col:7f5530} • Ω •{/col}{/h1}\n\n{col:7f5530} Ω{/col}{col:95ff2c} I typically steer clear of child and animal RPers. You're knuckleheads and I don't want to associate with you.{/col}{col:7f5530} Ω{/col}\n\n{col:7f5530} Ω{/col}{col:95ff2c} I also tend to avoid those who broadcast their political or religious views. I immerse myself in RP, and won't be bothered by your agendas; whether far left, far right bible thumpin' or goat sacrificin'. I ain't about none of it.{/col}{col:7f5530} Ω{/col}\n\n{col:7f5530} Ω{/col}{col:95ff2c} Your character's gender or sexual preference is not a personality. 'Fuck outta here with that.{/col}{col:7f5530} Ω{/col}\n\n{col:7f5530} Ω{/col}{col:95ff2c} If you RP a race that is having an identity crisis and is desperately trying to be anything than what they aren't, I will walk away without a second thought. It is your right to RP anything you want. It is my right to choose not to RP with you.{/col}{col:7f5530} Ω{/col}\n\n{col:7f5530} Ω{/col}{col:95ff2c} Your big, badass Orc, Tauren, or Troll makes me laugh. -HARD.-{/col}{col:7f5530} Ω{/col}\n",
				},
