					["1"] = {
						["AC"] = true,
						["TI"] = "I",
						["TX"] = "If ever near this Illidari, one can certainly feel a tangible magical aura. Incredible power just barely held in check within his very being. The feeling would be close to that of electricity humming in the air or even a loud speaker with heavy bass.",
						["IC"] = "spell_fel_elementaldevastation",
