					["3"] = {
						["AC"] = true,
						["TI"] = "III",
						["TX"] = "Much like himself, his armor is offers a heavy magical presence. Mostly enchantments, and maybe even a curse or two. It appears new, however, and is more equipped to aid in offensive attacks than that of providing defense.",
						["IC"] = "inv_helm_leather_raiddemonhuntermythic_r_01",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "II",
						["TX"] = "The glaives he uses are often stowed upon his back. When they are, the flames are not present. The fire erupts to life upon a silent command from the Illidari.",
						["IC"] = "spell_fire_felflamebreath",
