						["AC"] = true,
						["TI"] = "(( OOC ))",
						["TX"] = "Will go IC upon request. Its rare that I ever RP anymore as my standards are so high. Also, touching on Karcin's xenophobia: by no means am I racist. Its a character, and RP is art. I roleplay him just as an actor would fill a role in a movie.",
