		["0915065757Zt7dO"] = {
			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "spell_frost_frozencore",
						["BK"] = 1,
						["TX"] = "{h3:c}{col:4c83e5}\"All sunshine makes a desert.\"{/col}{/h3}\n\n{p:c}{link*https://www.youtube.com/watch?v=bIw0eXPKigQ*Aetheres}{/p}\n\nStealing, scavenging, salvaging. These three terms, sometimes used interchangably, are the best descriptions many have for the vulpera as a whole. While many of the race dip their claws into those questionable things at times there are outliers among them, this man being one. A sly deft hand combined with knowledge of the arcane arts is just as fearsome as a any hulking warrior.\n\n\nThis one however is not a brusier stomping around as if the world trembles beneath his tread. No heavy metal garbs him, merely somewhat ornate robes matched by an embroidered hood only slightly stained from long term use. From within that shadowy lee a pair of bright blue eyes gaze out relentlessly, humorously offset by the pair of scruffy, ragged looking ears that poke out from either side of his cowl.\n\n\nWhat little fur he has visible is of a bright red color, almost the tone of a blazing sunset. His fingertips however, are a dark almost black color blending in with his equally dark claws giving the impression that his nails are far longer than they should be. A flowing tail hangs behind him and with the way it moves one gets the distinct belief he has far more control over it that expected.\n\n\nA sturdy but well worn backpack hangs from his shoulders, stuffed with various things as one would expect. As does the belt that wraps around his middle, a small canteen kept at the perfect spot for easy access when needed.\n\n",
					},
					["PS"] = {
						["IC"] = "inv_misc_book_11",
						["BK"] = 1,
						["TX"] = "{h3:c}{col:3ec6ea}\"Wizards have no sense of right and wrong. You would do well to remember that.\"{/col}{/h3}\n\n{p:c}{link*https://www.youtube.com/watch?v=Ggrluc5hsHA*Dunes}{/p}\n\nAs one studies the underlying concepts and laws that govern the waking world the more one starts to learn ways to bend or even break those rules. This can, quite naturally lead someone into viewing things with a ever so slightly bent air. What was once immutable is now able to be influenced, modified or even outright forcefully changed at a whim. Like pulling on a thread in a blanket and observing how the designs deform and twist appropriately.\n\n{p:c}Suffice to say, Adho is a bit aloof and cold, perhaps even odd.{/p}\n\n",
					},
					["HI"] = {
						["IC"] = "spell_frost_coldhearted",
						["BK"] = 1,
						["TX"] = "{p:c}\"It does not permit itself to be read.\"{/p}\n\nSome things Adho has freely shared, such as him being the son of a vulperan merchant that took his caravan between the deserts of Vol'dun and the lush tropical landscape of Zuldazar. Where he learned his sleight of hand familarity, interest in the esoteric and arcane however remains to be heard.\n\n{p:c}{link*https://www.youtube.com/watch?v=h7rReolU_UI&ab_channel=Seatbelts-Topic*Ask Your Mom}{/p}\n",
					},
				},
