					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Blizzard:612:128}\n\nMidnight black covers her body in a thick coat of short fur. Large black horns sweep back from her head, curving up slightly at the ends. Her shoulders and back are broad, well muscled from use of the large weapons she wields. Her generous bust is held by a wide cloth strap, keeping her chest from bouncing about in battle. Her stomach is flat, abdominal muscles showing slightly through her fur. Thick strong legs that look as though they could kick through hand-carved mahogany, and probably have.\n\nWell-preserved... Yes, I think that would be a good description. Apparently raised shortly after her death, though the cause is anyone's guess, as there seem to be no visible wounds. She seems to be in near pristine shape, though if one were to get close they could feel the cold emanating from her body.\n\nA kind face, a bit odd for a Death Knight, but it is none-the-less. A smile on her muzzle, giving just a bit of a crinkle at the corners of her frosty-blue eyes, which glow just slightly.Her casual stance encourages approach, arms either crossed under her chest or hanging at her sides. All-in-all quite the friendly appearance.\n\n(Always WiP)",
