			["about"] = {
				["v"] = 32,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}{col:00FF00}\"Vengence is never as sweet as promised.\"{/col}{/h2}\n\n{img:Interface\\Pictures\\artifactbook-demonhunter-cover:256:256}\n\n{h3:c}- - - {col:00FF00}A P P E A R A N C E {/col} - - -{/h3}\n\n{p:c}{col:ffffff}\n{/col}\n\n\n\n{/p}\n\n{h3:c}- - - {col:00FF00}P E R S O N A L I T Y{/col} - - -{/h3}\n{p:c}{col:ffffff}\n{/col}{/p}\n\n{h3:c}- - - {col:00FF00}H O O K S{/col} - - -{/h3}\n{col:FF9B0B}Anything listed below is fair game for pre-established ships or walk up material. If you have an interest in a pre-established ship, whisper me and let's hash it out!\n{/col}\n\n{col:a22fc8}You may know Felarisa if you're a:{/col}\n\n{col:a22fc8}Illidari -{/col} {col:FF9B0B}Among the Illidari, Felarisa has earned a reputation for following the beat of her own drum. While she is a loyal soldier, the manner in which she accomplishes her missions is often unorthodox. Her greatest accomplishment amongst the Illidari came from when she managed to destroy two Legion battleships by crashing them into each other, after she had pretended to defect to the Legion.{/col}\n\n{col:a22fc8}Sin'dorei -{/col} {col:FF9B0B}Other Sin'dorei might recognize Felarisa as the former scion of House Cindergift, taking over the house after her parents perished in the Second War. While she dealt with the loss poorly, a fellow ranger named Asthen Morningfury, pulled her from the brink. The pair would later go onto marry and have a pair of children. Asthen and her children would later perish in the Scourge invasion, leading Felarisa to follow Kael'thas into Outlands {/col}\n\n{col:a22fc8}Veteran of the Second War -{/col} {col:FF9B0B}As a Farstrider for most of her life, she might be recognized by a couple veterans of that war. To her allies, she was known as a deadly shot and a loyal soldier.\n\nTo her enemies she was known as a cunning but cruel foe, which only intensified as the war continued on. She would often take captives to use in luring out rescue teams, use fire to burn entire camps down, and use desecrate corpses in order to provoke her enemies into making mistakes. {/col}\n\n{h3:c}- - - {col:00FF00}P L A Y E R / O O C {/col} - - -{/h3}\n{col:FF9B0B}\nThank so much for taking the time to read this and get down this far. While I have been doing this whole RP thing for quite a while, I assure you I am friendly and am more than willing to help out anybody that might be new to this whole thing.\n\nWhile the character might get flirty from time to time, that is just part of her personality and should not be seen as an advance OOC. In addition, adult themes and encounters are welcome, but only if it organic and makes sense for the characters to do so. Such themes are never required or expected. As a player, I am not looking for ERP simply for ERP's sake.\n\nI am always open to new friends, RP partners, and connections. If you're interested just shoot me a whisper or mail a letter and we can talk about it.\n\nThank you again for reading down this far and I wish you a wonderful day.\n{/col}\n\n{img:Interface\\Pictures\\artifactbook-demonhunter-twinbladesofthedeceiver:512:256}\n",
				},
