				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Night and Day",
						["TX"] = "To gaze into this Emissary's eyes, one might be struck by the cold glow they emit; An amber shade like the sky at sunset, they're aesthetically beautiful to look  upon, appearing warm - yet for a versed wielder of the Arcane, the aura might be unsettling to view. The orbs lack the brimming energies that ought to accompany the Sunwell's shade, so appear as empty shells of what they should be...",
						["IC"] = "inv_jewelcrafting_dragonseye03",
					},
					["3"] = {
						["AC"] = false,
						["TX"] = "When in close proximity with a source of arcane mana, anyone viewing Erissia’s elegant and collected visage might be struck by a subtle anxiety attempting to arrest her usually relaxed nature. In such a circumstance, arched brows nit with acute pain and eyes wide; looking teary and worried would place a dour weight on any other emotions she might push out, while her tone of voice would be accented by either withdrawn nausea or irritation, depending on the liveliness of her mood. Equally, in the presence of any neutralising Fel energies, the Emissary may even begin to feel calmer- at a kind of blissful ease - when compared to her usual self.",
						["IC"] = "ability_malkorok_blightofyshaarj_yellow",
					},
					["2"] = {
						["IC"] = "inv_sword_1h_panstart_a_01",
						["TI"] = "Battle Hardened",
						["AC"] = true,
						["TX"] = "No matter how lightly dressed, the tint of a warrior's experience holds a noticeable sway in this young Sin'dorei's attire. Whether it be plate enough to stop a musket shot or visible short swords - even down to a concealed dagger or weaved mail on her finer wears, its obvious to see that Erissia values her own safety, and would be willing to enforce that upon anyone who thought otherwise.",
					},
					["5"] = {
						["AC"] = false,
						["TI"] = "Finesse",
						["IC"] = "inv_jewelry_ring_73",
					},
					["4"] = {
						["IC"] = "spell_priest_void blast",
						["TI"] = "Abyssal Heart",
						["TX"] = "Arcane; An energy that runs within all things, yet within Elves especially it is preeminent. It flows within them all, and defines why an Elf looks as they look. The Sin’dorei in particular are a captivation of what the Sunwell can do to a being, eyes brimming gold with it’s power. This is not so true for Erissia though, as any observer with an eye trained in magicks, and scrying the essence of another would see what in comparison would be a void. The young Emissary’s soul has all the hallmarks of one that once wielded power, yet it is notably empty, barely flickering like a candle against the latent energies of the leylines when compared to the inferno emitted by others in her race. It’d seem as if she only held enough mana to maintain a standard of health and nothing more - that’d explain the hollowness in her amber eyes…",
						["AC"] = false,
					},
				},
				["v"] = 48,
			},
			["time"] = 1631140951,
			["link"] = {
				["Erissia-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}\n\n\n{p:c}{col:ffff00}†==========================================================†{/col}{/p}\n\n\n{h1:c}{col:ffff00}\"To many seers: An enigma, clasped in youth and mystery.\"{/col}{/h1}\n\n\n{p:c}{col:c745f9}For one to lay their eyes upon the Emissary, they'd be struck by myriad details, though easily the most pronounced of these would be two orbs of radiant amber yellow that sat wide and glistening atop rounded cheeks. They were her most illuminating feature: Arcane eyes, though compared to the verdant or azure lights of other elves, the glow was measured, curbed by a natural subtlety like shades of a falling sun. But these suns were still bright, defining high set cheeks that curved in tune with a full face, fuller brows that arched modestly and perked at their ends, centred with a nose of ample measure and well-cut shape. To best sum up Erissia’s appearance, words such as: inviting, moderate and serene were apt - pinched by patrician finesse in some spots, yet as strong and broad as a warrior should look in others. There was both warmth and calm, yet it'd be difficult to deny a fiery potential that seemed to surge below her surface, ready to bubble into honed annoyance if the situation required it.\n\nAccenting these refined facial features was a luscious flow of tidy hair, cascading with the smoothness of silk and sun-kissed to a satin red-orange. It was long too, passing just below her shoulders to scatter between defined back muscles or a flowing cloak of pelt and royal cloth, though bound up in rings of gold or spindles of colourful fabric, the mane usually sat higher, either with intricate braiding to placate the regal requirements of her official business, or held more loosely in tails for comfort and fun-going.\n\nTo follow her physique down any further than that may have proven a challenge for any tauren: She was short, especially for an Elf, barely peeking above five foot four - almost petite, one might've said, yet the toned muscle apparent below even the most baggy attire contributed to an all together leaner whole. This shapely stature was only accentuated by her outfits, usually stretched taut around her curves and ridges and more often than not studded with the well tempered plate of Elven smiths, warding her form from piercing strikes. The style thus predominantly consisted of two halves, one rugged -to face the harshest colds via fur skins and cloaks or to diffuse crisp heat with partings and thinner cloth- And the other finely crafted, interwoven silks and velvets padding the insides to leave a softer touch on the skin -no doubt comfortable- as well as pelts and hides; conforming to create a tastefully sophisticated aesthetic. Notably constant among the shifting styles was an elegant set of golden jewelry that was always worn, one piece leafed and woven into a brace that always sat snugly upon her pale right bicep alongside a carved necklace embedded with an ovular emerald that rested atop her collar. Finally, two swords -One short, for parrying, and one long- filled the role of armament, both ornately decorated with swirls of gilded filigree and enchanted scripture atop Damascus blades, curved for slashing deep and severing flesh from flesh.\n \nErissia's strong poise was hardly just limited to the physical aspect of her body and attuned appearance though, for her form -even the way she strode- was like that of a dancer: Practiced, purposeful and brimming with a subtle confidence. A warrior, especially one of the Blood would've picked out the tell-tale signs of martial training in her deliberate movements, as well as signs of refinement that'd only originate through experience, yet equally it’d be hard to miss that her combative posture could all but fade with comfort, just as her usually blunt and matter-of-fact mannerisms faded to warmer smiles and gleeful giggles in turn. The dichotomy there might've even appeared jarring to a socialite; What was seemingly a facade used to facilitate her employ or deal with distasteful company was distant and brutal, like some jagged peak sprouting from the horizon, as it held a ploy-calm designed to aggravate and intimidate. And as a polar opposite to this was a near over-expressive joy that was cherished too dearly, as if she were starved and might perish without embracing the current moment.\n\nFeelings of deep happiness were a strong passion, burning delighted intensity within her soul, but there was no Mana fueled energy to accompany it; No pulse of etheric blue hues that'd indicate a runic use, and on second glance, her golden yellow eyes were dim, the magic that formed them now practically absent. Compared to any other elf her arcane aura was shallow and latent, seemingly at the periphery of the Sunwell's revitalizing touch which provided just enough of the Sin'dorei's lifeblood to sustain her health. Thus much like the cosmic background, there was only the humming of a nigh-undetectable tune. Erissia was a nebula outshone by the surrounding stars, only reflecting their light and producing none of her own. To many seers: An enigma.{/col}{/p}\n\n\n{p:c}{col:ffff00}†==========================================================†{/col}{/p}\n",
				},
