			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}{col:ff0024}Description{/col}{/h2}\n\n{p:c}{col:e3bdff}Myrriel is as well-bred as a shal'dorei can get and that should be obvious from a single glance. Her appearance is the result of fastidious preparations, with a coterie of lowborn servants seeing to her every need. Perfumed baths give her a musky scent of sandalwood and nourish her dark blue skin to the point of perfection. Subtle violet hues have been artfully painted along her bewitching eyes and across her lips. Silky snow-white hair flows down to her waist, straightened by the strokes of an ivory comb that's worth a small fortune.{/col}{/p}\n{p:c}{col:e3bdff}Her garments are made of the smoothest silk that mortal hands can manufacture, and they seem to be as ageless as her, devoid of a single blemish. The attire fits snugly but comfortably, showcasing her beauty no less than an outline of starlight.\n\nAnd what's the point of all this effort? To draw admiring stares? No, it's to please the gaze of one whose true name cannot uttered by mortal mouths.{/col}{/p}\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-HighborneNightElves:512:256}\n\n{h2:c}{col:ff0024}Hooks{/col}{/h2}\n\n{col:e3bdff}Your character might know and/or recognize Myrriel if they:\n\n-know her family (House Duskbreeze)\n-were an Elisande loyalist for part or most of the Nightfallen Rebellion\n-were a Sylvanas loyalist during the Fourth War\n-were an astromancer in Suramar before the third Legion invasion{/col}\n\n\n\n\n",
				},
				["BK"] = 3,
				["MU"] = 53690,
				["v"] = 60,
			},
			["zone"] = "Orgrimmar",
		},
