			["about"] = {
				["T1"] = {
					["TX"] = "\n{h3}Appearance{/h3}\n\nJynnxe wears a small blue crystal in a silver mount, hung on a beaded leather thong around her neck, which she occasionally touches, as if for luck. She carries a notebook in her pocket, which you might see her writing in, and a pencil behind her ear. If more formally dressed, she may also be sporting an expensive purse and nice shoes. Also hanging from her neck is a lanyard with a laminated card hanging from it that says \"PRESS\".\n\n\n{h3}\"Stormwind Undercover\"{/h3}\n\nAs the Lifestyles reporter for the Stormwind Daily Mail, Jynnxe writes  \"Stormwind Undercover\", published weekly in the Sunday Times edition of the newspaper. \"If you're looking for Stormwind's hottest gossip and coldest chills, for sin, sex and sleaze, then this is the place for you.\"\n\nRecent editions of Jynnxe's column can be found here: {link*https://archiveofourown.org/users/JynnxeJones*Stormwind Undercover featuring Jynnxe Jones}\n\nPublished:\n\n\"You No Take Candle\" - Daily Mail launches \"Light up the Darkness\" campaign\n\"Waaazuuup?\" : A Girls' guide to Goblins\n\"Night of the Living Dwarf\"\n\"Love Slaves of the Kobold King\"\n\"Dances with Worgen\"\n\nUpcoming:\n\nStormwind in the Altogether:  A hiker's guide\n\n\n{h3}Stormwind Daily Mail{/h3}\n\nWith circulation in Stormwind City, Elwynn Forest, Duskshire, Northshire Abbey, Lakeshire, Ironforge, and wherever in Azeroth the good folk of Stormwind can be found, the Daily Mail is Stormwind’s source for news you can trust. The Stormwind Daily Mail is a proud member of the Azeroth Media Group.",
