						["AC"] = true,
						["TX"] = "Despite her big plush size, she is rather agile and virile, ready to bounce at a moment's notice. \n\nBrash, bold, and a bit of an adorable weirdo. She seems to have no verbal filter, and will say anything that's on her mind. She is rather social and approachable.",
