						["TI"] = "Hero Worship",
						["TX"] = "Shield-bearer. Wing-bear. Best Friend. She’ll fight by your side, outdrink you, and maybe hook you up with that hot goblin at the end of the bar. \n\nShe’ll never be the hero of her own story; but is still the damsel that’ll fight your dragons for you, while boasting your inflated ego over a frothing tankard at the end of the day.",
