			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-RandomScenario:256:128}\n{h1:c}Remy Bloodgrin{/h1}\n{h2:c} Huojin Laughing Skull {/h2}\n{img:Interface\\QuestionFrame\\answer-RogueCombat:256:128}\n{p:c}\"The whole world trying to tame the spark\nBut we've got fire burning bright, Hidden\nCatch the shimmer of showering stars\nThe sky gets dimmer and your light shows...\n\nFeral Hearts In the night\nLoving like we've been kept captive\nFree to light...\"{/p}\n\n(By clicking the links you forsake all complaints about getting mooned, you've been warned!)\n{link*https://tinyurl.com/R3MYee*Right to Bear Arse : Mature Content} {link*https://tinyurl.com/ZeshRem*Zeshog & Remy} {link*https://f-list.me/c/remy*F-List}\n\n{p:c}Remy is a girl that picks fights with big scary orcs and shoots trolls in the knees before asking questions. She is an affectionate, friendly bear, and expressive physically with her emotions. But most of all, she is a loyal companion to those she allows to get close.\n\nAs a Pandaren, she stands a little above average height for her kind, roughly 6’5 with a generous thicc, curvaceous frame. Her shoulders are broad with a lovely bosom with a depth of cleavage that an Orc could bury their face in; her waist is a little narrow and her stomach slightly toned under a layer of velvety violet-black and silver-toned fur. Much of her weight is carried in the girth of her wide hips and a large, supple and succulent rump that is much admired.  \n\nCurious by nature, her attention span can be short, as she’s often distracted by the newest shiny object or person that catches her eye. Though, she can still be attentive of her surroundings, due to her former training as a Hunter; her ears are sensitive to the sounds of the most subtlest motions, allowing her to detect most forms of stealth, which she quickly picks up on — an ability Remy does not reveal often, as it makes her an excellent tracker.\n\nRemy once served as a faithful Sidekick to any Hero she chose to follow, and was likely to embellish any story about you, just to see how far she can push the punchline of her terrible punny jokes. Her time in the Horde has seen a shift in the balance of her once innocent point of views, the rose-colored glasses ripped away and now a bone mask is donned as she adopted the orcish ways of her new family among the Laughing Skull Orcs that she is allied to. Becoming slightly more cutthroat and off-kilter with the passing of each new moon. Pain is laughter. Pain is strength. \n\nShe has shifted away from her former life as a Huntsman to expand her bag of tricks and take on a new role, trained in the ways of the Shadowblade; no longer the cute sidekick and become more vigilant and rogue-ish in her new endeavors to find her place in the world. Bows and arrows exchanged for blades and axes. A mask donned to help her hide in the shadows. \n{/p}",
