				["CO"] = "-- The charm is of typical Troll design, for those who would know a great deal about their culture.\n-- Player is 21+\n-- IC =/= OOC, please don't hate me. :V\n-- Is cool with most rp, but please be chill? \n-- Super LGBT+ friendly! :D\n-- Trying really hard to be nicer, if you have me ignored, I'm sorry...\n-- Also, sorry but I hate the \"goat meme\" please try to not refer to me as a goat, I hate it IC/OOC. Again sorry.\n",
