			["link"] = {
				["Lonaraee-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h1}The Basics {/h1}\n\n<WIP... :c>\n++PHYISCAL DESCRIPTION: \n   -Taller than your usual draenei girl, with a muscular/athletic physique.\n   -Light Violet skin, noticeable bags under her bright blue eyes.\n   -Has plenty of scars, mostly on her arms and upper torso/back. (Lots of clawing marks, probably from determind undead... Or maybe a troll.)\n   -Often clad in armour, robes, or gowns/dresses.\n   -Despite her weatherd appearence, she does her best to look nice.\n\n++MANNERISMS:\n   -Incredible socially stunted, has never been very charismatic, only ever enough to get by. Recent events have killed her ability to connect with people.\n   -Very Dramatic about a lot of things, can sometimes be seen sitting in strange places or lying on tables, lamenting her life, sitting in chairs wrong, complaining about herself, or just being ridiculous. \n   -She tends to act way older than she is, this may be from hearing how old 7,245 is to a lot of people, worming the idea into her head that she's some old woman.\n   -She is often depressed, but is working towards bettering herself.\n\n++Voice: Stock draenei player character voice, but a tad deeper, Naturally, a light \"rUsSiAn\" accent.\n\n++Born on the Genedar to two very dedicated practioners of the Light, was believed by her parents to be a prodigy in service of the Light.\n\n++Family;\n   -Mother; Isaara, a War Priest.\n   -Father; Vizor, a Paladin and Justicar.\n   -Sister; Iyona, nothing in particualr, but Lonara thought very highly of her.\n\n++Quickly became a capable squire, spent her time either training, hyping her sister Iyona like it's her career, or dragging her on adventures.\n\n++IT happened and things got bad. Her parents dedicated their time to protecting them and the others as the fled across the Draenor. Lonara made it her duty to protect and look after Iyona, and keep her spirts up.\n\n++Exodar was taken, Lonara and Iyona got on board, parents stayed behind with a few others to keep their attention, both presumed dead.\n\n++Sabotage! Lonara and Iyona got seperated in the chaos, Lonara landed in her pod, rushed to the crash site, found a grave plot for Iyona, her body was never found.\n\n++BIG SADS, WUH OH. Lonara got super depressed, tried to jump into the big whole in the Exodar's center attrium. Was the seat of a Naaru, O'ros saved her and she got taken to the medical ward.\n\n++Draenei haul ass over Outland and Illidan got booped, Lonara snaps out of it in time for the Sunwell Shenanigans, trains up and enlists in the Offensive. Leads her fellow Shattered Sun to victory, feels pride and joy for a the first time in a long time!\n\n++ZOMBIES! Lich King causes a ruccus and she goes North to North... Rend and starts beating the Scourge like it's her job! (Cause it is) Joins the Argent Crusade, and meets a Troll by the name of Sui'jen, becomes friends and they fight together against the hells of Northrend.\n\n++Arthas gets his bussy beat, and everyone goes home, except for Lonara who goes home with Sui'jen, they're in lesbians with eachother now. Spend time with her family, good friends with her mother, not so much the rest.\n\n++Big asshole Dragon jacks everything up and Lonara spends most of the Cataclysm joining Sui'jin in her travels to help where they can, doing their best to stay out of the Faction beefing. Finding a nice remote place in Stone Talon to call home.\n\n++Married! How cute! Got a shaman to give them the blessing of the spirits and everything! Enjoys a calm life with her troll wife and didn't give two shits about whatever nonsense happend in the Panda lands... Until Garrosh makes a stink, and she helps the Darkspear rebellion from behind the lines.\n\n<More soon>\n\n",
