						["TX"] = "Upon her person, you can notice several military Crests and Badges of high esteem placed tastefully and modestly. She doesn't like to show them off, so she doesn't wear them all proudly. Of which can inculde;\n  -An insignia of the Argent Dawn, with markings denoting honor amongst the Argent Crusade. This insigna was given to any and all whole proudly championed the Argent cause into Icecrown.\n  -A Crest of the Shattered Sun Offensive. One such crest denoting an honored leader and an Exarch of the Offensive. (she's proud of that one)\n  -A Crest of Fae design, presented to her by the Winter Queen. It denotes on of great esteam in The Eternal Grove. (it seems like she faded it on purpose so it would stop sparkling all the damn time.)\n  -A Badge of Honor of The Wild Hunt. Those familiar with the goings on of the Eternal Grove will know it denotes an honoured huntress of the Wealde",
