						["TX"] = "It's nothing blinding, but this goblin's got some accessories that don't conceal their shine in the slightest. Several hoops adorning each ear, a verdant stud in her right nostril and a silver chain adorning her neck were all part of the lightshow.\n\nOh, and a perpetually-ticking gold watch. Analog, of course.",
