					["5"] = {
						["IC"] = "inv_chest_fur",
						["TI"] = "Opulent Attire",
						["AC"] = true,
						["TX"] = "While not entirely over the top by goblin standards, Slax's wardrobe and accompanying accessories show that she's not straining for much. The most notable point might be that snug fitting fur-collared vest that she's often clad in.",
