			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-StaticField:512:128}{h2:c}{col:a7e6ff}S H O R T C I R C U I T {/col}{/h2}\n{p:c}{col:B5EEFF}\"Uh-huh. Yeah! Yeah, yeah. Wait. Repeat that? Like, from the top.\"{col:B5EEFF}\n\n\n\n{col:ceffe9}Huh! That's a goblin alright. Olive green skin and an unmistakable accent that often spews a handful of improvised curses assures any observers of that much.\n\nSlax stands about as squat as most of her kin, though she's perhaps an inch or two taller than the norm; nothing that'd particularly make her stand out. She does, however, deviate a bit in terms of physique. It's evident that she's comfortable with whatever it is her present lifestyle entails. It appears she's fattened either due to or in spite of it, sporting thick legs, doughy arms and a plump, muffin-topped midriff. \n\nTaking countenance into consideration, Slax's features could be considered modest while maintaining substantial distance from being deemed unattractive. A pair of platinum eyes displayed a muted luster that complemented the bedazzling ornaments she wore quite well. One small emerald stud pierced her right nostril while a duo of more miniscule prismatic gems gently twinkled on the opposite end. With regards to earrings, it appeared she doubled up on both ends. Two silver hoops dangled from each, matching the tone of the chain that spanned the circumference of her neck.\n\n[...]\n{/p}\n{/col}\n\n\n\n{h3:c}{col:B5EEFF}H O O K S {/h3}\n{col:ceffe9}—Spent some time in a Steamwheedle-owned outpost? Slax frequents Ratchet and has made jumps around to connected settlements. Must've done something semi-important for the Cartel at some point or another.\n\n—Care for Kaja'Cola? This goblin's got a can or three clutched nearby more often than not. She might share, she might not.\n\n—Anyone who has passed through Undermine in the past might recognize Slax as the prior receptionist for the local mechpriests' firm, a position she held for a year or three.\n\n—Rumors of a hole-in-the-wall jewelry startup have begun to pop up around Ratchet with Slax's name tied to its ownership. Hmm.\n\n—Similarly, posters offering the contact information of \"repossession services for hire\" can be tied to Slax's likeness in a few Horde settlements.\n\n\n",
