				["TE"] = 1,
				["T1"] = {
					["TX"] = "The best way to describe Medaedis is effeminate!  Through his fashion sense, choice of clothing, along with his mannerisms.  Though while this does describe him, within almost every sense, it would be within most people’s best interest not to call him that given that he would find this to be almost a down right insult.  Even though in most cases he would be applying a heavy amount of makeup while insulting you!\n\nThe best start would be his face; Short hair that hugged his face and was so well maintained it would look as if he combed it and maintained it whenever he woke up.  Messing with it would most likely cause a fuss with this short tempered one.  His soft cheeks were soft and whatever jawline that could be seen was covered with a creamy foundation that accented the dark hair quite well, least he thought so!  His eyes, goodness those eyes, well his eyes were just average alright?  They glowed green and he wished they were better.  Though his cute nose, small and button, how he hated it.  He was constantly teased while growing up.  Though his favorite feature, which he always painted with an array of colors that would match the season!  His lips.  His lips were puffy and stuck out quite well, they were his best feature, least on his face they were.  He felt it was something that many should be jealous of and if it wasn’t weird he would talk about his lips at parties, though, sadly it was weird to talk about your lips at parties.\n\nHis body though was something to, well, his body was sleek and almost willowy.  Almost having no muscle mass at all.  Most likely this could be a reason for his falling all the time as most of the mass of his body is at the lower end!  His hands and most of his upper body would highlight more of that effeminate nature that was so spoken about.  Soft skin always.  No calluses on these hands.  Also a scent that also, like his lips, always matched the season!  His upper body would also be adorning the latest fashion.  Though all that was on the crux is; Can I afford all this?  And sometimes a mage on such a budget must sadly make cuts for beauty!  \n\nThough what -most- considered his best accent was his lower features.  He did not see it that way as you cannot design around it.  It also cost him more at the tailor shop to get the latest fashion too!  Though his hips were wide, quite wide in fact that would make him look like, well, like a certain fruit.  His rear though he would do his best to hide it between dresses, skirts, whatever he could!  It stuck out far too much for him to consider it ‘good’ though he did all in his power to hide it.  Though sadly he isn’t the best mage, actually, he’s an awful mage.  So hiding his large rear is out of the magical question.  \n\nThen there are his feet.  They are there.\n\nOne day he will become a better mage.  Though for now he’s still a student and one that spends more time thinking of being a great mage than trying to be one!  He just hasn’t realized that isn’t how you become a great mage yet...",
