				["TE"] = 1,
				["T1"] = {
					["TX"] = "(W.I.P)\n\nCharacter Songs (If you see a + next to a song, she sings it sometimes! If you see a * you can hear her playing it!!!)\n\n+*Battle Scars - Paradise Fears (Note!!: She is always singing this OR Reason To Fight when idle.)\n\n+*Battle Cry - Skillet\n+*American Noise - Skillet\nTerrify The Dark, Reimagined - Skillet\n+*Save Me, Reimagined - Skillet\n\n+*United We Stand, OG and Remake - DAGames\n\n{link*https://tinyurl.com/y45aohtn*Xaleen's Hairstyle!}\n\nFamily!\nLinnarra Stormwake - Adopted Daughter\nAaylia Windfel - Adopted Daughter\n\nSolinela - Blood Sister\nJessiane Campbell - Sister In Law",
				},
			},
			["misc"] = {
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 1,
					["5"] = 3,
					["4"] = 1,
					["6"] = 1,
				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Forged Anew",
						["IC"] = "70_inscription_vantus_rune_light",
						["TX"] = "She may be recognized by other non-lightforged Draenei as having once been a Vindicator seen commonly around Azuremyst Isle, Bloodmyst Isle and the Exodar after the Northrend and Cataclysm campaigns, serving her people as a medical guardian for young Draenei starting their own heroic journeys or personal adventures! However, when the Legion threatened her new homeworld once more, Xaleen took to the Vincidaar and further took to the Light as her shield and her weapon to protect those who couldn't protect themselves from the demonic threat, returning to Azeroth reforged by the Light and reinvigorated to defend it once more. She seems to have adjusted quite well to her new body in the years since the Legion was halted once more. Her body is covered nearly every inch in tattoos and runes that show her service in every single campaign up to present day.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Light In The Dark",
						["IC"] = "paladin_holy",
						["TX"] = "Gods dammit was it diffuclt to break this woman's spirit and her hope! She almost always had a bright, cheerful demeanor with a warm, approachable and accepting smile on her lips. A skip to her step and always looking to the positive side of the horizons, it was difficult to find a point where the Draenei woman didn't smile or didn't try to look to the brighter future..no pun intended. She barely talked about the negative events going in, not wanting to 'add to the darkness' that she perceived Azeroth to be lost in like life were a cavern. She preferred sticking to doing her duty of being a single torch in that darkness to help light the way..and she was proud to be that.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "For The Many ",
						["IC"] = "ability_paladin_beaconsoflight",
						["TX"] = "Xaleen always placed the needs of the majority over the needs of the one. Her needs would, and will, always be superceded by the needs of others even if it means detriment to herself. She wouldn't rest until every patient she encountered or lost soul had found comfort and/or healing to a satisfied level for herself and her patient(s). Even if it meant sleepless nights or nights without eating, the Draenei woman would more than happily make that self sacrifice to improve and/or ave the life of another, without a second thought. She was a common sight around the Stormwind Orphanage, knowing their situation very well and keeping them company to keep their spirits bright. Her name was common to hear coming from Westfall, the woman being a common sight healing, feeding and aiding the homeless&poor there, as well the poor&homeless of Stormwind itself as well. ",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Peoples' Defender",
						["IC"] = "ability_paladin_gaurdedbythelight",
						["TX"] = "The innocent, the sick, the elderly, the young, the meek..anybody who fell under these categories or any other category of needing a protector? They were the types where Xaleen would not hesitate to show a combative force if push came to shove over. She despised racism, sexism..discrimination in any form and she despised seeing those undeserving of becoming targets being hurt and painted as targets for situations where they had no involvement in. She would be a very difficult case to deal with if she caught one being outwardly aggressive to someone she genuinely believed was undeserving of such hostility or action to. She defended people and she took pride in being a protector as well as a healer.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Cleric's Tome",
						["IC"] = "inv_7xp_inscription_talenttome01",
						["TX"] = "Resting on her frontside towards her belt buckle (basically in the artifact's tome position) resting Xaleen's personal holy tome. It held her scriptures for the Light, her oath, medical instructions depending on injury/disease/ailment/etc..it held anything and everything that helped Xaleen on who she was as a Paladin and to help her perform her duties as a battle cleric and an overall medical presence on and off the field(s) of battle. She treasured it quite closely, refusing to let others hold it unless she deeply trusted them and often growing a little defensive of it if people focused on it for longer than she felt was comfortable. It had a single white rosed tucked into the pages and the rose never seemed to wilt.",
					},
				},
				["v"] = 23,
			},
