						["AC"] = true,
						["TI"] = "\"The Silver Lion\"",
						["TX"] = "The nickname given to Rynhel in the Second War by Alliance soldiers for her fierceness in protecting her allies.\n\nRynhel carries a small lion pendent with her, though she rarely brings it out in the company of members of the Horde.",
