						["TX"] = "Tends to keep to herself, though after a few drinks she'll open up a bit more.",
						["IC"] = "inv_drink_03",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Companions",
						["TX"] = "Rynhel has many beast companions following her:\n\nHer three wolves, Hati, Blackwood, and Nyx.\n\nHer wolfhawk, Brennik.\n\nAnd a small mana wyrm, Wruenele.",
						["IC"] = "ability_hunter_pet_wolf",
					},
				},
				["v"] = 35,
			},
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Rynhel is considered tall by the standards for Sin'dorei women, with dark brown hair pulled back into a practical bun, and piercing golden eyes. She is lithe and athletic from her decades as a ranger and is never far from her faithful companions, Blackwood and Hati. She is covered in many scars, some looking much older than others.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Rynhel has always prefered to be alone in the forests of the Eversong Woods than to be amongst people in busy cities. Her sisters joked that she got along better with the beasts of the world than anyone else, and Rynhel tended to agree.\n\nQuiet, painfully blunt, and prefering practicallity over vainity, Rynhel stands out amongst many of the Sin'dorei, which is perhaps why she perfers the solitude of the forests of the world.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Rynhel Lightspear was once a Farstrider of the Kingdom of Quel'Thalas and fought under the command of Ranger-General Sylvanas Windrunner in the Second and Third wars. Rynhel was one of the few Farstriders to survive the Scourge's march to Silvermoon and was heartbroken by the deaths of her commander and comrades, and their subsequent raising into undeath.\n\nShe could not bear to stay in her scarred homeland and fled across the sea to the newly formed Theramore, where she stayed until her younger sister Vynnesa came to her asking for aid in bringing their sister, Noëlle, back from her journey with Kael'thas to Outland. Though, after their time in Outland, the sisters discovered that Noëlle had become a Demon Hunter and was jailed with the rest of the Illidari after the defeat of Illidan.\n\nShortly after their return from Outland, Vynnesa is killed by a Scourge attack and raised as a Death Knight by the Lich King, though she eventually breaks free, the sister's relationship is fractured. With both her younger sisters lost to her in different ways, Rynhel throws herself into the campaign to kill the Lich King, working closely with her former commander once again.\n\nAfter the fall of the Lich King, Rynhel felt an emptiness overtake her, unsure of her purpose she wandered the world, fighting aimlessly for anyone who needed her bow. It was not till the newly named Warchief, Sylvanas Windrunner, called her to return to fight the Legion once again, did Rynhel lend her bow to the Horde and be their Champion once again.",
						["BK"] = 1,
					},
				},
				["BK"] = 3,
				["TE"] = 3,
				["v"] = 21,
			},
			["link"] = {
