						["TX"] = "{p}{col:670202}† \"You{/col} {col:810A0A}were{/col} {col:9B1212}my{/col} {col:B81C1C}ride{/col} {col:D22424}or{/col} {col:EC2D2D}die,{/col}{/p} \n{p:c}{col:D22424}But what{/col} {col:B81C1C}I heard, I died inside,{/col}{/p} \n{p:r}{col:9B1212}Put{/col} {col:810A0A}you down,{/col} {col:670202}I'm terrified...\" †{/col}{/p}\n{p}{img:Interface\\PETBATTLES\\Weather-rain:500:3}{img:Interface\\PETBATTLES\\Weather-rain:200:3}{/p}\n{p:c}{col:670202}The flirt master(?) himself,{/col} {col:810A0A}Shakei upon first introductions is incredibly{/col} {col:9B1212}outgoing, charismatic and flirtatious.. And jerkish. His adorable teal-like eyes are always{/col} {col:B81C1C}eyeing those that pass him with curiosity,{/col} {col:D22424}he loves to give those who stop and say hello{/col} {col:EC2D2D}a big, toothy smile.{/col} {col:D22424}Shakei isn't entirely shy to admit he's the popular type of guy,{/col} {col:B81C1C}he wants to know everyone, and befriend everyone. He loves to sweettalk, and make those around him feel good.{/col} {col:9B1212}Although he's shamefully a little anxious, and emotionally{/col} {col:810A0A}struggles to keep himself in the loop when he feels his social meters downgrade, but he tries!{/col}{/p}\n{p:r}{img:Interface\\PETBATTLES\\Weather-rain:200:3}{img:Interface\\PETBATTLES\\Weather-rain:500:3}{/p}",
