						["TX"] = "{h1}{col:670202}. : • ˚ † \"M{/col}{col:810A0A}y{/col} {col:9B1212}b{/col}{col:B81C1C}a{/col}{col:D22424}r{/col}{col:EC2D2D}k's{/col} {col:D22424}w{/col}{col:B81C1C}orse{/col} {col:9B1212}than my{/col} {col:810A0A}bite,\n{/h1}\n{h1:r}{col:670202}Now you got me real tight.\" † ˚ • : .{/col}{/h1}",
