					{
						["TX"] = "{h1:c}{col:670202}. : • ˚ † A{/col}{col:810A0A}p{/col}{col:9B1212}p{/col}{col:B81C1C}e{/col}{col:D22424}a{/col}{col:EC2D2D}r{/col}{col:D22424}a{/col}{col:B81C1C}n{/col}{col:9B1212}c{/col}{col:810A0A}e † ˚ • : .{/col}{/h1}\n{p}{img:Interface\\PETBATTLES\\Weather-rain:500:3}{img:Interface\\PETBATTLES\\Weather-rain:200:3}{/p}\n{p:c}{col:670202}Shakei is brightly apple red color with a cream color{/col} {col:810A0A}his fur scratched with tiger-like markings on his tail and ears of the darker red, arms?{/col} {col:9B1212}Maybe those too. His ear tips are a low plum purple color naturally,{/col} {col:B81C1C}Around his neck rests a odd choker, with a even odder charm attached to it. Under the choker, under the fur is visibly marks of skin irritation, likely from the choker itself?{/col} {col:D22424}His fur always looks shiny, fluffy and well groomed, despite how much of a wild guy he is,{/col} {col:EC2D2D}although it does have some blood patches staining some parts of his cream color fur.{/col} {col:D22424}It's no secret that Shekai takes good care of himself.{/col} {col:B81C1C}His eyes are the shade of teal, or sea tears, while his right eye has a slight purple tint to it. When Shakei's mouth is viewable,{/col} {col:9B1212}his tongue has a single tongue piercing,{/col} {col:810A0A}in silver, and his one and a half inched fangs are cleaned,{/col} {col:670202}and as white as brand new.{/p}\n{p:c}{col:670202}Shakei's body is covered in some mild scars,{/col} {col:810A0A}most are hidden away from fur coverage and gear, although there's visible scarring on his neck{/col} {col:9B1212}made from weaponry,{/col} {col:B81C1C}as well as his shoulders, and back.{/col} {col:D22424}Most of his scarrings look similar to dagger slashes or bullet holes,{/col} {col:EC2D2D}however on his chest is a rather large burn part over his left breast plate,{/col} {col:D22424}as well as his lower left stomach.{/col} {col:B81C1C}While extremely hard to notice at first, the tip of his tail is{/col} {col:9B1212}bent, and curls at the end of it, it doesn't bother nor{/col} {col:810A0A}is it really considered bad, as well as messy tiger-like markings around the base of his tail.{/col} {col:670202}His ears have many type of golden earrings, from studs to small hoops. Shakei wears glasses, mostly in black or silver frames for his slightly poor eyesight. If one could see, just under his left eye is a beauty mark.{/p}\n{p:r}{img:Interface\\PETBATTLES\\Weather-rain:200:3}{img:Interface\\PETBATTLES\\Weather-rain:500:3}{/p}\n{p}{col:670202}† \"Grab me{/col} {col:810A0A}by the{/col} {col:9B1212}collar,{/col} {col:B81C1C}Leash laws bitch,{/col}{/p}\n{p:c}{col:D22424}I'll fuckin' maul ya! I'm an old dog,{/col} {col:EC2D2D}bitch,{/col}{/p}\n{p:r}{col:D22424}I'll show you{/col} {col:B81C1C}tricks you{/col} {col:9B1212}never seen before!\" †{/p}{/col}",
