					{
						["TX"] = "{h1:c}{col:670202}. : • ˚ † P{/col}{col:810A0A}e{/col}{col:9B1212}r{/col}{col:B81C1C}s{/col}{col:D22424}o{/col}{col:EC2D2D}n{/col}{col:D22424}a{/col}{col:B81C1C}l{/col}{col:9B1212}i{/col}{col:810A0A}t{/col}{col:670202}y † ˚ • : .{/col}{/h1}\n{p}{img:Interface\\PETBATTLES\\Weather-rain:500:3}{img:Interface\\PETBATTLES\\Weather-rain:200:3}{/p}\n{p:c}{col:670202}Shakei is extremely vulgar and at times apathetic, being a prisoner has caused some of his before sympathy to disappear when learning of the 'Every man for himself\" was a necessity.{/col} {col:810A0A}Shakei lacks a lot of friends, but because of this, he's extremely caring and playful with them. even at times likes to playfully flirt and jab some of the worst of insults knowing those around him that trust him knows he means no harm, and it's all for{/col} {col:9B1212}fun. Shakei can also come a little... flamboyant, unintentionally, he snaps his fingers when his point is made, or is correct about something and rolls his eyes and bats them when something or someone annoy him.{/col} {col:B81C1C}Shakei is overly confident and charismatic and often times,  competitive, he has no filter for his words, and could possible say the worst thing at the worst time, and isn't entirely to good in emotional situations, despite being secretively emotional himself,{/col} {col:D22424}he tries his best to be somewhat 'understanding' and cool in situations simply to keep friends, he shamelessly enjoys all the attention he can get, he wants to secretively be everyones friend, but with his slightly extra attitude, its' rather hard, especially with how dirty his words can get.{/col} {col:EC2D2D}Shakei is extremely adventurous, and dare-devilish, if he's not allowed to do something, he'll do it anyways. Not allowed to touch something? He'll do it anyways. Not suppose to cling on that thing? Or get close to this thing? He'll do both anyways.{/col} {col:D22424}Shakei is, surprisingly a very forgiving guy, and gives more than just a second chance, he'll give maybe three,{/col} {col:B81C1C}four, five chances? Six? Probably not.{/col} {col:9B1212}Overall, Shakei at first can seem like  a major asshole who talks about some of the most awkwardest of things, but once you get to know him, he can be sweet, and caring, and... very talkative. If he's not poking fun at you or making fun of you,{/col} {col:810A0A}then you're probably not good enough friends with him, but then again, he pokes fun at everyone, even himself,{/col} {col:670202}If you're going to insult everyone around you, gotta insult yourself, too.{/p}{/col}\n{p:r}{img:Interface\\PETBATTLES\\Weather-rain:200:3}{img:Interface\\PETBATTLES\\Weather-rain:500:3}{/p}\n{p}{col:670202}† \"...Don't{/col} {col:810A0A}act{/col} {col:9B1212}bra{/col}{col:B81C1C}nd{/col} {col:D22424}ne{/col}{col:EC2D2D}w,{/col}{/p} \n{p:c}{col:D22424}I fucking warned you! Go ahead,{/col} {col:B81C1C}try that again,{/col}{/p} \n{p:r}{col:9B1212}And I'll fucking dogwalk you!\" †{/col}{/p}",
