						["TX"] = "{h1:c}{col:670202}. : • ˚ † R{/col}{col:810A0A}o{/col}{col:9B1212}l{/col}{col:B81C1C}e{col:D22424}p{/col}{col:EC2D2D}l{/col}{col:D22424}{/col}{col:B81C1C}y ho{/col}{col:9B1212}o{/col}{col:810A0A}ks † ˚ • : .{/col}{/h1}\n{p}{img:Interface\\PETBATTLES\\Weather-rain:500:3}{img:Interface\\PETBATTLES\\Weather-rain:200:3}{/p}\n{col:670202}• Your toon{/col} {col:810A0A}bought{/col} {col:9B1212}poisons from{/col} {col:B81C1C}him,{/col} {col:D22424}or had 'custom'{/col} {col:EC2D2D}poison made{/col} {col:D22424}for you. Or your{/col} {col:B81C1C}toon likely heard{/col} {col:9B1212}of him from someone{/col} {col:810A0A}who -has- bought from him.{/col}\n\n{col:670202}• Your{/col} {col:810A0A}toon{/col} {col:9B1212}is a{/col} {col:B81C1C}Member of the{/col} {col:D22424}Uncrowned,{/col} {col:EC2D2D}and are{/col} {col:D22424}either comfortable{/col} {col:B81C1C}rivals, or{/col} {col:9B1212}were once partners{/col} {col:810A0A}in crime with him.{/col}\n\n{col:670202}• You're{/col} {col:810A0A}part of{/col} {col:9B1212}the Night{/col} {col:B81C1C}Fae,{/col} {col:D22424}and have{/col} {col:EC2D2D}been actively{/col} {col:D22424}busy, you{/col} {col:B81C1C}probably don't{/col} {col:9B1212}know him as 'Shakei,'{/col} {col:810A0A}but he might know you?{/col}\n\n{col:670202}• You've{/col} {col:810A0A}heard him{/col} {col:9B1212}sing{/col} {col:B81C1C}and{/col} {col:D22424}play{/col} {col:EC2D2D}music around{/col} {col:D22424}capital cities,{/col} {col:B81C1C}if you know him, you know{/col} {col:9B1212}he's not entirely shy about his singing voice,{/col} {col:810A0A}he loves for it to be known.{/col}\n\n{col:670202}• You're{/col} {col:810A0A}friends with{/col} {col:9B1212}a doctor named{/col} {col:B81C1C}Teranse Delpheaux,{/col} {col:D22424}a graverobber named{/col} {col:EC2D2D}Dexter Vileweep,{/col} {col:D22424}a Blood Bladed named{/col} {col:B81C1C}Kalvan Barus{/col} {col:9B1212}and or a self defense instructor named{/col} {col:810A0A}Velarrine Shan'rebandu, and have actively seen them hanging out together solo or all together.{/col}\n\n{p:r}{img:Interface\\PETBATTLES\\Weather-rain:200:3}{img:Interface\\PETBATTLES\\Weather-rain:500:3}{/p}",
