					{
						["TX"] = "{h1:c}{col:670202}. : • ˚ † L{/col}{col:810A0A}i{/col}{col:9B1212}n{/col}{col:B81C1C}k{/col}{col:D22424}s{/col}{col:EC2D2D} & {/col}{col:D22424}O{/col}{col:B81C1C}O{/col}{col:9B1212}C{/col} {col:810A0A}Notes † ˚ • : .{col:F97D5B}{/col}{/h1}\n\n{p:r}{link*https://www.youtube.com/watch?v=r3DN-pNNtfg*Theme song!}{/p}\n{p:r}{link*https://www.youtube.com/watch?v=yzhQt1Vhy04*Voice Claim : James}{/p}\n{p:r}{link*https://tinyurl.com/ek8hbyac*NSFW art!}{/p}\n{p}{img:Interface\\PETBATTLES\\Weather-rain:500:3}{img:Interface\\PETBATTLES\\Weather-rain:200:3}{/p}\n{p:c}{col:670202}• Player is a Twenty-One years old Non-Binary who goes by He/They/She! They suffer from{/col} {col:810A0A}Type one diabetes, depression and anxiety, so they will often times AFK randomly or take a little bit to reply / respond to things!{/col} {col:9B1212}I am A-OKAY with IC relationships, however OOC I am not seeking any kind of relationship other than friendships or RP partners since I'm currently in a relationship! Please understand that I myself am awkward with romance, so a lot of my toons will be too!{/col} {col:B81C1C}A lot of my toons are also what people would call 'clueless' and 'dumb', this is because the player is also a little empty in the head. x vx{/col} {col:D22424}Player is incredibly friendly but also sensitive!{/col} {col:EC2D2D}Some of my characters however may not be friendly and or sensitive! If I were to RP{/col} {col:D22424}with any of my toons with other people aside from trusted friends. PLEASE know I socially awkward and suffer from a illness{/col} {col:B81C1C}that makes it hard for me to wrap my head around some of the simpliest of things! I tend to get confused and anxious{/col} {col:B81C1C}with certain things and will likely need a little help or patience from you!{/col} {col:810A0A}I might even ask a few questions for reassurence or confirmation!{/col} {col:670202}Player is A-Okay with -all- races, and is okay with small lore-bending as long as it doesn't cause too much issues. ;; v;{/p}{/col}\n{p:c}{col:670202}• Shakei is a Dark-gorey/Drama/Comedy/Wholesome character,{/col} {col:810A0A}and in this I prefer those types of RP themes!{/col} {col:9B1212}He -may- be used for mature, depending on the situation! Kei attempts [and often fails]{/col} {col:B81C1C}to make people laugh, he likes to break fourth walls and likes to make people question his sanity,{/col} {col:D22424}he might make some uncomfortable on accident, so feel free to let Kei know!{/col} {col:EC2D2D}Kei has a dark past and often times without him knowing, it shows,{/col} {col:D22424}unintentionally making things dark when he doesn't mean to do!{/col} {col:B81C1C}I am MORE than happy to walk up first if you PM me!{/col} {col:9B1212}I'm oocly just as shy as you, but Kei isn't necessarily{/col} {col:810A0A}shy when it comes to walking up to a single individual or two!{/col} {col:670202}Just know he can be a tad bit awkward! For NSFW, I'd heavily prefer Fade to Blacks over ERP! Please do not call Kei a 'Femboy' or fetish him because he has a feminine model, or a vulpera, I will block you.{/p}{/col}\n{p:c}{col:670202}• I use PvP as my Battle resolution, however I am more than happy to do emote battles or roll battles!{/col} {col:810A0A}I am also open to unwarned attacks or sudden attacks against Shakei,{/col} {col:9B1212}I am a fair battler and as a matter of fact, I enjoy when my toons get beat up, I will purposely let Shakei get beaten down to the pulp if allowed too,{/col} {col:B81C1C}although I do not want him killed, so emote battles unforunately will not just be Shakei being beaten up if the results could lead to death!{/col} {col:D22424}I am ALL about unfair fights against Shakei, or near death encounters, and more [and worse!],{/col} {col:EC2D2D}just know Shakei will survive all of them simply because I'm not actively out to kill him off yet!{/col} {col:D22424}By all means, if you see his health meter under 10/10, attack him!{/col} {col:B81C1C}If he's gearless or distracted, go ahead and stab or blast him! Go for it, I encourage it!{/col} {col:9B1212}By all means, go ahead and scar him, lose an eye? Lose a hand? Missing pieces of tail or ears?{/col} {col:810A0A}I am ALL about it! [Although do let me know ahead of time for those{/col} {col:670202}but 9/10 of the time I am A-Okay with this!] All attacks are ATTEMPTS, no god-modding here.{/p}{/col}\n{p:r}{img:Interface\\PETBATTLES\\Weather-rain:200:3}{img:Interface\\PETBATTLES\\Weather-rain:500:3}{/p}",
