			["misc"] = {
				["PE"] = {
					["1"] = {
						["IC"] = "inv_sword_1h_draenorcrafted_d_02_b_horde",
						["TI"] = "I. Steeled.",
						["TX"] = "† — » ••••••••• \n\nAttached to Kei's belt is two very special daggers, or at least to him they're special. They have his name engraved on the hilt of them, \"Sha\" On the left, and \"Kei\" on the right, there's a small engraved heart and paw print under where his name on the hilts are, with the small initials of \"C.E\". Those close to him would know what the initials mean.\n\nThey look slightly damaged from all the times they've needed to be used, and staned on the blade, but nonetheless, they look to be in good condition currently, a small red rag is tied to the right dagger, is it broken? Or scratched?\n\n                                        ••••••••• « — †",
						["AC"] = true,
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "III. Dark Inhale.",
						["TX"] = "† — » ••••••••• \n\nAround Kei's waist is a belt with many small pouches attached to it, a pistol and vials, lots and lots of vials. The colors in the vials range from neon green, mournful purple and rage red. Also along with his belt is a few attachments and chained charms, as well as prison cell keys, were they likely his cells keys? Who knows. They jingle whenever Kei runs or moves his hips.\n\nShakei carries tranquilizer vials, mana and health potions, as well as a few types of poisons from frogs, spiders, and the occasional plant and bug, including Adder's Tongue,  Azshara's Veil, Cinderbloom and more.\n\n                                        ••••••••• « — †",
						["IC"] = "ability_xaril_masterpoisoner_red",
					},
					["2"] = {
						["IC"] = "inv_7_0raid_necklace_14b",
						["TI"] = "II. On the other side.",
						["TX"] = "† — » ••••••••• \n\nAround Kei's neck is a choker with a glowing ruby charm attached to it. However, it only glows at specific circumstances, not even he knows these. He gets angry when someones tries to take it off of him, or when someone tells him to take it off, he makes it out like he'll die with it on...?\n\nHe doesn't even remember where he got this from? Was it from Prison? Growing up in Kul Tias? He only knows that he's had it for as long as he can remember.\n\n[5/10 and under is considered dangerous.]\n\n                                        ••••••••• « — †",
						["AC"] = false,
					},
					["5"] = {
						["IC"] = "inv_cooking_80_wildberries",
						["TI"] = "V.  All Around Fruity.",
						["TX"] = "† — » ••••••••• \n\nStanding close to Shakei, you can immediately smell the fruity scent off of him. A mix of Shiso, spearmint and cherry aroma. \n\nAside from his scent, Kei often has what people call a 'fruity' motion with his body, he likes to put his hands on his hip and sway them, he's caught occasionally checking his nails, and making sure his face fur is clean, and good looking. His smile always has to be the best around in his opinion.\n\n                                        ••••••••• « — †",
						["AC"] = true,
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "IV. Blood Stain.",
						["TX"] = "† — » ••••••••• \n\nDue to Kei's chaotic and wild nature, he's in some way, shape or form always hurt, and injured. Despite how clean his fur looks, there's definitely old and dried patches of blood everywhere, and freshly made cuts and scratches, either by himself in clumsy accidents or when he decides to pick fights.\n\n[Kei's HP will never be 10/10]\n\n                                        ••••••••• « — †",
						["IC"] = "inv_artifact_bloodoftheassassinated",
					},
				},
