						["TX"] = "Celyndrelis stands on the low end of average regarding height, and in turn rarely stands out in a crowd in that regard. Though if one were to give her a long look, they'd find that she was rather gifted in terms of her body. Her assets, while large on her small frame, weren't disproportionate as could be commonly seen on the streets of Orgrimmar or Stormwind - implying more that it was natural instead of magically enhanced, but certainly straddled the line. Regardless, she carried it well and seemingly without difficulty.\n\nHer armor is simple plate and chainmail, not overly elaborate or large. Her weapons are much the same, the ensemble giving the impression that she valued functionality over looks. It would seem she had either made it herself or had it commissioned, for it was as form fitting as armor could be.\n\nLong, blonde - almost white - hair cascaded down her shoulders, but not unkempt. It was clear she took care of herself, clear skin and healthy, brushed hair. Her face always seemed set in a sad frown of sorts, eyes partially lidded, even when she smiled.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "She doesn't often speak unprovoked, but if you're able to get some conversation out of her she's quite cordial and friendly, if a little soft-spoken and short. She'll smile if you catch her attention, doing her best to be friendly and warm despite her cold state of being - literally and figuratively.\n\n\n\n\nInquire within for 18+ specifics.\n\n{link*https://www.f-list.net/c/celyndrelis*/c/}",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "She doesn't know, or at least remember. And it's unlikely anyone else does either.",
						["BK"] = 1,
					},
				},
				["TE"] = 3,
				["v"] = 5,
			},
