			["about"] = {
				["BK"] = 10,
				["T3"] = {
					["PH"] = {
						["TX"] = "Simply stout with dusty, sun-tanned fur, this Vulpera isn't anything noteworthy save for his beat up old guitar slung over his back and his trusty old leather hat. He has cataracts in his right eye, which limits his vision, but he can still see out of it.\n\nWhen he speaks, he sounds REALLY twangy and \"Southern\", with his words oftentimes being cut off and ending in \" 'n\"s.\n\nHe calls EVERYONE \"man\". Literally EVERYONE. Orcs? Elves? Humans? Worms? Cats? Vulpera? All \"man\", man.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Orderai is jovial and jokey, sometimes bitterly hard with the truth, but also laid back and cool as a cucumber. He's a much better lover than he is a fighter, but he's been in a bar fight or two. That isn't to say that he can't hold his own IF the need ever arose.\n\nHe is also a LOVER of food. Despite his rail thin appearance and goes days at a time without eating, he never turns down free dishes or snacks. NEVER.\n\nDespite being a little more on the peaceful side, don't let his unassuming and musical side fool you - he's actually very calculating and clever, using his procure on sight or improvization skills to keep him alive and come out on top.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Orderai is a travelling musician, specializing in blues and rock 'n roll. He left Vol'dun to take up his families legacy of being a wandering musician, just like his pops and his pappy before him.\n\nHis moms, on the other hand, was a thief and a rebel of sorts. She worried about her boy's safety and gave him some basics involving blades, firearms, and lockpicking. Although Orderai has this knowledge at hand, he much more prefers to not engage in violence and stealing like his mother did.",
						["BK"] = 1,
					},
				},
