						["TX"] = "He carries around an old, beat up, worn out six string on his back. He's constantly plucking on it, tuning it, and clamming out some blues. ((The backpack he wears is supposed to be the instrument))",
						["IC"] = "inv_axe_2h_undeadguitar_c_01",
