					["PS"] = {
						["TX"] = "He has a cheery attitude and tries exemplify positivity. There are a few things that could sway his happy demeanor and show the internal emotions he masks behind his smile.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Borrev was dealt one of the cruelest hands fate could give him. A Faithless ambush attacked his family when he was a little kit. Among the chaos he was knowingly abandoned by his mother who fled with her other children. The slavers then abducted Borrev and initiated him to servitude. He was fortunate enough to be ignorant of lifes simple pleasure's for some time. Borrev was obedient in his childhood years, but when the Faithless began requiring him to do much more work able for adults he began to defy them. Now left with a branding on his left wrist as a form of punishment, he resigned to his fate and lived a hollow life until Nisha and the rest of the Vulperans broke out. When his cage was open, he had to be provoked to leave.\n\nWhen he finally was accustomed to being free, an overwhelming sense of joy swept him. At first he joined whatever caravans would take him in Vol'dun, searching for treasure and sneaking around in the desert. This was the beginning of the skills he started learning he instinctively has. While not as adept in fighting as he is in trickery and stealth, he isn't afraid to use any advantage or dirty trick to survive.",
