				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-demonhunter-cover:256:256}\n\n\n{h1}History{/h1}\n\n{col:27dc24}Growing up in Nordrassil, she grew up with the stories of Illidan and the evil things he had done. She heard the stories of how he betrayed his people but she didn't understand all of the hate. He had blessed them with eternal life with the waters of the Well of Eternity and helped them start anew. She had a soft spot in her heart for him, and secretly studied the arcane art as he did although it was outlawed in their society. She grew up knowing relative peace until the third war in which she heard of the Illidan's release. She fled her home and chased him down, finally escaping to Outland and joining him at the Black Temple. She pledged her loyalty to him and devoted herself to his cause: the destruction of The Burning Legion. She trained to be one of the first Illidari, Illidan's trusted army of demon hunters. She trained hard, sacrificed everything, and grew to be one of Illidan's trusted soldiers. She was frequently sent on his most important scouting missions and proudly stood by him when the forces of Azeroth stormed the Black Temple and tried to kill her master. She fought her loved ones, but was eventually imprisoned by the wardens until she was later released to fight The Legion with the Alliance on the Broken Isles. She now fights alongside them, but they know that her true loyalty will always lay with Illidan.  {/col}\n\n{h1}Personality and Appearance{/h1}\n\n{col:27dc24}Ahlaria was taller than most of her race, slender, and agile, but with muscle tone to indicate that she was a fighter. Her horns and the sickly red glow of the fel in her tattoos made it easy to tell that she was a demon hunter. She was old, especially compared to human standards, but she had a youthful, if somewhat intense look to her. Though elegant, scars dot her form to show that she has seen many battles, before her unjust imprisonment for a great many years. Ahlaria would always be seen in her Illidari regalia, which was obviously kept in fine condition, for she wanted to represent her faction with dignity. Depending on her mood she could be timid and afraid to reach out, and other times she could be completely stand offish, keeping to herself in the distrust of others due to the slaughter of her people at the Black Temple. Once approached, however, there was little that would keep would-be companions at bay, for she often smelled of flowers, and cared openly for a certain cat that was often at her side. She kept a tome to her side in which she practiced the art of Inscription{/col}\n",
