				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Scarred",
						["IC"] = "ability_deathknight_deathscaress",
						["TX"] = "Gav is heavily scarred all over her body, scars that look like healed surgical scars over the majority of her body. Along her limbs, her ribs, her chest, even her fingers. Her face is scarred as well, similarly. Around the left eye, the bone is exposed and has runes carved into it. ",
					},
