				["v"] = 13,
			},
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "While Gavriyal is pretty in her own right, an outright 'beauty' she is not.  She is a bit more towards being a 'handsome' woman than a stunningly beautiful or cute one.\n\nThe first and most noticeable thing about her is the crescent shaped scar on the left side of her face that follows and exposes some of the bones of her brow and cheekbone. Runes are carved into that exposed bone, which almost seem to have an iridescent shimmer in the carved bits. She is heavily scarred all over her body, scars that look like healed surgical scars over the majority of her body. Along her limbs, her ribs, her chest, even her fingers. \n\nHer eyes are large, but hardly abnormally so. Their color, under the whitish glow was once a deep indigo, matching the tattoos she bears on her face. They are now an inky black, with barely any reflection when you look into them.\n\nThe tattoos and her eyes are emphasized in their darkness by the very pale blue tint to her skin, which is varied in places due to scarring and exposure to sunlight over her years in the field.\n\nGavriyal’s hair has now become a similar inky, raven black as her eyes are. She has not yet gotten around getting it cut again, so she has taken to braiding it in order to keep it out of her face. It’s reached her shoulders in length.\n\nHer frame is muscular, tall--seven feet, two inches. More in boots.--and lean. She has become far more lean in recent times. Gav’s curves, her breasts in particular, have reduced and her musculature has almost become sculpted and far more toned.  \n\n",
						["BK"] = 1,
						["IC"] = "inv_wand_1h_430nightelf_c_01",
					},
					["PS"] = {
						["IC"] = "ability_druid_dreamstate",
						["BK"] = 1,
						["TX"] = "Gav isn't called the 'Fierce Hand of Elune' for nothing. She is fierce. Near everything about her is fierce, from how she loves to how she fights. ",
					},
					["HI"] = {
						["TX"] = "Born in southern Darkshore to parents Vache and Siraya At'Lané, a warrior and a priestess, Gavrie began to explore the wilds of Darkshore and Ashenvale at an early age. As she grew it quickly became clear that she would not be likely to follow in either of her parents’ footsteps. The tenth time little Gavriyal presented Siraya and Vache with a creature and implored ‘Can I keep it?’ her path became clear.\n\nHer training as a hunter was difficut at times, especially at first. Despite her obvious affinity and skill with the beasts and creatures she tamed, archery took her far more time to master. More than once neighbors would find stray arrows in their backyard foliage. Tenacious and determined, Gavriyal practiced until she could put any fully trained Sentinel to shame.\n\nIn her adolescence and early adulthood, Gavriyal trained and served with the Sentinels. She traveled from Ashenvale all the way to Feralas and back as she matured and mastered her skills. When the call to Outland came out, she stayed behind to guard Kalimdor while others fought to eliminate the immediate threat of the Legion. Truthfully she had wanted to join the assault, but the safety of their homeland was equally important. She was no hero, and such adventures were for the heroic types.\n\nThe Sunwell cleansed, Illidan, Kael'thas AND Kil'jaeden slain… Gavriyal celebrated with her kin and comrades for their victory. The celebration was just a tad bittersweet. The young Sentinel longed to see those front lines. \n\nWhen the threat of the Scourge once again reared its foul head and the call to arms for Northrend rang out, this time Gavrie was among those who joined the fight. Determined to help wipe Arthas from the face of Azeroth, she crusaded against his forces and shared in many victories as well as setbacks–one setback being her encounter with the risen Death Knight which had once been her older brother, Alenras.\n\nTheir encounter was not a pleasant one. It ended with Gav destroying the artifact Alenras was pursuing, and this angered him greatly. Gavriyal was left with a souvenir of the fight: a crescent shaped scar that followed the arch of her brow and cheekbone, exposing the bones beneath the flesh. She had sustained other injuries as well, but that one is the only scar that she still carries to the present day.\n\nWhen Arthas was felled, victory was felt throughout the world. Finally the Scourge were not quite the menace they had once been, finally those who had lost loved ones to his rule could feel peace.\n\nThe consolation prize of the encounter with her brother was the making of a new friend: Valdyrr Marric. A Gilnean druid who had worked for days to be sure the scourged wound was healed and the infection did not reach Gavriyal’s brain. While he was unable to improve the cosmetic look to the scar, Gavrie found herself in his debt. A debt that would form quite a strong friendship as it was repaid.\n\nFor awhile, there was peace and normalcy. But as many would say, 'normal’ for Azeroth hardly ever means that there is no threat to life as its citizens know it. Deathwing’s escape and attack left Gavrie’s home country of Darkshore broken to pieces, the elements raging over its forests. After returning home to help with damage control, she again marched into the fray. Deepholm, Hyjal, Uldum and even the Firelands themselves did not escape her wrath. The Earth Warder and his many minions were taken down piece by piece until Gavrie and her comrades of the time were quite literally tearing Deathwing apart.\n\nWith the Aspect of Death defeated, Gavrie returned to Kalimdor once more to continue aiding in the rebuild in territories like her homeland of Darkshore and those drastically changed by the cataclysm such as Feralas and Thousand Needles. So much needed to be done to repair their broken world.\n\nIn the midst of licking their wounds, the mists of the South Seas parted and a new land  was revealed and its secrets were ripe for discovery. The once placid Sentinel now fancied herself something of a hero and adventurer, and thus, Gavriyal could not resist the call of Pandaria.\n\nWith the Sha and Garrosh Hellscream defeated, Gavrie and Valdyrr were hardly given any breathing room before Hellscream escaped and began the shenanigans to form the Iron Horde.\n\nDraenor proved a challenge for them. Neither had experienced Outland when the Legion had first reared its head to threaten Azeroth, and experiencing what it had been before Sargeras had mangled it was an exciting time, even without the point of reference. The wilds of Draenor were vast and strange. The Iron Horde’s armies were felled, driven into the bowels of Hellfire Citadel. Archimonde was defeated, and Gul’dan driven from Draenor. Once again, it was time to recuperate and rebuild.\n\nOr so they thought.\n\nFirst word of the Broken Isles being compromised, and then a call to arms. The Legion had finally brought the fight to Azeroth itself. Demon Hunters were free once more, and demons now attacked their very strongholds and lands. \n\nGavriyal and Valdyrr were among those who answered the call to the Broken Shore. Ready and willing to kill as many demons as was needed to keep their home safe. But… they were not quite prepared. \n\nWith the birth of her daughter, Estel, Gavriyal has been taking some time to recover at home and help to care for her. But soon it will be to the battlefront, again.\n\nHere we go again.",
