			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Windy:512:128}\n{h1:c}{col:007fff}Krenn'dris River Song{/h1}\n{h3:c}{link*https://cdn.discordapp.com/attachments/824882235261845515/825248435077644379/unknown.png*Apperance of Kren}{/h3}\n\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-ShrineoftheStorm:256:1}\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-ShrineoftheStorm:456:2}\n{img:Interface\\LFGFRAME\\LFGIcon-ShrineoftheStorm:01256:3}\n\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-ShrineoftheStorm:512:200}\n\n{col:007fff}{h2:c}{col:007fff}Life Story{/col}{/h2}{/col}\n\n{col:007fff}Krenn'dris was born and raised in Silvermoon City, where he spent most of his life dreaming of adventure on the seas. The moment he turned 15 he enlisted on his first vessel lying about his age to sucure the position, he's been on the sea ever since, bouncing around from port to port, never setting any roots.\n\nKrenn has done many things in his sailor career, he's done ferry passage, mercenary ships, importing, exporting anything you can think of. He's probably done it....short of military service. His only regret in life is not being able to help out the rebuilding of Silvermoon when Arthas attacked, because his vessel was at the time off the coast of Westfall heading to Booty Bay to deliever teas from up north. \n\nHe now commands a vessel named \"The Silver Phoenix\"\n\nKrenn spends most of his time nowadays hitting the bars at ports while his crew secures cargo to transport, trying to make friends and connections for things later in life. Maybe one day he'll settle down, only time will tell.{/col}\n\n{img:Interface\\QuestionFrame\\answer-warfronts-horde-CallOfTheStorm:2556:1}\n\n{h1:c}OOC Info{/h1}\n\nI ignore everyone in the Guilds Champion of the Lion, and Gearpunk Dynamics, and Firebrand Trust.\n\nPlayer is 25+ Male, I have Aspberger's Syndrome so please, please, please be patient with me,",
