			["misc"] = {
				["PE"] = {
					["1"] = {
						["IC"] = "inv_weapon_halberd_29",
						["TI"] = "Requiem, The Guiding Halo",
						["TX"] = "With new armor comes, new weapons and thus another joins Maurices collection. Requiem, The Guiding Halo.\n\nThe weapon being a staff, spear hybrid already gives Maurice a good edge since his skill are well trained but the addition of the circular, azure ore made point makes it all the more of a threat, being able to maneuver the spear in a bit of an odd way. \n\nThe weapon long hilt is made of Lumestone, wrapped by a thin layer of leystone, and grooved for swift and slick hand transitions. \n ",
						["AC"] = true,
					},
					["3"] = {
						["AC"] = true,
						["TI"] = " Badge Of The Archivist",
						["IC"] = "inv_staff_2h_artifacttome_d_06",
						["TX"] = "          \n   After spending a couple of months of training with Archivist Emeline, Maur was granted the title of Highlord-Archivist after being recognized by the members of the Silver Hand for his actions in returning relics and artifacts to the halls... yet despite the title all though he still only wishes to explore the world to his heart's content.\n",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Aura: Holy Hemomancy",
						["TX"] = "No longer it being a secret, Maurice auras are clear for all to see. \nBeing able to use Blood Magic and the Holy Light.\n\nHis skills in the Light are powerful and trained but for his skill in Hemomancy, they has been improving rapidly. \n\nA strange new power he's been able to use is Blood Light, being able to mix Holy Magic and Hemomancy into a healing pool that purifies one's bloodstream.\n",
						["IC"] = "inv_alchemy_lightbloodelixir",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Silver Hair Rings",
						["TX"] = "In his dreads are silver rings... nothing special about them, but they make a cool noise and are pretty so...\n",
						["IC"] = "inv_ring_80_02d",
					},
					["4"] = {
						["IC"] = "inv_mechagonpet_brass",
						["TI"] = "GT-2.0  Best Freind Mecha Relations",
						["TX"] = " Following the paladin either by his side or on his shoulder  is his best friend GT-2. A Micro Bot he found in a oil heap, ready to self destruct but he quickly got the little guy, now their inseparable!",
						["AC"] = true,
					},
				},
				["ST"] = {
					["1"] = 4,
					["3"] = 0,
					["2"] = 1,
					["5"] = 1,
					["4"] = 3,
					["6"] = 0,
				},
				["v"] = 49,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "\n{p:c}{link*https://www.youtube.com/watch?v=AJbTktXLlRs*•Mood Theme- Not Around•\n}\n  -------------------\n{link*https://imgur.com/a/HpdczTu*•Art Album•}\n  -------------------\n{link*https://wyrmrest.fandom.com/wiki/Maurice_Zyaire_Cain*•Wiki Link•}\n  -------------------\n{/p}\n{h1:c} {icon:inv_offhand_dalaran_d_01:25}{/h1} \n{p:c}{col:ffe297}Coming from the Cain bloodline, a noble line of Dalaran Warmages rooted with a half elf heritage Maurice holds a few of the qualities of his past ancestors despite both of his parents being human. He stood at a startling 6 feet tall with a few inches to boost and barely peeked under 190’ lbs. His skin tone, being a dark brown in the night but smooth chocolate brown in the day, gets him spotted rather quickly as the son of Dalarans famous retired Warmage,Lady Archmage Briana Cain.\n\nWith his wondrous height however came his stature and physique, being well muscled and rather “chiseled” due to duel  training to be a Argent Paladin and his more tribal orcish training with his  Stepfather Krurg Fullguard.\n\nIf anyone took their eyes from his top it would only leave him a bit embarrassed and begin to shy away from, as even humans can come \"blessed\" said by his step-father when Maurice began to reach points of maturity he still yet to finish growing from and one of the many reason he wears a compressed under armor and robe like armor and clothing.\n{/col}{/p}\n{h1:c}{icon:inv_artifact_tome01:25}{/h1}\n{p:c}{col:ffe297}With an inquisitive nature and docile attitude Maurice is an all around optimistic realist despite being a behemoth fighter and skillful warrior with a variety of weapons training, preferring to use his mind and brains to solve situations otherwise seen as impossible rather than doing it the easy way and fighting his way out of it.{/col}{/p}\n\n\n{h1:c}{icon:inv_alchemy_lightbloodelixir:25}{/h1}\n{p:c}{col:ff150d}My curse and my strength\nBorn of bad blood, \nBut raised with the faith and hope\nThat I could do better\nBe better.{/col} {/p}\n{p:c}{col:ffe297}Coming to terms with his original fathers rather evil bloodline as a necromancer Maur has decided to push his natural ability to use Hemomancy a bit further as to ensure the curse passed down from his ancestors stops and ends with him. His path in the arts of Blood magic is only beginning but so far he's managed to create a series of knives of blood he can throw at his enemies, a skill taught by a Venthyr ally of his.\n\nSpeaking on his dark abilities Maurice managed to quell the lust for blood from his... other half but slips each time he uses his abilites; the calling of blood dragging his mind into a frenzy sometimes. {/col}{/p}\n{p:c}  {img:Interface\\ARCHEOLOGY\\ArchRare-TheInnKeepersDaughter:512:256}{/p}\n\n\n",
				},
