					["4"] = {
						["AC"] = true,
						["TI"] = "Homefront Heals",
						["TX"] = "From midwifery to care for the elderly, Morea is generally known to care for the citizens of the cities of central Kalimdor. She is certainly not a combat or trauma healer!",
