				["v"] = 23,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-37:100:100}\n\n{h2:c}Personality{/h2}{col:ccff89}\nMorea Suncharm's bright green eyes often sparkle with curiosity and cheer. Although she lacks the boisterous energy of many young women, her optimism and pragmaticism carry her through hard-fought days with a head held high. While she is certainly modest and can be demure, Morea enjoys the company of friends, lovers, and family.{/col}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-6:100:100}\n{h2:c}Physicality{/h2}{col:ffbefb}\nHer body is fit and feminine, soft curves overtop healthy muscle that keep her frame on the pretty side of plump. She takes care to comb out her mane and keep her tail tuft smooth, as well as her thick, silky fur shiny and clean. This graceful Tauren's motions are full of calm compassion as she makes her way from Thunderbluff to Orgrimmar and back. Morea finds her smaller frame helpful at putting victims of violence or illness at ease when coming into their home to heal.\nMorea has one noticable scar: A bite from canine fangs at the juncture of neck and shoulder.{/col}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-76:100:100}\n{h2:c}A Little History{/h2}{col:ffcb95}\nMorea was born after Thunderbluff was settled by the nomadic Tauren. Her parents had thought they were finished with children, but this happy accident was an unexpected blessing. Morea has fond memories of her childhood, peaceful until the Grimtotem tribe attempted their hostile takeover. Much of her family was killed during that violent time.\n{/col}\n\n\n\n{col:9189ff}Ask if you'd like a /c/ :3 {/col}\n",
				},
