			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\DRESSUPFRAME\\DressUpBackground-Vulpera1:256:256}\n\n{h2:c}Physical{/h2}\n\nAverage build and height for a Vulpera, being close to 4 feet tall and being more on the lean side due to not always having a constant supply of food. He is clad with ash gray fur with various black spots around him and is never seen without his trademark coat, something he \"borrowed\" from another Vulpera pirate. He has a long vertical scar that runs down from his brow to his left cheek, going straight through his now glass eye. The smell of cigars and gunpowder follow closley to him.\n\n{h3:c}History{/h3}\n\nHaving been sold into a raiding caravan by his parents at a very young age, Rikki never knew any of his biological family, only the other Vulpera in the caravan. His early life was hard, but simple, and he learned many skills there that he still uses to this day in his present business. Sabotaging wagons, stealing and smuggling supplies over city lines, and killing others before they can kill you are just some of the skills needed to survive in this group. Of course there was strength in numbers, and they took advantage of that, targeting weaker wagons and raiding and pillaging them, taking their food and supplies and taking no one alive. This lifestyle led to many other caravans seeking to destroy and capitalize on their business, leading to the one fateful day that a certain rival group managed to sneak into Rikki's group's and murder nearly the entire caravan. Although managing to survive, Rikki did lose his left eye, and, along with the very few other surviviors of the attack, decided to stow away on a ship to Kalimdor, specifically Orgrimmar. This is where the story leads to today, and Rikki spends his days not unlike his past, taking on jobs smuggling weapons, herbs and any other goods across city or regional lines.",
