				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-warboard-bfa-Voldun:512:256}\n\n{h1}History{/h1}\n\nOne time, twenty something years ago, a woman got lost in the expansive desert of Vol'dun. She would have perished easily if not for the efforts of a single baffled Vulpera who happened upon her. Time passed, and the two grew close, living together for several years and even having a child, but the differences kept both of them from interacting with either of their people, not that they cared too much. They had each other...until one day, the woman vanished, leaving behind her husband and son, though not without leaving her mark...due to what she was.\n\nThis, was the story of Areku's parents.\n\n{link*https://imgur.com/2xuWDjh.png*Some Art of Areku, by RaptorChap}\n{link*https://d.furaffinity.net/art/foxyareku/1612221702/1612221615.foxyareku_kahawte.png*Art of Areku and Kahawte, by Moose}\n{link*https://i.imgur.com/NDD36cP.png*Demon Areku, by Enkie}\n\n\n{h1}Meta Knowledge{/h1}\n\nAreku is a half-demon, related to Sayaad's, or Succubi. He may have an effect on your character, much like a pheromone that increases attraction, while at the same time making those around him feel more relaxed and less stressed or anxious. You can choose to respond to this, or not. He does suppress it to the best of his ability, but it leaks out quite commonly. \n\nDemon Hunters and those who simply aren't attracted to men (or even vulpera) would be immune to this effect, Demon Hunters also would have the ability to tell what he is in a heartbeat, but otherwise unless your character is incredibly familiar with demons and how they work, they shouldn't be able to see anything but a standard Vulpera who feels a bit too hot.\n\nWhich speaking of, his body would also feel incredibly warm to the touch, not uncomfortably so, but still unnaturally warmer than your average person.\n\nIf you read this thank you, I LOVE when people act on this part of Areku in RP, so if you want to go into how this may have effected your character, please do!\nAlso he has a reason for having a last name.\n\n(Please stop making us vulpera rpers look bad!)\n",
