				["T1"] = {
					["TX"] = "Buxom and boistrous to a flaw, Harmoney Traxaland-Goldgear cuts an imposing figure when she's center stage. Her strong accent and voice are just grating enough to not be ignorable, though not so far as to be outright annoying.\n\nTopped with a vibrant blaze of purple hair that slowly shifts into a flowing starscape, the woman makes no secret of her lack of subtlety. Piercings line her ears, nose, and eyebrows, well over a dozen of them, but none mar her plush, distended looking maroon lips. Curving and sensual, they're always pushed into something more exciting than a flat smile or neutral purse. Makeup has been expertly applied to make her violet eyes pop and her smile brighten.\n\nShe's shapely - Real shapely. Wide hips further than her shoulders, a wiggling wobbling rump stuffed into whatever outfit she deems fashionable that day, and a real pair of gonhonagazooks leading her where she walks, threatening to pop out of a cleavage window you could lose an arm in, all of this seperated by tiny bit of pudge in a thick waist.\n\nEqually plush looking thighs taper down to her feet, often wrapped in the tightest of knee-height designer boots, carrying the beauty from place to place in style.\n\nRarely far from a cosmically conjured milkshake or beverage.\n\n\n{link*https://i.imgur.com/vz4NbEh.png*Ain't I just a looka~'?} Art by OhDangDoof\n{link*https://i.imgur.com/4J08Lyq.png*We're both pretty fantastic~} Art by Jazziks\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nSince i'm plugging my friends, maybe I should also just go ahead and plug my own stuff too~ \n\nBe warned, this stuff is SUPER extreme and NSFW.\n{link*https://www.furaffinity.net/gallery/brownhair798/*My Gallery of big screenshot manipulations}\nI do requests, but only if I -really- like the idea and the look.\n\nCurrent size: {link*https://i.imgur.com/nPZbj0f.png*Bigger.}",
