			["character"] = {
				["CU"] = "Looks to be in a bit of meditation. Soft and calm breaths. Occasionally.. floating?\n\n[Target- Looking at/watching]\n[HP - 5/5]",
				["CO"] = "(18+)\n\n(E)RP Most Themes\nLove a good mix.\nWalk ups loved! (Ping if I miss)\nFeel free to poke and ask more, I dont bite<3\nSometimes freeze for a bit.",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["v"] = 19,
			},
			["time"] = 1631153390,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "(18+)\n(Might be prone to freezing for a bit, sometimes crashing, but I'll try to get back to ya!)\n\n\n\n\n\n------------------------------------------------------------\nCurrently:\n\nRoaming around and seeing the sights again, as well as to see if people need his assistance. Can possibly be found in Alliance or Horde lands, helping either side. (Cross-Faction open!)\n\n------------------------------------------------------------\n\n\n\nStanding before you was a rather short pandaren as compared to most of their kind. Their fur could be classified as that of a charcoal coloring, well kempt, and often groomed when possible.\nAt first glanced it would appear they a flattened chest unlike the usual endowed pandaren women. The soft, white fur contained by a set of leathers they've come to claim as their own after formerly sticking to trainee gear; Seems the pandaren's found himself beyond that now.\nHowever, one would take notice the same stature of some pandaren women, a delicate looking, curvy, feminine figure, giving a rather androgynous appearance still.\n\nTo further compliment his feminine body and structure, this particular pandaren chose to wear things such as human makeups. Their eyes had a bit of shadow to them, and it wouldn't be surprising to find their lips were a rather deep, oceanic blue such as their soft eyes.\nEyeing down their form one could find wide, flared hips fitting for a 'woman' like himself, though that was to be debated. This was complimented by the plush and fuzzy thighs he had as well, perfect for a headrest if they convinced him. Around the back rested their well rounded, plush bottom that wiggled to his steps, often causing him some sheepish moments at how pronounced it was.\n\n\n------------------------------------------------------------\nMagical Brewing\n\nYin has been learning from another pandaren going by the name Mei Windpaw who is teaching him the art of magical brewing, starting with some basics in transformative types.\n\nWARNING: New potions may be slightly unstable or have lasting effects, he is still experimenting and learning.\n\n\n\n\n/c/\n",
						["BK"] = 1,
					},
					["PS"] = {
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "(Sorry there's not a whole lot in the history!)\n(If you wish to know more, feel free to give me a poke! And don't be shy, I'm rather open <3)\n\n\n\n\n\n\n\nPossible Hooks:\n\nPerhaps you've been to or come from the Vale of the Eternal Blossoms and have met him at a younger age, met his family, or have heard of them. (The Riverheart family is a noble one and known for their various healing techniques.)\nYou've seen Yin wandering around the city/town keeping his eyes on people and occasionally sketching them in a journal.\nHe tends to run courier work and travels all around, often between major cities or the odd place away from towns. \nYin has occasionally been seen travelling to Alliance and Horde territory, even staying the night in either faction's areas.\nHe also has a note for his services in Org and Stormwind, be it for healing, alchemical brews, or even a massage.",
						["BK"] = 1,
					},
				},
