				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n{h1:c}History{/h1}\n\nAritzza spent most of her life traveling from one Caravan to another selling what she finds while on the side practicing magic. One day her Caravan was ambushed by Sethraks and while she tried to fend them off, she eventually was captured by them and hauled off to be sold. Soon a slaver noticed her talent with magic and bought her in order to be trained. as for why, that remains a mystery to her. maybe she thought she would one day be used as some weapon for the Sethraks. Either way, it would not change her fate. Aritzza would spend the next few years working with other slaves during the day and being forced to stay awake during the night to learn magic, getting little (if any) sleep in the process. She'd considered attempting to escape, but after witnessing what happened to those who were caught she decided to stay and endure her treatment, hoping that one day she would be free. That hope finally came to reality one day when a group of slaves escaped their holding cells and decided to go back for her. Thankfully it was during what little time she had to sleep. They broke her out and snook her onto a boat to Kalimdor.",
