					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-Arakkoa:512:256}\n{h1:c}{col:22348F}CORAL{/col}{/h1}\n{img:Interface\\PETBATTLES\\Weather-Windy:512:3}\n{h2:c}{link*https://imgur.com/a/NOWRbIs*Art by me!}{/h2}\n{h3:c}{col:ffffff}(NSFW upon request.){/col}{/h3}\n\n{h2:c}{link*https://www.youtube.com/watch?v=sfLDOVcK7nU&ab_channel=CeeCee*First Singing Example}\n{link*https://www.youtube.com/watch?v=ADtoRm5ELZw&ab_channel=CelticWoman-Topic*Second Singing Example}{/h2}\n\n{h3:c}{col:ffffff}- Known amongst the Unshackled for her beautiful singing voice, singing while they worked before they were freed.\n- A fairly powerful Gralian priestess, however she has taken to incorporating her use of water in performances.\n- Sometimes will perform publicly and dance as she does so.{/col}{/h3}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-22:64:64}\n",
