						["TI"] = "— Vibrant",
						["AC"] = true,
						["TX"] = "\"There's beauty in everything..!\"\n\n†\n\nLanguid, fluid movements like water and pale skin like porcelain creates an almost ethereal appearance about the woman. Inky black air billows about her in waves, a striking blue streaking through the same shade of her fins and gills.\n\n†\n\nOdd eyes peer out from beneath thick lashes, a beautiful gold and gleaming playfully with an unusually black sclera. Plush lips are oft painted a deep shade of blue, while a button nose has a silver stud. When her lips part to let forth the melody that is her voice, a flash of silver gleams on her tongue in the form of another stud.\n\n†\n\nA soft face is framed by her hair, while thin shoulders alongside her stomach are bared with the black top she wears. On the sides of her neck and torso, blue gills are shown in a soft frill, while wide, soft hips are wrapped in a purple sash and black shorts hug shapely thighs. A pair of purple stockings lead to a lack of shoes, instead looping around her sole to leave her heel and toes bare.",
