			["about"] = {
				["T2"] = {
					{
						["TX"] = "{col:00ccff}I'll fix Maxxi's timeline when Blizzard fixes theirs.\n\n{link*https://twitter.com/Lightsnappin*Maxxi Twitter}\n\n{link*https://imgur.com/a/WkhLcY7*Maxxi Art Gallery (Says it may contain NSFW, but it's ALL SFW. I don't know how to change it)}",
						["BK"] = 3,
						["IC"] = "inv_artifact_xp04",
					}, -- [1]
					{
						["TX"] = "{col:fffb9e}-An Interesting Fact-{/col}\n\nYou can also find Maxxi on Pepsi-Soda. If you get what I mean.",
						["BK"] = 3,
						["IC"] = "inv_artifact_xp01",
					}, -- [2]
					{
						["TX"] = "{col:fffb9e}-History-{/col}\nLearn it through RP!{/col}",
						["BK"] = 3,
						["IC"] = "inv_artifact_xp04",
					}, -- [3]
					{
						["TX"] = "{col:fffb9e}-Nicknames-{/col}\n-Max\n-Mook(sie)\n-Mania\n-\"Mad Maxxi\"\n-Moonwalker\n\n{col:fffb9e}-Tattoos-{/col}\n\n-Mechanical (Ironbound) Proto-Drake on his entire back.\n-Red swirling rune on back of his right hand, pulses like a beating heart.\n-Kraken, starting on the left side of his hip and going down to his left ankle.\n",
						["BK"] = 1,
						["IC"] = "inv_artifact_xp01",
					}, -- [4]
					{
						["TX"] = "{col:fffb9e}Language Proficiency:{/col}\n\n{col:bdffba}Goblin - Native Language{/col}\n{col:ffaf8e}Orcish - Comfortable, can speak/read/write in it about as well as Goblin{/col}\n{col:aceaff}Common - Can speak it well enough, big words/accents are difficult; Can barely read/write in it{/col}\nOther: Learning via Tongues natural learning",
						["BK"] = 1,
						["IC"] = "inv_artifact_xp04",
					}, -- [5]
					{
						["TX"] = "{col:fffb9e}-Scars-{/col}\n-Right side of face has light burn scarring, he can still see.\n-One on his chest, right under his armpit. Originally a stab wound to the lung.\n-One on right wrist, looks like someone poked a hole through it.\n-Left wrist has a burn scar.\n-A cut on his right side, going diagonally from chest to stomach.\n-Bullet scar on his right thigh.\n-Bullet scar on his right shoulder.\n-Bullet scar on his left forearm.\n\n{col:fffb9e}-Older, faded scars-{/col}\n\n-Burn on his left shoulder (water).\n-Three small burns on his neck (cigarette).\n-Small cut on neck.\n-Four small burns on right shoulder (cigarette).\n-Slash on right shoulder.\n-Slash on chest.\n-Burn on chest (water).\n-Two slashes on left arm.\n-Three scratches on left arm (animal).\n-Three burns on left arm (cigarette).\n-Two cuts on right arm.\n-Two cuts on right leg.\n-Three cuts on left leg.\n-One electrical scar (as if tazed badly) on each arm.",
						["BK"] = 1,
						["IC"] = "inv_artifact_xp01",
					}, -- [6]
				},
