			["about"] = {
				["T2"] = {
					{
						["TX"] = "\n{p:c}{col:aeaeae}\"The world will never be in want of more heroes to die, little feather -- and die they will and do, by the thousand. Think instead of what rare gentleness there is for those they leave behind.\"{col:aeaeae}{/p}",
						["BK"] = 1,
						["IC"] = "inv_misc_celestialmap",
					}, -- [1]
					{
						["TX"] = "\n{col:aeaeae}Yska is of average height and heavy build, with white-and-cream fur groomed with painstaking care -- and scented, now and then, with the modest luxuries of rose oil or vanilla. Her claws are blunt and short with the habits of work, and ever are there faint, deeply tired shadows across her small, round face that lines of kohl or powder cannot entirely hide.\n\nShe tends now to dress modestly, in work-dresses and aprons, in sensible skirts and layers easily shed when soiled. Soft grey dapples spot her shoulders and the back of her head,  less dark by degrees than the points that start at her knees and elbows and ear-tips. Even at her most alert, those  ears don’t stand upright -- instead, they lop forward, framing either side of a pretty blue-eyed face that somehow always seems a little sad.\n\nIn spite of it all, Yska's affect is warm and open-hearted, and joy she holds upon herself like armour. No weary, bitterly hardened core hides behind her gentle surface, and in the end no cruelty wins her surrender: not as long as she simply drifts, feather-light, through the assault of an unhappy world.\n\nfull art folder! there is a lot.: {link*https://imgur.com/a/6TGM3KX*imgur.com/a/6TGM3KX} \n{/col}\n",
