				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Armor of the Wolf",
						["TX"] = "A heavy set of plate armor forged of steel and mithril. It’s ivory color and wolf’s fur lining give homage to Neruk’s people, the Frostwolf Clan.\n",
						["IC"] = "inv_shoulder_plate_legiondungeon_c_01",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Orcish Might",
						["TX"] = "Neruk exemplifies the physique of an orcish warrior, one forged through years of battle. He stands taller then most orcs with a commanding presence of authority and discipline. \n\n\"A warrior is not made with magic. He is forged in battle.\"",
						["IC"] = "ability_warrior_strengthofarms",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "The Stoneblade",
						["TX"] = "An ancient weapon, forged from the heart of a colossal earth elemental when Draenor was still whole. Though shattered in battle against the Burning Legion it has since been reforged with the aid of the Earthen Ring.",
						["IC"] = "inv_sword_2h_draenorhonors2_c_01",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Frostwolf Champion",
						["IC"] = "inv_frostwolfpup",
						["TX"] = "Neruk is a renown warrior of the Frostwolf clan, and has proudly represented the might of his people in battle against the enemies of the Horde since his youth.\n\n\"Frostwolf blood runs thick.\"\n",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Burned by Demon's Fire",
						["IC"] = "spell_fire_felfire",
						["TX"] = "Neruk's face has been burned by fel fire, scaring the entire right side of his face.",
					},
				},
				["v"] = 8,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n{h1:c}{icon:achievement_legionpvp3tier3:35}{/h1}\n{h2:c}{col:379FFF}N E R U K\nW O L F H E A R T{/col}{/h2}\n{h3}{icon:spell_deathknight_iceboundfortitude:25}{col:379FFF} Appearance{/col}{/h3}{col:FFD98F}Neruk has a hulking, brutish figure, standing tall even among orcs. His broad, muscular build and cold demeanor make him an intimidating sight to behold. His green skin is rough and marked by scars from past battles. He is an orc who has lived a life of constent war.\n\nHe is strong, capable of delivering crushing blows in hand-to-hand combat and is exceptionally skilled in a wide range of weaponry. In addition to incredible physical endurance and strength he is also a cunning warrior, with fierce tenacity and the predatory focus of a wolf. \n\nLong black hair frames his rugged features. The right side of his face has been burned and scarred. A heavy brow lined in bushy black eyebrows rests over his piercing, red glare. His broad, heavy jaw is covered in a thick, untamed beard. His stern features display a sense of authority and discipline.{/col}\n\n\n{h3}{icon:inv_misc_ selfiecamera_01:25}{col:379FFF} Images{/col}{/h3}{col:FFD98F}Assorted artwork of Neruk. Whisper for artist information{/col}\n\n{link*https://i.imgur.com/aLTOQ1E.png*1} - {link*https://i.imgur.com/cuTYKWW.jpg*2} - {link*https://i.imgur.com/7kMBz3i.png*3} - {link*https://i.imgur.com/AfKBVgJ.png*4}\n\n\n{h3}{icon:inv_misc_book_11:25}{col:379FFF} History{/col}{/h3}{col:FFD98F}Neruk has had a long and prominent military career dating back to his time defending Alterac Valley against the Stormpike dwarves. He has led warriors in battle and won many victories for the Horde.  \n\nA fierce warrior and cunning leader, Neruk inspired many other warriors to fight by his side. He has commanded soldiers from every corner of Azeroth, and beyond. He and his followers would become known as the Warsworn. \n\nThroughout the Fourth War he would lead attacks on the Alliance, though he was very vocal about his resentment of Sylvanas Windrunner. Despite this he would not join Saurfang's army, refusing to stand alongside the Alliance once again against fellow Horde soldiers. \n\nWith the Horde entering into an armistice with the Alliance, Neruk no longer feels the Horde can sustain itself. He and his warriors have rejected the council's claim to power. Believing the Horde has lost it's way, it's people forgetting why they fight, he has refused to swear loyalty to anyone but himself.{/col}\n\n\n{h3}{icon:wow_token01:25}{col:379FFF} OOC Information{/col}{/h3}{col:FFD98F}Empty?! For now....{/col}\n\n\n\n\n\n\n{col:000000}.{/col}",
