			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\LFGICON-TEMPESTKEEP:256:256}\nDescription\n\nA tall muscular draenei, her muscles developed through centuries of wearing heavy plate armor and fighting multiple wars. Her body full of scars and battle wounds from the wars and battles shes endured. Although she is quite old her face is youthful and soft. Her eyes are bright and full of wonder, as if the years of turmoil and loss has not affected her at all. Her nose is small, and her horns are turned back, her short white hair only visable when she removes her helmet.Hellig was a walking conundrom, as she was hard, stubborn, strong willed and mature, as well as easy going, free thinking, open minded, loving, and carefree. Her years of heartache, loss, and war has shaped her but she still remained innocent, caring, and happy go lucky. She loves making new friends and learning other peoples stories, she's traveled the world of Azeroth learning history, and the story of as many people as she could. Highly intelligent and curious, she is full of questions and wonder for the world.\n\nHistory\n\nBorn on Argus, she lived in Mac'aree alongside Velen and his brothers, she escaped with Velen from Argus and also Draenor, she has lost her family long ago on Argus. Fearing she would have to escape yet again Hellig has yet to make a family for fear she may lose them. Battleworn, Hellig has fought for and by Velen's side from the beginning. Through her dedication to Velen and to her people, and her courage, she was gifted by the naaru  the ability to use the light, which is when she became a paladin. Her history is long, and her life is complicated, but maybe she has a few stories to share.\n\n\nCovenant \n\nWhen landing in the shadowlands Helligstraff was heartbroken when she learned of the betryal that fell upon the Venthyr although she finds their way crass at times, Helligstraff vowed to help the Venthyr redeem theirselves with their own people and to the other covens, although she is sometimes looked down upon by her fellow light weilders for allying with them, she feels that the light and the justice she can bring is needed where she is.\n",
