						["AC"] = true,
						["TI"] = "Scarred Left Eye",
						["TX"] = "An old, jagged scar runs from the middle of her left forehead to the middle of her left cheek. Two horizontal slashes run along her cheek, crossing the lengthwise mark, just under her eye.\n\nHer eye, somehow, wasn't damaged in the fight that caused it, but she needs glasses anyway.",
