						["IC"] = "inv_chest_mail_revendrethraid_d_01",
						["TX"] = "Theresa wears armor emblazoned with Alliance military flashes. She keeps the majority of them partially covered.\n\nHer armor is well cared for and good for most environments with minimal adjustment.\n\nClipped to her right collar is the mouthpiece to a walkie-talkie. The cord vanishes into her pack.",
