			["about"] = {
				["T2"] = {
					{
						["TX"] = "Hooks: Come ask her about these:\n\n-She has an unusual scar over her left eye, mid-forehead to mid-cheek, with two slashes horizontally through it. And she wears glasses.\n-She has a big rifle, and a war pick. Strange choices.\n-She's NOT Gilnean. She's definitely a Worgen.\n-She's not super fond of being in her Worgen form.\n-She's a soldier. Alliance Navy Reconnaisance. She's been seen during the Legionfall Campaign, and throughout conflicts associated with BFA. With the rumoured abduction of the King of Stormwind, she's been thrown to the literal hells in search of him.\n-Her soul is battered as if she's been near death multiple times.",
						["BK"] = 6,
						["IC"] = "inv_fishing_nethooks01",
					}, -- [1]
					{
						["BK"] = 1,
					}, -- [2]
					{
						["TX"] = "Human Appearance\n\nTheresa is, upon first glance, average. Average height, maybe a little lean, and standing in the background if possible. She's athletic from years of running and fighting. She keeps herself tidy, but still somehow looks rough. Maybe she's just a little dusty, or a piece of hair sticks out at an angle, but never anything more than that.\n\nUpon her head is a mop of straight auburn hair. Short and bright, it frames a tan, narrow face with piercing brown eyes. Theresa wears glasses. Across her left eye is a scar that runs from mid-forehead to mid-cheek. The scar has two horizontal slashes, one just under her eye and shortly beneath that. They're slightly faded, but still obvious on that second glance.",
						["BK"] = 6,
						["IC"] = "ability_hunter_runningshot",
					}, -- [3]
					{
						["TX"] = "Worgen Apperance\n\nAs a Worgen, Theresa remains an average, lean built being. Slightly taller, slightly stronger, but just the same. She looks a little more like a coyote than a wolf. Her colours are warm-grey and auburn, and with an under-eye pale patch and eyebrows marking on her face. Her mane is messier than her human hair, but almost the same colour.\n\nThe difference is her eyes. Still behind glasses, they turn gold here. Theresa's scowl becomes even more pronounced as a worgen. The fangs that peek out of her mouth don't help.",
						["BK"] = 6,
						["IC"] = "inv_wolfdraenormountrusticyellow",
					}, -- [4]
					{
						["TX"] = "Personality\n\n-She's guarded.\n-She's blunt.\n-She's stubborn.\n-She's practical.\n-She isn't a jerk, though sometimes it's very easy to call her one.\n-She's fiery spirited, but would rather physically fight than argue. Actions over words.\n",
						["BK"] = 6,
						["IC"] = "rogue_shadowfocus",
					}, -- [5]
