						["TX"] = "Assorted other notes:\n\n*I have art links if requested\n\n*Stuff at home:\n\nStormwind City Watch keepsakes (badge, locker nameplate)\nKoray's antimagic dagger\nNiilli's Ghost Wolf fur\nTails' black/purple scale heart pendant\nAelli's magic lens\nDialandra's moonwell dagger\nTukauati's friendship bell\nBurt's mechanical bird (Mecha III)",
