			["about"] = {
				["v"] = 14,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-mage-cover:256:256}\n{h1:c}{col:00e5ff}Weeping Somnambulist{/col}{/h1}\n\n-Big ole wip\n-LF a teacher\n\n{h2:c}{col:00e5ff}Appearance{/col}{/h2}\n{link*https://sunwraths.tumblr.com/post/661495259859206144/smallfrost-this-was-the-gif-that-convinced-me-to*Her face claim}\n{col:d25eff}Ryswell fits the standards of elven beauty perfectly, her face is delicate yet with a certain sharpness to her features. Sparkly green eyes, pointy button nose, plump red lips, and a short silky raven mane that usually cascades down her shoulders or is held up in a bun. Yet, none of these characteristics seem to grab people's attention as much as her very obvious lack of left ear does. The empty spot on the side of her face also sports three small slash scars that can be seen running from her cheekbone and until hidden by her hair. Rys does not seem to like talking about how she lost her ear. The elf doesn't seem to carry herself around with much confidence, always looks tense, shoulders a little raised and head down as if trying to avoid eye contact, but whoever gets to see her standing up properly might catch that she's not as tiny as she usually looks. Her body has a certain strength to it.{/col}\n\n{h2:c}{col:00e5ff}Personality{/col}{/h2}\n{col:d25eff}Ryswell Bellator is an unusual case for the family. Her older sisters show charisma and confidence to some extent, but the youngest Bellator seems to be devoid of these traits. Ryswell is a quiet presence, she speaks softly, to the point where it can be rather hard to hear her, and she usually tries to rush conversation, as if she were trying to get out of it. However, the young woman has a strong thirst for knowledge, and any chatter about the arcana will catch her interest and bring her out of her shell a little. Although quiet and shy, she can show incredible friendliness, she's loyal to the bone and is remarkably kind to those who manage to break down her walls. Some of her behaviors might hint that there's something stronger about her stirring under the surface, ambition and drive that sometimes come to light, but immediately get shut down as if they'd never been there. {/col}\n\n{h2:c}{col:00e5ff}Background{/col}{/h2}\n\nOOC notes:\n- Congrats on making it all the way down here! Have a cookie\n- This TRP is under construction but I'll be adding things over the next few weeks\n- Player and chara are a lil shy, be nice please c:\n- English is not my first language, please don't murder me if I make any mistakes!\n- I am currently not doing much rp with this girl as I am leveling her, but I'd love to get some connections for her in the meantime! She's particularly looking for a teacher to help her with her training as a mage. The girl knows a fair bit of cryomancy and is interested in the area of illusion too, but I'm open to other schools of magic too!\n\n\n\n\n",
				},
