			["character"] = {
				["v"] = 71,
				["CO"] = "-Art in about!\n\n-VC: Laura Bailey\n\n-18+ welcome but if you open with creepiness or immediate ERP I'll call your parents.\n\n-Number of parents called: 19\n\n-29 RP points and counting.\n\n-Walk ups welcome, I'm a friendly dork <3",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "Hair finally orange again! Also kinda sleepy! Woo!",
			},
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{p:c}{link*https://imgur.com/a/fqlIUy2* Elia art album!!}{/p}\n{p:c}{link*https://i.imgur.com/qSlA3zz.png* Winter Veil outfit, credit to Lulu!}{/p}\n{h2:c}{col:92ff5b}Leaves from the vine{/col}{/h2}\n{h2:c}{col:92ff5b}Falling so slow{/col}{/h2}\n{h2:c}{col:92ff5b}Like fragile, tiny shells{/col}{/h2}\n{h2:c}{col:92ff5b}Drifting in the foam{/col}{/h2}\n{h2:c}{col:92ff5b}Little soldier boy{/col}{/h2}\n{h2:c}{col:92ff5b}Come marching home{/col}{/h2}\n{h2:c}{col:92ff5b}Brave soldier boy{/col}{/h2}\n{h2:c}{col:92ff5b}Comes marching home{/col}{/h2}\n\n{img:Interface\\LFGFRAME\\LFGIcon-Love:256:256}\n\n{h2:c}{col:a3a3a3}”Turn from the gates of Hell only to stare into the abyss.{/col}{/h2}\n{h2:c}{col:a3a3a3}You’d welcome death if you could find a noose that fits.”{/col}{/h2}\n\n\n{h1:c}{col:ff00c5}Physical Description{/col}{/h1}\n    {col:fface3}Elia is a bit short, especially for a Sin’dorei, standing at 5’4”. Her diminutive form lends to the slight sheepishness she often seems to hold, as if bracing for something. Still, when around friends or those she’s comfortable with, she tends to be significantly more relaxed. When unengaged, her face is often impassive and her dim eyes observant. In conversations, she’s quick to smile, her eyes often growing noticeably brighter.\n\n     Her skin is a peach close to pink, a touch lighter than most Sin’dorei. While her skin is mostly without scars or blemishes, an observant eye would notice an array of faint scars across her right hand reminiscent of broken glass. However, it’s far from uncommon for her to sustain some sort of injury, whether it be obtained through her work as a freelancer, her own reckless behavior, or some combination of the two. She often keeps her long carrot-colored hair in either a ponytail or a braid, but on the rare occasion she lets her hair down, it reaches to just a few inches above her waist. Compared to other Sin’dorei, her eyes are strangely lightless rather than the luminescent gold or green of so many others. A spattering of light brown freckles cross her nose, dotting her cheeks. While slim, she isn’t quite muscular, though the tone in her arms and torso are quite apparent. \n\n     Elia tends to keep her clothing casual, often confused as to why someone would willingly wear armor if they weren’t expecting to need it. Similarly, she remains unarmed unless specifically doing something where she expects to need weaponry. As such, she keeps an extensive wardrobe, shying towards tops that expose her stomach and pants that conceal her legs. Still, it’s far from uncommon to see her in a dress, though she never wears one without wearing pants underneath, regardless of the length of the garment. Elia wears a silver chain around her neck that ends in a small oval emerald wrapped in silver, as well as two dangling emerald earrings.{/col} \n\n{h2:c}{col:92ff5b}It's harder to be yourself than it is to be anyone else.{/col}{/h2}\n\n{h1:c}{col:92ff5b}Personality{/col}{/h1}\n{col:92ff5b}While those who knew Elia when she first arrived to Orgrimmar met a bubbly, kind, and jubilant girl, her mask has fully crumbled away. Dropping her all-encompassing lively nature for good now. Elia remains a kind and warm woman, though decidedly more withdrawn than before. She’s quick to engage in a conversation, though much less frequently would seek such things out. While she continues to be an earnest friend always happy to lend a hand to help or shoulder to cry on, the ordeals of her last year have left her quick to let her mind wander to darker things, often resulting in a much more isolated girl than before.\n \n     To learn anything more than that, of course, one would have to approach her. That's how personalities work!{/col}\n\n{h1:c}{col:a3a3a3}Background{/col}{/h1}\n\n{h2:c}{col:a3a3a3}”No more shame, no more fear, no more dread.\"{/col}{/h2}\n\n{col:a3a3a3}Arriving in Orgrimmar a year ago, Elia desperately sought to begin anew and avoid the traumas she had faced over the last three years of her life. After nine months spent in Suramar filled with trials and tribulations that she failed to meet, she left everything she had behind and went to Orgrimmar on a whim, having never been to the city before. Determined not to fail as she had before, she brought nothing with her – including leaving her own name behind, adopting her middle name Sylvia instead.\n\nWithin the first few days of arriving in Orgrimmar, “Sylvia” had swiftly been welcomed by a large and friendly group, including the woman that would become her magic teacher and later her lover. Weaving a web of lies beneath those that had welcomed her like none had before, Elia worked in secret to fix an event that had haunted her past, constantly selling herself as someone else all the while. Eventually forced to pick between her new life full of loving and welcoming people or fixing her past, Elia ultimately abandoned her quest within days of the final moment, choosing to embrace her new life instead. \n\nLeft broken by the decision to abandon all that she had worked towards and the guilt of lying to those that had welcomed her, Elia once again planned to start over. Intending to leave Orgrimmar in silence and begin again elsewhere with a new name, she was talked out of such drastic measures by one who had influenced her decision to give up on her quest for good. Instead of attempting to start anew once more, Elia chose to confess to those that she had grown to love. Met once again with understanding and kindness, the girl chose to keep her new name while accepting who she had been, coming to terms with the traumas she had been forced to endure and looking forward to a better future for the first time in years. Answering now to either Elia or Sylvia, she does what she can to move closer to being a better version of herself.{/col}",
