				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-rogue-cover:256:256}\n\n{h3:c}{col:b6140d}Aralera Rosesong\n\n(Wip)\n-Physical Description-\n\nAralera Rosesong was a blonde headed elf with pure fel green eyes... Or corrupted fel green eyes depending on the person's views. The woman had a semi rounded face with a somewhat defined chin as it was a rather delicate combination of fat and bone. Her makeup sometimes present and other times not, usually being full on red lipstick along with some eyeliner. She was a pretty average elf when it came to these sort of things, maybe a little below average on height, but definitely making up for it with her figure. Ara wasn't slim but instead held a bit of weight to her, having a nice rounded chest and rump, but it was all neatly tucked away by her devious leathers. The dark skin tight apparel was obvious the go to for these leather types and she certainly didn't disappoint. Accompanied with her own personal belt that held just a little bit of everything - Vials, pouches, a few throwing knife holsters and even a scroll holder. On the back of her belt however was a book that was neatly locked in place above her rump, sealed with a little ribbon but it seemed very held together. If one got a view underneath her armor they'd see a few scars here and there, a cut or two in her stomach region while also having a slash on her right shoulder and lastly the one across her back. As for the piercings and tattoos there shockingly wasn't many as the only jewelry she had was a navel piercing and earrings. The tattoo she had was strategically placed and not many got to see... Wherever it was it was certainly a mystery!\n\n{/col}{/h3}\n\n\n\n\n{img:Interface\\Pictures\\artifactbook-rogue-kingslayers:512:256}\n\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n{col:0013ff}{h3:c}OOC Information\n\nHer appearance is subject to change. Some of the information above such as \" Blonde hair \" might apply to an earlier version of Aralera\n\nIf there is any errors in my profile please do tell me! I have a hard time seeing my own mistakes.\n\nVoice claim is Kerillian from Warhammer Vermintide 2!\n\nChild RPers are kind of avoided. Don't be offended if I don't associate myself with you.\n\nIC is IC and OOC is OOC, please learn these things!\n\nI don't care that you are LGBTQ friendly.\n\nVulpera should not be allowed in slutmog. Change my mind.\n\nIf you are a cart dweller ( SMC ) don't talk to me. You guys are rather toxic.\n\nDark themes are welcomed and appreciated. I like the darker things in RP!\n\nLong-terms are lovely whether it be friends, enemies, romance, or maybe even family!\n\nIf you have an RP idea that is a bit on the darker side, whisper me first! Depending on what it is we might have to resort to whisper RP!\n\nThis character is revived and is a WIP.{/h3}{/col}",
