			["about"] = {
				["v"] = 15,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "(This is Searastrasza's dragon form in-game!\nI have two profiles for her, just to keep things simple.  Her main \"this is where you'd find out more about her\" is in her humanoid profile!)\n\n\n{h3:c} Appearance {/h3}\n{col:ff2e2a}\n\nNow that you can see this hearty red dragon in her true form, she's actually quite large!  She rivals the size of a grown black dragon.  (Not Aspect huge, but still pretty big!)\n\nShe has bright golden-yellow eyes that seem to trail with a fiery glow, her horns and claws are ebony black.  Her scales look incredibly thick and hard to pierce!  On the contrary, her underbelly is soft and a shade of pink.  Her back is heavily armored in both \"plates\" and spikes, the spikes are jet black, the plates are a mixed colour between rose pink and vermillion red.  She has two \"tusks\" on the bottom of her chin like her kin.\n\nHer tail looks heavy with the bulb at the end of it!  Probably don't want to get hit by that.  She has frills that go down to her chest, and spikes on her elbows or heels.\nAnd of course, she has golden rings around her horns and tail-tip, before the bulb.\n\nHer scales are bright red, and shiny.  She's quite healthy, and one could argue that she's in the prime of her life.\n\n{/col}\n\n{h3} Other Notes  {/h3}\n\n- Searastrasza's roars can sound similar to the Obsidian Worldbreaker's noises!  (If she means for them to be loud and intimidating!)\n\n- I'll try to get a full body reference of her dragon form up soon..  once I find the motivation to do so xD\n\n- She's massive.  She is by no means a small or meek looking dragoness!\n\n",
				},
