						["TX"] = "Searastrasza's horns and claws are ebon black, and look quite capable of goring or shredding even the toughest of armor up in mere seconds.\n\nHer scales are *very* thick and vermillion red!  Her underbelly is soft and a shade of pink with frills leading down to about her chest.",
