						["TX"] = "Searastrasza's essence, when in her true form, can be nearly overwhelming at times.  She reeks of flames and life!\n\nDemon hunters, warlocks, and deathknights might be disturbed by such a strong force, as well as anyone else who dabbles with dark or undead magic.",
