			["about"] = {
				["T1"] = {
					["TX"] = "{link*https://gyazo.com/39407b543a1b3058535afbc04f0b873b*Mela, by Irishmoo!}\n\n{img:Interface\\Pictures\\artifactbook-demonhunter-cover:256:256}\n\n{h1}{col:ff1d3e}'Anger is a gift...'{/col}{/h1}\n\n{col:3c9d7e}This demon hunter is Melantharia Fireheart, a proud huntsmaster of the Illidari. \n\nIf one were to look over her body from top to bottom, one of the first things a person would notice are those signature horns of her's. They're not too long, considered to be a 'medium' length; they jut upwards from her skull and then begin to gently curl back.\n\nWhen lacking anything to cover her 'eyes' or mouth, it would be obvious that she lacked eyes at all; having been plucked out from the Illidari rituals, what remains were the signature burning sockets. As for her teeth, however, instead of what should have been healthy, normal looking teeth would be a row of razor sharp fangs; the kind typically found in the mouth of a felstalker. A mutation given to her by her demonic soul bind. \n\nHer demonic soul bind has made her black, and somewhat long hair become hard to manage. Before she was fortunate enough to find magical hair care products, often her hair would have a 'wild mane' look to it, despite any other previous methods she typically used; often she used to look like she had just woken up and rolled right out of bed.\n\nSometimes Melantharia has piercings on her left horn, usually three rings going from near the tip down towards the mid section. When she is wearing those piercings, her soft lips tend to be pierced as well with two rings on her bottom lip on the right. Always, however, aong her right ear, Melantharia has several piercings on the tip of her ear, her lobe and the entirety of her left ear remains bare. As for any other jewelery, nothing stands out minus a ring on her left ring finger. The ring is made out of a combination of saronite and felsteel. The gemstone carved to look like a sun bound in chains. Occasionally energy seemed to flicker within the gemstone. \n\nOften Illidari love to show off their tattoos, and sometimes Melantharia's tops can be revealing; if wearing such an outfit, anyone could see the runic tattoos that decorated her pale, athletic body.  These enchanted runes ran across her chest, around her C-cupped breasts and down her arms; they fueled her abilities to consume magic and helped her to resist any magical damage that might have slipped by in combat.\n\n\nIf her choice of gloves for the day were something fingerless, or if she decided to forgo the gloves entirely, her nails appeared to be un-naturally sharp and could easily cut flesh if she wasn't careful with them. Often she kept them looking pretty and painted however.\n\nFurther down, Melantharia wore leather leggings that hugged them tightly, helping to display how toned she was. As if she did -plently- of running. \nMelantharia is the eldest twin, of which both eventually trained to become Illidari.\n\nBefore becoming demon hunters the two would always be mixed up, however after their training and demon bindings the pair became easier to tell apart. They both have different runes across their body, and have different style horns and hair styles. However even with this Melanthaira has occasionally still been mistaken for her sister by those who know them both.\n{/col}\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-Demons:512:256}\n{h1:c}Possible Rp Hooks{/h1}\n\n{h2:c}{col:41dc3b}The Would Be Ranger{/h2}\n\n{col:41dc3b} Rangers older than Melantharia may know her! In her younger years, Melantharia had dreams of becoming a Farstrider, and often was around the enclave within what is now the Ghostlands.  She would have been known as a hard worker, and one who took the craft seriously. She had a love for animals and even learned to tame a Lynx.{/col}\n\n{h2:c}{col:61fff9}The Magister{/h2}\n{col:61fff9}Melantharia's mother wouldn't -dare- raise a 'bow jockey'. But, Melantharia had displayed quite the talent for magic. Sent away to Dalaran, Melantharia spent a good number of years working on her craft. Others who would have been in Dalaran years before the Third war may have met Melantharia, either as fellow students, or someone who lived in the city. \n\nDuring the Third War; Melantharia served in Kael'thas' army, doing her duty to the Alliance until the Sin'dorei were labed as traitors for working with the Naga. Anyone who also served may have met or known of Melantharia before she became Illidari{/col}\n\n{h3:r}{col:7586ff}Just a little less elven and a lot more bitter and cold {/col} {/h3}\n\n{h2:c}{col:ff2c3b}The Beast{/h2}{/col}\n{col:ff2c3b}Any Illidari could possibly know of Melantharia, but Mela wasn't one of the demon hunters locked away by the wardens. While she didn't have the honor of being sent to Mardum and being part of the team that found the keystone, Mela instead spent those ten long years on other worlds, fighting the legion wherever they could till they were needed on Azeroth. \n\n Those other Illidari that weren't locked away, may look at Mela as someone to keep their 'eyes' on, after an incident on a world known as 'Shakurus' there was a time where Mela was thought to be a traitor. She eventually was cleared, but the stain of that time still sticks with her. {/col}\n\nYou guys like themes, right? Have three.\n{link*https://www.youtube.com/watch?v=skNbS40KK0w&ab_channel=StabbingWestward-Topic*Theme 1: The Thing I Hate}\n{link*https://www.youtube.com/watch?v=J2-K6-ppZLo&ab_channel=DemonHunter*Theme 2: The Negative}\n{link*https://www.youtube.com/watch?v=IEBrRl30cUU&ab_channel=CombiChrist-Topic*Combat Theme: Never Surrender}\n\n\n\n\n\n\n\n\n\n{col:1b1b1b}/c/ First name basis{/col}",
