						["IC"] = "INV_Gizmo_SuperSapperCharge",
						["TX"] = "As the years passed and the war back on Draenor dragged on, Khagaan found herself pulled from her place at the assembly line and rapidly trained to fill out the ranks of Shock Regiments increasingly outfitted by the Mag'har as the number of skilled fighters decreased. The idea is a brutal one, if simple and effective. Massed infantry armed with standardized weapons and armor, thrown en-masse at enemy strong points, supported by tanks and artillery. Casualties in such assaults almost always ran high.",
