						["TX"] = "One of the few personal items Khagaan bothers carrying, is a small black and white photo. In it an Orc man stands proudly in workmans overalls, his hand resting upon the shoulder of a young Orc girl, smiling and holding a toy train. There are some words scribbled on the back in Orcish.",
