			["about"] = {
				["T1"] = {
					["TX"] = "{h3:c}{link*https://youtu.be/rJptK1NenY8*Theme}{/h3}\n{h3:c}{link*https://www.youtube.com/watch?v=bGgKdDCJx5o&t=326s*Sounds from Draenor}{/h3}\n\n{h2:c}\"You may not be interested in War, but War is interested in you.\"{/h2}\n\n{h3:c}I. Prelude{/h3}\n\nPosturing, demagoguery and political hostility, followed by skrimishes. That's how all wars begin really, with words. The age old clash of dialogue or rather lack thereof. The case of an unstoppable force coming into contact with an immovable object. This climate of open hostility is what many young Orcs came of age into, and would see them thrust into a conflict that shook the very foundations of the world they knew, and would bring out the best and the worst in a generation.\n\n{h3:c}II. Escalation{/h3}\n\nAt first the individual Clans reacted the way they always had, shoving back hard when pushed and meeting the aggression of the Draenei in turn, but it would become clear that things were different this time. It was not a matter of land or resources to the Lightbound, they wanted submission. Submission to the Exarch leading them. Submission to the faith they preached. Submission to the Naaru. After a time it was obvious that they would never accept no for an answer, and the scale of their attacks only increased along with their fanatical zeal.\n\n{h3:c}III. Retaliation{/h3}\n\nBy the second year of the War it had become clear that no one clan of Orcs could stem the tide of the Lightbounds fanaticism. Every where the Clans saw defeat, and their territory shrink in the face of a far greater enemy. Desperate action was needed, a council was called, and so for only the second time in the history of the Orcish race upon Draenor, the clans put aside their differences and united as one. They would fight as one People, one Nation, one Horde. With a Warchief chosen from among the greatest of the leaders, the Mag'har would soon send their adversaries reeling in the face of a united effort, as other races of Draenor fell in line, their own survival also at stake.\n\n{h3:c}IV. Devastation{/h3}\n\nDespite the determination and might of the Mag'har, the war did not end quickly, but dragged on for many long and bloody years. While the desire for victory united the Clans, the demands of the great conflict would require new technologies, new industries and new sacrifices. Every year saw the nature of the war change, along with how it was fought. Every new tactic and strategy met by a countermeasure of the enemy and vice versa. From the cratered battlegrounds where thousands would lose their lives, to the deep scars in the earth from which minerals were stripped, and the great Factory-Forges where weapons were churned out endlessly, Draenor was marred. Draenor was scarred. Draenor would burn.\n\nStill despite the Mag'har's efforts it was clear toward the end that they were losing the War. With ever increasing casualties and many of their number falling victim to the Lightbinding of the Naaru or joining the enemy willingly, things were grim. The Orcish race and most of their allies would find themselves cornered in a few scattered territories and teetering on the brink of collapse.\n\n\n{h3:c}V. The War is Not Over{/h3}\n\nWith total defeat seeming immenent, the Mag'har prepared themselves for the final battle on the ruined plains of Gorgrond. As the remaining hours ticked by, pure chance or perhaps fate would intervene. When the last confrontation began travellers from another world the Iron Horde had once made war upon came forth calling in old favors for aid. Rather than see his people annihilated upon the field of battle, Warchief Grommash Hellscream ordered the Mag'har to depart with the travellers, and with only his Honor Guard in tow charged the enemy lines in a delaying action. \n\nArriving on the New World, the Mag'har would quickly recover from the shock of losing their home and Warchief of so many years, making good account of themselves fighting in the conflict being waged by the Horde of Azeroth. In all of their minds however is the ever present threat of the Lightbound and the fate of those Orcs who had to be left behind in the retreat. The Mag'har would carry on the struggle, until, in the Ancestor's good time, this New World, with all its power and might, steps forth to the rescue and liberation of the Old.",
