			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Moonlight:512:128}{h1:c}{col:712247}About Character{/h1}\n{p:c}Link is one of two children born from their mother Crixxia, a vulpine witch who at a young age, took to leaving Vol'dun and raising her children away from the desert. Link grew up in the Eastern Kingdoms, raised mostly on human traditions and is highly unfamiliar with other vulpera cultures from Vol'dun. With her mother's influence, she attended a small magic school, mostly learning how to hex and summon, and so she is well talented in darker magic and always eager to learn more, despite many of the challenges she may face. The naive fox often gets herself into trouble, and therefore is also highly trained in the art of stealth, able to hide within the shadows when needed.\n\nAt just three years old, she lost her mother during a witch hunt, leaving her with nobody else to raise her but her older sister, Lilith; however, Link's curiosity would eventually lead her to leaving the secluded environment of her safe-haven and making her way into the world alone. She spent much of her time searching empty tombs, learning, watching. Trying to become better and be just like her mother and sister. Now, she has found a new life, traveled among Kalimdor and discovered the allied Vulpera with the horde. Here she has learned how to make new friends and allies, although.. her roots may never change. \n\nLink's vampirism is a recent infection of only a few months, turned with the aid of a San'layn master, she now has the same thirsts and cravings as any other Vampyr, she embraces and fully accepts the gift, even seeming somewhat proud of it.. The infection has caused various mutations within her body such as long pointy bat-like ears, a slightly more pointy nose, a long set of fangs,  and the ability to nagivate dark areas with ease.{/p} \n\n\n\n\n{h2:c}[Character Traits]{/h2}\n{p:c}•Very Naive and often in trouble\n\n•They are lustful, and wil tease\n\n•They can be rather arrogant\n\n•They have a long set of fangs, most visible when she smiles\n\n•They're  very skittish\n\n•They have tall bat-like ears\n\n•She always carries a spell book\n\n•They have vampiric thirst and desires{/p}\n\n\n\n\n{h2:c}[Character Weaknesses]{/h2}\n{p:c}•Link is extremely sensitive to the light, any spells cause her great discomfort or pain and light attacks have the potential to kill her.\n\n•The sunlight is an extreme weakness, due to her vampirism. She is often seen in hoods to for this reason.\n\n•Those who can control, or shackle undead can stop Link in her tracks easily.\n\n•Her ears are sensitive, a softer takedown method!{/p}\n\n\n\n\n\n\n\n{h3:c}[Extra Information]{/h3}\n{p:c}(TRP is a WIP still, thanks for reading! If you have any suggestions, feel free to whisper me! <3)\n(Any rudeness of my character is not OOC, don't take anything personal! I still love you. Character is mostly always friendly.){/p}\n",
