					["TX"] = "{h1:c}The Fall of a Kingdom{/h1}\n\nThe rise of a new land was built on the blood of the slain and forgotten. Cast down by their once prince now corrupted and mad. Many Knights of the Hand stood up to challenge his campaign of slaughter. One such knight was Sir Francis Skelton, forged in battle with the orcs who once sought to take his home. Now defending it against the prince he thought would join them. Thinking his faith strong, he was cut down like the rest. The exact details are blurry. Gnarled hands, a cold weapon, and a wretched grin. How many days did he spend in the darkness, a booming voice in his mind telling him to slaughter and kill all who still drew breath? When Francis finally regained control, there was only one person to follow. The only one to have a plan, Sylvanas. Using his newfound strength and powers granted to him in undeath, he carved a new bloody path serving the Banshee Queen. Making sure she alone ruled their once great nation. ",
