					["1"] = {
						["AC"] = true,
						["TI"] = "Observer",
						["IC"] = "spell_nzinsanity_dontlook",
						["TX"] = "Cold grey eyes always watch from afar, always observe their surroundings. Anzou's gaze is emotionless yet his eyes are wide and rarely seem to blink. The whites are always visible, sanpaku eyes of a disturbed vulpera.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Irrational",
						["IC"] = "spell_nzinsanity_panicattack",
						["TX"] = "Anzou's fears and beliefs often descend into pure paranoia. The few friendships and connections he has are strained. Lack of sleep is visible as his exhaustion clashes with a manic sort of energy. His flat dull voice can shift to the extremes of delight, fear, rage, and everything between.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Living Armour",
						["IC"] = "inv_axe_1h_nzothraid_d_01",
						["TX"] = "Writhing tendrils and gazing eyes, the living weapons carried by Anzou carry the corrupted power of N'zoth. Anzou's outfit seems a cobbled together mess of scavenged materials yet it too seems unnatural. Fleshy, organic, alive, such traits are not often used to describe fabrics and leathers.",
