						["TX"] = "Anzou carries a selection of daggers concealed within his clothing. These daggers are often coated in poisons. The scent of blood is strong around Anzou as his fur and weapons always seem to be coated from a fresh kill.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Bone Collector",
						["IC"] = "inv_misc_bonenecklace",
						["TX"] = "Anzou's necklace and accessories are made of bone. Many of the bones appear to be sethrak and vulpera in origin but among them are some very unnaturally warped bones dripping in blood.",
