			["link"] = {
				["Lustfox-WyrmrestAccord"] = 1,
			},
			["about"] = {
				["read"] = false,
				["BK"] = 5,
				["TE"] = 3,
				["T3"] = {
					["PH"] = {
						["IC"] = "ability_warrior_strengthofarms",
						["BK"] = 1,
						["TX"] = "Deformity",
					},
					["HI"] = {
						["IC"] = "inv_misc_book_12",
						["BK"] = 1,
						["TX"] = "Little is known of Anzou's childhood, or if that was even his birth name. Anzou has never been one to describe his past, often deflecting or responding in hostility. His pendant and accessories were all crafted from bone, a mix of sethrak and vulpera harvested fresh from the source. His scarred body holds the brandings of a slave, likely one that escaped and cut a bloody path to freedom. Anzou's past may be a lost period of time but his body tells this tale for him. It is a tale of suffering and survival. He was isolated and removed from the rest of his kind and preyed upon the sethrak and exiles for supplies and food. Anzou developed a reputation in that time as the one who wore the bones of his victims, the vulpera who would dare to engage in cannibalism. He was disinterested in friendships or joining caravans, preferring instead for a more individual nomadic experience. His temporary cave homes carry the blood paintings and bone sculptures he so enjoyed crafting. Decaying remains often lined the floor, organised in a way that almost seemed deliberate. \n\nThe Fourth War made its way to the sands of Vol'dun. As the hunter of Sethrak, Anzou aided the slave revolt unintentionally by prowling through the heart of Faithless territory. He would silently strike at sethrak he deemed worthy prey, which unintentionally aided the Horde's interests. Anzou would eventually be approached by Forsaken, which immediately caught his interest. His fascination with death only seemed to grow as he watched the sentient undead. The Voldunai had already allied themselves to the cause and it seemed they mistook Anzou as yet another slave or caravan guard. This mistake did not trouble the eccentric vulpera. He was all too pleased to aid the Horde as his task was simply to kill sethrak. Much to his own dismay, Anzou found himself forced to engage in socialisation with his fellow vulpera.\n\nA choice was to be made, a difficult choice that involved forcing himself to engage society. Anzou wished to spend more time with the Forsaken and observe how they chose to live. He wished to leave the sethrak infested misery of Vol'dun. Yet part of him feared the outside world. He did not enjoy conversation and he did not respect his fellow vulpera. In the end the decision presented itself with a sort of randomness, an impulsive desire that carried him from his desert trappings. He finally left Vol'dun but he found his habits too difficult to abandon. Anzou's talents were in the killing of others and in the harvesting of bones and organs. He was not a merchant or trader. He did not wish to be a guard. Mercenary work seemed worthless. All he wished was the continuation of his ritual. The Horde offered much for a killer. There was an abundance of enemies to hunt. \n\nAnzou was skilled as a tracker and could step unheard through the sands but he also practised a primitive form of shamanism that empowered his weapons. The Horde's farseers and shamans had taught him to take a new form, that of a mighty raptor spirit. Anzou seemed all too pleased to act the part of a vicious dinosaur. It fed into his bloodlust. He was growing accustomed to this form when he ventured to Uldum. Another desert and even more enemies to kill, yet he noticed Uldum was vastly superior to Vol'dun. The tol'vir were cultured and grew crops. They had grand magnificent structures and statues. They were a thriving people compared to the sethrak. And the enemies he observed were unlike any other. Faceless creatures and giant insects radiating shadow. These creatures resembled the tortured nightmares he endured through childhood. They resembled the very things he scrawled along cave walls so long ago. N'Zoth, that was the name of their creator. Anzou had long dreamed of these distorted aberrations and now he was to destroy them in the name of the Horde. He felt conflicted.\n\nThe carapace of the aqir was sturdy and impressive. Anzou took to crafting with the material. He also began to pillage and collect the void tainted weapons left by the cultists of N'Zoth. These treasures were valued and prized within his collection. He had always enjoyed finding relics and valuables among the sands of Vol'dun but nothing in that desert could compare to the magnificence of the organic pulsing weapons and armour of the Black Empire. In time, Anzou returned from Uldum with a sizable treasure hoard and a satisfaction of finally understanding his dreams and nightmares. His inability to relate and integrate into vulpera culture was a barrier that only worsened upon his return to Orgrimmar. His desire to revert to the old ways of his nomadic murderous life tempted him daily.",
