				["T2"] = {
					{
						["TX"] = "{h3}Appearance{/h3}\n\n•Born a Grimtotem, Tauros's fur as ebon as night and he is powerfully built, hulking and towering over many of his fellow soldiers of the Horde; made all the more impressive by his hammer he’d forged from the scraps the Kor’kron left in the Barrens.\n\n•Over many years of feuding with his bloodthirsty family in his quest for vengeance, Tauros has lost the use of his left eye, both his horns, and bears countless scars from his exile.\n\n•Like many bulls, Tauros has a thick gold ring in his septum, twin gold hoops in both ears, and golden rings through both his nipples. Held precious to him, a woven dreamcatcher hangs from a leather cord around his neck. He claims it is the Eye of Taronhe, his dear mentor who gave it to him. \n\n•His warpaint is an echo to his past. The red on top represents his unwavering loyalty to the Horde while the blue on bottom represents his birth as a Grimtotem of Stonetalon. (Blue appears to be evident on Grimtotem totems throughout the region.) He also bears a brand of the Horde on the outside of his upper right shoulder.\n\n•A bit vain, Tauros rarely covers himself fully, preferring to stand about with his physique on full display. When he catches someone staring, he is known to even flex with a wink and a smile. He is never shy about showing off and will do so at every chance he can.\n",
