			["time"] = 1631044588,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-demonhunter-cover:256:256}\n{h3:c}{col:ff00d6}Hi pretty lady! Hm? No, no. Sey only eats souls from meanies! No need for worries! Pretty lady seems very nice. Yes, yes!~{/col}{/h3}\n\nWhile this woman’s demonic features are her most prominent quality, smaller nuances about her can be noticed as well. The first of which is the necklace she wears. A fine silver chain hangs from her neck, which eventually leads down to a thicker section that intricately coils around a green jewel and cradles it within a silver cage. At times, this pointed gem glows with a brighter green light that drifts within the crystal with a mind of its own, though it often seems to “shut off” on its own for brief periods of time. Astute observers may also notice a cockroach that seems obsessed with following this woman, though that fascination is strictly one-sided, she doesn't appear to pay it much mind at all. How odd.\n\n{h3:c}{icon:ability_demonhunter_darkness:50}{/h3}\n{h2:c}{col:ff00f5}OOC{/col}{/h2}\nSeyliah is an oddity. Like most Illidari, she does have her dark qualities, but they're generally overshadowed by her bubbly disposition, surprising naivety, and eccentric speech. Always happy and approaching new people to make friends, this demon huntress is always trying to spread smiles. She will absolutely melt at head pats, pets, and general stroking of her hair. Be warned!~\n\nThis player is 21+, if that matters to you, and has a decade of RP experience, if that also matters to you. I adore most dark, horror, and mature themes, despite the cheery surface of the character. Light-hearted interactions are great too, I like most things. One thing I love, is lengthy and detailed emotes. Please hit me with those! The one thing I prefer to avoid is ERP. Flirting is fine, romance is fine, but I'd rather not do the sex thing, thanks. I'm totally down to make friends with contacts, but I mostly stick to PvP when it comes to WoW, so I may be someone who you mostly just talk to rather than do PvE things with. FFXIV is my main game for that, for a very good reason. ^^;\n",
