			["about"] = {
				["T2"] = {
					{
						["TX"] = "\n{h1:c}Marsulu Goldmane{/h1}\n{h3:c}{col:fff3d9}Master Sergeant of the 47th || Journeyman Blacksmith || Amateur Inventor{/col}{/h3}\n{img:Interface\\PETBATTLES\\Weather-Blizzard:400:2}\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-BlackrockFoundrySlagworks:256:128}",
						["BK"] = 4,
						["IC"] = "achievement_pvp_a_05",
					}, -- [1]
					{
						["TX"] = "\n{h2:c}You May Know Her{/h2}\n{img:Interface\\PETBATTLES\\Weather-Blizzard:400:2}\n{col:fff3d9}- If you served in the Argent Crusade during the Invasion of Northrend.\n- If you live in Stormwind and frequent the Dwarven District or Old Town.\n- If you are a member of the Alliance Infantry.\n- If you are a blacksmith or engineer who frequents Ironforge or Stormwind.\n- If you frequent the Brawler's Guild in Stormwind.{/col}",
						["BK"] = 4,
						["IC"] = "icon_treasuremap",
					}, -- [2]
					{
						["TX"] = "\n{h2:c}Appearance{/h2}\n{img:Interface\\PETBATTLES\\Weather-Blizzard:400:2}\n{col:fff3d9}In either form Marsulu measures at 4'11, keeping herself in remarkably good shape through constant work in the forges, a healthy diet, and a strict workout regiment. Most if not all of her armor, weapons, and equipment are made by her own hand. While she can shift between forms, she is mostly in her worgen form due to the increased strength and stamina for smithing.{/col}\n\n{col:ffbc00}Worgen Form{/col} - {col:fff3d9}White curly fur covers her body, with the occasional flake of ash and soot lingering between the hairs. A large faded scar stretches across her blinded right eye which is milky white in color. Her left eye has a cainine iris and is colored a deep vibrant blue.{/col}\n\n{col:ffbc00}Human Form{/col} - {col:fff3d9}In her human form Marsulu has a fair complextion. Through constant work in the forge her body is toned and muscled, with a physique that is better than most. Her hair, a golden blonde in color is neatly cut to shoullder length. A faded scar runs across her blinded right eye which is milky white in color. Her left eye is a deep vibrant blue. Usually she has some soot or ash on her clothes or skin from her time working in the forges.{/col}\n",
						["BK"] = 4,
						["IC"] = "trade_archaeology_highbornesoulmirror",
					}, -- [3]
					{
						["TX"] = "\n{h2:c}Areas of Expertise{/h2}\n{img:Interface\\PETBATTLES\\Weather-Blizzard:400:2}\n{col:fff3d9}Over the course of two decades working with the Alliance Mlitary, the Argent Crusade, freelancing, and apprenticing under several master crafters, Marsulu has accruded a fair amount experience in several fields of engineering, mathematics, and smithing. Currently she has has yet to try and achieve a masters qualification. She has official qualifications in the following fields:{/col}\n\n- Journeyman. {col:fff3d9}Armorsmithing{/col}\n- Journeyman. {col:fff3d9}Engineering (Classical Mechanics){/col}\n- Journeyman. {col:fff3d9}Engineering (Magnetism){/col}\n- Journeyman. {col:fff3d9}Mathematics (Geometry){/col}\n- Journeyman. {col:fff3d9}Mathematics (Analysis){/col}\n- Journeyman. {col:fff3d9}Metalurgy{/col}\n- Journeyman. {col:fff3d9}Weaponsmithing{/col}\n- Apprentice. {col:fff3d9}Enchanting (Motion Control){/col}\n\n",
						["BK"] = 4,
						["IC"] = "inv_engineering_90_math",
					}, -- [4]
					{
						["TX"] = "\n{h2:c}Current Equipment{/h2}\n{img:Interface\\PETBATTLES\\Weather-Blizzard:400:2}\n{col:fff3d9}Below is a list of the equipment Mars has while in the field. All of the weapons are equipped with various ehancements that allow her to manipulate, move, and attack with them at range. All non-standard equipment has been approved for field use.{/col}\n\n{icon:inv_misc_2h_farmscythe_a_01:20} - The Symphony - {col:fff3d9}Argent Dawn scythe designed for decapitations and Mars' main weapon of choice. Special exception made for use in the field.{/col}\n \n{icon:inv_chest_icons_cloth_warfrontsalliance_d_01:20} - Standard Issue Stormwind Infrantry Armor - {col:fff3d9}Material composition provides damage resistance and full range of motion without sacrificing integrity.{/col}\n\n{icon:inv_misc_steelweaponchain:20} - Chains of Control - {col:fff3d9}Blessed silver chains that are wrapped around both of Mars' forearms. The chains work in conjuction with her weapons, allowing her to control the weapons as they move through the air. Considered to be part of the Symphony for field use purposes.{/col}",
						["BK"] = 4,
						["IC"] = "trade_blacksmithing",
					}, -- [5]
					{
						["TX"] = "\n{h2:c}Military History{/h2}\n{img:Interface\\PETBATTLES\\Weather-Blizzard:400:2}\n{col:fff3d9}{h3}Military Status{/h3}\nRank on Record - {col:fff3d9}Master Sergeant (MSG){/col}\nDuty Status - {col:fff3d9}Active{/col}\n{col:fff3d9}{h3}Promotion History{/h3}{/col}\nSergeant ->  Master Sergeant {col:fff3d9}(04/03/628){/col}\nCorporal ->  Sergeant {col:fff3d9}(01/23/628){/col}\nPrivate ->  Corporal {col:fff3d9}(09/26/627){/col}\nRecruit ->  Private {col:fff3d9}(08/15/627){/col}\n{col:fff3d9}{h3}Awards{/h3}{/col}\nDistinguished Service Cross - {col:fff3d9}(01/23/628){/col}\nKing's Cross - {col:fff3d9}(09/26/627){/col}\nKing Anduin Coronation Medal - {col:fff3d9}(08/15/627){/col}\nRoyal Unit Citation - {col:fff3d9}(05/01/628){/col}\nDistinguished Service Unit Citation - {col:fff3d9}(08/29/627){/col}",
						["BK"] = 4,
						["IC"] = "ui_alliance_7legionmedal",
					}, -- [6]
					{
						["TX"] = "\n{h2:c}Topics/Prompts to Talk About{/h2}\n{img:Interface\\PETBATTLES\\Weather-Blizzard:400:2}\n{col:fff3d9}- Anything engineering or blacksmithing related\n- Radical/Unorthodox ideas\n- Anything wierd that one may have come across\n- Battle strategies and war theory\n- Dueling and personal fighting strategies\n- Interesting places around Azeroth\n- Food and recipies{/col}",
						["BK"] = 4,
						["IC"] = "achievement_guildperk_everybodysfriend",
