			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Fel-Afflicted",
						["IC"] = "inv_lightforgedmatrixability_felheartofargus",
						["TX"] = "An unsightly but necessary result for survival in the Twisting Nether after so many years. His spells are Fel-augmented.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Dragonsworn Oathstone",
						["IC"] = "inv_jewelcrafting_necklace2_blue",
						["TX"] = "A sapphire oathstone hangs around his neck from a sterling silver chain, held in place by a socket in the shape of a dragon's talons.",
					},
					["2"] = {
						["AC"] = true,
