				["v"] = 19,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "“Salvation comes with a cost. Judge me not by my methods, but by what I seek to accomplish.”\n\nHistory:\n\nFormerly known as Prince Valron Silverblood, the Sorcerer-Prince, and better known as in his much younger years as, Prince of Llothien.\nValron, very much like Meitre and Archmage Tarsis Kir-Moldir was one of the few surviving Highborne & one of the most prestigious sorcereres of Ancient Kalimdor.\n\nValron has always been ambitious & was born a prodigy of the Arcane Arts. To understand the vast extent of magic, Valron often excluded himself from the politics of Kaldorei & Highborne society in favor of his studies, so much so that it led him to seek out the tutelage of the Blue Dragonflight proper. \n\nDuring his long excursions from Kaldorei society, Valron went through rigorous training sessions of spellweaving and studying leylines. By the time his tutelage was complete, he became one of the first Leywalkers and a Dragonsworn of the Blue Dragonflight as a result.\n\nAfter rejoining Kaldorei civilization, Valron was approached & inducted into the Moonguard, where he would futher develop and hone his skills as a Spell-Fencer & Spellbreaker for years leading up the first invasions on the Legion.\n\nIt was thought that Valron had been slain during the War of the Ancients or was dragged to the bottom of the Well of Eternity during the Sundering but it seems now with his re-emergence, he has indeed survived the chaos and simply disappeared into quiet seclusion after the the War of the Ancients.\n\nIn the aftermath he has utilized his amassed knowledge of the Arcane & has since traveled through time & across the Twisting Nether in search for powerful artifacts, relics & exotic magics. In his travels, he's made deals with a host of evil & villainy so wretched...all for the sake of creating the Highborne anew & redeem his once noble people.\n\nRecent History:\n\nValron returns to Azeroth as an elusive, secretive, and well informed de facto leader of the Empyrean Syndicate. \n\nValron's name and his life before Empyrean are both long forgotten by most. For years, Valron has been using sorcerey and his immense network of contacts to achieve his goal - that of making Azerothians ascendant above all other races in the cosmos. He has often been described as having the best and worst traits of elves rolled into one man.\n\nApperance:\n\nValron has a rugged yet youthful appearance about him dispite his true age. He is tall, dark & handsome by elven standards and sports a short black beard and medium length hair. \n\nUnderneath his enchanted blindfold are a pair of eyes, one gold and the other silver. Upon further inspection, you might notice the palms of both his hands have runes seemingly craved into them. If ever seen uncovered by his garb, one would discover a litany of the infernal scarification of runes littering his flesh.\n\nHis complexion is on the fairer side, almost oilve. He could easily be mistaken for a very tall Quel'dorei..and strangely enough he seems to appear to be a midway point between a Night elf and High elf after the exiled Highborne left on their voyage.\n\nPersonality: Sarcasim, Dry humor and Elven arroganace, with as dash of compassion.\n\n",
				},
