					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-HighmountainTauren:512:256}\n\n{icon:inv_chest_cloth_21:25}Frayed, stained, and patchy robes.  At least the bottem half since her top is mostly just a...small poncho...?  Stained with years of working with plants.  Lined with pouches around her waist, each one stuffed to the brim with flowers, roots, leaves, even one with a few mushrooms.  Another small bag slung over her neck and hanging at her waist.  Looks (and sounds) like this one's mostly supplies. (whisper for info for those taking a peek)\n\n{icon:inv_staff_01:25}Her...weapon?  Of choice is just a staff.  Nothing fancy.  Topped with a small crescent moon.  The other end of the staff seems to be caked in years of travel and adventure!  Not gross.  But it's def dirty.\n\n{icon:inv_inscription_warpaint_red:25}Faded and smeared Grimtotem face and body paint.  Trailing down her arms and across her face.  Friend.  Or Foe...?  Probably safer to be a friend since there's no profit from the dead.  Unless...they got raised as death knights.  Or forsaken.  Running along her right cheek, is a scar.  From the edge of her lips and reaching back just a few inches.\n\n--if you wanna attack her or whatever for being a grimcow...that's fine, just don't kill or completely maim the flowergal--\n\n---all magic and mounts and pets are OOC---",
				},
				["BK"] = 1,
				["TE"] = 1,
				["v"] = 7,
			},
		},
