			["about"] = {
				["v"] = 32,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}FENEK{/h2}\n {col:41ffea} - This young vulpera sports fur the color of sand blending into cream and coffee. He typically offers a friendly, fanged grin as sparkling, crystal-blue eyes peer up at you with bright curiosity and kindness, usually from under the rim of a rather adorable, Pandaren style coolie hat.{/col}\n\n  {col:27ffc3}  -  His circular coolie, made of bands of dark bamboo with a pawprint emblem on the front, also features two notched holes that allow his ears to perk out unhindered, and perk out they do!  Each remarkably large foxen ear is tipped in jet black as if someone had held him upside-down and dipped him into an inkwell.{/col}  \n \n  {col:3ed3ff} -  Fenek appears to be barely into his adult years and usually has an earnest, cheerful air about him, like a part of his kithood he never left behind. He seems quite fit and athletic compared to most Vulpera, built for speed and agiltiy, not raw power. {/col} \n  \n {col:2ea2ff}-   The monk is outfitted in a rather snazzy looking coat of sea-green dyed  leather with black inlays, custom fit and enchanted for his needs. The coat drops to mid-theigh and compliments a pair of well-fitted, blue-black pants. A hard, leather chestplate and gaunlets protect his core and his fists.{/col}\n\n{col:1e96ff}-   Around his waist is a thick, earth-toned, woven cord belt, tied in front in a neat, obi knot and protected by a shining blue belt-'coin' that houses a custom locking mechanism. The mechanism allows him to lock a pair of deadly looking, enchanted fighting claws to his gauntlets or stow back on his belt for travel. All in all, this fox appears kind, gentle and, if need be, well equipped to defend hmself.{/col}\n\n{link*https://imgur.com/a/vBYVqpI*Fenek Art Gallery}\n\n\n\n\n\n{h2:c}FENEK'S TALE{/h2}\n{h3:c}The Light of the Isle{/h3}\n\n{col:50dac5}Fenek's tale begins in a whirling storm, tossing a lone ship in a violent sea. \n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-ShrineoftheStorm:256:128}\n {col:50dac5}Despite the experience of her pirate crew; the ship, and her precious cargo of slaves would not escape Neptulon's rage this night.  The vessel was heaved in the roaring void and dashed against unseen rocks, shattering into a thousand pieces like glass.  \n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-EyeofAzshara:256:128}\n  {col:50dac5} Clinging to some debris, a new Vulpera mother placed a tiny kit onto the most stable bit of flotsam she could find and clung tightly to it to weather the storm for as long as she could hold on...  \n\n  Hours passed that seemed like days as the sea rolled and plunged endlessly in the black, stormy night.   \n\nWhen dawn's light finally broke all that was left of the ship was a tangle of broken wood and a bundle of cloth bearing a cold, crying vulpera kit. Against all odds it had washed up on a forgotton isle, soon to be found by an unlikely new family...  {/col}\n\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-UngaIngoo:256:128}",
				},
			},
