			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "inv_misc_tournaments_symbol_tauren",
						["BK"] = 1,
						["TX"] = "Theira is tall and built, she looks fit and strong.  Curvaceous with a long and flowing mane.  Her coat a dusty color, a mixture of greys, light browns and creams.  She has some spots that are found about it in random places.  Her eyes are a bright golden yellow.  Her horns are ivory white, long and overgrown in a omega shape.  If she isn't dressed in Rutilus Luna standard uniform she is dressed in traditional Shu'halo and tribal garb.\n\n{link*https://www.deviantart.com/jazziks/art/Miss-T-Oaksong-857746422*Theira Art -  there is more on my deviant art account!}\n",
					},
					["PS"] = {
						["IC"] = "inv_misc_tournaments_symbol_tauren",
						["BK"] = 1,
						["TX"] = "Theira Oaksong is a warm and friendly individual who's alignments might run along lawful good.  She is a old and wise tauren with many wars and seasons under her belt.  She protects those she loves and serves.  She can be rather cold and calulating towards those she does not much care for.  She treats everyone with a polite and basic respect, anything further however must be earned.  She can be very stern and stubborn, hard headedness and dominate are traits often said about this cow.",
					},
					["HI"] = {
						["IC"] = "inv_misc_tournaments_symbol_tauren",
						["BK"] = 1,
						["TX"] = "Theira was born in the Desolace to a nomadic tribe that migrated to Mulgore around the time the orcs landed on Kalimdors shores.  She was but a child much like Baine Bloodhoof was at that time.  \n\nFinding she had an affinity with nature, she practiced druidism in Elders Rise under her mentor for several years.\n\nShe roamed the wilds as a wandering druid, before running into an unlikely encounter. Love at first sight.  She found herself coming to the aid of a Shu'halo berzerker by the name of Rannoc.  \n\nShe and Rannoc had a son, they joined the ranks of Rutilus Luna founded by a good friend.  Things were good for a time until the dark days happened.\n\nThe Wrath Gate took Theira's mate and friend the founder of the agency.  The Wilds claimed their son and Theira was widowed and alone.\n\nShe took up leadership of the Luna for her friend.  Opening the way to the agency hiring Horde from all walks of life - multiple talents across the board to best serve the Horde. \n\nIn a new chapter and dawn for the agency Theira has a new partner in a Sunwalker named Tarkus and a daughter. - (WIP)",
					},
				},
