						["TX"] = "Not wealthy or poor, self-suficient through travels. Could be considered nomadic or a wanderer. \n\nThrough travels, has the scents of forests and earthy rocky areas around him. \nHas a very elemental scent to him and his armor/clothing.\n-----------------------\nWill travel to cities or towns to take short breaks to res. Will be most likely asleep opon Firefury\n.\nOn rare occasions will he stay the night at an inn",
