			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Mud:512:128} {h1:c} {col:ff0000} At a glance {/col} {/h1}\n\n{h2:c}  {col:ffee65}   Appearance: {/col} {/h2}\nA strange looking \"Elf\" with long scruffy hair full of braids, dreadlocks, decorative beads woven into string wrapped dreadlocks.  Accompanying his long hair is a full beard also decorated with golden beads on short braids. \nWears a few heavy cloaks, the outer most wrapped around himself and front side. The outer cloak has several curved tusks with plating hammered upon them taken from beasts of Dreanor. Other shamanic decorations hang from the tusks that jingle with movement. \n\nUpon a closer look???\n\nThis \"Elf\" only has four clawed fingers  unlike normal elfs, along with clawed feet with two 'toes' being larger than the other two for grasping objects.  He has Fiery orange eyes with iris long simiar to a cats. (fire horns are more OOC but neededfor the eye effect) {/col}\n\n{h3:c} {link*https://i.imgur.com/zy1Jm5o.jpg*Champs Online pic}\n{link*https://imgur.com/a/b3pgneU*Newer Pic}\n{link*https://imgur.com/TgDMuRR*Pic of Nel}\n{link*https://imgur.com/VtQoTXl*Older Pic} \n\n{link*https://imgur.com/jAAPLIN*A Pic of Vigos}\n{link*https://imgur.com/dhhLEpk*Sec Pic of Vigos} {/h3}{h3:c} \n{col:ff5615}  More RP places:\n   {/col}\n{link*http://two-black-leviathans.tumblr.com/*Tumblr Page}\n{link*http://twitter.com/Neltharion999*Twitter Page}\n\n {/h3}\n{img:Interface\\PETBATTLES\\Weather-BurntEarth:512:128} {h1:c}  {col:ffee65}   Personality & behavior  {/col} {/h1}\nQuiet, soft spoken, but can seldomly be mischevious. Tends to love history to finding interest in new things such as technology or discoveries in general. Geology and jewelcrafting are side hobbies of his to make a living\n\n{h2:c} {col:ff5615} Misc Traits/behaviors: {/col} {/h2}\n\n {col:f3c300}   (Agile & swift. Strong)   (Chaotic & Spontaneous)  (Perceptive & Knowledgeable)   (Arbitrary)   (Introverted & Quiet)   (Kind & Modest)   (Opportunistic)   (Pessimistic & Moody)   (Stubborn & persistent)    (Adaptable & Creative)   (Cunning & Calculating)    (Intelligent & Intuitive) (Reckless & Restless) (Witty & Sarcastic) (Thoughtful) (Anxious & Worried) {/col}\n\n{img:Interface\\PETBATTLES\\Weather-Sandstorm:512:128}",
