				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\LFGIcon-TheNighthold-ArcingAqueducts:256:256}\n{h1:c}Background{/h1}\n{p:c}Once a happy citizen of Suramar. During the legion invasion of Suramar, he found himself fighting with the resistance hoping to make a change. Unfortunately, he had gotten into more trouble than he could handle while assisting a mother and her child get to safety. He thought all was well, as long as he could protect his people during his final moments. Then it happened: he was struck down by a demon's axe. As time passed, he suddenly felt something. To his surprise, he was alive and standing, but he didn’t know where. As he looked around he saw what looked to be knights in full armor. After being drawn to the Lich King, he was told what lied ahead.  {/p}\n\n{h2:c}In Life Once More{/h2}\n{p:c}With his new life and lack of memories, he set out to protect his people’s new home amongst the Horde. His life in undeath, unfortunately, brought him into the battle at Darkshore. During this time, he had to learn how to combat his hunger and rage. There was a struggle, but he managed to get in under control through the battle’s end. With his free time, he had decided to educate himself on the world beyond Suramar, both with reading and first-hand experience. By the time the war ended, he had become as knowledgeable as any other Nightborne was. However, with less required of him in times of peace between the Alliance and Horde, a decision was made to take up smithing.\n\n{/p}\n\n{h2:c}Physical Description{/h2}\n{p:c}The tattos on his tattoos glow an icy white and some runes can be seen among them. His face is on average for his people yet carries a few noticeable scars, the largest of which is a faint slash mark across his left eye. His face’s remaining scars make it seem as if he had some near misses with arrows and other projectiles. His body is currently semi muscular. The scars on his body followed along with his face’s wounds. The worst of his scars lays on his lower back to the right of his spine. Looking at it would lead you to think a pillar had shot through him, yet only a scar on where it entered was visible. Further, his lack of a proper left hand may grab your eyes’ attention when his gauntlets are off.Though dead there is no visible decay for  he some how preserve himself with his dying breath. \n\n\n{/p}\n\n\n\n\n{p:c}Has aproximate knoledge of many things{/p}",
