					["TX"] = "\n\n{h2:c}{col:ba0006}Thrator{/col}{/h2}\n{h1:c}{col:ba0006}The Crimson King{/col}{/h1}\n\n\n\n\n{col:ffbc27}\"He’s a walking menace… an abomination... an indomitable, unnatural, mutant being… to be an instrument of destruction for the true lords of the macrocosm… it is the only explanation…\"{/col}\n\n{col:ffbc27}\"If you're always worried about crushing the ants beneath you... you won't be able to walk.\"{/col}\n\n{col:ffbc27}\"The reward for ambition too great... is self destruction.\"{/col}\n\n\n\n{img:Interface\\Pictures\\artifactbook-warrior-cover:256:256}\n\n\n\n{h3:c}{col:ba0006}The Iron Titan{/col}{/h3}\n\n\n{col:ffbc27}Each of his colossal footfalls threaten to erode the earth beneath them. A being of great mass, Thrator has no care for what obstacles lie in his way. Ebon plate as dark as the void clings to his immense form, grass green skin invisible beneath dark chainmail and iron armor. Shoulders as broad as the mouth of Menethil Harbor carry round shoulder-plates adorned with ebon spikes that threaten to puncture the clouds, and beneath them iron mitts that protect the Orc's gargantuan palms. At his helm, iron spikes vertically align at the center of his head just above a burning red visage of which is horizontal at the top and vertical at the center, all the way down to the bottom of his iron bucket. The red mist that emanates from his form threatens to brand the souls of those who dare mirror his gaze. A dark shroud hides most of his black armor, covering all of his back and curving around at the front. The cloak often brushes away at the ground behind his stride, leaving only a faint breeze where one of death's harbingers walked. {/col}\n\n\n\n{h3:c}{col:ba0006}Truth, Blade of the Red Star {/col}{/h3}\n\n\n{col:ffbc27}At his back, hiding beneath his pitch black shroud, a cursed, lightless, harrowing instrument of death would find it's resting place. Once a sword and shield for a warrior of the stars, whose strength was absolute but inferior to his grace's, it's steel had been broken and reforged many times. Repurposed now for a great warrior who rained down the hounds of hell upon those who opposed him, the weapon held dominion over all the beasts and atrocities it's masters had wrought. It's name, Truth, bestowed upon it due to it's ability to create new truth's in which it's master survived. The ability to slay is something powerful... the pathway to something many fail to understand.{/col}\n\n\n{h3:c}{col:ba0006} Iron Lord of the North {/col}{/h3}\n\n\n{col:ffbc27} Thrator is all but friendly. He wants nothing but to achieve his goals, and does not have time for idle conversation. You will likely never see him inside the city walls of either faction, having completely departed from the faction war after the burning of Teldrassil and the attack on Lordaeron, and subequently Sylvanas' betrayal. If your character wishes to interact with him, do not expect it to be anywhere busy. Thrator is a goal-driven, hate-filled, seen-it-all, unhinged Master of Arms with his own agenda that he intends on following.\n\n \n{h3:c}{col:ba0006} OOC Information {/col}{/h3}\n\n {link*https://imgur.com/gallery/BEojwNa*Art by @catbatart on Twitter}\n{link*https://imgur.com/a/2KKgt7q*Art by @epistafy1 on Twitter}\n\nIf you have any questions, are interested in this character's storytelling, or have any inquires about him whatsoever, do not be afraid to whisper! \n\nThrator may not like you, but I promise I do! \n\nDon't expect me to RP Thrator very much in game. Hundreds of pages of storytelling through Google docs and whatnot have made this character one of my most prized posessions. I do not want to force him on anyone, and while he is powerful, he does not break lore in any form or fashion. I pride myself on my ability to stay obedient to the main continuity of the game and I don't assume that my character could compete with any of the major powers in the game's story at all. \n\nP.S. No, Thrator doesn't want to stick his meat in you. Ever.\n\n\n\n\n\n\n\n",
				},
