					},
					["HI"] = {
						["TX"] = "(Heavily sumarized for brevity's sake)\n\nBorn in Mulgore like most Tauren, on a remote, and now gone, fishing village far to the south. Loved and cared for by a humble family, she had a peaceful and normal early childhood, but this was not meant to last.\n\nKidnapped as a young calf by Kul'tiran sailors before she could even make memories of her home and family. Taruah was raised at on a warship as a deckhand.\n\n\nStripped of her birthname and far from home, she grew up ignorant of her heritage and the history of her people. Knowing only the sea, and the customs of Kul'tiras.\n\nHumans sure found the extra muscle of a young tauren useful for moving cargo, weapons and munitions around the ship; but later on they found a better use for her natural strength.\n\nNow a young adult, she was given a greatsword and plate armor, then was properly trained in combat, and taught about the holy light to complement her strength; eventually becoming a Paladin for the Kul'tiran armada. Gaining the title: \n\n\"The Lightweilder Brute of the Sea\"\n\nBut even then she remained but a tool.\n\nIt would take years for Taruah to have her first encounter with The Horde.\n\nOne cold night, far from land, her warship engaged in combat with 3 Horde vessels. The Kul'tiran ship was no match for their superior numbers and firepower; and was captured. On those ships she met other Tauren for the first time in her life. who told her stories of Mulgore and their proud people. \n\nNow returned to her homeland, she has a tough time adjusting to Orgrimmar and the people of the Horde.\n\nEver since she was a calf, all she knew was the sea, the humans, Kul'tiras... what will she do now? In a desert, surrounded by orcs and trolls. Her people might welcome her, but the rift between them is great.\n\nPerhaps too great.",
