			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}\n\n{h1:c}{col:ff3627}\"Good isn't something you are, it's something you do.\"{/col}{/h1}\n\n{h1:c}Physical Description{/h1}\nWhat stands before you is one of the Sin'dorei with fiery glowing golden yellow eyes and a calm placid façade from afar. For her race, Nandrea is considered of average height and beauty. Though of course, to the more mundane races her beauty might be overwhelming. Long elven ears perk almost straight up from her raven-black hair which falls to her shoulders in a simple curled appearance, If touched her hair feels slightly silky which suggests she takes good care of it. Her face is normally makeup free while her features are smooth and angular which flows with her hair. Her ears were also unpierced. She can often give off a very cold look when she wishes to simply because of how her face is constructed, But her disposition seems to be quite the opposite at times. No piercings are noted on her face and she kept it clean, most of the time. She also has a very small scar that ran vertically along her left cheek, the sign of a very close call in the past. And along her neck was a necklace with a golden cylinder and a glowing arcane crystal on the end of it, obviously of sentimental value to the Farstrider. \n\n\nHer body was slightly curvy and toned, fit muscle, while not lacking for agility, with tapered hips that flared out slightly and she had a decently ample bosom, for a blood elf at the very least to give her a bit of a toned figure that was close to an hourglass shape, while retaining the litheness that was the norm for blood elven women. Her legs were toned as well, suggesting she was quite a fast runner, while also sporting a slight thigh gap. And when seen out of her armor, Nandrea's body is adorned with dark tiger stripe pattern tattoos colored a deep rich crimson color, the tattoos wrapped around the entirety of her forearms, along the sides of her torso, her thighs and calves. The elf also had a massive tattoo of a phoenix that spanned the majority of her back, set in the center with it's majestic wings spread far and wide over her shoulderblades and the feathered tips barely curving over the shoulders while burning feathers and arcane stars fall from the majestic bird, a symbol of the sin'dorei indomitable spirit and tendency to rise anew from the lowest points in their life, and the reason Nandrea got this elaborate, brilliantly detailed and enchanted tattoo was no different. On Nandrea's left shoulder she also had the symbol of the Night Fae covenant inked into her shoulder with brilliant blue shimmering and glowing ink that was often used in Ardenweald as the ink branched down her bicep in large lines like roots from a seed planted by the covenant's symbol that that stopped at her elbow almost like an armlet, obviously this tattoo was meant to show her loyalty to the Night Fae and the Winter Queen after proving herself, reserving her own place in the afterlife should she ever fall. Even with all this ink adorn the elf's body they do little to hide the different kinds of scars that dot some of her sun-kissed body, mostly blade and claw marks on her arms, legs, and the one on her face.\n\n\n\n\n{h1:c}Weapons and Equipment{/h1}\n\n{icon:INV_Chest_Mail_RaidHunterMythic_Q_01:25} - Ranger's Chain: A suit of thorium scalemail armor, Nandrea is usually seen wearing this when out and about. The armor is styled in an elven fashion given a rich white, black and teal color scheme, the armor was clearly built for a veteran marksman who had a preference for mobility, protection and style all rolled into one package. Under the armor itself would be knothide leather padding that hugged closely against her figure while not being too constricting. Set into the shoulders, gloves, thigh plates and her boots would be glowing yellow gems containing swirls of magical energy, Obviously to keep with the sin'dorei's reputation for magical aesthetics in much of what they craft. The cloak is made of mageweave cloth dyed with a mix of black and white, with gold trims and twin emeralds engraved into the top and bottom bits of the cloak, giving Nandrea a somewhat regal appearance that was the norm for Sin'dorei. And typically, Nandrea would wear the Sunreaver tabard or the tabard of the order she serves. And more often than not, she'd have a hood raised over her head but it did little to hide the glow of her eyes, nor that scar on her face or her raven-black hair.\n\n\n{icon:INV_Bow_1h_ArtifactWindrunner_D_06:25} - {col:ff4000}Taran'vas, Wrath of the Thalassian Warden{/col}: An intricate bow infused with magical energies from Life, Fire and the Arcane, Taran'vas is indeed a weapon worthy of a Farstrider. The bow was wrapped in vines with flowers that often bloomed and closed up.  Often paired with an quiver slung across Nandrea's back. Itched into the 'wings' of the bow close to the openning where Nandrea fires her arrows through the vines that are wrapped around it, at the left wing would be, for those who can translate thalassian: 'No Sacrifice', and on the other wing 'No Victory'. Judging from it's age, the bow was recently created for Nandrea by the bowmakers from both Silvermoon and Suramar, who dipped the bow into the Sunwell to imbue the weapon with astounding power. Such a gift was given to her after proving herself worthy of it, and woe to those who end up in the weapons reach, for when the energies in the bow are focused, the arrows fired at that interval cause thorny vines to wrap and tangle over it's victims. And on the other hand, the infusion of embers from Nandrea's old bow, Phoenixstrike have carried over her 'Phoenix Shot'. Which causes the arrows she fires to sometimes conjure up a vibrant phoenix that hurls itself towards it's target and explodes, singing the area around it and those caught within it, but takes a lot of power out of the bow and needs a long while to recharge it magics by drinking of ambient leylines in Nandrea's travels.\n\n{icon:INV_Sword_59:25} - {col:ff2800}Sunseeker, Sword of the Father{/col}: A rather sharp sin'dorei warblade enchanted with flames and a never dulling edge, this sword once belonged to Nandrea's father, Calidan Phoenixfeather. Often sheathed at her side along her left hip for those extra special moments when her enemies get nice and close. The sword's crossguard had a flaming rune itched into the center, causing the blade's flames to ignite when drawn from the leather scabbard. The reach and curve of the weapon met nothing but agony for Nandrea's enemies, showing that not even they are safe from the Farstrider's fury when up close and personal.\n\n-------------------------------------------------------------------------------------------\n{h1:c}OOC Section{/h1}\nTheme: Horizon: Zero Dawn OST - Main Theme: {link*https://tinyurl.com/ycqa7uz4*https://tinyurl.com/ycqa7uz4}   (For Non-TRP Users: https://tinyurl.com/ycqa7uz4)\n\nVoice Claim: Kari Wahlgren as Aranea Highwind in Final Fantasy XV {link*https://tinyurl.com/y6smgems*https://tinyurl.com/y6smgems}\n\n-Her nickname 'The Black Wolf of The Ghostlands' is one that's kind of recognizable by the military folk of Silvermoon, like the Blood Knights and her fellow Farstriders, and there would be whispers of that nickname amongst the higher crust of Thalassian society, so feel free to have them recognize/remember hearing of that moniker or the one who bears it.\n\n\n-If your character is a Nightborne who witnessed the Dusk Lily rebellion in Suramar, feel free to recognize Nandrea, for she had her own hand in that conflict.\n\n-Nandrea is often seen traveling with her trusty owl, affectionately named Hootie, if not him than she accompanied by her black raptor Umbra, her panthara Eranu, Her Frost Wolf, Snowfang or her black Vulpin, Vix.",
