						["TX"] = "When Ceedina was a child she was always smarter and stronger in her class which led to her being bullied and picked on but she always knew a way to stay strong. she was a very loving kind soul to all those who surrounded her with love. when she was younger she was left alone all the time while her mother and father went to war, but one day that all changed when the soldiers came back and Ceedina was waiting for her mother and father to appear, but one of the soldiers came up to her with her mother's blade and her father's necklace with a picture of both of them Icoked away inside. she took the belongings and went back home home bawling her eyes out, she got so fuled with so much anger that she swore she would seek vengeance on the\nkiller who killed her parents. As time went on and she grew up to a beatiful young woman, she would practice day and night to get placed high in command of the next of the next army to be sent out, she was a very poweful killer and nobody stopped her or dared to step in her way. after she came back from all the battles, she would goto her favorite spot and read or hum a song her mother would sing to her before going to bed. One day when she was sitting in her favorite spot she noticed a good looking blood elf but she would hide before he noticed her. He would one day find her sitting alone in her spot and took her hand and introduced himself and she fell madly deeply inlove with him, he would show her the world that no one has ever done, he gave her a flower that she would keep in her hair. They loved each other so much that they got married and thought nothing would ever come between them until one day he didn't show up to where they were supposed to meet, she then knew that he vanished because she asked everyone\naround town and no one knew where he was. she went to the feild of flowers where they first met and sat down crying holding onto what she had left of him, she held the flower and a picture of both of them she would then look back on the good days and then spoke up to the sky like he could hear her and told him \"i will never foregot you love and never let go of you and and..never take off this ring you gave me dear...I LOVE YOU!\" (she was the leader of the army in scourge invasion)",
