					["4"] = {
						["AC"] = true,
						["TI"] = "Weeping Blades",
						["TX"] = "These ancient, ragged blades have been poisoned so many times that a film of oily green-black death clings to the metal, the occasional fallen tear landing with a hiss.",
						["IC"] = "inv_knife_1h_felfireraid_d_01",
