			["about"] = {
				["T1"] = {
					["TX"] = "\n{h3:c}{icon:inv_tabard_a_90nightfallen:25}{/h3}\n{h3:c}{col:FF7F00}Player Information{/col}{/h3}\n{p:c}{col:ffffff}All forms of RP are encouraged! Player is 21+. Very quick typist, very patient with slow typists. Feel free to tell me to shut up and let you post. LGBTQIA+ Friendly. Tends to default to para/sub-para RP but will attempt to mirror your preferred style. Message me if your storyline or scene needs a thief! Feel free to whisper me if you'd like a shared backstory, or if you would like to have known Catora through her associates among the Irontide Pirates, smugglers, gambling rings, underground fight clubs, black markets, or via her former master- a sethrak trader named Sekriss.{/col}{/p}\n{p:c}{col:ffffff}Always IC all the time, except when explicitly marked.{/col}{/p}\n\n\n{h3:c}{icon:inv_knife_1h_artifactskulloferedar_d_03:25}{/h3}\n{h3:c}{col:FF7F00}Physical Description{/col}{/h3}\n{p:c}{col:ffffff}Cat is of average height for a vulpera, with a fit build. She has bright blue-green eyes and large pointed ears pierced with several gold earrings. Scars are visible where her skin shows through her armor, and several notches have been taken out of her ears. Her interest typically wavers quickly and she can be found peering around at nearby things or people, with a preference for obvious signs of value.{/col}{/p}\n{p:c}{col:ffffff}Her armor and equipment are ragged and old, patched together out of spare odds and ends she has been given or found (or \"found\") throughout her life. Among them are pieces of Alliance and Horde equipment alike. She is strung with spare throwing knives and good luck charms, including an elaborate soulcatcher hung from her belt that she is never separated from.{/col}{/p}\n{p:c}{col:ffffff}Her weapons are clearly ancient, a pair of wickedly sharp, curved daggers. Years of applied poisons cling to their surfaces in a film of oily black death, the occasional drip landing with a faint hiss. Eldritch energy has been imbued into the blades, the distinct sense of having been created far from where they have found themselves now.{/col}{/p}\n\n\n{h3:c}{icon:inv_stave_2h_deathwingraiddw_d_01:25}{/h3}\n{h3:c}{col:FF7F00}The Shadow's Daughter{/col}{/h3}\n{p:c}{col:ffffff}Those capable of sensing magic such as demon hunters are able to detect a strange enchantment clinging to Catora, though she is no magic-user. Her movements occasionally flicker or stutter with licks of flame, particularly when performing intricate sleights of hand as if she's a half-step out of sequence with her physical form, and her spirit has been bolstered by an ancient, near elemental power. There is no clear root to this gift, though it almost feels as if she is being shadowed or protected- the blessing of a distant patron manifesting as her unnatural abilities.{/col}{/p}\n\n\n{p:c}{col:FF7F00}Thank you for reading <3{/col}{/p}\n\n\n",
				},
