			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Insignia of the Horde",
						["IC"] = "inv_60pvp_neck1a",
						["TX"] = "Thekra wears an embellished set of worn dogtags around her neck. She has seen many battles in the name of the Horde.",
					},
				},
				["ST"] = {
					["1"] = 4,
					["3"] = 2,
					["2"] = 1,
					["5"] = 3,
					["4"] = 1,
					["6"] = 0,
				},
				["v"] = 14,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\Arch-Race-OrcBIG:256:512}\n\n{h3:c}{col:960c11}{icon:inv_conquerorifazeroth_horde:40}Appearance{/col}{/h3}\n\n{col:FF633B}Despite her small stature and preference for ranged combat, Thekra is a warrior through and through.\n\nUsually clad in heavy armor, much of her physical appearance is often concealed. She is built sturdily with thick musculature and a hardy physique well earned. Years of wafare have made her rugged and worn, and her skin bears the scarring to prove it.\n\nHer features are more broad and squared, lacking much \"feminine\" charm. Her tusks are longer and more pronounced than some females, and her short crest of deep green hair doesn't do much to add to her appeal. Sharp, crimson eyes always seem to be watching... and judging.\n\nTraditional Warsong tattooing maps her skin, set deep in her pale green hide. Little bones are pushed through her earlobes and through her septum, but aside from this she lacks any real ornamentation- it would just get in the way when fighting.\n{/col}\n\n\n{h3:c}{col:960c11}{icon:warrior_skullbanner:40}Personality{/col}{/h3}\n\n\n{col:FF633B}Brash, curt, and stubborn as a mule, Thekra is not an easy orcess to get along with. She speaks her mind and does not hold back her thoughts or opinions. A natural seeker of thrills and challenges- she always seems to be getting into more than she can handle... and somehow living to tell the tale.\n\nShe lives for the thrill of battle and the hardship of war. Forever seeking honor and glory- she is a proud Warsong.{/col}\n\n\n{h3:c}{col:960c11}{icon:inv_banner_tolbarad_horde:40}History{/col}{/h3}\n\n{col:FF633B}A veteran of many battles, a familiar face on many warfronts, and a proud soldier, Thekra has spent much of her life consumed in warfare. Her only living family is her younger brother, her parents having died.. less than honorably. For further details... one would have to get to know her.{/col}\n",
				},
