			["time"] = 1631153680,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{p:c}{icon:inv_misc_bell_01:25} \"Jingle\" {icon:inv_misc_bell_01:25}{/p}\n\n\n{p:c}{icon:ui_calendar_freetshirtday:25} {col:54c3ff}Clothing{/col}{/p}\n\nShe wears a very clean and neat blue gown.  Drapes down just a few inches from the ground so that it doesn't drag on the ground.  She has a blue sash tied around her waist with a small pouch hanging from it.  Wearing some knee high socks with the feet cut out of them.  Starts just above her ankles.\n\n\n\n{p:c}{icon:inv_staff_2h_newplayer_a_01:25}{col:ff6157}Staff{/col}{/p}\n\nCarrying a simple, carved wooden staff.  An cat carved into the handle with a 'collar' holding a little chime around the cat's neck.  A worn blue silk wrap around the center, tied with a pink ribbon.  Along the staff are small etched names. \n\"Jenn\"\n\"Victor\"\n\"Mary\"\n\n\n\n{p:c}{icon:inv_misc_nativebeastfur:25}{col:308e2f}Fur{/col}{/p}\n\nThe small vulpera's fur nearly shines in the sunlight.  Very well taken care of.  Even smells strongly of pandaren soaps and herbs.  A mix of red and white with a small hint of black along the tip of her right ear.  Very soft to the touch.  Her tail could be soft enough to use as a pillow.\n\n\n\n{p:c}{icon:spell_holy_fanaticism:25}{col:a856b6}Everything Else!{/col}{/p}\n\n-When she speaks to someone, she's very polite.\n\n-Her staff jingles when she walks.  Always.\n\n-Her ears are ALWAYS twitching in all directions.\n\n-She has a silver heart locket around her neck. (whisper for more info if you want)\n\n-Two silver earrings in each ear.\n\n-She walks slowly.  For those in a hurry:   BEWARE\n\n-On the inside of her left paw is a small branding.  (Bilgerats may recognize it as a slave marking)\n\n-SHE'S A VULPERA!\n\n\n\n{p:c}{icon:trade_archaeology_delicatemusicbox:25}{col:000000}TOONS{/col}{/p}\n{link*https://www.youtube.com/watch?v=ZiCx58pAycA*Zelda stuffs :D}\n{link*https://www.youtube.com/watch?v=3EsoFSLIHIg*More Zelda.  cuz it good stuff}\n\n",
