			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PVPFrame\\Icons\\prestige-icon-8-3:128:128}\n\n{h1:c}{col:bca95b}º The Stage is Set. º{/col}{/h1}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{col:5b973a}Born as part of a wealthy family in Gadgetzan, Zyrept had a childhood that few could brag about. Riches and luxury as he wished. Although, said life was brief, as the merchant family soon ended up in a huge debt and by mysterious accidents, the fortune and name was brought down, aswell as even some of the families lives, that is.\n\nThe orphan now was taken by a friend of the family to live away in a secure and reclusive place. Always keeping in motion, his protector took him to the Darkmoon Faire, where the Goblin grew up learning circus arts, even more those focused at fire juggling and fire dancing.\n\nAlways a supersticious one, once per month the Goblin checked out his fortune with fortune tellers that lived in the Faire. Every month, the same fortune was given, mounds of sands, eternal heat, a prize to be taken, only after the flames engulf him while in the dry and darker woods. On his heart, there was always a concern for that, but, one night after the defeat of the Legion, there were rumors of a suspicious figure taking shelter in the woods nearby the Faire.\n\nZyrept and a small other group were in charge of investigate it, the travel didn't led them far, as when they reached out the depths, they would be greeted by a dieing Warlock and a bound Succubus to him. As if pure instinct, the Warlock assaulted the group, incinerating most of them with his dying breath. The group then attacked the Warlock, putting him out of his misery and then turning his attention to the Succubus, a fiend and yet soo beautiful. Zyrept didn't resisted her charms at first, when he saw himself, he stabbed the couple few of the group to secure the life of the Succubus.\n\nOnce she was safe, as a reward for him saving her life, she gave him a soulstone necklace and a grimoire, proof of her bound to the old Warlock, and now, on his possession. The soul of the Warlock yet still resides in it, and it's energy and the Succubus soon taught the Goblin manipulations of forbidden magic that he never even had seen before, only heard about it in tales.\n\nHe turned his back on the Faire on the same night. Knowing he would be probably persecuted, he fled back to the desert of Tanaris, where he met a caravan of travelling artists. A wandering circus per se. With that, he and the group began to travel distances making small fortunes and presentation, which one day, led them to the sands of Uldum.\n\nIt was common to apply scams with street arts, pickpocketing people, stealing relics and gold. But this time? This time none of this worked. The people of Uldum, unique and fearsome, mistrusted their intentions on the very beginning, and on the first scam caught, the whole group were tossed deep beneath some haunted tomb to die and be consumed by the spirits in there.\n\nZyrept was the only one that escaped. A tale that once asked? He always offer a different story. Once thing is for certain, he escaped certain death while the others did not. And left the tombs with old jewerly and an unique shortsword.\n\nOne may only wonder what transpired inside these tomb and what lies ahead, for the Goblin.\n\n\n{/col}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{img:Interface\\PVPFrame\\Icons\\prestige-icon-8-1:128:128}\n\n{h1:c}{col:bca95b}º Appearance º{/col}{/h1}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{link*https://tinyurl.com/yxtvbvhe*Art done by the amazing AccessInvalid!}\n\n{col:ffcfb1}Standing at 3'9 of height, the Goblin was one exemple of height that his kin can reach to. His blonde is well kept and clean. Seems like he do pay attention to his looks.\n\nDown to his face, the Goblin would have an oddly calm one, moving from the large forhead to the prominent chin. The nose was large and pointy as many of his kin, of course, it was large, while the tip was slightly upwards, giving him a certain disdainful natural expression, even more when he smile.His ears are large in size, floppy and with a proper arch upwards. without any single adornement, even if there's a bit missing at one ear, a wound long healed. His eyes are purple, a pale coloration of purple, which only assist the whole possible-friendly looking from his part.\n\nAs for his body, the Goblin's skin is of a dark olive green coloration. Not covered by any scars or whatsoever. Arms have hair over most of it's extension, thin hair and black that is barely noticable if you don't pass your hands over it. If one would see Zyrept without his clothes or armor? Would see that the Goblin's body is toned. More then his arms allow people to see. Owner of a natural strenght developed over the years of intense labor and fighting, the muscular frame makes him an obvious strong speciemen of his kind, even if once again, there was not a signal of scars over his whole body.{/col}",
