			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}{icon:ability_rogue_findweakness:25}History {icon:ability_rogue_findweakness:25}{/h1}\n\n{col:ffffff}\n\nIzi'fon was born on december 10th. His life was a difficult one and he wasn't given the best hand. He was born the illegitimate child, and never met his father. His mother took care of him alone and was one of the lower caste Trolls. She had not a place to stay, nor a table to put food on.\n\nBut she took care of Izi. She made enough money through different methods than usual, she played street games. She usually rigged dice and whatnot to make money, only moving a few corners down the street if people found out of her plans. Once Izi was old enough to walk and lift things, he was sent to work.\n\nThe Troll usually did heavy lifting on the docks or cleaned up the dino crap on the streets when needed. but it wasn't a good way to make money at all. Izi one one of his workdays found a poster down by the docks. It was a bounty poster. It tasked the people to bring in the head of a certain Zi'kel, the reward was a measly ten gold for a dangerous man. It was a horrible deal to say the least.\n\nIzi set out into the jungles, wanting to make his mother proud and he somehow succeeded in killing the target, he brought in his head and his mother praised him for his deed, mostly just paying attention to that ten gold though.\n\nAs the years went on Izi took on more and more bounties, when he was fifteen he was a full on bounty hunter, one of the most reliable ones Zandalar had.\n\nThe only thing holding him back was his dear old mom, taking each and every single copper that he made during his bounties. He was fed up and thought he had given his mother plenty of chances to move on from this lifestyle and to stop wasting what they had earned. He left her on her own after a massive arguement in his mid teens.\n\nLife was looking up for Izi after this point. he was making plenty of money by himself, but he was a strange Troll by all means, he never went to the city and spent all of his time in the jungles, hunting or in his cave. His only appearences in public were so that he could collect bounty posters and turn in targets. He became \"Izi'fon\" the strange, flirty, button pusher but smart when it came to taking down his targets.\n\nOnce the Zandalari empire had become allies with the horde he made his way straight to durotar, excited for what his new allies had to offer him, new work? New people to bother? That's all he could ever want.\n\n\n\n\n\n\n\n{/col}\n\n\n{h1:c}{col:ffffff}Extra stuff{/col}{/h1}\n\n{col:ffffff}\nIzi is an extremely skilled bounty hunter, if your character has a bounty on them that will bring in a noticeable sum of gold, he will most likely know about it, feel free to whisper me about it if that's the case!\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n{/col}\n\n",
