		["0510133917RzB4e"] = {
			["data"] = {
				["TX"] = "\"You aren't malicious~?\" the frail soothsayer asked, narrowing his blinded eyes as if distrusting his own words. The clutch of claws loosen from around the grip of his staff, planting the butt into the ruined tile floor.\n\nThe shadowy creature draped in cloth quietly chuckles, extending a hand toward the curious vulpera. The creature's voice came with a low hiss before words came to formulate. It hums, \"I was once a being of pure righteousness. Now, I stand as a guide to those that may be lost.\"\n\nWith a tilt of his head, the soothsayer stares then suddenly bursts into laughter! \"Gah-ha-ha-ha! You~? A being of holy energy~!? You've~ fell from grace, have you NOT?!\" the vulpera said, leaning toward the shadow bound creature.\n\n\"All life must endure the same mortal coil. This is but another phase in my own cycle of existence. From brightness to shade, I am still committed to my duties,\" the creature nods, clasping hold of its own hands.\n\nWith an interested hum, the vulpera edges closer and beckons, \"Come closer, friend~. I can respect those who can uphold their words! Duty~. But your purpose is different?\"\n\n\"You are correct. I stand here in this ruined temple acting as a beacon to those that have lost their way. I show the correct path for those still seeking to end the cycle.\"\n\n\"What of undead~?\"\n\n\"An act against life itself.\"\n\nA large grin curled to either side of his maw, staring towards the lanterns that dangle from the creature's shoulders. \"We may have a lot in common, friend~. Mind if I sit for a while. Feet hurt! And I'd love~ to hear some more of your life. Not everyday I can meet a being such as you...\"",
				["read"] = false,
				["IC"] = "creatureportrait_darkshoreboat",
				["TI"] = "\"Beacon of the Lost\"",
				["NA"] = "Ferryman",
				["BK"] = 1,
				["v"] = 8,
			},
			["PE"] = {
				["1"] = {
					["AC"] = true,
					["TI"] = "\"Come into the Light...\"",
					["IC"] = "inv_helm_misc_candle_a_01",
					["TX"] = "Dim flames hardly illuminate the ground before Thokkath. Perhaps the laterns were meant for those wandering a wayward path...",
				},
				["v"] = 2,
			},
			["links"] = {
