		["0706191259Qa2tw"] = {
			["PE"] = {
				["1"] = {
					["AC"] = true,
					["TI"] = " ∂ ° — † — ° ∂ ",
					["IC"] = "inv_jewelcrafting_70_gem01_purple",
					["TX"] = "                   •∙ † ∙•",
				},
				["3"] = {
					["IC"] = "ability_fixated_state_purple",
					["TI"] = "II. Baby Violet.",
					["TX"] = "† — » ••••••••• \n\nMauve is no creature to be feared, she's very sweet. Her large, glowing purple eyes, all three of them, are in the shade of a glowing amethyst crystal, they're not deceiving, nor aggressive looking. She's like... a worm-y puppy.\n\n                                        ••••••••• « — †",
					["AC"] = true,
				},
				["2"] = {
					["AC"] = true,
					["TI"] = "I. Impacted.",
					["TX"] = "† — » ••••••••• \n\nWhen threatened, Mauve will extract her poisonous barbs hidden under the skin upon her back, this poison isn't necessarily fatel, but can be if those with weak immune systems are attacked, otherwise, the symptoms of her toxin can cause hallucinations, vomiting, diaherra and or dryness to the throat and eyes. \n\n                 No known Antidotes currently.\n\n                                        ••••••••• « — †",
					["IC"] = "ability_deathknight_marrowrend",
				},
				["5"] = {
					["IC"] = "inv_jewelcrafting_70_gem01_purple",
					["TI"] = " ∂ ° — † — ° ∂ ",
					["AC"] = true,
					["TX"] = "                   •∙ † ∙•",
				},
				["4"] = {
					["IC"] = "ability_ironmaidens_darkhunt",
					["TI"] = "III. Over The Shoulder Girl.",
					["TX"] = "† — » ••••••••• \n\nMauve is usually, if not always, seen on Shakei's shoulder. Her grubby self is usually napping or munching on some sort of plant, specifically on Shakei's right shoulder. Occasionally she'll be the extra eyes for him when out of town, she's known to stare.\n\n                                        ••••••••• « — †",
					["AC"] = true,
				},
				["v"] = 32,
			},
			["data"] = {
				["IC"] = "ability_creature_poison_01_purple",
				["read"] = false,
				["NH"] = "6947ff",
				["TX"] = "{p:c}{col:6846FF}While she looks like a grub from Ardenweald, she's completely the opposite, her location of creation seems to be unknown, but that doesn't stop her from being a common lap pet to Shakei, despite how dangerous he makes her out to be, sweet on the outside, deadly on the inside.{/col}{/p}\n\n{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:500:3}{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:200:3}\n{p:c}{col:6846FF}Mauve is not only a pet, but a current test companion for Shakei when it comes to bug toxins, while Shakei is no stranger to the toxins some bugs and critters can produce, her toxin are.. unusual, and peak Shakei's interest beyond his own capability. While he's more than happy to let others hold her, and pet her, and spoil her, he -will- tell you to wear gloves. for your own safety.{/p}{/col}",
