		["1018154028dFQSz"] = {
			["data"] = {
				["TX"] = "\"No, no! Easy!\" the tauren said, extending his hand toward the vicious snarl of an oversized brute of a black bear. It was difficult to make out the surroundings as the forest was unusually dark. Though his hand was fixated toward the bear, it was more than just a means to keep the creature at bay. An attempt to soothe the creature was made through with little luck.\n\nHe knew that look, that sudden hunkering down before an unruly charge. \"Oh. Oh, no.... No! Bad!\" he stutters before letting his palm fall, making an attempt to scramble behind something. A dash of his own left his hooves to sleep upon piles of dead leaves and withered bark. A quick leap grants him a bit of shelter behind a rock through the silence of the bear brought him a bit of concern. The tauren blinks, looking about, carefully rising to peer and scout the area.\n\nAt the same time, almost comically, the ursine managed to poke his head toward the tauren at the exact same time. There he was, inches from his face, a sneer growing across his maw. The bull then took a deep breath and slowly backed away from the giant rock. The bear didn't follow. Instead, the march of the beast came to circle about as if claiming the area. Once understood, the animal began to nudge and bump into a nearby tree that had a familiar hum and insect murmur.\n\nFrom atop of the dead sylvian came falling a lively beehive. The spoils were all for the bear, though he was distracted enough to allow the druid to work his natural abilities. Like before, his palm lifts and attempts to soothe the beast. It wouldn't be hard after all as the brute was munching down on a combination of insect and honeycomb. After the successful bond, the bear then approached the druid with what remained of the hive. It wasn't much, but perhaps enough to make a peace offering.\n\n\"Ah, thank the Earth Mother... Thank you, friend. You scared me. I meant you no harm!\" he tries to explain, though the beast couldn't reply with words. Instead, it huffs and resumes the patrol for more sweet, tasty delights. Of course, the tauren would follow close, hoping that bear would share a few more conquered wild bee colonies.",
				["read"] = false,
				["IC"] = "inv_misc_bearpaw_black",
				["BK"] = 1,
				["NA"] = "Big Double",
				["TI"] = "Hive Tracker",
				["v"] = 3,
			},
			["PE"] = {
				["1"] = {
					["IC"] = "ability_tracking",
					["TI"] = "Absolute Utility",
					["AC"] = true,
					["TX"] = "No question that Big Double was a big boy! An ursine such as this would need a decent size to haul around a full grown male tauren. Thankfully, he didn't mind much as his reward for travel was usually honeycomb.",
				},
				["v"] = 9,
				["2"] = {
					["AC"] = true,
					["TI"] = "\"Nose, knows,\"",
					["IC"] = "inv_cooking_80_choralhoney1",
					["TX"] = "Aside from being a mode of transportation, the bear had other skills. That nose of his could track a beehive from miles away! There was a reason why the tauren tamed the beast after all.",
				},
			},
			["links"] = {
				["Sweetnectar-WyrmrestAccord_288438"] = 1,
			},
		},
