				["TX"] = "Bekrash found Toast during one of his many visits to the Firelands. She's just a wiggly little Cinder Pup for now. Someday, she'll grow up to be a big strong Fire Worg!\n\nShe's got a wiggly butt, and a bushy little tail that goes swishy-swishy over the floor. Her legs are a little stumpy, but that's ok, because she'll get bigger, and her fur is very VERY warm, but not hot. Also it glows and shimmers like embers. Her eyes are dark, large and shiny looking, with an inner glow like coals. Her paws are very small and soft, and they pitty-patter quietly as she walks around.\n\nHer nose is constantly sniffing the ground and the air as she takes in all the smells the world has to offer her.\n\nBekrash has sworn an oath of BINDING, that if ANYTHING were to ever happen to Toast, he will kill the whole, entire multiverse and then himself.\n\n2-25-2021: Toast makes her first kill. She protects the farm from a virmen going through Bek's crops.",
